{"review_id":"K-wdPGHbErfxbKK6PetrmA","user_id":"FCoXqPxuI7GRBYyzJIwVxw","business_id":"r4HkiC71nB9k8Fe8zIORFQ","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"First time eating there and everything was so yummy! Great pizza and Salad, my son had the meatball sub he said it was very good, must have been because he wouldn't share. Highly recommend.","date":"2015-12-05 02:16:06"}
{"review_id":"01DNCgnW8K6xSyv4krYa1w","user_id":"XivuRnPq3D-K5cPiBTztIA","business_id":"oyjkEn5fAqcGNsBbqc8LTw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Just... not good.  We want it to be - we have been several times hoping, but the experience is always at best, lackluster.  The food is not great, very run-of the mill on a good day and the serve staff though very nice is always - and I have never had the same person twice - always totally lost and under-trained.  It blows my mind because they can't possibly know alcohol laws if they don't know anything about the menu - going to bite that company one day.  I am not sure but I think someone I know told me they do the shared tip thing and I thought maybe that may be why but I know another place that does that and the service is excellent.  I don't know what the problem is - I have worked in the industry before while in college and I would say front of the house training needs big overhaul.  At any rate, they have lots of TV's and it is closer to us but just plain not good.  I wish they would switch locations with Wild Wing Cafe - also chain-y but much better food and service.","date":"2016-04-11 16:42:13"}
{"review_id":"WGbtqQMeJwTVg6DFb156EQ","user_id":"K5MSNpwRf0xKQSaC6gK9Cw","business_id":"PL3cimEUfNHlenOGSOAdJg","stars":4.0,"useful":3,"funny":0,"cool":1,"text":"This was our choice, by default, for New Year's Eve dinner this year. See, we chose not to make reservations, but instead just wing it and see where we could get in. They had some early dining availability, so we jumped on it. Their special New Year's \"Paint the Town Gold\" menu did not disappoint.\n\nLocated in the beautiful Mandalay Bay restaurant row, Kumi is a gorgeous display of style and food artistry. Every course was surprisingly delicious, and plated interestingly.\n\nService was very good, seriously on point. Right up until the dessert course...after 30 minutes of waiting for it, we finally requested the check as we had an event to get to. One of our attendants felt bad and offered to quickly grab it for us but we were in danger of being late so we opted not to take him up on it. \n\nIt's a beautiful, albeit very pricey experience for dinner. We would return for special occasions only.","date":"2017-01-02 05:24:56"}
{"review_id":"PTk6YHmk2U7X-A7Js-VtNA","user_id":"bVwp0gnz3YxpJqSfXZrONg","business_id":"YyxB3K1ORzc7ChMKgyxm9Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The employees are so friendly and hard working! Keep it up! The store is very clean... I love subway sooooooooo much!!! :)","date":"2014-10-27 04:30:55"}
{"review_id":"NHQWhZve7UEaGLt7IwAyDw","user_id":"H3wPBzQCKCKiHcV7GZK4kg","business_id":"LkMtMHVetws5_7QfRjPtlg","stars":2.0,"useful":5,"funny":3,"cool":4,"text":"This actually used to be one of my favorite hotel\/casinos back in the day.  Oh, how things have changed.\n\nThere are some goods, however.  If you are a conventioneer, you have instant and direct walking access to the main convention center.  But don't think about parking here for said conventions.  $30 a day for parking, Hilton?  Seriously?  That's robbery.  And greed.\n\nThe biggest disappointment is the killing off of Star Trek: The Experience over two years ago.  Despite this place being off-Strip, I made it a point to go here because they had such a fun and unique attraction here.  It would be one thing if they had something in mind to replace it, but either poor planning or the economy.... It's dead, Jim. \n\nThe \"Space Lounge\" is still there.  An entire casino area with a heavy sci-fi theme to it.  Except there's no casino here.  It's a huge space themed area with a ghost town bar, no slots, a few couches, a makeshift stage, beer signs, and a few remnants of Star Trek themes.  All of this space, and nothing.  No life to it.  Couches and beer signs only make the emptiness and waste of the area seem more empty and pathetic.\n\nWith their main draw gone, what has replaced it as the headliner?  Benihana's.  Nothing wrong with the restaurant, but it's hardly unique or exclusive, even in Vegas.  The Hilton has a Pizza Hut Express here too.  Maybe they should promote that as their \"big draw\" on the marquee as well.  A huge Benihana sign covers up the old entrance to Star Trek.  With couches pushed in front of the entryway.  Again, just sad, and I'll be a big man in saying that they kind of broke my heart getting rid of one of my most beloved hang-outs here.\n\nThe arcade is dead as well.  Another blanketed off space that sits and collects dust.  Again, with two-plus years, no suitable replacement has been found for anything in this section.  A few shops that fluctuate, but that's it.  This is a lot of dead space to go unused.  \n\nThere's also the issue of the Men's bathroom in the main casino area.  Above every urinal is a picture of a lust-crazed girl staring over your bits with a camera, magnifying glass, tape measure, etc, while you pee.  The first time I saw this, it was \"ha ha\" funny, then when the laughter died, it just turned creepy and weird for me.  I actually selected a urinal based off which girl creeped me out the least.  She merely looked like she was casting spells at my nethers.  I could live with that.\n\nLadies: I must know.  Is there something like this in the girl's restroom?  When you close the stall door to do your business, is there a picture of some crazed guy making grabbing motions where your boobs would be?  Please message me and let me know.  I'd really like to know what the Hell you get in your bathroom after my gender's discovery.\n\nAs critical as I am being, there looks to be some sort of steampunk-themed club called \"Triumph\" there.  I want to check this out.  Atonement for the death of my beloved Warp Core Breach booze bowl?  We'll see, but it's going to have to be pretty good to replace the hole in my heart from that much booze for so cheap a price.\n\nThe sad part is, Hilton's one of those \"history rich\" casinos here.  Look up the history on this place.  A lot of awesome stars and vintage Vegas stuff happened here, which makes you wonder why this isn't represented more.\n\nThis place is great for convention visitors to stay, but that's about it as far as I can see.  They need to figure themselves out for everything else.","date":"2011-01-09 00:09:50"}
{"review_id":"x7g2FrewC9Qpq1y7q7UCwA","user_id":"nVK00oKUk4asStkaOR09uw","business_id":"ZbHE1ZncONeH-q93GuVGdA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Horrible- Unclean, rancid, foul odors, unkempt, and poor service. The restaurant was nearly empty, and the cashier didn't even look up to say hello as my husband stood hungrily grinning at the counter. Needless to say, I talked him into driving up the road to the other location. This one is unacceptable.","date":"2017-10-02 03:18:11"}
{"review_id":"2mLlQ9n5Ln_fykOuX_b0-A","user_id":"EZ6g9a17UdMjtR-wrZebmA","business_id":"wSAGILK2CFbq5BVZ5D67-A","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"The service is attentive. The decor attractive. But the menu is far too doused in polenta and paprika. The fingerling potatoes? Drenched in paprika. The aioli?Mixed with paprika. The appetizer? Fried polenta. The fish? Polenta crusted. It's worth a try. But be forewarned. The chef must shop at Costco.","date":"2015-06-21 00:07:59"}
{"review_id":"gbibui7sKs7QUTu5pF9TRw","user_id":"B03NtjnS1Ca4vHPN4S8s-A","business_id":"JHyv6TwbNfIcjpos8_espA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"This is a wonderful nail shop! Eric the owner is so hospitable, he takes time and effort on your nails to perfect them! I love my nails, they're so cute and symmetrical. Definitely will be coming back to this spa and salon! If you're thinking about going, Don't even question it, just go!","date":"2015-07-28 07:19:02"}
{"review_id":"-cRD6URpwks2GvP6qy8x4Q","user_id":"6UR0kNe3C-ivlF2x1fPHNQ","business_id":"WUmosjOxt_8nWByHgm8Kkg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Who knew?\n \nI did! \n\nI remember eating many many many times way back in the early childhood of Chipotle back in Denver. Like the picture on the wall in every Chipotle. (yep on evans and university) I had a feeling this place was going somewhere and Chaching!\n\nAnyway, long story short, as we all have eaten at a Chipolte somewhere. It simply is the best quick healthyish mexican there is period! \n\nOn a side note if you are one of those wierd vegan people this is my favorite burrito (veggie fajita black w\/ all the salsas no queso or crema greens and of course 3 lbs of guac!) Yuuuuuuuuuuuuummmmmmmmmaaaaaeeeeeee!!!!!","date":"2011-01-08 23:13:25"}
{"review_id":"Ymb8ZYPg2e8dvqhdj3Gkqw","user_id":"hHFSpKcnDtJOs6M-JKFZ8Q","business_id":"oCvxJBOs-Mbg-4oanPO7lQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"The ingredients are always fresh and I like that I can customize everything. The price for the pita\/salad is reasonable, but after the delivery fee of $3, it can be pricey. Definitely a great option if I forget my lunch at home.","date":"2016-10-26 14:53:42"}
{"review_id":"nQxoDWJ5kIwjYZhFILqVWQ","user_id":"lJBI50awi0N8qvX4PKzH7Q","business_id":"3n685UjMonF4fjBcILXkJg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Room was very clean.  Staff was exceptionally nice for a mid-level hotel.  It had a parking lot right out the front door.  The free breakfast seemed generous (I didn't partake).\n\nWhat more can one ask?  \n\nI'd stay here again.","date":"2017-08-16 11:21:42"}
{"review_id":"Qee78a9rXvSfyVhCO9EK7A","user_id":"NFebN50n-oXI7xgjP-Qixw","business_id":"k1c_bC3DK6mKg797vH1T8w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"A very busy restaurant, make reservations, but well worth it.    Our party ordered the short ribs, salmon and steam bass for our main entrees and each dish was outstanding.   Will definitely go back to this restaurant when we are back in the Phoenix area.","date":"2015-03-18 17:46:46"}
{"review_id":"TkcxD1A4N_9kRZwGhUjDKA","user_id":"bgG0jJyUXta_kczGrQW2Rw","business_id":"7EZ4Eu7YJ1ltRCC5jXFJrQ","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"There wasn't one specific thing that made this buffet so horrible... It's just the accumulation of everything being less than average quality. There are plenty of options, but none of them were flavorful, hot, or worth filling up on.\n\nSome others have commented on the dessert section being worthwhile, but to us everything tasted unthawed and on the stale side. The Asian section had probably the best offerings but all were still fairly bland.\n\nThe worst part is that when I was going to grab a slice from the pizza station, someone had placed the tongs directly on TOP of the pizza... So all the hand germs were in direct contact with the food! There were two workers right there who didn't think this was disgusting.. I would have discarded the slices.\n\nMy husband and I both left with unsatisfied stomachs and looked forward to the second dinner we would have a few hours later at a much better establishment.","date":"2013-04-10 16:19:12"}
{"review_id":"vPDLvkNLtyiBTRbt-wIeLw","user_id":"QIy3iLXjBUBqRzwd2lnWGQ","business_id":"_ZfjpSEO5ntk-1hbnwCR4g","stars":3.0,"useful":5,"funny":1,"cool":4,"text":"I stayed here back in April. Friday-Sunday. It's a nice hotel and the room had a great view. This is just another building that is part of the Palms. It has no casino and is just used for rooms. \n\nWe had the two room suite with 3 bathrooms, and 2 full kitchens. The main bathroom had a huge shower. I swear you can fit around 12+ people if thats what you want to do ;) They also have a tub in the middle of the room so you can watch your girl take a bath? lol The place was beautiful but was it worth the $2000?? I'd say yes, but the only major downside is that it's far from the strip. Would I do it again? Probably not since you can get a nice suite for the same price at a nice hotel and be on the strip. Another downside was that you cannot go out onto the patio. They lock all the sliding doors. That was a big downside for me!","date":"2012-08-15 01:33:11"}
{"review_id":"o3kyWgk5ZMW1KlLw6-tv2g","user_id":"FmQxARdHGnkclvcVWGEAxw","business_id":"VnOGWODJ7ZREYij0rpB-Xw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Had brunch here Sunday with a friend. The meal was very good. I mean the options were limited but over all a solid brunch! I've only come to Brewsters on one other occasion so I can't speak to the service before as it was at another location in Calgary. The place wasn't busy. The staff was rather slow but the food was good so no complaints on that.\n\nI had the southwestern omelette and I LOVED the salsa inside it was so yummy and really added a nice touch to the meal. Prices were also fair. I decided to branch out from my usual egg benny. It was a nice change.","date":"2013-11-14 05:08:28"}
{"review_id":"HftK8hqRDgmgchNLlpqJHQ","user_id":"Arf9ddxVvO3PsmdZlPBDyA","business_id":"YJ2Y_asLIlbo-uijVugLow","stars":5.0,"useful":0,"funny":0,"cool":2,"text":"As a spicy food fan, when I see a restaurant called Hot & Spicy, I add it to my must try list.\n\nI decided to give Radica's a shot shortly after seeing the title of the restaurant. On first glance, the restaurant was super clean and new. A really nice environment for a fast food style joint! \n \nBetween my fiance and I, we ordered two roti's - one spicy chicken and the other a medium goat roti. Oh boy, the roti's were awesome! Fresh, packed with flavor and actually spicy.  Portions were huge as well! \n\nWe also tried a shrimp double. This was my first time trying a double. It was ok, but the real star of the show was the roti's.\n\nIf you're looking for genuinely good roti with a kick of spice, I'd say this is the spot!","date":"2015-06-08 18:24:07"}
{"review_id":"nAm92_-WUQ084x9Uz9iFmA","user_id":"iFEM16O5BeKvf_AHs6NzUQ","business_id":"9Eghhu_LzEJgDKNgisf3rg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Was super excited to bring my boyfriend to this Scaddabush location after going to the Richmond Hill location months back with friends and have been craving their mozzarella balls ever since! \n\nWe arrived and were seated at 8:15, and since reviewing the menu before hand, we placed out order with our waitress right away. We ordered the 'Naked' mozzarella to start and for mains the Penne Bolognese and Margherita pizza. \n\nThe waiting game was okay, we got our appetizer about 25 mins of waiting. Once arriving, the first thing I noticed was how small the mozzarella ball was compared the he Richmond Hill location. However, it was delicious ! I was reminded on why I chose this restaurant for dinner. \n\nAs for the mains, we waited and waited and waited. We had seen a male (possibly manager?) walk around with pizza slices and deliver them to some tables, however not ours. As he went to the table next to us we could overhear him apologizing for the wait time for their meals. \n\nAt around 9:05 our meals did arrive. The pizza was good,  definitely not enough cheese but will do. My boyfriend did really like his pasta. \n\nOverall, I would say I would come back to Scaddabush. Possibly just for the mozzarella balls but as our mains were just okay and nothing special, wouldn't choose this location for a full dinner again.","date":"2016-08-25 16:25:12"}
{"review_id":"a9bcki-Jt26TtUoNRGjQHg","user_id":"4xIRICDNx33zPG-CYshTXQ","business_id":"IhNASEZ3XnBHmuuVnWdIwA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"If you are looking for something refreshing and delicious, this is your one stop shop! I've tried two drinks here and their delicious Japanese styled crepe that was filled with nutella and mouthwatering strawberries and bananas. There are other options as well. Their drinks are very customizable and if you think it's not perfect even after you get it, you can get it adjusted. The service is super friendly and the aura is welcoming. It's a clean environment where all the senses are in for a treat though the mesmerizing smell from the freshly made crepes, the refreshing sip from their drinks, to the perfect texture of their boba. I'm not from the area but anytime I'm on my way to Vegas, I'm stopping by first to get my boba fix. \n\nTry the Hawaiian Paradise. You won't regret it.","date":"2015-07-16 06:46:29"}
{"review_id":"8qdikDQ0bkJj7QZa2IdvrQ","user_id":"7MXunAzrmnbBd0XQR33zaA","business_id":"nJcyfIRGbI31EGLzillWYg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"A margarita in clear plastic dickie cup??? Wtf?? The drunkin shrimp plate should of been called the goldfish feeder shrimp platter..","date":"2015-01-18 16:12:27"}
{"review_id":"xFjo0v7PmYWZRI3tK2WPuA","user_id":"jqEbD-d5iI5nrwhfMmX_5w","business_id":"8OeHn9KCbICuRBs_XiDDUA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Happy to give a strong recommendation to this place - fun atmosphere, great service, excellent food... and really loved the made-at-the-table s'mores!\n\nI recommend this for anyone who has out of town guests for a little bit of the 'old west' and good fun.  All you can eat BBQ on Saturday and Sunday during the day.","date":"2013-06-24 04:49:52"}
{"review_id":"slmv7dEs9FD3KsdbywTHUw","user_id":"Ir__fU1m6dBqgTrP3aLP9A","business_id":"KalAJyO0Zpg3K1wVwYXBHA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I have been coming to this sweet little place for years and think they deserve my compliments.\nThe food is french in a not too serious and snobbish way. \nThe wine is best enjoyed outside in the evening overlooking the \"lake\". They have live music (jazz guitar or piano) outside in the evenings most nights as well. Probably,one of the more romantic night spots on the west side. \nThey also have a fantastic lunch menu, with a lobster salad croissant that is true bliss..... mmmmmm....\nLook them up for their specials, like wine tastings and discounted days.","date":"2009-05-20 02:16:00"}
{"review_id":"T9T3PFKevNu-EhqwJF21pA","user_id":"YX1apap1DCOmOer3C9X2qw","business_id":"77KuSFMOXqRGqcV9NJjzDA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Food was piping hot, which is great!! Had the buffet...and it truly is all you can eat!! You order whatever you want off the menu (except chitlins) and they bring it out to you!!! Mac n cheese, greens, and black eyed peas were pretty good!! Fried chicken was pretty good too! Will come back!!","date":"2015-07-03 21:35:49"}
