{"review_id":"LzCJ5m9xbiSJElYfwufqqQ","user_id":"rHC67vLw-_pwoGjmEn-iQA","business_id":"u8CFMZ9rCMDvKGDyqt6MEQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"If you are looking for a fresh yummy breakfast on the weekend in Waunakee you must try Cuco's. They have your traditional American breakfast choices or some tasty Mexican dishes. The food is fresh and comes out sizzling hot. \n\nThe service is excellent and the restaurant is very clean.","date":"2017-05-13 15:10:59"}
{"review_id":"3tsmExxS5NYBgqVfl2JOyg","user_id":"ica-FXNzyDzoOeArmg9Lwg","business_id":"bM3ARXFMxGrntnHS6a7vEQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"So I don't give out 5 stars frivolously, but this place deserves it. Everything I had (summer rolls, vegan pizza burger and chocolate chip cookies) was delicious. The service was great and the waitress helped me narrow down the never ending yummy looking options on the menu. They even gave me a smoothie sample while I waited.\n\nNext time I'm in Cleveland, I'll definitely stop back in. I may even be coming for dinner today.","date":"2014-09-09 18:06:44"}
{"review_id":"PpDRBIHw-0a32vWcFyTINA","user_id":"AdMCAKmNDIaubYPxnjTq1g","business_id":"nIIuxIn5RU0j-XkDWh3hlA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Passed by here after we went to raijin ramen and thought everything looked super cute. Bought 3 bread, the charcoal salted egg, an almond croissant and a coffee walnut bread. All three, after discount came to almost 20$. I was quite excited but upon trying them all, the croissant was pretty good (but I've had better, ie nadege, etc) but the other two were very mediocre. The salted egg bread was very one dimensional as the bread itself wasn't very flavourful. I thought it would be closer to a moon cake concept where bread is a bit sweet and counterbalanced the salty egg yolk but instead the egg yolk overpowered everything else. The walnut bread was also very weird as the coffee had a weird after taste. \n\nFor the price I would def not come back.","date":"2018-10-04 14:12:57"}
{"review_id":"OoC5b4LQOmzHvzj4eI3iVg","user_id":"fVILhIglx6RNOXQba5t4kQ","business_id":"swX3Vj3dQsz1YlCRmwNQEQ","stars":4.0,"useful":9,"funny":5,"cool":10,"text":"Great fresh seafood spot located in the Scottsdale Quarter. Enjoying a nice dinner out and felt like seafood so we decided on this restaurant. We were greeted and taken to our seat right away. The restaurant sets a more professional, upscale type atmosphere.\n\nWe were greeted by our server and he took our drink order. We started with the seafood platter which had shrimp, oysters, lobster tails and a crab mix. Love seafood? Get this for sure! The oysters were quite large and not amongst the freshest I've ever had but they were still good. \n\nFor dinner we enjoyed the chicken and the scallops with a side if crab fried rice. Crab fries rice was full of flavor and really good! Scallops had a citrus flavor added which made it even more tasty. \n\nService was above par as well. Our server was attentive and friendly. \n\nI'd go back if I wanted a nice night out and craved some seafood","date":"2017-03-15 03:34:29"}
{"review_id":"39ukJIrbqD1Pk5V16B5weA","user_id":"HLaSqQMDVvlcFPGJL_kGCA","business_id":"VMPSdoBgJuyS9t_x_caTig","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Easily my favorite place to eat in Madison.  Great Lao-Thai food.  Curries are fantastic and make sure to start with a soup.  They're always good.  Tip: place is tiny and you will wait.  Either get carry out or head across the street to the Weary Traveler to grab a beer while you wait for your table.","date":"2005-03-03 19:49:39"}
{"review_id":"vJPU5tqK0YR3VtZIKZG8tg","user_id":"MuMVzbBYfHXvwM93TZfx-Q","business_id":"OK0ba4X5seibH8oMWh4bhw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"When it comes to presentation this place executes that one thing completely. The food tastes as good as it looks, but if you're on a budget this place my be out of reach depending on what's in your pocket. Even their establishment looks amazing. I love this place and love their \"screaming orgasm roll\"!","date":"2015-04-15 05:54:17"}
{"review_id":"IwlVSOnINIYnqRBjPrRDhQ","user_id":"dZxXGlJtNwr9pag5UXCa4A","business_id":"ACb637NG7EnswRs8U_BX_w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I travel lots for business and this is one of the funniest places.  Heather provided great service and NCAA B-BALL on the screens","date":"2018-03-15 20:18:36"}
{"review_id":"BnB8z3d1BiLyqdAwgQnejw","user_id":"fn0wmD6MY2zmNUkOJJrjjA","business_id":"l4ByLNdIcsjgnglB1aXQQQ","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I can't tell you how angry I am right now.  I went to Huntersville Ford yesterday to get an oil change on my commuter car.  Paid my $41.00 and was given back my car just over an hour later.\nToday I had to go to work (40 mile round trip commute).  As I was getting off of I-85, I noticed the smell of burning oil.  I thought maybe the tech just spilled a little on the exhaust manifold since it's right there, and maybe it's burning off.  I didn't hit a stop light until I was almost at my office.  When I stopped and was waiting for the light, my cabin started to fill with smoke, and I had smoke pouring out from under the hood and the wheel wells as well.\nI pulled over into the parking area of a gas station (because they have accessible fire extinguishers) and parked.  I popped the hood only to find THE TECHNICIAN DID NOT PUT THE OIL FILLER CAP BACK ON!!!  Now my engine is covered in potentially flammable oil, and of course Huntersville Ford is closed today!!!!\nI have my car sitting outside in the parking lot with the hood open, just in case it decides to ignite, because my engine is pretty hot after a 20 mile drive.\nI called and left a voicemail, and now I have to find a way to degrease my engine at work, just so I can drive it home in a less-flammable state.  I WILL HOLD HUNTERSVILLE FORD RESPONSIBLE FOR ANY COMPONENTS THAT FAIL AS OF A RESULT OF THIS.  Most electronics don't like being slathered in motor oil.  In fact, I'm pretty sure they aren't designed for that.\n\nAnd NO, I did not have other work done... Just the oil change.  You had 1 job.... oil change.  No transmission service, no brake service, no rotation, no cooling flush... just an oil change.  I hope he remembered to tighten the filter, but I am skeptical at this point.\n\nI can assure you, I will NOT be taking my car back to that dealership, even though it is right around the corner from my house.  MAKE IT RIGHT, HUNTERSVILLE FORD.","date":"2018-04-15 14:54:30"}
{"review_id":"jnWMRfsp3evb0WW9vVXt6A","user_id":"FlkOUFwCf-OBYkCIXLGWcg","business_id":"zTgzmZGHnZyqA_4xn8Fvvw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Worst pedicure ever. First, waited over a half hour even though we had appointments. Then, the girl rushed throughout, made rude comments and talked and laughed with her other coworkers in a different language. Pedicure is chipped not even one week later. Will NEVER go back here. Worse experience.","date":"2016-07-03 17:50:57"}
{"review_id":"8doYwWUhN0yX48xa0WqbxA","user_id":"DMtVkV1K2DPimItj9xUfjw","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Bobby Flay's restaurant at Caesar's Palace.  Tasty but with mixed reviews.  The first time I went there, everything I had was delicious.  The chicken and pork tenderloin were outstanding.  This time, I ordered the following - duck crepe (SOOOO good!), shrimp tamale (very flavorful and fresh), salmon (mediocre, at best... and our waiter even told us not to order it... but my friend didn't listen), and halibut (tender, flaky, not fishy at all... and so flavorful!).  The halibut and appetizers were my favorites and I would definitely go and order those again.  We also ordered 3 desserts, which were totally worth it!  Sweet potato pudding (and I don't even like sweet potatoes!), Banana pie tart thingy, and spicy peanut chocolate cake.  mmmmmm would definitely go there for dessert and the appetizers!!! \n\nYou need a reservation for this place.","date":"2012-11-06 06:00:13"}
{"review_id":"0geBkVBnj4p7l-7rwUuUCA","user_id":"4CQ3ik_L4hTdIvm3XXlSvg","business_id":"BmJdcOr-XOyM_Otc3wMraQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Cleats is the best! Our daughter pitches and we have exchanged 2 sets of Mizuno metal cleats. Both were coming apart at the seams and they happily replaced them each time.  Great friendly and knowledgeable staff!  We buys all our softball gear from Cleats!","date":"2015-06-08 19:30:54"}
{"review_id":"2E-1IudsdLlrvR6-gP51og","user_id":"dZudYQD1T2U5RSJeJWYCLw","business_id":"kBJfBVaXJtPEKLTov1hJdQ","stars":5.0,"useful":1,"funny":1,"cool":0,"text":"When I'm Arizona...we Reathrey Sekong! \n\nFood is good and authentic! Would love if there was a closer location to Gilbert!","date":"2018-03-15 19:48:59"}
{"review_id":"3ED-N6Nn3DE2cLfXZtGbjQ","user_id":"lMIm1Ye7BeVE21xqlImqEw","business_id":"eNFubUPJR7yIQah-NxZN_g","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Decent food. Fishermen lobster or even congee queen can do better than this. Nice decor but that is it. I don't expect too much service from a Chinese restaurant but I gotta say that the hostess and waitress weren't welcoming at all. Won't recommend this place to anyone.","date":"2017-05-26 01:20:43"}
{"review_id":"PvgCQa3FsA-FXYQsaEguIw","user_id":"LhZhxlOqTSuRY6r7HV6NVg","business_id":"UOFTGqJ95xQxeYndG7hbbw","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"I was staying at the Hilton next door and got access to the YMCA.  Nice!  One of the days, I woke up with a sore throat.  Headed to the gym anyways, but started coughing horribly just as I checked in.  Had to walk out to clear my throat then went back in and hopped on an elliptical machine.  The lady at the front desk was so nice!  She brought me a cup of water because she noticed that I was coughing so much earlier.  \n\nAmazing service!  Now I wish I belonged to a YMCA back home.  Going to have to look into it for sure.","date":"2011-08-25 00:49:25"}
{"review_id":"jkVxX4ieJwVRO9n4E8tNMw","user_id":"z8-Y3mHdujSZS7JcvzFP8A","business_id":"vhKUBKcOm8zOLxeS3XM9iA","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"More than just  Pizza. This location is small but cozy.  Has two large screen TV's for your entertainment pleasure.\n\nThe pizza is of better quality than most (a definate step up from Pizza Hut and Domino').  The thin crust is we like here.  The crust has a crunch to it, which I prefer.  Their menu has a \"tailgate\" variety of food (Pasta, Ribs, Fried Chicken, sub sandwiches......you get the picture).\n\nThe prices are bit high for what you get.  They do have specials so that is what our family typically goes for..... Familiy Feast ($22) includes 16' pizza with one topping, 6 wings, 4 garlic sticks, and 2 liter of pop.\n\nWe are planning to keep this place on our list of places to think about  for a weekday \"too many kid activities\" and \"too tired to cook\" take out night.","date":"2009-03-01 02:20:56"}
{"review_id":"2dYcxwdtulsUY8kj4oZezw","user_id":"iAQFEArbXp1WUrseOFTLMA","business_id":"gfhWUixZ4MmEAC1DtTsodA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"GREAT SERVICE!! The food was amazing and very reasonably priced! Oh and the deserts are to die for!!","date":"2017-06-06 21:04:58"}
{"review_id":"5rY_i4Eao9ncLmzvF_JNYg","user_id":"wGiUu3rFw83EDj8bzMzsuQ","business_id":"FiW6w5nmhlUoJAyNofb4jg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"We drive by Fruits and Roots almost daily and we finally decided to give it a try. Unfortunately the only good thing I have to say about the place is it has nice decor. We walked in and was greeted by one of the girls and as we were looking at the menu she asked if it was our first time and we told her yes. We assumed she would explain the menu but nope! My daughter's go to is a strawberry banana smoothie and the menu had a few smoothies that had strawberry and banana mixed with other stuff and I asked if they would be able to make one with just strawberry and banana and she had said they couldn't because it was already pre made. So we continued to look at the menu and a different girl came and said she would be able to make the smoothie so thank you to her. My husband and I knew we wanted to get an acai bowl so as\nwe looked at the different options we found one we wanted to try but on the menu it had a pitaya and we asked if we could get it with acai instead but again was told that it was already pre made. So we went with one that was made with acai but it had blueberries which we don't like and we weee hesistant to ask if they would be able to leave them out since everything seemed to be pre made but my husband did ask and luckily she said they could leave it out. Whew! It wasn't a long wait to get our order. My daughter drank her smoothie saying it was okay and our acai bowl was okay as well. To\nme the best part was the granola and that's about it. At least we can say we finally tried this place and we definitely won't be back. We will be sticking to our usual spot Bowlology!","date":"2018-05-08 16:50:09"}
{"review_id":"a_4IN1krICioWWvDDgo0Mg","user_id":"UniWikK9zPi-9PYgFpE01g","business_id":"AVdo7XPlyRZ_pj5DVk1Yow","stars":5.0,"useful":7,"funny":2,"cool":6,"text":"Love the staff here! Becca, Chrissy, Angel and Arianna are so friendly and helpful! Super clean and professional place. Highly recommend coming here!","date":"2015-01-04 00:12:38"}
{"review_id":"5DO6RYDU_9cxAXs0JSYcWg","user_id":"LWyUWSRmTzjfeDBCvdy7lw","business_id":"Kk6k9cs4rXfDkC9Fjv0MjQ","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"I had an oil change at the 15515 N Scottsdale Road location.  When the car was delivered to me, there were two engine warning lights on that had not been on when I drove the car in.  The technician said that the lights were on when he got in the car, which was not true.  I took the car to the dealer who said that a sensor light had been left unplugged when they removed the air filter.  I should have read the many bad Yelp reviews prior to going to this facility.","date":"2017-11-06 20:58:23"}
{"review_id":"8UrOyS_pDT3UlV-smLWPFw","user_id":"8wo82tssB-tY4L22u0f3Jg","business_id":"hFY-MQpyuvBvZfxMqtxZHg","stars":1.0,"useful":2,"funny":1,"cool":0,"text":"The absolute WORST apartment complex I have ever lived in. Moved here from out of state. Hoped to find a decently priced apartment until I got myself settled in. Wow this place has been trash. Landlord is only here half the time, so those of you with a full time job, forget ever trying to communicate with her! Doesn't answer the phone or call back. Place can't even get with the 21st century and splurge on email communication. Rent past due? Noise complaint on an animal? Anything, Don't worry, you'll be singled out with a cheap ass piece of paper taped to your door for the whole complex to see. As far as CAM Properties as a whole, also trash! They also refuse to give callbacks. After hours \"emergency?\" ha, yeah right! Scottsdale PD had to be called when I had troubles after hours because CAM's \"emergency after hours hotline\" didn't answer the phone! I will never ever recommend anyone live here. The bugs invade the units like crazy - cockroaches, spiders, lizards, you name it. They say they spray before you move in, but do not perform any follow up procedures. They tell you if there's bugs in you apartment, that's all YOUR fault. Ha! I cannot get out of this place fast enough. The only upside is the utilities are included, however the price is still absurd for the less than average amenities and the horrible customer service.","date":"2017-05-26 02:25:13"}
{"review_id":"Lm-Sy_QbFMRf8GbKjNxg6w","user_id":"IZzkAUnRtJtw3tGNdZtrJg","business_id":"V4sPxg8y29QDskQmMM1FIw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This was my first time at this place and the shop was super clean. The staff was nice and helpful. Rose took care of me like a regular customer. If I lived in Vegas, I would come here all the time.","date":"2017-01-14 21:03:01"}
{"review_id":"Lb9r62Qlu12ZB909CbFeOQ","user_id":"sHUQOhH75nK0J6n_INkKDA","business_id":"E54AvEdLfCFFkCvXmXJ7GA","stars":1.0,"useful":1,"funny":1,"cool":1,"text":"I ordered a pizza at 4:49. Got an email that said my pizza would be delivered at 5:18 to5:28. 5:38 still no pizza. Called the store. They said it was out for delivery. I said I knew that it was suppose to be delivered 10 minutes ago. 5:48. Still no pizza. Called the store back. Again, I was told it was out for delivery. 5:48 called the store again. When I was on the phone the pizza came. When it arrived it was COLD.","date":"2018-04-04 01:38:49"}
{"review_id":"6mpdexlJQ-4WVjPw40xhog","user_id":"2VRkBZBS5FO_N7yBRWfaLA","business_id":"gc_GGat7TgNCmrgc4nVOgw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Paid a visit here after the JT concert on Friday night - best decision all weekend. Every restaurant was packed before the show, so we set on wandering MGM afterwards for a good after show nosh and were definitely pleased at Crush. Luckily we were seated right away (not many people ordering dinner at 11pm I suppose!) and our incredibly nice server saw to our drink order ASAP.\n\nThe ambience is tres chic. Dark, romantic, and removed from casino craziness in the back where we sat cuddled up in a booth. The only negative about our seats was the pretty chilly draft, but perhaps we were just too sober ;) The Syrah was absolutely delicious, and at $11 for a glass, a Vegas bargain. We began with the Caesar salad which came out within minutes of ordering and was very tasty, though I myself found the sweetness to be a little strange. Overall it was a crunchy, refreshing delight. We then shared a margherita flatbread and the gnocchi. Whoa....both dishes definitely exceeded expectations. They were small plates, but really perfect for sharing. The speed at which the salad was delivered was slightly misleading, as the other dishes took quite a while to come out. However, they were clearly exceptionally fresh when they arrived.\n\nOur waiter was pretty busy but as attentive as he could be, and very professional without being overbearing. The end-to-end experience was more than I expected at such a large venue, and thus deserves a high recommendation. This was a perfect way to wind down from an energizing show without losing the dazzle of a getaway weekend with your honey.","date":"2014-08-10 23:03:05"}
{"review_id":"E5iXQGD_x_Fyee1kOKgGTw","user_id":"ffMc-TmUUhEbj5LLNILB4A","business_id":"4ZbRwCB9oGibxK21MUZKHA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I went into this store yesterday and it was horrible!!! It was sooooo dirty. I'm talking there was trash everywhere!!!  Not only that but it smelled like trash! It was 5 o'clock on a Friday afternoon so I completely understand it being a little messy but the store just looked horrible!!! Not to mention the were out of pretty much everything on the store. I honestly will probably start going down the road to the next Smith's.","date":"2018-08-04 22:27:08"}
{"review_id":"A9Jeb8657LKTbvofHBBLMg","user_id":"UIdROvjyMfhoKhJ-Giuxpw","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I love Bouchon. It's still my favorite place to go hands down. They are extremly fresh and have excellent service. I ate at the bouchon in Beverly hills and didn't encounter a single difference in food quality in Vegas. The food has always been delicious and this one time I went we ordered practically everytihng. From the bakery basket in which the waiter chooses for us a selection of baked goods to the mussels to the hash. \n\nEverything was delicious. And you can't beat the price around 20-30 a person with small apps. Or aroudn 40-50 if your drinkin a little. Very reasonable for what your getting.\n\nTake a peek at my photos.\n\nThanks Thomas Keller for a great meal again!","date":"2011-11-30 00:51:49"}
{"review_id":"VmJVQTRDqxqWoxNREdVn3w","user_id":"G5yx5pmozG-mXR-J8on6pw","business_id":"gLOc1Fzl8yuKGq7B1TWj_A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"So pretty inside and well organized! I called for an appointment before my wedding for me and 3 others and was told they wouldn't be able to help me on that day because they were going to be too busy. :( So we went somewhere else. I had a gift card for here so I went here for my fill, and they did a great job, but a bit overpriced! I brought my daughters in so all 3 of us could get pedicures and had a great experience! Overall a great place!","date":"2016-06-11 22:52:59"}
{"review_id":"g_T3-GN7HwGTLdbnMZYOIQ","user_id":"4wp4XI9AxKNqJima-xahlg","business_id":"nkDSE-yhvLX4ij5fSzvb5Q","stars":3.0,"useful":3,"funny":1,"cool":0,"text":"Furry watching 2011 concluded at Tonic....it was a fun time had by all....furries and humans alike.\n\nI was the same as Mel U.  I had been past this place a couple times and never thought to go in.  I think it may be because it's on the \"outskirts\" of town and a section I really don't go to often.  \n\nFirst off I'll say I love the outdoor seating area!  It was a front row seat to all the furry watching action going on outside the Westin and convention center.  Plus let's face it, it's always great to have outdoor seating!  \n\nSince they're known for their martini's I had to indulge!  I ordered the Cosmo-Tonic because for some reason I've been really into Cosmo's lately.  With all tini's, you really have to have the right mixture.  I hate when there's too much Cranberry or even too much Vodka (gasp, I know!).    This was a perfect mix I'm glad to report!  Nice job shake masters!  I also tried my friends Lemon Drop Martini, holy bejebus, it was WAY too sweet for me!  I'll stick to my other options out there!\n\nI would like to try the dinner options now and have the full experience here.  But I'd say so far so boozy good!","date":"2011-06-29 01:49:16"}
{"review_id":"MRPCm_BYEHl2T9oNZYnCbQ","user_id":"oAFF_A02Ws0mwH-lkbzyMQ","business_id":"l_kefVF1frmC0xRW2YkvUA","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"Pros: Fun atmosphere, great for people watching, mechanical bull is unique in my experience\n\nCons: I had the chicken tenders and fries and while the tenders were alright, the fries were pretty terrible. I've had fries that didn't taste good before, but these were the first fries I've experienced that actually tasted bad. After dinner, I felt sick and had to drink lots of water to get the taste out of my mouth. Would not go again!","date":"2018-01-21 04:58:46"}
{"review_id":"r_ViiWEz-9HKGRRjshDM4Q","user_id":"NrxsOAR-rBI-E7rD5B6Uug","business_id":"Vw9u6qar1I2QlkQOV6KNVA","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Nice decor, service was as good as it was asked for. Food came out very quickly after we ordered it, which makes me wonder whether they have prepared contents that they assemble by order??? If so, it explains the overcooked noodles in the Padthai. I didn't like the fact that they don't offer Padthai with flat noodles, but only with thin noodles... Took away from the whole Padthai eating experience that comes with the flat noodles and the flavors it generates. It was also extremely sweet marinated and had no particularly Thai spice flavors. The meat to noodle portion was pretty good though. Again, did not get Padthai as Padthai should look and taste. So far Royal Jasmine in Litchfield is my favorite Thai in West valley.","date":"2015-12-20 19:39:54"}
{"review_id":"-cF-W0AAi9pdQdHVVjopPQ","user_id":"4FnosmTZU4Kq3110Ykt7ZA","business_id":"VrGI7_nRjXpn0415S3coGQ","stars":4.0,"useful":2,"funny":0,"cool":2,"text":"Prices are reasonable...fried rice, Thai flat noodle with Duck, and the yellow curry is delicious!  However, they burnt my fried calamari :(","date":"2013-06-24 06:21:34"}
{"review_id":"ktOeQ7aup9FKFSnO_M1MOg","user_id":"lq_DOs_38ctAKSzdE8gW4g","business_id":"N6-dAWPTAaHqwRb94vXFCQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Their Homemade Lasagna was Great!\nYou've gotta try Rizzo's Spaghetti House.\n\nTry out their other restaurant, located off Cherry Road in Rock Hill.","date":"2015-10-17 01:05:43"}
{"review_id":"Oh6EPfAybFt-2Q-gP_7Umg","user_id":"gkw9tSW_DuxSvhKLES9ePQ","business_id":"MNaPOkqm2vKeNG8EqkZWCg","stars":5.0,"useful":3,"funny":1,"cool":2,"text":"By far my favorite Italian restaurant in Vegas. Pasta Luigi is the fastest they have! Also try the stuffed artichoke. It is one of the best of ever had","date":"2013-09-04 01:42:22"}
{"review_id":"ydmLJUsQTKrUMmM1hSFjFg","user_id":"LPva2snYp0Fdu8Z1QIXLiA","business_id":"6ZIHxvFTHC1pvAzAS0uLDA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"What can I say?  The bread is made daily and the portions are reasonable. \nThey have a wide selections of desserts,  Asian drinks\/candy\/food,   and their sandwiches is made when you order.","date":"2018-02-01 19:18:02"}
{"review_id":"rqGuZNdCcIVqqlmmjdF5Yg","user_id":"iDJCA-MMb8LRpBEN5qIWrA","business_id":"H464UiJ5c7q5dAJ14h731A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Had a wonderful meal here. Rib steak for two with herb butter and mushroom onion sauce was excellent, cooked to medium rare spot on, lightly coated with Montreal steak spice. Tuna steak lightly seared just right went well with lentils and mint. I am withholding a star because even though the wine list was interesting and extensive, only three reds were available by the glass, and the pour was nowhere near generous.","date":"2015-08-06 22:59:22"}
{"review_id":"b9dq4-FW7DZPGvBcyMUs7g","user_id":"aFXA_ZCpPWhsHVg1Uyjl4A","business_id":"LLOCKcFIKbeWmiyCGytBSg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Huge breakfasts served all day. \"the all American\" was very good if you want something simple. Service was spotty mostly because the waiters would disappear when we needed their attention. They were able to separate the checks which was great. The waffle was forgettable and expensive. I recommend egg dishes! If you need a quick yummy breakfast in downtown I recommend this.","date":"2016-07-25 05:30:15"}
{"review_id":"LY8OfJm-Uk-jsfeCiW3O7Q","user_id":"-ngKtxn2tB_c3fnNouRM5A","business_id":"V2TN04eMwKJmGki8ioOY9A","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"I love bookstores, and I love to spend some time browsing and flipping through the books and having a generally pleasant time. \n\nI would have enjoyed it more, though, if this store were organized better. It was nothing but an exercise in frustration going through the fiction section. I am not sure if it was a matter of the store being in transition, or what was going on, but the \"General Non Fiction\" shelves included a number of books that should have been filed in the fantasy or science fiction shelves, which were incredibly tiny as it was. It make finding anything incredibly difficult, as it was hard to tell if they just didn't carry a particular author, or if it was mistakenly shelved elsewhere.\n\nService was perfectly polite, the Starbucks inside is pretty comfortable and a good place to relax. However, if a bookstore wants to compete with Amazon, they really need to have their stuff together and not annoy the customer.","date":"2015-05-26 15:21:38"}
{"review_id":"3TlCnn6hG-Hs8xQGyOAhiA","user_id":"Qh1sq9Civof7Fd9TZLm4HQ","business_id":"vQMcpsCYhkpJKvkity2VHA","stars":2.0,"useful":4,"funny":4,"cool":1,"text":"I passed Five Guys, In-N-Out, Carl's Jr, and Sonic to get to The Habit.  It won't happen again. I don't know where all these five stars are coming... but their burger tasted like an unseasoned Sonic burger... and more overpriced than Five Guys. I WILL SAY THAT THE CUSTOMER SERVICE WAS GREAT!","date":"2018-02-01 21:01:42"}
{"review_id":"-b99rgqD_o_KtXR02j_zfg","user_id":"Bf87HcPERF9yiSjb2tQBqw","business_id":"LiE33AU9CAZooCyAXr957w","stars":5.0,"useful":2,"funny":0,"cool":1,"text":"Some cretin at a store swiped my credit card information while ringing me up and then charged 3,000 bucks worth of stuff on my Keybank debit card.  I was in Florida at the time on a long term assignment, hundreds of miles from a Keybank.  I discovered the fraudulent charges when I checked my balance just before leaving on a road trip.  I called the customer service number and within a few hours all my money was back in my account.  They canceled my number and sent me an all new card by FedEx which arrived the next day at my destination. They made the whole recovery process so easy.  Miss this bank, big time.","date":"2005-05-11 05:05:13"}
{"review_id":"5n7Ye0F9mS7r25rnRfPhZw","user_id":"AVxQMKJsNvyNPbCJsinvYA","business_id":"srHBs-NlG0upDlambkURbA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Fast and friendly, always! They make sure your order is correct even when they are in a hurry. Always a great meal.","date":"2018-05-19 00:32:03"}
{"review_id":"eSmuw_7aCamAWhKdiZvzxw","user_id":"owc3KFagSCE38eWTQ4CaRQ","business_id":"PBmMvDows5HWIqrEVvNfQQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I tried chicken Shish kebab . Chicken is really juicy and really tasty . The atmosphere there is very Turkish style , love it . Definitely 5 stars .  Good place ever for coffee break , delicious deserts.","date":"2016-09-18 15:43:56"}
{"review_id":"eDBC5o8_28FMafDAeT1lJQ","user_id":"omzXdnZFmB6irpf7jmTQWQ","business_id":"XwJ6fZRVbxQYRsryy4-qDw","stars":5.0,"useful":1,"funny":1,"cool":0,"text":"I love the atmosphere ! Perfect for families ! Very welcoming to children , my sons a bit active && loves to touch the decorations but they're so patient && understanding . The food is filling , tasteful && excellent portions . Nd their hours are accommodating to all they're open late .","date":"2016-05-19 05:03:48"}
{"review_id":"LkDcm5hRFcKyDt_q0N9OYw","user_id":"FUT-tRk_GVBNqwS_Hogolw","business_id":"lmxA0dJM0XsPCIHPXhEQ-g","stars":2.0,"useful":1,"funny":1,"cool":0,"text":"I just want to note that I am all about eating quality sushi. I have been to many sushi places  and I know when the sushi is worth the money. Unfortunately, this is not one of them.  The presentation of the sushi is clean and organized but the quality of taste was not there. \n\nWe ordered the Godzilla and  10 orders of sake nigiri and 10 order of shrimp nigiri. I was disappointed. It was not fresh enough for my taste and not good enough for the money I spent there. The fresh sushi was flavorless and the rolls did not have a correct balance of flavor. \n\nIf you guys are big sushi fans and know the difference between great sushi, good sushi and poor sushi, then this is place in not for you. But if you do like spending $5 on one piece of Nigiri\/sashimi (not even a set of two) cause you won big in the casino or something, then be my guest.","date":"2016-06-11 21:17:30"}
{"review_id":"WN8Mv-izludqkQrAFxmrhg","user_id":"Jv7tTiEpkm4vSLzp7Ryb5w","business_id":"zidkKI_N1OPxsiddTOQH_Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Amazing staff and food everytime! Always so welcoming and the food is constantly awesome.","date":"2018-07-17 01:33:57"}
{"review_id":"oV2rbFWgjyk3ISZd50_u1A","user_id":"mn0tWjJCIozGGg9EweGncg","business_id":"TIXQ4Yo65ZJUTGiraWI7ug","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"They did a great job on my two Golden boys. They can be a handful at times but they came out looking great and what I considered a great price as well!  We will be coming back for sure in the future.","date":"2017-08-07 19:35:44"}
{"review_id":"TxpuxIkumA95x3qEgB-AaA","user_id":"CGZD3Xkg7JsBIELPXyLzZg","business_id":"CIdyd88FK-4-YaEFo3Ht6A","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"The whole experience is awesome. They start you off with silly anouncements from the gate. In other words, the staff is friendly, spontaneous, and well, AWESOME. It's a small plane, though, so whether you're travelling a short (ie from San Francisco to Vegas) or longer distance (SF to New York), then Virgin America is the way to go.  \n\nI guess the airline is famous for its mood lighting which is relaxing. They have a really cool in-flight entertainment system - touch-screen, on-demand movies, live satellite TV, radio, etc. So if you're flying, better bring your own headset coz they sell theirs for $2. To sum it up, the experience was so darn good that I wish I had more time on the plane.","date":"2010-01-08 09:36:25"}
{"review_id":"gHi_lCvO0659TOUGyZwPvA","user_id":"STcrjP1twU03Vk6syLft7g","business_id":"zRJBKJkEheN30Vl_fdiS7g","stars":2.0,"useful":5,"funny":0,"cool":0,"text":"The reviews for this place on Facebook are great so despite not having a presence on Yelp, I made an appointment.  I won't deny my dog needed some serious grooming.  We'd brushed him out the night before but he could still use more combing, his hind legs\/butt trimmed up and he had some matts behind his ear.  There are 4 doors at this place, I believe. If you just pull in to the drive way it's not terribly clear until you get closer to the doors and see signs directing you which to go into.  The lobby is cute. I was quickly greeted and I was given a form to complete. The woman doing the grooming introduced herself and I asked that his hind legs and butt get trimmed up and asked that she cut out any matts.  She said it would probably take about 3 hours.  I received a text about 3 1\/2 hours later stating the price would be $80 and if I returned within 8 weeks it would be $65.  I went to pick him up and I was shocked that they shaved him.  His hair was NOT that bad.  Not to mention the hair that was left was not soft as it has been after visiting other groomers.  I didn't say anything because I was so shocked in the moment so I took him home.  We saw our dog paying particular attention to his private area...more so than he usually does.  My husband looked closer and found that he had been nicked a couple of times.  We found a large cut behind one of his ears.  We won't be returning.","date":"2016-03-07 00:34:42"}
{"review_id":"6f8govVUNZf5Gi-UiRv7vA","user_id":"ktZxmBGBEnWLyecg0X4uVw","business_id":"6M5WG1Hp38dsYkK77S-bzQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Amazing food and perfect location for any Luke AFB military personnel looking for some decent Asian cuisine. I'm going on my third lunch this week! The Chicken Teriyaki and ginger salad dressing is out of this world!","date":"2017-01-27 18:48:28"}
{"review_id":"0ID7sVxBNa7nBmsSo9cNOw","user_id":"XBRgHoPjOi4GgcYFCvYElQ","business_id":"osSwv6CJy5hDKQdOKeyTow","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"3 stars for food, but the service was awful. Appetizers were ordered and all the food was brought out at once after wondering where the food was. Saw multiple tables served while we sat around waiting for the check. Won't be back!","date":"2015-11-05 23:56:14"}
{"review_id":"_1cKUxp1Ii5yGj000S-RnQ","user_id":"bolI1wtWAvn7tzEZ5k2UJw","business_id":"lslPZKTjaG9vhfINJ9acFA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I'm traveling from out of town. It's amazing! Best massage I've ever had! Most definitely will be my new go-to place no need to look any further.","date":"2016-03-07 01:15:48"}
{"review_id":"vNHdIY_wU_btRuHK3HMCgQ","user_id":"mXBkddhNdHjw4vRmo7X8Hg","business_id":"XWxYHSld0T2TfANwt1KmqA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We love Cafe Americano! We've been a couple times for lunch and have had Eric S. both times as our waiter. He was unbelievably attentive, kind, and efficient! The food both times was amazing. As with anything down at the Strip, the food can seem pricey, but the quality and the amount of food you get is worth every penny! My favorite thing is the Short Rib Nachos. Also love the atmosphere. Highly recommend for anyone that has a stomach and is in Las Vegas ;)","date":"2018-08-24 00:20:02"}
{"review_id":"B_1HqrwINKkIEnekkxtpsA","user_id":"1kNsEAhGU8d8xugMuXJGFA","business_id":"cDoo0Pf1d_P79Rq3ZNk-Mw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Sigh. This review was tough to give, as it could've been anywhere between 2 and 4 stars.\n\nLet's start with the positives. I came here with a friend for Summerlicious this afternoon at 12:30, and we got the last seat in the restaurant (it helped that we reserved). We were given the menu and our order was taken in about 3-4 minutes. Not bad to start.\n\nI ordered the miso soup, green salad, ebi shiumai, sushi\/sashimi\/maki, and green tea ice cream. The miso soup and green salad tasted nothing special (the soup was a little salty though). The ebi shiumai tasted really good! The sushi\/sashimi\/maki tasted very good as well, and I especially love how there's a much higher raw fish-rice ratio compared to other restaurants I go to. Finally, the green tea ice cream was a great dessert to finish.\n\nEverything with the food satisfied me. The service, after having the order taken, was a near disaster. I understand it was a busy day today due to the fact it was a nice Friday, but many of the servers were confused in their roles. There was a long lineup of orders by the sushi counter, and at one point I saw 15 dishes lining up ready for serving, but no servers were going to pick them up. I didn't receive my shiumai until 1:00, and my sushi\/sashimi\/maki until around 1:20. I finished everything by around 1:30, but the ice cream didn't come until around 1:40, and finally the bill didn't come till around 1:55. After 1 hour and 35 minutes, I finally left the restaurant at 2:05, since I had to ask for the credit card machine, in which no server was around for about 8 minutes before I finally got one's attention.\n\nWhat probably saved this from a 2-star (or even a 1-star rating) was the fact the manager came out to me as I was signing my receipt saying how they were horribly understaffed and completely underestimated the demand for Summerlicious this year. They only had two sushi chefs, four servers, and two chefs serving what was a full house restaurant. In a way I felt bad, but I did give them just less than 10% tips; something I almost never do in restaurant.\n\nFree wifi! Password is the phone number. Perhaps as a sucker for free wifi that might have contributed to the 3-star rating I gave. However, be warned.","date":"2013-07-13 00:57:45"}
{"review_id":"x_AWd7i9NVCCynAyvk99VQ","user_id":"U4INQZOPSUaj8hMjLlZ3KA","business_id":"pKOy7-pP-BdSVcCrtQo_ww","stars":5.0,"useful":3,"funny":0,"cool":1,"text":"This is a review of Pliner's approach and style (truly original, but certainly \"not for everyone,) this location, and especially their sales person - Milijana, or Mia as she introduced herself.  Making my purchase on 12\/18 during their holiday sale I literally tried on 25 pairs of shoes before making my final selection - a half-lacquered pair of black suede shoes unlike anything I've previously seen.\n\nWhile the store did not have my size in stock, Mia brought me shoes made from the same mold and informed me that not only could the size I need (11) be mailed to my home, but it could be accomplished with no tax and free shipping since I lived in Ohio.\n\nIn retrospect I wish I'd have bought more pairs of shoes while I was there, but as it stands they've guaranteed I'll return on my next Vegas visit.","date":"2011-01-08 22:46:24"}
{"review_id":"k29ZobahoFGWPePsxd35Ng","user_id":"YthHssImvAsOjE2AWWmg6w","business_id":"6Cl15LapBVhw4ZfBIeVJJA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Absolutely delicious. Ordered chicken\/beef kabob combo with spinach rice based on other reviews and not disappointed! The spinach samosa are also fantastic. My new favorite restaurant.","date":"2016-01-30 03:24:38"}
{"review_id":"MS5Qm98MZOb747tkObIP8w","user_id":"pvXNlamX78K_fQVUz8C3sw","business_id":"NIPn7olHs6k3Svxy6DHUQA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Really good steak house. Steak is always seasoned to perfection but is never exactly coined to perfection. Make sure to ask for bread and butter you will need it. The butter is home made infused with honey and the bread always comes warm.  can't wait to go back again do a nice dinner.","date":"2014-12-17 19:48:47"}
{"review_id":"G9h-WIlysl1TDlKvErZNUg","user_id":"uLWWpi62JJLnTh7UciJFHg","business_id":"X2f2s37_cFKo4xpzGFqk1w","stars":3.0,"useful":1,"funny":1,"cool":1,"text":"The food use to be really really really fuckn good here\nBut not any more.. Suckx the food is all picked over eeewwww..\nI had to wait for FRESH!! Food to come out .. Uuuugghh.","date":"2012-12-04 06:09:07"}
{"review_id":"Hy6baACAfpcYBj_CE-EI2w","user_id":"kbvHEgHre_T0wx0Z_7t_7A","business_id":"3p410D9YzcmgyXQWCcCPiA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great food & very friendly staff.  We got the Shrimp Creole & the Cajun Trio, both tasty with the equivalent of home cooking.  The peach cobbler was delicious & passed my friend's test, who is from the South & has some experience with this dessert.  The owner chatted with my friend & I and told us how the restaurant got started.  Definitely worth trying.","date":"2018-01-09 20:21:19"}
{"review_id":"-D4IJNDfoWp90DIGJBkr0w","user_id":"qPunrDwmTYU46Pp27-iyZw","business_id":"rp6EwfZATNfvkC_h9VtwYg","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I went up too my storage unit at the Uhaul facility on 1\/9\/16 and when I opened my unit door I noticed that there was boxes pushed too the side ... I noticed that three pieces of furniture was gone out of my unit and I notified the manager of that facility about the missing items... And the manager told me I had too file a claim with the Uhaul company ... I couldn't believe that the manager wouldn't look into it making me feel suspicious... I will never use their facility ever again can't trust their company....I called and they have never returned my calls","date":"2016-01-17 06:13:07"}
{"review_id":"n2BEHit2SwqsRo6jlTagUA","user_id":"abdw-Nf5xxWdi5wmUO7UYg","business_id":"2qLOnQtWSlTOtkfEFyWScg","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"There are good things, and bad things about this tiny airport. The bad things are, no food, no bar, just vending machines a couch and a big screen TV. \n\nThe good thing is that this airport is so small, only American Eagle flies here, that when you show up for your flight, you can sit on the couch or an easy chair and watch TV while you wait for the security guys to show up. Then everyone on your flight (~32 people) go through security and get on the plane.","date":"2013-04-10 19:26:54"}
{"review_id":"smQpjjY8bu8Vl5VsOViiNQ","user_id":"o6j8ZpiLIA2gwzaAsUHWpw","business_id":"XSY26vVt9qvLh3SAECPzkg","stars":5.0,"useful":2,"funny":0,"cool":1,"text":"Disclaimer: this was our first experience there. \n\nVery friendly staff & nice ambiance. We got Wisconsin cheese, The Classic & Fundue Delight for our entrees & The Original for dessert. We chose Mojo for our cooking style. We had the Cesar & the Bacon & Bleu Spinach salads. I was a little unsure coming into it but the staff asked if we've been there & explained the process. We were warmed the portion sizes were small but we got full--guess it depends on your appetite. Everything was very good, even the apples with the cheese. I highly recommend this place. It's such a fun & different experience.","date":"2017-03-27 01:09:43"}
{"review_id":"UiLcyhq3tAahSRBetqZ_qg","user_id":"ccKJusSm_iCv7YGrKCqzsQ","business_id":"2gHJ-csflxzezLAi6JQW0w","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"This place is clean and a great price the other places around is are horrible and have undesirable types (I.e. hookers) not here safe and quiet no bedbugs a huge plus would recommend it to anyone unless you are from the Phoenix area they will not rent to you unless you live more than 30 miles away after our 3rd stay we were informed of this policy such is stupid and discrimination of Phoenix and surrounding area residents so I'm going to file a complaint with corporate and talk to my lawyer!","date":"2017-05-26 01:17:27"}
{"review_id":"h3H1A-fzNNC8ppKeNwkkhg","user_id":"q3ycagiLqUaRkOgEPf_gbw","business_id":"ODTI9W7fHMKNWZ3g8VcFUg","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"What a great restaurant in the South Side! We went for restaurant week but the entrees are on their normal menu. Everything had such a pop of flavor and was perfectly cooked. The only part of our meal that my boyfriend didn't enjoy was the dessert. \n\nThe shrimp appetizer is loaded with garlic! Definitely enough for two people. The stuffed oysters were very filling but I liked the shrimp more.\n\nFor entrees I had the chicken in cream sauce which was amazing. My boyfriend had a perfectly cooked fillet. \n\nMy lemon cake was awesome but his creme brulee was watery. They substituted it for him.\n\nAwesome service, great wine, and great food! We will be back!","date":"2017-01-14 23:23:29"}
{"review_id":"ZNGCRXZzENUl0FawjfOLxg","user_id":"-VtIPsp0TgYyO4bg9vyG9A","business_id":"LeuGZImVz_IG1e-SMYTSXw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I didn't really have a positive experience at Blush Lounge. The crowd here is much older than a typical Vegas club. The music isn't great and $20 cover on Thursday made me cringe a little. Other than that, the club is designed really nicely (as are most things in Encore\/Wynn). The drinks were typical Vegas prices ($9 beers) so overall it just wasn't great. I probably will not come back here.","date":"2010-10-05 19:15:52"}
{"review_id":"tH37DtvmqeoPdIVZ_3Xhgg","user_id":"no2KpuffhnfD9PIDdlRM9g","business_id":"Wj1yPG74S_vkCMspcSmH9g","stars":4.0,"useful":3,"funny":2,"cool":1,"text":"If you're in the Mississauga area, a must stop for any tech professional. \n\nI'll sum it up with two easy statements:\n1. Awesome selection of beer on tap\n2. Reliable free WiFi with good bandwidth\n\nEnough said.","date":"2012-12-04 06:19:02"}
{"review_id":"V3kZd0O3EeVuTBCKOW-M4g","user_id":"Eg_VTAQwK3CxYTORNRWd2g","business_id":"4m_hApwQ054v3ue_OxFmGw","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Excellent food, service and ambiance! The tapas are truly infused with spanish flavours. \nWe had the Octopus, Dates wrapped in Bacon and Figs with Goat Cheese, but if I have to pick a favourite it will be the Foie Gras \"sliders\", they were unbelievably tasty!! \nWe had the 'Paella Patria' you could see the saffron, beautifully done. For dessert I ordered the Chocolate pudding, it was sublime, rich, decadent. Infused with olive oil and salt, it couldn't make me happier. Ohh I just can't wait to be back!!","date":"2013-02-21 23:37:18"}
{"review_id":"CO3G0edGWt47V1eJUTSXlw","user_id":"aLqp_fe64ugZFuwMpsXLiw","business_id":"XgRljuEUyaHBKIpIz-PRAA","stars":5.0,"useful":2,"funny":0,"cool":1,"text":"I can't believe I'm saying this, but I think I just ate the highest quality burger of my life at a place where you have to order at the counter and the burger only cost $9. \nI was immediately impressed upon ordering at Bang Bang Burgers. I ordered the hangover burger, and they not only asked how I wanted my burger (can choose from medium to well-done) but the worker even asked how runny I wanted the fried egg and then if I wanted it sunny side up or if they should flip it over easy. My buddy asked for mustard, and they even asked whether he wanted regular yellow, dijon, whole grain, or honey mustard. I added sweet potato fries for the $1 upcharge because I love sweet potato fries, paid my $10 and waited. I must say I was a little disappointed that I had to wait 15 minutes for the burger, but after first bite I had no more complaints!\nI don't know what's in Pat LaFreida's beef mixture, but it was the highest quality beef in a burger I've ever ordered. The bun was ridiculously soft as well. The egg was cooked perfectly, but the burger lacked any flavor from the small slice of cheese or the bacon hash unfortunately. Despite that, the amazing quality still made this burger awesome. \nThe sweet potato fries were by far the best sweet potato fries I've ever eaten, and I love sweet potato fries so that says a lot. They were crispy which so many places cannot accomplish and had a balance of sweetness from the fries and salt that was perfect. They came with a decent maple sauce, but I didn't dip very many because they were honestly better on their own. I must say, the bang bang sauce that comes on the side of the burgers is incredible though. It's similar to a Thousand Island dressing without the pickle relish, but something about it just makes it so much better and slightly sweeter. \nOverall, I probably wouldn't order the hangover again and would choose a more flavorful\/interesting option. I would also recommend going with a double if you're hungry because each patty is only around 4 ounces. Despite these slight \"drawbacks\", the quality of the meat and bun stood out so much that I think any burger here would be amazing and for a pretty solid price as well.","date":"2015-06-08 18:56:14"}
{"review_id":"7waZ74cpeFi8Th_IdRcsag","user_id":"x5bK_r_44IN2r-YqrHAE9w","business_id":"Vw9u6qar1I2QlkQOV6KNVA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I went for the second time yesterday, and it did not disappoint!!! I love their willingness to work with you on a dish to make it exactly as you want! Best Thai Food I have ever tried!","date":"2013-06-24 05:03:22"}
{"review_id":"bviGAY3LUNOcOFaI6f_HDA","user_id":"1EADjPQ3-qu7DSQ_8mII2Q","business_id":"hsDkxhc-_YYsVqAeQBJJjg","stars":5.0,"useful":2,"funny":0,"cool":1,"text":"I saw Big Jim's on Diners, Drive-ins and Dives. Went there when in Pittsburgh with my son visiting Pitt, had a great lunch. \nMy son went to Pitt and I have been back several times. The food is very good, large servings and reasonably priced. This place will surprise you. It is off the beaten path. You have to be looking for it because it is below the highway in a neighborhood that leads nowhere to my knowledge. It is unattractive at best but the service is good, food is very good, fresh, plentiful and very reasonable. If you like good food, funky places and you are not a snob stop in and give it a try.","date":"2012-02-01 06:25:35"}
{"review_id":"l8JU4_4oDQ6xx7zTKMjBGw","user_id":"6Fd61O8RXegJNp6pm4_new","business_id":"FodnfLi_ezVmL5DcrxnI3Q","stars":1.0,"useful":3,"funny":1,"cool":0,"text":"The worst hotel experience I have had...we came here tonight, and the bathroom shower is visible to he whole room. Then we needed extra blankets and called down, they said they were all out. Then we asked for water botlles, and they said they were all out! Then to too it off, we asked a cot, and to no surprise....they were all out! What bull is that?? The next two nights better be better...","date":"2014-03-14 11:41:29"}
{"review_id":"c9VFCK3gXuNRvbC7lXfk1Q","user_id":"oCFvgGH40QHc25qOUrpu3A","business_id":"e13SEvJud_vgeDR_doL4sQ","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Absolutely love it!!.The most authentic and incredible Mexican food I've ever had in Las Vegas hands down!! The place is so beautiful and colorful. The food is sooo good.Their tacos are freaking amazing!! Everything is so exquisite and delicious. Will definitely be coming back here. Manager Chad was very attentive and stopped by a couple of times making sure we were having great time! Great suggestions, great atmosphere, very friendly and helpful staff! A+++","date":"2016-09-18 18:37:45"}
{"review_id":"MNQQgIKA85dqv2y7OZaTVg","user_id":"xCzmYGX7p_55F_4l79cf4A","business_id":"v9blKqAkFdEMusd6OaeRqw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Sheila is AMAZING!! She did a great job on my nails, they look so natural. I give her 10stars!!\nDefinitely will be a repeat customer!","date":"2017-03-27 02:52:48"}
{"review_id":"G-YhFo_55-3Br7DmF7BqeQ","user_id":"3I806vywudUaWV6yVGHE2w","business_id":"d4qwVw4PcN-_2mK2o1Ro1g","stars":4.0,"useful":2,"funny":1,"cool":1,"text":"I was excited to finally eat here. I ordered Carne Asada tacos and rice and beans. The food was great the chicks were hot. The chip and salsa were good.","date":"2010-01-08 18:26:09"}
{"review_id":"zJc_P1A5z8FntKPLsK04cQ","user_id":"Pvb59pY9rcZM5xo1quPbbA","business_id":"eaNenRk_liZBERFFLCXqqQ","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"The high quality Korean BBQ that started it all in Vegas...One of my favorite kbbq places in town.\n\nBeef combo is usually what I go for and they will cook for you!\n\n Three things stands out the most for me. \n1. Skirt steak\n2. Aged short ribs\n3. Ice cream that comes with the combo\n\nCome hungry and give it a try!","date":"2018-08-24 00:08:38"}
{"review_id":"Z5ZyjaOtBjWGJ6eT0AHqxg","user_id":"lkUZqtZFPDXwdCO5EKdgHw","business_id":"KWojrEKjUqHCRI5HO7pB4g","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"After my scathing review of the Perez Museum in Miami, I thought I better balance things out by telling you about the AGO, which (I feel) is an example of how to do things right. Had lunch at Frank (on site restaurant), which was quite chic and the food was delightful, but a wee bit spendy.\nThe gallery itself is beautiful and interesting. I've been twice in the past 6 months (to see the Turner exhibit and the Lawren Harris exhibit), and have been impressed by both the special exhibits and the regular collections. The special collections are an additional fee, but in both cases, well worth it. \nThe gallery is spacious and well lit, with an interesting mix of trad and modern art. I still need to go back again, as I didn't get to spend as much time as I would like, and am pretty sure I didn't see everything.\nIt's a great way to spend an afternoon. The staff is polite and well informed, gift store is eclectic and fun.","date":"2016-08-25 13:02:30"}
{"review_id":"sk7D4DcUxnLNxOP0oHhmRw","user_id":"3PnzCtO4eEagc9vq9rZGNw","business_id":"_WvEXsx2eZ53lTWHlIx9kg","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Went here for lunch with my mom & her friends today. Over all the staff was great! Two thumbs up. How ever the food was okay, they gave us the wrong flat bread & when told they let us have the wrong one to munch on (we were starving!) and made the correct one - I think, it said pork belly was on it but it looked more like brisket. They also gave us some Carmel popcorn (the best part of the meal! Then at the end we ordered 2 cappuccinos but they were clearly espresso with no milk, and had to request half and half to go with it. So in short- okay food, excellent service, with some hiccups that were addressed extremely graciously.","date":"2014-02-05 22:27:19"}
{"review_id":"_wdtCZ42rXR-KyvR6LXfaA","user_id":"DtajKETYfOtSsKJCD33SOw","business_id":"VrGI7_nRjXpn0415S3coGQ","stars":4.0,"useful":4,"funny":5,"cool":4,"text":"3\/5\/11\nConsidering how disappointed we were with Lotus of Siam last time in Vegas the bf was wary of trying Thai again until we found Thai Style Noodle House! We tried the thai style noodle with beef which is their pad kee mow...and the beef combo noodle soup...\n\nSuper crowded and cozy...the service was good but there was a slight wait for food obviously...the beef combo noodle soup was very interesting... not sure I'd try it again because it wasn't spicy at all! LOL \n\nOne of the better tasting Thai places in Vegas...","date":"2011-03-20 08:01:57"}
{"review_id":"9Il2VDNs_CAZa1rMoudluw","user_id":"QTLL0xbcy7AyLUPJogk5kg","business_id":"0EUohlWGBPnIgzCULyWl7g","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"this place is lame! my boyfriend and i decided to check it out because it was their very first 80s night and some dude working for the club gave us a free pass.\n\nso we waited in line about a half an hour, dealt with the rude doorman, got in and um. not much else to be said. \n\n\"80s night\" was going on outside on the patio, and they were playing the worst of the 80s. bad 80s\/hip hop mash ups were going on inside with trashy mid-westerners dancing on tables.\n\nwe chugged our drinks and were in and out in about 10 minutes.","date":"2009-10-15 08:13:32"}
{"review_id":"0yBD9KFf4Bvf3Ta00Twn4Q","user_id":"8Ad4ErIl1mZiZ_2kvI6MVA","business_id":"2lF1UsGcDpDpaI1lXgRX_g","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"This was delicious. I got the vegetarian enchiladas and tacos. It came with a side of fresh smashed potatoes (never had this as a Mexican place but i was craving it).\n\nThe water was delicious and fresh, the decor of the restaurant was phenomenal, and the service was good (not over the top, but nothing to complain about).\n\nPrices were very reasonable. I would visit again and take friends.","date":"2013-10-03 14:34:56"}
{"review_id":"rfHpwsrV0W-HISJgE8RMUQ","user_id":"Ry3U3-3JXf5GE8zjUG_cBQ","business_id":"6gFcUhaYdinTbIhO2pcvdg","stars":1.0,"useful":0,"funny":1,"cool":0,"text":"I went to a Spring Training game here on Monday 3\/17\/14.  The stadium is just off the freeway so I arrived in the area about 75 minutes before the game.  The traffic was backed up on the freeway and the main street was a mess.  I waited almost an hour to get to what I thought was the parking lot only to find out it was the parking for the local Marriott.  People were very frustrated cutting others off in traffic, being aggressive and I witnessed a road rage incident while sitting in the line.  By the time I made it to the Marriott lot, they had been out of spaces for 15 minutes but they did not have a method to notify people.  I blame the Marriot for most of the mess but the City of Tempe need to plan better for events.\nInside the stadium I found the place to be less than average for Spring Training games.  The food was not good, the customer service was average and we could not hear the speakers very well.  I will stick to other Spring Training facilities to see some games in the future.","date":"2014-04-01 02:10:32"}
{"review_id":"Udrs3BH9XpraS5e9R6MKUg","user_id":"WAZMAkUNQvEDAJB5uwDerQ","business_id":"hDL3Q-GNQlOuE04_zWEMJA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"We got there by 5:30pm and most of the dishes were cold, as if they been sitting there since noon.  They never refilled our drinks and tried to rush us out.  I would never eat at this place again.","date":"2011-08-24 23:09:57"}
{"review_id":"WEw6ymSk3N0LY4xLpvLWZg","user_id":"ekO1FoeD8c9uqIQokBLCSQ","business_id":"TKaND6oV1n2ylnCYoAfoag","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"THE TACOS. I got pastor, asada, and chorizo. Authentic. Delicious. Nice topping bar with cilantro, limes, onions and sauces. The market itself is cool to walk around and get unique items as well.","date":"2016-03-17 16:22:48"}
{"review_id":"9I5wJ9ZG4wegRPS__Zq8gQ","user_id":"QgbfaTwsjBksgUyJZA4P9A","business_id":"j7TsOIl_pZm2wzs13-pRDQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I really enjoyed my stay at this very reasonable hotel.  The rooms are very spacious and clean.  I really didn't expect to get a warm continental breakfast included at the price I paid for the room.","date":"2016-01-15 21:12:05"}
{"review_id":"aR81GkM3Q9kcJbPxbBnuYw","user_id":"DZEClXcmhoTk2caP9gpl5w","business_id":"bM3ARXFMxGrntnHS6a7vEQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I must have walked by this place a thousand times working on the square. Never knew what it was exactly. Came up in a search of \"Asian \" ? Amway, saw the reviews and walked over. The buffalo paninis with a side of black bean and corn salsa was very good. At $7 the price was fair, I think the yelp menu may be outdated. The desert case looked great and they have breakfast items also. There was a gift area too. Cool place and I'm far from vegan.","date":"2014-12-17 18:04:16"}
{"review_id":"SmbjoJCoTvY24FhVACTyfg","user_id":"fFFTeVrZfTWuvbJXNKb-vQ","business_id":"HmsCerK_rub0Ulo0aC0f9A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great little sushi spot \nTook advantage of all you can eat to sample lots of different types of fish \nFriendly  staff \nGreat variety of items on the menu \nA must try","date":"2016-03-07 00:53:38"}
{"review_id":"Lx-ervsT1BqUL7OfW-Lb9A","user_id":"IIE2OX5haarGNefY23R8BA","business_id":"jM6JjZXFAQQANwdlEwbH3g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My absolutely favorite mushroom pizza in the city, Great brunch spot - really reasonable and you can always get a table, because it's really big and has indoor and outdoor space.  I think the ice cream is homeade.  A neighbourhood favorite!","date":"2016-04-23 03:32:19"}
{"review_id":"641ca8i5v5RZK9IngojV2Q","user_id":"xFSLb_pxXta5G4oaRB1ylQ","business_id":"TspQ9jCczz436RiJHJQYZw","stars":5.0,"useful":4,"funny":3,"cool":3,"text":"Hands down, the BEST kabobs in Vegas. \n\nI stopped here late after work one night on the way home after having passed it at least a thousand times, and decided to give it a try. I went in, placed my order, and after about 15 minutes, was on my way home. \n\nThe inside is cozy, there is a new hookah lounge upstairs (not technically the same business), for those who might be interested in that. The tables inside were pretty low key, but the kitchen area is open except for some glass, so you get to watch your food prepared while you wait which is always a nice touch. Some people don't like that, but I do, it forces restaurants to practice more hygienic practices because customers can see more. \n\nThe young lady who rang me up was helpful and friendly. The gentleman who gave me my food, apologized for the wait (15 minutes is not long in my book, but maybe for some it is), and said that calling ahead is a great option if you're ever in a hurry in the future. \n\nI ordered a lamb and chicken shish kabob. They were both DELICIOUS. Many kabobs in this city are incredibly bland and under seasoned, definitely not the case here. The rice was also well flavored. The green sauce that was at the counter where you pick up your food was perfectly spiced and I put it on EVERYTHING! I appreciate the fresh lemon wedge that was included in my to-go container. \n\nMy only real complaint was the price. It was more than $17 for two kabobs, which I thought was on the expensive side. If they took their prices down around $2, I'd be here way more often that is good for my wallet...","date":"2016-03-06 23:58:31"}
{"review_id":"Y_hUyMWEN6XjtKVXuoT8Qg","user_id":"sA5W9l1szGmeAOWAzTDaew","business_id":"RNi6tW22UMgHwWLAb0mYdA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Lawry's is everything a good restaurant should be. We came here to celebrate our anniversary and Lawry's made our night unforgettable.\n\nTheir service was impeccable- from the sweet hostess who was unfazed when we arrived 30 minutes late to our reservation, to the warm friendly bartender who chatted us up like we were old friends, to the waiter who was not condescending in the least bit, to the busboys who guided me back to my table when I drunkenly stumbled into the kitchen.\n\nThe food was solid. The prime rib was balanced with just the perfect amount of richness and seasoning. I ordered a medium and it was a true medium- the edges were seasoned and done well while the interior was still a soft pink and juicy. My date loved the Yorkshire pudding, I wasn't really a fan, but it was airy and puffed up to perfection. The mushrooms were rich and earthy, the perfect accompaniment. The mashed potatoes were smooth, creamy, and deliciously well seasoned. No bland taters here.\n\nAll in all, we had a truly wonderful evening at Lawry's LV. We decided to skip dessert because we were stuffed and totally satisfied, so our waiter went the extra mile and boxed up a mini cake for us saying that we couldn't leave without something sweet on our anniversary (!!) Major points up for this, we were an intoxicated mess that night and he should've just shooed us out the door. I left with a huge smile on my face and a slightly renewed faith that there are still nice people in the world.","date":"2012-03-30 08:28:26"}
{"review_id":"mnHBGv8fv51kSszfS_SBSw","user_id":"LmPxZshPCXBd4mrERDU8RA","business_id":"atNpoWy_XrhT9EUIEP6azg","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"I loved this place!!\n\nFirst, my drink was delicious!  I ordered the bellini and it was definitely one of the best that I've ever had--kind of fizzy, but so good!\n\nThe bread and butter was hot and delicious!\n\nI didn't LOVE the Field Salad, but it was okay.  But I did LOVE my steak and french fries!  When asked how I wanted my steak prepared, I said Medium.  The waiter suggested Medium Rare since it's a thin hanger steak.  I'm so glad he suggested that.  It was perfectly cooked for me!\n\nAnd I would love to try the dessert one day!  Looks delicious as well!","date":"2009-08-03 20:45:00"}
{"review_id":"vQxJvbInA6D7ToMixXGcrQ","user_id":"mmpuZFDBTa_0OMGr9_fiJA","business_id":"Q2Gd5Dmqtii59EheSjsA-Q","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"I purchased the Groupon and I honestly shouldn't have. I could've painted my nails better at home and saved $30. It was a rush job. The nail polish isn't even covering the full nail on some nails and other nails, the polish covers the entire nail and a lot of skin too. I had to ask her to clean up the nail polish on both my hands and feet. A customer should never have to ask that question, the nail tech should be able to see that themselves and fix it. Well, she cleaned it up... and there is still polish on my skin surrounding my nails. Needless to say, I won't go back.","date":"2017-09-08 23:48:03"}
{"review_id":"6jnlUFbMyNK8H-qz3eR-Lw","user_id":"3gm_H_pt20MSNXxPObkhIw","business_id":"iSBy71Dg2du28YC9ewVa-w","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I will honestly state that the pre installation process can be a bit disorganized.....BUT\n\nI recently had Paradigm Luxury Vinyl Plank flooring and new mouldings installed on Saturday, March 24, 2018 and I spoke with Marshall about obtaining his best installation team since I'm quite hard to please.  Well the installation went flawlessly, they had a can do attitude, listened intently,  did a fantastic clean up with every piece of plank and moulding meticulously placed!\n\nTo me the quality of the installation and competitive pricing is of most importance and Cloud delivered!","date":"2018-04-04 02:55:16"}
{"review_id":"6qFnJWDmVdIboy50BnJZ0A","user_id":"OJJSJyh_YUQWxUYAuPtUGw","business_id":"6B2z54cn3Ak38UCiPq0luA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I have been going to Timeless for just shy of two years. Amanda is my tattoo artist. I have about 10 hours of work done so far with her. Every time she has impressed me with her ideas. I come in with an idea, she makes it freakin awesome. From american traditional to Harry Potter she knows wassup. Clean shop, friendly atmosphere and you want a place that has experience and won't BS you, than Timeless is def a the choice you want to make.","date":"2016-10-26 15:27:19"}
{"review_id":"Nr5hefDW-Yitb3jYgmL2UA","user_id":"k1zNCz3JODi3YN5sXcKApw","business_id":"8F-UdXe_YylX3k0L1SEiRg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My family and I love this place. The food came out fast and nice customer service! We been coming here for five years now! We refused to go anywhere else, lol we are 3-4 times a week, because I can't cook","date":"2017-05-13 08:56:04"}
{"review_id":"mrK-GF4zYYj8A3oIlvUVTQ","user_id":"wurJLbqM_iM0R64dQ8r3Qw","business_id":"z9lOfnUorcbWR_xS0DSeHw","stars":4.0,"useful":2,"funny":1,"cool":1,"text":"I came for a quick bite and just ordered from the appetizer menu. \n\nThings I had:\n\nSweet Potato Pancakes: these were very interesting and not what I expected. They appear to be deep fried pouches of a sweet potato purée-like filling. The balance between crunchy outside and gooey inside is a nice balance. These are only slightly sweet and I wish weren't so oily.\n\nBeef in Lettuce Cup: the plating was nice but not sure how they got \"cups\". I expected lettuce  wraps but received beef with lettuce pieces. I could not scoop then into lettuce cups as the lettuce was chopped too much. Flavor wise this was DELICIOUS! I highly recommend this if you want a lighter low carb dinner, and it's much cheaper than the entrees and the portion isn't too much! \n\nAmbiance: a little dark for my liking and I went during lunch time. I sat by the window which made it bearable, otherwise it was way too dark.","date":"2014-08-24 20:25:08"}
{"review_id":"Bkn84S917TNvyReOrzM_bw","user_id":"V_fSO8w2zoV6n7JCqM54oA","business_id":"WpI8HWOVoHtCOOinszWDYQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Visited Captain Steve ' s for the first time today.  There were 11 in our party. Our servers were great. They had 2 large parties at the same time.  But we NEVER felt neglected. \nOur food came to our table at one and it was all HOT! \nEveryone received the correct food, our drinks were maintained full, and the amount of food was generous. \nWe order fish, shrimp, broiled items, & steaks. Smiles all around.  \nI WILL return whenever I visit the Charlotte area.","date":"2015-06-21 01:01:45"}
{"review_id":"3GX4KJL6w1LCTgwzMTyR2A","user_id":"ssgRnGGXxigWTEXM-n92lg","business_id":"LHOe8v2fX176bWA6JRd0Xg","stars":4.0,"useful":0,"funny":1,"cool":0,"text":"2015 St. Patrick's Day Festival highlights: Saturday morning parking was available for free at 1) Parking Garage near City Hall, located at Basic Road and Lead Street. Accessed from Basic Road and 2) Parking Garage near Justice Facility, located at Water Street, near Basic Road. Accessed from either Water Street or Texas Avenue.\n\nA must see is the  Carrolier Academy of Irish Dance! The children participated in the parade and scheduled events throughout the weekend. Led by Debbie Carroll and Shelley Locklier, the two dancers have Irish dance teaching credentials; both teachers travelled the world with Michael Flatley's Lord of the Dance.\n\nFun for the children included the ferris wheel and carousel.  Since the Las Vegas Valley does not have a permanent ferris wheel and carousel to ride, we enjoyed taking a twirl on both.  Ferris wheel tickets were 4 tickets per person. Carousel tickets were 3 per person, but an adult is free if standing next to small children who are on the ride.  Each ticket = $1.25.\n\nI would like to see a greater use of food trucks.  We saw pizza, Mexican, Filipino, hot dogs, cupcakes, and snowcones. Come on Las Vegas Valley food culture, come out and show us what you offer.","date":"2015-04-01 15:16:00"}
{"review_id":"as3dFVDDw_XHDtp749rWmw","user_id":"zzaq5Fn1U2Feut3dGxidNg","business_id":"8nP8ghEpT6WFcM6tfqAaGA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My favorite (sentimental) ice cream spot in all of Arizona! \n\n$4.95 for two big scoops of ice cream, chocolate sauce, malt crumbs, whipped cream, and a cherry? The Dusty Road Sundae is terrrrrific. The average sundae is $6.50, but that's a steal compared to other places.\n\nThey have about 10 traditional-ish ice cream flavors, the prices are reasonable, the storefront is classic, the interior is huge with comfy booths, and there is a small-ish arcade in the back. Only a 10-minute walk from Scottsdale Stadium into Old Town Scottsdale.\n\nIf you're reviewing this place based on the food, you're missing the entire point of the Sugar Bowl. It's a 1950s ice cream parlor, not a modern ice cream store with fancy new flavors.","date":"2015-03-18 19:23:03"}
{"review_id":"qIGE1UVG1cNSjZRGMeL01Q","user_id":"NJo1UC18X5fWMHNM-7brlw","business_id":"QC8cV2iUE7dtXW-CayBgUg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I live in Austin, TX and have an old 1992 Porsche 968.  When I need parts for my car I call these guys directly. They find or get what I need for my car, and at a great price. Lots of Porsche dealerships and parts departments don't even know what a 968 is till they punch it up on there computer. Next time I'm in Las Vegas I'm gonna go see the people at Gaudin! Maybe they'll let me test drive a GT3 RS!!","date":"2018-04-27 20:02:01"}
{"review_id":"REts4jBM0y24jXfuNrvEFg","user_id":"NGuMR5J-N3TJ-d2XOfOhag","business_id":"1QJFpZxLbHbXSKohWp9uIA","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Whenever we have out of town guests...we visit RWB.  Everyone is always impressed and always LOVE whatever they order.  Be sure to check out the specials - there are some yummy, yummy things listed there!  The portions are HUGE!","date":"2009-03-01 01:57:52"}
{"review_id":"saJUbTtnictm8KFx6cNNJA","user_id":"RRhco4irDXPk5EJmvuwr2w","business_id":"PMPMHHLe9vFzcR67iCjgLA","stars":5.0,"useful":0,"funny":0,"cool":2,"text":"Been to this a couple of times. Excellent food at good prices. Love the tea they provide at the end. Nice friendly staff definitely a place to visit","date":"2016-01-17 05:23:59"}
{"review_id":"88YNDP38RsjkQSVPSllXRQ","user_id":"lErQHDX-b88lHU3RRjeQtg","business_id":"4vDT_wMX9KSehuICvE_urA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I used to go this office, but as other reviewers have noted, they made a pair of glasses wrong (one lens blurred, could not read with that eye), and then told me, well, your other eye will compensate so you can still read. Really???? What a great way to handle an error in the production of the glasses.  When I objected to being relegated to reading with one eye with my new glasses, the reply was...\"Well, then you'll have to see the Dr. again, and no, he is not available now.\"  No offer to look up his schedule and see when I could see him again, or see if another Dr. could see me then to resolve it.  After the poor response to the problem (you would think they would have some professional way to deal with when glasses come back from the mfr\/lens maker and there is an unexpected issue).  I told them I'm not a patient here any longer and took my useless glasses home and resolved to find a quality optometry office and start over.  I did call back and spoke with an Office Mgr, who stated she would look into the matter and get back to me, but never did.  So I called again and toild them to toss my file out and not contact me again for any future appts. \n Another thing about their exams.....as part of your exam, they offer to take optional (extra cost) retina photos so you can also have a look at your retinas on a computer screen with the Dr., using a clumsy cube-shaped camera. You sit there and they have you smush your face up against a flat glass panel on the front while they take repeated attempts to get a good photo of your retina. They charge extra if you want this option. Then they raised the price, and I declined due to raising the price. They were charging plenty for that option already.  I moved to a different office that does not charge anything extra at all for the retina photos, and uses a better camera than the camera cube, so no more smushing my face against a flat glass window.\n(Note: using fake name here for privacy protection from internet identity thieves.)","date":"2018-07-17 00:21:32"}
{"review_id":"h0WIzX3KjDB4LeIhLQ3bvw","user_id":"ea-FFbghzx-nm4YZthLJaw","business_id":"Ec9CBmL3285XkeHaNp-bSQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Came here on a Saturday for dinner.. there was a wait for a table so we decided to sit at the bar for a drink until the table was ready.\nEnded up ordering food at the bar and giving away our table because Emily was so cool!!\nSeriously, my favorite bartender. EVER.\nAttentive but not annoying.\nHandled everything (being the only bartender there) very well.. timely and efficiently.\n\nDrinks: Moscow Mule and Vietnamese Donkey\nBOTH SO GOOD.\n\nFood: Lobster Pho.. 5 stars. Delicious\nOx Tail Fried Rice: 5 stars. Really good, and actually had good chunks of meat and a yummy over easy egg on top. \nFried calamari: big portion (we had leftovers) really good kinda spicy dipping sauce! \n\nOverall, 5 million stars","date":"2017-04-30 04:05:21"}
{"review_id":"ZmwNDuUIeVzUMXOAxp69ag","user_id":"uhXDfdIYPaI51_VIMgn-wA","business_id":"ZGaW5a7wxXxUgGTtbFqNxg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Food was really good, but $14 for a carry-out Greek salad seemed kinda pricey...","date":"2017-06-06 19:01:17"}
{"review_id":"9uvJ1swxqPGTBOwzAwskAg","user_id":"U5hGl2vTIXG8CABB71BOwQ","business_id":"L16ly2UGc9j4qO3Id8Gx3A","stars":1.0,"useful":0,"funny":1,"cool":0,"text":"After being a regular at Veggie House i thought it be cool to try Chef Kenny's. We went there a couple times and usually had a great experience until most recently we ordered spicy crispy beef and it came out cold and we told the waitress. All they do is bring you hotter rice but pretend not to hear you about your request. I called back to share my experience and was in shock. They actually put Chef Kenny on the phone which At first I thought was cool. Completely different than I expected, instead of being understanding the owner himself was very rude and told me next time I come in and of this happens to let him know but that's there's nothing more he can do because we already left. I'm sorry but there will not be a next time because I'm going back to Veggie house where they treat customers with respect. I also unfollowed Chef Kenny on Instagram as well.","date":"2018-08-23 21:27:10"}
{"review_id":"kQV85SJcJOkhgudHOzmiIA","user_id":"SIGMyncbCt2P7Sq3sCnrvw","business_id":"-4_n--u4Z_SBbgz1zUKpYw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Five stars all the way for this property! \n\nI stay here at least a couple of times a year, and for one of Marriott's limited service brands, the staff here really go out of their way. For example, when I changed reservations in the middle of our stay, they got me a better room and actually moved our luggage to the new room while we were out for the day. They also address me by name when I come and go. In particular, the woman at the front desk on weekday mornings is delightful, as are the two guys who work overnight.  I had even provided some constructive feedback the last time I stayed, and one of them remembered me and still treated me very kindly.  Even at the breakfast, the woman comes over, clears my plate, and asks if she can get me anything else. I have never had anybody speak to me at a limited service hotel morning breakfast buffet before!\n\nI also observe whenever I am in the lobby. This level of service is not just provided to me because I am gold elite.  Everyone is greeted with a smile, a kind word and a willingness to help.","date":"2018-03-23 15:11:59"}
{"review_id":"IBXGhyjpKjAwfNpyrrltXg","user_id":"8mLXf-R5YEr2pLfVrfSd3g","business_id":"U9aA5H13y7t9xWnoQslV0Q","stars":4.0,"useful":2,"funny":0,"cool":1,"text":"Q&D: Some of the best Chinese I've had in AGES!  Great atmosphere too.\n\nLong & Fishy:  \n\nI'd be surprised if you could walk by this place in Caesars and not notice the huge fish tanks filled with hundreds of goldfish, it's unreal.  People stop just to take pictures of the tanks.\n\nWe came in to grab some dinner and I have to say I honestly wasn't expecting much based on the yelps I read.  My experience was nothing like everyone else.  Our server was nice and friendly, the menu was big, the atmosphere was ultra cool, and the food rocked.\n\nThe one downside was that the food did take a few minutes longer than I expected, but when it did finally come, boy was it worth the wait!\n\nWould I go here again?  If I ever stay at Caesars again, sure.\n\nShould you go here?  Yes, it's pretty darn good Chinese.\n\n,\nSam","date":"2011-03-20 01:17:26"}
{"review_id":"EEKkgQv3xoS1qkFbl7b-Sw","user_id":"BBLpIfJSBQPKT-KgcUm6Zw","business_id":"Jz4LZvTibMEzXx8nZX5Q7g","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Some really great produce prices, which are what pulled us in.  We got a newspaper flyer from them last week and decided to check it out, based on that.  Still, I kept thinking, isn't this the place [friends of ours] went to and said wasn't that great??\n\nThe produce is priced well but it seems like everything else is on the high side.  Bulk food section was small-ish, I though.  I meant to bring a pen and paper to write down prices of items I usually buy, to compare RBN, WF, TJ's, and EEFCO - but forgot.  But long grain brown rice was $1.99 here, which is same as EEFCO.  I think walnuts are more at RBN, though.  Basically - don't believe the low price claims!\n\nI think we may go back for produce and that may be it.  Free parking is nice, though - they cover 2 hours, which would give you a little time to wander, too.  Parking is covered which is oh so nice.\n\nOne negative for families is no changing table in the bathrooms.   I had to change a diaper  on the floor of the bathroom on my husband's coat.  Yeah, the floor was pretty clean, but still.  Ugh.  Not a good thing for families!\n\nupdate - they did eventually add a changing table, but I guess their low priced produce and high priced everything else model didn't make many people happy.  Defunct!","date":"2009-02-28 23:53:47"}
{"review_id":"iRYMCBILS6Ic77Y_5Ii0vA","user_id":"Qh_QDSPPhWjJZ82kZnJPQg","business_id":"DYuOxkW4DtlJsTHdxdXSlg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I LOVE THIS PLACE. ever since i frist tried it in atl.\n\nok. first thing first. YOU MUST ORDER COCONUT SHRIMP (unless your allergic!)\n\nwe ordered:\n\nonion rings ( A MUST its frikkin huge and the sauce is awesome!)\n\nCrab, Shrimp, Mango and Avocado Stack Crab (its frikkin good as hell.. mix it in the sauce that is circled around the plate they go perfect together!)\n\nCuban Sandwich (eggs were missing from it for me but the bf said it was good)\n\n1\/2 coconut shrimp & Caesar salad. (like I said the coconut shrimp is to die for ::and if your allergic i mean literally::  the caesar salad was... meh.. the cruton were cute but the salad itself was whatevers.\n\nSERVICE AS USUAL WAS AWESOME! waiters were nice, patient and quick. waters were always filled as well.","date":"2010-10-06 06:33:07"}
{"review_id":"vxbTTt4GLzAGnmVa5qqBlQ","user_id":"IfLTw-yFMpuiqAdYRxLv8Q","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":4.0,"useful":9,"funny":2,"cool":3,"text":"Well, it's doubtful that I'll ever get to eat at the French Laundry so was happy that we got to try out his more casual, Vegas restaurant, Bouchon.  We ate here on the day before New Year's Eve so that may have been why we easily got a reservation at prime dinner time.  Everything from start to finish was pretty much impeccable. \n\nSourdough bread in the shape of leaves were brought out immediately with softened butter in a small ramekin.  One thing I hate is when warm bread is brought out with butter that is ice cold and hard to spread on the bread, so I really appreciated that the butter was the right temperature to easily spread.\n\nFor a starter, we split the Terrine of foie gras which was delicious.  It has a thin layer of braised beef ground down to a coarse pate texture, then a thin layer of foie gras, then a layer of prune gelee.  Served with crostini and a small frisee salad.  The slightly slightly saltier beef and the creamy foie went so well together. The prune gelee added that touch of cool sweetness that made it all work together.  A dish I would definitely recommend.\n\nFor our entrees, I got the Steak frites, and Mark H had the Leg of lamb (Gigot d'Agneau.)  Mine was hangar steak topped with caramelized onions served with a compound butter and a healthy portion of nicely crispy, thinly cut fries.  The steak was cooked to a perfect mid rare and was tender.  The onions and the compound butter did overpower the steak a bit, though.\n\nMark H's dish on the other hand, was the better of the two.  The roasted leg of lamb was just so tender and flavorful,  the knife cut through the meat like butter.  The lamb was served with flageolet beans and braised escarole.  Our server asked him when he was ordering if he wanted any sides to go with it since it didn't come with a starch but the beans and escarole was enough for an entree portion.  Besides, I know he wanted to save room for dessert.\n\nFor dessert, we split the Banana crepe gateau.  Layers of crepes with banana pastry cream between them, served with salted caramel and french vanilla gelato.   This was pretty amazing as well.  I've had some fantasic gateau de crepes in france and this one really reminded me of being there.  The banana flavor was a bit too subtle for me but that salted caramel was like heaven.  Such an incredible texture to it with that bright kick of salt, damn.  The french vanilla gelato was memorable as well.  Nice silky texture and oh so creamy.\n\nThe next time I'm there,  we really have to try their breakfast.","date":"2016-01-04 04:06:15"}
{"review_id":"Wj2scpb-B5i58fZbyzpE5A","user_id":"UER4m0CBVgcFlVbMqhCvCg","business_id":"upSPwM6Fr6RHAhwagnleow","stars":5.0,"useful":18,"funny":8,"cool":12,"text":"I normally don't bother with dealing health stores but I have wanted to try out a hydrogen peroxide therapy to help detox the body and I didn't want to wait 5 days for shipping from amazon and this place popped up.\n\nIt was relatively close to where I was and whole foods doesn't carry the 35% h2o2 so I stopped by here. Even though the parking was horrible, the store was pretty open and I was greeted by the owner (or I think it was the owner) and he was very friendly.\n\nI asked for my 35% food grade peroxide and he had some, and it was way cheaper than paying for it on amazon.\n\n5 stars for being clutch, and for having cheap prices. \n\nThis is a mom and pop store, check them out if you are in the area.","date":"2012-03-30 00:46:54"}
{"review_id":"h-TAhsvgDgeS83Dl0ZePRQ","user_id":"7m3e7gAAYWrZti-V7BkAOQ","business_id":"JmR31zZjh1yeNLAGjhW2fg","stars":1.0,"useful":4,"funny":0,"cool":0,"text":"$28 for a 15 minutes pedicure with used tools? I would never come back. The place seems new and having 50% back so my friend asked me to join her for a pedicure day treat. As soon as my friend and I got colors and sat down, there were three other customers came. There are not too many technicians working at this salon so they started rushing through my pedicure to get to the next customer. I did not say anything because my friend was beside me so I don't want to make her feel bad . The technician finished my pedicure in 15 minutes. After that, she got her small basket and ran to the next customer using the same tools that she used on me. The tools did not get washed. I was thinking the tools she used on me was already used on someone else. I hope I won's have any infections. I would never come here or let my friend come here again !!!","date":"2015-06-21 03:34:12"}
{"review_id":"cZEMR_a5mI90qZbl_rVI1g","user_id":"5xEcksoXnbAQYLWagcxgaQ","business_id":"ssZHf7vpLwVhjySlqefDaw","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"I've been to almost every cigar store worth going to in Phoenix and I have to say that the Tinder box has a lot of potential and that's about it. The store itself is nice but once you enter the huge humidor you quickly realize that somethings not quite right. the humidor is only 30 to 40%  full and of that 30 to 40% of cigars it's a lot of off brands, bundles and empty boxes of cigars on the shelves. When the cigar inventory improves the tinder box will warrant another look and probably 4 stars but for now it's 2 stars, you can't call yourself a legitimate cigar store without legitimate cigars.","date":"2012-04-28 19:32:02"}
{"review_id":"lFGpBaCGBWzjlTiS5_I3PQ","user_id":"iWsZrhQNLDivSrypzpfdBg","business_id":"APPZiUz_CEvR_--qY-tbig","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great place! This is our go to place for sushi in CLE. They have a tuna appetizer that is served in the shape of a heart and is possibly the most refreshing and delicious thing on a hot summer night!","date":"2014-06-11 15:50:27"}
{"review_id":"RSM88By7OWcVaiPhiDDjBA","user_id":"TwpFapxGnZwY9jFy0WjLJw","business_id":"UaYpgH8ATDNNY7Uoa5utdA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"First of all: the pictures on the website are incredibly outdated. My boyfriend suggested we go here at first, but when I googled it, I exclaimed that I didn't feel like watching the Jays' home opener in a \"dumpy ass place\". \n\nImagine my surprise at the nice newly-renovated pics on Yelp! It's a gorgeous space now. We live in the area, and I think this is our new go-to bar. We got a comfy spot in front of a giant TV to watch the Jays game, and our food\/drinks were great. The salmon salad came with a huge piece of fresh, healthy tasting salmon filet. It was just what I wanted. \n\nThe one wrinkle was that I wanted to swap something out of my salad for avocado instead (which came with the grilled shrimp salad but I wanted salmon, and not shrimp). The server told me they didn't do \"those kinds of substitutions\" but would check anyway. He came back, and affirmed that they couldn't put avocado on my salad unless they charged an extra $2.00. Kind of annoying. I get that if you're Terroni you can have a \"no substitutions\" policy but in this case, how about changing that policy? \n\nThe server really made an effort though, and said he'd bring over some guacamole instead. That was much appreciated :) \n\nThe hourly rentals to use the pool and ping pong tables are pretty pricey ($25\/hour) but it is a really nice space now, with nice, clean washrooms (important!), comfy seats, and lots of TVs. Will be back to watch more sports!","date":"2016-04-11 16:46:59"}
{"review_id":"LRKThZJaOENl0w6UpAL2xw","user_id":"_TVVlxhRqV19gdyZHTxctg","business_id":"I7ZzsHeuf1IQyrG3JyECmg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I was excited to try this place after seeing the reviews. Unfortunately this place was a real let down. The best thing about this place was the corn tortillas for the street tacos. Service was friendly. Ordered the tinga, viniargretta, and carnitas. All bland and nothing special. Salsa's ranged from very hot to hot. Most were hot without any flavor. We won't be back as there are better options with more flavorful protein and salsas to choose from.","date":"2018-03-15 22:39:28"}
{"review_id":"vNe0e9r5TyxLiuzYOY6coQ","user_id":"9urf9uT1i2N7pM3tkgpI4w","business_id":"urkODQ1jX0qQzgbqsQjWVQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Love the menu, love the service. I had lunch here on Friday for my first time here. There was a line of course when I walked in at 12:15 and the place is definitely a little noisy. Right away someone greeted me and asked if I'd be eating here or taking it to go. She reserved a table for me and my friend so we didn't have to wander around trying to find a place to sit after ordering (always the worst part of restaurants like wildflower, paradise, etc). We ended up spending $35 for two people for lunch, but I'm ok with that since we got two salads (both with protein added), iced tea, and fresh juice. My husband even commented that the food was much better quality that what we'd get at another fast-casual type restaurant. \n\nI ate here again a few weeks later - called my order in and it was ready to go when I arrived. They even have a separate door and counter for take out. Not cheap - $22 for lunch, but that's on me for getting salad with chicken, juice, and a brown rice krispy treat. I was still hungry later that afternoon - portions aren't huge, but quality is top notch.","date":"2014-09-09 19:00:04"}
{"review_id":"q0lJ7-1tOhB-3Hua_1koJQ","user_id":"S_a_7OjFxA0HRNIRK17DIw","business_id":"WunR7VclAddvbCnc-97jzg","stars":2.0,"useful":4,"funny":0,"cool":2,"text":"Hey, I love the Vig Arcadia. I would go there all the time if it was closer. Great food, cool place, good atmosphere, and the best band on Sunday. I even had my birthday party there, with people driving all the way from Gilbert and Queen Creek.  I like the Vig McCormick ranch, same great food and cool atmosphere but still a bit of a drive. \nI was so excited there was a Vig being built right in my neighborhood. I watched the construction progress on my way to and fro work. I told my friends who didn't know about the Vig how awesome it was and how excited I was to have one close. It was going to be my number one go to place.  I have been going to Local Bistro, Modern Sports Grill in DC ranch and Isabell's. Now there would e a Vig which is closer and better.\n\nI went to the Vig and it was ok, I figured they had just opened and they were still hiring and getting organized.  I went  again. Food was great, bummer no band due to Scottsdale rules but DJ is nice. Service ok but its busy on a Friday. I went again, food great as always but service still lacking. I figured its just busy. At this point I had gone 4 Friday nights in a row. Its close great food and I have always loved the Vig. \n\nI don't get why I have to wait so long to get a drink at the bar. I don't understand why once I get a drink, I'm not offered a refill or second round. I'm trying to unwind on a Friday night, I don't want to have to work to get the bartenders attention to get a drink. \n\nOk had my cocktails, now time for dinner. The food has always been great. Good taste, good variety on the menu, priced fair. Why does it take so long to put in my dinner order? If I have been there 5-7 times, I have had to wait to order too long maybe 5 times. The food comes out quickly enough and luckily its good since the wait staff doesn't check back. \n\nMy friends and coworkers know I go out to eat quite a bit. I am often asked for recommendations, I had said to go to the Vig but I feel I can't recommend it anymore. If anything I would say to go somewhere else. I fell like the McDowell Mountain Ranch location has been open long enough to be running smoothly but its not apparent in the bartenders and wait staff.  \n\nPlease get better with your service. I want to love this Vig as much as the others but its getting hard. \nI work hard for the money I spend at the Vig and don't like feeling unappreciated as a customer.","date":"2017-10-24 19:29:18"}
{"review_id":"iUFvcJ1ANyrfE_KasHUdRg","user_id":"wRbcBWdiyeCDUydcBQcYfg","business_id":"2GmGT-7QjowR1ihup3FbVA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I was so excited to try this place after many people recommend this place. When we arrived we had to wait in the entrance for couple minutes.  Than we were placed at a table and the server came 5 good minutes later.  When he arrived we ordered drink and food.  We had time to visit all the shop and after wait at the table. The food arrived  and all our meats were dry and hard. The tabooli tasted like the presley was old... we all left more than the half of our plates and very disappointed..","date":"2015-07-16 05:57:44"}
{"review_id":"Ow6zsH5nfy5J_zU3nkWz1w","user_id":"Vb2u6EcBCBf1_LJSHpiWMw","business_id":"w3gg3OaBTOAZpotv-i80hA","stars":1.0,"useful":1,"funny":2,"cool":0,"text":"the most low quality catering in persian catagory. we had party on persian new year and every one paid for the food to be cater through this place.\nthe food was not even enough for everybody and the quality was bad.\nI feel so bad for this business,","date":"2015-04-01 14:14:58"}
{"review_id":"s-hMH69u_MMwcNBRk7DPjw","user_id":"UHV0B24i_IVOKyXcRe9IeA","business_id":"oyjkEn5fAqcGNsBbqc8LTw","stars":1.0,"useful":0,"funny":1,"cool":0,"text":"Table of 3 on Saturday March 25 around 8pm.. Well the service was terrible. . the host this night took us to a dirty table. . that waitress brung one glass of water when clearly all 3 were empty. Her hair was too damn long and should have been pinned up.. She reaching all over the table and my food.. I couldn't enjoy my meal i was pissed... First time at this location and will not be returning","date":"2017-03-27 04:04:41"}
{"review_id":"UqskD2QVe53bT47CDaJkFQ","user_id":"odHJ5JAWEdes_HV8Q3BMKQ","business_id":"7wHLFohwCw8l6WS-feLjeg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Food is super fresh and delicious! Loved everything and wished I had room for more. Amber took great care of us. Can't wait to go back and bring more friends and family.","date":"2018-07-07 20:56:07"}
{"review_id":"UcBJrncwfqj63u-z1E8Flw","user_id":"lgh7a1Qey0bbmv5JIQ1beQ","business_id":"Ec9CBmL3285XkeHaNp-bSQ","stars":5.0,"useful":2,"funny":1,"cool":2,"text":"So far one of the best customer service I have had in a while. Everyone is pretty friendly and helpful, they make sure you are comfortable. The food is pretty good different compared to other places. Highly recommended especially if you like seafood.    Everything you eat will be flavorful its like a party in your mouth. \nThe place is big so it is good for big parties. Some of my favorites are the \nOyster \nPork belly bun \nSteak and eggs \nOxtail pho \nSlow braised pork belly in coconut juice\nCoconut mojito ( verry good!) must try \nBest of all the big bone soup this a must as well \n\nThe price is also decent considering how good the food is. Typically don't write reviews  unless the service is really bad or if I had a really good experience. With all that said Kudos to the staff for such wonderful customer service please do keep it up because for sure my friends and I will be a regular. :) \nI love that they are open till 4 am on the weekends.","date":"2014-04-01 06:22:54"}
{"review_id":"jYThZzXQMXRy0II3JNIwIg","user_id":"FoVJ2W2-Gtj4LxdA-EBuXg","business_id":"aeYjLZ0t15D3Rtiz7Woy3w","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"While Cox maybe overprice and give crappy customer service; they are HEAVEN sent compared to these jokers. I called to get a quote, I made sure to ask him that no service will be started. I didnt agree on a price or speed. They started the services anyway. I called to cancel after I got notified of a pending bill. $151 still. If you like your a$$ , stay away. If I could give negative stars I would. I think they paid someone to write the 5 stars reviews.","date":"2017-05-26 01:26:56"}
{"review_id":"2haJu1Bl8JHdUryeWXu1HA","user_id":"Kl6jNDAE7PG_VVQafIptxQ","business_id":"IfUkm42SB9D0m_ZbkQ711A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Wow, this baby's got no love on Yelp since 2010! What's up with that?\nWell, you guys are missing out because YUM. I recently tried the shrimp burger at this cozy little hole in the wall, and was pleasantly surprised at how good it tasted. I mean, it consisted of  burger buns, lettuce, swiss cheese, onion, tomato, and about 6 sizzling, crunchy shrimp which to my knowledge didn't have too much garnish. Still, the combination was oddly very satisfying. I like my food to have a lot of flavour through sauces, herbs and spices, but the dressing wasn't at all necessary. Great little place.","date":"2013-04-10 17:43:11"}
{"review_id":"mlnj9zuUP8y1kWjhRLerbw","user_id":"lShVqncthsaSB4viUhob1w","business_id":"cHGu7VWETFPGSWrNUdXGeg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I've driven by this place countless times on my way to work but finally got the chance to stop by early this afternoon. There was another couple sitting outside (they only had 2 tables with 2 little chairs outside, so not much of a patio incase anyone was curious). \n\nAnywho, me and my boyfriend took a couple of minutes to decide what to try because there were at least 30 flavors to choose from. The small and medium give you 2 flavors to try from, the large gives you 3. He chose the small with coconut and mango gelato and I had the small Oreo and dolce de leche. \n\nThe coconut tasted AMAZING. But the mango was the show stopper, it was amazing. To anyone who loves the fruit, this is just as good if not better (yes, I went there!)\n\nThe Oreo tasted like plain vanilla. I barely tasted any cookie pieces. So avoid it unless you want a plain vanilla taste. The dolce de leche was really good, a little on the sweet side but still enjoyable. \n\nAll in all, we paid about $11 for both small gelatos. It was worth the price and if ever I'm on the danforth and craving something cold & sweet, this is where I'll go!","date":"2014-05-25 23:49:46"}
{"review_id":"CbwmSDCidwUHXRgjaEYJiA","user_id":"liJS3rpRalcZM4G-uHZLjw","business_id":"bsrj9_hFAql3dlSf244zpg","stars":2.0,"useful":0,"funny":1,"cool":0,"text":"I would have given this place 1 star if not for the service from the front desk.  I checked in on Saturday during memorial day weekend, waited 30 minutes to try to valet park my car and failed to get on the porte cochere due to mismanagement and understaffed valet crew.  There is no excuse for that kind of thing at a hotel especially where there is no self park option.  Ended up parking across the street at the mall to check in, ridonkulous.\n\nThe service at the front desk was good to great, they were apologetic about the valet and whenever I called down for my car (once I was able to valet my car), they fought to have my car ready by the time I got down.  Accommodations are decent, nice big jet tubs, good sized rooms and a mini kitchenette in the studios to boot because these are condotel units.  The location, despite being off strip, is workable because you're walking distance to the Wynn and directly across the street from Fashion Show.  If you're staying here, you probably don't want a casino and so being next to fashion show is a plus.  \n\nI can't stress how understaffed this hotel seemed to be and so I probably won't stay here again if I'm paying the same price as a on-strip 4star hotel.  I was able to book at a $100 discount to other comparable hotels with a casino though so something to keep in mind.","date":"2012-05-28 19:53:06"}
{"review_id":"BQnSsHBx2knw5oCGoXpRkg","user_id":"NdmLQWsrGnGgWi4k0Jb0bg","business_id":"JZwPJyoJnqlfjCsrnSUmNw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Delicious, delicious, delicious. Zuppa's Deli always has a clean and friendly atmosphere. Their food is cooked to perfection & ready in a time efficient manner. They always have kind employees which makes the atmosphere even better. They offer many options with mixing & matching meals. Their menu is one of a kind. 5 out of 5.","date":"2015-12-20 19:55:51"}
{"review_id":"jdeXUl1zbo8Vsf0TENrYVA","user_id":"SCe2nY8q7x1Lozwf4tqU3w","business_id":"xA6L2w_TlbxHubb1xeBE8w","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"Last night we had a take out of Butter Chicken. I ordered it as medium spice. The butter chicken sauce tasted like sweet tomato sauce. It reminded me of panera bread tomato soup. It was that sweet. Tamarind used to have good delicious food. I don't mind paying more for delicious food but their quality has gone down. It's more expensive than other local establishment and food quality has degraded as well.","date":"2017-01-28 00:40:36"}
{"review_id":"wu_BtVvqgYAUepwUnEc3NA","user_id":"fk-jBk1cFF9rsU7Mt-bV2g","business_id":"8un5h1h8NXs0hzeVraaPbA","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"This is not the place for Italian food.  It is a pretty generic Americanized Italian food chain joint but if you ever want Beignets, come here and order the zappolis... They call them Italian doughnuts but they are basically just beignets with chocolate dipping sauce and are great!  Other than that... I sat at the bar and the bartender was super sweet and nice, his name?? but the check said \"khutso C.\"  Sooo, I think his name may have been Chris?? He was great, the staff at the bar were very friendly and cool but there were two guys at the door when I came in that had an attitude problem... I walked in and said I was going to the bar and they stood there looking at me like \"whatever!\"?? I mean... Come on, they didn't even have to seat me, thus do their job, so what was up with the shitty looks?  While I was waiting I tried the crispy asparagus app and it was good except it came with this heavy sauce.. I asked for balsamic instead and it was much better!! Also I have to say they had no problem with me using my small vaporizer at the bar and Chris and the other bartender even complimented me on it;) love a vape friendly bar!! All in all, for a chain the bar is great but if you want Italian food this isn't the place... It's like any other national chain, pretty Americanized!  Chris and the other cool bartender should be working somewhere high-end, they were the best part of the visit!;)","date":"2014-07-28 01:38:10"}
{"review_id":"VdEUhQZ9sdQZ3HvvozMrVg","user_id":"KWFiZKiZBANVxuhm4MLBNw","business_id":"gBy6UXTpoSHhW6qd15XU0g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Lakes Lounge is a great place to have a meal. My husband and I read a review about our neighborhood eatery 4 years ago and have been fans ever since. We work hard and like to treat ourselves to a great meal and this place competes easily with your top establishments.  The food is exceptional along with the great customer service. We love all the people who work there but watch out for Brandon...he does not make you feel welcome or gives the excellent customer service as the other employees. You will absolutely agree when I say that Lakes Lounge is a fabulous place to dine, but just avoid Brandon. He doesn't do this place justice by being an employee there and probably should re-evaluated.  Maybe the owners should have a secret shopper eat there to understand what I'm talking about. If it were not for the other staff there I would take our business elsewhere. Don't let one BAD APPLE...well you know the rest","date":"2015-08-07 01:17:43"}
{"review_id":"JduSoCM6fn6a8EpfZoL4pg","user_id":"4bxhIKz9ePWqD93UkEjnbg","business_id":"NAigH4SqnuuQip8lekq7GQ","stars":5.0,"useful":3,"funny":2,"cool":4,"text":"Another great Port of Subs experience! The XL #1 on white with double meat! That's a beast of a sandwich and great value!!! FYI, a 2 foot sandwich is just a really good deal on two 1 foot sammys. But you can top them differently so sharing is possible, easy, and probably recommended! :)\n\nOh, don't forget to pick up a Port of Subs loyalty card and register it. Every $100 gets you a free footlong sub of your choice and registering it online earns you a free small sub during your birthday month.","date":"2017-01-27 21:39:23"}
{"review_id":"FqXuMs6O8Z4-YJ3m-s1hVg","user_id":"EWQil1sWe23p9uoEU5AZlg","business_id":"uUEKndnFbHD8mVkGiirtpA","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"I've always appreciated how fun this place is. Great food and drinks, but dining here during the day is another experience. A little too laid-back for those of us who have a limited lunch hour. Why is it always the \"other table\" has the fun waiter that is attentive to service? \n\nFood was delicious (when it finally arrived), and as always, the fish tacos were great. Be careful of filling up on the fresh, warm bread and cinnamon butter while you wait for the main course.  Obviously this practically became our meal while we waited for our waiter to stroll over with our lunch.\n\nIf you truly want to experience this place at its best, try the late afternoon, early evening when the sun dips and people are darting in and out of the various stores close by. Great place to meet with friends and sip mojitos.","date":"2010-10-05 23:05:55"}
{"review_id":"t0y5v6HPGzaVAAT3i1N9cw","user_id":"8kPI0A8t4ZAkmfV8wMMlig","business_id":"QeGkAHAKUT-TkyPUsl2PIg","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"This is a great little neighborhood pet food market that also has grooming available.  More on that later.  There are a whole host of foods to choose from including very expensive premium brands.  The staff is always very friendly and helpful and will help you make the choices that you need.  I always give them my phone number each visit to look up the items I got last time and they help me find them, as products do tend to move month to month.  There are lots of fresh made treats and snacks for your furry friends.\n\nThey have a groomer on staff, but best of all are self service tubs of various sizes that you can bath your own animals.  Depending on what you pay, you can get different kinds of shampoos and skin conditioners to bath them in - and then move them to a drying tub.  This is a great little mom and pop place.","date":"2014-06-28 01:11:03"}
{"review_id":"L99rtFi8zUhJMo493b1GoQ","user_id":"C9SIuSN989FNBf9t7abobQ","business_id":"R2pJmnf_hqGr1M5FJB4Zow","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My adorable but klunky big puppy from the local shelter accidentally locked me out of my car while I was removing the trash bins from the driveway.  I was locked out, blocking the road, during a freezing Madison winter night. The dog (and a second, her small dachshund brother) were really scared. Really not fun.\n\nI called Marvin, the owner of M&M.  He sped over and rescued all of us.  Within 45 minutes I was back in my house, all curled up with the dogs, and the road was clear for others to use.  Marviin provides quality service with Wisconsin friendly charm.  No hesitation to recommend him for any vehicle-related emergency.","date":"2015-03-05 03:17:40"}
{"review_id":"D60kKNr0l2wDkkPeX_S7wQ","user_id":"p3aNBKnpuy_h4gcVKl-r_Q","business_id":"urkODQ1jX0qQzgbqsQjWVQ","stars":5.0,"useful":5,"funny":0,"cool":0,"text":"I had heard great things about flower child and wanted to go and on the way home one day I saw a sign that said to come get take out. I decided to try because I wasn't really in the mood to cook. \n\nThe restaurant is beautiful. Great outdoor and indoor space. Kombucha on tap! \n\nThe have a separate window for takeout orders. They have a 2 different family meals, a larger one and a smaller one. The regular family $39 for chicken and it comes with 3 large sides of your choosing. The larger meal comes with 4 large sides. \n\nThe chicken was chicken breast cut into slices. The three sides I got were the sweet potatoes (4 stars), the Indian cauliflower (4 stars), and the corn quinoa( 5 stars). The quinoa corn creamy concoction is like crack.  \n\nI love when places have family meals like this!","date":"2015-05-12 18:38:42"}
{"review_id":"83u-UlmGZB0kIIL1XQmzBQ","user_id":"85uM-cor3VXCUyVFEe0YNg","business_id":"SZEFE5hL7aN5nM-A44iPwQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Fantastic service, atmosphere and food.  We ate until we couldn't anymore.\n\nMy first visit here was spring break in college and my roommate who had not eaten steak in years (he went veg for a while) decided he would break down and try it since we were in such a highly regarded steakhouse.\n\nHe loved it and raves about it to this day.  Good times.","date":"2010-03-12 19:57:36"}
{"review_id":"H-BobmvT1h_4M69SVnvjEw","user_id":"fmhvtUuQoFTLDH1NRIRNQg","business_id":"W8-Bsk_hHg5pxbt4EhmPWQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Spent only one night here and the main reason is because they're pet friendly. Our room was the Queen suite that had a stove and full size refrigerator and pullout sofa bed. Check in and check out was a quick and easy process.\n\nFree continental breakfast which, according to my brother, is pretty decent and they offered good food. \n\nOverall, decent and quiet place. Far from the strip, which is good if you're not into partying and the Vegas nightlife.","date":"2016-01-17 19:42:47"}
{"review_id":"4tZKjy7uebpjN1iR54wjyQ","user_id":"JQlzHruOqwMuueStY_9_DA","business_id":"38YPE4KCvgChy9y6FcksEQ","stars":2.0,"useful":3,"funny":3,"cool":1,"text":"The pizza wasn't very warm when it arrived (they didn't use the warming bag at time of delivery) and the order was wrong, but the pizza tasted good.","date":"2015-01-18 20:45:00"}
{"review_id":"r2r5j6p0heQ36sNhoyIXgw","user_id":"CaV-DNd6uFyn882O8MYO_A","business_id":"Cg3sK4ptre1uPPCzPWH1aw","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"Seriously, where are the vegetarian options? All the dishes (even the salads) have either meat, fish, poultry or eggs in them. I have heard that this place is good from my friends but I can't join them since there is nothing for vegetarian or vegan people to eat here. Vegetarianism is becoming more popular everyday and restaurants like this one have to learn to adapt and cater the needs and wants of people becoming vegetarians or vegans. Sadly, this is one of many restaurants who fail to understand this change. There are very few places where vegetarian or vegan people can have a proper meal. I'll come here only when there is a proper vegetarian\/vegan menu in place.","date":"2016-08-25 15:37:07"}
{"review_id":"hfXVxrlD6fr1kXfz6sR13Q","user_id":"7nIzgNF7YzI-UAyYr3y9hw","business_id":"J9f-9Prw2YVM-fiZqv2fmQ","stars":2.0,"useful":0,"funny":1,"cool":1,"text":"Parking is tough to get here so I don't get to go much. I also get a little cautious sometimes as they frequently have multiple questionable looking characters.\n\nPro's:\n- Legendary fries that used to be super huge and gave you great value for your buck\n- Good burgers\n- If you drink, it looks like they have a lot of different kinds of alcohol\n\nCon's:\n- Customer Service? Hahaha. Not here. If you can get more than a fart out of one of the twin's working there, you are ahead of the pack.\n- Dirty, messy tables, crap everywhere.\n- Many questionable characters here. Someone once asked me if I wanted to buy stolen jewelry off them while I was eating. I'm being totally honest too.\n- Their french fry portions have gotten smaller. They used to need two baskets for a large fry and now only need one.\n- Really expensive hot dogs. \n- They have strict limits on ketchup. No I'm not joking. 2 for large fries, 1 for anything less.\n\nI do recommend getting their legendary fries at least once and I do recommend the egg burger, but get it to go and go when it is light out.","date":"2013-09-04 04:35:27"}
{"review_id":"7i0kGk_lxWxXXJm-2okR4g","user_id":"ljexhO2z36Mt3WXAjed-Kw","business_id":"YTCCJ3ShO-zg0dlx1nk6dw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I was really excited to eat at this place because it looked so nice from the outside and the yelp reviews were all great. I was incredibly disappointed in their sushi because even though the fish was real..not imitation..it tasted very old. I'm from the pacific northwest and we have amazing seafood...so I should have known desert seafood wouldn't have been very good.","date":"2018-06-19 16:29:11"}
{"review_id":"FsdIE1E2dLghATsOCkr36A","user_id":"OwUwO6wdVSrUUUyXnVMYVg","business_id":"heBxeibpHsPGJxZfdcD_HQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Just took some of my old Army gear in there to sell. Very friendly staff and very hard to fight the urge to start shopping. This place is loaded with a lot of different things I noticed while just standing at the counter. This is a must go back and walk around looking at everything they have to offer.","date":"2016-08-25 18:07:27"}
{"review_id":"g5m-5RHmXCI_wAJw9uD4wA","user_id":"1psChMmcPW0MN50iAUb06g","business_id":"F2Y-nyjAU91nUHtUjALIKw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"My dog nips at men so I was terrified of having a man groom.  But she sheds a lot so my fiancé made the appointment and I'm glad he did.  First off, the prices are a steal.  Secondly, the man who groomed her was amazing he was super nice and my dog was calm with him.  My chihuahua\/terrier usually has a lot of anxiety around people and she was nervous at first but didn't bite and by the time I came back she was really calm.  We came in to get her trimmed so she wouldn't shed so much over the summer and he did a really good job.  I will definitely be back!","date":"2014-06-28 00:13:13"}
{"review_id":"KBgs_qJfzxzGQhn0IVLzeg","user_id":"is1nHZ4oBqqmBm_mfVyhoQ","business_id":"NrJSy3dgcXErFtOKGREmnw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Second brunch visit. Loved the Hash and the Eggs Benedict. Great atmosphere. Nice service. I will be back again.","date":"2017-09-08 23:06:29"}
{"review_id":"firvmOGi0dgeACCEV5luVw","user_id":"EJq7AwhAAeywvg_lAANYJQ","business_id":"0jAexNHRHhkQv4zNYqenBA","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"SCAMMERS!\n\nIf you pay your tab in cash...make sure you DO NOT forget your card (credit or bank). If you do, when you go back to pick it up, they'll charge your card for the total amount of your bill...\n\nAND...you may find additional fraudulent charges like I did. I\n\nn the day that management had my card someone purchased an item from  Barnes and NobleCredit and a Credit Report. \n\nNow that's customer service.","date":"2013-04-10 16:47:47"}
{"review_id":"2UNgQQSVlAzgRwVr_98ayw","user_id":"kfNQzi7nxMeYaFGTHPJEKg","business_id":"pta7G9jyDzDquBA7_fqWYw","stars":1.0,"useful":1,"funny":2,"cool":0,"text":"I called Garcia Bail Bonds and when the call was answered I was greeted \"Speak\"... I proceeded to ask a question about the type of bond I was looking for. The reply was an angry \"what the hell are you talking about?\" I let the person answering know they must not want to make any money talking to customers like that and hung up.\n\nI may not have known what I was talking about since I have never had to bail anyone out before, however the three other bail bonds companies I called prior with the same question were able to provide me an answer minus the horrible attitude.\n\nWhy would I ever set foot in a business who can't even handle the simple task of answering a phone call.\n\n\nUpdate* In response to the reply.\n\nA. Of course you are \" lost why I feel that way.\" You think its normal to answer a phone call  at a place of business with the greeting \"Speak\" and reply to questions with \"what the hell are you talking about\"'\n\nB. You do not remember anything. I never said anything about 3% or California. I ONLY asked for a specific type of bond, (because not all bond companies are able to provide this specific type of bond) and your reply was \"what the hell are you talking about\". After that short conversation I terminated our conversation as stated in my review, so there was NO talk of California or 3%. I only included my experience with other bail bonds companies in my REVIEW to highlight how easy it was for me to call another business and not be treated so rudely. \n\nC. Thank you for letting me know how poor your customer service is so quickly. Made the decision to go else where easy. I write this in hopes that someone else will not get stuck with your company before they get a taste of your horrible customer service.","date":"2014-08-10 20:48:56"}
{"review_id":"VaGS1PvguQW-CdpjYUgs9Q","user_id":"ZnNcaZ7tAIhvWzihCXjFSQ","business_id":"oeW0vIYd3rUnAPgmD4fEFg","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Surprised they didn't open earlier in a Sunday but it was worth the wait to get in. \n\nAlways want to try something new but couldn't pass up on the eggs Benedict.  The sauce is consistently the same and the Mancini bread has something to do with the experience I think. \n\nSometimes the eggs get overdone but one of the most consistent places for Benedict.","date":"2017-03-27 01:31:04"}
{"review_id":"kNrFMqAAs0b3sswbJyyEgQ","user_id":"055mHXHyW4wE3dwVSNMs9g","business_id":"3-q92s_9lKhAH9OgqEg_Dg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Finding a solid spot to get a quality cut can be a challenge sometimes, look no further! Cutting edge II is the spot. G always gets me right and in a timely manner. From beard trim, to razor fade, to line ups I've never been let down. Thank you for bettering the community of southern highlands!","date":"2018-03-15 19:38:03"}
