{"review_id":"fKRA1n-ngUIl9I8dmn5OpQ","user_id":"8zUniV0wOwnyjRWpAL_E-w","business_id":"q2GzUNQj998GSC8IhkN9hg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"A new fav for sure!!! Loving the concept of building a bowl with various hummus, meat, veggie and grain choices! I cannot wait to go back and try something else!! Good gluten free options and beyond for other allergies too!","date":"2018-08-04 21:02:40"}
{"review_id":"ehrPO9cBdMpYyv_wJrd3ew","user_id":"iLP8qrcL6Adz3Zu2r28NKA","business_id":"eB6E-gPs9XnYvDsVWNeKiw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Courtney is the best waxer I've ever had! I've been getting waxed for over a decade, and she's the only esthetician that I didn't have a reaction afterward. I think it has to do with her all-natural approach to her wax and products. She's gentle, super nice, and her salon is very clean. I'd highly recommend her!","date":"2018-05-08 16:33:45"}
{"review_id":"KW6Ta9wVz7B2pREviWFMkA","user_id":"8tX-EprIfJarL2n88bnqkw","business_id":"SAfuIUZMXrOnb3LWyvYjDA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We love this place.  Service is always good and food is delicious.  Korean pancake and Meat Chun are my favorites.","date":"2015-12-20 22:12:26"}
{"review_id":"xBe7qY1vyfeVpPVTfnulEg","user_id":"8p4JGNgZl705fByqyF6BrQ","business_id":"m8LwM6D7UkgZxCj7uw68GA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"It is very small and the coffee\/tea is self-serve. But, it was very good.\n\nI always take it as a good sign when the menu is small. Usually, it indicates fresh ingredients and flavourful dishes.\n\nWill go back :)","date":"2014-07-13 16:02:24"}
{"review_id":"6ZSjbi_TCvlk82BnaVU33g","user_id":"N_IFBJrVN5CVRNi4UmKf1g","business_id":"0zTLMQOZhiCp9GFtegiFsw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I've been going to Bihlu and Kusums restaurant for over 25 years. The original location was at about 52nd McDowell(it was a treat after squaw peak hike with da)( but they have been at the current location for probably the last 20 years. They have a good mix of North Indian and South Indian food. Masala dosas have always been one of my favorites things to get. The vegies and sambar are always fresh as well. The title may not say it here but they are just as famous for all the amazing sweets they make as well. Indians from all over town order it by the tray but if you arent sure what you want to order ask them to sample it. Jalebi barfi and laddu are some of my go to's. I'm an american born and raised indian so I'm suggesting some of the more tame whitewashed options. The service is quick and the staff is always attentive. You'll see an crowd of ASU kids definitely during cricket matches but they also have indian music videos playing throughout the day. Before I forget my favorite thing to get from there to go is pani puri!. Picture a cracker like hollow bubble with potatoes chickpeas and a spicy sauce. yes my mouth is watering just describing it. I put in mint chutney and tamardind chutney. Im confident you have will a few items that you love and will have again and again.","date":"2015-11-05 23:02:06"}
{"review_id":"EDQpLLFiAxeSxWI5ipwzBQ","user_id":"SkueY7hVsyXmYItELoodGw","business_id":"lpel3pRFAzlow7u2TJMz4Q","stars":4.0,"useful":3,"funny":0,"cool":0,"text":"The server had an extensive knowledge of wines & their various menu selections and it was clear that we were her top priority. The pizza and dessert were amazing. My only complaint is that the chairs were uncomfortable, I think they could add some more comfortable seating to give this more of a \"wine bar\" feel. Otherwise everything was amazing!","date":"2015-04-28 19:28:12"}
{"review_id":"JU9dTw0xHscHjG0jtFlfKQ","user_id":"yMI4vNI5CWoJWmqjxJRD1A","business_id":"xsFeeqZS6PoVvwseEefzEw","stars":2.0,"useful":3,"funny":2,"cool":2,"text":"A disappointing cacophony of in-your-face flavors.  Having tried two of the pastas and the gnocchi, my impression is that these dishes are the food version of jazz improv - discordant and overwhelming.  Like the music, I can see how the Pasta Bar dishes may appeal to many, particularly those who favor flavor intensity and\/or creativity over all else.  For my taste buds, this was overload.  Interesting yes, but I can't say I found it good.\nHere are some details:  \nPasta and gnocchi - both are quite heavy and substantial.  I prefer a more tender pasta and pillow-light gnocchi.  Maybe after running a marathon the high-density pasta would hold more appeal.\nSauces - Here is the in-your-face part.  The gnocchi sauce is spicy, overwhelmingly so for me (although I do freely admit to being a hot chili wimp).  Despite my personal intolerance to hot food, a more delicate approach would have been better.\nThe le Sarde sauce sounded interesting, mainly because I love sardines, but my taste buds could not get over the bizarre combination of strong flavors vying for attention. I could not even pick out the taste of the sardines amongst the culinary noise.  And what is with the dried hunks of bread?  I could not get beyond the oddness of this one.  \nThe carbonara was an intense combination of garlic and black pepper flavors, and probably the dish I enjoyed most of the three.  Even on this one, the garlic was out of this world in intensity.\nOn the good side, the staff was genuinely pleasant and enthusiastic - a real treat.  The atmosphere is modern and hip, while maintaining a touch of coziness.  The ingredients all appeared fresh and high quality.  And the food is indeed interesting - this is no boring spaghetti\/lasagna place.\nAs a matter of taste, I'm going to have to pass on Pasta Bar.  For the price, I'll be looking for more of a flavor symphony.  If culinary improv and high-density pasta is your thing, check it out.","date":"2009-03-01 19:50:23"}
{"review_id":"Ww1HKDe4Mk6O36C_HoEsjQ","user_id":"NfyYd5x7S2s9fsRm-HC6UQ","business_id":"jppxrDQLXr4Nk8cV7IGlcw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"The food here is very good, but not great. I had the enchiladas reynas. Again good, but not great. Could have done with some more flavors. \n\nWe had salsa and chips, guac, and margaritas. Margarita was ok. Guac was yummy. Chips and salsa were excellent. \n\nI would give this place a strong 4 stars for food and atmosphere. The place had a very nice atmosphere though was a bit loud. \n\nThe reason for the 3 stars was the service. While they were extremely nice when asked for anything, we had to ask, often. Missing parts of our orders, incorrect items on check and a standard dinner of drinks, apps, and entrees took over 2 hours. A few more servers would really bring this place up a notch. \n\nWould I go back? Yes. The menu is flushed out enough and the food was tasty. Would enjoy trying the fajitas server in a half pineapple one other party\nMember had.","date":"2014-05-26 00:00:01"}
{"review_id":"UP5ZPaGL3ymPsfXMOgvyTg","user_id":"cGskg8zw1KuSkpdraZXm7Q","business_id":"WXR0ND0KqbArMZDvFMA-bw","stars":5.0,"useful":5,"funny":0,"cool":2,"text":"The time has finally come, THE IMPOSSIBLE BURGER is here! The burger is plant based but is said to bleed, smell and taste like meat. My husband and I got it and now we feel like we want to order different burgers but substitute for the impossible patty every time!!! It was delicious! It's a different texture but there is so much flavor and you don't feel so heavy after eating it. \n\nWhen feeling a little guilty but still craving starch, I will order sweet potato fries but unfortunately never fully be satisfied. Not this time! The sweet potato fries were crispy, lite made perfectly! On top of our delicious meal I love the different ketchups. Seems simple but it's the simple things in life that we appreciate most! \n\nAlso the staff was awesome! Very friendly and attentive.","date":"2017-12-29 16:10:32"}
{"review_id":"9bZ-bawEk6YTLsZGpwaJEQ","user_id":"XmguBITJlcsbm40y6zvJ8w","business_id":"4-QlcyLqRc8To15oOHUjkg","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"Food was great! Loved the pepperoni rolls and the zamboni fries! Service was sub par. They hustled at first; however the server entirely forgot our pizza. When we inquired, she proceeded to blame it on the kitchen. She never apologized, nor did she offer a discount. She coerced us into paying our tab and did not offer to get us any additional food or beverage. Furthermore, she did not pass on to another server that we intended to stay and eat and drink-even though we explicitly stated that. We stayed for 45 minutes waiting to order more food and have our drinks refilled. Our plates were cleared and we were not offered additional food\/drink. No one addressed us. L\n\nOverall: good food, bad service.","date":"2015-12-05 02:37:22"}
{"review_id":"rtNAgwpp5p2z238Sggc2YQ","user_id":"jHONHSh8BHkmDARrfcoCGg","business_id":"leDMYX5D-ziaYMgIWo73pQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Ok so I've come here a couple times for breakfast the first time my order was wrong I figured a fluke, I go again and yet again my order is wrong. Sucks because it's close to my job and I like it but I doubt I'll come back to this location. Nothing worse than having your food wrong.","date":"2017-01-27 22:01:17"}
{"review_id":"sDtzceBnE7Z_nha-e_jDcg","user_id":"-r2tywPFg7lCw9hPpHsk_w","business_id":"uBCRRQJ4ukFaE_UyY6T1uQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I found this restaurant to have a great atmosphere. Dark, perfect for a romantic date with your partner, not a first date. I see people giving it bad reviews for the fact that the sushi wasn't great, but really the place is called China Grill, what made you think that it is a good place to get sushi. That is like going to Pizza hut for a taco, doesn't make sense. Had a couple of drinks, an appetizer, and two entrees for under 80 bucks. Great deal.","date":"2011-03-20 11:12:39"}
{"review_id":"VbHU2g4lVkq8mRJnU5T9sA","user_id":"i3YlCab0lSENjFSe_kNcWw","business_id":"bjKn15qfyHZrfZ6N8R7YUA","stars":5.0,"useful":3,"funny":3,"cool":3,"text":"Tyler is amazing!!!! Had my makeup done for my wedding and I never felt so pretty! I sent him some looks I liked, and he went above and beyond. The whole process was so easy! Totally will use them again in the future!!!!!","date":"2014-11-12 17:27:37"}
{"review_id":"odcpF6nUgRxLoy-CmFbKxQ","user_id":"xaNV-IFarllW1fbneGi8KA","business_id":"wSBNzVkRzTVlnR95AFvYMg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Recently had my sons birthday here.  I like this place much better than Sky Zone!  It's much more open and not crowded, even with open jump and other birthday parties.  Our hostess was awesome. They customize shirts for the birthday boy. Our hostess drew an awesome Super Mario shirt. The birthday party included a private dodge ball game which was so much fun. We played a few rounds and then she let us jump privately because there was no party after us.\nThe place feels so clean. They have a free place for your shoes and belongings and seats all around so you can watch your kids jump if you aren't jumping too, where at Sky Zone you see parents standing at the entrance or sitting on the ground in those narrow walkways. The regular jump area is nice and open and they have a separate netted off area for younger kids that the parents can also jump in. Unlike Sky Zone that have small kids to one side, 8-10 yr olds in the middle and adults to the other side. \nIt's very sensory friendly also. I wish FEAT would consider hosting family nights there. I only wish they would open a location closer to my side of town.","date":"2016-10-13 22:03:35"}
{"review_id":"mVHvbvkKGRtm6wJui_2yHg","user_id":"bO-O6QrB2qbMXsIUsu23Ew","business_id":"qC9ivAdl47BcZdlbW7ffLg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great Sushi by far the best I have had in Charlotte....Don't waste your money on all the high priced sushi places in charlotte. Higher prices does not mean better sushi !!! I have tried them all in charlotte and 18 Asian is the best !!!","date":"2011-04-22 14:18:38"}
{"review_id":"tzl3ubHDVxUzkFvKCqgi1Q","user_id":"Z1xIIAJxFQ37ESDZX9mNVw","business_id":"nveeiYhDhj0WJu1JUmx9fw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Outstanding service and food!!! My family and I will be back. Best Mexican food I have ever eaten, hands down!","date":"2018-02-24 01:32:56"}
{"review_id":"gOIxceo80TWnWBuRgUavYg","user_id":"JnPIjvC0cmooNDfsa9BmXg","business_id":"nY2oBwH3s5sKox1mERIoVQ","stars":5.0,"useful":6,"funny":3,"cool":6,"text":"When I walked into Epicure Cafe today it was like bizarroland - like when you come home from vacation and sense that everything isn't in its right place. You know you're at home, but someone's moved something, rearranged the furniture, or otherwise changed things ever so slightly but just enough to make you suspicious. This wasn't the Epicure Cafe that I remember from three or four years ago.\n\nI learned from Jackie, our cutesy server who was a total dupe for actress Clea DuVall, that a few years ago Epicure changed locations. To a few doors down farther east on Queen, on the same side of the street. Which explains the slightly-different-but-not-quite layout, decor and seating. It was a pleasant surprise. I didn't venture upstairs but I was told there's an outdoor eating area that will have to be explored on my next visit.\n\nThe menu options are, like others have said, a bit overwhelming. But for the fussy eater (I was with one of them) there was no lack of choice - Epicure has everything from pasta (17 choices, including different sauces and shapes), burgers, pizza, wraps and another full page of duck\/veal\/lamb\/chicken options. I appreciate the selection but it could stand to be honed a little! Luckily Jackie was able to recommend favourites when we showed indecision. \n\nMy eyes went straight for the Pumpkin Ravioi ($14), which I was assured was \"not a mistake\". And it wasn't. I barely looked up my from my plate as I feasted my eyes on the glorious, pillowy ravioli on my plate. They were seasoned with ginger and nutmeg, tossed in parmesan cream sauce with grilled corn, wilted spinach and mushrooms. The mushrooms were perfectly sauteed, the spinach was wilted just right and the corn was fresh and added the exact amount of crunch that the dish needed. The portion wasn't skimpy either - at some restaurants when you order jumbo ravioli you get 3-4 pieces, but this was more than double the size. Good value for the money.\n\nI was more than tempted by the dessert board (tartufo, ice cream, tiramisu, Grand Marnier cheesecake or crème caramel, Belgian chocolate mousse, apple crumble) but unfortunately dinner left me positively STUFFED. After seeing that Epicure is now open until 1 or 2am every night I know where I'll be heading for late night dessert!","date":"2009-05-20 03:22:43"}
{"review_id":"PhN14AYrE5NgFKS3U8BZ1w","user_id":"lluNN1aQlFN7NQQ2BxFBUQ","business_id":"AtD6B83S4Mbmq0t7iDnUVA","stars":5.0,"useful":6,"funny":5,"cool":5,"text":"\"River, we see that you haven't Yelped in a while, what the one place that you want everyone to know about?\" This. Is. It. \n\nEveryone has that one vegetarian friend, right? They're always there on your tail making it so you and your friends can't get your McRib on at the local McD's and you have to make sure to reiterate her order with \"NO BEEEEEF, SUB BEANNNNNS\" at TB. Geez.. But there's no need to fear, Veggie House is here! \n\nI've tried a variety of dishes here and I've yet to be disappointed; Pan-Fried Noodles, Mongolian Beef, Wonton Soup, Beef Ramen, Sweet and Soup Chicken, Jasmine tea, BUN ROLL!! You need to order a fried bun roll.. Thank me later.\n\nThis place is vegan\/vegetarian and they serve no meat.. What? Yes. I tell my bestie every single time that they should put quotes around all their meat products so people don't get so darn confused. Their meat, it's not real- but trust me, it's a good thing. Especially when it just hits the table, it'll have you scratching your head. Once it cools, the \"meat\" starts to get a bit of texture, but it still pretty great. If you have the thing and you can't do textures, you're probably safer sticking to something with veggies instead.\n\nAll the food I've had here has been really great, even if the service is a little shoddy. Don't let that deter you. \n\nGet the bun roll.\n\nI'm serious.","date":"2015-01-18 18:39:41"}
{"review_id":"Y8CXTTc4YB3ntCoQ4is08Q","user_id":"o0E4f4eLiI5d4Db6Mm3-Uw","business_id":"eUuKXhloFVHdQsLdodcLbw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Awesome, awesome, awesome! Food was great and potion size was more then enough. Service and helpfulness was as well a pulse from Jo. Great place will defiantly will be going back! Did I mention inexpensive as well.","date":"2015-11-18 19:12:09"}
{"review_id":"sLbCQgT1ZJWB0e-XOVyS2g","user_id":"I1mLZm-YSIarwaj0q9Njuw","business_id":"RvpSsArnUXRZgC4-I7AyTQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"It is a cute little place with very friendly staff; however, I went there on three different occasions and was disappointed with the quality of the food. I tried the cheddar and broccoli quiche which was terribly bland (no salt and pepper or nutmeg, no noticeable cheese or broccoli flavor, just bland egg and dough). Another time I had the grilled cheese sandwich - same problem, bland and greasy. If they improved their food, it would be perfect.","date":"2016-07-03 17:32:06"}
{"review_id":"_JnWBvqCPMqKY_pUKv07Yg","user_id":"YLt4hZXECyi9d0pffmrvBA","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"The photos posted of the rooms are definitely NOT indicative of the room I stayed in except for the one of the broken electrical socket.  The plug for the tub didn't fit properly hence I couldn't take a bath, the electrical socket was broken and didn't seem to even work enough to charge my cell phone or the portable charger, there was bird poop all over the window of my room, there was food sitting outside the rooms next to mine from room service for the ENTIRE time I was there, and the breakfast buffet was bad.  The lettuce in the salad bar was wilted, the scrambled eggs were runny, the \"soup of the day\" wasn't labeled. It may have well been mystery soup as it had a creamy base but with random spinach like veggies and tasted a bit over salted. For the over all price I payed for both the room(almost $200 for a MONDAY til TUESDAY, 1 day stay), I could have stayed at a better kept or newer casino.  The last time I stayed at the Flamingo was probably about 15yrs ago and it was better kept back then than it was now...Maybe they spent all the gambling revenues towards the birds and fishes in the courtyard as there were only flamingos there the last time I stayed there.","date":"2016-06-22 21:24:09"}
{"review_id":"gXxmViRwoVZ8-4F6wKgGkw","user_id":"N0Qmo0G67GLrmUK3dNB2Uw","business_id":"zOMiDo5iGn5dTrckP4F_Ig","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Honestly I expected a lot more from this restaurant due to rave reviews of the others in the area. I ordered a burrito with steak and the quinoa brown rice. It was obvious the steak wasn't super fresh; it was kind of cold. The burrito, although super large, didn't have too much flavor and the quinoa brown rice was pretty unappetizing. The dining area was pretty dirty too, tables had food all over them and hadn't been cleaned for a while. I would  give this another try and order something different but until then the 2 stars stands.","date":"2018-02-11 03:41:47"}
{"review_id":"wHrbQBt0eSaQl0T3xjGhww","user_id":"TTemlnsYaGzVKwt0lFFsiA","business_id":"nJcyfIRGbI31EGLzillWYg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I enjoy coming here several times a week to eat, drink, party and sing karaoke. The managers John and Jose are great and the staff are attentive and fast. Food is good but to some it might seem a  \"little\" pricey but pricing is standard and to be expected of any place on the Las Vegas strip so hotel guests need to take advantage of any deals\/specials.  The sound system is awesome. The amount of Vince Neil memorabilia is amazing and he is at the restaurant on occasion like his birthday this past February.","date":"2018-03-23 17:23:18"}
{"review_id":"CX77JmILKKFTe5DLl8hHLA","user_id":"nHc2XXcOLpeUH_mkgUeWDQ","business_id":"XhUec_6-kgPy1_ZYUrzvPQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My wife and I went there last night to celebrate my birthday. It was our first time there so we were very excited to try another dining spot at the M resort. We arrived at our reservation time and the hostess was very nice and polite and showed us to our table which was in the back of the main dining room, which was perfect because it was away from all of the action and private.\n\nOur server Dave and his team were on point from the start. They got us everything that we ever could want and or needed. They were very friendly and amazing and made us feel like we were their only guests of the evening.\n\nThe food was amazing and the portion sizes were impressive. When Dave said that most people order one vegetable and one starch for the table he didn't lie. The side dishes were impressive.\n\nStarters\n\nBeef Carpaccio - 4.5 Stars - Only complaint was too much Mache Salad\nLobster Bisque - 5 Stars - Nice Lobster Flavor - Not Fishy at all\nSeafood Louie Salad - 5 Stars - Seafood Cooked Perfectly, Perfectly Seasoned\n\nEntrees & Sides\n\nBone In Filet - 4.5 Stars - Needed more seasoning before hitting the grill\nAustralian Lobster Tail - 5 Stars - Cooked and Seasoned Perfectly\nMac N Cheese - 4 Stars - Just Needed a Little more Seasoning\nCreamed Corn - 5 Stars - Best Creamed Corn Ever\nTater Tots - 5 Stars - Crispy & Full of Flavor\n\nDesserts\n\nPeanut Butter Pie - 5 Stars - Perfect Way to End Dinner\nChocolate Souffle - 5 Stars - Light, Airy and Full of Flavor\n\nAt the end of the day  we had an amazing time and the restaurant exceeded all of our expectations. We will be back again soon.","date":"2014-11-12 18:09:15"}
{"review_id":"bx69Dn6x1as5oLwARPf6Vg","user_id":"tSf2SivaZbYNabDCyQv1Tw","business_id":"KalAJyO0Zpg3K1wVwYXBHA","stars":1.0,"useful":5,"funny":1,"cool":1,"text":"We regularly went to Marche Bacchus for many years. The French food was excellent without being too expensive. I used to eat their filet mignon. They changed their chef and booom, no good anymore. Because we love the ambiance so much, we still went and had their pate, french fries and their wonderful crispy baguette\/brea that is the foundation of French food. Now they changed their pate, taste like the one at Vons, they do NOT have their crispy bread anymore, but a mushi bred like in any cheap restaurant. The American owners who bought from the French owners DO NOT UNDERSTAND what French food is. The ambiance is stil great, the service is amicable but the food remind me of Mary Calenders. Shame on you for not maintaining the quality of food we had when you took over.","date":"2013-10-03 20:22:21"}
{"review_id":"sT6NI0Imod7QyigI0wcI4w","user_id":"A3nYLrq1pzx5T0WguYBBQQ","business_id":"WBlYp-nmLiBLp7VjP1FJFg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"High price, low quality and bad taste. It's not Chinese food nor American food. Don't recommend it.","date":"2017-06-06 20:47:44"}
{"review_id":"F6tv34H54lDGMUgF55hfTA","user_id":"Pls6uO-ojX9JdnsYVCLFKw","business_id":"EYOPM91BM039rYuAjgZbkg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Musicals suck, except this one!! Puns, fun, songs and a gun. Fake (?) blood, masks that look like bone, make sure you sit in the splatter zone. \"Candarian Deamons\" was my favorite number, they couldn't have made this show much funner! If you like the evil dead movies, check this out, it's truley groovy!\n\nGO SEE IT","date":"2016-09-30 21:13:14"}
{"review_id":"qO9UAx5Tyew0IrvNrm4c5g","user_id":"cfZXA2IxbaA0KjGqGVw49Q","business_id":"xr02EylrumEHr_-CdFZEEw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Hair Classic is a great value for a haicut in the downtown Toronto area.  I was introduced to Hair Classic by a friend and have been getting my hair cut by Yoon for the past six months.  He is superb - quick, friendly, and always delivers a solid and consistent cut.  Overall, excellent value at $20.","date":"2014-05-26 01:53:24"}
