{"review_id":"mk6DA_bJeacVe8UeUQYf5Q","user_id":"gALa9uXg89XJCZ5XCp2VXg","business_id":"KMKPusWbBaIORB669W0EeQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Was not greeted by any of the three people inside. When the girl came out from the bathroom the only indication that she was ready to work was her standing behind the register, silent. Seemed irritated that we were the only customers and interrupting her \"down\" time.  Good thing the food was great.  I had the lamb kubideh and my wife had the chicken kabob. both were cooked appropriately. rice was tasty and the grilled tomato was a nice touch. I also really like the green relish\/salsa like condiment.","date":"2018-01-09 22:37:20"}
