{"review_id":"nfJjuoFzIWmVxQWG9avXPQ","user_id":"rpqu9tBIzRcnqiKqaYEBDA","business_id":"_gSAOo5E2YLVwOTthI56yw","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Had a Blast! The entire crew at Extreme AZ was extremely nice they set us up, showed us a few things, gave us a map and sent us on our way! 3.5 hours and 50 miles later we were beat! So worth it!","date":"2016-07-25 12:36:46"}
{"review_id":"gNIj56ZbIK15L_TFcO2Vag","user_id":"XOYOtGcJaddJkeH4JygokA","business_id":"3z70db5MNhCBPpIaRCB5nQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Despite it being a vegetarian, vegan, and healthy place to dine, their pastrami sandwich with thousand island dressing on rye bread is delicious! In my opinion, the prices are a bit steep for the type of food. There aren't a lot of meat options available, but if you are craving something hearty, order the Roo's Romanian Pastrami!","date":"2018-09-03 03:35:55"}
{"review_id":"sVo9gOvDzUj54CFKA0QiRQ","user_id":"VmYpF5C3GL-7wFnvOkhpvg","business_id":"PcPN_HyvtZpCZ0b_4l_45Q","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"WOW - a good hearty meal. The quality of the meat seems quite good. Service is great. Food may not be very good for me but always nice as a treat once in a while.","date":"2013-01-02 18:05:53"}
{"review_id":"nqjgrqJIKWDdlEMMd6WDuw","user_id":"IeojscL3rg3x3vtmR-hWlA","business_id":"tWdp26XQEJqJGnRmFVJQxA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"The pizza is very, very good! We arrived 15 minutes before closing time and the restaurant staff were very accommodating!","date":"2018-07-17 01:49:01"}
{"review_id":"cOhWyA14jQyzwneJbDxrzA","user_id":"FlkxSPplbkEOSJ-cvGomBg","business_id":"UDE4VL0k8Zrko7RkJ4agGQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Fantastic friendly service. Very authentic flavor come thru their food. This is a great chines restaurant on the NW\/N side (centenial hills). The egg flour and bean curd soups are freshly made with obvious care, not in bulk and sitting in the kitchen for hours!","date":"2018-03-15 21:09:26"}
{"review_id":"7KtMOcDTthAvo5hTwkSCmA","user_id":"OYvKoFz583_Sdn4-UWhUqg","business_id":"XPLSNGSClW8gR5BTcvyOhQ","stars":3.0,"useful":4,"funny":0,"cool":0,"text":"The place is overcrowded with kitschy things on the walls and in every corner. We also noticed all the flowers outside were fake and pretty worn out, which made the place look ridiculous, cheap, and unkempt. So for environment, we would rate it a 2 star.We placed our order online, which was convenient, but when we showed up to pick up our food the place was dead and we couldn't find anyone to help us. Two employees actually made eye contact with us and then went right back to talking and slacking off. After about 10 minutes, someone did finally wander up front to get us our order. \n\nWe ordered the stuffed mushrooms, Penne San Remo, stuffed shells, and chocolate chip cannolis. The meal came with french bread but the bread was stale and cold. The mushrooms weren't too bad. The sauce was tasty but the stuffing overpowered the mushrooms so it ended up tasting like sharp cheese and sauce. The penne san remo is supposed to contain artichoke but we only found two chunks of artichoke out of a container with enough food to feed 3 people. So that was disappointing. The sauce was also really bland and the chicken was overcooked\/rubbery. The stuffed shells were ok, no major issues, they just weren't worth the price. Actually, none of the food we got was worth the price. We paid over 60 dollars for a dinner that was maybe worth 30. All in all we weren't impressed and won't be returning.","date":"2014-05-07 20:22:14"}
{"review_id":"zNlZi2QVkzFFiuFtqZ4HbQ","user_id":"kTz1vf_yrcmTPdWta9QIpQ","business_id":"RNi6tW22UMgHwWLAb0mYdA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"On March 15th my husband & I decided to celebrate his retirement at Lawry's Prime Rib. We had made reservations for a busy Friday night but due to circumstances out of our control - we called & let them know that we were running a half an hour late! Well Ms. Carolynn Stevenson greeted us as we again apologized for our tardiness. She immediately put us at ease, told us she would get us seated as soon as possible, and show us to the bar. We waited maybe ten minutes when we were called and seated! Our server turned out to be - in our opinion - the BEST - Mun Froilan!!!!!! If you want the most awesome dining experience then ask for him when you make your reservation!!! It is a must! He makes you feel as if you are the one and only guests he has to please and take care of and everything he did he seemed to truly enjoy! The restaurant's décor is a 1930's-40's era which I love since the staff's attire also reflects that time period. You start off with the artisan bread (OMG - SO SO DELISH) and their famous spinning salad. The prime rib just melts in your mouth! The cuts we had were good size - Mun made sure of that! - and I had the mashed potatoes and creamed spinach which was so fabulous. The dessert cart that he wheeled out looked amazing but we couldn't fit another morsel of food in our mouths! Highly recommend this GREAT restaurant!","date":"2013-04-10 18:48:39"}
{"review_id":"Qr9LGSix6ORlKY5msXQeGA","user_id":"iX1IIVWt5__u7ykkczLsRA","business_id":"759faMgpYDW-00vxd-In3A","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"If you haven't tried mackerel, this is the place to be!\n\nVery comfy, never excessively loud. Environment is pleasant for you to sit down and enjoy good food. Also note, everything has been cleaned \n\nDon't judge the book by it's cover, this restaurant appears to be small from the outside but opens up a heck more as you go further. You will find large televisions hung on the walls frequently broadcasting Korean music videos rather sports or weather forecast is nice for a change.\n\nSong's is definitely at the top of my list for Mississauga's east-end Korean food. \n\nTheir pork bone soup & grilled mackerel are an absolute MUST! \n\nService is quick and staff is very polite. \n10\/10 very well done guys!","date":"2015-10-08 03:32:30"}
{"review_id":"Mnb1SWHsGmwFLz80xRXBbg","user_id":"dhMblY6CDf6GQeOJSKiHPA","business_id":"VMr8sgoQOW0fo0qVJENajA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Nice atmosphere.  Excellent Thai curry and interesting other entrees. My wife got the small portion which she brought home leftovers while I got the larger portion and didn't have any leftover","date":"2017-04-07 23:31:23"}
{"review_id":"iOAquZvrCbqYyvSQVXNySA","user_id":"ELcQDlf69kb-ihJfxZyL0A","business_id":"AoO2nQHz2UmB_Y5-RQ4CTA","stars":2.0,"useful":2,"funny":1,"cool":0,"text":"A store that specializes in cheese curds doesn't have any? Well, they had bags of jalapeno cheese curds ($5.99 and less), but regular cheese curds were non-existent. Apparently, I need to return on Thursday's when cheese curd production is higher and they fill all their Costco orders or some explanation similiar. \n   There is a giant cheese\/milk production facility right behind your store and you can't make some more curds or make some more cheese that makes more curds available. This is basically a waste of a store. It seems to serve as a sort of a Circle K for the white coated and masked milk employees milling around at the corner of Hardy and Broadway. Ended up buying $2 worth of jalapeno curds, but they could do alot more with this place than serve grab and go crap like a convenience store.","date":"2013-05-07 21:37:22"}
{"review_id":"F14PC8Eg1waiVzmmr5ofKQ","user_id":"2TAvvTz9E6AOYObB9OOjaw","business_id":"S4dLodWFIMjDxQKxuzHi3Q","stars":4.0,"useful":5,"funny":0,"cool":1,"text":"After making idiot faces through the window at the employees of Spicy Pickle, employees who were most likely tired after a long day of training, my husband and I were invited to lunch the next day- a training activity for the staff. Only friends and family were invited. We felt very special- either to be considered part of the Spicy Pickle family, or maybe because we made such ridiculous fools of ourselves at the window that they thought we might be \"special\" in the other meaning. Perhaps.\nEither way, free lunch.\n\nIt's not as though I could give a stinky review to anything given to me for free- I might feel bad- but this was just what the doctor ordered. \n\nNot for the weak at heart.\n\nIt's not just a clever name. Their pickles are actually spicy. They seems to be lightly dusted with some kind of chile powder. A nice kick follows a good bite.\n\nI ordered the Dilly something or other. It was half a sandwich (sub or panini) with a bowl of soup. I chose the Corn and Green Chile Bisque with the Sausalito Bandito panini. Delish! It also passed my spicy- enough- for- me- test. Yes, I needed multiple napkins for my nose.\nI could have taken a little more spice, so next time I might ask them to kick it up a notch, but it was a refreshing foray back to my traveling days when I tried to convince a chef in India that, no, I am actually not white. I just have REALLY light skin. Never worked.\n\nAl had the Aztec pizzeti. Coming from NY, I am particular about pizza. This looked like it fit the bill. Very think and crispy crust. A little too much cheese for my taste, but most people out here like it like that. She loved it, along with her bowl of loaded potato soup.\n\nMickey had the Gobbler with a side salad. When she bit into the panini she made a face that I think should remain in the bedroom. Enough said.\n\nBryan had the salad and enjoyed it immensely. It didn't look like much, but I might have to return when they open tomorrow and try it out for myself. The croutons did look very appetizing.\n\nOne of the attentive staff members made the rounds with a tray of mini chocolate chip cookies. Fantastic. Crispy on the outside and soft and gooey on the inside. Mama like.\n\nAll in all, I'll be back. Probably tomorrow. And maybe the day after...\n\nAMENDMENT:\nOK, so I did go back the next day... and today (which is the following day). Yesterday I had the tuna salad, which was delish. Theur tuna is a little kicked up, as it's made with chipotle mayo (but really not too much) and spoicy pickle relish. Tasty. It was served over a bed of greens with a lemon olive oil dressing.\nToday I had the med sub. It was ok- nothing out of the ballpark. I got it with the spoinach salad, which was also delish. \n\nDown to 4.5, but alas no halfs...\n\nStick with the paninis and the salads. Maybe the soups too. I have yet to try the pizzetti... stay tuned.","date":"2007-12-11 03:52:39"}
{"review_id":"dsnCj_jbRNBuzRFygt6fQA","user_id":"6WmMHMBM4FLGyK98-reecA","business_id":"tJcpzXzykNSLuzWwa1JQUw","stars":1.0,"useful":1,"funny":1,"cool":1,"text":"With many eateries to chose from on queen street we decided to give this place a try seeing how there is usually a line up outside....after waiting 20 minutes outside we were seated at an extremely small stool table.. our waitress took our drink order and it took about 10 minutes to get our drinks. We ordered 3 dishes and an appetizer. An hour later our food still had not come. We flagged our server down and she said it would be 2 more minutes. 10 minutes after that our food arrived all at the same time...including the appetizer and there was barely any room on the table... I was starving by this point and I decided not to make an issue of the extra long wait time and dig right in. Now I never leave any food on my plate...ever! but in this case I could barely get through a few bites of each plate. The hot dishes were lukewarm and tasted like a 12 year old skater boy carelessly threw some canned ingredients together mixed in with cigarette butts. It was quite literally the WORST food I have ever eaten in my life. My husband just ate a few nachos. I mean imagine me, a pregnant, starving  food loving, happy go lucky person who never leaves food on my plate and I just coudnt eat this stuff. I chose hunger over this food...and im PreGnant!\nWhen we were done fidling with the food we had to wait another 20 minutes to get someone to flag down our server....finally when she came we had to lie that we are catching a flight just to get the bill at a normal speed. By this point the whole thing was comical....felt like a joint run by teenagers...absolute joke of a place. A lesson well learned...just bc there's a lineup...it doesnt make it good. I actually just got a yelp account to specifically write this review...thats how bad it was. And I eat out several times a week so thats saying something people.","date":"2016-05-31 01:21:11"}
{"review_id":"fV8tPnHLts18978amquDTw","user_id":"THXlQWxQvf0lb4hLK8K1iw","business_id":"1NcuAhU5N96oY6F-iIioSw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Very good company to go with for attic insulation. I called to make an appointment and they were able to come out and do the job within the hour that same day. Brought my insulation up to code at a very reasonable price! The two guys that came out were very friendly and courteous.","date":"2017-01-14 21:41:58"}
{"review_id":"DeCqyyvlq9Y-6_lRc0zBag","user_id":"Butq-0nTDYKFtSlpjmud3g","business_id":"XTtNTWH_Nqv27RC7OtS7dQ","stars":5.0,"useful":2,"funny":0,"cool":1,"text":"So i came here for dinner. The service was outstanding and top notch. The food portions are very small but it is a high end type of restaurant. \n\nWe started with a arugula salad: very fresh and delicious. Next i had some kind of bread with pork belly avocado and a few other things on top. It was awesome i never had something like that before. We drank moscow miles with everything! Easily one of the best mules i've ever had but it wasn't too strong. \n\nNext we had salmon which was hot and crispy omg he outside. The dip it came with was good too. Last we have a small piece of steak: very well cooked and crispy on the outside. i love when the food comes burning hot it's really so important! \n\nLast i had the banana bread pudding and signature pot dessert. Both were UHHHAMAAZZZINNG! Check out my awesome pics!","date":"2017-03-15 03:23:31"}
{"review_id":"cSP33LKJGk-1_N9v5bbPEA","user_id":"pMefTWo6gMdx8WhYSA2u3w","business_id":"PjtX-5vSTBVyWfMREX8bRA","stars":4.0,"useful":6,"funny":1,"cool":1,"text":"I'm so sorry to do this to you Capitano and while I love your food most of the time, there are some inconsistencies.  I still want to go here and will come back again soon, but I've probably been here close to 10 minutes and 7 times were phenomenal, 1 time was average, another was slightly below average and 1 was quite dismal.  The last time I came here, while they tried to accommodate me and fix the issue, the fries were hard and not salted enough and the burger tasted very bad.  This is rare and that's why I'm only docking one star, but for some reason, one of the fry cooks didn't add salt to the fries and they always have before.  The cashier said you could ask for salt, but what frustrated me is that they were always perfectly salted before and while I understand some people will say it's too salty, you can't go from quite salty to no salt at all. That's quite the change.  I have to say, all the bad times I was there, there was one consistency on who was making the food, but I don't want to say who, as they are making a living.  \n\nWhile I love you Capitano, I really hope you can be more consistent.  However, gelato is still da bomb.  Love the mojito.","date":"2013-11-14 00:57:42"}
{"review_id":"D8jIyMWlbTUAxde-izc0jQ","user_id":"a2UGFf0Gz1yCZIaGayELrg","business_id":"QYFPUhHy87nEZ9cmuP8zQw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"DO NOT USE THESE PEOPLE!!!!! I wish I would have looked on here first as now I can to attest to the fact that this company is a total scam!!!  Their website looks so professional and said family business so I figured they would do a good job!!!  I was just charged $760 to rekey 6 locks!!!!!!  Total scam!!!  I am sick at my stomach as I had my elderly parents there to meet them and they totally got taken advantage of!!!!  At my own house in Colorado I had 12 locks rekeyed by a different company and paid $240!!!","date":"2017-06-27 23:25:10"}
{"review_id":"E4iNibcGYKCPDR4FnMSuFA","user_id":"O8wTVW9EKK8olDUkhKqQ6g","business_id":"p0iEUamJVp_QpaheE-Nz_g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"South Point is a very nice hotel and everything is nice since it is only 6 years old.  The room is very clean, big and comfortable with a big flat screen TV.  Everything is modern and new.  Inside the hotel, there is a movie theater and bowling center.   The buffet is very cheap and they gave out a lot of coupons like a free cocktail, a free sovenior at gift shop, 50% coupon for Garden buffet.  It is a very nice hotel.","date":"2012-01-03 19:38:16"}
{"review_id":"ivyr86sIQcmCdROK_qGPmw","user_id":"Cm2hoeA9O_8GkbwY0qwDaw","business_id":"Sy75QB18Sv-xNp8FoA8KvQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Let me start by saying that we had a very fun dinner; however, the sushi quality is just mediocre.  The Turning Japanese martini was fantastic. The highlight of our meal \nwere the drinks and the dj during dinner. \n\nIf ambiance is more important than the actual sushi, this is a great choice for you.","date":"2014-04-01 01:58:32"}
{"review_id":"tIIdt06cSPmn7RVPPpAbIg","user_id":"HmWd_szFZbzOJNbvrDI4DA","business_id":"HmsCerK_rub0Ulo0aC0f9A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I absolutely LOVE Hanabi! I've had excellent service every visit and the quality has remained top notch. Unlike some other locations I've never had rude servers nor have I been neglected service when busy. The owner has gone out of his way to ensure my food was well prepared and I was properly attended to. Highly recommend!","date":"2016-10-13 22:45:42"}
{"review_id":"j7bTnG-aZAi9rdqf9cmmqw","user_id":"bRN42wJnFMJzY4ZzKqqz1A","business_id":"49sbCG7F2jvqJsfG6-N8Rw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Good service. Food ok. All around this restaurant was just ok. I'm not an Indian food expert, but have enjoyed many Indian restaurants in different cities. We ordered about 6 dishes, none of which were memorable. Nothing was very spicy, which is kind of ironic given the name of the restaurant. The atmosphere was pleasant and the service was very friendly and attentive.","date":"2018-04-15 11:07:24"}
{"review_id":"xKeufb74Zn4lOG7jqZ9Hxg","user_id":"XLMpKbIsNOH1DcQN4knRjQ","business_id":"ICUCAzUZFiWkYs7iCtNCQg","stars":1.0,"useful":0,"funny":1,"cool":0,"text":"Horrible guest and hospitality. Wish I could give a 0 or a negative star. I once showed up with shorts and sleeveless tees and the management got pissed off because of that and asked me to leave. Worst place ever and would never recommend to anyone.","date":"2015-11-18 20:06:35"}
{"review_id":"rVXxQkidfjP1eBFGiHFG8A","user_id":"52MlnjkvSLLqKKSRrbrH0w","business_id":"g0yeRwvJmdd-XrH9lye0ww","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This is a very cozy and cute australian cafe where the owner serves toasts with vegemite (YUM!) and flat whites and a whole assortment of other deliciousness!\nThe atmosphere is very relaxed and quiet. \nThe owner is ready to tell you about his experience of living in Australia and other great stories. \nDefinitely love this place!","date":"2016-11-21 21:30:43"}
{"review_id":"fMJQC8gifBNpUMqPvN4RpQ","user_id":"EVzpYvuyhBPb9u2sS-YJeg","business_id":"3uHuoVXDAIoiHotGTHxcbg","stars":1.0,"useful":1,"funny":1,"cool":1,"text":"Came here for happy hour since it indicated the times and stated it was everyday so I decided to spend my lunch here. I got here at 3:12, sat at the bar by the tv's and then proceeded to wait for a hello or a welcome that didn't happen until finally about two minutes later. I ask about the happy hour to which the woman working responded they don't have a happy hour since they are running specials. I'm a little sad about the happy hour thing being scratched off but I have had The Otheroom to go before and was pleased with the food so I decided to look at the menu and order something good. I then wait about ten minutes before being approached and the whole time I was sitting there was a guy making drinks and nothing else. How can they have only one bartender? It's slow but it's also Memorial Day weekend and you should have enough people working. I understand people want to split your tab and whatever else but there was a third guy who could have handled whatever problem they had at the register. Anyways back to when the woman came to me she apologized for the wait which I didn't care for at that point and proceeded to order my food. Overall the experience I was expecting wasn't a good one. The food was great and a bar with great food but when the service isn't up to par it deserves a low rating. I work in high end retail and know me and many of my co workers and friends around the mall would like to be treated just like any other customer and be given a great service when we go to eat for our lunches. We work in the service industry and will treat our local clients with the same service we do our tourists. Since this wasn't the case I'll be sharing my experience with the rest of my co workers and friends who work around the mall.","date":"2018-05-28 22:55:31"}
{"review_id":"F_tDOL6UKsbVcv8qcvmXAQ","user_id":"UIJMQU0TSEeOf4ntpTzu1w","business_id":"-FtngCwHCD2tRlH8jpj_Ag","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"For father's day me n my sister's took our das  he was amazed of how big the serving wore.  the service was very nice n up beat and positive. Great job","date":"2016-07-03 17:48:14"}
{"review_id":"KOZgFxzMJi_Qk5Y9gIOngw","user_id":"BwwqlPVsJk1dbUyNwCWB7Q","business_id":"28adZ4lsuUeVB2aWzohK9g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Amazing place! My co-workers and I went here on. Saturday to celebrate a postpartum baby shower. I showed up late so didn't end up ordering food but i tried my friend's food.\n\nThe Nachos were delicious! Served in a baking pan with sour cream and salsa on the side; and even though it was basic nachos (veggies and cheese), it was probably the best I had - they didn't try to mess up a good thing by adding extra toppings. Huge portion too! \n\nThe drinks were so affordable! Hooch hour starts after 10pm so all shots were 2$ each and 5$ bar rails! I like the fact that the end of the restaurant turns into a dance floor after maybe 11pm if memory serves me right and they played awesome music the night I was there. \n\nThe best thing about this place, in my opinion, is that there's a mini bar attached to the dance floor with the main bar being so close and is the centre of the restaurant. Would highly recommend this place if you're not into the club scene but want to go to a place with good food and great music","date":"2017-11-06 22:08:35"}
{"review_id":"rzP-DWDnEHQyBLqKQ0ifJw","user_id":"oz5TP2PGGAHIy5G4ZmO9rQ","business_id":"D-lzSVYyaobiguo7tfSzWw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Delicious burgers for sure! Add that with the Cajun fries and it makes the meal even better!\n\nThe free peanuts is a nice touch.\n\nI'd give it 4.5 but the app doesn't let it. I'd deduct the half star just for the price. We got a 2 burgers (reg and little) with med fries and large drink cost me $25.\n\nBest burger joint in the area.","date":"2014-06-27 22:14:01"}
{"review_id":"XTHxu0R89CIS23pFel3mlA","user_id":"GRbr5oMkVNa50Shyb8Orcw","business_id":"STFLkNU9LqgDk4nCV60hXA","stars":1.0,"useful":5,"funny":0,"cool":0,"text":"I am only giving them a \"1\" rating because it's the lowest available.  We bought an air-conditioner from them in 2014 and one just last summer in 2015.  We've had nothing but problems since the very first day we had it installed.  Not only that, but the guy who comes out is completely rude and his office seems to back him up.  This is a unit which holds 5-tons of Puron so it is pretty big and it's not cheap.  We spent $5000 on the unit and it is still under warranty.  It's a good thing, too, because these people have had to replace it once and now it's compressor just blew yesterday morning.  It had been making horrible noises and shutting down and about a week ago, they came out and replaced the thermostat and the air seemed to work, but it was making an even more horrible noise than before and then 2 nights ago it stopped working altogether again.  So, it just so happens that my roommate was going to call them yesterday, anyway, to come out and fix it AGAIN.  However, before he did, all of a sudden, I heard the loudest BOOM!  I mean, it was like a bomb going off and literally was louder than a shotgun being fired close by.  Then, it had this awful constant noise - like I've never heard before and vapor was coming out of the hose by the valve and there was a funny smell and I didn't know what was going on and I panicked because I wasn't sure if it was smoke or Puron or what so I ran into the house, turned off all of the units, made sure all of our cats were okay and ran back outside real quick with fire-extinguishers just in case it was smoke.  My roommate called them and they said they'd be there within the hour.  Two hours later, a little after noon, the guy shows up and says it's the compressor that totally blew and he'd have to order another one and that they were going to charge $1200 for labor for the 5-hour job it was going to take to do it.  The compressor, itself, is still under warranty.  He tried to say that the problem was our faulty electrical and that it was on our end, therefore, they were not at all to blame for this.  Also, he said this was a completely different issue than the thermostat, which he claimed was a good call and that he did fix that problem correctly.  So, we hired an electrician (one who is extremely reputable) to come out and assess the situation because if it was our end, we knew we needed to not only get it fixed immediately for safety reasons, but I may have owed the guy an apology for insinuating this could have been their fault to begin with.  The electrician came and his findings were that #1, the units were too close to one another to begin with and that after checking the voltages, etc. with his do-hicky (LOL), his findings showed there was not one problem with our electricity, no surges or imbalanced distributions of power, no breaker problems, etc. on our end and he even called his friend who owns another air-conditioning company and his friend told him that had it been on our end it would have not only showed up in his readings, but it would have had to be a surge large enough to, at the very least, surge other electronic items in our home and that really...  it would more realistically be an outage-type surge where other neighbors would also have been affected.  Not only that, but both agreed that there's no way that it should be a 5-hour job to replace a compressor and that the money they were telling us they were going to charge was outlandish.  This electrician made a point of including some of this on the invoice and gave us the contact information of his friend in case we needed additional assistance with this matter.  Thank God for him and for Yelp and all the Yelpers out there who recommended him. :)  \n\nI'm doing this review in the hope of saving anyone out there who may be considering hiring these people for ANY reason a lot of time, headache and money.","date":"2016-08-03 23:37:42"}
{"review_id":"uN3_j5Yu4xOeM05KkedRFg","user_id":"rKkpHJkJ27xOwnhy_bMkvA","business_id":"KVwflracbADEUzLn1wTEKg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I've had both good and bad experiences at this location.  It may be far fetched to expect at least DECENT customer service.  I know it is a fast food restaurant and the cashiers are likely making minimum wage, but come on!  At least be happy you have a job (for now) and stop treating people like crap.\n\nThe only thing that keeps me coming back is that it is a 24 hour drive thru and really hits the spot if you've been drinking.  Although, if you hit it at the same time as the rest of the drunks, the line can be really long, and it seems like the food takes forever sometimes (although I will not complain, at least it is fresh).","date":"2012-08-14 23:38:55"}
{"review_id":"g5qZY-XWfMDfLtHv9Zo3kA","user_id":"4dIxMP5--LX1X0i3s3PIAA","business_id":"58h2EhvN3iJ4jeu95N5YzA","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Beautiful, tranquil, warm and inviting. A favourite escape in the city. I hope it continues to be as cultivated as it has been for the last three years of my frequent visits.","date":"2015-11-18 19:03:53"}
{"review_id":"Ht9XnvqbF3bnbCyd11fEMg","user_id":"_JjBRV8pTAMV-tp6hebfEw","business_id":"RNi6tW22UMgHwWLAb0mYdA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Okay so this place rocks.\n\nYou cannot go here without getting tyhe Prime Rib, it is amazing. The stick some mash potatoes and Yorkshire Pudding and I am in ex pat heaven. My one tiny tiny gripe is give everyone the yorkshire puddings in one piece so you can pour the gravy in and have a delicious bowl. That is how it is done, none of this cutting the yorkies into pieces business. \n\nThe decor was semi fancy and the service was brilliant. Our servers all had a sense of humour, which you need when faced with a group of 15 guys out for shenanigans.\n\nThis place is a must when you visit Vegas.","date":"2009-05-19 17:17:31"}
{"review_id":"ObO1y1Ffs6f3JtSSGA0rWQ","user_id":"Hc2tC2TDMD1wDjp8aCq7jA","business_id":"CK-Gv3vqIlWOrKP4fhT8_g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is probably my favorite bar in Pittsburgh.  The pizza is solid, the hot dogs are great, and the beer cave...mmmm.  My only complaint is that they haven't opened another one on the other side of town!","date":"2010-01-08 14:20:01"}
{"review_id":"c2mdmZLsrXCfZpIGcqPOBQ","user_id":"-tQ3UVVdNBZBR_HOVFROzw","business_id":"6ZIHxvFTHC1pvAzAS0uLDA","stars":4.0,"useful":2,"funny":0,"cool":2,"text":"I'll admit it was hard to get used to the smell as you walk in, but I'm glad I did! I'm big on their baguette's which have the perfect crunch offering a great ratio when served with their sandwich meat. You can even buy day old bread at a steep discount to have with dinner! I normally opt for the turkey and cheese that comes out fairly quick. Give their dried fruits, smoothies, or one of their many pre-packaged oriental desserts a try. I love coming in when they are baking the bread for the day and the line always moves quickly. They have recently started accepting card so that's a major bonus!","date":"2018-01-09 21:02:28"}
{"review_id":"5kjWk9JVPcVi7-0Y8_nbaw","user_id":"wnFWoQ63F9-ohUQ-C0AeIw","business_id":"7RoaNSRDpjaDVWfpDnbPng","stars":2.0,"useful":0,"funny":0,"cool":2,"text":"There are better and worse Y's for sure.  This place is nothing compared to Dowd or Davidson, but it does the job.  I would give another star, but I've just been told they are raising the already high price.  Plus, people don't seem to understand the one way signs in the parking lot, or just the parking lot in general.  I've def been honked and yelled at for following the rules.\n\nThe front desk help are always pleasant, once you get to them.  I normally don't have the best of interactions with other patrons while waiting in line, but that seems to be the idea on this side of town.\n\nThe locker rooms are decent, nothing special.  Plenty of open lockers most times of the day.  You will rarely find yourself solo in the sauna or steam rooms.\n\nI've only swam here once, I need to get on that.  I've never used the basketball courts or anything outside.  I stick to the weight room.  I have never had to wait on a bike or a treadmill.  If I'm looking for a stair climber that can be another story though.  The bikes are no where near as nice as the Dowd.  The only thing I ever have to wait on are the free weights.  There's plenty of weights, but not much room at all to use them.  If you want a lay down bench, you will probably have to wait, especially at peak hours.\n\nAll in all, it is what it is.  Its close, so this is where I go.  Plus, there is a 24 hour Harris Teeter right there where nobody looks at you funny for being sweaty in gym clothes.  But, If somebody calls me asking if I want to go to a nicer location, I do.","date":"2015-12-28 05:52:45"}
{"review_id":"if5oKprsFpR_nYPSfo5qyw","user_id":"WuXKh29BZhw1Tix_oUk2vg","business_id":"lu6IAy3HQaQytbKIAPh2EA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Nice Family restaurant, long wait time for food but really delicious. Appetizers doesn't stand out much, but definitely order pastas.","date":"2018-05-19 00:12:03"}
{"review_id":"rpMgh9Kb6QWuZEHn-nedPQ","user_id":"SWFP-3VMVFkQswmTHwHODw","business_id":"buacGSEw8yLGJo8g-i02wg","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"I was invited back to the restaurant by the owner to give it another try. \n\nAlexandria our server was awesome. She gets 5 stars just for being so lovely.\n\nI tried the A2, Frying Tuna, and Screaming O... They were good, all offering something a little different.\n\nThe BEST was the Tempura Oreos. Sounds bonkers, right? No! Eat them.. Be willing to get too full off of them... They are heaven.","date":"2015-09-24 00:48:44"}
{"review_id":"3O98T_z_i_o_zY_JSykCqg","user_id":"Rb4QUZN6QC92d_-nm5wlBw","business_id":"Jt28TYWanzKrJYYr0Tf1MQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Plus: Chips and salsa were warm and plentiful, with a nice heat to the salsa. Jarritos soda was refreshing after an afternoon of drinking in the sun. Our waitress was also lovely and attentive. Hubby's salad was ok. \n\nMinus: BLAND, flavourless food. My rice seemed like they it had been sitting under a lamp, very dried out, and the beans were basically kindergarten paste. Not worth the money.","date":"2017-09-08 23:43:10"}
{"review_id":"Ii63D3Rvuvke5PAnHsqKlA","user_id":"FzRxr6E-3kjOb9wpsSOJ4Q","business_id":"I3UkP4Mmp0cmfe3vTev0jw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"By far, the worst sushi place I have been to.  I would like to give them a one star and I don't think I'd like to give them another chance.  Friendly service but speed of sushi delivery is horrible.  This place seems to be busy and it's bring your own alcohol.  Students also get a discount.  If you truly love sushi, you will know this is not the place by pure observation and presentation.  The taste speaks for itself and the rice isn't sticky enough and falls apart.  If you check my other posts, you will know where my favorite sushi place in Montreal is.","date":"2013-12-28 22:36:51"}
{"review_id":"wbUynQgnHtNwsWDJS9CHPg","user_id":"cm6ctpCg3JKUUqV95YCwjw","business_id":"Ok9vikKusbG_Ue9pJf6s3Q","stars":5.0,"useful":0,"funny":0,"cool":2,"text":"que restaurante tan padre\nwe had tacos al pastor\ntacos rosarito\nchicharrón de queso\nand a quesadilla de hongos\nwhich was really a sincronizada\nall was excellent \ngreat ambiance and good service\ngood mezcal\nthe only thing i did not like was my cocktail \nit was not terrible but it was not great so i moved on to straight liquor\noh good music playing as well","date":"2016-12-04 01:57:16"}
{"review_id":"cECSlJT39-IbPBK-xfXfSA","user_id":"kmOvnwtroMBC8y9lOR29bg","business_id":"tvYID0arhN-shKGUrC1Wsg","stars":1.0,"useful":9,"funny":3,"cool":1,"text":"My wife is Brazilian and wanted to show me Brazilian BBQ.  She searched around and was told this is 'the' place to go for BBQ.\n\nUnless you're going to fill up on side dishes, don't expect to get any value for your money at all.  The place suffers from an identity crisis, part night club part overpriced buffet.\n\nThe food is entirely average, nothing spectacular but what absolutely stands out is the fact that every portion of meat I was given was entirely bite size, I literally had already eaten the meat given to me before the guy had even left the table.  I often had to wait 5-10 minutes between 'bites' as they were very busy.\n\nThe meat was either extremely overcooked or border line raw (I like rare, this was nearly blue).  As I'm from Texas, I've eaten a substantial amount of cornbread and I can honestly say this was sugar with food colouring and a tea spoon of cornmeal.\n\nWe ordered caipirinha's and it was like drinking lime flavoured water with ice and a 1\/4 shot of Chacas.\n\nWhat really gets me, is the $43 per person price tag they charged us for this.  I honestly walked away feeling like I just made a charitable donation to the restaurant on my way to McDonald's.","date":"2013-08-03 20:59:19"}
{"review_id":"wwYLxzav9lwR7nqZ1dbGjA","user_id":"tk2yQjiit-ZedTgZFnaZJg","business_id":"cxsN3mkioAXuOLKy04QpyA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Really filthy silverware asked for new set  just as bad  asked for ketchup Disgusting!!! See photo. Italian beef so-so. Fries were good. But fries don't make a restaurant. Where ever this chain started they need to go back.  Hate to see the kitchen if what they bring out is this bad. There's so many restaurants that take pride in cleanliness,this was certainly Doesn't!!! If you go don't say I didn't warn you.","date":"2017-07-28 19:14:54"}
{"review_id":"v4naBkAOC6MtPts26-oFNw","user_id":"rCWrxuRC8_pfagpchtHp6A","business_id":"cNCXUYQd3kFR_AyfjTejQQ","stars":4.0,"useful":7,"funny":5,"cool":6,"text":"With a Just Pay Half Hot Card in my hands and an imminent wall-shaker of a concert at nearby Howler's recently, I strolled into Lot 17's darkened but genial beer hall-ish environs for eats and came away satisfied. \n\nDeciding not to go with a burger for the umpteenth time, I instead chose the Jamaican Jerk Chicken Sandwich, which comes complete with a pineapple ring, a drape of provolone cheese, and roasted red peppers. It's shame that the exquisitely tender chicken didn't smack much of jerk seasoning, though. Nonetheless, sweet, savory, tart, and creamy cavorted brilliantly together within a Sunday dinner-worthy Kaiser roll on a Saturday night. A flawless pile of housemade, kettle-plunged, perfectly salted potato chips complimented the soft and juicy sandwich with their inherent crunch factor. \n\nA domineering cleat of an after-dinner treat, the Snickers Ice Cream Pie had me bug-eyed upon its arrival, something my wonderful server (name forgotten) got a laugh out of. \n\nCarvel had nothing on this monstrosity of vanilla and chocolate ice cream that was garnished with nuts, candy pieces, and sauces of the caramel, white chocolate, and dark chocolate varieties. An Oreo crust would hold this sundae-on-a-plate together, bringing more texture as well as stability to this luscious, saccharine, bon-bon-riddled masterpiece of frozen confection. \n\nWith quick, courteous, adept service and above average bar food, Lot 17 has hollowed out a deserved niche for itself in this restaurant-heavy area of Pittsburgh. Considering I have credit left on that card and that Hot Card participants are dwindling, I may be overdue for another visit, and it will be without a hint of reluctance, Lot 17 proving itself to be a sturdy dining option in a neighborhood with much...\n\nhttps:\/\/www.youtube.com\/watch?v=5U9wGcQYfVw","date":"2014-05-25 20:56:20"}
{"review_id":"e5VhPI_obVivFxvGE80KUg","user_id":"TSThCn9RaHqYF1VknVTTRQ","business_id":"Xs2iTWxbczvfEapAFH3cyw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Good food. My girlfriend loves the breakfast enchiladas. Service is always good and the Rosemary potatoes rock. It is a favorite Diner, Drive-in, and Dives. Check it out...\n\n#vino2ultimate #vinosquared","date":"2016-09-18 15:08:18"}
{"review_id":"4ShqRuS9z7T6KIU5kIiKNA","user_id":"XhMjACJ8aKBdtZkZd_m1jQ","business_id":"xlMgaPOpd_99SFTuOtDH0A","stars":3.0,"useful":2,"funny":1,"cool":0,"text":"One major warning for the winter months.Do not sit at the two tables near the door.If they can't move you leave.I spent $ 150.00 on a very good meal and wine with really good service.But my overall memory was being cold and uncomfortable.They offer you fur or a blanket, but its enough.","date":"2015-01-18 14:26:52"}
{"review_id":"Hv5tPTrv4L2eZzPF9CtWBg","user_id":"-KCQtcA-TEqWtIFKmGN_2A","business_id":"hihud--QRriCYZw1zZvW4g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Liked how they were open late and also had happy hour specials after 10 pm. We really liked the bulgogi and Korean prime kalbi. They were marinated very flavorfully. The mushroom medley and sweet corn were also very good. Would definitely keep this place on my list of late night eats or when IIA just craving korean barbecue.","date":"2015-05-26 06:10:28"}
{"review_id":"PiqvgR0Psc-GBg9zEYcWbg","user_id":"NhMt8aBjpG6LgOjDRXivJg","business_id":"TWkL-VHo6P-WwL8iTvqlYQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"The quality of food been going down hill in the last few months.  I ordered the lettuce wraps and a chicken dish take out.  When I got home the lettuce was slimy and soft.  I ended up throwing it away and ate the meat portion by itself.  The previous time I ordered lettuce wraps​, the lettuce we're too small to wrap the meat in.  Also the entries seems to have more rice and less meat.  Like I said earlier, quality is get worst.   I'll give Pei Wei another chance in a year, that will give the chain chance to fire the cooks or whomever prepares the lettuce.  Maybe management will change also.","date":"2017-10-24 19:54:39"}
{"review_id":"QCxjgQ3Twcca9512-toBJA","user_id":"o6pljmlor3DJqUMiqvS67A","business_id":"ZjKpGYdQCQPxzkYWAsV56w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"If I could give this restaurant more than 5 stars I would. We always start with their wontons which are some of the best I've ever had and then get the red curry. The food tastes amazing and you can tell the vegetables are fresh. We have also had their BBQ chicken which is reminds me more of a curry chicken but is good nonetheless.","date":"2018-01-21 07:32:56"}
{"review_id":"phhklc8OvaGlZ6NEGbyKjg","user_id":"8PVrN-By9CwpO1HLoyOhYA","business_id":"5LPK0LeKiS4HKzYwKXvFLg","stars":4.0,"useful":3,"funny":1,"cool":2,"text":"I ordered the much recommended hachapuri and 2 orders of khinkali (dumplings). I gotta say the flavours of Georgian cuisine is quite unique. These dishes seemed to be made to order because it took quite some time to receive. It may have been more than half an hour.\nMy favorite would be the hachapuri. It makes me think of having pizza but the cheese is distinctly salty and they roll up the boat edges with cheese so the crust is a delight to eat. I wish there were 2 eggs. It definitely balanced the saltiness of the cheese (feta?). It seemed like there were 2 layers of cheese: the crusty top and a layer of soft chese below.\nThe khinkali reminds me of Chinese dumplings but the flavours are truly very different from what I'm used to. It was creamy and dark. Each serving contained 3 dumplings  which doesn't seem like a lot but it really is like its own meal. It definitely needed something to cut the heaviness.\nWhile waiting for the food, we got complimentary appetizers: bread, pickled cabbage and an array of sauces (tomato, Georgian, spicy). The sauces and the pickled cabbage all have tastes I am not familiar with. I ate it all because the food was taking so long to come. The pickled cabbage I did not like so much.\nAll in all, the service was good, the food was filling and I was satisfied.","date":"2016-01-17 05:47:00"}
{"review_id":"maVwPKGzHyX0tkKKlmjxpg","user_id":"kTi96LP1DxwlFTe9jqkayQ","business_id":"j9bWpCRwpDVfwVT_V85qeA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I'm reviewing it on the basis of take-out.  I love their yellow curry.  I've actually only ever ordered take-out, but have ordered 5 or 6 times now.  Every once in a while I get a hankering for it and have yet to be disappointed.  \n\nI can agree with the other reviews that the decor is not the fanciest...it could use some updating.  In fact, I probably would not take my wife here to try Thai for her first time, simply because experience is important.  However, the food is good and that's what keeps me coming back.  I'm a fan.","date":"2014-12-17 19:02:56"}
{"review_id":"wVjUf6AkKcLCand2GOo4YQ","user_id":"0TJ01iwzVLXtr_EYcfqoWQ","business_id":"NfQTfc22vHKsq-UA05nAHg","stars":4.0,"useful":4,"funny":0,"cool":2,"text":"Excellent place if you are walking down Wellington and feel like fish and chips with beer. We went on a bike ride on the first beautiful day of the year and ended up visiting a friend in Verdun. We already know the other Comptoir 21 locations at the Latine Quarter and the Mile-End - but I like this one best. We sat outside (for the first time this year!) and really relished the last light of the day. The waitress was nice and friendly, although she was a little swamped. Once she took our order, the food came pretty fast. While we all had beer, I was actually the only one having fish and chips. My girlfriend had the veggie poutine (they have vegetarian gravy that is not bad) and our friend had a cheeseburger with fries and salad. We all enjoyed our food and I was pleasantly surprised by how calm this street is (compared to busy main streets like saint Denis or Mont-Royal where it's not as nice to sit out in the street). I was also glad for the opportunity to sit outside because sitting inside on the bar makes it harder to have a conversation when more than two people are involved, plus there is a lot of oil in the air near the kitchen.  We went to pay inside and discovered they only accept debit and cash :( but overall this is a good place to have a good time!","date":"2016-05-07 02:11:26"}
{"review_id":"HJLrpu2SWMX41EiFyj1W_g","user_id":"IaP8g--mvs6lHPiT-13qDw","business_id":"R6CvJZFu1OetERB8i2ctCw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Huge selection.  Friendly SUPER helpful (and funny) sales woman.  As a plus size woman I am used to having maybe one rack of clothing to look through.  But not here!  I spent at least an hour looking around at all the fantastic modern and vintage tops and dresses.  I will be going back.  There IS a market for plus size women and I'm delighted that this place exists.","date":"2015-03-04 19:33:08"}
{"review_id":"EFvjRonQ52Zv8Q-KzaP4tA","user_id":"9eQIGbBCrTfmedDFYQC98Q","business_id":"hqKhAY4IJLj_7fmIpRy6Hg","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Excellent service from the cute blonde bartender Lindsay, cheap beer, good music and pool tables.  Oh, and the cleanest bathrooms I've ever seen at a dive.  Definitely be coming back","date":"2017-03-03 20:41:33"}
{"review_id":"bxr9BenGPjTqH-AfTgzhPw","user_id":"kDGhswMrYIOaFJAViW_nCA","business_id":"6zry3kyGHiplbQ4rdqxbaQ","stars":5.0,"useful":10,"funny":8,"cool":8,"text":"Wow. Difficult is not the word I would use to explain Turtlehead Peak. How about \"extremelystrenuousandrewarding\"\n\n6 hours round trip, 2 liters of water, holes in my shoe, change in headband, backpack tan, sunglass tan, burnt arms, sore legs, and dirt all over my body was the result of my trip at Turtlehead Peak.Making it to the top of Turtlehead Peak I was rewarded with a really nice cool breeze, an ammo box holding a signature book, and one of the best views I have ever seen in my life. Worth it? Yes. Would I do it again? Probably not. \n\nWould not recommend for something looking for a nice stroll in nature or a quick hike (less than 4 hours). \n\nWhat I learned from my experience and mistakes is that you should have the following items with you:\n\n1. Excess water (better to have more than less in this case)\n2. Sunblock\n3. Hiking shoes or comfortable shoes that you don't mind destroying.\n4. FOOD! ( I really lacked on this one, I ate prior to the hike, but all that uphill really took a toll on my energy. I appreciate the kindness of whoever left a Clifbar inside the ammo box holding the signature book. Don't think I would of made it down without one)\n5. A companion\n6. A map or GPS device.\n7. Focus\n8. Patience\n\nP.S. Don't get off the trail like my group did within the first 15 minutes. There are trail markers for you that will make the trip a lot less strenuous and more enjoyable. \n\nP.S.S. The first part of going down can be dangerous and it is easy to slip, so be careful!","date":"2011-05-27 07:18:15"}
{"review_id":"BU_TqsBIXKVom-TeUlNXHw","user_id":"A0Tkq4VV8dD6t8NbBxvBPA","business_id":"xUsLyzWQId6nXwNDVq08qQ","stars":4.0,"useful":5,"funny":0,"cool":2,"text":"Wow! I'm the first to review! How can that be? The Lotus Garden has been around for 60 years and there's no question as to why. The food is fantastic and the staff is very friendly and accomodating.\n\nMy meal always starts out with an egg roll. These are no ordinary egg rolls...they're not tiny, and aren't considered one of those side items tossed in as an afterthought as at most Chinese restaurants. No - these egg rolls could be a meal! Filled with baby shrimp, cabbage, and carrots, the filling is tender with a bit of a crunch. The wrapper isn't your typical thin, fried, \"papery skin\". The wrapper is a bit more substantial because of the size of the egg roll..yet it's crisp on the outside and a little chewy on the inside. The best egg rolls I've ever eaten.\n\nI also like to order the fried pork dumplings. They're pretty basic as pork dumplings go, but they have a great flavor and the dipping sauce is very good. I'm pretty picky about my dumpling sauce. I don't like it too salty or too sweet. This is just perfect with a touch of heat.\n\nMy main course staple is the chicken with garlic sauce. This is noted on the menu as a spicy item. The Thai red pepper flakes give it the right amount of heat without overpowering the garlic brown sauce. It's a simple dish with slivers of white meat chicken, slivered water chestnuts, and a few mushrooms tossed in for good measure. This dish is so flavorful that you don't need anything else. I love the chicken paired with the crunch of the water chestnuts. They both take on the flavor of the sauce quite well. \n\nOther great dishes are the chicken lo mein, General Tso's Chicken, and chicken with broccoli.\n\nPlus the atmosphere is welcoming and cozy. No need for takeout!","date":"2009-05-19 17:41:51"}
{"review_id":"-DQb3fBYScdqyi_9irsJtA","user_id":"CWenIpiWVvcBJPXFR5A6OQ","business_id":"oS96aJIHFWcFAlGHKKXjaw","stars":5.0,"useful":5,"funny":2,"cool":3,"text":"So happy to have found a little piece of France in Pittsburgh! As a francophile and food-lover, i was excited to try this place out. It exceeded my expectations. The little shop mirrored the boulangeries in France. I ate the sandwich La Campagnard, which was a simple turkey sandwich on a baguette. Its simplicity, freshness, and texture made for an amazing gastronomic experience. I also sampled the Pistachio macaron which was reasonably priced and very good as well. Of course, i had to get a Baguette Tradition, which had an intoxicating smell and had the perfect consistency of crunchy and fluffy on the inside. \nWill definitely go back soon, and i suggest anyone who is visiting Pittsburgh must go here. \nThe only downside was that there were only a couple of tables, and with the line forming into the street, not everyone could sit. Luckily, there is a park across the street.","date":"2014-04-19 17:37:58"}
