{"review_id":"U41FD_8A4Ftx2r0HpNP0bQ","user_id":"GtAnNpuu4rVFEyBhv8k8Ww","business_id":"hihud--QRriCYZw1zZvW4g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Food is FRESH, great service and the cost is very affordable. They have a great selection of items to choose from. We have 3 kids and as you know, kids can be picky eaters. Because they have such a good variety there is something for everyone....even the most picky eaters. All and all, I highly recommend this Dining establishment. Dave Sac CA","date":"2016-11-09 21:23:05"}
