{"review_id":"IcDCmZcWjwG7yVbHkOIdgQ","user_id":"HsHuPVBMDahL8CJm6_X63A","business_id":"NFm869_w6cvVaWaNpAzjeA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"One of my friends was in from out of town so I brought her here.  Everything we had was delicious and the wait wasn't bad at all, we must have come in before the dinner rush.  We ended up trying the fried brussles sprouts, which were delicious. The Saganaki on the menu says it is flamed, but either the girl forgot, or they just don't truely flame it, so was kind of disappointed.  The Fried meatballs which were divine.  And the yellowtail Hamachi melted in my mouth. \n\nThe drinks were very tasty as well, they had a granny smith apple cocktail that could be dangerous, as you couldn't taste the alcohol in it, so we ordered two. ;)\n\nIn all, loved this place, will definately go back again.","date":"2014-10-11 15:10:58"}
