{"review_id":"3Mhzwx1HauGV3tnBOaDkQA","user_id":"FNP8h7mywPGKkErQSBJdqg","business_id":"URf61OrDNrpWICL3XHXvmA","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"Loved going here for happy hour. They had the BEST cucumber salad, I could eat ten bowls a day. Went there once a few weeks ago craving some sushi and salad, parked, walked up to the door, only to find that they had CLOSED. Went next door to Humble Pie and the guy at the front said they shut down January 1st. My heart sank. This is the second Sushi joint that has closed in the past few months. Ten on Tatum was equally amazing and had great food. Sad day when great sushi bars close because the chains get more business, even if their overpriced food sucks.","date":"2010-03-12 22:04:23"}
{"review_id":"SEs6ULw_3HPcnFs0g4ZsYw","user_id":"Yxf8BEKQUUJ4IdSgq56sWw","business_id":"xfzDtGxx6B4a27RAyah69w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I loved this place. We stumbled on it because we were staying in a nearby hotel. I told my daughter about it as she was staying in the same hotel. She ate at Sushi 21 twice during our trip.  I would definitely eat there again and would recommend it.","date":"2015-09-24 02:54:41"}
{"review_id":"qUWYCQG4QnNYqsfVj3yYZA","user_id":"nm7UFfTWQiZAOD-AjhL3qA","business_id":"24S-aiManGfjbb-fwwi2VQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I chose La Quinta over other pet friendly hotels because they don't charge an extra fee for them, and I had two little doggies!! So, plus, plus there!! Room rates very reasonable.  Room had no lingering smells of any sort, very clean.  Location for my needs, right on! Had complimentary breakfast, yum!  And free wifi.  So, really saved on a lot.  Staff was friendly.  Will recommend to others especially if travelling with pets!!\n\nOnly 4 stars because the only night I had a chance to relax and enjoy pool, the pool was temporarily closed down til the next day when I check out! Boo!!!","date":"2018-07-17 02:20:23"}
