{"review_id":"nkjCCIQrlHOkUlojvMWVZQ","user_id":"mWwoQZ9NnFNLXVpLqupUVg","business_id":"iAu8s96GKQ73Xe7j_2GyCQ","stars":5.0,"useful":3,"funny":0,"cool":2,"text":"Great place to stop for the Badger game! A great Wisconsin friendly place in Vegas. I would come here again. \n\nBurger was big and juicy. Service was a bit slow, but there were a ton of Badger Alumni here for the game. The Alumni Association runs raffles and has stickers and tatoos, etc. \n\nFun place. Filling food. Friendly service.","date":"2016-12-04 02:50:13"}
{"review_id":"GIbbh0Trik4LDA42n2JzmA","user_id":"2Y2BDlljwa5Gj55u8Oj1RQ","business_id":"BYtGiZr3dbxa2qAhg_3I4w","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Can't say anything bad about this place! Great food, fun gaming and they special order my beer! Yes we are regulars! Avocado egg rolls with jalapeño ranch and stuffed mushrooms are a couple of our favorite appetizers! Love the staff and and the ambiance! \nI super am excited for football season to start up again. Good give aways, drink and food specials are the best!!!","date":"2016-09-06 01:20:06"}
{"review_id":"sz-XAI4zjRRDp5SKygokPw","user_id":"0aHFybE0id9DD97QzAfNDQ","business_id":"sSdHUsUZ4mvkb5ymIOJ_Aw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I had a durian mille crepe cake and the raindrop coffee. The coffee was delicious and the setup for the cotton candy was really cute! The durian crepe cake had a decent durian flavour but I would have liked it to have a stronger taste to it since I am a huge fan of durian anything. A little less cream would have been better as well.\n\nThe store itself was pretty cute too! Service could have been faster since it was a slow night but it's ok if you're just catching up with some friends.","date":"2016-11-10 02:00:55"}
{"review_id":"Djnpcek-S1QmH9j4Qmfz0g","user_id":"sTcYq6goD1Fa2WS9MSkSvQ","business_id":"QeGkAHAKUT-TkyPUsl2PIg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This place is awesome! I recently took my puggle in to get a nail grind and the staff was amazing. The girl that did her nails was sweet and patient and Ginger is not an easy one to deal with. Unlike most of us ladies she does not like getting her nails done.\n\nI got a tour of the place and the dog wash stations are pretty cool, there was every make and model of dog there getting their groom on.\n\nI can't wait to take Ging back to giver her a proper bath (and they have a blow dry station)!","date":"2016-09-18 17:18:11"}
{"review_id":"vbKI5yf02LgL-M53lMqWLw","user_id":"ITv82fJ1F-F4p-MU6C8M8A","business_id":"T_YWS3Rp7-iu69VS5jcQPg","stars":5.0,"useful":0,"funny":0,"cool":2,"text":"Tried this place out for the first time last Knight. Think I found my new favorite sushi spot! Pretty vibey atmosphere and really nice inside\/out. Fresh fish and good selection. I got AYCE focused more on the menu items. They have a buffet line with a few choices such as fried rice and egg rolls. Sushi is what a came for . You can only get 1 order of oysters w\/ayce (2pcs) dinner menu only. I would pop these like crazy! But you can buy them by the half or full dozen. Presentation overall is A+. A couple behind me got a sashimi platter that had some dried ice effect to it pretty cool! All in all I'll definitely be back again. Go Knights Go","date":"2018-09-25 17:33:33"}
{"review_id":"6r2UDwgveltdjpm63lAZgg","user_id":"-InhDRRVG7wrwsgAUvN4Qw","business_id":"-D2vGSq_SvuCmHdqsDxzeA","stars":5.0,"useful":7,"funny":0,"cool":1,"text":"I recently answered a job offer on Craigslist which stated \"In the chaos of unpacked boxes you orchestrate a home masterpiece!\" which I quickly answered and got.  Basically I curated this woman's art, sacred objects and artifacts collection and needless to say it was a very memorable week working in what you can imagine to be a very eclectic home.  When the job finished my client invited the crew and I to a celebration dinner which brought us to a restaurant in Inglewood on 9th avenue S.E. called Sugo Caffe Italia.\n\nJust sitting outside Sugo I felt underdressed and so did my co-workers but our appetites and curiosity managed to find our way into the restaurant where our reservation of 6 was warmly greeted by the staff.  The decor in this restaurant is exquisite, simple and clean with accents of contemporary earthy art pieces on warm muted walls.  Jarred tomatoes and jams are illuminated upwards with mini lights shining brightly from beneath them and antique chandeliers hang above dripping with crystal raindrops and lined pearl beads.  There is no corner that has not been thought out decoration wise here and the table settings are complete with artisan ceramics and fine crystal glassware.\n\nAn average meal is between 20 to 40 dollars but once you savour the many dishes on a menu that changes every evening and the many cheese options that I couldn't pronounce you are completely titillated.  Every meal's presentation has been evoked with an artist's touch and the freshest ingredients are presented in front of you to tantalize your palate.  I was extremely impressed by an ample Scotch list, over 15 choices and the huge portions of deserts that were presented in the most elegant formations that look like one could almost wear them as head pieces.\n\nI was so impressed by Sugo the first time that I took my partner there to have our own celebration dinner the very next evening.\n\nAbsolutely 5 stars without a question.","date":"2009-10-14 02:33:41"}
{"review_id":"W4z6w4jGiVb8ZlntHjYieg","user_id":"C7aIVNWsRtOnn6cGtc8WAA","business_id":"YXvXE2p6xeg6a11SMIjQ3w","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"If I could I could give 0 stars I would. So we show up around 5:30pm on a Monday. Place is pretty empty. Ordered drink which took about 30 mins to get. Ice was already melted in my drink. Ordered apps and meals. We did not get out food until 7:30. We waited a hour and a half for food @ a empty upscale pizza shop. BTW my pizza was cold. And there is some manager guy walking around looking busy but what a joke. Also I ordered a Calzone which was not a Calzone. Crust Chandler Simply Italian is a joke of a place and anyone that waste there money obviously does not care about the food they put in there mouth or any kind of service. What a rip off. Just remember every time someone has a bad experience they tell 10 people. I was with 4 people. That's 50 people in day. I think the major issue is the customer base has no clue what good Italian is. It sad that so many people accept this.","date":"2018-05-08 16:24:57"}
{"review_id":"aBWKb49Xfkv1946YN7_SIg","user_id":"sSPbLBHcEMXaJfoO8zs1bA","business_id":"poSV39UqEg-gpESXafS9-g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Amazing food, drinks, service!\n\nWe started with what we thought would be a 30-40 minute wait for a table- what did we expect on a Friday night?  they send text notification when your table is available (love that!). Our table was made available much sooner than anticipated. The Bloody Mary was super delicious and came with several garnishes-including a nice snow crab leg!   Our server, Dawn, was personable, and while we could tell she was super busy, she made sure we were taken care of, and explained any expected delay!  The menu was AMAZING!  Nothing sounded bad!  I had the snow crab boil with added vegetables (1 pound!) and corn on the cob with the Trifecta sauce at level 3 heat. My companion, the Incredible Running God, was more adventurous and had the shrimp boil (complete with \"everything that shrimp was born with\" as our server put it-eyes, tail, legs) with the Trifecta sauce in level 4 heat-\"Angry ghost\". Be prepared to sweat with level 4 spice!  The kiddo had the pepperoni flatbread which sounded like a horribly boring choice, but hey, what can I expect taking a moody tweenager who hates seafood to a crab shack!  The place was packed!  And for good reason!  It was our first trip there, but certainly won't be our last!","date":"2016-01-17 05:33:14"}
{"review_id":"m4AXzV9l14iFBd9DRdM82w","user_id":"6X0i-oGUbh5DZdTHzFuKfg","business_id":"9A1C1f0m4nQltQrOOTl-Kw","stars":1.0,"useful":11,"funny":1,"cool":0,"text":"The building is lovely.  The remodel after Buttita's is as good as one can do when turning a lovely restaurant into a sports bar-style restaurant (though why one would want to do that is beyond me).  And that's where the good stuff stops.\nIn short, the service and all things related to it were glacially slow; the food, when it arrived, was mediocre at best -- and missing key elements (one whole order, and other parts).  This restaurant cannot possibly last if they don't figure out how to greet and serve customers, or get the food that was ordered actually to the tables.\nThe full story.\nUpon arrival, we found a vacant hostess stand, then a long walk down the hall to the dining room along which we saw no one who works there.  Luckily, we ran into friends who assured us that we could seat ourselves.\nAfter waiting at our table for some 15 minutes, we used a bit of self-help, and accosted a waitress to ask for some menus.  After another 5-7 minutes another waitress finally showed up with menus and silverware. She did not offer water, or to bring us a drink of any sort - just plopped the menus down and disappeared.\nQuite some time later, our waitress arrived, apologetically, and took our order.  We ordered an appetizer (cheese fries), and three meals: 1 burger (would have been on wheat bread but despite the menu, they had none), one 1\/2 ribeye (which the menu says was supposed to be thick, but which was certainly not), that should have come with some interesting sounding twice baked potato casserole, and one individual pizza.  My daughter ordered a diet, I ordered water, and my husband ordered a beer.\nThe water and diet only took about 7 minutes to arrive.\nThe appetizer might have arrived after another 10, but the food runner carrying the plate of cheese fries tried to deliver them to another table. Having learned he had the wrong table, the lad just took them back to the kitchen.\nEventually, the cheese fries arrived.  They weren't as hot as one would like, and for the price, there should have been a LOT more cheese.  The fries were no better than I could make using frozen crinkle fries from the grocery.\nWithin 3 minutes of the appetizer's tardy arrival, some of our food arrived.\nThe burger (but not the beer), and my steak with vegetable, but no potato casserole, and no pizza.\nThe waitress arrived, and asked if everything was there, we told her \"no\", and pointed out that we were missing the beer, the potatoes and the pizza.  Ten minutes later the beer arrived.\nMy husband then went up to the window where the pizza would have been put up for a food runner -- no pizza had been ordered.\nSo. \nThe steak was fatty, but moderately tasty, if only tepid.  The broccoli was cold, the burger was not as good as you can get at, say Hardee's (despite costing twice as much). \nWe never did get the pizza.  Or the potatoes.  \nI DID offer to come in as a consulting manager to help them teach the staff how to actually wait tables......","date":"2013-12-07 02:26:13"}
{"review_id":"dWok_1EBIhokaC1nTK0Qog","user_id":"luhdgbeCQTduV1VcKtcqSw","business_id":"VksJ-Qf5SI3Uhpo2_8GCPA","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"Problems popped up after we dropped off the vehicle. This location doesn't have an after hours key drop box. In the past, we simply left the keys in the locked vehicle.\n\nOn Sunday we parked the SUV in a spot directly adjacent to the front door. On Monday at 5:45 pm; I received a call from  them asking where the car was. After they figured that out; they claimed not to have a spare key and we would be charged continued rental until WE found a way to actually put the keys in their hands. Or we could pay a $50 fee and an extra day rental and they would handle it. After demanding to speak with a manager; we were told that they would drop all extra charges this time.\n\nLooked at our checking account on Tuesday. Found out that they had debited our account for the rental plus the initial deposit. (The deposit is never drawn at the end unless there were damages involved; there weren't.) Had to call our bank to contest the extra charges. The bank handled this for us and we only paid the agreed upon rental price. This was the ABSOLUTE worst rental experience we ever had.","date":"2016-08-25 12:12:27"}
{"review_id":"Kg5ncegiJ3utWRxDtDpi8g","user_id":"1Dul59QEe-Q-7OQHTLOptw","business_id":"-8F04F54iDT6VgWPCgybug","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Super cute place! It's quite spacious with an open feel so doesn't feel like some crammed coffee shops.  The chicken sandwich was really tasty! The bubble tea I got was not my favorite, but not bad either. Will definitely go there again in the future.","date":"2017-09-20 16:18:45"}
{"review_id":"o9fXwrBhxDaYZt_AY-assw","user_id":"EiuyyJ6_sGxNsxU_L1X0pA","business_id":"2JU7FRlnYgdRauYyFzHSLA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is the best hole in the wall with delicious food. There chicken fingers with seasoned fries drizzled with the same sauce, are the bomb!! I've followed them since I was 15, when they were at Stop n Shop. People complain about the area and the ambiance. That's all part of the package, you know if you go down there to find them, that's how good they are. 28 years later, I now take my kids there to eat or order out to take to drive in this place is on point!","date":"2017-03-27 01:15:45"}
