{"review_id":"jFi2QLASSIJl7NzstbnKWw","user_id":"b04v2r8jaHlKTsPaZJ8exg","business_id":"Os1n1_idfw9vv9kwULGJnQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I love coming here because it's always a very inviting atmosphere. A bartender at the Bellagio suggested I try this place if I was looking for amazing Hawaiian food. Him being a Hawaii native, I took his word and decided to try it out. \n\nRussell and Gina are one of the nicest couples you will ever meet. Russell comes over and greets you with some boiled peanuts which are so addicting. We always order the combo and fried rice omelet which tastes amazing. My most recent trip my combo plate was a little too salty, but I didn't want to speak up. I'm so happy for them that they expanded into the space next door vs how small their place was when I first started going there. Best hospitality in town you feel like you're practically family!!","date":"2013-10-24 12:50:14"}
{"review_id":"iua9qOmDKuhtMMWePtZ4Gg","user_id":"Rc5x6wqDTC1x-jn-8TSkLg","business_id":"oUX2bYbqjqST-urKbOHG6w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"A cafe with a very chill and relaxed ambience. The menu has a good variety, and out of the six drinks we tried, we weren't disappointed. We tried a mango smoothie, banana frozen latti, matcha latti, caramel latti, and from their signature teas: Emerald and Scarlett. We also tried the raindrop dessert and it's unique and something to definitely try, but maybe only once. The prices are very reasonable and I'm excited to try more! Oh, and the staff is very nice!","date":"2016-08-03 22:53:12"}
{"review_id":"IA9PlY2SyoAY78MLFl83oA","user_id":"P3qliHdJF8D597F_z4nObg","business_id":"z4K95Y4P5nMrtJiDtXWDYA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Food is great. Really really Great. Portion sizes are adequate. Prices are a little too high for the portion sizes. Last time we went their AC wasnt working well. Spoke to a friend who also went recently and the AC wasnt cooling during her visit either.  \n\n\nAll in all, Ive been back a few times however, will try a few other Mexican joints in South Scottsdale before I go again.","date":"2016-06-22 20:43:21"}
