{"review_id":"opg5-BDGIT7ovgU6nib4jg","user_id":"SRLUbD3FwG2w40IB9RlNNQ","business_id":"Ra5fI9BEAuWWaLJSfkiCiQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Amazing food! You wouldn't think it was the nice just by looking at the outside but the inside decor is wonderful. The Venison was perfectly cooked and the sauces were incredible it comes with the House rice which was also great. The Veal Marsala was a little too saucey for my taste but still really good. The dessert options are also great. Overall amazing place !","date":"2018-01-21 14:38:30"}
{"review_id":"WbLs2xPqkCCymrhY2cKalA","user_id":"Ta5_SSg-ZWqn58W3P0uKnA","business_id":"SZEFE5hL7aN5nM-A44iPwQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I had to find an anniversary dinner which had amazing food with equally amazing views.  I was a little skeptical of Prime because I've been to the other restaurants on the Bellagio waters, and they were nothing to write home about.  \n\nWe were seated outside, overlooking the fountains.  The dry-aged ribeye was a party.  My wife and I were trying to figure out what made each bite so good, but at the end, we came to the conclusion that it was just damn good.  I've had Mortons, Flemings, etc. and this steak ranks higher than those places.  \n\nThe wife ordered the Chilean seabass, and it was just alright.   The fish was flakey, but there was not much taste.  \n\nI'm comfortable giving this place a 5, even with the mediocre fish, because our dining experience was everything we hoped for.","date":"2016-07-14 18:51:05"}
{"review_id":"G6Aoy0A44z0AQE-ByEatNA","user_id":"UlRTdkOFDDhtUcMQ5Q1vOw","business_id":"i066yR2IDP4FWt6p-k9aFg","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"I really need to try some other sandwiches that they offer but the Paul Reuben's is insanely good!!! Gotta have it on the Dutch Crunch bread.","date":"2015-01-03 23:31:20"}
{"review_id":"V1nxkftt8jvDK1wP5xrNDg","user_id":"kaWVhOJK3X3_XEtYBD8muw","business_id":"Hb8pO9jpr4IeB6cFcVZxxA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"New owners have really given this place a facelift! The veggie lavosh was recommended and did not disappoint. Looks like a great place to watch sports. Coming back without question.","date":"2015-08-06 21:31:14"}
{"review_id":"bybUhWLPcg5nMQYBOuK05w","user_id":"guP0iaS6scB_ONYC67fyYw","business_id":"8F-UdXe_YylX3k0L1SEiRg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I've been here three times.  I concur with the commenter who noted that the parking situation is difficult.  However, being close to I-15 and Spring Mountain is a huge advantage for me, and it is open 24 hours.\n\nA relatively new member of the staff is Tony, who recently left Saigon 8.  The guy is terrific, and I've seen him iron out the bumps when language is a problem.  He's the reason I came to this restaurant in the first place.\n\nI've had pho twice and vermicelli with grilled pork, spicy (#68) once.  The pho broth was pretty good (not quite Saigon 8, but not bad), and the meat, etc., was also good.  The #68 was the best thing I've had there, and it is served in a bowl rather than a plate, which I think helped.  The restaurant was jam packed (Friday, about 1:30 p.m.), but service went smoothly.  By the time I was finished, I would say about two thirds of the crowd had left after eating.\n\nAt the table, There was hoisin sauce and Sriracha hot sauce, plus fish sauce and soy sauce.  There was also a jar of a pepper sauce that looked like a Szechuan sauce, but didn't have the heat.  There were plain wooden chop sticks, which I like, spoons, and small saucers, which I use to mix a dip.  I've mentioned in my Jenny Pho review that this is the way I prefer it, instead of bringing stuff out with the pho, and using lacquered chop sticks.\n\nOne thing you should know is that there is a sign that says cash only.  That changed a couple of months ago.  They allow major credit cards (Visa, MC), but they left the sign up.\n\nI like the restaurant for the quality of the food, which is pretty good, location, near I-15, and the fact that Tony now works here, and he's terrific.\n\nSomething I should have said earlier:  Pho Little Saigon makes its own Vietnamese sandwiches.  I brought some home, and they're very good.  Pho Saigon 8 doesn't  make its own, though there's a shop that makes them out the rear of their parking lot.","date":"2014-11-30 01:24:25"}
{"review_id":"Z2lLB8PXDKpVWpi_gkzFtg","user_id":"iZNs250Zzjga4wSOU1AYcA","business_id":"bKSIcXTdr5qg83SFq_gOTA","stars":4.0,"useful":4,"funny":8,"cool":8,"text":"How can you NOT love a store that is filled with clothes that have sayings such as \"I only cry when ugly people hold me\" or \"When life gives you lemons, squirt people in the eyes\"..??\n\nThis place is a playland for the fun, the kitschy, and the yeah...just a little mean.They have tshirts, shorts, baby onesies, pajamas..also keychains, compact mirrors, lip gloss. Whenever we come to Vegas, I have to come home with a D&G shirt, it's so hard to just choose one...I could easily get a little outta control. \n\n\"Oops, I almost cared\" or \"I can tell your bag is fake\" are ones I have eyeballed on numerous visits, but still passed up. This time I got one for my better half too. Control Freak with an old-school gaming remote control on it.\n\nD&G is the new black.","date":"2008-04-29 14:44:52"}
{"review_id":"8HE6Wc_A5eHcPGqpeWplvw","user_id":"I4RpSWfgDSlDZ6DL2FYfiw","business_id":"0FUtlsQrJI7LhqDPxLumEw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Are you looking for an organic, unique, and historical restaurant? Than Joes Farm Grill is the place for you. Even if you have simple tastes Joes Farm Grill will have something to suit your needs.  It has beautiful decoration, great food and affordable prices, so why not pay a visit. \nJoes Farm Grill has a long historical background, with a house originally built in 1966 by the Johnston family. In later years it was decided to turn the farm into a restaurant with its food being home grown or locally brought in. The house development around the farm is Agritopia, and was dedicated to permanent urban farming. In fact if you live in the development surrounding the restaurant you can rent a garden lot to grow vegetables.  All of their products are certified USDA organic, and their focus is common food done uncommonly. They feel fresh food taste better and are better for you so why not share all that with the customers. They take the foods taste to a new level with all of the recipes and ingredients. \nJoes Farm Grill is delicious, unique and a fun experience. I feel most restaurants are chains and don't have the history behind them like Joes does, and because of this it makes the experience much more special. Knowing your food is organic makes it taste ten times better, and knowing you don't have to spend a fortune for organic makes me want to go again. It's really stands out among most and everyone in the chandler area needs to stop by and visit. \n First walking up to the twelve acre masterpiece is like going through a farm, with orange trees covering the path and large oaks surrounding it which gives a beautiful green glow of a garden.  It smells fresh and gives you an earthy vive. They are enormous and full of green vegetables that look extremely appetizing. They are covering most of the land and you can walk through them and see your food growing.  The building is white with large windows showing the back and the front equally, and the inside has simple decorations with light blue and green accents not to overpower the beauty of the vegetation growing outside. It holds no more than a hundred people and is rather spacious seating. The entire restaurant is very simple with a 60s feel mixed with a futuristic time. I ordered the jumbo breaded shrimp with fries, French toast banana peanut butter sandwich and the barbeque chicken pizza. I went with my sister because the portions are rather large and I could not have eaten it by myself. This was my first time visiting the restaurant and my sisters second. Everything so far was very pleasant and the employees were very nice. No more than ten minutes later our food was ready and it looked and smelt great. We sat down and I tried each dish, starting with the shrimp which were very large. The shrimp was crunchy and juicy and was simple and not overpowering. I thought it tasted very good and wasn't too rich which is a problem I normally find when ordering shrimp. Then I tried the French toast peanut butter sandwiches that surprisingly had strawberry's in it too. This was one of the best tasting things I have ever had! It was a house specialty and lives up to its name. It tasted like a gourmet peanut butter sandwich and was so flavorful and sweet. I had to order another one. Then I tried the barbeque pizza, I liked it but it wasn't my favorite. It was thin crust and slightly burnt, but it did taste good with the cheese and chicken combination. It just tasted like there was too many ingredients on the pizza that overpowered it. The prices weren't that bad either, the shrimp was the most expensive at 14.99 when I go again I probably won't order this again, just because it wasn't a to die for dish.  The peanut butter sandwiches were 10.99 and I crave these every day it was amazing! Than last the pizza was 12.99, my sister liked it more than I did so it depends on your taste but I probably will try something else. \nThe most important part though is the food, and not to leave you hanging was no matter what spectacular. Fresh fries galore. The most appealing part to me was the decorations and the gardens surrounding the place. I think the set up as if you're in a food court is a really interesting concept; you have to throw away your own food on trays, and clean up after yourself. I didn't expect that and I think it's a smart move on the restaurants part.  The calm and relaxing atmosphere, and no rush pace is really nice. \nI enjoyed Joes Farm Grill and I plan on visiting again. I think the organic concept and urban farming is a really nice thing to hear about in today's society. I feel better knowing I'm eating organic, and knowing there are still places that are going strong with the idea of organic. I hope the success of this restaurant shows others they can do the same. This restaurant meets all my needs as a customer, clean, green and tasty what more could you want.","date":"2012-06-25 23:41:20"}
{"review_id":"JlGx3sB8RpKApr-LoSgwSg","user_id":"wl2UKfXcam32XCFGIp5NSA","business_id":"XgRljuEUyaHBKIpIz-PRAA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"One of the best burger joints. Love the concept, food, and exceptional service. Get the TNT burger if you like it spicy.","date":"2016-06-11 21:04:02"}
{"review_id":"rcebF6O2pA5zPUL3B4GJvQ","user_id":"lJPm0lqWb0Lx3CT_QOXEZA","business_id":"ATErtjbLCxEPOD8ICKKr5Q","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Bad service, reeeally slow chefs. We were the first guests in the restaurant, and after an hour or waiting for sushi\/sashimi, the waitress told us they hadn't even started our order! When did 'sushi making' start takin so long???  We told them to cancel our order and bounced. Don't even know what the food quality is like but I can't wait an hour to find out.  There are better Japanese restaurants in Henderson if you're willing to drive out of the hotel.","date":"2013-03-18 18:11:37"}
{"review_id":"t-Dc8jIKQV6m7VZh7zNNYQ","user_id":"TPZbqNXMA2xMXLLd1zL_0A","business_id":"swX3Vj3dQsz1YlCRmwNQEQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"For me Eddie V's never disappoints.  Fantastic service, incredible food, great choices, terrific atmosphere... this is now my go-to place for an overall grand experience.  They offer Valet parking which I love... nothing worse than getting all dressed up and having to walk 2 blocks to get to your destination.  It is $3 plus tip... just an FYI.  We always make reservations just to be sure we'll get in.  If the tables not ready they have a very nice bar area to enjoy a cocktail while you wait.  Both times recently our table was ready even though we arrived a bit early so we just sat down.  Service is A+, first class all the way.  You can just relax and enjoy your dinner.  Things I love, Sea Bass!  OMG it is wonderful!  If you like Sea Bass... get it.  It is a huge portion and its usually market price...  Last time I ordered it was $35 which I thought very reasonable considering the portion size.  Very easily shared by two with smaller appetites. Sorry... back to appetizers... Oyster lovers love the oysters here!  they are on the happy hour menu in the bar area.  Yellowtail sashimi is OMG to die for.  Heirloom tomato salad was fantastic too.  Filet always a good choice... The asparagus was cooked to perfection and I would choose the augratin potatoes over the twice baked.  Ive had both and I prefer mashed or baked usually but these augratin are wow... really great.  The Sole is super!  It is a HUGE portion so unless you are a big eater or you are sharing... there is too much to eat but its prepared to a T!  It has a crispy exterior due to the parmasan crusting... and its delish!  Oh and if you order a steak... you can order any way, any sauce, peppered, etc.... pretty much it seems if you ask they most likely can do.  Just the way you like it! They also have live jazz playing in the bar area... very nice touch.","date":"2013-09-04 01:20:12"}
{"review_id":"qgZw0pewQ7aAC35M5bfmLA","user_id":"u7FrnUo4A-DZYM_OXbRo4g","business_id":"zuVvDYJkKAbXQTTBauAqJQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"My mother and I often go here on Sunday mornings.  I am a big fan of their Eggs Country Benedict and she says that their Huevos Rancheros are the best she has ever had.","date":"2016-05-31 02:10:46"}
{"review_id":"6Rru3tX84484aSC2UoEtCw","user_id":"WdH8pzmTvPyFucmrfI0bUA","business_id":"Q8EzJWK-JIh8zRDfsAeqWA","stars":1.0,"useful":5,"funny":7,"cool":3,"text":"bop is so over-the-top ridiculous. the prices are outlandish for the very little fabric you're actually buying. i've been in there a couple of times and feel like i've entered an alternate world: a land where it makes sense to spend $80 on a tube top covered in cheap rhinestones, a land where the employees believe customers should be discouraged from buying their clothes by sending them sneering glares, a land where they forget their neighbors are pizzeria uno and fair trade coffeehouse. \n\nugh.","date":"2006-04-21 01:25:26"}
{"review_id":"ofLA7-5gVRk3CQDyhDzB-w","user_id":"wgtJ6oS_VIZT_yVz3N5w3Q","business_id":"Jt28TYWanzKrJYYr0Tf1MQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Food was pretty good.  My wife's margarita was too sweet for me (it was the coconut one).  My margarita was very good (not really worth the cost, but this is a touristy place).  Got the tequila \"flight\" which was 3-shots, one of each style of tequila and it was very good and a pretty good price for 3 shots of alcohol.  I probably don't need to return, but it's worth a first-time visit.","date":"2013-08-03 19:05:11"}
{"review_id":"zAD3GLZ93IG2aF8AOKoq6g","user_id":"l2BRqPLJAthlZXW6Te0CUg","business_id":"k1c_bC3DK6mKg797vH1T8w","stars":5.0,"useful":4,"funny":0,"cool":2,"text":"Wonderful restaurant.  Service was the best we have had in recent memory.  Michael was exceptional, friendly, talkative.  Definitely had a passion for what the chef creates.  Just about perfect.  \n\nAs for the food, pretty darn good.  I had the Scottish salmon and at first thought it looked a bit small but it was just the right amount of perfect.  Super succulent with an excellent quinoa radish and edamame mix.  I was actually sort of surprised by how good it was.  Went with the advice of the waiter and couldn't be happier.  The lady had the chicken which was probably the best preparation I have had.  Super moist, served on an awesome bacon stuffing....could have eaten a bowl of stuffing all on its own.\n\nSince it was her birthday we had the s'mores.  Which the house comped; a total surprise and it really just rounded the night out to perfection.","date":"2014-01-17 00:29:01"}
{"review_id":"eDlqeTxzYRAaebOYYoN-Lw","user_id":"7qk1_0ZfrW4_dYQmHW0Cpg","business_id":"ID5wWJ9C7G0hfbQilvlfxA","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"The service was friendly and attentive! \n\nHowever, a San Diegan is familiar with Mexican food and this isn't. Margaritas shouldn't be made with sour mix, nachos aren't 4 large chips with toppings on each of them, and no one should need to salt their food when it comes to the table.\n\nWith all the superb dining in Vegas it's disappointing when you dine out and have a subpar experience.","date":"2016-02-23 19:31:19"}
{"review_id":"obYef6g3o6AVRJW_ocd4HA","user_id":"_xEw7D-qZ4DL2rOD5ZWPvg","business_id":"ZVSGswtLoZLAH9gzRAGf7A","stars":1.0,"useful":10,"funny":0,"cool":0,"text":"I have been using Handy's service for three months now. I will admit that I had 2-3 really good professionals clean my place. However, the others were just OK...Several of them would leave after 1.5 hours even though I paid for 2.5 hours. I could understand if there were not anything else to do, but there was (for example: mopping the floor.)\n\nI have had a couple of professionals who were very rude. The last one was scared of dogs even though it states on my profile that I have a dog, and he will be with me at all times. BTW: I have a 10 pound Chihweenie who is very sweet and likes all people. The last person kept complaining that there is no free parking--well I live in downtown Toronto. What do you expect? She stated that she had tried to call me and text me. However, I showed her my cell phone, and there were no contact from her.\n\nI don't get the same pros each two weeks. I am allowing a complete stranger into my apartment each time. I have decided that I will cancel my service as of today. I am truly not satisfied with the unprofessionalism, pros coming late and leaving early, and jobs that were done half assed. I am not asking for much. I am asking to clean the counters and mop the floors. I don't think that this is too much to ask.","date":"2015-11-18 20:40:08"}
{"review_id":"uF0q0Fusxou3w9tdjI_uvA","user_id":"ThTUwfNAdWrK6tKvl-Dtpw","business_id":"SNuyBZuaCkhEjqAEhjuOrg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Awesome customer service! I finally upgraded and got so much help. The sparkling female there was so nice. She explained the difference from my old device to the new one I just decided on. She helped with flavors (bc with the upgrade the flavor tasted different than what I'm used to) she helped balance it out and made sure I left liking what I had. Above and beyond. I've tried a few shops in the area but this is the ONLY one now!!! Thank you.","date":"2016-05-07 03:16:58"}
{"review_id":"2H6BBloSKumJ5JWx3vzzjw","user_id":"Et6zdAUoxM8BPJbKvsSJlw","business_id":"eiTWTVThkHr-DKXxIysbgA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This was my first time here. Very cool and interesting concept. You pick a poke bowl or a poke roll from the menu or create your own. I picked the Ahi Lover roll. It's like a giant sushi roll, more like a wrap in seaweed paper or soy paper. Yummmm. Besides the fact that the young man helping me didn't know what was supposed to go in the roll, was clearly nervous and shaking, and I had to stop him from putting in crab and put in the tuna instead (you think Ahi Lover would give him a hint), overall it was very good. I will be giving this another shot to try something else.","date":"2016-07-14 20:03:54"}
{"review_id":"iIy0tY1yWQfniRjPXKG72w","user_id":"94WE_bRQlfwpuCyKImRTjg","business_id":"HRxCNChQNu7maK29qviS7A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This bike shop was awesome!! Reasonable prices, GREAT customer service, not condescending at all, (like you sometimes get at bike shops)! Super helpful tips on trails nearby, helped us get the bikes into our car, trail maps, reverse osmosis water to fill your camelback, etc! Literally couldn't ask for more!","date":"2016-12-04 04:23:13"}
{"review_id":"TN071dbv14Vz4C7rskrICQ","user_id":"hRYTM_Z3Bp5oNtrxwl5ImA","business_id":"s6L6SdVYhPcOQEDmNIg1-g","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"The most disgusting Chinese food ever! My hubby ordered some lunch specials since we like like 5 mins away.. it was terrible! Oily food and service was horrible! The lady had charged our card twice. We had to call her back twice to get our refund.. Never ordering again!","date":"2018-10-04 11:01:10"}
{"review_id":"OpOGmmgqTbU5ZXugQh7y7Q","user_id":"FIup8Q0uhRQn1F7zsKmmEQ","business_id":"G5or_Fra4-6IYOVlm_dI2Q","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"The hostess was a complete b&%$#!\n\nCouldn't handle seating\/reservations at all.\n\nWaitress was efficient, but very cold.\nDefinitely nothing like I had heard. No fun, no laughter!  Seemed like everyone was just... there!","date":"2018-02-11 04:29:13"}
