{"review_id":"-zN-et1Klryec6ZNwXMtEA","user_id":"4kux7ad959LcfTy6usKpzA","business_id":"Pthe4qk5xh4n-ef-9bvMSg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Food was delicious and the staff was friendly and they made feel welcome.  Try them out!","date":"2017-11-06 19:07:21"}
{"review_id":"RoIWjkejmRq6JB_LmBELwg","user_id":"D5WdAZCUv0ABEzH40ZlDUA","business_id":"on5wA9xgE-HZyBp19-yxsg","stars":4.0,"useful":1,"funny":1,"cool":1,"text":"On a recent trip to Westgate our friendly tour guide suggested we get pedis here.  This place did not disappoint, taking all 3 of us on the spot and plunking us down in their luxurious (aaahhh ) massage chairs and getting our feet soaking right away.\n\nIt had been about 6 weeks since my last pedi and I was due.  In my opinion, this place was superior to the Aveda spa I had last visited. \n\nTrue confession, I had a little fall in Old Scottsdale the day before on unsteady footwear so my foot was twisted and painful.  The lady worked my feet perfectly, although a bit painfully.  But good.  I walk a ton and have calluses on the pads of my feet that really needed attention.  My feet are in much better shape now - pretty!\n\nA bonus for us was the owner, who was a big football fan and confessed he'd bet on the Vikings to win the Super Bowl.  Then we talked Packers - the local team that has our hearts!\n\nThe best was the price.  The pedicures started for a mere $32.  I paid $40.  One of my friends got paraffin and paid more.  Well worth it for this luxury!\n\nThanks again for the great treatment!","date":"2018-01-21 14:26:54"}
{"review_id":"I5vhFnQIH7u1tWbkhf-eLA","user_id":"eVpp856OTmiZH3OEw8AYEA","business_id":"cTJjTKz2huGZ-ElScC2pSw","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Awesome ambiance, and great staff. Food was pretty good, too. \n\nHad the brown bag chicken sandwich (good), and the fried okra (good). Also had the bacon cheeseburger and mac & cheese (both pretty good). Couples next to us ordered a sampler platter of some sort with shrimp - they both raved about it, as well as the custom style drinks.\n\n$5 for a small(er) pitcher of good beers on Sundays - great deal. Lots of unique drinks, worth a try. Servers would awesome with recommendations and making their unique drinks.","date":"2012-11-06 03:11:03"}
{"review_id":"EvhV4DCHsnM96oRjALdciw","user_id":"rYPjqZO89ABei1fsZBSUbA","business_id":"Pe9kznAqPNFOZ6Ly1qmE0A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"After an evening dining at Commercial Center we decided to drive around the parking lot to see what other odd places we could find. Cue Club is large inside and out. Like how can they use this much space? The bartender gave us the lowdown as soon as we walked in: the building is divided into smoking and non smoking and each have either quarter tables or pay by the hour tables. Apparently you can only do pay by the hour if you're a pro. We chose the non smoking side and there were 2-3 other tables being used at the time. The jukebox was surprisingly really good until someone chose to play their own tunes. We did end up smelling like cigarette smoke afterwards. Not sure if this is from hanging out in the smoking area initially or if it's so overpowering that it gets into the non smoking area. They also have shuffleboard and a few carnival style games like skee ball. Knowing that most any billiards hall in Vegas is going to be equally smoky I think I'd rather come here and know your chances of getting a table are pretty good and they're at least attempting to offer a non smoking option.","date":"2018-10-04 17:47:38"}
{"review_id":"nJAmCEu4TUprWUVHy59Hqg","user_id":"XNEhI7txmya0WzsnYihU2Q","business_id":"58APdML-PG_OD4El2ePTvw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Pretty good brunch place. We went on a Sunday and the wait was about 35 minutes. The salmon brunch plate was amazing- salmon omnelet, lox on a half bagel with various greens and the mocha was rich and chocolately. The Bloody Mary was not too good though, it tasted premade, but the Montreal seasoning they used to line the rim of the glass was a nice touch. Atmosphere is nice with communal seating.","date":"2016-07-03 17:18:08"}
{"review_id":"1xk6Zpi5RIHhww0OiRGVFQ","user_id":"AjXZFItEGQ1LrKD1cS7HqA","business_id":"wrQxV_guk0ntqJWnJlK0NQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I've donated since college when I started organizing blood drives at our school. I try to donate during holidays since it seems that's when more activity happen with tourists in town or DUI accidents. It's a great way to give back and get some neat freebies, movie and Penn & Teller tickets, Amazon gift cards, blood donation promotional and \"hero in you\" t-shirts. :)\n\nThe West Charleston site is the UBS I've donated to for many years. Location is within 15 minutes from home and has great parking. I am thrilled they now have a questionnaire they email me the day of my donation so I can jam through it while having my morning cup of joe. \n\nI love Mimi when I donate platelets. The other phlebotomists not so much. Last Sunday went and had an unsuccessful donation and a bruise for four days from my stick. I will only donate from this point forward when she's working. She knows me by name, happy, bright, sunny disposition, always has a loving presence and checks up on me throughout my 1-1\/2 hour platelets donation process. Afterwards there are always lots of different juices in the frig, oatmeal raisin and chocolate chip cookies, Oreos, nuts and wheat thins. I actually raid the canteen area BEFORE my donation when I have to sit get my vitals done (BP, temp, pulse, iron). Due to being a pescetarian, my iron usually teeters on the 12.5 mark.\n\nPlease donate! We need more people to give in Vegas.","date":"2015-12-20 21:43:58"}
{"review_id":"owR1w1hKsHtFnOWckiuG0w","user_id":"xVuLiVjmHh-XQ6nCpyAx7Q","business_id":"BFibmswPtBNyChp8vBHRsg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great hidden gem with fantastic tea, coffee & pastries. Didn't try any lunch items but def going back. Perfect place to sit and enjoy some time with a friend or good book","date":"2018-08-23 21:26:54"}
{"review_id":"ISN_kInb_vKZRxeJ9NOyxg","user_id":"th5TCwgIUvK9UX9XLa4VGw","business_id":"XnJeadLrlj9AZB8qSdIR2Q","stars":2.0,"useful":2,"funny":0,"cool":2,"text":"Robuchon was the first 3-star michelin my wife and I had been to (Daniel in NYC only recently attaining their third star).  However, it paled in comparison to many of the 2-starred venues.  The prices are obscene first of all - about double what I've grown accustomed to paying for a  similar experience (even the champagne).  Not to mention, the bites and bubbles menu at Guy Savoy we had tackled two nights prior was MUCH more affordable and more enjoyable.\n\nOur standard 5 course menu began with what was really  an oversized amuse bouche, a chopped apple with spices served in a glass wrapped with pictures of apples.  Good but not worthy of being called an appetizer.  The next dish was cold, shaved foie gras and thin slices of black truffles arranged in a salad.  The truffle slices were old or improperly stored and had absolutely no flavor.  I absolutely love truffles and should have sent it back; huge disappointment.  The foie gras was excellent however.  \n\nThe main courses were a boring fish cooked in a unneccesarily huge iron pot and some wagyu steak.  The quality of the steak was amazing, much like the one time I've had authentic prime wagyu before where I was charged far less for the pleasure. \n\n The one saving grace of the meal was dessert..  The presentation of a shiny, glittery ball that melted upon contact with a warm sauce was spectacular.  The dessert trolley offered a wide selection of expertly prepared mignardises.  The free take-home box of chocolates was a nice touch.    Service was great but not exceptional and the tables were packed too closely.  \n\nOverall, Robuchon is hardly deserving of 3 michelin stars based on our one experience, though your mileage may vary .  I feel that it was all style over substance and that may be fine for fashion bu not for food.  At half the price, I'd have been more forgiving (3-4 stars), but I felt cheated and given the many other excellent restaurants in Vegas, I don't feel there's any reason to visit Robuchon.  And I say this having gone in with a very positive attitutide after dining at L'Atelier de Joel Robuchon in Paris, which was exceptional all around.  If you do go to Robuchon, my one piece of advice is to go a la cart, which I didn't realize was an option and seemed almost reasonable.","date":"2009-10-13 15:01:50"}
{"review_id":"6Trmd4xgxhEe5I_LNdZ5bg","user_id":"lROh5HIO2jd2VhDOp8yO6w","business_id":"ms7cmWkPiSBDTnz-1sv2kQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Very cool, spacious dining room decked out in black and red. Friendly servers, although a little slow. Delicious food - the chips are fresh and warm, and the three different salsas are all amazing; the grilled peach salad was more like canned peach salad, but still was light, tasty, and refreshing on a hot summer day; and the jumbo grilled burrito...wow! There are so many good authentic Mexican places in this area, but this burrito would probably top them all! The passion fruit slaw and masa-thing on the side were equally wonderful...so much flavor! Like its siblings Fez and Switch, Ticoz offers terrific food in a hip but casual atmosphere perfect for a work lunch or night out.","date":"2009-08-04 00:00:30"}
{"review_id":"F3Kavu3MeKvnEj4qlK7gYA","user_id":"lcDQPxJRR62T6hA8u4-aBA","business_id":"Pthe4qk5xh4n-ef-9bvMSg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Went there yesterday with high expectations after the raving reviews but was disappointed ... Their website n online menu says they have trout fish but in real they only have cat fish !!! Food was mediocre below par ordered pad thai with tofu... V average taste n burnt fried tofu with no vegetables have to sent back .. Came back with raw not seasoned vegetables ... Hubby ordered basil fried rice with shrimp which has two shrimp n bland tasting ... Only good part was tall manager who was very nice and friendly but i guess their cook need some serious improvement !! And yes the calamari appetizer was totally tasteless like stale have to sent back ... Manager was nice and admitted all seafood is frozen .... Would not go back ..","date":"2016-07-14 19:44:04"}
{"review_id":"new5XHoaqW3XJ4D0lJq0UA","user_id":"ViN-154MG-aeEZAX-VHYqQ","business_id":"VMr8sgoQOW0fo0qVJENajA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Yummmy!!!\n\nLast weekend I was visiting Scottsdale with my mom and we met up with a friend of mine here. That was definitely a good choice :)\n\nPros-\n- Lots of options on the menu, and they are clearly explained so there is minimal confusion\n- Every dish has the option to be changed (perfect for picky eaters like myself!)\n- Generous portion sizes\n- Fair prices, nothing was over $20\n- The staff was very personable! Such nice people who love what they do!\n- Efficient service\n\nCons-\n- I ordered a side of noodles and never got them :(\n\nBut above all else DON'T FORGET TO:\nTRY THEIR NEW SPRING ROLLS BTW. I forgot the name, but it's the Chicken ones on their latest menu. SOOOO good!","date":"2013-04-10 21:03:45"}
{"review_id":"E8BmhoPmuhRL4vgxHehVEA","user_id":"oqau_mWj8R7PMZju0UHVaQ","business_id":"XNrnspswrrB044gPFHSi8Q","stars":1.0,"useful":1,"funny":1,"cool":2,"text":"The copy and print center here is just so horrible. They have no care and concern for customer service. This department always handles shipping too. It should be a walk in and walk out kind of thing showing up with prepackaged boxes- wrong! Seriously UPS shouldn't allow them to represent their brand. It makes UPS look bad. And the store manager just doesn't care. Mention it to him and he'll just say their short staffed and not even offer to help.","date":"2016-09-30 19:46:32"}
{"review_id":"6GM3rSPgZh8wq0JrrB1EzA","user_id":"rtayjZlKP71NpMKHm6VIpA","business_id":"RMjCnixEY5i12CiqnskiVw","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"I come here every so often with friends to get a quick sushi lunch fix, however that is all. I will never come here for dinner or for any other occasion. Service is terrible, although we write everything down in the menu they give us, we receive only half of what was asked. They'll mix up our orders with another table more than once. I was watching one of the waitresses as they had food in their hands, and they looked so lost as to where the food was supposed to be served. Honestly if you do plan to come here, just come for some quick sushi and that's it, otherwise don't waste your time.","date":"2015-01-03 21:06:13"}
{"review_id":"OCKBBbJBs225i4J8I0UMhg","user_id":"n1kvzpwRpVuEwMzjFNkX5A","business_id":"UhCSu92r2XVPmhQET1c2Bw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very tasty and more reasonably. Priced than mojo. But....for my food-allergic toddler, no dairy free! ! :( had to load him up w\/ fruit and candy. Alas. We got free kid spoons, too.","date":"2011-10-27 18:52:26"}
{"review_id":"jP4-vdi7Qv2-9kBN36SqRw","user_id":"WH2aXDOXXlZZsNIBoXw6ZQ","business_id":"9Jo1pu0y2zU6ktiwQm6gNA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"My husband and I started eating here a few months ago. It's close to home and convenient for a quick bite. Food is very good. We've only tried the Mahi Mahi and fish n chips, but recommend both. Prices are pretty resonable for the area and not much different than any other restaurant. Service is a hit and miss. The young gals working there are mostly very friendly and attentive with an occasional employee not wanting to put much effort into work. That doesn't compromise the food however. The one thing that took me by surprise on my last visit was watching a gentleman pick up the wash rag off of the FLOOR behind the cash register and start wiping tables with it. When we were leaving I asked the gal at the counter who the manager was and she said well he's the owner and pointed to the very gentleman that picked up the washrag and wiped tables. I said to him, \"I just watched you picked up the wash rag off the floor and start wiping down the tables.\" I'm sure (or hope) he teaches his staff restaurant cleanliness. You can tell he was embarrassed  (which was not my intent at all), but he did apologize. I think he will be more conscious going forward. I DO NOT WANT THIS TO DISCOURAGE ANYONE FROM EATING AT THIS RESTAURANT AS THE FOOD IS REALLY GOOD AND WE WILL DEFINITELY CONTINUE EATING THERE. Because of this however, I could only give it four stars.","date":"2018-03-03 23:35:25"}
{"review_id":"iZvHMdsGEO-bnrGzmG9K3Q","user_id":"ZQdVRsytsEKJJ0cobovE-g","business_id":"oZcbn7ENit23xbCsyu9xbA","stars":4.0,"useful":2,"funny":1,"cool":0,"text":"I read reviews on yelp for sushi places in Phoenix area before picking one, so my husband & I could go there while we were there for a vacation.\n\nThis one poped up as the nicest and best food reviews. So, we were quite surprised to see it was tucked in the middle of a strip center (between a Dollar Tree and Subway!). We almost had the taxi keep driving and go somewhere else.\n\nLuckily we didn't. It is a very small place, but very warm and cozy and romantic as well. We had exceptional service the entire night and great sushi dishes! We went off the recommendations of our waitress and loved everything. \n\nWe went with the tapas style menu, with smaller portions, and had 5-6 different dishes. I don't remember the names of all of the dishes we tried, but most were raw sushi with light sauces, absolutely delicious! Then the last one was a hot seafood plate with shrimp, clams, squid, etc. THEN they take the sauce left, after we finished the plate, back into the kitchen to make a small dish of risotto with it and served it to us...Perfection!\n\nOne negative comment. I love seaweed salad and they only serve the kind with mostly cucumbers. I was very dissappointed, as I do not like cucumbers, and getting the salad without the cucumbers was not an option. \n\nWe would absolutely go back here, though, and eat again.","date":"2012-02-29 23:03:53"}
{"review_id":"DtgMRRERz1vKAO-Q7Xhvdg","user_id":"K64uNIY-r4JRj1GZmtrNUQ","business_id":"2lF1UsGcDpDpaI1lXgRX_g","stars":2.0,"useful":0,"funny":1,"cool":1,"text":"As a vegan I am pretty good at finding great food on menus at non vegan restaurants.  I was super disappointed last night when ordering the vegetable fajitas to find out you use butter to grill your vegetables and you put milk in your tortillas.  The waitress, who was super at her job, was only able to offer me a salad.  She said there wasn't any vegetable based oil in the kitchen to grill my vegetables.  Super frustrated for myself but the rest of the party really loved their non vegan choices and they will definitely be back.  Me, not so much.","date":"2017-12-02 18:19:22"}
