{"review_id":"rL04Cowa6_dFa2XrUpVgKA","user_id":"uR0yTfsVwtZVBWAAes32gw","business_id":"RRpHuoXpxcuLk4LdB_YrOg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is a very very nice indoor range and affordable to shoot your own or any of Discount Firearms selection on the wall. The sales staff and range masters are all polite to help with any question you may have. The indoor range is top notch by far with high standards.","date":"2018-09-25 11:26:27"}
{"review_id":"lsTR-MMZ55s4GUKGVmNKZQ","user_id":"Lm98gts_yO0eeVYnwYny3g","business_id":"ZLVWlYQQxzZoJbg4w0gsMA","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"My hubby and I went here for our first date night away from our newborn.  It's definitely worth it. Great burgers with lots of options.  The fries were amazing and my most favorite thing was getting a milkshake!  Chunks of apple pie within a shake!  Oh my!  Highly recommend!","date":"2016-06-22 22:06:28"}
{"review_id":"l6SnUVH7wd2lp7FiPqpZJw","user_id":"hg4AyAMgmQGO2tx6kjo8yw","business_id":"zdM9p4ZOXUb-kdRr8VPGQg","stars":4.0,"useful":4,"funny":0,"cool":0,"text":"There appear to be many negative reviews of this place but I can honestly say we had a blast.  We raced with a super-groupon deal so that our family of 4 had 2 races each. \n\nThe kids started with the junior carts and that was the right call as neither really had much experience driving carts (Mario Kart doesn't count) so they were a bit cautious at first. However, in their second race they put the pedal to the metal and tested the limits of their speed-limited carts.\n\nThe adults took the big carts for a run and I was lucky to be racing with novices and took the checkered flag in one of the two races. I was foiled by a \"pile up\" in one of the races which killed my lap average. :) My lovely wife took a nice stroll around the course and it was fun to wave as I zipped by.\n\nThe service was excellent. The track-workers were hilarious. All in all a great experience. \n\n** note ** Our first attempt to race was marred by the company Groupon and their multi-hour outage in March 2015. We did not print the groupon, we couldn't pull it up on our phones, and they had no way to help us over the phone (30+ min wait to tell us that). Clearly this had nothing to do with K1, and they were trying to help us, and other than just giving us the races for free I'm not sure they could have done more.","date":"2015-04-28 19:04:54"}
{"review_id":"IpYfN1xiRJTGqVJKW-vgcw","user_id":"asYFxz_fdfF2-4IiwLaqXw","business_id":"f0-KEhvOZeRx-Zfo6GoA_A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I liked this place.  The Gyros are huge and can fill you up. I liked the baklava as well.\n\nThe falafals were very good and salad was fresh.","date":"2016-08-12 21:29:49"}
{"review_id":"1WKIlJnHLT2i7s0a-s5qjw","user_id":"P241NkCS4JR-QxUwpsA9Jg","business_id":"4IGaWH9jUYMtP2uHIFEqFQ","stars":3.0,"useful":0,"funny":1,"cool":0,"text":"I'm a Cleveland local who travels monthly for work.\nI have to say that now that my horizons have been broadened by other airport experiences I have to put CLE ( Cleveland Hopkins) as just plain average if not slightly below average.\n\nCompared to other similar sized airports it just seems dingy and blah\n\nOur airport is just so Outdated! Sad but true!\n\nDingy concourses, drab and downright depressing. I always feel badly for those with mobility limitations trying to get to the end of the c concourse. People movers would be great but clearly the walkways aren't wide enough. \n\nPassenger waiting areas are so ancient. For gosh sakes trying to find a plug to charge phones, tablets, laptops is almost impossible to locate.\n\nThe food choices are sporadic, limited and boring.\n\nThe welcome for new airport travelers is just not welcoming. \nReading articles about possible new airports in Pittsburgh and Columbus may lessen travelers willing to use our airport.\nWe really need a new airport or a massive update.","date":"2017-12-02 20:19:48"}
{"review_id":"cAEzwo6ODchFpmOjMpQ6qg","user_id":"UAPa7nw1_0_yjvcH82It2g","business_id":"CvonRhKDJaH155xhtpz_iw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Stopped by because we saw that the patio had a good amount of people so we wanted to see what was causing the crowd. We we're visiting from California and wanted to try out some AZ brews. \n\nHappy to report that we were satisfied with our choices the night we came in. We also ordered the brussels and bacon pizza. Definitely not your tradition pizza toppings but it was delicious. \n\nWill be back again when we're back in town.","date":"2018-04-15 16:18:57"}
{"review_id":"MiBup120uHPaEXj4ZIe24A","user_id":"ocbOc0jy1TjEhJIvuVpoPg","business_id":"E0OKctOhZpUQgwUUBc_RwA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Grilled chicken on sourdough swoon. I love all of their food. And it's a late night drive thru. Lots of healthy options.","date":"2016-06-11 22:42:45"}
{"review_id":"5EVEzIC7vvgH8CFnaCbu2g","user_id":"Rifq9wCiA98eTFXNG3bGFQ","business_id":"CvZi1UTIz6yw58R0kYqLcA","stars":1.0,"useful":5,"funny":0,"cool":0,"text":"I placed a custom order on 30 August. I was told it would be ready in 2 weeks. By early October I hadn't heard anything about it. I contacted Carrie Hood and asked for an update. She apologized and said it would be ready that Saturday. I messaged her after I didn't hear back from her about my order that Saturday and received an automated response. I have since messaged her several times and have received the same automated response. On November 4th I sent a message asking for a refund and again received the same automated response. This morning I attempted to contact Rugged Moose Decor again only to learn that I have been blocked. I was using Facebook messager to communicate with Carrie hood. Now I can no longer reach her and I don't have my order or a refund. This company is a scam.","date":"2017-11-06 21:28:25"}
{"review_id":"VtDy03ppjvncyCBO1pMUnA","user_id":"fSaj0b9IizqR8O1BLgbW4A","business_id":"1VCK89mQPnDoGK0amBrYOg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I was looking for a really good wings spot so I came here. Wedges were soft and tasted good however could not really eat them cause it was over seasoned and heavy in salt. Wings were ok not good for it to have \"Wings\" in the name of the establishment, but to each its own. sauce ok. Atmosphere was welcoming server was great. \n\nThe attraction for this place is good to get a drink with friends if in the area or if you want to try a different random sauces with names like \"Voodoo\" then you will like. \n\nGlass wear wasn't very clean\nEntrance not easily accessible due to construction.","date":"2017-08-28 22:36:52"}
{"review_id":"5Bk9D1MHyvD-__kGAoWaOQ","user_id":"SSd0HXDPcHhlMnrn9qwSWA","business_id":"HNQzTcyaW3PwJ2oC8vKWHw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"The good food is not worth the hassle of dealing with the lady at the window she treats the customers like dirt. On one visit I asked for my change and was told no you don't get change and had the window shut on me, the second time I paid for and didn't receive my side of sour cream and when I asked her for my side she demanded I dump my bag of food out at the window and show her there was no sour cream. I plan on never returning to this location as she is always working when I drive through.","date":"2015-09-24 02:10:19"}
