{"review_id":"ZlKbsJu50lVV-gqbBxgMcg","user_id":"dO9V1_-8a2xg5r0FdTsU4w","business_id":"NFm869_w6cvVaWaNpAzjeA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"I'm just going to say what needs to be said- Soul is the best restaurant in Charlotte. They made a mean dirty martini and the pork belly tacos are ridiculously addictive. I think the fact that I'm willing to wait well over an hour  to be seated (which is usually WAY beyond my waiting threshold), says something about how amazing this place is. Go and you won't be disappointed!","date":"2012-12-04 18:04:36"}
{"review_id":"3FVGxLbWdSwiGZWDt17TVg","user_id":"b9fnOAKU-YzBZTunAXEavQ","business_id":"zFGqtqlZXQYYhBozM_ZpOw","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"AMAZING. Absolutely love this place. For pilates and barefoot bootcamp, Martin and Liz are unreal. Janelle and Mark teach an awesome TRX class. Strongly recommend that you arrive at least ten minutes before a class. \n\nOne of the reasons I love this studio is the number of classes they have in the day. I can go to the 5:45 and 6 am classes or hit the 7:15 and 8:30pm classes depending on my schedule. \n\nOn top of the great instructors and class times, it is also really affordable. Especially compared to other studios nearby.","date":"2014-05-07 23:52:01"}
