{"review_id":"LnVme0M39okEsfm73Xsttg","user_id":"WqWV7qDKLXOVmGMHfRlrTg","business_id":"iEOzCcAGjfnkrP4cO2vX5w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I was lucky enough to find this place. The manager Jack was absolutely unbelievably helpful and kind. And he likes dogs! He was efficient and help me in anyway he possibly could I was in a dire need of a new mattress and box springs and he helped me. I was in and out of there within a half hour of choosing what I wanted. I am not sure that I will ever shop anywhere else for a mattress. They will have my business forever and I will also let everyone know about them. Fast easy and efficient. Thank you again for all your help and consideration and time.","date":"2017-09-20 14:28:03"}
{"review_id":"TLzGusMgBWt0SIasInKG9w","user_id":"D9mgcl6MFE3vRKTVadFFdQ","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"We got a GO room which was nice but 2 stars off for:\n\n1. Our toilet overflowed at 3am\n2. No late check-out, not even at noon!\n\nI was looking forward to the bed since everyone raved that you couldn't get out of it but for me, I got out of it with no hesitation. My bed at home is waaaaaay better.\n\nI did enjoy the built-in TV in the mirror in the bathroom. My BF thought I fell in the toilet because I was taking so damn long but I just had to reassure him that I was just watching TV LOL! And I didn't mind the pink florenscent lighting in the bathroom. Pink is my favorite color!\n\nSure the casino floor can be smoky but I really didn't care because as a smoker, I was contributing to the smokiness.\n\nAnd boo to the cocktail waitress that wouldn't give my BF 2 drinks because she was insinuating that one was for me and I wasn't playing at the time. Um, missy can't you see that I have 2 drinks already that are keeping me rather busy?\n\nThe pool is the highlight of the whole place. So much fun!!! The slides connecting to the pools were great and the turn around of people was pretty good so you will find a lounge chair. Sure there were kids but not as much as I expected. And they were about 12+ years old and watching them have a blast made me feel like acting 12 years old again and go down the slide over and over and over and over again. The waterfall is nice too.\n\nAnd how LUCKY was I when I lost my DL in the pool and one of the lifegaurds was able to spot me out and give it back to me! Lifegaurd you ROCK!!!!!\n\n2 for 1 Dos Equis at the pool bar! Drunk swimming! Hell yeah!","date":"2008-08-18 21:24:52"}
{"review_id":"CeqmLTAm_rpbnWyhZsUQGA","user_id":"_PjyLyv3YbVFOXwhXuF8kQ","business_id":"mBzL2_AKRD5TFQwMA6Itdg","stars":5.0,"useful":2,"funny":0,"cool":1,"text":"We decided to try someplace new for our weekly breakfast out as a family, and I'm so happy we went to Lone Spur Cafe. \nOur server, Michelle, was awesome! We had our two toddlers with us, and she engaged them from the get-go, which is huge for us. She got our older daughter some stickers to play with, and they even had a saddle bag up front with goodies in it that the kids got to pick from. She mentioned that it's a very family-oriented business, and that was very clear in how the kids were treated as guests, not just accessories of their parents. I love it when businesses embrace kids!\nThe food was also top-notch, and arrived to the table quickly. I had the Eggs Benedict, and loved their thick, buttery Hollandaise sauce. Their breakfast potatoes were also very good. My husband had a skillet meal that looked great, and I stole a bite of his toast with house-made jam, that was seriously soooo good. \nThe service, food, and atmosphere at Lone Spur were all great, and we will definitely make a return trip in the future to try some of their other offerings! A big THANK YOU to the management and staff for creating such an awesome family environment!","date":"2017-12-02 18:30:42"}
{"review_id":"w2-RdZpyT5Xt0AVIxo_U6Q","user_id":"bYHDSTtg33w5WxA2foWdNQ","business_id":"bZ0HY9fLYrk096mRDBLZyg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I got a French manicure and pedicure done from here a week ago. When I came home, I noticed that my heels were all scratched. Moreover, the French manicure started peeling 2 days later. When I went back to show them my nails, they said they don't guarantee regular nail paint and were least interested in attending to my concern. It would have been better if I would have not paid extra money for the French manicure and painted my nails myself. Would strongly dissuade anyone from going there for the service and attitude towards their services. A customer pays for some level of satisfaction and service which seems this place is drastically lacking!","date":"2016-05-07 01:30:33"}
{"review_id":"AWwty1-e4JHZmqRtWo3NKg","user_id":"Jj2CLSRVr6PnhRM02y00BA","business_id":"lr1FwSGZLAGpHY9RKKHaPw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"All the locations are convenient easy hours of operations and staff are always friendly! Price are pretty much compatible with everybody else!","date":"2015-08-30 15:54:58"}
{"review_id":"V9coWy0DQCh54KFIO_v1tg","user_id":"jZ1ziwykb5EEla5y4D5Ozg","business_id":"-WVF5DKZeEWlMK8Cucto-A","stars":4.0,"useful":1,"funny":1,"cool":0,"text":"I came here for a party a few weeks ago so I can't rate this place as a restaurant. \n\nIt's a very upscale joint. Bartenders did a good job of quick service. Typically expensif drinks bottle service once specials were over; just about what one would expect.\n\nThe decor is modern. Large screens placed through the upstairs lounge. The DJ played some really great hip hop sets; really loved the music. I especially liked the upstairs outdoor patio area. Very cool place to hold a party!","date":"2011-11-29 23:35:23"}
{"review_id":"ispaSCkIdDh2QxvLYwwVTw","user_id":"38aXgF7BOxjeLFeBEJ5rUw","business_id":"V2oe1HVgNK0He9Mf3Q17AA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Excellent idea and execution. I love that the pierogies rotate and then lunch special was very affordable. Excellent service as well.","date":"2017-09-09 01:44:44"}
{"review_id":"bh_e1THgMaSmVZwi2HVCjQ","user_id":"SaiLEuDVmP62l8oNSl5XQg","business_id":"q3YnYPjLuBGRDi_59yTC5g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Food was as advertised\/reviewed by others...love that it's so close to home too! And nicest people imaginable too!!","date":"2016-01-04 04:14:20"}
{"review_id":"cZucqjYXvo-sKJ2G3y90LA","user_id":"ttauTXuRemnMf1SDhMgQZQ","business_id":"ApG6TS7aDiYSZaGjcuzEHA","stars":4.0,"useful":2,"funny":2,"cool":1,"text":"I just came here with my friend who had to get his car checked for something really quick.\n\nPros:\n+Attendant was quick, responsive and nice. \n+Wait was short (it was an easy task).\n+Waiting room is nice - complementary water, coffee\/teas. Magazines and television for entertainment. \n+There is free wifi.\n\nCons:\n- Waiting room is a little small (probably sits around 6-10).\n- I would like it more spacious and open.","date":"2012-07-16 00:39:34"}
{"review_id":"uM8JQxyz14pSW1StGvQ-Xg","user_id":"mAUIuEj03rXXuhcHPV9TbQ","business_id":"uQdk6xm0TE4qji48yysRDA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Too much gringo, not enough gourmet. Pico is overly chunky and hasn't been allowed the time to sit. Salsa verde from a jar. Raw onion everywhere, mayo chipotle sauce in the burrito... It's good Mexican style food, but it's not Mexican food. On the same page as Mucho Burrito in my book.","date":"2015-10-17 00:33:19"}
{"review_id":"wnHykM_VtiTc0b1eXek_ZQ","user_id":"1_ejvGNh3ErL6muPH5Dl6w","business_id":"XO9oHMxyT0fklifbmED5LQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Happened to be walking by on Taco Tuesday.  SO, I decided to stop in and try some tacos.  Got a couple beef and pork and chicken.  Very good!!  Great actually!  The reason I gave a 4 star rating is because I got these to go, and I jumped in the car and only had to go a few miles away.  They were wrapped in foil, but, they were not hot when I got back to work.   I wonder if they could warm the shells, too--just a suggestion.  BUT nice, nice guys who work there and the tacos are delicious!!","date":"2014-02-05 20:42:13"}
{"review_id":"zObtamE5z74BSnpkAxVvZg","user_id":"3ajn7OsVwsgKqBGGlbSgJQ","business_id":"-_G-VYIWq5ITVcQz4VPdcw","stars":1.0,"useful":6,"funny":2,"cool":2,"text":"The one time I came here for myself, my Arizona Brown spider bite was diagnosed as a staff infection. Either way I would have gotten antibiotics, but the misdiagnosis turned me off from this hospitals expertise, especially after a friend who is an army medic and an EMS team diagnosed it right.","date":"2011-10-27 13:22:58"}
{"review_id":"_lx2oiWkP7vwAWmiiO-UFA","user_id":"VehPPTKsJ4dwmHZj94duMA","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Bobby Flay makes delicious food. \n\nI have been to Mesa Grill three times, twice for lunch, and it's one of my favorite restaurants in Las Vegas. \n\nThe space is huge, so even on a night you think a seat might take a while, they can typically accommodate you, so don't skip this place thinking it'll be too tough to get seated. \n\nEach time the service has been fantastic. \n\nFor lunch both times I got the Green Chili Cheeseburger, which comes with some awesome spicy French fries. The sandwich has cheese, delicious green chili and picked onions. It's awesome and that's why I got it both times. \n\nFor dinner, I got the pork, and there's was absolutely nothing left on the plate. \n\nThe price is what you'd expect, but not outrageous. It's definitely worth the visit on your trip to Vegas.\n\n5 *****.","date":"2015-01-03 21:06:09"}
{"review_id":"JK5zGvjb6BmLTAsVb9yCmw","user_id":"VKrXZY_OjTZ1yg7a3HH_4w","business_id":"Vf44uj2f3lVlcHs0ambUlw","stars":5.0,"useful":9,"funny":0,"cool":2,"text":"I've been massaged in 4 states by dozens of masseuses over ten years. I have received sports massages, Swedish and deep tissue. I consider La Vida to be a very good facility and Angel to be a very competent therapist. For more than 6 months I have gone once every 3-4 weeks.\n\nI work out regularly and consider a massage a great way to heal sore muscles and low back pain from sitting at a desk all day. After my old therapist moved to Florida, I began the annoying process of trying new ones. Some have trouble dialing up or down the pressure. Some can't get the low back pain out like others. Some reek of cigarette smoke. Some are lazy, using one hand at a time instead of two.\n\nThen I found Angel, who is quite competent. If you wanna chat, she'll chat. If you want quiet relaxation, she'll put you at ease. If you say \"I hurt here\", she will solve it. I consider one of Angel's attributes to be the fact she can dial up or down pressure just BARELY, and maintain that. She can find where it hurts and, due to her through knowledge of fascia and layers of tissue, massage the pain away. After repeat sessions, she understands I need more pressure on the right side of my spine than my left. Angel's ability to meet her clients needs combined with her through knowledge of muscle and fascia along with the ability to maintain consistent pressure make her an extremely competent therapist.\n\nIf Angel is busy or sick, Ivan is a fantastic alternative. He's an A in my book, with Angel an A+. Edit: Forgot to mention, Ivan's strengths are deep tissue and neck work. If your neck specifically is killing you or you need real deep tissue, Ivan is your man.\n\nLa Vida is an upper middle \/ yuppie chain massage location with ample parking. I feel strongly that these are superior to middle brow chain massage places (such as Massage Envy) and superior to upscale spas (such as Sewickly or Seven Springs or Esspa). Simply put, La Vida has lots of returning clients and as such, a steady stream of business and competent and calm massage therapists with little turnover.","date":"2014-02-05 20:28:23"}
{"review_id":"FxrTJ6AeP32FdwZVK2RXlQ","user_id":"gspAT0PELCPHC4lI5LKdtA","business_id":"1u_FbiGTSTCc1XvvoT2txw","stars":1.0,"useful":3,"funny":0,"cool":1,"text":"I had explicitly explained to your manager that 1) I didn't receive an email - so I didn't see this fine print that you speak of; 2) I'm in the process of relocation, so I don't have my license transferred to NV and still work in both NV and CA.\n\nMaybe the reason you boast not being a crowded gym is that you won't let anyone use your facility without these crazy conditions that I and others speak of in reviews...\n\nAdditionally, you have one shower stall with a huge rainfall shower head; not everyone wants to have water falling directly on their head and no where else...\n\nAnyway, thank you to the GM for being such a jerk; this allowed for me to see that there is no flexibility whenever there is an issue that may arise with your patrons. The reason I signed with 24? Their staff was understanding of my situation and totally accommodating.  Yay for them - love them!!!","date":"2017-04-19 18:34:22"}
{"review_id":"OABC-oUcTmKXCS5SBK-QxQ","user_id":"vhn1kAld_SYmerdUNHyKQg","business_id":"bsrj9_hFAql3dlSf244zpg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Boyfriend and I don't really gamble (tho, I do occasionally play some Blackjack or Poker), so when we come to Vegas, it's usually for a different reason -- wedding, or, most recently, Boyfriend's show at the Double Down saloon. Thus, we actually PREFER a hotel with no casino in it. I got a Travelzoo rate several months ago for $109\/nt for a King Suite with a view.\n\nWhen we arrived, check-in was VERY efficient and speedy. Our room was on the 55th floor and we had a view straight down the Strip. The room was spacious and had a well-equipped kitchenette (including Sub Zero mini fridge, Bosch microwave and Cuisinart toaster and blender). The bathroom had a huge marble shower and separate Jacuzzi bathtub, double marble sinks and a flatscreen TV INSIDE of the mirror! The furnishings are very clean and modern and the room felt luxurious.\n\nThe best part of the entire room was the bed! It was easily the most comfortable bed I've ever slept in -- IN MY LIFE! The front desk told me they are made by Stearns & Foster specially for Mr. Trump, but that he thinks something similar is available through the company. The sheets were high TC and the pillows and comforter were lofty and plump. The hotel also offers a 4 p.m. late checkout for no additional charge, which was perfect since we were out until 4 a.m. the night before.\n\nMy complaints are extremely minor: no call-down service for the valet (but the wait was usually only about 10 minutes), no free WiFi ($12\/day is a little steep and I felt it should have been included), no additional toiletries like mouthwash or toothpaste and the shampoo\/conditioner wasn't very high quality. Boyfriend also thought there should be some sort of rubber mat for the shower, since it was all marble and was very slippery once wet. My only other comment is that the lobby is a little bit gauche (but, it's Vegas...what lobby isn't?!).\n\nAll in all, I thought this was a FANTASTIC value and, as I said, the best bed I've experienced in my life. I will definitely be back.\n\np.s. in response to those who say it's \"off the Strip,\" it's not. It's on the older part of the Strip (near Circus Circus), but it's not technically \"off-Strip.\"  Also, when it's 110 degrees outside, I don't know who is actually WALKING from casino to casino, anyway!!! Seriously? Doesn't everyone take a cab everywhere?","date":"2009-08-04 01:11:02"}
{"review_id":"0285zwocEL-GWL2l6fRd3w","user_id":"yiLiYYg6MM7Pmuo6jPY4Nw","business_id":"uG0yvj2JWfCf0eaIgxcwXQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is very small and cozy, but what I love most is that you really get such great food for the price! \n\nAlso, its a family-owned place, and we always make a point to come out and support the owners who we've gotten to know, every time we're in Kensington :). \n\nBest breakfast place in town, hands-down, if you are looking for a simple, down-home breakfast!","date":"2015-03-07 13:40:01"}
