{"review_id":"K_hFnQs0lkccrstm3NKizA","user_id":"GBfzyv0EK8flUL7YUdM-Uw","business_id":"y5-eKdMan2QwyI4mUi9OJg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I've always liked best buy, however I recently came in looking for a router to connect to my two computers, the suggested to get a splitter, i bought that came home to use it and it didn't work, went back exchanged it to a different type of switch and it didn't work again, after my third trip i figured out I needed a router and decided to go on the shelf and get it myself. Not very impressed with my last trip.","date":"2012-03-30 01:53:50"}
