{"review_id":"MOEjsqGwlRIzp57iPoz75A","user_id":"s5BG_ObtewqCCVfCWiPk_g","business_id":"-FtngCwHCD2tRlH8jpj_Ag","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is as friendly and kind as you would expect to be treated in the farm belt, where this company hails from. Also portions are huge!\n\nA special shout out for Yvette. The nicest and most darling waitress you'll ever meet","date":"2018-01-09 21:15:22"}
{"review_id":"RyYOLkcg68G1wtpdj2PGgg","user_id":"mhvRUHpGDqASGKOfeCu1QQ","business_id":"uuGlYAIvYAX1q1KhpY6dtA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Amazing steak, great cocktails, plus very efficient and friendly service. We'll definitely be coming back!","date":"2014-01-17 04:20:23"}
{"review_id":"YgP6IDrA6Rkedfdq3Nkg3g","user_id":"WacvBAPmuQLzckxnq67FbA","business_id":"Ha_3Kyq7ka0X3Qi5-skCQw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Not bad dollar value for where you are. Menu if kid of small in selection, but they cover the bases. I had   the burger. Fries were cold, and burger was not as hot as I thought it should be. \nThe beef brisket was not hot, but it was a ok.\nWaiter was right on.","date":"2018-06-08 22:56:17"}
{"review_id":"00Pf9TlMZBgn5EziQAlFKw","user_id":"tYnbw419U2Lfzwn_ytrNuA","business_id":"oYfzCy8kUkALFa28og_OsQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Bad 1st experience! Charged for something I didn't ask for or receive. The young lady at the drive thru was rude and incompetent, it's just coffee and a danish. How do you screw that up? Will never visit this store again especially if she's on the window. Bottom line, put friendly people on the window who can place an order and swipe a card.","date":"2017-12-02 19:43:01"}
{"review_id":"BQqKQulp2muLy__0WQP3Ew","user_id":"DPitNu466172os6m0Yri1Q","business_id":"RdK6dhy4lOb2taNp-WrHjQ","stars":3.0,"useful":1,"funny":0,"cool":2,"text":"One of my fathers favorite places to have breakfast.  El Mesquite is a bit of a drive and in the hood but anytime my dad asks if I want to join him I always say yes.  The food is done well.  The Mexican standards: beans, rice, chips and salsa are all tasty.  I've had several items over the years from chile verde to chorizo.  We really only go for breakfast so I can comment on the other items.  But nothing I've ever ordered has been off the mark.  The stand out for me are the tortillas and especially the horchata.  It has to be the best non homemade horchata I've ever tasted.  Executed perfectly.  I would definitely go here more often and for more meals if it werent so far from home.","date":"2012-01-03 16:07:03"}
{"review_id":"bok3CSnPbKPpkVkLrTP-yQ","user_id":"qRWzBX1q07ZuPgaTXB_4JA","business_id":"QzuamBC7eQx8oHlg6n_qIA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"The only thing that makes extended layovers bearable, is the Maple Leaf Lounge. \n\nthis little oasis makes time fly.  \n\nIf I do not have nay pressing deadlines, I am happy to just read my book and have some snacks.  However, if the pressure is buildling up at work, I enjoy their wireless internet, and Citrix in, and get productive.\n\nThe snacks are usually perfect for what I am looking for.  They usually have a wide assortment of light items.  I tend to be on and off diets, so if I am craving sugar, they got it.  If i am watching my intake, they have fruits and veggies.\n\nThe staff are always non-intrusive, and the guests tend to be like-minded. \n\nOther than the comfy setting and snacks, it keeps me out of the shops. :)","date":"2012-10-08 14:23:24"}
{"review_id":"0lEcodS-yEV2Uw22Yr8h3Q","user_id":"XHILHzYk1zK-Ay66j6gcZQ","business_id":"2gHJ-csflxzezLAi6JQW0w","stars":3.0,"useful":2,"funny":1,"cool":1,"text":"This place gets 4  stars based on the hotel it self. It's location gets 2 stars. Thus the 3 star rating. The hotel offers a shuttle to the airport. I was on there for business, and the front desk clerk was extremely helpful, as far as helping me with directions and getting where I needed to go. \n\nThe only negative to this hotel, was the location. 30th and Van Buren is not such a nice area of Phoenix. Granted, it's nowhere near the shadiest, but if you have a choice, you should make a point not to stay east of 7th Street and Van Buren.","date":"2012-05-28 15:03:14"}
{"review_id":"T7UiE1ZvusDHGyhvBR7XYw","user_id":"AKpKCNFmagy92lnnmDHGWw","business_id":"IhNASEZ3XnBHmuuVnWdIwA","stars":5.0,"useful":3,"funny":3,"cool":3,"text":"So the guys told me they steep the fresh brews for 7min. If you like your tea strong like me, order any fresh brew for 10 min steep and the drink half sweetened with honey. BOMB. \n\nUpdate: CREPES ARE BOMB. I'm used to a crepe having only the stuffing on a small mid section on the half of the crepe. But these crazy  people put the toppings on the whole complete half of the crepe and then fold it in that typical crepe way that it feels like it's a crepe cake with fruit and Nutella layers. BOOM","date":"2015-11-05 23:53:25"}
{"review_id":"DWIyzSl5kI1Foshhc38Kpg","user_id":"3RKdyZNgbZZUIjslqXWhZA","business_id":"S-Hksc_Hh_dMEbiTWDnblQ","stars":2.0,"useful":9,"funny":3,"cool":0,"text":"My sister got married here tonight. I'll start by staying that the venue is gorgeous. There is not a lot of parking so just plan on that. I am giving this place a one star simply because the owner Betty was terrible. She was cold and unkind. At 8pm when the part still had one hour, she started going table to table dumping out drinks and cleaning up. It Made the guests uncomfortable and my sister (the bride) felt anxious and started cleaning up and asking others to do the same. I thought that was unprofessional. She was also drunk and smelled strongly of alcohol. Not that I care if you're drinking but perhaps that altered her mood.","date":"2016-12-04 04:19:27"}
{"review_id":"ZRwIbqGNBQLPCaS9EqjR4A","user_id":"z4Fxr2GhzxpHvkZyekZAOA","business_id":"lH1WyBjyrIlWjYvKmaKctg","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"I stopped in because Harumi Sushi no longer serves dinner options, only sushi. Upon entering the restaurant I was greeted by a nice woman. After glancing over the menu, I chose the lasagna, which comes with sourdough bread. I wasn't in a dine-in mood so I took the order togo. The restaurant was clean and I only waited about ten minutes to receive the meal. However, the clean environment and short wait time cannot make up for the bad taste of the food. The lasagna was horrible!! It taste extremely bad and I don't know if it is just me or not but when did lasagna start being made with carrots? Moral of the story is, I will not be returning again!","date":"2016-05-19 03:57:03"}
{"review_id":"SlXnM-Raf51vZ_MChfmE2A","user_id":"xiob29rYgq0pWXPnBh48Rg","business_id":"jAkzCaRnri2b9n8UGrRwvg","stars":5.0,"useful":7,"funny":2,"cool":0,"text":"Craig puts the customer first.  He gives friendly good service quickly and gets good results.","date":"2013-05-28 22:21:54"}
{"review_id":"imbPLAFFb0SPz_779u13QA","user_id":"wxRVZowoEoy7kscvU-FX-w","business_id":"u-SvRRAfYgpbXZRfQgcTzA","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"I'm a big fan of ramen and prefer Imadake's ramen over the ramen at Kazu and Ramen-ya. The spicy ramen is especially good! The noise level is high and reservations are always a good idea because this place is generally packed at night.","date":"2013-06-24 04:35:37"}
{"review_id":"MkjP9AkrsKWIhHWUcHi4Hg","user_id":"oAUzPK5fC75C2A0hZakvrA","business_id":"9p-cpmHaga-EXyc6ZzYCcQ","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"What a great cocktail bar! I'd never spent time off the strip in Vegas, but I was staying in Downtown for a work trip last month when my friend and I came across Velveteen Rabbit. Vegas gets a bad name for being super kitschy and touristy, but there are places like this bar that are so refreshing and change my whole perspective on what the city has to offer. I loved the inventive menu and the back story of the bar's inception. One thing I loved about it most? It's classy, but not snooty.","date":"2017-07-08 18:43:22"}
{"review_id":"IPTO-kgeBz3r_lOXhHLjdg","user_id":"vxf427mKFMUxpfbHCvv6ig","business_id":"4POPYEONJpkfhWOMx_PyGg","stars":2.0,"useful":2,"funny":1,"cool":0,"text":"This place gone down in last 5 years. Steaks are not up to par anymore, certainly not in this price range. Regular, okay steak. Expectations not met at all. Presentation is slaking.  Take your dollars somewhere else. There are plenty much better steak houses with much better in the same price range. \n\nThe only good things that are still left: Bread basket and wine list. But these will not make me come back anymore. It's not that I did not like it, the place is just not good anymore.","date":"2014-07-28 01:22:44"}
{"review_id":"BsmoRGmMBeSbkUe3wD6XtQ","user_id":"6tlC85J2zsHpnrtHp3qX6Q","business_id":"vbUABNAQI2iwN7v0xSqG9g","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"We liked this location better than the one inside Concord Mills. The crew here is pretty green, yet try to offer good customer service. A few of  the patrons had some problems with their orders. Which made us think they were rushing so that they started having lots of errors. I rather wait one extra minute to get it right versus 10 to completely remake the order. One our sides was cold which they quickly fixed for us. We appreciated that service.  I understand a rush, but moderate flow should allow for someone to come tidy the dining room-our only peeve. All in all, it was a typical Popeye's which we would return.","date":"2013-06-24 13:28:47"}
{"review_id":"MTpURf3ZdPGho0ICTJssjw","user_id":"19GV-9KP8fCkDi0kUUSYjw","business_id":"6kkxRV8H9SQLybj0xnEbMw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"So many great things about this resort.   Loved staying offstrip for a quieter experience.   \n\nThe good:.\n\n Staff are great (see exception below).   Most staff here were fabulous.  The check in was smooth, the valet staff are lovely, one of the cleaning staff even offered to wait for me to get my Starbucks when she saw me hesitating to leave the guest access only area because I forgot my card. \n\nThe amenities here are awesome!  The pools are gorgeous and one pool has a sand bottom portion with a sand beach.   \n\nThe only thing I will say needs to change is the pool staff.   For the most part the wait staff was okay but could definitely improve but what I found awful were the lifeguards.   The first day we were at the pool three lifeguards just talked amongst themselves and bottle flipped to keep themselves busy. Yes, bottle flipped - my 8 year kids favorite game.  There was even a point where a young child in the pool went face down in the water and the adult with them didn't notice and guess what? Neither did the lifeguards.   No kidding someone is going to die on their watch if they continue like this.  The second day here it was two lifeguards having a bromance looking at each other the whole time instead of at the pool.  I get that it's not that busy but it's a job that has some dangerous consequences if you aren't doing your job even for a moment.  Instead they were passing a life float between them for fun, talking about picking girls up at the bar to the point my husband had to leave becauae he didn't want to here their childish talk anymore.   \n\nOtherwise a fantastic stay.    I'd return here for sure.","date":"2017-10-24 19:55:07"}
{"review_id":"H1hdeQ1TdZ4fF1GctHWrfg","user_id":"gj7dwFiadFO5gyrH8c7QdQ","business_id":"PmYIuaV18eyr5IMXZskPlg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I've got a 2 hour layover so armed with my trusty ipad I decided to review this box restaurant. I usually don't review places like this. They are all the same to me.  Food is on the average side. I ordered a chilli, coffee, and a donut.  The food tastes the same as every other T Hortons I've been to. That's the advantage of these box restaurants, generally there are no surprises. \n\nMy tirade is going to be on the service staff. These women are awful!  The counter person who served me did not dare look me in the eyes when addressing me. Avoiding eye contact, looking down, she mumbled something incoherent to me. I had to ask her twice what she was trying to say to me. She wanted to know what kind of bun do I want with my chilli.... Whole wheat or white.\n\nI know many of the counter people who work at T Hortons are immigrants working for min wage and they are working long hours, but have a bit of empathy!  A weary traveler would certainly appreciate a friendly smile and a sweet disposition!  I think showing that you're happy can make you feel happy!  Just food for thought....  Something to think about on your next coffee break.","date":"2015-03-04 20:37:18"}
{"review_id":"ZBiVwoU0IzbHqu7pKm2ijQ","user_id":"DBD3NB1ecSF5_OJNsXjK_w","business_id":"vHt0CSynqesXox-9nBj7uA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Walked in the door and my 9 year old pointed out that the place smelled like a bathroom. I shrugged it off and told her they must have been cooking a lot of eggs. I should have listened to my kid.\n\nOrdered a specialty margarita that looked nothing like the picture and tasted like a watered down regular margarita. The waitress, who was doing double duty as the hostess, explained that all the bartenders \"do them differently\" and offered to take it back. I kept it, as I'm always afraid to send food back, who knows what I'll get in its place. Luke warm, bland food. So disappointed as I have been to a location in San Diego where the drinks and food were great. Oh well, we had to use our coupon...","date":"2016-01-30 01:42:55"}
{"review_id":"A-yKlSLEQQcoHR5q2lCyHg","user_id":"Yximlvn0cfb3yVDaLuXDxw","business_id":"VHsNB3pdGVcRgs6C3jt6Zg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"LOVE LOVE LOVE this place! I'm a bit of a sucker for Irish fare in general, but the atmosphere here takes it a step further. Small and intimate with dark woods and nice artistic accents. I've had just about everything on the menu and the only thing I was unimpressed with was the roasted chicken. Definitely try the fisherman's stew! It's sooo goooood. The corned beef and cabbage is amazing, the shepherd's pie is so savory and the bangers and mash are just wonderful. They do a great snakebite too (which down in Chambana is Guinness and cider, not Guinness and Harp)","date":"2013-08-03 19:59:56"}
{"review_id":"uDZoa1KRgoSCtGz9rOebNg","user_id":"YpGt3hdq5adPlEFn9fQ2Zw","business_id":"xzj6q131hJE59tBkhe3Gag","stars":4.0,"useful":7,"funny":5,"cool":5,"text":"A real cozy spot to grab some Greek. \n\nIt's tiny, warm, and feels almost divey, but Crazy Jim's is not a bad place to grab a gyro. I'm not going to say it tastes the most 'authentic', but it is unquestionably satisfying.\n\nIt starts with the bread, because if you're not ordering a gyro on your first visit, you're doing it wrong. The pita is T H I C K. Flavorful. Heavy. It serves as a great foundation. The meat is tasty, the toppings are good and have plenty of customizable options. I had warm feta to top mine off, and it was great despite almost being too rich. They are very generous portions.\n\nYou can get pizza, beer, and a variety of other dishes at an affordable price, so you've got nothing to lose by giving it a try! \n\nJust be warned that parking is a bit of a pain.","date":"2016-10-13 21:19:20"}
{"review_id":"E-JrSKq4yHy-plq4tEtnGw","user_id":"lNDoRrMrdrK-Gd8Yllgpkg","business_id":"LMq6fpxEhN1RhhG88iTqLA","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"I've been a regular at Sport Clips since my first review (Nov 17, 2016) of the Arizona Pavilions location in Marana.\n\nSince then I moved to Chandler and have been a customer at this location for a few months now.\n\nThe price for a haircut at this location is a little higher than I was paying in Marana. However, I still believe it is a good value due to the quality of the service.\n\nI also appreciate the fact that they usually have more staff on duty than the Marana location and so the wait time is shorter, especially on busy Saturday mornings.","date":"2017-10-02 02:33:05"}
{"review_id":"mmyTLeoDNbuZsKXRDy1www","user_id":"-au58wpCb4oX-_N-tKjonA","business_id":"GtioOu-ZcwVJUhTgox4lsA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"When to Grab breakfast as I do everyday. Get to work open my box and it appears that my food looks trampled and thrown away.\n\nNot what I expect from Chick-Fil-a.  This is probably some of the worst looking breakfast I have had in awhile.","date":"2017-04-19 13:11:10"}
{"review_id":"zD4SkySQWcj_snNiTLA2EQ","user_id":"ZfI74lHwtwuUTXYolO83Eg","business_id":"ApG6TS7aDiYSZaGjcuzEHA","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"I'm a return Audi customer and I've had Audi for 10 years.  So far I'm a little bummed because I waited in the lobby for 10 min and nobody would help me...","date":"2017-07-28 17:44:04"}
{"review_id":"eX_IxLVWmYbk-KOtunO-Zw","user_id":"S174fBtIcnQFGH8Ngo861g","business_id":"eNFubUPJR7yIQah-NxZN_g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Place was recommended to as an alternative to the super busy other seafood place and tried it out for dinner with my family over the weekend. \nFancy interior decor that was expected from this sort of restaurant. \nHad reservations so didn't have to wait long. \nSet dinner was competitively priced, and had decent portions for a 5 person meal.","date":"2016-08-03 23:16:33"}
{"review_id":"lr-I1KtY9_ivR1E28Z7Kkg","user_id":"mE1s4m1_vaVPY-pMu7gHvw","business_id":"V2oe1HVgNK0He9Mf3Q17AA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"When a friend told me there was a Pierogi place near my house I was excited.\nI went and had dinner two nights later and saying I was happy doesn't do it justice.\nI had the Kielbasa with Cabbage and Mushroom Pierogis. I also got to try the Meatballs with Tomato Sauce and the Farmers Cheese and Chive Pierogis. \nThe Kielbasa was lean and tasty. Both Pierogis were great but the Meatballs were fantastic.\nOn a whim I took the Beef Stuffed Cabbage with Mushroom Gravy for lunch. It was very good but didn't compare to the Meatballs. Probably because the Tomato Sauce was much richer in flavor.\nDon't forget to visit the market next door. It has so many goodies including Cracovia Plum Butter. Simply Fantastic.","date":"2017-09-08 23:15:19"}
{"review_id":"-Lb4GnswICu7MwCi6WroSw","user_id":"7GPNBO496aecrjJfW6UWtg","business_id":"_BnBjRMt5Ba-TAv07r3fyw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Beautiful food and restaurant. they give ya food for days and days!\n\nI got the deelish risotto (they have multiple risottos).\n\nthe service was great too.","date":"2009-08-03 23:20:11"}
{"review_id":"X6ZWvjSW8MUbaNWrAUAolQ","user_id":"f02-cOUypTfU-_rWu2NaWQ","business_id":"OK0ba4X5seibH8oMWh4bhw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Sushi was average, I was pretty excited after seeing the reviews, but it isn't anything special. The cheapest roll I got ended up being better than their more expensive rolls. The pot stickers were pretty good, but the sauce they came with...not so much.","date":"2015-05-26 13:24:11"}
{"review_id":"0TKhdhzHnF0a3_ChRnZ0WA","user_id":"MPc3f_wBwjwwal2Y8vcX0A","business_id":"p0iEUamJVp_QpaheE-Nz_g","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"This place should be rated less than zero for customer service. We had a horrible experience with the buffet. Couldn't tell you about the food. We got in the line at 9:59 am and were told they were closed when the sign said they served until 10:00 am. That might have been ok if they weren't so rude and when we walked away the cashier actually laughed! OMG! I called to complain to the food service manager. I was told he was in meeting. Not even offered someone else or voice mail. I guess the lack of good customer service starts at the top. Too bad since it's not a bad place otherwise.","date":"2013-12-28 21:32:46"}
{"review_id":"uZ66BJLPMx6mJAY_6bi8vQ","user_id":"kNL4SpfIdMC8GywGayDEOw","business_id":"tOhRQqiupLyJdBJVQMGOEQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Montreal bagels were well worth the experience even in the pouring rain. There were bagel samples galore in this tiny space. I scored a caraway (cumin) and sesame bagel. I heard that the sesame bagels came out hot which was the closest thing to toasted they offered. Anyway, I really enjoyed their flavor and texture. I would agree they are superior to our Denver bagels.","date":"2016-07-14 20:32:24"}
{"review_id":"G-Mx9bsCsmIGICEtne17rw","user_id":"vtJNNmRxWwM8MSULUSAdSw","business_id":"OjnRf8yDGEBCoUDdchSViw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"I thought it was fair. Went to visit them while they were at Whole Foods.  I had the Vegi Jambalaya bowl which actually comes in a cardboard carton. Has rice, beans, cheese, cabbages and some peppers.  It was OK, but I'd never wait 30 minutes in line for it again.  \n\nSo its put in this cardboard box, then the red and white checkorboard paper is put in, then the rice, beans, cabbage, etc.  The problem with this is the paper is not designed to be under juicy foods like beans, so by the time I got down to the bottom the paper was disintegrating into my food. Not very  appetizing.  They might want to rethink putting the paper in their bowls.  Anyway, wouldn't pay $8 for this again, and likely won't visit them again either.","date":"2013-02-21 20:29:15"}
{"review_id":"0jduztItUhOh3FzKGjMxZQ","user_id":"lVbPEaNUxFjwUydjentrYw","business_id":"hr0vxeTzlHx6fTpSSmu2AA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"By far my favorite Cleveland\/Akron restaurant!  Great food, very consistent.  Bartenders are always great.   If it is on the menu... Try it.   Only the Navajo tacos have been so so.  Everything else is outstanding.","date":"2013-12-07 01:09:23"}
{"review_id":"-6pk09iSCpjJQ7_NzYSP6A","user_id":"VrMaL32wWNed_DjOcsO3Ng","business_id":"GtQPbazps0jt7_cJghfmsA","stars":2.0,"useful":3,"funny":0,"cool":1,"text":"Quite a disappointment really.  Over priced non-specialty grocery store that only has you coming back simply because nothing else is close by.  Limited produce selection due to space, nothing is fresh, huge sweets section, not sure why. They do have prepared meals hot and ready to go but they are served in hot plastic and the plastic is placed on a heated table to keep the food warm and toxic, hot food and plastic is pure poison,  by now you know how I feel about plastic and hot food. Plastic is the root of all evil when it comes to healthy eating. Speaking of healthy, they have a Good-life located just above with a lot a traffic as a result, you would think Longos would make some effort to provide some healthy alternatives at this location. Get rid of the Starbucks or white sugar counter and put in a juice bar and replace the white sugar section with some products conducive  to the gym and healthy eating.","date":"2014-04-19 17:09:28"}
{"review_id":"nRZTizRJutyMM3HPpAXOVQ","user_id":"6Q0QWRMJE5Yo47tn7pAaYA","business_id":"RNi6tW22UMgHwWLAb0mYdA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Our favorite when in Las Vegas.   Fantastic prime rib and always great service.  We miss Ms. Taylor, but Ms. Pleasant took over and we had a great time celebrating my wife's Birthday.  Ms. Pleasant is excellent!  See you next visit!!!!!!","date":"2017-07-08 18:07:18"}
{"review_id":"Gqn3CIViASmm-yOUTN8UKg","user_id":"BOmBm4j0r2JPqi6V6swazg","business_id":"w7DEm_2Gj_xF0qeRdbZn3A","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Came here for dinner with a friend. We lined up for ~20mins to get a seat for two. During the 20mins, none of the servers came to ask us how many people, we waited until a table left and that was when the server came over. \n\nI've passed this restaurant quite a few times, and it usually isn't that busy... But I guess we went on a Friday night and peak dinner time. \n\nI was very surprised that the food was better than I expected. I got the chicken teriyaki, which came with green salad, rice, two grilled chicken breasts. The chicken wasn't that great.. But oh wells the sauce was delicious. \n\nMy friend got the crazy platter! That was AMAZONG !! It came with a pork and fish katsu, hamburger patty with fried egg on top, macaroni salad, coleslaw, cabbage salad! The portion was big, and filling! \n\nI'm giving it a four star because I think the staff should try to learn how to approach customers when there is a line up out their door. We were kinda confused.","date":"2016-05-07 03:18:32"}
{"review_id":"_iNcYpFEyftAV-2ohKQqlg","user_id":"VU2lpEyNSp16Gk8Ujrkiqw","business_id":"rLTa-PztQLafDf70aKrNOA","stars":1.0,"useful":3,"funny":3,"cool":0,"text":"This place leaves a lot to desired. My dad and I went during the week because he was craving Mexican food. So, I suggested we give Gil's a shot - trying to support local restaurants. \n\nIt was in a pretty dingy strip mall but we weren't deterred. There was a family eating on the patio so we decided to eat inside (and were the only ones in there, aside from one guy that stopped in to get a take-out order). \n\nWe started with chips and salsa. The chips were descent - thicker than normal but tasty. The salsa (if you can call it that) was horrible. Not much better than tomato paste and a few spices. \n\nThen, we got a cheese crisp with green chiles. This was the highlight of the meal. Not a memorable cheese crisp but the green chiles were fresh and not canned. \n\nFor entrees I got a shredded beef taco and my dad got a combo plate with an enchilada, rice and beans. Pretty bad - bland and nothing to come back for. \n\nThe 1-star is for the friendly service, good chips and okay cheese crisp. But, if you're wanting Mexican food, you'd be better off at Valle Luna or Manuel's. \n\nAnd my rating is not because I'm comparing this place to normal \"Mexican food\" places - I know this place is supposed to be \"New Mexican.\" I have been to good New Mexican food restaurants - this will never be one of them.","date":"2012-11-06 04:19:50"}
{"review_id":"hPTTyLpKwaM3AQ1mVMyTzw","user_id":"Uwlm6u10dSFvYSpppbehAg","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My wife and I know breafast fare, and we think Bouchon is the best anywhere, bar none.  Yesterday morning was our second visit to Bouchon - the first was a couple years ago.  The setting feels elegant and calm, in stark contrast to manic hustle of the Las Vegas Strip.  My wife ordered the Quiche du Jour, which yesterday was a quiche florentine (spinach and cheese), served with a simple salad of lightly dressed greens.  I had the Croque Madame (toasted ham & cheese on brioche with a fried egg & mornay sauce) which was served with more french fries than I deserved.  Seriously, Chef, you can pull back on the volume of fries.  But everything, from the complimentary bread served with butter and incredible jam, to the perfect quiche to the wonderful croque, was FANTASTIC.  Highly recommend.  Only criticism was they were a bit snooty when my wife and I tried to swing by for lunch the day before - seems strange that they say they are open for lunch but close at 1 pm.  Regardless, we can't wait to come back.","date":"2012-11-06 06:27:17"}
{"review_id":"U1dU-rlHqOercHzz-HqqEg","user_id":"sF9R5Ac6kEauAswt7UVyiw","business_id":"2IbXNp96PAZzjpzytN9vVg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Excellent flavour, clean, nice people!\nLove the ambient.. the \"hot wings are not really that hot\"","date":"2018-08-23 20:59:04"}
{"review_id":"ab6TPqyzfrYa0ZUEQKKf-g","user_id":"h69CQvbyAD7JVOc5VPz0_g","business_id":"JTXqPkssRG-3rlrh_uMcYQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I'd never dine in at the restaurant before, I had always ordered delivery on the app just eat and I really liked their foods. I was very satisfied with the food that I get, but it is little but expensive compared to most sushi places I order from. Plus I recommend not to deliver because I've been experiencing longer waiting than was told to me, especially when it's only a 15min drive.","date":"2018-02-23 21:55:52"}
{"review_id":"JZFHvaG3GfB3kegOiWkf0A","user_id":"DF3pL8EatKCBfsF0ok1qYw","business_id":"3eexaenBq8HvkTiYjVl3Pg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"This place gets a 2 stars because while the food is delicious heir service is horrible. Every time I order from here it is always some kind of issue. The first time I tried to order their 4$ ginger salad with extra vegetables she informed it only comes with iceberg lettuce and shaved  carrots.... pause- FOUR DOLLARS? Never mind! I came to dine in today and we order our appetizers- I ordered sushi and Tom Kia soup with modifications to it. and everything came out of the kitchen out of order. My soup came before everyone it was not modified the way I asked for it. And when she sent it back to be corrected the main dishes came out not the appetizer so we said never mind and my soup never came out. I only recommend eating as take out and check your orders to make sure they are correct!","date":"2018-08-04 20:49:53"}
{"review_id":"BZS0w18XfwNOl1EPamR9vw","user_id":"BxV2pTVmYCW15gSZAPMFKQ","business_id":"XHxeDcbfDkXJdOOrmYgdJQ","stars":4.0,"useful":17,"funny":10,"cool":12,"text":"I call it Central Avenue Hiking Trail.  I've heard folks call this the Bridle Path, but there are a lot more running shoes and strollers than riding boots and saddles.\nNOBODY says Murphy Bridle Path, except maybe some grisly old dudes munching stogies and kicking out women at Phx Country Club.\n\n\"there are no brides either so all the times you see it referred to as Bridal Path is wrong. \" Artur C.   ell oh ell 8^ D\n\nI really love this path.  I like going out into wilderness more than strolling through the city's center, but THERE'S SHADE ON THIS TRAIL !!!   Yea!\nIf you were to go all heat stroke it wouldn't take a helicopter to extract you!   Yea!\nLots of friendly people of various hobbies and fitness levels, and a Boy Scout troop (I cannot recall the name of to give credit to) has even continued to supply the doggie mitt boxes with real pick-up bags, even though the city of Phoenix has stopped supplying them to all of the dog parks.\nAt the north end of the path, you are a little south of Dunlap ave, near Corbin's and Bombero's, and at a crossroads with the Trail going along the Canal.  You can park in the lot at Senior Villa Mexican Restaurant [*Edit: Formerly this mexican rest, but now the new Central Grille at 8525 N Central*].  If you want to start further south, then there are plenty of churches where you can prob park, but this restaurant is not open in the early part of the day, so even on weekends, this is a nice place to park.  \nLock up!  Despite your surroundings, and those even more posh further to the south, you are only a 5 minute walk from downtown Sunnyslope. \nOn the southwest side of the canal, there's a house with it's back wall bordering the canal path.  The folks here have built a few Guard Towers for their little dog, and s\/he gets to runs up the steps to see over the wall and bark at whomever is going by.  NEAT and FUN for that dog, but was a little distracting to my dogs, who wanted to eat that yappy little....)\nOnly trouble I had: \nonce you're down the road a bit further south on Central, you are moving past various houses, estates, and condominiums, and are no longer near any of those restaurants up near Dunlap, however there is a distinct odor of DIRTY SPENT FRYER GREASE all up and down the path.  I wonder if the city sprays a petroleum product on the unpaved path to keep dust down?  I hope not; they did that on my street as a kid in Detroit, and anyone who walked on it barefoot got blisters, cracking, and peeling skin.  Blech!  Even if I lived near here, I'd rather have the dust, and I don't want that on my dogs feet, either. One reason I'd use this path in the summer is that with all the nice sized shade trees, you don't need to get your dog booties.  \nPick up after your dogs.  What's with the people who tie it up in a baggie, but then leave the baggie?","date":"2009-05-19 23:51:15"}
{"review_id":"45wqS8PK5IiO0wvRrjE5yw","user_id":"HhjokdywLG6XLBkCG4HQcg","business_id":"f-TB-ygTz5qYZpSsglgDbg","stars":1.0,"useful":9,"funny":3,"cool":0,"text":"There is no way this place deserve a high raiting on yelp\n\nThis is the most unprofessional and disorganized range I ever been to. I gave it a chance as it was close my home but I really regret I did\n\nWe arrived and immediately put our names on a list, upon asking how long will it be, the lady behind the counter replied, 20 to 30 minutes. That's ok I'll wait a bit and see what happens\n\nI go and observe the range, only 7 spots, seems small but I'll deal with it. I see three lanes open up, range officer says over the radio, three lanes are open. 15 minutes go by, still no one in the lanes. The place is packed at this point.\n\nOther customers are getting irritated. I go back and ask how much longer, she tells me 25 minutes. Another customer starts yelling \"there are three open lanes back there, what's the hold up\" she replies that she didn't know, after I observed four radio transmissions stating three lanes are available and one range personnel coming to the counter to say three lanes are open.\n\nAt this point, I had enough, got up and left and proceeded to range 702, where I started shooting within 5 minutes of arrival. \n\nDo yourself a favor, skip this place, unprofessional and a waste of time with a horrible set up","date":"2016-07-25 05:33:05"}
{"review_id":"EFpbg1HT1Zv455Gj0fMpmg","user_id":"-krQvx-ZVGJxv480zsWDCQ","business_id":"L4WsFJS9sGwn8a4QlRBSaA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"So I was waiting  to check out and the lady who took me was very rude she needs to be trained to do her job right if she does nt.  like her job than leave.  She  was a lady maybe in her 50s she had black hair . I was asking her how much was each items I had a budget and I didn't want to go over and she said well that's why there a machine on the register to tell you how rude of her to say that to me . I felt like it was a bother of her having me there there fore I will never come back unless you want to have bad customer service","date":"2018-08-23 23:42:14"}
{"review_id":"Cnh4H5u0B1HJBt03f6IcvQ","user_id":"wft2WZu4R1xKUVlVJHu_Qw","business_id":"gP8s25-O3HlMEcbA7ZYW3g","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Worst Experience Ever! The customer service reps were very unprofessional and I was unable to get contacts, even though I had a prescription already written up. I tried to order contacts online through another company because they were so expensive. The company needed doc's approval, but was declined because I didn't go through the check up process that I wasn't notified about to make sure the contacts suited me. The entire process just to get in for an eye exam before was even more ridiculous.","date":"2016-03-07 02:51:49"}
{"review_id":"mscF94aHl77US0MB1mrXvg","user_id":"yzF_-JtpMVPqM-TnYtQs-g","business_id":"5gl2GLgimBz1-Q-uXji_Rw","stars":5.0,"useful":2,"funny":2,"cool":1,"text":"Excellent pizza! I travel a lot and one of my favorite things in different cities is to try a locally owned pizza place. Delivery was right in the timeframe they provided and to my hotel room directly, both my pizza and breadsticks were hot on arrival and the delivery guy was friendly. \n\nThe breadsticks came with a really flavorful sauce and themselves were perfectly baked and seasoned. The pizza was just a cheese pizza and the ratio of cheese\/sauce\/crust was on point and tasted great! \n\nAs much pizza as I eat I ought to be considered an expert and if I wasn't leaving town tomorrow I'd be visiting these guys again. Great food. Thank you!","date":"2016-01-30 03:26:26"}
{"review_id":"v-yGFbuO9w5_vHDUf7cNPg","user_id":"9rMg4ePrSLCqvzebAlUStQ","business_id":"W7Ua8ELRMm3IPd23fp7XjA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This is another great ayce sushi place I visit at least once a month. The biggest selling point is the fact that they actually have little rice with their sushi. I hate how some places have rice that's size of my fist with such a small sushi piece. However, the Entrees here are comparably worse than Sushi Legend (my favourite ayce place).","date":"2015-06-21 00:56:43"}
{"review_id":"sxfmzhMvZ8LlI1x4fhNjKg","user_id":"SQKRGzDa7qd8qHb13Z2-Hg","business_id":"F4kjKxXXyn3e-BYVb1mWcg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"All food is good here I usually get the Italian sub or pizza. Would recommend. Very busy on Friday and Saturday. If you can pick it up usually takes about an hour for delivery. And if you order sides of sauces make sure you get usually they forget to put in my bag.","date":"2014-10-27 01:42:40"}
{"review_id":"jIiulrIbZy1hQ3BjzaFEDQ","user_id":"01s7LU3GsNVUR9vPAoj7Lw","business_id":"u_-PMjrCpr9EBRmLSWCEHQ","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Being huge fans of Unibroue (and the fact that they don't give tours at the brewery), it was essential for us to check out Fourquet Fourchette... and that we have... TWICE!  A great place for beer geeks!  They have their entire line-up of current beers to choose from and an excellent little store that you can purchase bombers and interesting things like Trois Pistoles Mustard, Blance De Chambly Orange Marmalade, and Trois Pistoles Blackberry Jam (we purchased all three of these and they are all delicious)!\n\nWe hit the restaurant at a weird time (around 4pm) on this trip and they had a limited menu.  We did a meat and cheese plate to go along with a Sampler (3 ounces of Blanche De Chambly, Ephemere [Seasonal], Blonde De Chambly, Noire De Chambly, La Fin Du Monde, and Trois Pistoles) and Seigneuriale for me and an Ephemere Cerise (Cherry) for my wife.  A minor setback was that four of the six beers in my sampler came out of the bottle instead of the tap, so only two of them had that super-fresh taste, but it was still good nonetheless.  I would recommend finding out what is on draft and sticking with those, though, because those beers will rank among the best beers you will ever have in your life.\n\nRestaurant atmosphere was beautiful.  When we went during the summer, it felt like a lovely cottage house on the lake.  When it was cold in October, it felt like a rustic ski lodge just getting ready for the snow.  Service was very courteous.  We practiced our French this time (as there were some language barriers on the first visit) but both of our servers spoke excellent English.\n\nDefinitely recommended to swing through on your way up to Montreal.  Even if you're heading to Quebec City, it's not difficult to get to, just a long trip after you leave.  If you're heading back to the US, just remember that you'll be dealing with the border about a half-hour after leaving and that might not work out too well.  Please note that we were able to purchase Unibroue shirts on our first trip through but we heard a rumor that no more clothes were being produced.  I hope they change their mind on that one!  Also, be sure to check their hours before making the drive as they have limited hours during Chambly's slower months.","date":"2013-10-24 14:28:42"}
{"review_id":"y4M6l7NDkAdhOVbC4UHsoQ","user_id":"7C_BrVAgy9XgC_ZKhugYGw","business_id":"ZOIlxeoFnlT0JZB5x8jSOQ","stars":4.0,"useful":1,"funny":2,"cool":2,"text":"Friendly staff, a great job detailing my car, and gas is always 2 or 3 cents lower than \"Big Oil\" . The place is just east if Islington on the south side of The Queensway... I have had exterior washes there for years (Used to be a Shell) today is the first time I spent 38 dollars for the express interior detail... Great Job ... one of those times when you just have nothing but happy thoughts ...And a nice shiny car inside and out...","date":"2013-06-24 21:16:48"}
{"review_id":"dugo66jue68uwIMpGI4STw","user_id":"tKvfjPB2p5k6xNN-18HYgQ","business_id":"0ebavvJVXAzKKQ8C9cOt6g","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I give it 5 stars Bc the good is really good, I'm sure there is better out there but the flavors are fun and unique. They are fast and convenient, friendly and accommodating. They give u huge portions, it's always warm and hearty. The pricing is extremely reasonable and don't skimp on sauces or sides. They always pay attention to my instructions when I order on grub hub too! Love this place when I want to have a filling late night dinner. Delivery times never exceed 30-40 minutes.","date":"2014-09-09 23:28:43"}
{"review_id":"cqg2X5YFl4s4xSGQQ7po1w","user_id":"TndfGJ453B0BHodvYvYjVw","business_id":"eaNenRk_liZBERFFLCXqqQ","stars":3.0,"useful":0,"funny":0,"cool":1,"text":"My family of four ordered the beef combo, which was indicated for three or four people on the menu. For $94.99 (without tax), the three meat choices that we had were honestly tasty and tender, but they were brought out in considerably small amounts and were not refillable. Being accustomed to the cheaper, just-as-good AYCE KBBQ spots in Orange County, CA, we were displeased that we were not full at all after finishing the beef combo. Overall, we thought our meal wasn't reasonably priced and therefore won't be coming back. Though, it would have been reasonably priced if the three meat choices had been refillable.","date":"2017-01-02 06:58:40"}
{"review_id":"Qc85Vhs4RG8knKsYLYmddw","user_id":"Oz8Bp1NY-Szz4lvSbVsV4Q","business_id":"bDjcA6ecs9sMXaPElt7Cng","stars":5.0,"useful":4,"funny":0,"cool":5,"text":"July is my One year anniversary of practicing under Aina, an Authorized Ashtanga Teacher from Shri. K Pattabhi Jois Ashtanga Yoga institute in Mysore, India. \n\nMy practice, knowledge and consistent dedication has progressed tremendously in 1 year versus to all of the years that I have practiced yoga on and off, for cleanses, challenges, girlie times, skittles and giggles....since 2001.\n\nI am so blessed to have this sacred space to traditionally practice the Ashtanga System. Aina has an amazing way to observe, adjust and allow you to grow into your own practice of Mysore Magic. \n\nAshtanga (8 Limbs of Yoga) has completely changed my life. Ashtanga Yoga Las Vegas is the place for you to delve further into the world of sun salutations\/Surya Namaskaras at 5:30 am as it was traditionally taught.","date":"2016-07-14 21:43:19"}
{"review_id":"45IN7F-mqy8i1FQV4svgdQ","user_id":"GPQ9-bYKnbqOVEfR4zQfcg","business_id":"NhRR-2iy3N3y-lcPu27UYA","stars":5.0,"useful":7,"funny":0,"cool":1,"text":"I never expected to say that I love a vet. I love everyone I interacted with thus far at Gateway! I have two dogs - one loves everyone (so this was easy for him) and the other is ... a little more hesitant. When I came in, the lobby seemed pretty busy (they were getting low on seating, but not out) and I took a number. I was seen less than 30 minutes later, and never felt like my wait was too long.\n\nWhen I was taken back, there are tables set up, where the vets and vet techs come talk with you and help your pet. You're not in a separate room (like my old vet). This isn't necessarily a bad thing. I think for one of my dogs it was better because while he got blood drawn and a vaccine, he was too distracted to care - there was (what looked like a) lab\/pit mix across the room who may have at one point looked at him! How interesting! and that golden over there! What's that smell behind me?\n\nEveryone that works there is friendly, and they work quickly. Since they work rather quickly, don't expect to sit down and have a long conversation. They get to the point, and then send you on your way because there are twenty more dogs to be seen. I never felt rushed though.\n\nIf you own pets, you know that they can be expensive. Even small expenses add up quickly. I ended up at Gateway because I priced out my annual vet trip at my old vet and cringed. A lot. I called around and checked out a few other places. I felt like Goldilocks. One vet was a little cheaper, but the staff seemed to hate their jobs and maybe me. Another vet was more expensive but seemed nice. Gateway? Gateway was just right. Gateway didn't offer me any discount, yet I felt like I got two for the price of one (I paid what I would have for just one dog at my old place). My dogs got their vaccines for the next year plus(heartworm and rabies), as well as kennel cough, and one of my dogs got microchipped. Previously I was told that the kennel cough vaccine is given every other year as a shot, and every other nasal - but Gateway had oral. That was so much easier on both of my dogs! One of my dogs is a pug, so the nasal was unpleasant for him and I (on the plus side, last year I got the vaccine as well - since he sprayed it all over me). \n\nBoth of my dogs seemed well cared for while I was there, and got plenty of love. The microchipped dog seemed neutral (and wouldn't take any treats from the vet tech after she took him to get microchipped), but he pug LOVED it. I practically had to drag him out of there. Being so incredibly busy, you'd expect Gateway to be a circus, but it was run pretty smoothly. I hope I won't be back until next year, but I know that regardless they'll take excellent care of us.","date":"2013-05-08 05:19:03"}
{"review_id":"O5NpKOLzmSh5EdU0SZzhLg","user_id":"jGKMAlMNbgonyeZBdqMpEg","business_id":"IhNASEZ3XnBHmuuVnWdIwA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Really friendly staff, very willing to make adjustments or re-make your drink to your liking. \n\nBest boba in town, soft and chewy (even in cold drinks 30 min later), nice honey and brown sugar sweetness...not too sweet and definitely not bland like some other places. \n\nVery good tea flavor and great tea:milk ratio. Tried the Okinawa milk tea (not as heavy as Hokkaido and more tea than milk flavor). Loved it!","date":"2015-10-08 01:52:53"}
{"review_id":"XDe6hbmRZ9TwSwkvQBxpEA","user_id":"tIFWjDotktTv8vbs5gFQ-A","business_id":"7HrCELR6uv2HkgL7aT_hcQ","stars":3.0,"useful":1,"funny":0,"cool":1,"text":"One of the best winterlicious I tried thus far. I never really like winterlicious menu, usually it's pretty mediocre. It is in the higher price range of Winterlicious at $45. I had sardines as starter and black cod as main. The cod was very tender and nicely flavored. I really enjoy my meal. However, one of my friends had lobster bisque as starter, and he thought it was bland. And, he had squid as a main, which he thought was the size of a starter.  :\/ everyone's a critic.\n\nI thought the service was great too.","date":"2012-02-01 02:36:29"}
{"review_id":"s3zWHOyPZjRwfu8pbAMdZA","user_id":"CPTqcnBtrzQEvWTAIsbk1A","business_id":"JtrYFTxskT97HQBAawjV3g","stars":1.0,"useful":0,"funny":1,"cool":0,"text":"Actually my name is Aaron Sloan. My ex-wife was Erin S. Just clarifying so they know exactly who posted this. I have spent over 1000 dollars and still not finished from 6+k in damages from the estimate on my car that I left there on a Wednesday afternoon and Geico estimated 15 days to repair it and then was told it was done the next Tues.morning. Corners cut? Anyone with half of a brain would agree. I asked where's my new rim damaged in the accident? Oh sorry here is another Geico adjuster present standing next to my car. Owner says my adjuster Tom Fletcher is an asshole and that the guy present standing next to my car was fair and he said he would get me a rim. And the owner also promised the rim regardless and when I asked how much more to do some touch up paint work he said FREE! Long as I would bring my business to them, from now on. \n     He surely noticed that my inspection was up soon as he promised me BOTH! Then I NEVER heard another word from them again since Dec.2016. And still have not been able to afford to fix all of the damage done in the accident that they overlooked due to quick in and out. I had to buy a new battery 3 days later when my car wouldn't start. Whatever mechanic worked on my car forgot to plug in the power cord to my new radiator cooling fan and my car overheated and had to spend money to get a diagnosis why it was overheating and was a simple wire not plugged in. So also proof it was never even tested to see if the new fan worked . This was a front end collision and then I had and still have a loud clicking sound coming from my front wheel where the rim wasn't replaced.  When I took it elsewhere for inspection soon after due to no reply from multiple messages left for the owner gone without a reply? Rather than bother with them after speaking with an ex-employee, I realized I was screwed.  So then I had a broken tie rod not noticed or added to my estimate and anyone knows you need an alignment when you replace a tie rod so another 300 bucks total. \n    But still have the clicking noise or loud tapping and my friend said it's either The CV joint or a bent control arm. But couldn't tell without it on a lift . So now will end up spending a fortune to finally get my car back to perfect operating condition like it was before one of their tow truck drivers just happened to be standing there in downtown Pittsburgh during rush hour with a walkie.  Waiting to prey on me. But I still haven't gotten to the most corrupt part.  Geico paid them from my estimate to recharge my A.C. since it was obvious that it was routine when my radiator, cooling fan, and coolant tank were all destroyed. But guess what happened when I went to actually USE my A.C. a couple months later once winter broke? Hot air. So I took it to Ryan's Auto\/Goodyear in Moon. Twp., and explained everything to them. They said well I can't imagine they would have not recharged your system with refrigerant.  So I paid for a diagnosis and dye ran thru the system and nice of them to only charge me 75 bucks and guess what? Cold air!!! NO LEAKS! SO THEY NEVER EVEN RECHARGED MY A.C. Crooks! And guess what else ? I AM AN UBER DRIVER FOR 2PLUS YEARS NOW AND UBER HAS THEIR TEST TRACK BLOCKS AWAY FROM THIS SHOP IN HAZELWOOD JUST BEHIND THE RAILROAD TRACKS! I have driven Uber employees there too many times to count and as well as them? I tell ALL of my riders to NEVER take their car here no matter what.","date":"2017-06-27 23:15:12"}
{"review_id":"jiEdyT24xwQQ7T9sX5wH1Q","user_id":"0upLXvOe-ejNyeyTifRxJQ","business_id":"mO8ukT3f5BRQ29pC_WoAtg","stars":5.0,"useful":3,"funny":2,"cool":0,"text":"I had to share, this is the best nail salon I've been to in the Vegas area! Ive had gel twice with Kim and she's great. The entire salon is staffed by the friendliest people and I think the reviews speak volumes. My first gel manicure lasted 3 weeks which is unusual for me, I can maybe get 2. Clean, friendly, and a lasting manicure!","date":"2014-02-23 23:33:06"}
{"review_id":"8cg56vWMUtMjqnO4NZfy0Q","user_id":"L8P5OWO1Jh4B2HLa1Fnbng","business_id":"5eV8oUGdBXylwB7HeaDFOA","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"The restaurant was very busy on the Saturday evening, but a table opened up just as we approached the counter to place our orders.  My wife and I each each chose the Great Greek gyro - lamb and beef gyro meat wrapped in pita bread along with lettuce, tomato, tzazki and feta. At a nominal additional cost, these were upgraded to a platter that included a small Greek salad and soda.  We were more than happy with our dining chose this evening.","date":"2015-05-26 08:22:03"}
{"review_id":"NqxZHcsUWzgNTZCpc1IV5w","user_id":"9bHSiggZp1szjXxrqBM1cQ","business_id":"ZGHMmErnJRKx5II4VcTwXg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"worst company I have ever in my life dealt with all way up to management I will never in my life use this company ever again .and will tell everybody and companies I know not to use them. matter of fact every time i see their trash cans I'm gonna leave a note for other people about how they scam people and let their accounts drag on when there to be closed months ago .  use a different trash company","date":"2018-08-15 20:51:29"}
{"review_id":"VHipxuM-yvhhiaEf2CK06w","user_id":"rhE4gLtM0gb3XLwSz6HPCw","business_id":"16Md-YQqxnSVKgrnL_yx5g","stars":2.0,"useful":1,"funny":0,"cool":1,"text":"Had lunch here the other day and wasn't all that impressed.  FIrst off the parking is very strange you have to park off to the side and walk past an empty boarded up building to get to the front door.  The decor is more rock diner than mexican restaurant, but nice enough.  On a weekday at 12:00 they were completely empty and it's a huge restaurant so that's a little bit of a concern right off the bat.  I had the cheese enchiladas which were ok, not anything special and kinda plain.  The Corn pudding for a side was something you never see and was the best thing on my plate.  The Anaheim Chili stuffed with sweet potato would be better if they removed the skin. It was pretty inedible the way it was served and very messy to scrape the pepper and potato off the skin to eat it.  I will give them props for trying something different, but poor execution at any rate.\n\nThe high point was our great server. She was very friendly and really nice. So I think going here for chips and beer on the patio would be cool.","date":"2012-02-29 22:01:18"}
{"review_id":"yY0MEKwcJPxic0Cd9qX3UA","user_id":"Zof5LevynuBuY00HNbbhlA","business_id":"9H6crpi5M05v7Eny-KV8AA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"The menu is too large and they can only make Vietnamese food. We ordered Singapore noodles and vegetable fried rice, neither dish looked or tasted line their name sakes. It looked lime they didn't fry either one.\n\nThey brought our dishes out one at a time with 15 minutes between each. My wife asked for the Singapore noodles not to be too spicy and they cooked it without curry.\n\nWe will never come back here.","date":"2016-05-07 01:01:42"}
{"review_id":"JsokSFsO_CZ5zEzJKgg6AA","user_id":"dvdWONDt4KbcbKcJtKDL9A","business_id":"KfuNW67ZM3jegHT4txnHbg","stars":5.0,"useful":1,"funny":1,"cool":2,"text":"This place is absolutely amazing. I was at an art show across the street, starving, late on a Saturday night and I knew I didn't want to deal with the hustle and bustle of old town eateries, I was so glad to stumble upon this amazing hidden jewel. \nMy boyfriend and I happen to be the only two in the place so our service was of course outstanding. The food was great, we split the crab puffs, which were nothing special but still good. I had the beef fried rice, just the presentation was impressive in itself the so to no surprise the taste was equally well over par. My boyfriend had a chicken curry dish he still raved about days later. \nThe only thing that might have made our experience less than perfect is that I ordered a pear saketini and the glass came only half full, strange, and the music was less then appealing, if I heard another instrumental version of the song from Titanic one more time during or meal I was going to scream, literally it played four times while we we there, which was only about an hour and a half. \nOver all well worth the price we got out of there just under $45 including drinks.","date":"2010-03-12 20:01:22"}
{"review_id":"p7ndw41PmXktwYjnwBQj-g","user_id":"tRKwDUy7AyNR1Ext37bh8g","business_id":"SGMMS_1R4M3OkeAztscUgA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Booked the rental online after comparing prices at other car rental locations on the strip. The price was reasonable, a little higher than off strip, but was willing to pay for the convenience. \n\nThe service was awesome. Friendly, easy and no high pressure upselling. The car was clean and was exactly as booked. Easy to find the car from the clearly marked Hertz stalls.","date":"2018-02-11 03:55:01"}
{"review_id":"4ueKWKLBGUdqlBAHLBJ7Ew","user_id":"e06pyeueHwJNVZJBKQ67uA","business_id":"qdtfcYMROGZVvYcE9F23yg","stars":5.0,"useful":3,"funny":0,"cool":0,"text":"Placed my very 1st order today. I am very pleased with my order. Very friendly and the BEST customer service I've dealt with since moving to the valley. Thank you for being awesome! \nI order a Green Chili with Shredded beef burrito, cheese quesadilla, side of beans, chips and salsa, and a side of sour cream. It was worth the wait and can't wait to order again!","date":"2013-12-07 18:39:26"}
{"review_id":"8E2bRNPWvBmPWR4Wdtop1Q","user_id":"aifdY9J7g6eWk92UEwh-YA","business_id":"YLwWi9r9S2LXzZlMG1O2FQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I like their service, they have plenty of tools and building materials. They have nice customer service and everything around is clean.\nThe customer service is very helpful and courteous. It's worth working with them","date":"2016-03-17 16:54:07"}
{"review_id":"xIk3A2PYhHJjd8-DzXywYg","user_id":"3Rq5WmYhLVwgSkzWy1UG-A","business_id":"taXKuFldSoerm9SXrckh_w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Are you ready to be transported? Because that's what will happen when you order this food, transported to a euphoric state of pure deliciousness. So I ordered the dumplings and the hunan two. First things first you can order chow menu instead of rice, which was a hard decision but I went with the chow main. The staff is very friendly and there is a very cute fish tank while you wait, anyways pick up the food and get home. This stuff is amazing. The red bell peppers in here are amazing. They are fresh and lightly sautéed, as well as the broccoli, zucchini, mushrooms and onions. This is a great portion for what you are ordering and the meat is nice big slices. The sauce is this spicy brown concoction with lil Brown beans that are perfectly spicy. The chow mein is seriously amazing and also a great side size portion. These dumplings have to be some of my favorites in the valley and I have tried my fair share. This is incredibly worth it, better than most Chinese take out by far. It isn't your typical take out. Seriously give this place a try.","date":"2018-05-19 02:50:35"}
{"review_id":"RecYrlMehlPz4FZjRx3UKA","user_id":"yj8qKmj-6PeWa-G2191Jkw","business_id":"GI-CAiZ_Gg3h21PwrANB4Q","stars":5.0,"useful":3,"funny":1,"cool":3,"text":"This is the second Mastro's location that I have gone to. I've been to the one in Thousand Oaks, CA a few times and thought I would give this location a try. It is located in the Crystals shopping plaza that is next to the Aria hotel. This place is really nice and you feel a little bit underdressed if you aren't in your Sunday best. \n\nI made reservations ahead of time but the place didn't looked too packed for a Saturday night. We had a nice table an attentive waiter. We got our drinks pretty quickly and the martinis were strong.  There was some live music being heard from the lounge area near the bar area which had a nice touch to it. \n\nI still went with the meat selection even though this was the Ocean Club. My boyfriend and I both had petite which is served on a searing hot plate. The meat continues to cook on the plate and just easily cuts like butter. The steak just melts in your mouth as the seasoning of the meat and light butter from the plate meet in your mouth, I call it Meaty Symphonic Harmony. \n\nWe also ordered the sweet potato fries as a side. This is no mere small side dish but a mound of fries is delivered. Each fry is seasoned with an almost tempura like batter on the outside that leaves you craving more and more. I was stuffed after the filet and the fries and the yummy bread basket they bring you (with warm pretzel bread and other goodies). \n\nDessert is something that just can't be missed and I suggest the sinful delight of the signature Warm Butter Cake and whipped cream. The butter cake is rich and heavy with deliciousness and the whipped cream is no ordinary whipped cream. It almost has the consistency of ice cream as it hits your palate. \nThis is my treat for the year, it is expensive so be warned but it is also a high class meal. I highly recommend it.","date":"2012-12-04 20:43:19"}
{"review_id":"sRp1VNv0cVkedWmkehbx1w","user_id":"-9vc7n5Qrc0Wp7_NGufj3w","business_id":"p0iEUamJVp_QpaheE-Nz_g","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"I am a fan!  Been here several of times and never a suprise. Rooms are top notch and the price is Very hard to beat! Sportsbook is on point! 24hrs?!  Only thing I missed was the fire bet for craps.","date":"2015-08-06 21:04:24"}
{"review_id":"kCkyGrMMRQbqx69dgzmnEA","user_id":"I143qmTjREqTwAVWVsB6sw","business_id":"EfAqol3tWckyNrBMIooJmg","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"From take out box right to the trash can. I've had Persian, Arminian, Turkish beef Kabob before & I know my middle eastern food, but this thing was absolutely disguising! The minced beef (koobideh) was dry, not hot & very herbal. The rice stank so bad I didn't even touch it. I wonder how they managed to screw white rice like that. I don't even recommend this place to my enemies!","date":"2016-02-24 00:02:29"}
{"review_id":"r6mJOqJ0xQQWTJ7f6MXcdw","user_id":"QVmfEMLckTVy1gTjYDtZUA","business_id":"gKCQMUVa31kLInYxaAkiLA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Johnny Rockets is a decent choice for a weekend lunch at Pittsburgh Mills. My kids enjoyed the atmosphere and music. For certain songs, the waitresses have a choreographed song\/dance and my kids enjoyed that. The kids' meals are generously sized as well and neither of my kids could finish their two cheeseburger sliders that they ordered. \n\nI went with the Streamliner, which is a vegan Boca Burger with regular burger fixings. I am not sure about the bun being vegan. They can substitute a whole wheat bun but this time, I didn't ask whether they were vegan. It tasted fine, the toppings were generous and the veg burger was cooked well. The only thing that I would change next time is that I ask for the bun to be warmed or toasted. It was a barely room temperature and it detracted from my overall enjoyment of the burger.\n\nThe service was great. Our server was very attentive and friendly. She was very nice to my kids as well. Overall, a decent and fairly priced lunch. I would definitely return.","date":"2015-01-18 18:50:44"}
{"review_id":"Ns_P6qQy3blBIav6FCFfMQ","user_id":"1KJ_2hP6dDiCCOSUrx6i8Q","business_id":"HtctU6CwYrKN3r2SL259EA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Nice place.. Excellent decor and authentic food. Little disappointed with drink, specially Margarita. Good experience and surely visit again.","date":"2014-10-27 03:37:46"}
{"review_id":"mQUNenrwZ1Ghl27NnemkmA","user_id":"ftXAwWq5_3AMSzVviheQSQ","business_id":"e99T6GFJZKebgG3qO9i6Pw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"We didn't even know this was nearby until a waitress at Great Lakes Brewing Co. mentioned it casually. How cool! We walked from that restaurant and neighbors warned us it was \"quite a trek!\" But when I said, \"My map says 5 more minutes\" they agreed it was accurate. I guess 5 minutes is quite a trek in Ohio. \n\nBut really, the neighbors were quite friendly and only one got frustrated at slow drivers in front of the house. He screeched his tires and cursed, but I think that's rare behavior in the midwest. Perhaps he was from New York. \n\nThe house is great - you can walk up on the front porch and look in the back where Ralphie shot his eye out. Museum was really just a store. It's not a bad trek if you have some time to kill and want to walk through pretty neighborhoods and talk to friendly people.","date":"2015-07-03 20:54:17"}
{"review_id":"nssAo4hSKTHajnSMhUC7zw","user_id":"maLYELdq4Q7pfjA8P2_ckw","business_id":"ajWAVO3L3bFTpk3SVo9JcQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Did the bang for your buck deal I found on Groupon. Pricey but so worth it! We were in town for the weekend, and called ahead to make a reservation on a Sunday. Very friendly and hassle free process over the phone, and they even offered a ride to and from our hotel. The day of the reservation the driver was a little late, but they called to let us know, which was much appreciated. He only was 10 minutes behind due to traffic on the strip, which is understandable. When we arrived we only had to wait 20-30 minutes. The girl at the counter was super helpful and helped us decide which guns we wanted to try. Surprisingly, the sten ended up being my favorite for the day. Brandon walked us through the entire process, he was a great instructor, and very patient with us newbs. This is a bit embarrassing, but I somehow scratched my delicate hand while handling a gun, I'm usually a big baby, but Brandon was such a gentleman and even gave me a bandaid. Overall this is experience was amazing and to be honest I'd come regularly if I lived nearby. Definitely will come back when ever I'm in Vegas!","date":"2017-05-13 04:57:30"}
{"review_id":"10Snluraq9Ymb64_emEczQ","user_id":"jqRmnJQp3-s-9NWtS9IIEg","business_id":"Y2dcF2OUISPkCFMFUWT55g","stars":4.0,"useful":3,"funny":0,"cool":1,"text":"This place is great I bought a full set of appliances for nearly half the price I would've paid at Home Depot or Lowe's their customer service was great. Their delivery was great on time and no problems what they said is exactly what they did for me I recommend this place to anybody and everybody who needs appliances!!","date":"2015-04-15 14:22:27"}
{"review_id":"EIzWPiYZRAEamHYryT05aA","user_id":"kT81WNa7DlteWSuEruuI0g","business_id":"gc_GGat7TgNCmrgc4nVOgw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Had a 11 Person dinner there. Service was good, but Everything is over priced compared to quality. All the stakes and meet was over done (even when sent back to re do).","date":"2016-02-23 18:03:19"}
{"review_id":"kg-YKxz8_f5ikPMGU1RaAA","user_id":"hc08wDJV4cEhWuaQ7VEuwg","business_id":"y6dxJAGMbpVEkoYQszz27Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Moving is one of the most stressful things in life so if a company can make it a little easier they get an A in my book.  Rich was very helpful and patient. He gave great recommendations on which truck to rent and what the best deals were. He even compared to other companies which made me trust him more. This was one of the best moving experiences I've had.","date":"2018-08-04 20:20:02"}
{"review_id":"XCRmpw4z8eKLmi1z5wEE4A","user_id":"5sc03tSvJ10EhK-JGKhdZw","business_id":"7z2x16M7IuG8KPfMsyVrKA","stars":5.0,"useful":1,"funny":0,"cool":2,"text":"This is my favorite restaurant in Pittsburgh, if not anywhere. Every aspect is well thought out and perfectly executed. My husband and I have eaten here twice, both times have been amazing. We spent our honeymoon in Spain and visited San Sebastián, the home of Spanish pintxos. This restaurant always reminds me of that amazing trip. The food is well executed and delicious. The last time we went we stopped in on a whim expecting to either not get seated or maybe wait for a bar seat. The staff was so accommodating, they were able to fit us in the dinning room by chance. Service is superb. Highly recommend the pickled cauliflower, amazing dish.","date":"2017-05-13 13:30:44"}
{"review_id":"94ztL1Hy5bnD_XXVz1fb6A","user_id":"MGxxhpyVCqUI696GfH48iw","business_id":"Ok9vikKusbG_Ue9pJf6s3Q","stars":5.0,"useful":4,"funny":2,"cool":2,"text":"Had the Carnitas tacos. Very good quality - fast and friendly service. Delicious. Nice atmosphere. Oh yeah. \n\nAuthentic. 5 stars.","date":"2015-11-18 17:45:19"}
{"review_id":"6bZK8Ta9nWXYlGO0-n3J5w","user_id":"Q7h2OOHhwjP9JQrNNDAs3g","business_id":"AwlvIsKDqB5LeKNWC6k4kQ","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Saw the Kusama exhibit. Lots of dots. Long lines. Took 90 minutes and I was very satisfied at the end.","date":"2018-08-23 21:28:01"}
{"review_id":"-kaduqAoh_hFbtH7fTUCYw","user_id":"FLuZBFZVoh-lWhBd3S3i0w","business_id":"7z2x16M7IuG8KPfMsyVrKA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Service was lovely.  I live in NYC and have eaten Spanish style tapas there and in Spain for decades. I guess the novelty of tapas in PA carries this place? Food tasted good. Service was friendly. But even for tapas - the serving sizes on the larger plates was tiny. $52 for 6 or 7 ounces of chicken and a couple of cups of rice? We spent at least $30 a person on food and were still very hungry - at which point we decided to cut our losses and head elsewhere for dessert and a night cap.","date":"2018-09-03 03:27:35"}
