{"review_id":"rrZ_6c-HuEDnBMBVPETVYw","user_id":"3f7WGTPkj1a8cIWewDFUrg","business_id":"yNPh5SO-7wr8HPpVCDPbXQ","stars":4.0,"useful":1,"funny":2,"cool":1,"text":"This. Place. Is. Solid. We came here during the middle of the downtown lunch rush hour with a party of 13 and only had to wait 5 minutes for a table. Given the amount of people in our party, the waiters did an excellent job. The servers were polite, prompt and knowledgable of the menu. It is nice coming to place where your menu questions are answered without an eye roll and with confidence.\n\nWe started with the Pretzel Bun and Fried Shrimp with Jalapeño appetizers. These were amazing. The breading on the fried stuff was seasoned nicely and the Pretzel Buns coupled by the cheese sauce were simply irresistible.\n\nI ordered the Cubano sammich and of course it was delicious. The amount of smokiness in the pork was a punch to the mouth but in a good way. Normally I don't like going back to work in a borderline food-comatose state, but this place was too good to not channel my inner fatty.","date":"2016-01-04 03:18:30"}
{"review_id":"nXIh0bwgQ4P635G9ogaZMg","user_id":"C85t8w88IT7oeRMjRZkyxw","business_id":"aYyj9OdH059CoEXadmldXA","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"I thought this place would be super good & a new sushi spot to come to but I'm going to pass. Our server was great, very nice & attentive although we were the only customers for a whole hour. The ambience was a little \"weird\" arriving. No music just silence. I had shumai, nigiri, tempura,  fried noodles and oyster shooters. The food wasn't anything special I feel like it lacked taste. The side of fried noodles was just.... fried noodles, no veggies or meat in there. After having tempura I had to take benedryl on the ride home because I was having an allergic reaction to the shrimp which is caused by being undercooked. That was my first and last oyster shooter I'll just say that. I was really optimistic coming here but left with an allergic reaction. Sorry bonzai.","date":"2018-07-17 00:18:59"}
{"review_id":"Pl4V06VxZUrsOCciXelIKg","user_id":"pJKu8tDBk4IqILFCabvtGw","business_id":"m3XyLvnOVvt-jECDnEWuwA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great lunch..perfect wings and a Greek salad.   Service was perfect too.  A hidden gem. Tv's for everyone","date":"2014-09-09 18:38:59"}
{"review_id":"EWQheKuBEQ6b5hxOiMpwag","user_id":"fIl2vuddRLlfjf9ya_aUSQ","business_id":"_AVXgkX4DiNQAQj_3tNhFQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Really nice, casual bistro feel.  Quick and easy spot for a light lunch.  Food could be improved.\n\nThe shrimp and avocado appetizer could be improved upon - the shrimp was very fresh but it lacked flavor.\n\nThe grilled octopus was delicious - nicely charred and savory with the chickpeas and tomato sauce.\n\nThe pizza with mushrooms also could be improved upon - the crusty was undercooked and had none of that nice, smoky flavor it should have.\nThe mushroom pasta looked really good - lots of mixed mushrooms and very moist.","date":"2010-03-12 19:50:49"}
{"review_id":"35utTAE8SAPOGbQqROpYWQ","user_id":"ExJwXGoEilQTN5wKioYtuQ","business_id":"JUhADLjryOiS339GeFZThQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Another great exterminating service performed by Pam. In my opinion she is #1 in serving the Fountain Hills area. Always friendly, professional and reliable! We 100% endorse this service.","date":"2017-09-20 17:13:00"}
{"review_id":"FgXSF5w_OmaCJb27I1-5ow","user_id":"DuGuP8ox6GNWjSjJbUBlBA","business_id":"WUswpeAjbiww_xkSS8jTEA","stars":1.0,"useful":4,"funny":1,"cool":0,"text":"Extremely bad service:\nWARNING!!! Do NOT eat here!\nEven though the service and food here were both below average, the worst has nothing to do with their bad food\/service, but business ethics (the thing that keeps businesses from cheating their customers).\nThis restaurant, my dear reader, has violated the key principle of doing business - they are cheaters:\nThey put a couple of sales promotions on yelp to lure you in and spend money, but when it is time to pay, the servers stare at the yelp page i hold in my hand and have the guts to say: \"sorry, we can not honor that...\"\nNaturally, I asked: \"why not? You put it on your yelp page, so i think you should honor it.\"\nThis is the restaurant's response: \"sorry, but we haven't done that for a while now.\"\n\"Not for anybody?\"\n\"Yeah...not for anybody.\"\nWell, that was the end of it.\nEnd of conversation.\nEnd of trust.\n\nDo you want to help stop this cheating restaurant's dirty practices?\nIf yes, then please find your food elsewhere, in a better place, with way better ethics.\nThank you.","date":"2016-07-25 03:55:14"}
{"review_id":"4svXSoxRipWjUxKNkiGyvA","user_id":"ir7fsp088Gux3G1jrLT72w","business_id":"_nUQ_iT_JEdkMN7c-wqkBQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"ok. going to review this place again since I've tried it a few more times since my first time. \n\nwhat can I say? the food options around here are scarce and its either here or 4 other less than desirable eateries. \n\nfirst, do not get anything fried. that was what I had last time, spicy salmon, dynamite... and it was not good at all. \n\nhowever after going with rolls like simple tuna\/avocado and salmon, it's decent. for the price point. it's a good deal and 10 bucks can get you a good meal.","date":"2015-10-07 21:43:53"}
{"review_id":"pVdRwyI-8MoMuyqOMRHUIQ","user_id":"rR4FUUBTyHJICZN2XUDElw","business_id":"YTCCJ3ShO-zg0dlx1nk6dw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Not impressed.    Only giving 2 stars because the toro was amazing.  The waiters were a bit rude, they recommended California rolls, and they made us feel like we were peons and it was our birthday.  Not cool.    I don't recommend this place.","date":"2016-12-04 02:04:41"}
{"review_id":"_iNLR72OWXgKG45ihc9CKA","user_id":"3OXGfha1ryoWehAxU4ST1g","business_id":"3jjZftEYMzTLzlp8GKSKnQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Had my car window shield replaced while at work. Safelite was on-time, fast and super efficient. They call before the appointment, and review all the charges before beginning. I would use them again in a heartbeat.","date":"2016-09-06 01:02:04"}
{"review_id":"nZpeMG6aPu75hLCseFNdYw","user_id":"gScM-d4vXGBXMlc5XjwTlw","business_id":"BGGQOJQTQerEQu0kHbT_UQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Outstanding food for a decent price.  You can get a good bottle of wine for $30 to $40.  Try doing that at Maestro's.   Lots of compliments from other Yelpers on the cornbread, but it's a little too heavy for my taste.  My favorite dishes are:  artichoke heart as an appetizer is unreal.  Best ribs I've ever had and I lived in Texas for 6 years.  Great filet.  Great prime rib dip sandwich.","date":"2009-10-14 00:37:02"}
{"review_id":"Oo08EBgRY32koaTB2hgiiw","user_id":"_EVgROVKM9Oylu7OMCNsnA","business_id":"XYZBc8WCuHGgFHkOZ9QW9Q","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I feel the need to chime in here because I don't believe N.H. has fairly evaluated their experience here.  I have been going to the Goodyear Donor Center since about 2012.  It started as a Father\/son thing and I continued after my son went off to college.  \n\nNow, I have had successful donations and I have had unsuccessful donations.  At one point I had to take a 16 week break.  Things happen.  But reality is what it is.  Sometimes it just doesn't work out for one reason or another.  Back in the day if you had a failed attempt in one arm followed immediately by a failed stick in the other, they'd apologize and send you on your way with a bandage on both arms and no donation.  No need to be upset about it.  It happens.  It is simply fortunate that I can donate.  Many can't but I cant see getting upset about it.  For whatever reason it just wasn't time NH.  Whether it was something in the questionaire or who knows. \n\n I have yet, in all the time I have been going there ever felt unwelcomed or unwanted there.  Sorry you prepared so heavily and feel let down.  I can say the staff are all wonderful.  They are like a whole different family and the time spent in the chair is comfortable and safe!  I can honestly say I am defensive of them because I have spent many many hours in the chair.  Ms.Betty at the desk is definitely in her element!  Everyone there is upbeat and no one is ever grouchy!  Vinny is magic with a needle for those of you who worry about that.  \n\nGo in some time and check it out.   Get your questions answered and avoid possible hiccups down tbe road.  It is important to everyo e who is dependent on blood and blood products!","date":"2015-10-08 00:55:12"}
{"review_id":"OZqIHDADh8EJGp5XcGf01A","user_id":"IcFuq5YY_m6WxTpL5Uqolg","business_id":"FOqYmI24hSVP4EUibW-9zQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Thank you to the friendly staff and always beautiful nails, never a wait for me but I do go earlier in the day. The nice accommodations to the kids is a plus, hot coffee or the tea is another plus. Come here and you will leave looking fabulous. Thank you Melinda for the friendly service.","date":"2017-06-06 19:20:43"}
{"review_id":"ZMaaowJgxQ0vnJNOPZUcWw","user_id":"3HCP7V2hcRfCheqfbbABYA","business_id":"7EZ4Eu7YJ1ltRCC5jXFJrQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Food taste Ok. I like the pasta selection. However, there is No seafood choices at all. If you are looking for seafood, skip this place.","date":"2017-01-02 04:03:37"}
{"review_id":"6IqhJgmPUv9zG9XoHqt4oQ","user_id":"HGQnPQe7py4iPDU2eOJXPQ","business_id":"qFAw6wHMMcr4ctF-ZdGhEA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great food.  Get the meatballs.  They are the best I have ever had.  Pasta was perfectly cooked.  Clam sauce was light with excellent flavor.  Canoli was amazing.  Only reason it doesn't get five stars is the ambiance is lacking.","date":"2011-02-13 18:24:48"}
{"review_id":"oWKKCllfhXxjeVe99EWzFw","user_id":"7YOgt6KvY1-x0NiHITXt_Q","business_id":"Vu8Z-zbNT_InsKm4IrdeCg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Heard so much about this place I had to come and check it out. Very speedy service and the oreo chocolate milkshake has become an instant hit!! Great fresh taste to burgers and smash fries are good!!","date":"2017-06-17 17:41:22"}
{"review_id":"atp5dvG9ZKjRZwkwjPLzYw","user_id":"Y4AxlZ_Q6xK3H1sugPt0wA","business_id":"yNPh5SO-7wr8HPpVCDPbXQ","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"I was reasonably impressed with AB. We got there just before the lunch rush and scored a prime table near the windows (tho upon leaving, my friend noted how cozy the sofa-bench tables looked, so I'll aim for one of those next time). Our server, Robert, made even the soup of the day (tomato bisque) sound out of this world. Even after the restaurant filled up, he was attentive and made sure we enjoyed our meal. \n\nWe shared a handful of oysters with a mild jalapeño sauce. They could have been a bit briny-ier for my taste. And for entrees, we hit opposite ends of the taste spectrum: I had the pork carnitas, which was mild and sweet, with avocado, cole slaw, and a corn 'pancake,' with only a bit of red onion to balance it out. My friend had the jambalaya, which looked deliciously comforting, but she reported the chicken was dry and overcooked and the shrimp was underseasoned. The bite I tasted was too hot (spice-wise, not temp) for me. \n\nThe decor was comforting in a British pub style. I wish the menu had been more unique (burgers, BLT, variety of salads), esp for a place with the wird \"arrogant\" staring at you. \n\nI do plan on returning for dinner, to see what catches my eye.","date":"2014-01-17 00:40:39"}
{"review_id":"0iHo-dAlXU0ohsyqXXEPbg","user_id":"-2gOxVWcnBr5DclrrsWXCA","business_id":"x4gWo3XcAJtkOX-boqcV-A","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Excellent service. They usually have my peracriptions on hand.which is rare for.a pharmacy to have.","date":"2015-01-03 22:45:44"}
{"review_id":"PuRJz-bAZBWhAabDGxbC6g","user_id":"MI6B_KjrG1BOHSCC_dnoDQ","business_id":"YOD9dXrnpu8HTRILpF0onw","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"The breakfast menu is complete and the items are good. Lunch and dinner is over the top. All items from the sandwiches to the main entres are great. There is great care in creating these recipes and menu items. They make a new demiglaze every night. The Caprese Salad is great to share. The musels are served a couple diferent ways and both are great. The Pasta Giovani hits many different cravings. I usually have them provide the food for my birthday dinners. No matter how much food they cater, there never seem to be any left overs. Just as important as the food is the personal service. From the owners to the chefs to the servers, everyone here treats us like family. Lastly, if you like Bloody Marry's, they have a very complete Craft your own Bloody Marry Bar.","date":"2015-10-23 15:35:17"}
{"review_id":"Q2IjKdawSqWiPIKdFx1rZg","user_id":"2uZ8uULKN38ZiM-Iakr5TA","business_id":"oVAySgyWYzzmvJpTJ8PO5Q","stars":4.0,"useful":3,"funny":1,"cool":4,"text":"Tempe Farmer's Market is rad.  Their selection has grown immensely since today and when it had first opened.  It's not a one-stop, get all your groceries for the week kind of place, but it works marvelously as a neighborhood market with a few necessities and a great variety of delicious fruits, vegetables, olives, pasta and frozen meat.\n\nGoddamn am I glad this place opened.  Prior to this, my closest convenient neighborhood market was Rollin's Market with its rotting bell peppers and frozen Banquet dinners.  There's always Fry's or Safeway, but I like hitting up a small little market on the corner of my neighborhood and build a rapport with the employees and owners as part of establishing a community.\n\nThe dude who runs the place will sometimes thrown in a tomato or apple or lime in with your bag of groceries.  Hey, free apple.  \n\nNot everything they have is permanent.  Sometimes something new will be there, and the next week it will be gone, but in a way, I like that about it.  You go in there, and they have these Indian pickles made from wild cucumbers.  Next week, in its place, will be garlic pickles or something else awesome.\n\nFor what the place is, it's marvelous.  It's a little place and about as un-ghetto as it gets.  It's nice having a little market where you can pop in and buy polish sausage from a local farmer, organic soup, goat cheese with kalamata olives but you can also get your regular ass Skippy peanut butter and Campbell's soup.","date":"2010-01-08 18:58:51"}
{"review_id":"v-FhkSvirQVLmPMpgcdcNA","user_id":"SS3sFA9ksCT9bjocM3Wbug","business_id":"ID5wWJ9C7G0hfbQilvlfxA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I've been here several times over the last 3 years and the food is just okay! Nothing spectacular and highly over priced! I can get a better meal at  Taco Bell and for way cheaper! The service is good but other than that go somewhere else Downtown! Don't waste your money here!","date":"2017-04-07 22:23:58"}
{"review_id":"0Qr8VLXex3MniXYn_b3IRQ","user_id":"6W5ac-swF_hbdsX-z8PqJQ","business_id":"RRpHuoXpxcuLk4LdB_YrOg","stars":4.0,"useful":1,"funny":1,"cool":1,"text":"Awesome she let me have a free pair of sunglasses,  Lol","date":"2013-04-10 18:08:55"}
{"review_id":"2c_NhOWrfRrYB7UpxiyOng","user_id":"WTTlaXK_2g17grShzdsczw","business_id":"r-W1HPIZ3V6S2DaXhs9EbQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Dr Allen was simply amazing. First, I doubted how good they would be because the receptionist was not that friendly, nor he seemed to even be kind. But dr. Allen was quick, friendly, helpful! I am waiting for my contacts, hopefully they fit me well :) if they do I'll keep coming back to him.","date":"2016-09-30 22:17:22"}
{"review_id":"qJWgxFH9O57mumbGTFoXfQ","user_id":"Fioehz-oYWFo9dqX1IekWw","business_id":"yfMYY2s-qqAqQFMjK6_Ytg","stars":5.0,"useful":3,"funny":0,"cool":0,"text":"Divine threading is the only place to go to in Las Vegas for your threading needs! Noor is always does an excellent job and the other ladies as well. A definite customer for life right here.","date":"2015-10-23 18:07:54"}
{"review_id":"LaK3nCJaH-f6rMf7DCjU8A","user_id":"qQum_x8FBHKsFm8rJhuICg","business_id":"4JguZ4BzTQaGHm6Aed4SNg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Came in today with my family of three growing boys. Another awesome experience. Clean lobby bathroom and playground as well. The food was tasty as always. They even gave us table service with a smile... Ie refilled our drinks and cleaned off our table. Eat Mo Chicken!","date":"2015-03-19 00:26:57"}
{"review_id":"bKfoEaIWc5_NIV6MLMYRzg","user_id":"XF3ho4jKNzFy9PInhRbBWg","business_id":"C-cvl8Mf2vpxHwUon3sVGg","stars":5.0,"useful":1,"funny":0,"cool":3,"text":"How have I never reviewed Caramba's?!?!? I've been eating at this place for at least the past 13 years. It's a family favorite and you might say it's been a little bit more than a staple of my diet for nearly as long.\n\nMy two most favorite meals from Caramba's are the bean and cheese burrito (fresh tortillas and the perfect mix of cheese to beans) and the chicken quesadilla. Oh, how I miss my chicken quesadillas since I went vegetarian. Delicious grilled chicken, cheese, tomatoes, onions, jalapenos, sour cream, and then add some of their amazing mild salsa, and you'll seriously be in heaven.  My dad is a huge fan of their machaca burrito, and he's pretty picky when it comes to machaca. So I'd have to trust him and believe that it's pretty darn good.\n\nThey also have a decent beer selection (Mexican beer of course), with margaritas available too. Free bowl of warm chips and freshly made salsa with every meal, lunch or dinner for under $10 and at least two locations (Bell Rd. and Glendale Rd.).","date":"2010-03-12 23:19:45"}
{"review_id":"be4QW8H7K5QrWwS9Bvj5cQ","user_id":"96t9mDuBpfdYSbJ31dpakA","business_id":"C6C_dc78Zhzei9wrZs-tdQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"As soon as we came inside the room, found our first roach.... and there's nothing they can do about it. Never staying here again. SO BE CAREFUL WHEN YOU STAY HERE.","date":"2017-07-28 18:31:41"}
{"review_id":"5_EOd1BSzONi6TmEi_VoxA","user_id":"QuBSBx00-WTomonbXgaqmw","business_id":"LJSEmHKt4GH8UlXvaUnBNw","stars":1.0,"useful":6,"funny":0,"cool":0,"text":"2 words: RIP OFF\nI made the mistake of booking an appointment AND paying up front for a package before reading any of the reviews. The girl who sold me the package asked me what areas i would like lasered and i told her exactly what i wanted to be done (i have done numerous laser treatments in the past) so she told me that this package would be perfect for me. Later when i go in for my appointment they tell me that i have to pay extra for this body part and that body part! Not only did they sell me the wrong package but they refuse to refund me my money and want me to pay more that i initially anticipated. They never sent me a reciept (as the purchase was made over the phone) and the laser technician literally spent 10 minutes with me for full legs and bikini and face! They are in the business to scam individuals who are new to laser treatment and have no idea what to expect. All i can say is STAY AWAY","date":"2017-11-20 18:33:12"}
{"review_id":"E2ZujnfG-jn7e-IWAOBDpQ","user_id":"PwFqk6C35K_ZJOdzu4gUUw","business_id":"xmAakatNKpvIJ-Fmq5swCw","stars":1.0,"useful":2,"funny":1,"cool":0,"text":"Initial experience left a HORRID TASTE IN MY MOUTH and I never even tried the food!!!!!\n\nJust had an -interesting- conversation with the girl who answers the phone, Amanda. \nWOW.\nAfter being asking what I was calling for (catering an event, duh!) I told her what I needed, I was put on hold, phone was answered again by Amanda who acted like she hadn't just talked to me 6 seconds before and asked the same question again. \n\nHer absolutely lack of professionalism quickly wore down my patience. I felt like I was dealing with a 15 year old!!\n\nIn the middle of asking me what our date was for our wedding, venue, etc., she blurts out \"Oh, you know there is a 5k minimum for December. You know that, right?\" \nI was baffled by the way she said this, as well as there was no surrounding explanation or context... When I asked \"Why?\" She laughed at me and then said \"Well, thats just our policy.\" Okay, that's fine. There are much, MUCH better ways of presenting this to a prospective client. Also, you probably shouldn't say it to someone when you don't know what their budget is or how much they are willing to pay. Moreover, the condescending, rude tone in which you say things like that have a lasting effect. \n\nThey don't know that they are on the preferred vendor's list at my venue, they don't know specific rules or things that the venue already provides and this girl seems to have no grasp of how to get details from someone without asking the most idiotic questions. If someone keeps saying \"We just require a plated dinner, no other services from you.\" You don't need to keep asking things like \"what about cake, what about a bartender, what about hors D'oeuvres?\" \"NO! Just a plated dinner.\" \n\nTotal incompetence, lack of professionalism, rude, and absolutely not a business who I would recommend working with after this brief and exhausting exchange. \n\nI wanted to book a simple consultation to try to talk to a coherent adult about food, do a tasting, and then sign a contract --TO GIVE YOU MONEY--! \n\nTo the owner of this business: \n(Before I completely wrote you off as my potential caterer) I requested that when I got my call back, I would like to deal directly with the owner, Jennifer. \nAmanda rudely asked \"Why?!?\" I told her that I would like to deal with someone who knows the venue that I am booked at, (considering you are a preferred vendor there). \nI would strongly suggest getting someone else who knows how to deal with customers, has a better \"table-side manner\", and knowledge of halfway decent customer service. \nI have had much more pleasant experiences with call center employees.","date":"2014-02-05 19:28:08"}
{"review_id":"FL62KUvQIiVPfGozqiVEdQ","user_id":"ArAyrioD75AC01DF-Jo1DQ","business_id":"d_q4avZYM1sOlQP7noJKVg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"After hearing about people rave about this place I decided to try it out for myself he other day. Went online and saw the menu, saw the \"famous Sonoran dogs\" and immediately wanted that to try. Saw that they had an option to order and pay online to avoid the line and pick up quickly. Heck yeah I'll take it! Ordering through a phone call or going in would be better. Put my order and a couple co workers order in online and paid. 25 bucks gone. Another co worker left to get the food and went to the counter to pick up order. Luckily he made it just as it started filling up with people. The employee at the counter didn't have any idea what he was talking about when he said he was there for an online order pickup. Luckily I printed out my \"invoice\" as they call it and sent it with him. Had it not been for him having that paper they wouldn't have taken the order. I get it, sometimes technology doesn't work right and you get missed. They realized and said sorry and made the order quickly. Now for the food.. we were all excited to try this place as it was new for us all. Every single item we ordered was made incorrectly. Whether it was missing an item that was checked off on the invoice and paid for or just the wrong ingredient. There was absolutely no flavor in any of the food. It was literally bland from the tacos, to the burritos, even the \"salsa\" was bad. If you don't have taste buds then this place might be good for you. I on the other hand don't wanna do it again.","date":"2018-08-04 20:32:30"}
{"review_id":"Mp7qXWexqoSqKbNh7dYhJg","user_id":"jAYIkCIqhDgQcp7PG8z_vA","business_id":"J9f-9Prw2YVM-fiZqv2fmQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Fries are cooked to perfection....very crispy.  Portions are out of this world.  Don't waste your time on a small or medium, you'll regret not having more. \n\nHot Dogs & Burgers were very good.\n\nSecure Parking is available around the corner at S Bouquet St & Sennott St for a few bucks.","date":"2015-05-26 07:45:02"}
