{"review_id":"asLnux3k2yqoVjcJcLuF0g","user_id":"Cz8l7JQ2I_RhtK0BosH-7Q","business_id":"Ah4i15g8Ow_zphzcpulTxQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"The bread company is perfect for lunch. The prices are reasonable, the atmosphere is great, and the food is delicious. I haven't tried it for dinner but I heard good things. Definitely go!","date":"2015-12-05 05:38:55"}
{"review_id":"N-47CYWYryHK3T08dknlNQ","user_id":"oRZQgGKZBG5V5ePmQkngww","business_id":"TFdLM8R_7Pf1xVeBNKl0hg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Pittsburgh has many excellent restaurants, and Sunday brunch at Casbah is well worth adding to your culinary \"bucket list\". Everyone in our party of four chose the prix fixe brunch at $28, which included a brunch cocktail, an appetizer and a main course. Preparation and creativity was wonderful, which meant that standard brunch choices such as a smoked salmon appetizer or a tomato and basil bisque were standouts. The same can be said of entrees, such as the Casbah Benedict, the braised lamb and eggs, or the other egg dishes tried by our group. Service was professional and the experience was special.","date":"2017-03-15 13:43:13"}
{"review_id":"8bTpgBiYAmuveHF_avX0SA","user_id":"8vIK6ndl8yzIdmSDnGp0tw","business_id":"nQjuBVbcRFyX3trnuf_8CQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Notes: 1 visit, late lunch.\nOverall: Food had some good points, but I wasn't overwhelmed.  West Covina, CA location is better if you're in the area.\n\nHainan chicken - chicken was soft, but they left out the best part - the chicken juice.  I love it when they pour that stuff all over the rice.  (I say juice so it sounds healthier than say, 'oily chicken essence.'  Also, if you want really good Hainan chicken rice and you happen to be in Alhambra, CA, go here: http:\/\/www.yelp.com\/biz\/savoy-kitchen-alhambra#hrid:8nuOzJJQDsKa9NK-WhJsbQ\/src:search\/query:hainan%20chicken)  \n\nSome sort of egg tofu - pretty good, but really heavy.  Don't order it unless you're hungry or you really know how to scarf protein.  \n\nRoti canai - Must try for Malaysian cuisine it seems.  Crepe\/pancake style bread that you dip in curry.  The curry was good, don't remember what kind it was.  I don't think it was served hot enough, though.  It got cold too quickly.  My mom said the bread wasn't as good as their location West Covina.  \n\nChicken satay - Really light appetizer.   They give you really small, thin strips of chicken.  Don't expect this to be in any way filling (unless you decide to pour the peanut sauce all over your rice, and you just might be because that sauce is so sweet and delicious.  Almost sweet enough to be a dessert.)","date":"2010-01-08 03:17:23"}
{"review_id":"QYAKBNwQl9djyEgyxYh6qQ","user_id":"I8e6hjygm_ukkqxtM5RcAw","business_id":"qZfsxM4Wndt9N4OHT3I47A","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Well, I've been to lots of Ardene locations but this one is my least favorite. Still cheap, but not as cheap as locations further north and I found the store to be small and cramped. They still have some really neat stuff and the staff was friendly , but it's the first time I've walked out of an Ardene's empty handed. Sorry, this location just isn't for me.","date":"2012-10-08 14:02:13"}
{"review_id":"wpZjxMGpJxEjaYcxsP8oZg","user_id":"SlgpAnj2gQd44EM_Uq6DkQ","business_id":"UByM7N0mF-ylIGUuIWHCtA","stars":3.0,"useful":3,"funny":1,"cool":2,"text":"I really want to give Sullivan's 4 stars but in comparing this experience to a recent visit to Longhorn, I just can't bring myself to do it.\n\nWent here with a group from work for an \"appreciation dinner\"  Normally, Appreciation dinners end up at Chili's or Ruby Tuesday so I was completely shocked we ended up here.\n\nEverything was great service wise.  Foodwise, it was good but I'd expect that from a place like this.  I ordered one of their Mixup lunches which gives you a salad option, a protein and a side.  I ordered the mixed green salad, the porcini mushroom and pepper encrusted strip and an order of carmelized cauliflower as a side.\n\nThe strip was amazing.  It came sliced over a layer of steak sauce.  It was cooked perfectly.  The salad was ok....mixed greens with tomatoes, blue cheese and a dressing that I still do not recognize.  The cauliflower came in a mound.  Honestly, this had to be 1\/2 to 2\/3 of the head of cauliflower.  It was seasoned with capers and other herbs.  While the taste was good, the quantity was entirely too much and I could only eat half.\n\nThe decor of the place is as you would expect with a lot of medium to dark wood but it just didn't do anything for me.  Same with the service. While they were all friendly, our water just didn't go beyond what he was expect to do.   \n\nSorry, Sullivans but I can get better service at Longhorn and frankly I think their food is better also.   But still this is a solid or 3 1\/2 star review.","date":"2013-11-14 05:56:23"}
{"review_id":"EltgtpG5E_6PbGPLQZQVlQ","user_id":"5MJQVYbQuQO3t6sCMvSjXQ","business_id":"04__PnXBxnEhgyMv_jYddg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I been going to AAA for about 3 years now...I have an older Yukon and everyone at AAA including Mike have alway been extremely helpful and professional. Honest, trustworthy and great mechanics are great a few words which help describe AAA on 40th St and Greenway.  I would highly recommend them to anyone!","date":"2014-04-19 15:12:49"}
