{"review_id":"4wRwZSvF0HAbj80eUoTG9w","user_id":"2IEfINYRpdETW_KQQjtGfw","business_id":"ZGXd87vme_dDVYqr-HpRQQ","stars":5.0,"useful":7,"funny":2,"cool":1,"text":"My favorite new pho! In town. My family eats like crazy and I went to them to this place 30 minutes before it closed:\/ I hate doing that but that's how my mom rolls. Anyways everything was so fresh. Pho 1 and Kim long have more reviews but this was better and a lot more fresh. Service was great! They packed all our food and were very kind. Oxtail soup and peanut sauce soup were my favorite! It's a plus it's close to my house and the pho is the best!!","date":"2013-03-18 18:28:38"}
