{"review_id":"4tnm5lM3eppc-cL3nOyPRw","user_id":"I4bdIW3wlZiFsIbTSRPiHw","business_id":"SMNZS7w9Blmc8TOUZ4oqYg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Great food and very personable service. It's a chipotle-sequel take on Indian food. My wife and I both had excellent meals. There was a good amount of people for later on a Friday night and the staff was very friendly and attentive. Glad to have another good food option in Strongsville.","date":"2015-10-17 00:32:43"}
{"review_id":"FI4ZwWvuT5DBr41nwV8Xtg","user_id":"OfpwOsEmKMQ-R4AKD7gDxw","business_id":"tZEW8ESjrVmNGXvPnrR97w","stars":5.0,"useful":2,"funny":1,"cool":1,"text":"I really enjoyed this place. I'd give the decor 4.5 stars and the service and food 5 stars. Our waiter was super nice and he seemed to really love his job. My family got 1 lb of shrimp \"hot feel\" and mild. The sauce is good! The shrimp are big too. We also got 2 free pounds of combination seafood because of a newspaper special they have. The lamb skewers were bombbb! The location is kind of tucked into the plaza across Tea Station.","date":"2014-04-01 02:06:33"}
{"review_id":"svCh-qRblLIdgoDETvTRBw","user_id":"78e0Yf-Lhl9E7Su-OMjEJA","business_id":"hihud--QRriCYZw1zZvW4g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Got the meat lovers for 4 people which was more than enough to feed the 5 of us. Food was great. Especially the marinated meats. Service was on point as well. My only complaint is that I wish they didn't server such small portions of side dishes at a time for a table of 5, which made it annoying constantly having to ask for more.","date":"2017-01-02 08:53:16"}
{"review_id":"OQ48kD9XzF2xEGUufgKxow","user_id":"xCokEpVNJDysHCXSEFvKvA","business_id":"QITVudxg4pCScJnEUw46xg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We had a great experience leasing a new Equinox at Henderson, Chevrolet. Joe Gallagher spoke to my husband after we made an internet inquiry. They came to terms on the phone, and Mr. Gallagher was true to his word. We went there, secured the lease, and drove away in our new car in just over an hour. That set a new record in efficiency, at a car dealership, for us. We appreciated Mr. Gallagher's attention to detail and making the transaction process a pleasant experience.","date":"2018-01-21 05:10:42"}
{"review_id":"nPLGGhp4vE5o1TpQXmZuSg","user_id":"p1X0gdU1ceWnHlDNAWrkDg","business_id":"Gdv3qhsDeQzZ2Ag-Tzq6vA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"best New York pizza in Summerlin and p.o pasta dishes look yummy too!  very friendly staff! please come to LA!","date":"2018-05-28 22:42:44"}
{"review_id":"O9kninOPpLT9Zkd1Mq8d4Q","user_id":"Q1iDQmp576GFmaGAYJ760g","business_id":"UFVy-8WC7pDzvBUzOvdwzA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Loved this place. Food was delicious, although the menu selection was sorta slim. The combo meals are good though because you'll always find something you can eat. Delicious margaritas were on special for Cinco de Mayo, wait staff was very friendly and the free birthday dessert was a treat as well. Would definitely go back!","date":"2013-05-07 13:41:05"}
{"review_id":"LSPBfreF-ma3GbqEunb9iA","user_id":"xEKAb9TGx4aOGbHXSaCmDQ","business_id":"K74HYkFjYwhEpJt8HTOxnQ","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"We had an incredible time. The food and atmosphere was so good. Linda, our waitress, was the best. Thank you Linda!","date":"2018-04-15 15:46:14"}
{"review_id":"la3lOiyCI3g1VS7wbz6hRQ","user_id":"6oEZYS26p2CgFKIOSTn4OA","business_id":"ypXftd9bRXqFVHyud9UbjQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Jack was the seller's agent I met while looking at a house, I called him on a Sunday evening to take a look at a house and he answered my call and was very responsive. After meeting him in person and seeing how knowledgable he was I had him assist me will buying and selling my house. I feel like I made a great choice to employ him since he was very passioniate about his work, responsive, and knowledgable. I probably called him 40 or 50 times over the time that we worked together and the longest I had to wait to get a response back was maybe 5 minutes, it was amazing.","date":"2017-09-20 17:35:15"}
{"review_id":"2VXfB7-yJM7bF9rBK28oqg","user_id":"zw--A1hdbdLuAf3Lu3oJWQ","business_id":"QTT_kax-2H0Am7_6fSgxwQ","stars":1.0,"useful":4,"funny":0,"cool":0,"text":"The village is one of the worst places to live near the UIUC Campus. Their staff is very unprofessional and they have no empathy toward any of their tenants. They provide late notice about everything while expecting you to pay on time. I have never seen such horrible customer services and treatment toward tenants. DO NOT LIVE HERE. Don't get sucked in by the low promotional fees. They don't last and at the end of the day the head ache isn't worth it.","date":"2017-06-27 23:03:26"}
{"review_id":"-T40W1TjG-hpbFQPE3exeQ","user_id":"bFh4EO-u9U8uhMyxATvEjQ","business_id":"3VHJGvjHeEki7Hiyt-Hv5g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Honestly a little too sweet for my liking but I should have expected that getting the triple threat beaver tail, since it was covered in Nutella, If I go back I think I may opt for a different flavor, but regardless it was good, service was quick, good location ....if you love sweet you will love this place","date":"2017-10-11 04:02:35"}
{"review_id":"Bl0ro6Sv5sL8VusH3ND6ig","user_id":"MbKhZ5jip0OVZ_4Lx3S0lg","business_id":"XBIgiDL_sXYOroaX4ULaUw","stars":1.0,"useful":2,"funny":0,"cool":1,"text":"BEWARE: There is a guy who works here, tall, glasses and painfully forgetful. I've gone here a total of three times in the past month for a quick fix with my siblings and he's gotten our order wrong each of those times. He must be new, but he does seem genuinely sorry after he adds or subtracts something from our order.\n\nRegardless, he's not why I give this McDonalds 1 star.\n\nThis place is usually jam packed with teens by 1pm during the school year and during the summer, just can't catch a break. \n\nLocation is usually messy and has THE LOUDEST DOOR EVER! \n\nService is mediocre to the max, then again, this is McDonalds, no 5 star review here.","date":"2012-07-16 09:31:37"}
{"review_id":"F_HjUerUu0JGX8APNH1D4Q","user_id":"WdD8hWn-NjSyDYoHqin_tQ","business_id":"FAEO3WHP25djJsPDMwsk7w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I've been to the Fashion Show and Town Square locations, but I'll just review my most recent experience at this location, which I like just as much as the others. \nI set an appointment online with no problem. Arrived about 15-20 minutes early, but I was greeted right away and asked to check in with another representative. Cool beans. \nNoticed they were slightly behind, but I'm not in a rush, plus going in I had expectations of them being busy. It's Apple. \nGah... I wish I could remember my tech's name 'cause she was just as nice and courteous - just remember it starting with a D. She let me fully explain my iPhone problem, then she walked me through diagnosing with their speakers. She literally could tell that the difference I had with it compared to hers. Before trying to replace my phone, she wanted to know if I had any questions for her and I brought up how I bought the device from my cell provider. Not wanting to cause any problems with them, she wrote me a notice to bring to them just in case they wanted proof that the device needed to be replaced. All courteous and thoughtful. \nOther than my experience, I can commend them on trying to accommodate\/help a mom and her 2 kids. The little brother overheard the patron say she had the wrong appointment time, but she had been waiting for awhile and had other appointments elsewhere. Before they could get to me, they helped her out first. Her tech was nice, trying to be personable with her and the kids while diagnosing the problem. Took him about 10-15 minutes to help her out, hopeful that she'd make it to their other engagements on time, and thankful for her patience.","date":"2015-12-20 19:38:27"}
{"review_id":"m2gchjEFaOPZSoT6oI2gGw","user_id":"rdysF0ymVkMX82Bu_8x3nA","business_id":"vpEiM4UuUtbLVibXAHPq3g","stars":5.0,"useful":2,"funny":6,"cool":0,"text":"This town needs an enema!!\n\nWell, here it is ya jerk!!\nArtistic Armory combines everything you like about an underground music club with elements of an actual, organic independent art scene. It is the opposite of First Friday, a refreshing alternative to seeing bands in filthy bars, and the antithesis of hanging out at the mall.\n\nI used the bathroom... once...\n\nThe bar tenders are great!! There's a tall dude with strong hands and a pretty girl who likes to talk about different ways to cook chicken (women love chicken).\n\nCheck out their Facebook page for a listing of upcoming events.\nThe website is maintained by some dude named Gus (I guess he is an employee and\/or web designer), and contains about as much useful information as one of those hooker trading cards you get on the strip. \n\nThe Artistic Armory a roof, which is great and really compliments the floor, which I once cleaned up baby carrots off of. \n\nMy only complaint is that some drunk with tattoos and a beard kept banging into me and spilling my drink. I attempted to complain to management, but a tattooed guy with a beard said that my vague description was not going to help him narrow down the assailant. \n\nOverall, your experience will be based on what you make of your time at The Artistic Armory. Just don't talk to anyone in a black t-shit with a band name printed on it and you should be fine. \n\nMention this Yelp! post for free admission to the next show!!","date":"2014-07-28 06:17:11"}
{"review_id":"rbewsDf1t_kp_aybeP3sqg","user_id":"_pxG5OeVgakgJC0gimV8zQ","business_id":"McoGYpK3JgrX377D7Crs6Q","stars":3.0,"useful":0,"funny":0,"cool":1,"text":"I stayed at the Radisson across the street during superbowl weekend. This bar provided entertainment while it was raining.  They have Golden tee 2015 at an expensive price of $4 p\/p for 18 holes.  The food looked good and many people came to play pool often at the 30+ tables.  The dart boards (7+) looked digital and something i wouldnt enjoy as i prefer traditional darts. The beer was priced well and there are specials each day.  Although i thought the bartender could be \"quicker\".. the beer came out ice cold.\n\nThere was a fight at night which emptied the place and brought the phx police but it was something two idiots started.","date":"2015-02-02 20:14:06"}
{"review_id":"agy8JritjVoZg9uyiqSW0Q","user_id":"jSbUkorPvVNztP-uPlNaYg","business_id":"ac3laXcJnclYZAO65XAcmA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Breakfast was so so. One thing I noticed was while there for over 2 1\/2 hours (catching up on old times while with family) was that the men's room needed some attention. Trash cans were overfilled with paper towels on the floor. The staff was ok.","date":"2018-05-29 00:59:35"}
{"review_id":"UpiRkl0TnCY4Ays07y5KBQ","user_id":"fEt1yBaJ3oQp-JOy6ku_rw","business_id":"ZCzey5aPhd7jYIoHsUfjmQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"One of my favorite places in Phoenix. I like how their menu changes slightly over time, so there's something new to try. Everything I've tried is good so far, and I've almost tried everything on the menu. I don't like the pig face dumpling as much, actually prefer the other dumplings. I love the stream buns, especially the chicken waffle and the pork belly steam buns. Their ramen and seafood hot pot is excellent, but wasn't impressed by their duck dishes.","date":"2015-06-21 05:35:20"}
{"review_id":"JrrTV0W0I1ghblJYSTZYTw","user_id":"SbpEMWghc9wXo-iv2ESXsg","business_id":"XhUec_6-kgPy1_ZYUrzvPQ","stars":1.0,"useful":2,"funny":1,"cool":0,"text":"This review is not for the food or dining, it's only for the reservation & host\/management experience.  In short, making a reservation means nothing!  I reserved a table for 4 on Saturday night at 7:15pm to welcome my colleagues to a nice meal while staying at the M Resort & Casino.  It was crowded when we arrived, and the host snapped at us saying it would be another 30 minutes for our reservation. I asked if we could go to the bar while we wait, and she said there was no room there either.  So we went to a Casino bar & came back 30 minutes later, and the manager told us it'd be at least another 30 minutes.  They weren't at all polite, they acted like we were being a pain for coming back. SERIOUSLY?!  So I asked them to take my number down & call me when the table was ready, and she begrudgingly did.  Well, they NEVER called me to say our table was ready.... good thing we snagged one at the Burger & Brews place next door.\n\n\nClearly, Anthony's doesn't know how to manage their reservations.... obviously an OpenTable reservation doesn't guarantee you a table.  We were super let down because the menu looks great, but I can't comment on that.","date":"2018-02-23 22:03:16"}
{"review_id":"-XlH5PW5LrM8aI-xm7zoiw","user_id":"puK1NJiFCCy4Bj_e6SCr1Q","business_id":"u-SvRRAfYgpbXZRfQgcTzA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We came here at a recommendation of a friend, upon walking in, it is quit the full house for dinner on a Saturday night, so we were seated at the bar. There is not a formal coat check (it's self-hang), and you can put your coat in the front. \n\nFOOD: We got the takoyaki, karaage, chicken skin, unagi rice soup, and green tea cream cheese cake. Imadake definitely has fast service once the ball gets rolling as they have to meet the demand of so many people getting sake bombs and what not. I settled with a Tokyotini, which was very strong. Thanks for not holding back! The food overall was on par. Hot and straight from the kitchen. I think my favorite was the chicken skin and karaage. Well seasoned and warm, so nothing to complain about. The cake was more cream cheese than green tea though. \n\nSERVICE: A bit slow at first, but it did pick up. There were several birthdays going on at Imadake, so that would slow down service a bit. Overall courteous and efficient! \n\nRecommendation: Make a reservation, if you do not want to sit at the bar!","date":"2015-11-18 18:27:58"}
{"review_id":"n8fxbbpCW0VBT4BxnYnVYQ","user_id":"NPCD3cyPlyz1T2AcG7ep9Q","business_id":"Ph7iO3to0eyvZKqQ1kJ4PA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Went here for a concert in their basement venue. Very cool space. Intimate, cozy, nice ambiance. They seem to have a real handle on crowd management. The event was sold out, but still comfortable - they clearly take care to not oversell the space. You get the vibe of being in a friend's basement, except there's wine and better decor.\n\nThe wine itself - I'm not a connoisseur by any stretch. I thought it was good, but not exceptional. Cheapest bottle is a $21 white blend.  They had a total of 4-5 varieties that night, with varying prices. \n\nOverall, it's a cool place to see a show. Might  go back for a tasting sometime to get a better handle on their wines, but they did seem slightly overpriced to me.","date":"2014-02-23 23:22:29"}
{"review_id":"SkCsX9eyj-r4Hdw86dBOgQ","user_id":"qWTeFVdxXS-H5l41XA_Lxw","business_id":"dpJbQLWxCgbNd9sboaed1w","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"THE UP-SIDE: Mojo's is wonderful, a call back to the days when coffee shops served great coffee and food, and didn't make you feel like a number. \n\nThis place feels like home. You can hang out and work at the many tables. Never that difficult to find a spot, although they are always busy - and for good reason. The coffee drinks are perfectly created and there is a great selection of breakfast and lunch choices, along with fresh bakery. \n\nThe service is warm and pleasant from all of the staff. They always greet you with a smile and make you feel good about coming back. Kayla has been especially helpful for any little issues I had like getting a new extension cord with multiple outlets for folks in one small area. Much appreciated!\n\nTHE DOWN-SIDE: No down side. \n\nTHE SUM-IT-UP: I love it here. You will too.","date":"2018-03-20 15:48:38"}
{"review_id":"RnkFS-UhdLt9wsOGM0v43Q","user_id":"LmWO_u9v7e1vMJlNykjUoA","business_id":"sjJOsKnXxsQodXMr1i8fsg","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"You can find everything in this mall but it's always so packed with people it tires me out. They need more and bigger\/cleaner washrooms here.","date":"2011-08-25 02:03:37"}
{"review_id":"FNGNTLBnqCYHDOz_PrFqWQ","user_id":"Fmii2bqJVaR6-eANCDFbpQ","business_id":"mFU9j43H8E5DhBEMPjElsA","stars":5.0,"useful":7,"funny":0,"cool":0,"text":"Great service terrific quality. I was able to set up my appointments for the days that I wanted. Cheapest rates I found in town. 16 windows of various sizes plus a sliding glass door for well under $1000. I would recommend CC Sunscreens to anyone.","date":"2014-10-11 03:47:42"}
{"review_id":"w8Mk5XRhuwlis_rPLCZwKw","user_id":"f7huVSEbAfAmxLQy-JiV7Q","business_id":"iyFS4twFjCKfaKl7kUl3sg","stars":4.0,"useful":2,"funny":0,"cool":2,"text":"Great restaurant for a date night or to get a different ambiance than the usual PSH here in Ayrsley. Service here has always been fantastic. They always recommend great apps to start and they always have daily drink specials! \n\nThis is actually a bit more upscale than you think. I would put this more on the higher end of the double dollar sign. $$. I think it's worth it if you are craving a good steak. \n\nI haven't been able to pull away from any other appetizer other than the hummus & pimento cheese dip dip. The hummus is really good! \nAnother great go-to if you are here to drink and munch are the flatbreads. They are actually more like little pizzas, not flat at all and very good! Very filling because they are doughy. Finally, when I am craving a great burger, this is my go-to. Trust me on this one.","date":"2017-04-30 03:38:07"}
{"review_id":"ga2d8qwGVC3r2YbrVGXnig","user_id":"sDiiBvtwbwzTqEozByzaAQ","business_id":"bb3JRKOEWwoDUmN0l90XaQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Ils ont toujours des prix imbattables sur les fruits et légumes, et souvent lorsque j'ai besoin de fromage cottage ou de yogourt grec je peux en retrouver à rabais dans leur frigo. Oui, la date d'expiration est pour la semaine suivante, mais au rythme ou je les inhale ils ne survivent jamais jusque là. En plus, ils ont commencé à vendre des fruits et légumes bios, tout pour faire mon bonheur!","date":"2013-06-24 06:44:00"}
{"review_id":"U7tl-Z3xBrbonBdMzLOYnw","user_id":"bMEy9AlpMIVHnnM1sm0ZkA","business_id":"L16ly2UGc9j4qO3Id8Gx3A","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"The atmosphere is great here every time! The servers always have a smile and start great conversation. This time I ordered to go. I always get the crispy spicy eggplant. This is the first time for a vegan Sushi! Presentation is beautiful! Easily one of the best vegan restaurants in town!","date":"2018-09-14 03:01:06"}
{"review_id":"-AyRSq5g_qLr2ZdE_eRaFg","user_id":"4FvrM9S76kkP5u50G81Nhg","business_id":"H6skMpg_g-sOrfTQf_Q5LQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I have been very on the edge about trying this place after reading it's health reviews, but I threw caution to the wind and I'm glad I did. It is Oakland Restaurant Week and they offered yellow chicken curry for $6. I must say that this was some of the best curry I have had. It has peas, carrots, sweet potatoes, and chicken. I do not like my curry spicy and it was perfect. Amazingly sweet and creamy with the right amount of spice. I will definitely be eating here again.","date":"2018-02-01 19:37:26"}
{"review_id":"7W19o1AOXyTfdY5ZP0XUBw","user_id":"b76SMSsFvtVqwhD_xMhz4w","business_id":"vcVgncax_tbfhMckX1m36w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Completely addicted. \n\nI love the make your own bowl. I'm the kind of person that knows exactly what I want and that's what I get. \n\nFood is always fresh and plentiful. I've never felt underwhelmed by the toppings. Always delicious!\n\nTry to avoid the noon rush though. It gets a little backed up.","date":"2018-07-17 00:52:16"}
{"review_id":"0O8JHMpvHr11tKfjSSvLEA","user_id":"KLReaaVCWVJL9mYU6YywGw","business_id":"bsrj9_hFAql3dlSf244zpg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Now let me start with the good.... \n\n1. Great location\n2. Very clean\n3. Most comfortable bed in Vegas\n4. Fashion show mall is literally right across the street\n5. Large rooms\n\nThe bad....\n1. Noisy. Train comes by 3 times a night and it is loud and they honk as they are going by.\n2. Pool is just ok\n3. Rickety pull out sofa creaked all night\n4. Not 5 star property like Priceline said\n\nI would stay here again if a deal popped up and my trip didn't revolve around the pool. I love a clean non smoking hotel and this definitely beats my go to JW marriott in summerlin","date":"2015-05-26 14:34:46"}
{"review_id":"uesAtjiXZp1XscvnyyMDxg","user_id":"9tHfX7gm8kmWhEQbKJQa9g","business_id":"1QJFpZxLbHbXSKohWp9uIA","stars":3.0,"useful":3,"funny":0,"cool":0,"text":"In the past I would have rated this restaurant 5 stars. We used to order from this place weekly. Lately, however, I have been disappointed in this place. \n\nThe food is always five stars, that's in the event you are actually able to eat there. My wife and I enjoy eating at this place but realize that it is small, and often busy. Another option is take-out which we often opt for, because we live close, and can still enjoy the food at home. That hasn't been an option the last two attempts that I have made to order take-out because the line was busy. The first time it happened, I had to go to the restaurant, order the food, and wait 45 minutes to get the food. \nI tried again on Friday to order food, and again the line was busy. After many call attempts, my wife and I decided to see if we could get a table. When I got there I was told that there was a 35 minute wait for a table. I went into the bar to see if there were any tables available. There was one available, however a woman who was waiting for a table in the main dining room was occupying it. We decided to eat elsewhere. \n\nIf there aren't ever any tables available, and I can't get through to order take-out, I can't see any reason to attempt to order from here again.","date":"2017-04-30 05:42:02"}
{"review_id":"Isj61vRf47u1Yb59MlNBmg","user_id":"0TJ01iwzVLXtr_EYcfqoWQ","business_id":"u_-PMjrCpr9EBRmLSWCEHQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Nice decore in this large restaurant - the theme is beer. Appropriately, there is good beer selection on tap, as well as wine, and excellent food. Superb service. Recommended!","date":"2015-10-23 13:52:50"}
{"review_id":"DuX698FftQvW-cTY-Mq04Q","user_id":"Gr2di0N7KdFxnvXwBDKG9Q","business_id":"99kGGQoig4YaRi-52VtqMA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"My friend and I were there this afternoon at 6 PM May 25, 2017 we ordered cranberry pecan chicken salad sandwiches barbecue chips and water\nMy sandwich was not fresh the bread was stale it had chopped apples no Pecans. They had no barbecue chips even though they were displaying them they only had one salt and vinegar chips and they had no bottled water of any kind. \nThe beverage cabinet at the front by the register was completely empty\nThe only good thing about this meal is I ordered a peanut butter smoothie and that one was fine. \nMy friend ordered the same sandwich that I did instead she was delivered and Apple turkey sandwich that was very dry. No chips we had to go after the chips and they had no water and no napkins with our meal or on the table. \nThe only beverage they were offering was soda, and smoothies. \nI definitely will never return to this topic and a smoothie's café","date":"2017-05-26 04:04:26"}
{"review_id":"2uHB2-PVaTneMdHyNNpotQ","user_id":"-1eORDLXTqztOsdmrEJ_Pw","business_id":"i066yR2IDP4FWt6p-k9aFg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great service!! Friendly staff! The Vegan selection of sandwiches is great! I got the Meatless Mike, Vegan style, with Creole Onion Kettle Chips. It was so delicious!! I just wish they had a larger selection of healthy natural beverages but I settled for the country time lemonade. Next time I will just bring my own drink but I would definitely visit again! Great place!","date":"2016-05-31 04:31:36"}
{"review_id":"UVLyuicTlnLYedWUwz4LNA","user_id":"NpHj5E2qkX9DS4jbXf-s6A","business_id":"v0FdDAXvEYieRWcngbCe1Q","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Better than chipotle. Yup, you heard me! The meats are amazing.. Fresh made tortillas.. Great drink selection.. Just YES","date":"2016-03-07 04:39:49"}
{"review_id":"rlr6JrKiBCebvyQ_D8fmdA","user_id":"wUmQpPuLWrSUvVW7YzdAWg","business_id":"7sb2FYLS2sejZKxRYF9mtg","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Yesterday was my first time at Sakana and I thought it was a great place. It's not on the strip, it's about 20 minutes off the strip. The service was well, the waitress would come around often. The food was delicious. A must have is the summer crunch. The best part is the all you can eat deal. You pay $25 and get as many rolls as you want.","date":"2016-12-04 16:13:12"}
{"review_id":"7Bx18tTtZbSdT_fB_t6F0A","user_id":"RtNxciEeyvF6RKubVcgwWA","business_id":"eB6E-gPs9XnYvDsVWNeKiw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I will never get waxed by someone else! I absolutely love Courtney! The studio is very clean and comfortable and she always makes the experience great! She treats you like a friend, not just a client. I live in Flagstaff so I try to make an appointment every 4 weeks but even when I can't and I don't see her for a while, she still remembers so much about me and my life! Also, she charges far less than most places (half the amount that Flagstaff places charge). PLUS she gives a little discount for college students which helps out a ton! I usually get a brazilian which she charges $50 for, but as a college student she only charges $40! That $10 really makes a difference for a broke college student. My wax always comes out flawless and I stay silky smooth for 2 weeks at least. She uses hard wax but if I have stubborn hairs, she doesn't hesitate to go in with soft wax and even tweezers to make sure I get the best result! I love Courtney and I will never go to anyone else again!","date":"2018-07-07 21:44:00"}
{"review_id":"hdGYXYZU0Ku7MjW-nkRopg","user_id":"w9wic5DqY79J-qWfF7mYQw","business_id":"4V2KN03EJMzaoOmLOy5UhQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Love this place at all times of the day. They have great food with speedy service. At night turns into night club. Best in town. They always have great DJs from all over the world. Good job barley house","date":"2016-08-04 05:15:59"}
{"review_id":"QdOBhOGhp9psfnqiW-XQyg","user_id":"HgqzUOdaDrGS_NvKkSQwuw","business_id":"i4SPLxzUF0iUa46CORlwxg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"After writing my previous review, I was contacted by a Midas rep who offered to submit my complaint to head office. I appreciated someone listening and trying to help, so I agreed. I later received a call from the manager at the Midas Ringwell location around June 6 or 7. He didn't know why he was calling and it seems that he was just told to call me without any details. I explained the situation, and he told me that parts rust and that's how cars work. I asked if it's normal for parts to rust and seize after 5 months of use, and he didn't have anything to say. He then said that I could have brought the car back to them so they could \"fix\" it (actually do the work this time), but I told him the work had already been done by my regular mechanic. He said it was too bad, because they have no way to compensate me. I explained that this was fine and I'll just continue to tell everyone I meet what thieves they are. He offered to have the regional manager call me, but it would take a couple of days because they are busy. I said this was fine, but it's been a week and a half and I still haven't heard from them. It's interesting to note that he never denied anything I was complaining about.","date":"2017-06-17 17:49:41"}
{"review_id":"xx6SAGgkQ-FcG5i_z_KoeQ","user_id":"DOZtiJTh6ZYsZJcXgPrdBg","business_id":"LquC3-q4KBVle6HSE5cRjQ","stars":3.0,"useful":3,"funny":1,"cool":1,"text":"Yay, gentrification.  For all the new hip locations that are growing in Toronto, you need several things to make it liveable.  Look at the up-and-coming Liberty Village for example.  Grocery store: check.  Starbucks:  check.  Movie rental place:  check.  Wait a second, where do you buy booze?  Thankfully, the LCBO moved in and have you covered.\n\nVery new and pristine, this LCBO has a decent run of wines for its size, and an adequate selection of beers as well, but certainly not exhaustive.  They have the basics and a little bit beyond.  I'll be surprised if you're ever surprised about finding a bottle here, when the larger Queens Quay LCBO (http:\/\/www.yelp.ca\/biz\/lcbo-toronto-14) affords much, much more.  This will be a place to go when you realize company is coming over, dinner's in the stove, and you're all out of Merlot.  This LCBO is to be used in cases of emergency or convenience, but really not much else.  No special trip is necessary.","date":"2008-12-05 17:21:16"}
