{"review_id":"F5TaV_SQeejAJxVfyHzxCg","user_id":"ue4lq4iPIoshGIsUsaO6lQ","business_id":"RV5k1Dj_vL5Gs5ldM8AM0w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Mr. Hassan will make you look like a movie star!....He is the best portrait photographer that I have ever seen. He is definately a Master of his craft. His prices are super resonable, also....His guarantee is: \"If you don't like the finished product, you don't have to pay\"...It does'nt get any better than that!!!","date":"2011-11-29 22:48:53"}
{"review_id":"9jBOrv_wl5fIQrcM5n2vDg","user_id":"CQ67NJigSe5-uBDX3b_CUw","business_id":"dvbcUnKv2awsIxog7dO4vw","stars":4.0,"useful":5,"funny":0,"cool":2,"text":"Dropped by for a late lunch. They have lunch specials until 3 PM.\n\nThey've got a menu that's chinese-only, and I'm not sure whether that's the menu with the better stuff or not. It's definitely different from the english menu though.\n\nService is alright. Portions are pretty big. A group of girls sitting at another table across from us had ordered one dish each, but when the dishes arrived you could tell they were visibly shocked by the sheer quantity of stuff on the dishes. Lunch combo was pretty sizable as well, and they come with a drink on the side.\n\nFlavor was alright.\n\nAt the very least, you won't be leaving hungry.","date":"2017-07-28 18:09:29"}
{"review_id":"wYL8dWIdsMQIgi6Ms3CGRQ","user_id":"B7fctYZWnTDBb_8vh68W9w","business_id":"WSbHXAZHTCNQUMHW7DgbPQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I've seen SO MANY negative reviews of this location it's insane. So I was prepared for the worst. But I'm currently sitting in the waiting area (which is really spread out and not cramped at all) and the environment is so nice!! The girls in reception have been smiling and laughing with all the people that have walked in. I tried to go to several locations yesterday and each one was miserable. At this one the wait is very long but they seem to be filing through people as quickly as possible. So give them a try if you are in the area!","date":"2018-03-15 19:20:06"}
{"review_id":"zWbB11c4Ps6c2CZtKlweZg","user_id":"OqweF5o8se1UcJ7YjBB7hQ","business_id":"TFdLM8R_7Pf1xVeBNKl0hg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My introduction as a youth (dating back AWAYS) to gourmet and class.  15 years later, still delivers the goods.  Cheers!","date":"2015-03-18 18:59:33"}
{"review_id":"W9NWlVwEOr9zGGh6yvhL7A","user_id":"bW3WOoWQ7ETG-6pQwnHdbg","business_id":"nnDLapJk1z2NJE0-XzwMlQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"My husband and I were pleasantly surprised when we had dinner here. We were expecting good food but after eating our meals this was my favorite meal in Vegas! The prime rib was cooked perfectly! The salmon was delicious! The service was absolutely great as well! We made reservations for the same day which was very accommodating. Our table was ready even when we got there 30 minutes early.","date":"2014-09-25 14:23:06"}
{"review_id":"SlzFfSJxd-MlyvLJYE_Gvw","user_id":"YcaZNr4HQ5f3ihajDQQLJw","business_id":"5eV8oUGdBXylwB7HeaDFOA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Absolutely FANTASTIC!!!! The service was a+++!!! The girl at the counter was so nice and so informative. We got the feta app with cucumbers (OUTSTANDING), I got the Greek salad (small) wth gyro meat, my husband got he rice bowl with double chicken and said it was incredible. We happened to be in the Henderson area, and pulled up yelp for a lunch spot, SO GLAD we did! So yummy, super clean, and excellent service. What more could you ask for?!  And we found out they just opened a location right near our house on Blue Diamond!! So naturally we went there the next day, LOL!","date":"2017-07-08 17:21:45"}
{"review_id":"QbPRkPeGW7g9D0xchocnlg","user_id":"oq2NNY1UGHjtnoSk4oVimQ","business_id":"9ULcHyUTN1O16Vr8KUMQew","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Fast delivery and delicious food. The food was hot and freshly made. By far the best Chinese food I've had in the area!","date":"2016-08-12 20:44:45"}
{"review_id":"DF09avMH-tl7nGreGbOSsQ","user_id":"ojKLAp858S8zv7RnoBMzqQ","business_id":"nkMAcmooVZvBuLqywYYHwg","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"My family has been seeing Dr. Brown and the girls at Comfort Care since the mid 90's when we moved to Vegas. My father had extreme perio problems and Dr. Brown did all of his work.  There isn't a single piece of work in my mouth that hasn't been done there as a result. As an adult, everyone knows me and they are always friendly, really flexible and understanding with billing, and above all else, thorough. Every time my mom has an issue with a crown or abcess she simply calls and they have a prescription ready at her pharmacy so she can start treatment before they get her into the office. I make my boyfriend go there now, too!\n\nI recommend Dr. Brown and Marlaney (she replaced Kathleen for hygiene) if they take your dental plan or if you really need experienced and top notch care.","date":"2013-08-03 17:45:30"}
{"review_id":"CsrUqOyKMeAtD1N4memLNQ","user_id":"dEe-1GTJQ3dBEHOH9jGlNw","business_id":"5O02gK9VpnLZNC-aFnp6lQ","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"I really wanted to check the place out based on the pics. I asked about specialty drinks because of what I saw here and all I was given was a Michelada option. Food was slow to arrive and it wasn't busy. The place has a nice feel and def potential. Seems like the bar area has it's local feel which was cool.","date":"2018-02-11 03:41:23"}
{"review_id":"cBy_4ft8ES1pbpn_O1WdAw","user_id":"v9vGnjphb0Hta0lvtf5haA","business_id":"D38nHcnLTnw3xhhiI2apyQ","stars":4.0,"useful":4,"funny":4,"cool":4,"text":"For $35 per person you can come and recharge or have some drinks while waiting for your flight out of Las Vegas.\n\nThey do not have an American Airlines Admirals Club in Las Vegas so we needed to find an alternate location to relax and have a few refreshments. We walked in and were greeted with friendly smiles. Gave them our boarding passes and $70.\n\nNo hot food or snacks are offered here except for Cup of Noodles (beef or chicken). Plenty of quickie snacks: multiple flavored popcorn, fruits, pretzels, potato chips, cookies and trail mix.\n\nBut the unlimited drinks were really why we were here. The bartender kept the Hennessy and Coke coming. They had wine too but nothing that caught our attention. \n\nThis place was a Godsend when after walking down the ramp to board we were told we were too early and that our flight was delayed. We headed back to The Club to continue keeping our drinks on.","date":"2015-10-07 21:46:14"}
{"review_id":"H5H9AGwaNbjJoL0xCujq3Q","user_id":"74goFJSWzAwmk69XfPqEag","business_id":"Zx-rz7D4DOT8Kmx97LFAjw","stars":2.0,"useful":3,"funny":2,"cool":3,"text":"Overrated.  Maybe I just don't get it. I do enjoy divey bars, such as the places on ossington, leslieville and junction.\nI do not think this is the best patio- not even close.\nThe bar is small and divey. Basic stuff here only behind the bar. it's small so be prepared to be bumped into once in a while if you\\re sitting in the front room. oh are you ordering Whiskey ginger? sorry No jamiesons. \n\nbartender told me \"They don't take credit card or debit. And the ATM machine may or may not work at times.\" Thanks bartender. You are so cool and helpful. ps: Washrooms are gross.","date":"2012-12-04 15:56:18"}
{"review_id":"lCfDlBtqpDec0kfUzhTwbA","user_id":"xuCB3RFibKwq2lqicSSShQ","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I was surprised with how they redid the OG rooms. Granite and marble countertops throughout, even in the shower, highly recommend the upgrade if you can. We had a view of the wheel. Right outside of the hotel is a strip that has awesome food and bars, a daiquiri place literally right outside. There is also a few liquor stores that surround the hotel if y'all want to save money and make your own drinks. I don't think we paid more than 30 for Uber there from the airport. And even though the lines look long at the counter desk to check in, they move fast. If you go to the pool, opened from 9-5 by the way, seats are very limited and the drinks start at 17 and 42 for a pitcher; it is cheaper to get the pitcher and splitting it with people.","date":"2018-09-25 04:25:31"}
{"review_id":"W8TnXwk6wtx3ITj8TLM5EQ","user_id":"HRDwcLHS-JvXNUWhTPYpdA","business_id":"24S-aiManGfjbb-fwwi2VQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Really enjoyed my stay here at La Quinta Inn. Checking in was fast and the customer service from the staff was great! Not only was she attentive but she also provided my guest and I with water. The pool was nice and clean and overall the room was well upkept. The breakfast that was provided was also delicious. I had no issues what so over here at my stay. Definitely will be returning!!! :)","date":"2017-07-18 17:58:21"}
{"review_id":"fVQX0LXSZlT6LyvbbQe4NQ","user_id":"DxQQUd-gbiMCzYznptFjog","business_id":"cKwg6HFaLYXl7Ar0rHojAQ","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Apparently this is the first review for this company. I can't fathom why others have not reveiwed this company. My 23 year old garage door finally gave up the ghost the other nite. I got quotes from some competitors ranging from 750.00 to 1,100.00 dollars. Both companies came immediately said I needed a new door. I expressed to them by budget was limited and a new door wasn't in that budget. A friend said contact AAA Action Doors. Contacted Josh (part owner)...Told him my budget was limited. He came out took one look at the door,..Said we got this it can be repaired w\/o question..All that was needed was new metal bracing along the top and middle. He installed the metal bracing in less than 45 min....I had an operating door again..and saved a bunch of money.","date":"2013-11-14 04:21:20"}
{"review_id":"Pk59E6JcDAnLg5jp4O4ugg","user_id":"JM6z9feHgWNsWs0E1Y3lhw","business_id":"rp1TgQObnIIRZw3fHWSwJA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Our server was very nice and attentive.  Margaritas were delicious.  But unfortunately the food, no bueno.","date":"2013-08-03 13:48:37"}
{"review_id":"PDnnhmkJXq4Ffh3G9ivPTw","user_id":"fZk_l3cPTj7AScYmaguomw","business_id":"XnJeadLrlj9AZB8qSdIR2Q","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Chef Joel Robuchon's restaurant is my siren song...love, love, love it!  A gorgeous little jewel box, stars removed from the casino.  The decor, bar, cuisine, wine list, staff and service, all so perfect, I could rhapsodize about the myriad joys I've experienced here forever.  The many, many times I've enjoyed the 16 course tasting menu, so truly scrumptious and amazing offerings, executed so perfectly and plated so exquisitely it's almost a crime to eat them!  Executive Chef Claude Le Tohic is a true gem and helms the venue like the marvel it truly is!  My favorite restaurant in the country!","date":"2014-12-17 17:52:15"}
{"review_id":"jp2qDWenNyL-POe4fyDcag","user_id":"F0oazTkA1JsKFwvpCTDjbQ","business_id":"QFqtVX-lyZQgVHQrG-dhlg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"The food isn't bad. I'm obsessed with sweet potato fries, so I try every place her in Charlotte. These are great! I love the BLT, the bacon isn't too fatty & cooked perfectly. But the blonde bartender is a major bitch! I hate placing my to go order when I see her. She gives no eye contact, talks to you while doing other things or walking away & just sits your money down without even seeing if there's anything else we need. Happens every time, like it's rehearsed lmao. Food is still amazing tho =)","date":"2017-05-13 05:17:03"}
{"review_id":"aOiuIszcQDMoc1sugEwCVw","user_id":"N8M1Dmks-FtPCLiaVSy73g","business_id":"4FNmoUQjonMwrLuxg6n11A","stars":4.0,"useful":3,"funny":1,"cool":2,"text":"I like to think that fast food and barbeque are two separate things that should never be mixed; the idea of getting a decent barbeque sandwich through a drive through window seems like an impossibility to me.  However, when the bartender at the awesome strip mall wine bar told me about this place you could get buggalo of food for less than a five spot, I was sold.  \n\nCook Out is an anomaly among fast food places in that its menu has everything you could ever want, or at least everything I could ever want (sans corn nuggets).  Cook Out offers the boring old hamburger thing but don't let that distract you- opt for the BBQ.  For less than $5, you get your own picnic.  \n\nMy plate had a hockey puck sized portion of pulled pork, a couple fingers of hush puppies, fries, and slaw. The chronic pulled pork was super moist considering it was 1 AM, and came topped with Texas Pete's.  Although it was delicious, isn't Carolina BBQ supposed to be heavy on the sauce?  The hush puppies were okay (more breading than bread), and the fries forgettable.  When it comes to cole slaw, I am a snob but Cook Out's slaw was surprisingly good; it was house made and very dry, but I mean that in a good way.   It's also worth mentioning that you can get a corn dog as a side.  I don't know why, but as a Southern gentleman, I agree with and salute that.  \n\nHow Cook Out really let me get my jollies was the drink menu.  Cheerwine- my god, if I ever make a lot of money I'm putting a fountain of that crack drank in my house.  If you're from out of town, drink up because that stuff can only be found in North Carolina.  They also have about 40 different kinds of milkshakes available, including seasonal ones.  The winter shake is eggnog but apparently they only have that one in December.  The fact that they have a watermelon shake in the summer blows my mind.  Be warned though, the shakes are thick like a Petey Pablo video girl- you'll need a spoon, or at least a boba tea straw.  \n\nAs I said, the idea of a fast food BBQ joint just doesn't do it for me, but Cook Out pulls together the concept beautifully.  It's like if Jesus and Allah got along and then made a baby.  A beautiful mixed baby named Cook Out.","date":"2008-12-03 04:07:28"}
{"review_id":"ZmNdtSzyheDTJUlwXqzEQw","user_id":"PZNMPWCViVX8JLsn10MSnQ","business_id":"9aSMIZjC7tdXM-VyC6g0Qg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Located in Wilmerding, PA, Bucky's Automotive is the former Palumbo's Automotive.  \n\nWe've been coming here for years and never feel 'jabbed'.  Jose, the owner, has also worked here for years and he is fair, honest and accommodating in his scheduling.  If something comes up that is not his shop's specialty, Jose will recommend another local shop.  Did you ever walk away from the car dealer's service department feeling like a 3-month financial recovery is needed?  Ya, me too...  Never happens here.  Great communication regarding work that is needed, cost involved and time required.\n\nThrough the high school years, our family had (5) cars requiring attention and service and we cannot imagine anywhere that could take the challenge and keep everyone on wheels.\n\nWhat can I say?  We {heart} Bucky's Automotive!  Tried and true It's a great east suburban car care option and well run business.","date":"2014-06-11 14:40:07"}
{"review_id":"F4-ZfKiATEfTlAJK4JaULQ","user_id":"EWv-QUwo3hMfoM04sIXdUw","business_id":"qxVcSWGKyH3HkkHV8NinDA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Take two on my review, as apparently the first disappeared.  We stopped in on a Wednesday afternoon. No one was there.  They had an all day happy hour, and great lunch specials.  \n\nMexican bento is the greatest idea I have seen in awhile. The food was fresh and fast.  Open air concept does attract the flies, with all the sweet liquor bottles and fragrant foods.  We enjoyed a nice lunch, few drinks and moved on to the local shops nearby.  Great location. I can see why Salty Senorita is so popular. This could definitely be a place I would like to hang out if we lived in AZ again.  \n\nWaitress brought my husband a birthday dessert with a candle.","date":"2016-11-09 20:44:19"}
{"review_id":"3l1JCc2VZM99Hir-YhaRQw","user_id":"BUrjFIE7Rpd7HESbvCKtaQ","business_id":"riNcBAeiQ3s80jzfmTVSfw","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I purchased a Samsung fridge from Lowe's in 2014. A few months ago, I began having an issue with the ice maker. The ice smelled bad and tasted worse. The water still tastes amazing and is odorless. I replaced the filter and thoroughly cleaned the fridge, emptied and cleaned the ice bin several times to no avail. Chemical type smell, similar to freezer burn, but different. Emptied the entire fridge (as that is where the ice maker is located), nothing helped. Looking at Google, I discovered this is a common problem. I contacted Lowe's as I have a 5 year warranty, and they sent Buy-Rite.\n\nTech showed up and used his laser thermometer in the fridge, drink drawer, and freezer. I explained that the issue was the way the ice was tasting\/smelling, and not with the temperature. And also that it was a common problem reported online in reviews, etc. The tech told me there was no solution, but that he noticed dog hair under my fridge. \n\nI took 5 hours off work to wait for the tech to come for 5 minutes and tell me there was no solution. Very dissatisfied.","date":"2015-11-06 00:40:19"}
{"review_id":"TiTtNdnN0RY3XJLDVFihvQ","user_id":"xfGTlY7fir1PlsbxQHppYA","business_id":"8l5_WS7fpP-14qUNCy3kwQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Tried La Mai Thai tonight and it was delicious! Was craving peanut sauce so we ordered the Chicken Satay app with peanut sauce, shrimp pad Thai and I got a side of Tom Kha Kai soup. \n\nSoooooo good! \n\nEverything was fresh and vibrant. Even with the shrimp surcharge our meal was less than $30. Score!","date":"2018-02-11 02:55:13"}
{"review_id":"s43jrtahE5Hsx7nX9j0lqw","user_id":"A9Fhjckq4gnp654eI2m1Hg","business_id":"9rmVrOEi4cG1IUBTZS02oQ","stars":5.0,"useful":2,"funny":2,"cool":1,"text":"I met up with some friends here for some habachi and drinks. Let me start by saying that one usually doesn't associate Rock Hill will good Japanese food so I was initially skeptical but I'd figure I'd trust my friends and give it a try. Well I was happily surprised.  First of all the restaurant was very clean (which is VERY important for me) and we were greated warmly.  So we decided to have some drinks at the bar while we waited for the rest of our party to arrive. I ordered a martini to start which was strong yet smooth followed by a shrimp tempura roll. The roll very pretty big and the shrimps tasted fresh. I especially like that it wasn't like most sushi rolls around here that are 90% rice and litte else. Once we were seated I ordered the steak and scallop hibachi.  This was my favorite by far! The steak was perfectly cooked and the scallops were especially tasty.  The best part was the portions were really good for the price and quality of the food. I had more than enough for lunch the next day!  It's definitely worth the drive and I'll totally keep going back.","date":"2014-08-10 20:06:30"}
{"review_id":"4za5A5mEU2yiP6TM_DOnLw","user_id":"OtqdOQ2cwOsO5xwTeBxlsw","business_id":"Cyy95sS5r6MGzgEA4UZX5g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I've always loved Parlour, as noted from my previous review. Luckily, my stylist, Sam now works here. He's my guy for my cut and colour. Whatever I'm after, he'll get it done. Whether it's trying a different shade of red to chopping off all my length or even just a quick blow dry. \n\nThe salon is always hustling and bustling with coifs of sleek styles to more drastic changes. They can really do it all.\n\nAlthough the prices are up there, they do have junior stylists, regular stylists, senior stylists and educator stylist tiers to suit all price ranges and expertise. Definitely one of the best salons in the city. Hands down!","date":"2016-08-25 12:55:44"}
{"review_id":"zAu8comQdi3RjqmlOcUjMg","user_id":"mgpCWdcyglWx6QOxQkyamQ","business_id":"I6ICIIZfZsp_J9hHmfhWhQ","stars":4.0,"useful":1,"funny":2,"cool":1,"text":"I came right after the New Year for my birthday thinking that everyone was gone already... nope, the party's still going! I walked here during the day and thought it was okay. During the night? That's when our fun start!! The lights were just amazing and really had us pumped up!\n\nWith shows, shops, casinos, and buffets all given to us on one long street, we had plenty of things to keep us busy. However, it does get pricy so I would definitely come when you have the cash to burn. Otherwise, you can just watch people gamble, attend free shows, and window shop.","date":"2014-01-17 05:53:39"}
{"review_id":"fhLlAM-NJUMu6MSvuibOBg","user_id":"Pwa3X14Olao484xDGJELFw","business_id":"0FUtlsQrJI7LhqDPxLumEw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Holy smokes!  I can see driving to Gilbert, AZ from Ventura County just to re-experience this delightful dining experience.  Flavor, flavor, flavor!  On our way back from our New Orleans road trip we detoured and took a chance on Joe's and it was well worth it.    We are bringing the kids next time so watch out!  By the way the G.I Joe's showcased were a nice touch.","date":"2011-04-22 02:17:14"}
{"review_id":"ikc3YzsD_u7T_5GnLGxS7Q","user_id":"3w-oXPMjhv6bDyCZKTuO7w","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Had breakfast here, ate outside, beautiful and great food. The cafe au lait was really good, I had the eggs Benedict with salmon and my wife had pian perdue (French toast) both were EXCELLENT, very well prepared and great plate appeal","date":"2016-07-03 16:50:57"}
{"review_id":"1JZ65FGcbH62VD-Dri9qwg","user_id":"LRARPyzzf7FpH7lJXJgH2w","business_id":"h_4dPV9M9aYaBliH1Eoeeg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"very loud, wish I could give half stars, solid 3.5 but not a 4.  sausage was good beer was okay...just very pretentious and unnecessarily loud...put up some sound absorbtion.","date":"2016-08-25 15:08:33"}
{"review_id":"7Dl9dv8vYMKIXPTaHGbpNQ","user_id":"OBXh774Jghr0aW0cpiDfxg","business_id":"0jAexNHRHhkQv4zNYqenBA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Went to El Hefe with some friends and really loved the atmosphere and the food! We sat at a booth w the old school taps (still cold\/can't use) and had great service! I ordered the Queso Fundido and Chicken nachos for the table and everything was delicious! Had great drinks, great food, great service. When in Scottsdale hit this place up! Was awesome at 4pm and apparently gets crazy fun later in the evening!","date":"2014-07-13 14:57:41"}
{"review_id":"PdqGgSuZcgPwIpPI5AyPtw","user_id":"H9d0x9EuU63KPeRb2gCHfQ","business_id":"33N-oL25LxumJNft-ULXTA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Used to be really good with previous owner. Since new management took over service has declined. Employees seem uninterested and \"shortcut\" services, especially because owner is not always present. Too bad because new owner seems really nice but perhaps unaware of decline in customer service.","date":"2017-08-28 20:45:03"}
{"review_id":"uqnVTOavicgYYZrOT_as9Q","user_id":"HRqgFOJ_M_8C5NlqT207dg","business_id":"woXlprCuowrLJswWere3TQ","stars":2.0,"useful":1,"funny":1,"cool":0,"text":"This is not the place to go if you want to have a good conversation - it was so noisy it was difficult to hear (the same can be said for all the restaurants in this group so it wasn't a surprise to us, but be forewarned). The tacos are varied and really delicious. My big gripe is the cocktails. I'm a huge tequila fan so I was excited to try some interesting twists. My first cocktail was supposed to be \"spicy\" and it barely had any heat. If you're adding jalapeno to a drink don't be timid. My second drink was, according to the server, not going to be too sweet but it was so syrupy I couldn't finish it. A big disappointment, and while we might go back for tacos we definitely won't linger over cocktails.","date":"2016-08-25 11:19:28"}
{"review_id":"M3bYj0xCgZKr2a5hLCRCwQ","user_id":"ommO0-ZiFc2npO5S9vXaVg","business_id":"VlDTUr3y-bdVZDKXEILKfQ","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Great draft choices, friendly staff and affordable prices. Good place to grab a beer with a friend or sit back and watch a game.","date":"2017-10-02 02:25:22"}
{"review_id":"Roccolld-ahI0DOdWmyHAQ","user_id":"-FMSIHEmk0m-5Fi99V3XiQ","business_id":"GtSNTE2qMOZBlj0noCgCGw","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"This place rocks. BBQ was great, spicy squid was tasty, Cham chai noodles awesome, very friendly service","date":"2012-07-16 02:23:32"}
{"review_id":"WTgN6hoXQUgjYUxlfqB8TA","user_id":"xVFglqG1i4EFvFCaWOqPqQ","business_id":"M0pkmBUi_CI0qrzN7ee80Q","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"An eclectic decor throughout.  Tables, chairs, and sofas are scattered to make this locale very laid back.  The fresh pastries are exquisite and the breakfast sandwiches are amazing.  This is a must stop on a visit to Charlotte.","date":"2017-12-29 15:47:59"}
{"review_id":"UXESji8phJx64rJBmUIcdQ","user_id":"mnDcilbDG8tw648CrlOn8w","business_id":"ZFyJ83LJkkO1dP82kzXKNg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"This is the other Raising Cane's I've visited (the other in Grove City, OH) and the complaints are much the same... it's a little pricey, the sides lack flavor (especially the fries), and the staff just don't seem to give a sh*t about being there and have no care that you can tell.\n\nBut if you've got a craving for mechanically separated chicken breaded up all tasty-like, you'll probably manage to enjoy this place!","date":"2010-05-14 20:04:28"}
{"review_id":"LFdPTfhAwk7ma_hvurqIEQ","user_id":"I4z0kawvdZHrYR1Iq3Whew","business_id":"ID5wWJ9C7G0hfbQilvlfxA","stars":5.0,"useful":4,"funny":3,"cool":2,"text":"Love, love, love, love this place!  The first time I went here was with a friend visiting from out of town.  Our server, Frank, was so fantastic we ended up staying for nearly there hours eating, drinking and goofing off.  The other staff are fun as well but, if you can, ask for Frank!  The atmosphere was busy but not frantic.  The decor was fun and playful, making you feel very comfortable.\n\nThe guacamole was outstanding (we ate the entire thing) along with their tortilla soup and salsa verde.  The shrimp enchiladas were enjoyed on my second visit, those too were phenomenal.  Their food has a balance of spice and flavor without being overly salty.  Their tequila selection is killer.  If you enjoy good tequila this is your spot, they have just about everything you want and a few you may not have heard of yet.  \n\nYou have to be sure to get a picture on the swing next to the bar.  It's a fun photo op and a great way to remember the place.  La Comida makes a great first date spot, especially if you want to see how your date holds their alcohol.  It's also fun with a group of people, their bench seating easily accommodates large parties.\n\nIf you like Mexican food, a relaxed environment, and great tequila - I dare you to try this place.  You won't be sorry!","date":"2014-04-01 03:58:52"}
{"review_id":"8PuXeGEK1y_y0dry7pt6XQ","user_id":"9a60KWJRTxHFNRqt4qb7Xw","business_id":"6QJAT0N9X2dRqAtQyTw7Ag","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Artie with the business team is awesome. Very prompt with responses and helpful with my team getting us the right products.","date":"2016-07-25 04:50:21"}
{"review_id":"rzohC09KMYpWbODwvqkqqg","user_id":"75RntWgoKzw9hOnAG61lUw","business_id":"ggtfLZqMigUx5Nn7jTc2hQ","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"I understand that is billed as a \"boutique hotel\" so I expected some level of quaintness. What I wasn't prepared for was run down and dirty. First of all, it's very easy to miss this place, we drove by it twice as it's wedged in between two other businesses and there is not a single hotel person (i.e. valet) waiting outside. We ended up having to call the front desk and ask where we were supposed to park the car to unload our bags. She seemed confused by this request and after a few minutes she told us just to leave the car in the service entrance behind the hotel. Weird! What hotel doesn't have some sort of established valet system for their guests arriving in cars. \n\nCheck in was fine and the staff was nice but I knew as I walked in this wasn't going to work out. The lobby was super small. It was cramped with four people waiting at the front desk. We were told we had been upgraded to a junior suite, so I was hopeful the room at least would be nice. The elevator was dark and dingy and barely fit two people with luggage. \n\nAs soon as we got to the room, the few hopes I had left were dashed. The room size was nice but it was just....dingy. The bed was lumpy, everything from the curtains to the dust ruffle were wrinkled and stained. The linoleum was cracked, the burner carpet looked like it had been there for roughly a hundred years. Needless to stay, we checked out immediately and headed to the W Hotel. I would highly recommend staying somewhere else unless this is your only option.","date":"2013-08-03 15:29:18"}
{"review_id":"1oAVgr9UvkslRg3DcQToyQ","user_id":"G6zMw6yjBRBXWYAhHC-3JQ","business_id":"JDDZAflMR3oHBH5cKOQNpw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Dave Bonanno and the VW North Scottsdale staff was fantastic to work with.  Everyone was fast and courteous.  All prices were fair with full disclosure given.  The experience was more Lexus\/BMW\/Mercedes than anything else.  I will be a repeat customer again!  They took the time and didn't rush to get a quick sale (and I was in on a Saturday).  Thank you VW North Scottsdale!  I love my GTI!!!","date":"2015-06-08 17:05:02"}
{"review_id":"FiKFByFVGp7vIQaPmU9fDg","user_id":"6WfBop_XS1EgHU3F3ACqKA","business_id":"QdvROupQvDDQIaHrTGNgKA","stars":4.0,"useful":3,"funny":1,"cool":2,"text":"Yes, hot tip you have to ask for the full menu. Second hot tip, learn to say \"hello\" in Mandarin (pronounced nee-how) and likely you won't HAVE to ask for the full menu. \n\nWe've dined here several times, and on Sunday, not surprisingly, we were the only non-Asian customers in the place. The chef was in rare form, and as I sit here having my third round of leftovers for lunch I'm still loving my dish. I opted for the Vinegar Fish, it's pretty simple -- whitefish, wood ear mushrooms and water chestnuts prepared with a dose of spice and rice wine vinegar. I'm guessing by the waitress' excitement when I ordered, that it's a dish they're pretty proud of. It was fabulous.\n\nHubby ordered the Beef and Onions, which I would classify as good, but not mind-blowing. We also partook of the Gai-choy which was cooked perfectly -- just the right amount of garlic and tenderness. \n\nIn the past I've really loved their Mapo Doufu (tofu), theirs is one of the best I've had anywhere. Next time I'm planning on having the Water-Boiled Eel. I heart eel, mmm.\n\nService is pretty barebones, so don't expect to be sucked-up to. It's perfunctory and efficient, the food comes up fast and they leave you alone. I can't complain about that one bit.","date":"2010-10-05 20:44:13"}
{"review_id":"bpTgXe79v44oyBagEXcYPw","user_id":"iBBCbb9HavgQSC15QzGS8w","business_id":"pELYR3hDc20IwzzR-ZTcTA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Fantastic experience. Dive instructors and crew helpful and on their game. Video and photos were top notch and I definitely recommend this dive company!!!","date":"2016-06-22 21:58:39"}
{"review_id":"yedOg00TV-vm1zvtB1457g","user_id":"RMkqCS2xT53D6ylQp89HGA","business_id":"p-5u8qhYmB-IcTaQcq2_pw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The staff during the night-shift are Amazing! They're fast and efficient. Free Smiles and Friendly. Watermelon Mojito and Kiwi Quencher are Refreshing! I Love the Mango Magic minus the pineapple. Bring back the Mango Moxxi!","date":"2018-08-14 04:56:02"}
{"review_id":"3lGvBsJuAnxBbxADalvMBg","user_id":"y4Pa-Nhfh7acBYrhg6fO4Q","business_id":"EjZYT46Y2qHSoChynd0q-A","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"The Power Plant showcases contemporary art from Canada and around the globe. \n\nSometimes a really great show will be presented, like Beat Nation this past year, but it's hit and miss as other shows are too narrow and lack lustre. \n\nI was pleased that they offered free admission this past year, as it gives a place to go and enjoy art with family and friends on a regular basis. The staff (mostly volunteers) are friendly and informative (I hope they are duly rewarded).","date":"2014-02-05 18:59:08"}
{"review_id":"3EViiOVzq3dUD_PzmD_X4Q","user_id":"oIWTNrRgegZqTDPVicNjkw","business_id":"IhNASEZ3XnBHmuuVnWdIwA","stars":5.0,"useful":0,"funny":1,"cool":1,"text":"This place looks so nice place to chill with friends! People working here were pretty nice too, the server explained me the stuff about the drinks. I ordered the Matcha Milk Tea and dang, that was so good. The boba is really fresh and very chewy, this is so different from any bobas that I had before!","date":"2015-08-06 22:59:48"}
{"review_id":"Ss7ySqrS1NrLf4hHi0ecuA","user_id":"i0PMahfd1bKvNXnUyyelLg","business_id":"qh5dTNXritViyuqd_Ao6jg","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"I love HIllcrest Dental! I will admit I haven't always treated my teeth well, and this has caused me to have a dentist phobia and thus made my teeth worse. Before I went here a few months ago, I didn't have a cleaning for close to 5 years! The hygienist was very gentle and took very long cleaning my teeth. I was surprised I didn't need a deep cleaning after so many years! She did mention my gums were receding a little, ( which I can clearly see) She told me to take a certain amount of vitamin C a day. Doesn't sound like a place that up sells to me. In the last month I have gone weekly, instead of silver fillings I now have beautiful white fillings that were very nicely done. Next up for me is a dental implant and invisalign in a few weeks when I save up enough :) take it from someone who hates her teeth and now is learning there is a way to be happy about her smile; this is the place to go! I feel like this place is one step ahead, tells me exactly what my options are, and now I feel completely comfortable going to the dentist after 25 years! Lastly, if the quality of their work wasn't enough, the people that work here are so friendly. You walk in here and feel like you are going to visit your family. No more snooty front desk girls or dentist that are rushing you out!","date":"2017-07-28 19:14:26"}
{"review_id":"yytN5OpIYwEux1R9rUWnCw","user_id":"sodPsaSyN5fDVlQoRtJG2g","business_id":"hfgcYtGziLl5bGbc89BTkQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Had the opportunity to use them for a few Christmas lunches.  I will be using them again.  Great pricing, great product, and who does not enjoy Taco Tuesday?","date":"2018-02-01 20:31:53"}
{"review_id":"5e_JUyKVFpYxl9qHp1MG1Q","user_id":"w1LWJ4l7jDeMNmmgIUKZyg","business_id":"7xHbnGo4MXFkBm6gYSu_xg","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"The pizza was great, but the guys that make it , while we were there they were scratching their heads, taking  their hats off to run fingers through their hair. And one guy that was cutting up something was eating. They need to wash their hands after scratching. Will not be back to this one","date":"2018-05-02 18:55:11"}
{"review_id":"u5O1Ab7KkG6LT_e5RrFdqA","user_id":"z-RAhKrqk082ifO6WBV1LA","business_id":"Jt28TYWanzKrJYYr0Tf1MQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I'll give this place one star for the music, I would never eat or drink here again, ever. We went in for the 2 for 1 margaritas, which ended up being $11.00 each, even with the 2-fer!! Yeah, the server said they were regularly 22 bucks each. They came in small plastic cups for a nice touch, they weren't bad but the food was horrible. We ordered tons of starters and everything was bla, dry, even the nachos went back!  I went the safe route and got the street style tacos and I'll tell you any Taco Truck in California is 100 times better than that dry, bland, chopped up fajita meat thrown on some greasy corn tortillas and then topped with raw chopped onions and some cilantro, I ate half of one and gave the rest all back. Ew. Actually one of my friends said she probably wouldn't eat Mexican food for a while, that's how bad it was. \nOh, and the cute bar girl poured tequila all over my face and  neck when I went up for the \"Mas Tequila\" shot at the bar. Seriously..","date":"2010-11-22 03:34:23"}
{"review_id":"elmcX1fKorDzJ4uZzuVpvg","user_id":"8CRdokGFu_Y6ym5XnaKZVw","business_id":"Bkf6d4VZdRXkSUjjMViBvQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I was hungry. My aunt was hungry. Those were the only two reasons I went to this place while out visiting Boulder City.\n\nThe pizza portions were ridiculously huge, but y'know, there was nothing special about this place other than its cheap prices. The cheese on my slice was overly greasy and no matter what you do, NEVER order their fries because they're out to make you fat.","date":"2014-08-24 20:27:12"}
{"review_id":"2wp4hcEInaDGbUCVTRZkKw","user_id":"BqUm1rHPSxlCWr-3HhNQyw","business_id":"TdjydrOFUSMUsTKdlXW6aQ","stars":3.0,"useful":2,"funny":0,"cool":0,"text":"This place has been around for a long time (at least 30 years).  Apparently it used to be quite a popular hang out for certain circles back in the day, and many locals still regularly visit.  The location is in a small nondescript building on the corner.  You can enter through the front door or through the back door from the parking lot and walk through the kitchen (somewhat odd, but ok..).  The dining area is a small wood panel lined room with only a single tiny half window.  You are definitely not here to enjoy the atmosphere.  The menu choice is a bit limited. I tried the egg flower soup (yummy), pork fried rice (good), mongolian beef (not bad), and shrimp chop suey (not bad).  It was basic fast food chinese fare, good but not great.  Also soft drinks only come in cans. The food certainly did not impress, nor did anything else really.  On my own, I probably would not return here, however, my friend is one of those locals I referred to above so I'm sure I will be back.  The owners are very friendly as well.","date":"2011-03-20 03:05:02"}
{"review_id":"YMw3MePThw-nPuz9cSl4rg","user_id":"ujOwZo999jM6bhkSXOX61w","business_id":"nrY2Qm3WTBwyqlLrNi49Lg","stars":4.0,"useful":6,"funny":3,"cool":6,"text":"This is one of my favourite places to brunch in the East End. \nI was a bit surprised at my last visit because the prices went up on the menu. That's what made me put a 4 stars instead of a 5, because I would recommend this place ! \n\nIt used to be very affordable (it still is!!) for very generous portions. \nFor an example, I have a hard time finished the whole serving of benedict eggs by myself. \nI love their potatoes \/ crispy !\n\nThe staff is always nice. In the summer you can eat outside. \nYou should get there before 10h on the week-ends, it gets busy quickly.\nEasy parking around.","date":"2017-02-09 04:36:28"}
{"review_id":"98npCaCpTsPapGsvTdfdIw","user_id":"Tfa3NNSf5C2Os-L6gyIqFg","business_id":"3PekkCkOZD7Pe3Q4owP3Pg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I had wanted to try this tailor for some time and recently walked in with expensive jeans I needed hemmed.  I had read somewhere that the original hem could (or should) be retained so as not to spoil the \"look\".  When I mentioned this to the proprietor, he told me they could absolutely do this, but assured me they could reproduce the original hem for substantially less money.  They were able to do the work immediately, and the results were great.  The length was perfect and the new hem indistinguishable from the original.  \n\nWhile I was waiting the five minutes for the job to be completed, another customer dropped in and had major alterations performed on a new suit - the results were impressive.  \n\nThe location is spacious and there is comfortable seating.  The price for my alteration was less than any other place I've frequented.   \n\nOn an earlier occasion, a friend and I took a well-worn leather jacket in for a repair estimate.  The tailor, who is obviously extremely talented, polite and personable, was honest about what could be accomplished and what the repairs would cost.  While we didn't use their services then (we threw the jacket out), I really appreciate a business that values honesty over a cash grab.  These guys are great.","date":"2016-05-07 02:16:01"}
{"review_id":"1zZdNy98JThSkVDHcrZ0Ig","user_id":"nu_M6QrRQ5vZQ-5OmFOFMg","business_id":"QFqtVX-lyZQgVHQrG-dhlg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Great for greasy late night eats. You can't go wrong with a burger and a side of fries or fried pickles.","date":"2015-10-23 13:59:38"}
{"review_id":"fRE46mCdq94RZpgdCrjzHQ","user_id":"PzLuS9aBgoi6lkxtrTY5IQ","business_id":"jNSWLq2i45GHNHIzwEiTiA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Probably the friendliest and most knowledgeable staff in town, very fair prices and a local neighbourhood gem. They even have a self wash dog station people can use for a low fee. They have tons of products ranging from dogs to birds, and even offer delivery which is great if you can't haul that giant bag of dog food home.","date":"2014-01-17 01:42:25"}
{"review_id":"8Xy5yRMsUSPvNv_lpCHsEg","user_id":"aYt6yemtPLX1RbX7UT6KCw","business_id":"nQjuBVbcRFyX3trnuf_8CQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Being in Vegas for nearly 1 week, I was craving for something hot, spicy, and flavorful.  While there are numerous \"famous-chef\" restaurants and buffets galore on the strip, sometimes you just need a break from mass produced hotel food.  \n\nPenang Malaysian Cuisine fit the bill perfectly.  Located on Spring Mountain Road on the second floor of a mini mall, Penang is a medium sized, modest looking restaurant on the outskirts of Las Vegas' Chinatown area.   \n\nThe first thing that struck me when we arrived was how empty the restaurant was...where were the people?  Only 1 table was filled, but from the way they were eating, it looked like they were enjoying the food.  \n\nThe menu is extensive and offers a large variety of appetizers, rice dishes, noodle dishes, curries, seafood, beef, pork, chicken, and vegetables.  I loved that in addition to the list of menu items, there are pictures for every dish!  This helped a lot since my husband and I are not all that familiar with Malaysian cuisine.   \n\nWe ordered the roti canai, a stir fry vegetable dish with shrimp paste (similar to chinese spinach, ong choy), a spicy curry chicken, and a rice noodle stir fry.  All of the dishes were delicious.   The roti was light, flaky, and hot.  The accompanying curry dipping sauce was the perfect vehicle for sopping up the yummy sauce.  So flavorful and spicy.  The vegetable stir fry and noodle dishes were also tasty.  The star of the show, however was the curry chicken.  OMG!  I wish I had a second stomach to eat more of that dish.  The curry was spicy and dripping with flavor.  Just thinking of it is making my tummy grumble and mouth water...\n\nThe service was friendly and attentive.  They kept filling our water and wanted to make sure we were happy with our food.  The prices were reasonable and portions just right.  \n\nOverall we were extremely happy with our meal and will definitely be returning!","date":"2011-03-20 04:20:27"}
{"review_id":"G9oOZy7WfCINBw4ipdO6UQ","user_id":"JpwMuSrftfg9vnj1YNsNJg","business_id":"q4CjxLPsMCAPeST0lcQlOg","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"I can not say enough about what a positive experience I had with these guys today! I called day of- from Los Angeles asking for a delivery to my friend and her new baby. Even though their schedule was packed, they accommodated and delivered 18 beautiful (and from what my friend says, DELICIOUS!) mini cupcakes with a bow and personal message on the box! They were beyond friendly and helpful. Don't send flowers, send cupcakes!!!","date":"2015-06-21 01:32:59"}
{"review_id":"0jYYW9gbdAYCE2kf6WYvGg","user_id":"oAufOk5iCZZ6zG7SRhW8Mg","business_id":"nDn2h-_c7Xk4UwM0aiXZlw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I thought Mezes was over-rated. The food is very similar to a bunch of Greek places which are much better value. I thought it was over priced and not all that great.","date":"2015-04-28 19:37:55"}
{"review_id":"8bpcqRvSV7QegV3xNy76tw","user_id":"ZIj9TeLzUfewLKVyb5-x1Q","business_id":"qABb9Wzdn51VcNHdp_Qhpg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Nice little place that you can get decent Italian food late at night.  Everything we had was flavorful and not over priced like most of Vegas. The ambience of sitting outside in a mall is surprising nice and feels like sitting in a side street restaurant in Rome.","date":"2015-07-16 07:52:12"}
{"review_id":"wkXbsBVPZklmuOgmizrBBw","user_id":"xCby-gCFW8aLmXbMhMms2g","business_id":"5iawpo9MaMaMcqtQxxbfqQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Favourite coffee place in the city. An americano from C Bomb makes my day. Paired with a flakey, savoury gruyere croissant... gah (that's the sound of me melting with extreme contentment). Good tunes. Friendly millennials. Roncy Yipsters. Kaboom!","date":"2018-04-15 15:15:00"}
{"review_id":"4h0_63tLo6WPVUmXW2OgIw","user_id":"fU1S53pMhVghQj_G-2R1QA","business_id":"q48MlSSEmbQWsM9h3NaUBA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Customer service is outstanding. Personalized service, they try and save you money. Bad experience elsewhere.  This will now be my go to for anything mailing, packaging related. I appreciate the service.","date":"2017-12-02 18:53:43"}
{"review_id":"3_yM3UxgHMYd-osLd1Sktw","user_id":"mY3mROf28N-vY1fpR-FFUw","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":4.0,"useful":9,"funny":4,"cool":5,"text":"Loved the Bakery.. Finally decided to try the Daddy shop - Bouchon (The Restaurant):\n\n10th Floor, Venezia Tower.. Walked in here for Brunch. The place had a Classy Decor, Very Professional Staff and Clientele were mostly Upper Class looking individuals. \n\nStarters:\n\nBread with butter, jam and ketchup?!: Bread was shaped like a branch with leaves.. something like that. It was hard but the inside was soft and tasted fresh. The butter was kinda hard too, the jam was pretty good and the ketchup I guess was for the fries to come? Who eats bread with ketchup?\n\nCheese Danish - Looked like a croissant shaped like a muffin, with a dab of some cream cheese butter on top. This was So Flaky\/Soft and the cream cheese butter lightly spread throughout was perfectly balanced.. This wasn't your ordinary cheese danish (pre-packaged grocery store bought), this thing was Superb!\n\nCroque Madame: Toasted ham & cheese on brioche with a fried egg & mornay sauce. Served with pommes frites.. Sounded quite fancy for a breakfast dish - In Layman's Terms = Ham & Cheese Sandwich with Egg and Fries! Toast tasted like a really buttered croissant with an airy texture. Ham & Cheese wasn't the oscar mayer ham nor Kraft cheese I use for h&c sandwiches back at home, it was much more gourmealicous! Plus, with the fried egg, more like a sunny side up egg and their white creamy\/frothy sauce, makes an Incredible Sandwich! Fries were served as a generous amount and were plain good. \n\nCorned Beef Hash with eggs and toast: Corned Beef hash came in shallow bowl with a blanket of overeasy eggs practically covering the hash. I scooted over the eggs to try just the flavor of the corned beef. They were little cubed chunks sitting on top of some pretty tasty juice\/sauce. The cubes tasted and had the texture of ham. The juice\/sauce gave it a great beef flavor but not the usual Real and typical corned beef I'm used to having. Nevertheless, it was Good. The toast were thick and had a buttery flavor and reminded me of a Crouton. Like a Toast Bread Shaped Crouton?!..\n\nFancy  Place, Great Service, Delectable Food But Came with a price.. $83.00 for 2 including 11.00 Tip.. Oh, it did include 2 Mimosa's! Cheers!!","date":"2010-11-22 05:17:02"}
{"review_id":"ZcnL48alXyRX5iT-Wh4AYQ","user_id":"7ofjFxZy9vlKSbQf2WgtHg","business_id":"hIUKufhwR6Ifn7bi0-phLA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Everything is always good. The smell from the bakery is amazing. Be sure to go early as it gets very crowded and is small.","date":"2016-07-14 19:39:32"}
{"review_id":"ycda1y1EvZ5EI9azc1Jukg","user_id":"BZPycUvKS65gIgftMF9pCQ","business_id":"pKUNAEeUGjeEE0pFzhZlxw","stars":5.0,"useful":3,"funny":0,"cool":1,"text":"We have been going off and on for over 10 years with my inlaws who are members.  Pastor Dave is a very kind and approachable Pastor.  He married my husband and I in 2004 and baptised my daughter and two nephews.  Just recently we renewed our wedding vows with Pastor Dave in a very intimate, religious ceremony which was important to us.  The church is very traditional and we like attending with my inlaws for all the holidays.  I love the music ministry and my daughter has been attending a summer camp for three years.  I highly recommend this church.","date":"2014-06-27 23:16:28"}
{"review_id":"W6PVE6vdO4oxpwqKofIZ3A","user_id":"JFAnoh8FVj6BufPrssvBCg","business_id":"VlMRR74NjdysPIfaUUSoBA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Outstanding place to eat.  I ate here several times and service was always timely.  Food choices were sufficient and prices acceptable.  It can get crowded when the place is full.  Unfortunately it's a small restaurant.  I understand there is limited space at its present location but if the set up inside was roomier the setting would be better.","date":"2017-12-02 19:43:03"}
