{"review_id":"ezBhqKcg_4H84ii9Q7dGRw","user_id":"i5WMqdq2vzi-U4W2aHhlNg","business_id":"KsYAGLP4yC7FbfixaeCHsA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Food is good, nothing extraordinary, but tasty and this restaurant wins all its points because of convenience, since it's open, cooking fresh food, 24\/7. A favorite for late night, absolutely.","date":"2012-02-01 05:26:47"}
{"review_id":"Fghrx7OnFJhLGdnbYF-KhQ","user_id":"4n_W8porGZjlmLk-wi5DdQ","business_id":"IWsrQ4-AtZuFJdYzIztMZw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great experience! Love Amanda R! She is always sweet, energetic and friendly. She goes way above and beyond! Mornings she's not there are always a little duller- Amanda R adds the sparkle to working out!","date":"2017-01-27 19:35:16"}
{"review_id":"nl-QNdEPM6Kz58gt94xMmw","user_id":"8qY0rSk-AUtCAl8th4ru2A","business_id":"7v91woy8IpLrqXsRvxj_vw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"yay! another school. I love the spot in liberty village but the brunch rush always kept me away. \nThe menu here is slightly different but of the same ambiance. It's delicious and indulgent brunch food served well. I haven't gone for dinner, only brunch. \n\nI had the pulled pork benny (meh- the pork was dry and the egg was well cooked! which they replaced with a runny one when I asked), but the french toast was killer! the candied bacon was also totally worth the visit. Would go back and try other things. \n\nPork benny was meh but the french toast was heaven so it gets a 4.","date":"2015-06-08 18:17:58"}
