{"review_id":"GiMzuG-2toWBxoDoWPkqdg","user_id":"-pXs08gJq9ExIk275YLvPg","business_id":"uLyeGUKKi_hDlnhEEqsDPA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"this spot has an ample supply of different products for the painter, sculptor, draughtsman and artisan in you.  they seem to have a bit of everything with a decent supply of many different products.  if you want to be sure that you get all that you need in one spot, perhaps your needs might require more specific tools or products, then there inventory is not as extensive as other art stores in the city.\n\ni noticed, though,  that they had quite a few products for kids whether itd be plastacene type products, crayons or something simply for fun like build a monster kit.  \n\nand if you need stuff for a party like streamers and the like or perhaps you are going to a party and you need a card, well theyve got that too.","date":"2008-12-03 20:42:28"}
{"review_id":"jH3BkQo0X5PwjCWPzqJ2pA","user_id":"gqn_YgUm08MEjYhWo1nRsw","business_id":"3Qlf9gw16eV-Mg6pJHlKuA","stars":2.0,"useful":0,"funny":1,"cool":0,"text":"This place is really falling apart.\nThey did put up a big mosquito net in the one bottle-service area though.\nAnd since the other cooks left they now have food again.\nIt's just really dead and boring and the one DJ is shit but Paul is great.\nNote that I only talked about non-stripper things? Yeah, that's because the other things are the best part of this place..","date":"2015-08-19 10:45:54"}
{"review_id":"OrZ1TlKflw0iQ9lm8uHtlg","user_id":"4iuTVX-ImR6_MameAXIgXw","business_id":"emMNb3q6cbEDZyc_JAgoww","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I was in town visiting over the wekend and stumbled upon this gem!\nI was amazed that it had only been open for less than a week!\nBeing from New England, I stopped in to watch the Patriots game.The Video presentation for the sports were second to none.\nIt didn't bother me that I was the only Pat's fan. The ambiance, energy, and professioanlly trained staff, made me feel right at home.\nThe selction of beers were amazing, as well as the food that I sampled! I would pit their burger against any other high end burger joint that I dined at.\nI even challenged my girlfriend to a game of Billiards, because I was having so much fun there. \nThe icing on the cake were the reasonable prices! I didn't get sticker shock, and it the experience didn't burn a hole in my wallet.\nIf I lived in AZ, this would definetely be my new hang out!","date":"2012-01-03 15:14:58"}
{"review_id":"REp5EAFUo7L_OC4LKWVh8g","user_id":"A-5DQIIb1YfQEBmabv-6Fw","business_id":"LkMtMHVetws5_7QfRjPtlg","stars":4.0,"useful":2,"funny":0,"cool":1,"text":"After reading some of the reviews here, I'm wondering if I stayed in the same hotel.  Stayed here one night, 7\/15, got an incredible price ($18!), fantastic room on the 26th floor, and couldn't have been more pleased.  As a local you get 25% off the food automatically, only one I consumed was the Sunday dinner buffet, and it was really good.  Gambling doesn't interest me, and I didn't come here to dine, but as far as a place to stay, it was an incredible deal.  Room was clean, nice, great view. loved the built in table along the length of the window (I even saw my laptops smile).\n\nGreat bargain, no resort fees, good base to take off from...","date":"2012-07-16 02:03:45"}
{"review_id":"ouYQOkjuzAFYZyudvJKJuw","user_id":"xS6kmkMXp0PRrFwkSWq2-w","business_id":"jYB3FHXjS491zFlCoLZ91Q","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"We ordered almost everything on the menu. Because we love sushi and hibachi and were excited for this restaurant to open. Only to be disappointed. The quality of the food and the flavor was not there.","date":"2018-07-26 12:21:00"}
{"review_id":"eUNUB-74We6DYZyNPlb20A","user_id":"ISirqOjZ0HRaKJqbIuhGRQ","business_id":"wpws2fFdsSvyPAsPAfIxaA","stars":3.0,"useful":3,"funny":5,"cool":1,"text":"I found this whole concept a little bizarre and a good representation of annoying Vegas clubs, with the bonus of being in more advanced states of undress. You get the privilege of paying to enter, paying quadruple for drinks, obscenely loud music, and plenty of drunk twenty somethings bouncing on the deck chairs. But hey, it's Vegas, it's hot as the surface of the sun, and Foxtail has a pool. So there's that.","date":"2015-08-19 12:21:15"}
{"review_id":"Tk-aYVTut2BNTV_0C7_dRw","user_id":"ZLS7cwa1UplSB8nRrwrHIQ","business_id":"qYiVyZrgbzxcBxuUgfPyHg","stars":3.0,"useful":10,"funny":4,"cool":11,"text":"Looks inviting from the outside.  After glancing through the reviews I was good to go.  I am glad they offer a separate dining area besides the seating at the bar.  I was having a late lunch and didn't feel comfortable enough to hang with the happy hour crowd.\n\nVery attentive service, nice menu of options, daily specials and soups.  Too many choices to look over when you aren't quite sure what the specials of the house are.  I opted for a baked Italian hoagie that wasn't baked.  The meat was grilled but that's about it.\nI was surprised  to see that their portions do not match their prices.  I asked for a half of a hoagie and was told that the 9.99 is the half hoagie price.  Meat and toppings were very sparse. \n\nHalf hoagie,  1 beer, and cheese bite appetizers came to 22.00.   I like the surroundings  and service but I might need to rethink what I order the next time.","date":"2017-01-27 22:24:23"}
{"review_id":"gKCVOzzVPCWhErIQ7m8AJg","user_id":"6a68uJTE0vCNdHfDGv2uyw","business_id":"lUG4i-s3zNFY1f6bEnTfqg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Jenny is a miracle worker!!!!! I had a very bad color done at another salon. I didn't know how much she would be able to fix it. She stayed late n made sure I left happy. Best color I have ever had done!! See Jenny for your color it will be the best decision you could ever make for your hair!!!","date":"2013-12-28 22:10:46"}
{"review_id":"RMX0HyMhbjeXUhXMlq9Xkw","user_id":"WZIktXq5R9aK-ez0ZL_rkA","business_id":"HMifRnUrqrMoQXKCOXYfPA","stars":5.0,"useful":2,"funny":0,"cool":1,"text":"This location is not only excellent in service, but the cuisine is expertly prepared and presented. The owners are friendly, and give their customers nothing less than phenomenal service. \n\nAs a growing business, I recommend it to anyone who wants a quick bite to eat on lunch, but wants genuine BBQ, from grill to melting in your mouth. I thank the owners for this exceptional service and cuisine!","date":"2018-03-15 19:19:46"}
{"review_id":"BLXCp23juNe_eETDnGGOBA","user_id":"0Msh21ZFXJwZejypXjmKyg","business_id":"EjzMHfwqAmj7BgdzQjquRQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"This review is based solely on the food. Service was 5 stars, but we probably got such great service because we were the ONLY people in the restaurant. I ordered the special Cuban Torta, meat was a bit on the skimpy side and flavor was very lacking. No salt or pepper on tables so we had to ask for it. Portion to price ratio is way off, ordered rice with my Torta and after 3-4 spoon fulls rice was done. To sum up this place I'd say it's best for drinks and appetizers.","date":"2017-08-07 21:13:24"}
{"review_id":"U5GuAgWQffcgqgpbe6KjxA","user_id":"Q3wAsfTIi1PMqyTqUMmEjQ","business_id":"V2oe1HVgNK0He9Mf3Q17AA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Are you craving pierogis? All Pierogi Kitchen is the place to go to fulfill that craving! The pierogis were authentic, made fresh in house, and filling. Every bite was deliciousness. All of the pierogis tasted good and we even recommend trying out the dessert pierogis. On the outside, the building looked sketchy but we were glad we weren't deterred away. The restaurant inside was clean and had a homey vibe. The service was attentive and friendly and we recommend checking out the market attached to the restaurant.","date":"2018-05-28 21:48:56"}
{"review_id":"D2oYk9ipsvsYP_ls0aL9kg","user_id":"9IA3P3DxrZcoAl29IYOloA","business_id":"eU_713ec6fTGNO4BegRaww","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"It's on Mt. Washington, but no view.  The inside looks like a fire hall set up for a wedding.   It is so loud that I sometimes can't hear my dinner partner across the table.  But none of that matters when you taste the food.  The pasta is outstanding, and served in enormous, enormous portions.  The menu is a bit cryptic - dishes aren't really described, only named, so make sure you know what you're getting before you order.  \n\nAnd it's BYOB, so don't forget your wine!","date":"2009-08-03 20:21:18"}
{"review_id":"3osm50V2lt77vmpNORkXkQ","user_id":"vLTlc4X6V8swHElcfxfpxw","business_id":"cxsN3mkioAXuOLKy04QpyA","stars":2.0,"useful":5,"funny":0,"cool":0,"text":"If Giordano's is looking to compete with Lou Malnati's, they are going to have to improve their dough recipe. The crust tasted like a flaky hard biscuit which is not pleasant on pizza. Lou Malnati's dough has a wonderful yeasty dough flavor while Giordano's doesn't taste like much at all, same as their garlic parmesan french fries. C'mon give us garlic, we can handle it!\n\nTo someone who just shoves food in their face and doesn't overly think about it, Giordano's is fine, but if you consider yourself a pizza buff you will probably be let down after the fourth bite. \n\nOverall Giordano's is not horribly disgusting but it isn't impressive either. They could also stand to hire extra staff to be refilling drinks.\n \nIf you're looking for a truly spectacular pizza, do yourself a favor and go to Grimaldi's.","date":"2017-01-02 06:00:14"}
{"review_id":"hJf4vtp2_QUwBpPVK9uxUQ","user_id":"q22jmWdW9iQhGByTfJQouw","business_id":"KTPRYqiFdLowAUEAnN7e3g","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Four of us went during the first few days this restaurant opened. we ordered the fries (delicious, with rosemary and salt) and each ordered a burger. I had the steakhouse which has a red wine sauce and was really very good it came as I ordered medium well. The other three people who were in our party all had a problem with the way the burgers were cooked. Everyone else's were too overcooked, my parner's burger was cooked to a crispy well done even though she had ordered it medium. \n\nOur waitress was happy to send my partner's burger back and have it made correctly. Our waitress also seemed very nervous and seemed on the verge of a nervous breakdown.\n\nOverall I liked my own burger but was unimpressed that 3 our of 4 burgers that were ordered at our table were cooked incorrectly. I will likely not be going back to this restaurant. I felt it was also a little overpriced. \n\nFor a great burger I will continue to go to Tessaros","date":"2011-02-13 23:21:11"}
{"review_id":"Jfd8e_JjmNhrpr0jRm8Eww","user_id":"xVV86BToDOQGxE1gt9MMvg","business_id":"BmV0ZAdepydSujYJH5_EQw","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"Ever since Tsujiri opened up, feels like a lot of copy cats are opening their own, or had the idea to bring over a brand from Japan. To me, it's ok. As long as you do a good job I don't mind buying from a copy cat. Saryo is a 2 in 1 shop with ramen (Konjiki) and the Saryo café. This review is for Saryo.\n\nI'm a matcha fiend and have to politely disagree with all the other reviewers praising Saryo's matcha. It really doesn't compare with Tsujiri. Tsujiri has a much longer history of doing matcha and Saryo's matcha is simply not the same grade. High quality matcha is supposed to have a subtle sweetness in addition to a slight bitter taste. Too bitter does not mean it's better. Saryo's matcha soft serve is simply not as pronounced and lacks that subtle sweetness I would expect. The texture is also a bit more runny than I would like. \n\nAlso, their selection is much smaller than Tsujiri and most of the pastry items are a notch worse than Tsujiri. \n\nCustomer service wise, I can't get over one of their servers. It's a guy named Taiki I think. Horrible service. If you want good matcha drinks and desserts, definitely go to Tsujiri instead. Prices are about the same but you get less quality at Saryo. I might try their houjicha as that seems to get a lot of praise.","date":"2018-02-01 19:07:08"}
{"review_id":"YQEy-o2pK-hkz_i-v2WKwQ","user_id":"hJOQS1Q8MHb_RB9woTgu4A","business_id":"XSZgcEMWM4XcuE-sWXny9w","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"If you visit Calgary, you must make a point to go to Charbar. The building itself is historic, formally an industrial building, and its juxtaposition to all of the newly constructed skyscrapers make it stand out. It's an overall beautiful, and beautifully decorated, restaurant. My husband and I sat down for an after-dinner drink at the bar and were pleasantly surprised by the wide wine, beer and cocktail selection. We also ended up ordering the yucca fries, which were to die for. Our bartender Andrew was clearly well-versed in all of the selection and made great conversation! We also had the opportunity to meet the restaurant manager, Tyson, who was more than willing to let us know more about the building's history, what they have to offer and very knowledgeable about food\/drink. Everything from atmosphere to customer service to menu offerings are 5 stars!","date":"2018-05-28 23:09:07"}
