{"review_id":"wDSbFPvxhtnD0PzHax1j_A","user_id":"Si5RL2XGrI3KdfsxGUsPuA","business_id":"ZD2GKnnauQxEmPre3IHBBw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I wasn't aware that it's a state law in PA for phlebotomists to only be allowed to try taking blood three times at one time. Whoever the woman was that I was assigned to could not find a vein to get blood. This was important for medical reasons to get done and she was very unprofessional and rude. I recently moved to PA from Ohio, so I didn't know a phlebotomist here can only try three times. I kindly said to her 'can I ask why you can only try three times?' And she gave me a nasty uncaring look and replied quickly 'because I'm not a doctor'. After I left, all I could think was no shit you aren't a doctor, it's not a doctor's job to take blood, it's your job( a phlebotomists' job). I thought it was very unprofessional. I've never dealt with someone in the medical field that didn't truely care or have passion for helping me, especially if I ask a question. I don't remember her name, and if I did I wouldn't put her name out there. I just wish people would stop and remember the reason why they chose that field. Yes, money is great for most of the opportunities, but you really have to care and want to make a difference in order to be successful in the medical field. Even if someone asks a stupid common sense question, just remember there is a reason they are choosing you to ask. If someone asks me anything, I feel honored because they care about my opinion and what it is I have to say. Just saying, sorry for rambling!","date":"2018-05-08 17:15:07"}
{"review_id":"pig_E9F1LQbJcXwwEQN1Kg","user_id":"Wp-IrBCNqSc2r3LrPZQjXA","business_id":"LkmRdUKz7cKNls3BpKHxRA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great Mexican food! We had green and red enchiladas. YUMM! Beautiful white Burgundian wine offered by the glass. Lovely ambiance. Ask to sit FAR away from the door in the winter. Or upstairs. They could use a heavy velvet curtain to block out that cold Montreal air! Thank you so much for the lovely dinner and good service.","date":"2017-01-14 22:13:02"}
{"review_id":"LId8Q5LZlYk8AeOJeiDOyg","user_id":"i86VvQuwn4sFvsiuwmJwcw","business_id":"4dWhd2lHIELpI0XTvs8_8A","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Great food. Great service.  Love this place.  I tell everyone it a must stop if you are a foodie!!!","date":"2018-04-15 12:07:22"}
{"review_id":"GJ60uYK2N1TWbRVPn_0h_w","user_id":"jCuD5qF7faKsdiXJ5Ow-mg","business_id":"iyFS4twFjCKfaKl7kUl3sg","stars":4.0,"useful":0,"funny":1,"cool":1,"text":"My normal lunch routine has consisted of cheap, fast food contraptions and bowls of Progresso soup. So, a change in food was very much needed. My co-workers mentioned this restaurant a while ago. Today, I decided to feed my culinary curiosity and order lunch for my co-worker (aka my lunch homie) and I. Harry's Grill and Tavern, here we come! Here are some of the items that we ordered :\n\nMapleleaf Farms Duck Wings w\/Bourbon BBQ sauce and Jicama Slaw\n\n1) Initially, the chicken looked a little parched. Last night's chicken? Ummm, I hope not. However, the taste was decent. Portion size was good. \n\n2) The Jicama slaw was an excellent take on slaw. Traditional slaw (cabbage) can sometimes become very boring. However, the Jicama put a nice spin on it. The lunch homie, though, with her traditionalist, non-risk taking tongue, let the slaw fall gently from her mouth. You can't please every palate.  \n\nSmall Mixed Green Salad with Raspberry Vinaigrette and Mac - N - Cheese - Lunch Combo\n\n1) Harry's Mac - N - Cheese was the greatest joy that I experienced during this meal! The consistency and texture was great...not too dry and not loose...just creamy goodness in my belly! The levels of cheesiness was outstanding. And the light sprinkling of panko crumbs provided that last bit of contrast and crunch. The Comfort Food gods have bestowed their blessings on this particular dish.\n\n2) Bought the Small Mixed Green salad to eat for dinner. The portion size definitely small, but it's packed with some good stuff. Can't wait to get my greedy hands on it later this evening!\n \nHarry Old Fashioned Burger with a side of Sweet Potato Fries\n\n1) My lunch homie ordered a Harry's Old Fashion Burger with a side order of sweet potato fries. I snagged a few and they were good. I've ordered sweet potato fries at other establishments and I've always needed additional condiments (i.e. Honey Mustard sauce)  to add some taste. However, we both agreed that these fries were great by themselves. The slight sweetness of vanilla gave the side item a little more depth, while the salt reminds you that it's still a fry.\n\nShe was less enthusiastic about her burger, though. I believed she said that she had better times with a BK Whopper. Hey, I'm not a burger connoisseur,  so who am I to judge? The presentation of the burger was well put together. Wasn't sloppy or unappealing. Just your typical pub burger waiting to be consumed.\n\nAll items were moderately priced. My tab totaled to 31.12. Our lunch take out order was timely ( ready in 15 minutes) and accurate. Great location and if you're a non-parallel parker such as myself, they have easy access to the restaurant from the parking garage.  I will definitely return to see what Harry's has to offer for dinner and brunch. I must try the Lobster Mac - N - Cheese!!!","date":"2016-07-14 20:03:15"}
{"review_id":"dx_hw7EjxPh8ro6fBce0FQ","user_id":"lhes2tqK_N6SP9lkBjRk1g","business_id":"9JN_Ox5SJp46Ck9MrnYGOw","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"after incurring intense lower back pain, I searched for a good chiropractor and discovered Dr Warkentin at the rateMDs website (under the Top 10 Chiropractors in the World) - what astounded me was that he had about 350 reviews (412 as of today), absolutely dwarfing the number of reviews for all other listed chiropractors - I also found out, to my surprise, that his clinic (actually a full-scale wellness center) was only about 15 minutes away - I made an appointment and was able to see him the same day - I had a full set of X-rays done - Dr Warkentin showed me the pertinent X-ray and provided an unrushed and thorough explanation of what was causing the pain in my back - he also pointed out areas that could lead to problems down the road - I was then put on a roller table, received electrical stimulation, had some adjustments done, and concluded the visit with cold laser therapy - subsequent visits added use of a spinal decompression machine - I also received instruction from his associate Dr Wolsey (who has a master's degree in Exercise Science) about how to strengthen my core muscles to provide support for my spine - after about 2 weeks worth of visits, about 90 to 95 percent of the pain was relieved \/\/ I've seen other chiropractors in the past - how Dr Warkentin conducts his practice blows them out of the water - it's evident his goal is excellence in terms of the quality of care he seeks to provide and the physical environment in which it's done (e.g. the patient restrooms resemble that of a luxury hotel; also, there is meticulous attention paid to upkeep, which explains why his large facility still looks new after 8 years) - in addition to being very personable and super sharp, Dr Warkentin is extraordinarily skilled at diagnosing conditions, going well beyond what the normal chiropractor is capable of doing (he's caught life-threatening problems that patients' physicians have missed, even though they're not in his official realm of expertise) - he attends surgeries weekly with some of the most skilled doctors in the Valley (neuro, spine, cardiovascular, etc.) to enhance his diagnostic capabilities - Dr Warkentin also has a desire to give back - e.g. he goes out of his way to provide affordable care to fire dept and military personnel - another example:  he took a week off earlier this year to provide his expertise on a medical missions trip to Africa \/\/ Dr Warkentin sets an example and standard of what quality medical care should be like - he doesn't market - he obtains all his business by word-of-mouth - and having experienced first hand how he treats his patients, I now understand why his marketing budget is non-existent - some of his patients fly to his clinic to be treated by him, rather than visit a nearby local chiropractor - you can add me to the list of his fans - almost forgot, one last item to mention: on the day of my initial visit, Dr Warkentin gave me a call later in the evening to see how I was doing  - it was completely unexpected - how many doctors bother to do that? - a most well deserved 5 stars!","date":"2015-07-16 07:10:39"}
{"review_id":"viJ05oYVfHa6MsBG8-jTIQ","user_id":"Q1upwqBn2zS4EIcrZoTo5w","business_id":"IrLTMLWZI1CzjXGQdjN1_A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"very helpful and does excellent repair work at very affordable prices. Good selection of inventory as well. Probably the most reasonable fees for repair and replacement work in the Valley.","date":"2014-08-10 22:16:15"}
{"review_id":"0ETdGS_uFMbeW21LoAVoYw","user_id":"bfkaY3bXPWkescqFQHpEpQ","business_id":"RCX3zz86OvwqLCr6X290EQ","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Was in the area, and I'm more into supporting local shops than chain. Read a couple of reviews and they seemed fair enough to give it a try. Got the steak sandwich with provolone and mushrooms. Was okay, not much flavor in the meat. I will add as well this place is a bit pricey for what you get , $11.00 for a full sub and a drink is kinda high. Over all it was good, I'd say the best was the bread, soft and fresh can't ever go wrong with that. Would I return, probably not, if they adjust the prices and have more lunch specials that are worth the travel then I probably say I would come back and try many other subs.  At least a daily special from 11-2, maybe $7-8 bucks for a 6 inch, soup and a med drink. I'm sure my one review is not gonna gear people away from coming, but if your on a budget this review might be helpful.\n\n\"Focker Out!\"","date":"2014-02-05 20:43:10"}
{"review_id":"F0jSh-yHFvxbw7WI6exXiw","user_id":"1Cy52zRNZ46rfLM81iaYXw","business_id":"sCPNcNxYuTnTdlAZohMyQg","stars":2.0,"useful":1,"funny":0,"cool":1,"text":"I went to Museum Tavern last night for summerlicious and was really disappointed.\n\nService: 2\/5\nWhen we arrived we asked if there was space on the patio and we were told that there was not, and everyone on the patio just arrived so he wasn't anticipating that there would be space any time soon.  So we took a seat inside only to find 2 groups had left the patio 10 minutes later.  We would have waited for a patio seat if we had the option as it was a lovely night.  \n\nWhen we were greeted by our waiter he told us that we could only order off the summerlicious menu.  But throughout the night, we saw many people ordering burgers (that were not on the summerlicious menu), so I'm not sure why everyone other than us could order off the regular menu...?\n\nFood: 2\/5\nI had the buttermilk fried chicken as an appetizer and it was good.  My food rating would have been 1 if not for the appetizer.  My boyfriend got the duck buns and said my appetizer was better.  The main course was the maple baby back ribs.  I was looking forward to these all day and was very disappointed.  They were way too spicy and not cooked very well.  Ribs should be falling off the bone if cooked properly - these definitely were not! There was also no plate for the bones or wet naps for us - but that has nothing to do with the food, but more to do with the service.  For dessert I had the brownie ice cream cake and my boyfriend had blue berry pie.  The pie had no taste and was infinitely better than my cake.  The brownie part was so hard that I couldn't cut into it with my spoon.  After two bites (my b\/f had to cut it for me!) I decided it wasn't worth the effort - and thereby made history, as it was the first time I've EVER declined a dessert!\n\nOther:\nThe restaurant was nice inside but not nice enough for me to return.","date":"2014-07-13 14:26:10"}
{"review_id":"i-2fHvThIXKt2LTSmzCJ0g","user_id":"DPJsO89jaPFSjWsTGAe0vw","business_id":"QvyG5fZ0mxo5yeLY8jabCA","stars":3.0,"useful":0,"funny":1,"cool":0,"text":"Place is OK . Met here for happy hour on a Friday! Coronas were $3.50 and the food was well priced! Got four \" mini chimi's \" for $5 and our group of four people split the Mexican pizza $8 which was large and we had left overs! Place just seems like it has seen better days? They had garbage bags over the stools outside which was odd.  Music was odd as well played the grease sound track the. Lil yahty? I would go back just to much on some food and leave.","date":"2017-01-14 22:21:58"}
{"review_id":"eecnb85fou4MI-nVtUh9-w","user_id":"OKlIkCZkth5_5onodbMe7w","business_id":"0EUohlWGBPnIgzCULyWl7g","stars":1.0,"useful":2,"funny":1,"cool":1,"text":"If I could give this place negative stars, I would.  It Sucked!  My girlfriends and I were given free entrance and we were promised free champagne if we showed up between 11:00 and 12:00.  We showed up at 11:40 and they were out of champagne, and didn't offer us any other free drinks as compensation.  That sucked since the free champagne was the only reason we were going.  Then I asked for a water, and they tried to charge me $5 for a bottle of water.  They wouldn't give me tap water until I lied to them and told them I would vomit if they didn't give it to me.  Seriously - what kind of a place hands out free champagne until it's gone, but won't give out free water?  It's like they want people to get out-of-control drunk.  And to top it off the bouncers were jerks.  Please don't go there - it's a waste of resources.","date":"2010-08-20 22:04:55"}
{"review_id":"9mfIrZiDnGExRsDaM2aHrg","user_id":"SkpCulULgiBfLc4lV8vx2g","business_id":"CvsTfS2pIWwZbwusZL4x0Q","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I had a very nice lunch with a client. I tried out their new pesto chicken pasta dish. The side salad was a bit of a disappoint for the price, maybe because the plate was not big enough to actually toss the salad!! ha\n\nLocation was a nice size, clean and the staff were okay!","date":"2013-03-18 17:41:21"}
{"review_id":"cexg2fzTYIzyxh59jux5wA","user_id":"noG6Ly8wqvfrD8zb5vQ36g","business_id":"xzj6q131hJE59tBkhe3Gag","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"This place is uhhhh-mazing and delicious. Everytime I come, I am never disappointed in the food. It is pretty packed, but I still come because it is that delicious.","date":"2018-04-27 19:31:39"}
{"review_id":"BKJeJE2Fnz-73CZDr4tYcw","user_id":"XU-JR0vGW1_O5GmNwZ0bfQ","business_id":"IhNASEZ3XnBHmuuVnWdIwA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Location: located in the Albertson next to a vapor store. Plenty of parking space. \n\nDecor: nothing special. But clean and their service is great. If you do not like your drinks, you can exchange it with no question asked. That's great customer service especially if you pay $6 for a drink. \n\nDrinks: their specialty is Fresh Brewed Tea. However, they also have smoothies and coffee too. Their smoothies are not from fresh fruit so do 't expect healthy fruit drinks. The coffe is OK, not strong enough for me. My favorite drink here is the Jasmine Latte. I love how you can customize the sweetness, or add any toppings. \n\nPrice is expensive for tea drinks. But you get what you pay for: freshness, great taste tea and service. \n\nWill be back and for that I give this place 4 stars!","date":"2017-09-09 00:56:06"}
{"review_id":"4pSXJdTObT-45XXl2DZlzA","user_id":"6mvqgw366KwYzXUFuzrHYA","business_id":"W1l_hf4j2uvvxA5h1KW6Fw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"It's great to have mobile service come to you. I appreciated T&A returning my call within a few hours. Taylor and crew provided quick professional welding service to our new RV. Our welding work was neatly done including marching spot paint to protect the new welds. My only complaint is arrival time was 40 minutes late. Service charge was very fair. We are happy campers!","date":"2015-06-08 17:07:37"}
{"review_id":"2g-dcy4IEyDZ-R0MMVKZBw","user_id":"JY8zWgPoaQiFZD5B-0gIfQ","business_id":"2SfSzEd3B7WimeZac23zhg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Ordered food to go, so I haven't had the full experience, but as far as I'm concerned, I love this place already. The Florentine and the Smoky Eggs were both delicious, although they didn't come exactly as described in the menu. Customer service was on point from the moment I walked through the door until I left. I sat on the patio while I waited for my food and soaked up some of the sunshine. It felt like I was back in Italy. Great vibes all around.","date":"2017-03-03 18:28:57"}
{"review_id":"S1OF_WbnJCrhR1I0BZ30Bw","user_id":"HIi8Jg_rNTVVelGCuSEX0g","business_id":"ynmTXY9yJDiNkO4HUmxRSQ","stars":2.0,"useful":2,"funny":1,"cool":2,"text":"Service is good, but the food is just disappointing. Didn't live up to the expectation at such a high price ($45\/person with tip and tax). Won't consider coming back again.","date":"2018-07-17 00:30:52"}
{"review_id":"FoACK9xhdLObjJHd0K7bgQ","user_id":"bhAjXNZfIK7hLFnEWCHQVQ","business_id":"XxX2LZ2o9p9Wlq7noOcfNg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Probably our favorite restaurant in the area. Great food great prices and always a fun environment. We've never had anything we didn't like and you can't beat the beautiful patio views of LKN any time of the year. When our family comes to visit from NYC this is always their first choice for dinner, sometimes even twice in one week!","date":"2016-04-11 17:15:39"}
{"review_id":"0yYinf6lcINQtx_VS_YVhA","user_id":"t5VR4WEL0R4quI1R-oEDDw","business_id":"dndpsDRu_4XcuwM_0mq9_Q","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Took my car here over a year ago and again, recently, just prior to selling it. First time I just needed the interior cleaned so I requested the interior detailing and they did an amazing job- they were able to remove all traces that my dog was usually my co-pilot and the interior was spotless.  The second time I had both the interior and exterior cleaned and again- perfect job.  I will definitely use again and would highly recommend.","date":"2015-08-06 22:33:09"}
{"review_id":"fosBO-sA93xWO60K7BxLpw","user_id":"kj88nbbMo1bOfYrGBrgQmw","business_id":"sZsJooAzpKqOvDysphkqpQ","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"This is my last stop on the reign of terror of vegan hotspots in downtown Las Vegas.  It's a pizza shop in the plaza hotel with a vegan slice called the soho.  It's pretty majestic, including spinach, artichoke, and the Daiya cheese we all love.  The crust is chewy and delicious.  At other times (like daytime) they offer a vegan soft serve in chocolate and vanilla.  In my case, my 2am pizza trip also featured a drunk twenty year old hitting on me. Thumbs up!","date":"2015-05-26 07:11:52"}
{"review_id":"RWK09drdD9gfXJjGXH-Qug","user_id":"vD3S6Klov8x1Ru60zjlHKg","business_id":"tInrGCzll4k9hF34Ye1rvQ","stars":4.0,"useful":1,"funny":1,"cool":1,"text":"Don't eat all day and go here to eat every animal under the sun. Above average salad bar but not the best brazilian steakhouse I've ever been to before.","date":"2011-07-28 13:32:43"}
{"review_id":"giTGLRkzCvVV4077aUy8pA","user_id":"5jf3SJVCPxHNrQXGZ2h-2Q","business_id":"80klSQFFKguEL76Zo8m5YQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The worse part about the Sofitel was having to leave.\n\nI miss the bed.  I miss the robe and the towels and the L'occitane products in the bath room. I miss the quite gym. And the amazing city views from my room on the 7th story. \n\nEvery detail of my 5 night stay was fabulous.  From the housekeeping to the concierge service.  The location couldn't have been better! The Peel metro stop is just steps away from the hotel.  Also, if you like to walk\/run Mont Royal is just up the street (at Peel and Pins).\n\nOur last night in the city we were too tired to go to dinner so we sat at Le Bar and enjoyed a flight of French Reds and a cheese plate with 3 different local cheeses.  Although it was slightly pricey, listening to Joe-Luis speak about the wine and food with his sexy French Canadian accent made it all well worth it :)","date":"2010-10-05 23:32:45"}
{"review_id":"GQxn7Z6VWdTRhZAsiIIpRw","user_id":"JcNSd3dXmIMVHP2CUpvMHA","business_id":"wRPPrmpvYowLHXmftrT5YA","stars":4.0,"useful":3,"funny":0,"cool":2,"text":"Absolutely best Trader Joe's I have been to so far in Las Vegas and San Antonio. First off Trader joes has amazing prices vs. Other grocery stores. The selections of pre made dips and different meats is the number one thing I  love about it. Its is one of the only stores that I have seen carry Hawaiian shorts ribs already marinaded!! (Mmmm). They don't have tons of produce but they do have a good selection. They have awesome bouquets of fresh flowers that are super cheap! Natural shampoos, toothpaste, ect. Dog food, wine, gluten free selections, and on on!!\n\nIn think it was such a great idea to hide a fake  parrot....or at this store it's a sea horse, to keep kids occupied while shopping. If they find the hidden Sea horse they get a treat. Yay!!!  They have these adorable little kids carts too which my kids loved!","date":"2014-10-27 04:24:57"}
{"review_id":"uMbgC_Ujkcf9OXBKLbZj4g","user_id":"6v4Mb2bKRY-FKr5so9ORhw","business_id":"2JU7FRlnYgdRauYyFzHSLA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"My coworker turned me on to this place. The place is a classic hole in the wall with good food. I had the burger, wings and fries all was delicious with a great price.","date":"2013-10-24 02:56:31"}
