{"review_id":"9zmvKOAfTMGI7BEluZq8Bg","user_id":"hSTQa4VovgWTil21ONgCng","business_id":"TFpiquSDJjJET6EZtpcv9g","stars":2.0,"useful":2,"funny":3,"cool":0,"text":"Rich is such a cool guy he could sell just about anything to anyone at a high price. He is also smart, so I think that is just what he might be doing. If you dont care about getting screwes on price, I think there may be a good chance you could be happy here. But if you are on a budget (arent we all in one way or another) then you may not appreciate their \"you have to come in before I tell you what it costs\" game and even when you come in they still dont tell you what it would cost, only that their guys charge hourly and almost as much as lawyers. That was not was I was personally looking for. Finally he tried to sell me a DIY polishing machine that he supposedly invented himself because he is a chemist, and instead of telling the specs he gave me some sales pitch how it \"circulates instead of rotates\". That was probably a salesmans way of describing what ordinary people would call an orbital polisher - that is not unique but he tried to present it as such which I percieved as dishonest. Sorry. So instead I went and waxed the car myself with high quality Meguilar stuff I got from Walmart at around $30 and now it is nicer than new!","date":"2016-06-11 21:48:53"}
{"review_id":"qh_XDEdRqiDerhJfLXIRmw","user_id":"D5cXnEn1rDN17bQYkPBNbg","business_id":"zunMkZ4U2eVojempQtLngg","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"I came in becaue I work around the corner and I always used to come in for lunch. Had the French dip or should i say a bread sanwhich. It would have been nice if the food came to me atleast warm. And if they are going to serve full size sandwiches probably is a good idea to put enough meat in there so you don feel like your just eating bread. I'm going to have to pick a news lunch place.","date":"2013-07-12 21:18:07"}
