{"review_id":"sgrWBH4rLE3tLfWtsu5gHA","user_id":"bGgobkuYRKZAgwg8km83vw","business_id":"0FUtlsQrJI7LhqDPxLumEw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"A great local place. Good food. Good atmosphere. Healthy. Only draw back is they are busy all the time. Good things are worth waiting for!","date":"2018-06-08 23:25:30"}
{"review_id":"bRK-2IMszaqG2r52GneWGw","user_id":"68p_UVmCk8FkZ_QAlvvJsg","business_id":"HKSyA7YZplj9i_vIdtwyzg","stars":1.0,"useful":0,"funny":1,"cool":0,"text":"I wish I could leave no stars. I waited in the drive through for 15 minutes even though there's a 60 second guarantee sign outside. Got no apology. Said to the girl 4 times what I wanted and assumed she got it right...which I should know better than to do. Got home and all of my stuff was wrong. I drove all the way back & got no apology and was told to wait in the drive through line again. Which took another 15 minutes. Never coming back. I'd rather drive to Henderson to get good service.\nIt isn't my fault that you have a mediocre job and hate your life.","date":"2015-07-03 22:11:00"}
{"review_id":"Q-07VtfeOrHrKgMSOe6Ywg","user_id":"A4bpHuvzaQt9-XAg8e9Msw","business_id":"cLx7rt6JTTMU6aO4kBPLnA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is the best Shawarma I have had in Calgary! (That is not something that I would say causally) ... and I was sober when i went there!\nThis was a fabulous surprise, ... until I tried the Falafel sandwich , ... Wow! \nThe best Falafel I have tasted on this side of the Mediterranean.\nTheir secret is ... Fresh ingredients, and traffic.\nThe service was great, I plan to go back again at an earlier time in the day to try the Foul.","date":"2017-02-09 05:55:00"}
{"review_id":"3kHqWLMrUAU3iK9-1dyRJw","user_id":"WD0pchQWVY5tBbPqRq4zjQ","business_id":"Vx9ePhbQJYGJaZqICXAPrQ","stars":5.0,"useful":1,"funny":2,"cool":1,"text":"They had a car available to me even though i didn't have a reservation. The transaction went quickly and I got a mid-size vehicle for the same price as I would have with a reservation. Mark waited on me and he was really nice. The car was clean and fresh! Definitely would use Alamo again!","date":"2014-11-12 14:46:47"}
{"review_id":"ViolQBwfrBmE1kinT43Fzw","user_id":"I1CWI5kEY0FujXnmMAB2pQ","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"So I put off writing this review for a couple months because I was kind of pissed. I want to be fair. We will start with the good stuff.\nWe stayed here back in June 2017. We, my husband and I, were going to Las Vegas for combination of Honeymoon and my husbands 40th Birthday. We invited some friends to join us. We ended up with about 20 of us there. We didnt all stay at the Flamingo. Only 6 of us did. Others stayed in time shares and other hotels. We are platinum members so we got to skip the long line, That was great. We chose the Flamingo because it was iconic. We knew it was a bit older and less expensive so we really were prepared for less fancy than other places. We were ok with that. Good thing too since our mini suite was quite run down and not very clean. Housekeeping obviously needs some training. But we didnt really mind. We had the Birthday party at Carlos and Charlies with all 20 of us. It was great and our waiter , Jason, was the best. We rented a cabana at the Go pool which was pretty nice but the mister in the cabana didnt work and just dripped water all over our stuff. Between my Husband and I and the rest of our party we spent many thousands of dollars. We had saved so we could do anything and everything we wanted and we did. It was great. At the point of getting our bags out of the room and heading down to check out I probably would have given them 4 stars. Quite pleased with the experience to this point....\nAnd that was the point where we discovered that the staff at The Flamingo did not want us to have happy memories. At the check out kiosk we discovered a charge of just over a thousand dollars that we didnt understand. We went to the front desk and were told that someone in housekeeping had gone into our room and noticed sleeping bags and enough luggage for about 6 extra people. -First of all, our do not disturb sign was up the entire time so no one was supposed to go in there at all.-  I told her that was a lie and we wouldnt pay it. She went in the back to talk to a manager and came out with out the manager and with no solution. She called housekeeping and was told the supervisor was not available but that they had pictures to prove it. I asked to see the pictures. They never could supply them. We had to leave to catch a plane but didnt pay. We had agreed with the front desk lady that it would be left as pending until the problem was resolved. After weeks of calling and getting no returned phone calls. Total run around. They never supplied us with pictures. It was a horrible experience. We found out we could contact Ceasars Customer Service so we did. They did call us back and said the charge had been removed. No sorry, No admitting they had made a mistake. It was more like just take it off to get us to shut up. So we dropped it because the charge was removed but never made happy. We will stay at Ceasars properties but never at the Flamingo again.\nI hope  it was worth it for you -Flamingo- to try to screw us out of $1000 because I can promise that no one in our 20 person party, many of which are Las Vegas regulars, or anyone any of us ever talk to about it will stay at your hotel. Ceasars is lucky that we love their other properties so much, especially Paris.","date":"2017-08-16 13:59:00"}
{"review_id":"zMYsJ0M6VLY55CL7Hazlrw","user_id":"RIbBl9J2tDRJ8aJAVNFWhg","business_id":"4qG3Gh8QyugC1XvoTlmgcQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"we updated our review and eggworks redeemed themselves----thank you=we had a wonderful experience on our 2nd visit-happy we gave it one more try. we will return an be sure to customize everything we order....) food took a long time to come out\/be served, but well worth the wait!!!!","date":"2015-07-04 00:54:50"}
{"review_id":"8x3D5RX6w5t_VbrP4NbLwg","user_id":"fs4Pkw8QABbkRDD5KXblOg","business_id":"lVN1516THpVQ7NtU7f-eNw","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"Only giving it a 1 because you can't do zero.  We get there and they put my husband and 70 year old dad right in the middle of traffic.  In a very claustrophobic booth.  We ask to move after ordering our drinks.  Took 20 minutes to get our drinks even after we told both waitresses and the hostess helped us move.  Pops and I both ordered the 16oz prime rib so we could have leftovers for lunch the next day.   They bring out our prime ribs and say our baked potatoes are on the way.  Pictures attached.  Almost half of it was fat.  I said oh my gosh that's a lot of fat.  Waitress says nothing.   \nPops and my hubby ordered salads and I ordered mushrooms as my other side.   They bring my daughters and husbands meals came.  A few minutes later we get out baked potatoes.   Hubby says where is my potato?   Well they had given him my mushrooms and he was well on his way of eating them.   So you would think I'd get new mushrooms right?  Nope.  Just slide the half eaten mushrooms to my plate.   Then we order another round of drinks and it takes 20 minutes to get a half chill fireball shot.    \nSo not a good experience.  If I'm paying $25 for a 16oz prime rib, I should get \"close\" to 16oz.  Not 8oz of meat and 8oz of fat.   \nAlso it's supposed to be unlimited bread.  How many loaves do you think we got?  Yup 1.  \nNot a happy experience.","date":"2017-01-27 22:16:46"}
{"review_id":"NLkAEsgeD4UVh2qN-0bebQ","user_id":"pQ8qmUnAZH0hYToenRS57Q","business_id":"_G1C1J-syqfRxD0tqTvEuw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Sunflower Market is hands down my favorite place to grocery shop EVER! They have an amazing selection of organic fruits, and vegetables. They have delicious soups everyday. They sell Boars Head cold cuts for cheaper than any other store I have shopped at. Their freshly prepared tuna stuffed tomatoes are banging. Their roasted red pepper hummus is the best I've ever had. Their frozen section is full of organic and all natural selections. Their beer selection is THE BEST, and they have a decent wine selection with really good deals.Their prices are better than all other natural grocery stores, and even better than some big name stores. I love this place!","date":"2011-11-30 00:12:56"}
{"review_id":"WEUl6a11EXHqEChS3egV9g","user_id":"JaqcCU3nxReTW2cBLHounA","business_id":"Os1n1_idfw9vv9kwULGJnQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Good food all around. The meal begins with complimentary sides as most Korean restaurants are known for. In addition to the usual sprouts, kimchi, etc. Island Style also gives you boiled peanuts which were a nice touch. I went wth cold noodles half and half for my meal. I really liked the dish, with each side offering a nice taste. I wish it could have been spicier but in the end I was contently full and very happy with my choice. $14 for the dining experience was well worth it. The restaurant itself had a very mom and pop feel and seemed authentic in every aspect. A very good option for eating in the area.","date":"2017-01-14 22:05:48"}
{"review_id":"5yCbTZ9wTyjTLjA4GxSlXw","user_id":"w0G2GjGZrrzSwOr__j4B4w","business_id":"L0T0tx47qXd15FOrLoKUng","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"Ordered on Ritual but was not rdy when i went there, the worker doesn't seem to be well trained and it was obviously too busy for the one worker. So not really the employee's fault. \n\nOnto the food, $15 for a plate... And it wasnt even that much food. This place not aight","date":"2018-02-23 22:35:50"}
{"review_id":"bh-2mZ_ZfRd4dhnbu7Y2JA","user_id":"WOw9TLTaTzJd4Do4MBbcHA","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I think there is a lot of mediocre food in Vegas.  Even the big name places-- dull.  Bouchon is very good but not quite outstanding.  I have also been to the Napa Bouchon, and would say the same.  Well, except for that side of butternut squash.  The best butternut squash I have ever had.  The pumpkin soup was great, the scallops very good but not great.  Our service was excellent.  We needed to catch an early dinner before the Garth Brooks show, and I was definitely pleased with our choice.  We'll be back!","date":"2010-11-22 05:21:18"}
{"review_id":"TYUOUKT1obeB3-rTt5_HQw","user_id":"xSiaSnRfXBVZstO9LBNRaA","business_id":"pGwfOqNEL8FbMUFspJdAMA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"The second most authentic Mexican experience I've had in Pittsburgh (see Edgar's Tacos in the Strip for the first).\n\nChips and salsa are brought to you as soon as you sit down, there are plenty of options, even for a vegetarian like me (that don't involve tofu, which has no place in Mexican food). It seems to be the only place around that has a wide selection of traditional Mexican beers.\n\nI find the atmosphere a little hokey, but I feel like that goes with the territory.","date":"2015-07-03 21:58:04"}
{"review_id":"vjgqcCdXLTEcTakFn1ZaoQ","user_id":"mC8ax89NE0gyAM3HMajo0Q","business_id":"qbT8zCAZDhYbUbGmrqIPDA","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"First off, this review is for the intercontinental suites which is a very different hotel than the intercontinental reviewed elsewhere on Yelp.  The intercontinental suites are simply ok.  They're clean, they make your bed, bring you towels, etc.  But for the price, I have to give them only 2 stars.  \n\nOn the overpriced side, they're well over $100\/day for a std room, plus parking is $16 \/ day, plus wireless for $10 \/ day.  For that price in Cleveland, I expect at least something special.  That simply wasn't to be found at the Suites.\n\nI ordered room service.  Prices were on par with room service and delivery time was very fast, but my salad appeared as if it had been made a few hours ago and shrink wrapped.  They had a lame selection of beer on room service too.  They didn't even have single beers on their menu, they sold it by the six pack.  I managed to get a single bass which was palatable, but if you've read my other reviews, you know I like the local stuff better.  \n\nThe exercise room is pathetic, they converted a former guest room into an exercise room by removing the furniture and throwing in a bike, treadmill, and maybe an elliptical.  I don't remember for sure what was there. I took one look at it and walked out in disgust.  I went for a run instead, but you better know the area if you're going to do the same.  It's not too far from some places you definitely don't want to get lost in.  Head to the university and stay on campus.\n\nIf you're looking for a nice hotel in the area, I hear the other intercontinental is much better including an enormous workout facility.  If you find this place on the cheap and just need a place to crash, it's great for that.","date":"2008-10-04 17:40:27"}
{"review_id":"YHYU3azWPb4UrKElyPO5QA","user_id":"zS-MLrePVjxlkjv6RhtdYg","business_id":"Fozo0B-y42EhRMomR0K5vQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The waffles here are to die for.  Having been to Belgium, I can say that these are almost just as delicious.  It can be a bit pricey but for all the waffle and toppings that you can get with it, it's definiely worth it!\n\nTry the waffle with vanilla bean ice cream and fruits\/chocolate sauce! \n\nThe map on the wall is also cool to look at while you're waiting or enjoying your waffle.","date":"2013-04-10 18:14:32"}
