{"review_id":"ZwJhJ-FnL6--NuERGQaa6Q","user_id":"ec083MQy5vBzj2nooDN9-w","business_id":"VeFqptSzekFAc3FZOpi81Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I heard really good things about this place, but I wasn't sure what to expect. It was very different than I expected. Alexander Michael's is in a cute, old house in the 4th ward and has a COMPLETELY different feel than anywhere else in Charlotte. It is a dark, pub feel. I assume they would have mixed drinks, but it's definitely more of a beer place. They have a large selection of local beers, which I love. The night I went it was 100 degrees outside, so I wasn't much in the mood for food. I didn't see a lot of lighter options on the menu that I would eat (I'm picky), but I did try the \"What It Is\" pasta. So glad I did because it was delicious! If you're looking for a unique, small place in Charlotte, go visit!","date":"2016-07-14 19:32:37"}
{"review_id":"f4vnS24_xeV9IVGdWsJsTQ","user_id":"gsts9XFXWQq7titkXH3DYQ","business_id":"pp8iXohJLmVLzAtiBP4ITQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Outstanding course.   Great views. Challenging course.  One of my favorites in all \nUS courses.   Outstanding service at clubhouse.","date":"2016-09-06 01:34:59"}
{"review_id":"Cz_nU_2HJC5IuXVJu804xA","user_id":"r6psNEvMoJDmMEyFJALO6g","business_id":"_nL5u09k7J7XAww1_UJ-tw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Went in to check out the different phones that ATT has thru Best Buy. After looking at several models decided upon the Motorola Atrix. This is where it gets complicated. I have four lines and some were ready for upgrades....well anyway it took us over two hours with the store and ATT to get everything straightened out.  Kendra who was helping us was supposed to leave early to spend time with her family and never once did she act impatient or on a hurry. GREAT SERVICE!  Very Happy with my new phone...the only  reason they do not have five stars is because there were only two of them working and the line got backed up.  But very happy with my service!!! Thanks Kendra!","date":"2012-09-10 17:36:34"}
{"review_id":"F28jlYh6_BiS59X9nJHD5Q","user_id":"WMfPxXHWEmz3ggD89Q1Osg","business_id":"EUQoB_ph7_xIyj7JZGI3bg","stars":5.0,"useful":2,"funny":6,"cool":2,"text":"forget what you know about fine italian dining. the dining at Giuseppe's is neither fine, expensive, or classy. it's a black and white tiled mecca of italian food, nestled comfortably in the same strip mall as a cellular reseller and a blockbuster. go anytime, and order anything. if you see a dude alone at a table getting drunk on red wine, that's the owner. the first time we went we cut him off for a parking spot outside. PARTY FOUL. it's BYOB, so make sure you stop at sprouts next door and get a bottle or five of whatever they have on sale.","date":"2006-04-24 02:08:02"}
