{"review_id":"y6QhVcyFyJ2cNR1vDLboGA","user_id":"agR6de0vN78LfSzH5-2spQ","business_id":"2GmGT-7QjowR1ihup3FbVA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Delicious food at a great price. Generous portions as well. This is a hole in the wall type place and it's as authentic as it gets!","date":"2014-01-17 01:34:16"}
{"review_id":"sCRmqF_zoy1f9QqSlRqZ_Q","user_id":"ETguBNhXulVj-HcheYknzA","business_id":"1QJFpZxLbHbXSKohWp9uIA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"A good indication of a great experience is wanting a repeat ASAP. My husband and I came here for dinner after a long drive from So Cal to our new home in Mountain Bridge. We were immediately impressed with the attentive staff and blown away with the portions of delicious food. (I had such a plentiful plate, we split my leftover pasta for lunch the next day!) A few days later, we went back for happy hour and were just as impressed. Dan at the bar was pleased to share recommendations on local brews - just what we were after, being fresh  Arizona residents! Food is delivered from the kitchen piping hot... wonderful. This place is run like a tight ship. We had a quick chat with the manager, Demi, who stopped by to see how dinner was going. She was really cool and obviously very involved in ensuring guests enjoy every aspect of their meal, which we did. We've lived here just over a week and have already found our new local! Awesome.","date":"2017-03-03 20:05:04"}
