{"review_id":"5cNOWKEtVoko1kZ-4nXT4A","user_id":"tVgpWz8odviFnE1SmEMXhQ","business_id":"1gQrMs-I8oKg2p-iRxznzQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place was awesome! Love the atmosphere and the biscuits and jelly. Can't wait to come back","date":"2017-06-27 23:08:26"}
{"review_id":"QUhhKNAcXu2Yr0S2r7uavA","user_id":"gKqHk7m3O5w08xJZvi9Y-w","business_id":"bn_ViqReisnTDVlDvmeHXg","stars":5.0,"useful":3,"funny":0,"cool":0,"text":"Chad was wonderful he was friendly on time and my dogs look amazing. It's hard to find a good groomer and when you do you have to spread the word. I have two dogs and one is a pain but Chad won them over. My dogs look and smell great! Thanks again","date":"2017-09-20 17:35:15"}
{"review_id":"_Pu_8IW-tTYEgFCEP0DsbQ","user_id":"L73pcflCXh0o4KJWVh-HkA","business_id":"qTmuW0C9XXuxWwumvn89sw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Super personable show.  Be expecting to laugh the entire time.  He comes out afterwards to take pictures, and sign autographs.  I would and do plan on coming back.","date":"2016-05-07 01:13:22"}
{"review_id":"xFp1PMJRPvJfG4KuzJVKpQ","user_id":"OXKNyFDrjAEPvQ87ClsZlw","business_id":"hqKhAY4IJLj_7fmIpRy6Hg","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"I was eating at Oregano's the other day and this girl, a local was telling me about this place said it was a dive bar but fun so I had to try it out for myself.  I liked it but it is def a DIVE bar.  Cheap drinks that has liquer in them.  I'll def be back.","date":"2011-03-20 00:33:50"}
{"review_id":"FijhYtRiAyZKF6q5ICzIUQ","user_id":"zvwRYUIjQ37A9MgOYG3ohQ","business_id":"Zd_VepeAl_SCzLAUcv1S8Q","stars":5.0,"useful":3,"funny":0,"cool":1,"text":"A wonderful little shop with very much a community feel to it.  Kit runs a nice and unique spot which is rarely seen these days - her vision is clear and focused in the decor, product assortment and services provided by the boutique.  \"Boutique\" truly is the appropriate word to use here, as the focus here isn't all about just turning product - she takes her time to educate and curate a broad array of interesting and cutesy little products that are not easily found elsewhere.  Outside of succulents, there is a finely collected assortment of little planters, pots and decorative items for creating your own miniature diorama.  My wife and I went to Plant It to participate in their succulent planting workshop.  The experience was wonderful.  Kit was hospitable, educational and created a very welcoming and fun environment for the experience.  We both enjoyed it very much - Kit helped document the process via taking photos, and guided us both in the selection, care and the assembly process.  Highly recommended--we will be back.\n\nNote: Plant It does not only have succulents, but also these cool \"sleeping flowers\" which are living, last 10 years, are low maintenance and come in some fantastic neon colors.  A great place for gift ideas, favors and sprucing up your place.","date":"2017-01-14 23:15:29"}
{"review_id":"XSfs69eDNNgoEvHQ9Hyu9Q","user_id":"6Ct2TGDPcrEQJ7sVHAi5vw","business_id":"Puo7pY8_h7acOb826Q27pg","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Fix your store, it is so poorly run that I cannot even go there. There are never pizzas ready, they don't answer the phone to make orders, the employees are rude and condescending and the customers are trash!\n\nOur neighborhood is not this gross but if I was from outside the area, I would think it's the slums. Totally unacceptable, get this store fixed immediately. No excuses.\n\nIt also has a foul odor to it...the pizza is worth 5 or 6 bucks...nothing special just fix your stupid store and standards","date":"2018-02-01 19:33:27"}
{"review_id":"PqZRvXK6IyIfht4v4NoSmw","user_id":"98POYOTkTN6Qu62pFR09Ag","business_id":"8F9C5vhDlYphBWELUgLkvQ","stars":4.0,"useful":7,"funny":5,"cool":4,"text":"Loved the pizza. They had a great selection. Services wasn't bad. The wings are also tasty. It was the breakfast of champions!\n\n ; ^ D","date":"2009-08-03 18:41:59"}
{"review_id":"o2rEOAfvwWYNXBuE0S4yHQ","user_id":"fH3EC8mf_fi6eB8OraRj3Q","business_id":"e5Qw3r7mkwPLcdDzZzTeew","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"So I thought I would make Lahaina Grill my FIRST review even though I've been a Yelp member for a while and eaten at many places. Upon entrance of Lahaina I was very impressed with the atmosphere  its very nice and laid back for a sushi place but I was really taken away by the fact that it has a full service bar with gambling. Its not an AYCE sushi place anymore but their ridiculous happy hour make up for that. My g\/f and I thought the calamari and sushi was bomb. The service was good and we will definitely be coming back here again.","date":"2012-03-01 03:29:23"}
{"review_id":"F8MNc_II55Cy041kF2jS6A","user_id":"1BcNXW9_Y16TIofPVpFqIA","business_id":"2GmGT-7QjowR1ihup3FbVA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"The highlight of my visit was finding delicious, high quality Armenian String Cheese in the deli case, in addition to all sorts of interesting and unusual items in the market.\n\nI went for a late lunch, and had no problem being seated. Service was good, and the atmosphere was friendly. I ordered the chicken shawarma plate with hummus, tabouli and garlic sauce. \n\nThe food portions were huge. The hummus was good, but a bit too salty. The chicken shawarma was nicely seasoned in general, but was all dark meat, which I don't care for. Also, the garlic sauce was more like garlic mayonnaise, which I also dislike. I came prepared for the more traditional blend of garlic, lemon juice and olive oil which is generally served at my favorite Lebanese restaurant in Minneapolis.\n\nAll in all, I was let down by my meal. I will however be returning to the market again soon.","date":"2015-07-16 05:39:33"}
{"review_id":"GvOLqTXj3Oc-iP0BE2xcdA","user_id":"uzpAEuM8eAkdtD-2jsTtTg","business_id":"bAgZTy1CzXUxZj5wxAnDJw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Well even though the staff was decently nice when my fiancé and I brought in his car to check why the AC was not working and have ONLY the ac checked we were told that the cabin air filter plus numerous other maintenance items needed to be done. They said as soon as the cabin air filter was taken out the ac worked beautifully! So great you found nothing wrong with the ac just do the filter and other things! Well less than 24 hours later low and behold the ac started to malfunction... Again! We take it back to check it again and get told they never checked the rest of the ac system and now we have to buy a $300 blower motor and that is before labor! We had spent every penny we had already on the other work because we trusted that the tech did his job. Boy were we wrong. Now here we are an uber driver who now can't work because it's 115 degrees out and his ac only works sometimes. How do we pay our bills? No help, no caring, no claimed responsibility on their part and we are left with nothing. Thanks for destroying us!","date":"2018-07-07 21:28:31"}
{"review_id":"ttyIKr0h3r2BX_X-eql_Fg","user_id":"-ki-qIZHP4zZ2D49-b8ZzA","business_id":"dF11zSNDXbq6DBchUvqgZQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Hit this place on a Sunday evening right after the Super Bowl, needed something quick to take to the hotel. As always, Chipotle did not let us down. Clean place, friendly staff and fresh chicken bowls. Perfect.","date":"2015-02-02 04:25:19"}
{"review_id":"HOjngCC35UugJi3Y0-nsDQ","user_id":"Hn-XZT3IMeMWdh50_Bvu_A","business_id":"MAMAvVQG7vZ_qxHKjndZHw","stars":1.0,"useful":5,"funny":0,"cool":0,"text":"Went in for an estimate to add Bluetooth phone capability.  They told me I had an amplifier with optical cables - WRONG.  They told me I had to replace all my speakers - WRONG AGAIN.  Estimate came to $900.  Went to Soundwerks and Sun Valley Stereo.  The Soundwerks guy actually spent the time to remove my stereo to see what I actually had.  Both estimated around $600.","date":"2011-03-19 23:50:28"}
{"review_id":"9V-52xKikAPdBZ2cWjCxpA","user_id":"_7KSR98ehCtM_2JiPKUv0A","business_id":"AUp7fTAH7PwxecdSO_iAhw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Went for the 1st.time to CPK on the advice of a friend, there were 8 in our party. We were seated at a table that was made for 6, kinda cramped for space,we endured because they said the wait for a bigger table would be 20 min. Although there were 2 areas  bigger than where we sat that were empty.  \n         Now when your waitress finally shows for drinks (about 5 min) and the first words out of her mouth are.  \"They must think I'm  wonder woman, I already have a table of 7 and a table of 12\". Translated= hey guys, your service is gonna suck but that's not my fault. And it did!!!!\n          My wife and I split the pepperoni, sasuage and mushroom pizza, obviously  'shrooms are the cheapest ingredient cause that's about all we could find. Pizza was bland, 'shrooms  overpowering and service sacked. If that's what your looking for in a dining experience, then this is the restaurant and location for you. If not  STAY AWAY!!!!!!!!!!!!!!","date":"2016-12-19 13:52:53"}
{"review_id":"or_KYZ65UeXi2LaXyymPMQ","user_id":"mTciBW4NAd4VlkKexH0QlQ","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":1.0,"useful":4,"funny":1,"cool":0,"text":"I grew up going to this hotel and wanted to try and start the same tradition with my family and son.  Boy oh boy has this hotel gone downhill....was so disappointed.  There were many problems:\n\n1.) Check in took 2 effing hours, we didn't get into our room until 2 am\n2.) Be careful, you don't want to sleep on the side where the Cromwell hotel is...their rooftop club will keep you up all night long :(\n3.) This hotel is no longer family friendly, it's more fitted for 21 year olds.\n4.)  Was super sad about their new Go Pool crap, use to be open to all guests, now only 21 and over and more of a club now with super loud, annoying music\n5.)  Families are now asked to be shoved into their tiny beach club pool, so ridiculous and insulting for families.\n6.) DO NOT try to be in the lobby when the party pool closes at 7 pm...drunk people everywhere\n7.) The rooms are renovated,  but so ugly and they did a really bad job\n8.) Elevators are scary\n9.) The buffet used to be amazing...it's terrible now\n\nI was very disappointed and sad that we will no longer be carrying on the family tradition at this hotel...can't believe I wasted money there.  I wouldn't even stay here if it was just my friends and I, terrible.  So mad my son had to endure this icky hotel.","date":"2014-07-28 02:30:18"}
{"review_id":"_RKlISGIc7CRxy0QSeqbJw","user_id":"EcUIVACeTxR5gtOa4tSwmg","business_id":"GBuB1uV9NRrtaLxZoVhi7w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The maple bacon donut might be the best donut I have ever had. All of the donuts were super fresh and moist. There was a big selections. I will be back.","date":"2016-10-26 15:21:40"}
{"review_id":"TTTjfvkgijVHY8jJybmhVg","user_id":"b_nAmaoxGtj5LGxRFf35BA","business_id":"lmxA0dJM0XsPCIHPXhEQ-g","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"A lot of the 1 star reviews seem to be about the portion size of the meals and I have to agree. But my main issue was the service. When our server came to take our ordered I let her know I wanted a tempura roll and a bowl of the ramen and her response was \"That's it?\" First of all, what would be the issue with ordering that for two people plus drinks. I find it extremely rude to question the lack of portions for my order. There is a warning about the volume and the vibe of the restaurant before being seated. My boyfriend and I thought there would be loud music but the restaurant MC was more annoying than entertaining. I would definitely not go back.","date":"2018-01-21 06:25:44"}
{"review_id":"m5QuLIeERoxTB8xg5fd4eg","user_id":"Y0GfcQ58UpiUsnOdkMzvgA","business_id":"8le6TQQwjAw_UQ67L8-Hpg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"It was a very interesting place. Prices wise I rather go to Popeyes or Canes. What got me was the hair in my over priced chicken tenders. The fries were eh and the roll wasn't really rolling with me. Save sometime and just go to Chick-fil-a or McDonalds.","date":"2018-01-21 08:29:38"}
{"review_id":"d8M-ty-5FJBasBr_4KcSiA","user_id":"wNLZnNNLV8rOGiPjqMPVdQ","business_id":"th-1D89M0nLicba6QRS8WQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Culligan Total Water Treatment Systems is really a great company to work with and I love their service! \n\nWe have one of their products at work (a counter-top, plumbed water cooler) that was having some issues. I called in and spoke to the nicest gentleman who was able to get me through to who I needed to talk to, and then Reed was able to get a tech out the very same day. That's almost unheard of! \n\nThe tech who showed up was very friendly and knowledgeable and was able to get our older machine swapped out quickly. I was very impressed at how efficient he was. \n\nThe service is great. The product is great. And the price is great! No complaints. Definitely recommend!","date":"2017-10-24 21:02:28"}
{"review_id":"H4__vUuq8DwyJeI2prOjfQ","user_id":"hfoABRaYNwIcw0p-qMTTnA","business_id":"BYtGiZr3dbxa2qAhg_3I4w","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I didn't try more than 1 drink but was happy with it. Had s licorice stick. Super yummy.","date":"2016-10-13 22:36:00"}
{"review_id":"YpPNklCTQgSR3xaWVnsy7w","user_id":"1csYUsGUX4vwHH-YmRTgQg","business_id":"_cs_J4j8XXyBgihJs83qUg","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I like Church's better than other fast chicken places, but this location is horrible. The first time I went, I waited in the drive through almost 40min. By the time I got to the window, they were out of the food I ordered. I waited a year before trying again. Second time I waited almost 20min in the drive through. The chicken sandwich was not good at all. Won't be back.","date":"2015-10-17 00:25:33"}
{"review_id":"fseD9PAUCKsEigzWCNtLfA","user_id":"9JkDYx16OTRFvgIvFwZgOQ","business_id":"k1c_bC3DK6mKg797vH1T8w","stars":4.0,"useful":1,"funny":1,"cool":0,"text":"Great drinks, friendly staff.\nMenu is very pork oriented (a major plus).  Everyone at my table was very pleased with their main courses, but the bacon and cheese biscuits were dry.\n Overall, great place and I will return.","date":"2011-01-09 02:04:10"}
{"review_id":"A50OruDSTQlYnD1k8oNtlg","user_id":"jCpu4Elxq8GeEhR2G8nvOA","business_id":"R0vOUWx_N9a6TeDtcnRTWQ","stars":5.0,"useful":0,"funny":0,"cool":2,"text":"Scheduling was a breeze- I called on a Wednesday afternoon and was able to book services for Thursday without issue.  Every treatment was top quality (mani\/pedi, massage, facial). Only wish I had more time in between services to use the steam room. Highly recommended, will visit again.","date":"2015-08-06 22:37:20"}
{"review_id":"gKDAAtXSItBGN3lUksQ9Cg","user_id":"FYPU4o4pnBA9WniaWLAKOQ","business_id":"5t9kTG9DakuamJgY65HA7w","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I would not recommend this place. We went on 7\/2\/16. First the chips were stale and the salsa had no flavor, watery. My husbands Michelada was not cold, he had to ask for ice. His fish ceviche was boiled instead of cooked in lime and his tostada was warm not cold. He ordered shrimp and octupus cocktail they gave him shrimp and oysters, it also smelled bad. My mexican plate was also not good. The beans had no flavor, the enchilada & chile relleno were not good. I was only able to eat half. My sons fries were over priced.  The floor was dirty, at the entrance, that should of been our first clue. We went because we heard promo on spanish radio. Thought it would be good. This is my first review and for the first time we wished we would have asked for our money back. We are definitely not going back.","date":"2016-07-03 18:36:52"}
{"review_id":"ne6Pt_UaPliNRLPpTvQxuQ","user_id":"lL5OczpX17DIbCQ2mqhSDA","business_id":"ai8nfTBNvL579cjIuqZajQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Horrible customer service. I have gotten food from here a few times expecting to have a better experience from the last, but I was wrong to hope for that. I once called and they answered \"Hold on\" and just put the phone down. After waiting a few minutes they just hung the phone up. I called back again and they answered \"Hold on\" again. I waited for 5 minutes before they took my order. I asked for their specials and the guy on the phone just says \"Well what do you want to know specials on?\" In a kind of sarcastic tone. We've ordered chicken tenders from here many times and were charged for them but received chicken wings instead. This has happened multiple times. When going back they did not even apologize and  they just took the wings back and made us wait for the chicken tenders to be made. Horrible customer service. The food here is WAY OVER PRICED. The pizza is mediocre. They may use \"fresh ingredients\" but really the crust is the best part of the pizza. Maybe I would have thought the food was better if I received better service. \n\nIf you want WAYYYY better NY pizza go to rockos pizza. Way better prices, extremely friendly service, way better EVERYTHING.","date":"2014-11-30 00:20:55"}
{"review_id":"tN-8bLuiQc4wZ9G-zDg-zw","user_id":"rIvh-c-Qkhme6FG0dADvcQ","business_id":"Zw9wEAk9L6oTZi63f4zVvA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Food is yummy, hot pots are affordable. Only complaint is the long wait for service and food, but the food is good enough to keep me coming back!","date":"2017-03-27 03:17:02"}
{"review_id":"0qucdLGDwuSM9w5bjfiZGQ","user_id":"PpBzb-w7JlSuML_-GpORcw","business_id":"TKaND6oV1n2ylnCYoAfoag","stars":4.0,"useful":12,"funny":4,"cool":7,"text":"I have stopped in at La Plaza twice now in the last two weeks.  Once on a whim (based on a glowing yelp review) and once more on a mission.  \n\nBoth times I left happy and excited to return. \n\nLa Plaza stocks most of the general staples you'd need from most groceries, though obviously there is a strong lean toward mexican, Central, and South American goods. \n\nEspecially delightful to me is the meat counter with not only fresh chorizo, but also fresh chincharrones (PORK RINDS!) by the pound.\n\nThe fresh guacamole, salsa, and pico de gallo (also available  at the meat counter) are all superb, however there is only one heat rating for both the salsa and pico.  You get what you get, and you'll like it, gringo\/a.\n\nThe produce section has lots of items that would be hard to track down elsewhere, as well as reasonable to great prices on other more common items. \n\nOn both visits the staff has been very friendly and helpful, and strongly urge others to visit and support them.  \n\nAs an added bonus they do have a taco cart, but it wasn't open one either of my visits.  I guess I'll just have to go back...","date":"2011-04-22 11:30:48"}
