{"review_id":"9WsORk6y22cnCqRdCfLEXg","user_id":"Bn0xnhjUMOQib_Y-7Bxb6Q","business_id":"0TBTV3q6QXCn9vNhy3Xi2w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My wife is gluten and dairy free so this place was perfect. She had plenty of options for her. There was also several option for me that included a lot of meat and vegetables. Food came out very quickly as well. Overall a great experience.","date":"2017-03-15 05:15:48"}
{"review_id":"b96P8-R9XJb7SqEbx1idBg","user_id":"eVnQ9ZJeOarD5YxJdpJAMg","business_id":"zidkKI_N1OPxsiddTOQH_Q","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"A quick lunch \nNoticed BBQ with good ratings nearby so felt the need...haven't had decent BBQ in awhile. \n\nService was great \nSmall dining area (or felt small during lunch lol)\nHad the 2 meat meal. \nBrisket was delicious with good flavor\nTurkey was moist with good flavor (seldom can I find decent smoked turkey, a real treat)\nMac n cheese was very good \nBeans were quite bland in my opinion. \nThe little cornbread things (mini muffins) were dry but good flavor \n\nNothing needed sauce.. to me that's a good sign. (Sauce is available )\n\nBig disappointment was the side cups and soda cups..styrofoam! Better options out there.","date":"2017-07-18 19:31:40"}
{"review_id":"8_bxGVIzPjqRlOG6sprR2Q","user_id":"-PTPvOoXVSqa24vHP894Pw","business_id":"Xs2iTWxbczvfEapAFH3cyw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"We love going to this place! Never have a bad meal. Busy on weekends but worth wait. Staff is friendly and food comes quickly. \nMy favs are the pumpkin pancakes and Mediterranean omelet. Kid friendly too. \nBeats any of the other breakfast places around here!","date":"2017-12-02 18:46:26"}
