{"review_id":"daQdrmlnjMJsdv6tW1C-1A","user_id":"EXNzW57Ofmv8i7LcGcejaQ","business_id":"-VYYKJBVTX1BtaJU4eFJ8A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"A good option for a quick and inexpensive meal. I had the chicken teriyaki and spicy chicken plate. It was a lot of food and came with veggies and brown rice. I signed up for their special offers club, so hoping to see some deals soon that will get me back here! I would highly recommend checking it out for a simple and cheap meal.","date":"2018-09-14 02:38:26"}
{"review_id":"sur3OUsoiSkHP-O9Epwbhw","user_id":"HhxBwe-LWERB71fgYTYVBg","business_id":"MpT8KheTjs7TSDWIoMUFxg","stars":5.0,"useful":2,"funny":0,"cool":2,"text":"My number one go to place for Chinese food! I don't go anywhere else! You're always greeted with a friendly smile and they make an effort to talk to you and converse with you. The food is delicious and reasonably priced and the establishment is always so clean and smells fresh. Highly recommend this place and I will always keep coming back!","date":"2017-02-19 06:10:00"}
{"review_id":"xKDk3menA7a4h6P0oJCETA","user_id":"fExj_WQCSQnqtJJitlp1ag","business_id":"Xt6OhDqC8J69wTkMNmTheA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Nice new spot to eat and drink in Verdun! Great drinks (pomme sweet pomme is delicious, had to order more than one!) And great comfort food. Nice veal poutine, and the chicken and waffles were tasty too! Been back twice since it opened, would totally recommend!","date":"2018-02-11 02:36:37"}
{"review_id":"CKHk7l_VriSEqPbG1PSLTw","user_id":"gP0DqgbBsPTHmu_RXW8TxA","business_id":"epWC7CGRbNHkXM7G2ulYzQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"There is a large dine-in area that is child friendly with arcade games. The pretezel bites were awesome, hot and soft. The seafood salad was fair. The use imitation crab meat in a creamy base, similar to Neptune salad. My husband enjoyed his pizza, but Angelos in Lakewood is still his favorite. The lady at the counter who took our order was very friendly and helpful. She explained the specials and talked to my husband about their Cruisin' nights.","date":"2017-09-08 23:39:53"}
{"review_id":"XJvECqxFNuAB5nhTGfVWcA","user_id":"TMvcS_zpVt_o9gt3GHhuRw","business_id":"MDtMV0ld7q0BsQPKNIxGrQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The best chain burger you can get in the city.\nI first ate at this chain a few years ago on a road trip to Florida and as I was sitting in the car eating my cheeseburger wrapped in tinfoil (commenting that maybe we shouldn't have each ordered a fries because they're HUGE) I complained that we needed this in Toronto. Well now we do! Haha, and unfortunately for my waistline it's uncomfortably close to my house, and just as good as it was in the states. Not much was lost in the cross-border translation. From the bright red and white self-congratulatory decor, to the awesome food and the giant bins of peanuts that fill the room and sate your appetite as you wait for your food: everything has come North. \nThe burgers are big (the standard burger is two patties) juicy and fresh. I like to keep the toppings simple (ketchup, mustard, mayo, lettuce, pickles), but there's pretty much anything you could want to put on them on the menu. The sesame seed bun does the job holding the messy burgers together and the processed cheese makes the burger creamy and adds just the right amount of flavour without taking away from the burger.\nThe fries are on par with the burger and as good as some chip truck fries:  big, fresh and crispy. And, as mentioned above, unless your incredibly hungry a regular fries can serve 2 easily and a large more. They actually measure out a heaping portion of fries and dump them in the bag loose to match the portion they give you in the container.\nIt's not cheap, you're looking at 25 dollars plus for two (share a fries and share a drink: there are free refills), but honestly it feels like you're easily getting your money's worth. No other burger chain comes close.","date":"2014-02-05 18:37:14"}
{"review_id":"jUdOI9bKee4WyMmuD_RYLg","user_id":"znk9pbzoiaXduZ8REkZn1w","business_id":"SZEFE5hL7aN5nM-A44iPwQ","stars":2.0,"useful":1,"funny":1,"cool":0,"text":"So,if you are thinking of eating here but haven't gone to any one of the other acclaimed steakhouses in Las Vegas, I'd highly recommend you go elsewhere.  This place was a disappointment from beginning to end for us.\n\nFirst thing you need to know is that if you look at the menu, the only place the word prime shows up is in the title.  The steaks are not prime.  And they definitely do not taste like prime steaks.  They may have prime steaks on the menu, but unless it specifically says it is, it ain't.  \n\nSecondly, the service here sucks.  No sugar coating here.  I don't want people to make the same mistake I made and eat here when there is definitely much better in this town.  Go elsewhere for good service, or at least average service.\n\nWell, hopefully I've dissuaded you.  If not, or if you just like reading about poor dinners like watching a car accident, read on.  \n\nWe ordered the crabcakes.  And this is where the problems started.  We dutifully split it in half as usual, I began eating and noted it was good, then I bit into a crab shell.  Wow, that hasn't happened to me at any decent restaurant and I've had my share of crabcakes.  Disappointed but willing to overlook this, I bit into another piece of shell.  I'm paying a pretty decent sum for a crabcake that isn't remarkable in any way, and I'm biting into shells?  Unbelievable.\n\nNext up, the salads.  Except we didn't order salads.  They were for the table next to us.  With some horror I realized that our steaks and another table's salads were on the sam f-ing cart, but they served their salad first!  I don't think they do that kind of thing at a Black Angus, much less a restaurant that claims to be a top steakhouse.  Horrified but willing to ignore the two insults already suffered, we got our steaks and sides after a bit of a pause.  \n\nMy steak was ok.  18 oz bone-in ribeye.  The sauces weren't special but I'm not much of a sauce guy.  However, if you are going to pride yourself on your sauces, it should generate some interest from me.  Sides were decent.  Truffled mash potatoes were creamy, creamed spinach was what I expected.  I didn't much enjoy the bread though.  I got a pretzel roll that was extremely salty.  \n\nAnd then the final insult.  We finished our steaks, and waited a long time for our waiter to come back, but we didn't see him again.  The second cleaned up and brought us out the dessert menu, but that took quite some time.  At this point I hadn't seen our waiter in so long I assumed he actually left.  I thought that was incredibly rude to do that without turning the table over to someone.  Why are we ordering dessert still?  I wanted to give this place a chance to right the wrongs.  After ordering the crepe suzette (17 layers!), we waited a long time for our dessert.  A real long time.  And after finishing what I thought was a good dessert, we waited a long time for our check.  At this point our waiter returned!  We hadn't seen him since we ordered.  Apparently he had been taking care of another table.  He didn't tell us this, which would have alleviated a lot of the insult I felt by this time.  He cleared our dessert and we wanted no more of this restaurant.  It took a full 15 minutes for him to bring us our checks.  By this point we were angry.  We got here at about 6:45, and it was now 9:15.  So we spent an equal amount of time being seated, ordering and eating as we did waiting on our dessert and paying our check.  I won't be back here when there is so much better in town.","date":"2010-11-22 05:30:32"}
{"review_id":"Ydk2rl0xjZKuNQj2IDpUxw","user_id":"aczIFOeU-v52SaG1B-vo2w","business_id":"7S_L-3ggy4YpFr50Q08fcQ","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Amazing service! I usually take my BMW 328 to another mechanic and pay over $100 for an oil change, here it was only $65. I made an appointment 2 days before and were able to see me right on time. They have a very comfortable waiting area and game room where I was able to catch up on some work while I waited. Thanks for great service, I will be back!","date":"2015-04-28 18:50:38"}
{"review_id":"AcUeY5jNjDPRrWUXPZOKbg","user_id":"b7ijwegYC73v8FwefXk9jQ","business_id":"jUp_wmljktcAuQnkYllRjw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"This bakery was near our place in Montreal.  After checking out the review I decided to give this place a try. Small mom and pop place, they seem to have a variety of bread (did not try). I was A little disappointed at the almond croissant (flake of the croissant was hard and the feeling was very sweet and this was 9am), the cheese croissant was a little tastier.","date":"2016-08-25 10:53:44"}
{"review_id":"v8Cp7eZXLV_89fuijISEaQ","user_id":"jn6vn65m8uwXLmaTXtQkRw","business_id":"dj4eotH4cBqbeIH2CgSmYg","stars":3.0,"useful":2,"funny":5,"cool":0,"text":"I work right next to this place and I've been here a bunch of times so let me tell you what the deal is.\n\nA lot of people complain about this place because they say \"Ooh the cashier was unfriendly\" or \"Oh the food wasn't like an asian master would prepare\" well no kidding you big drungus, it's because you're at Pei Wei and it's like a fast food place if you wanted authentic asian experiences you screwed up already.\n\nPei Wei is where you go if you want a bowl of noodles or rice and you want some stuff on top with a sauce.  Just order it and move down the line and if there's a table then sit at a table or maybe take it back to you office.  It's just food.  This location is pretty average in terms of speed and politeness, and the food seems to be cooked appropriately so what else do you want?\n\nHere's my PRO TIP: When you go to the place where the drinks are right after you order, get a fortune cookie, but slip it into your pocket, then at the end of the meal, go back and say outloud \"Oh man I am going to get a fortune cookie\" so they don't think you're taking two and then swipe a second one and eat it there.  They've got the most delicious fortune cookies and even though the messages are usually something stupid about sports like \"Oh you're gonna have a good sportsball game tomorrow\" you can still enjoy the cookie, and you've already swiped a second one to enjoy later so you're the real winner - sportsball or not.","date":"2014-02-23 22:01:54"}
{"review_id":"vWKsezizbgIxVP9tW1pZEg","user_id":"PK1xFkJrfdZGdlb4cYt50g","business_id":"4Nj2ktP2NjCbv2aKeH3ZBg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This was by far our best coffee experience in Vegas. We just moved here a week ago and have been all of the top rated places. The employees were great atmosphere good and the coffee was awesome. My sister in law ordered a \"golden milk\" (?) I think that is what it was called. Super good too. We will be back this week to try the food","date":"2017-06-06 19:15:45"}
{"review_id":"0qECqIYf02gvdcoCcU4vaA","user_id":"kWVbvqydGgfZ-NpXFp0sYg","business_id":"LpVNpw2-Bn9iHVON33auKw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"We live across the street from here, so we get take out here about 3 times a month. The prices are average, and the food is generally pretty good. My only complaint as far as food quality is concerned is the hard tacos. I'm a huge fan of shredded beef hard tacos. I like the kind of tacos where they put the meat in the tortilla and then fry it to make the taco hard. At Tacos And More, the hard tacos are the ready made taco shells like what you would expect from Taco Bell. I guess doing it that way saves the cooks time. Aside from the terrible taco shells, the rest of the food here is delicious. I would recommend it for anyone not looking for hard tacos.","date":"2017-01-14 21:08:39"}
{"review_id":"vI3ptj0JGEjFIZd9wzWa3w","user_id":"CdqfDiKJbA8TbCpIAeK-jA","business_id":"0VjHFdczi6Nln_nn8bucJQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is small quaint little place to get some tasty, but still very affordable pho. The gentleman (and I'm assuming maybe the owner) who greets,seats, and takes our orders is very friendly, patient, and quick to make recommendations if you have any particular requests (as I heard him do when a lady seated nearby told him she was on a diet). We usually stop in to get an order to-go and the service is always quick, with the food usually taking only about 5-10 minutes.My husband loves their iced coffee with condensed milk and I usually go for their Pho Ga, which is offered with their lunch special ($6.50 with a soda or tea included). If you're ever craving some delicious pho, but are in a budget this is the place to go.","date":"2018-01-09 22:13:01"}
{"review_id":"nouDJoiuH5nnHOVaDncd4Q","user_id":"mxfzEIOO8UqA53QTiYPvSg","business_id":"PHUcMHrbDKAmKxsqT2cewg","stars":5.0,"useful":4,"funny":0,"cool":1,"text":"As a coffee shop, this place easily deserves five stars for overall consistency of excellent service and good food.\n\nAlways very prompt seating and the restaurant is very well staffed for efficient service.  The wait staff are always courteous and seem to like working there.  The quality food is above average for this class of restaurant.   \n\nStopped in today for lunch and had really good grilled ham and cheese with fries.  Washed it down with iced tea.  Service was great.  The total bill came to $9.38 without tip.\n\nA very well run restaurant.","date":"2013-02-21 21:42:11"}
{"review_id":"E8lVGvOQogtq0JGuYEv7jg","user_id":"Y-aeqCKNf7RQvVBZw6oCkQ","business_id":"HoCDl7gV9eEL6p7fYhc3vw","stars":3.0,"useful":6,"funny":1,"cool":0,"text":"I really like these new york style apartmwnrs and their great location nwar roosevelt row and a lot of other great restaurants and shops in down town phoenix.\n\nSo far my.one complaint is the garage door has been broken for 3 weeks.... hmmppph.","date":"2015-06-08 19:10:47"}
{"review_id":"lOZn47oWcDeDVF7XJs6EQw","user_id":"VQ-8YfJTmfF0R5sH4IPbGQ","business_id":"ysJo5Jdo29XOBCnKrbUKWg","stars":4.0,"useful":4,"funny":0,"cool":1,"text":"Good food, very solid. Nice, dim interior would make for a great, cozy place to go in the winter. Macrons are buttery and unique. Not a great place from a parking stand point, but otherwise, very respectable indeed.","date":"2013-08-15 16:07:28"}
{"review_id":"xzpuKDxfIJCeJ4BpLe6usQ","user_id":"VmltTwKvhN6ebjjqcIXIyQ","business_id":"pP71Ir_U2uKU10f4vwA7tA","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Cool little shop\/common I meant to say comic shop for the nice mixture of statues and action figures and all is well. Prices were very reasonable I'll check back here next time I'm in the area","date":"2016-11-09 21:49:04"}
{"review_id":"dPWswr-GHGByxDnohzYaqQ","user_id":"WTTlaXK_2g17grShzdsczw","business_id":"Cy8XYYDrZ5wd3Bq-toXMsg","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"I love their food, specially the duck skewers. Their sashimi is probably one of the freshest I have tasted in Vegas. Hirame is a must try I would say!\n\nThe only down side is that their drinks are pricey, but everything else is good!","date":"2016-09-30 22:15:35"}
{"review_id":"1vdOIV0k9P3XI5dc-HUZXA","user_id":"Ej-7J2TUnZgXabIPIJ4ZiA","business_id":"RNi6tW22UMgHwWLAb0mYdA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Nice place but smaller and more intimate than Los Angeles location. Our server Rickey was Great!","date":"2018-06-08 22:36:40"}
{"review_id":"GzwMZUqcgKkDwG5V2jGPtA","user_id":"BM5-lVdXvcfIzY3rhkG1rQ","business_id":"58h2EhvN3iJ4jeu95N5YzA","stars":4.0,"useful":3,"funny":0,"cool":3,"text":"While I was marking my Toronto itinerary, Allan Gardens kept coming up on places to do. Apparently this is Toronto's best kept secret and I could see why. I've been to a lot of conservatories and this one is up there. \n\nWe were greeted by a staff member upon entering. The place is breath taking as I stepped foot inside. The dome glass ceiling brings so much sunlight into the place. We followed the path, one room lead into another and another. There is an outdoor vegetable garden, do not pick them! There are 2 cool looking sculptures with plants growing all over them outside. There's a small coy pond and another one filled with turtles. It's very calming and relaxing in here, you forget the crazy hustle and bustle going on outside. \n\nThere are bathrooms here. \n\nAG is open 365 days a year from 10am to 5pm and the best part it's FREE! \n\nBeware of the all the homeless people hanging out in the park.","date":"2016-08-25 13:27:17"}
{"review_id":"R-YXbFVxwcpRIbddIJzw_Q","user_id":"nHjk08LHmIpMPrsjJj4Z7w","business_id":"4J0Ihvi2p1l6lGTKR9AB6g","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"This was the worse experience I have ever had an urgent care facility. The staff was subpar the doctor was rude, inconsiderate, and my discharge papers listed symptoms that were undescribed by me. When I refused to sign the discharge papers I asked to speak with the physician. The doctor begin to explain to me that I gave a vague description so he decided to list just something on my discharge papers and that it didn't matter what it said. I explained to him that I felt uncomfortable signing my papers being that my symptoms though vague  they were given to him and the symptoms listed on the discharge papers had nothing to do with the way I felt and that I am concerned.  The doctor became angry and I rate telling me that I can go and see someone else but good luck with that! I told him that I will be reporting him. .., I am shocked at the type of treatment I have received here . I will be making this less that acceptable treatment I have received at the Urgent Care Extra known by all. The Doctor I saw today was Dr. Timothy Eichenlaub ( bald guy with bad teeth and an adittude to match).","date":"2016-06-22 22:26:41"}
{"review_id":"h6ypUO8UEQdJfiyuqW3JjQ","user_id":"uDTjxHyP1jaOCzWVsubujw","business_id":"OYEDBt0Z1q6fC92LQMfq7A","stars":1.0,"useful":4,"funny":0,"cool":0,"text":"ABSOLUTE WORST COMPANY. \nIf I had negative stars OH WOULD I USE THEM. \n\nALL I am trying to do is change my damn delivery address. BUT NO apparently this is not allowed. You have to call in and sit on hold FOR FOREVER. I have called EVERY DAY FOR THE PAST TWO WEEKS and have gotten NO WHERE. This is ridiculous. I have emailed Customer Service every day and still have received nothing DESPITE the fact that their website says that in 24-48 hours someone will contact you. This is complete bull. \n\nNow I am trying to cancel my service but this is impossible as well. \n\nWORST COMPANY EVER. STEER CLEAR.","date":"2015-03-18 17:47:05"}
{"review_id":"81sRqQd1qnZMyLDMkbX4jQ","user_id":"Fj7PELxHYa5crhHMEUTsig","business_id":"qFAw6wHMMcr4ctF-ZdGhEA","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Delicious Italian food at a reasonable price. Our waiter was a little sarcastic, but his so-so attitude was made up for by the quality of the food. Recommended for casual, affordable (relatively speaking) Italian on the strip.","date":"2015-07-16 06:08:27"}
{"review_id":"Ok2HBbJ6ZIycUrnNG5sv_A","user_id":"FiHiGLDPsNv7nzgpUXgKlw","business_id":"ie2AH9hX7LUksz0K90IdAA","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Ok, I hate to give a bad review on this one, due to them practically being in an empty plaza and I'm sure they could use all the business they can get, but I won't be coming back. There are literally so many nail salons, that I feel like I should be completely satisfied or keep moving on in search of \"my\" nail place. I got my nails painted with the gel nail paint, which is amazing in that it lasts over two weeks everytime I get it done. It was $25, as well as, I always leave a $5 tip, unless the service was just ridiculously horrible, which hasn't happened to me yet, thank goodness. The man who did my nails and I won't leave his name. Well, he seemed depressed, like he'd rather be somewhere else. At one point, he went back to get him a bottle of water, did not ask if I would have liked one and sat it down right in front of me and frankly, I would have accepted one, I was thirsty. He did attempt some small talk, but I could tell, he really didn't want too. I also attempted small talk, just to make the time go by faster, plus I do try to be polite whereever I am, Its just my nature. I'm from the south. Also, he was dressed rather shabbily, just not professional in my opinion. He did get some of the clear coat on my skin above my nail, which has taken several hand washings to get off.  There's nothing absolutely wrong about the place, but neither is there anything absolutely right about the place, it was just \"meh\". I want something better.","date":"2014-07-28 00:16:04"}
{"review_id":"w686HVOOtnZQSlTzbFmhqQ","user_id":"j56G3m8vYtA_2Io6FcISBg","business_id":"dUxjXr192ci5pjlSKxflxA","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"We went to tour the Stetson earlier today. When we arrived we were told to wait 20-25 minutes for a tour because the ONE person working was assisting someone else. Luckily after waiting a few minutes, the assistant manager showed up to help us. We took a tour and the community seemed nice enough. However, the assistant manager who was helping us was completely incompetent. She did not know pricing or what was available for our time frame. She also took us to see an apartment and then we found it was occupied so we couldn't even see it. It looks terrible for the company that she was so incompetent and unaware of the community. At the end of the tour, she told us that she didn't have anything available at the end of July when we wanted to move in. We told her we would be in touch, and got up to leave. She proceeded to do a hard sales pitch (probably because her boss was around the corner), and tried to get us not to leave. We left with a bitter taste in our mouths. We looked on their site later that evening and found that there were several apartments becoming available in mid to late July. Guess we will take our business to one of the plenty other luxury apartments in old town.","date":"2017-05-13 07:43:20"}
{"review_id":"q5yeoNA71ztDxL9osrNz6A","user_id":"ndnUSSsfKtqefxPRQ9gNSQ","business_id":"Cyy95sS5r6MGzgEA4UZX5g","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I'm really pleased with this salon. For the past few years, I've been trying to find a salon that will actually provide me with what I ask for and what looks best on me. I tend to also look for inexpensive salons, which never really satisfy me, even if the prices were much more affordable in the end.  \n\nI went to Parlour for the first time last summer. I booked it online (which is super convenient!) and booked myself with Martha, as reviews stated she works really well with curly hair. \nI showed her pictures of what I wanted and she did a great job! She gave me a long bob that worked well with my wavy\/curly hair. I returned back in November to do more layers and to cut my bangs, and Martha did a great job once again. \n\nWanting to go blonde for the longest time, I booked an appointment with Aimee this past December. I showed Aimee what I wanted, which was a blonde balayage, and she was really receptive to this and provided good feedback on what would work best with my hair. My hair didn't turn out as blonde as I wanted because it would have been too damaging, but it did look good and very healthy! We agreed to return in a few months to add more blonde highlights to it. I returned today and she did a fantastic job. It's the perfect shade of blonde mixed in with other shades, just what I wanted. \n\nBased on my experiences, I've paid $60+ for my haircut and $175+ for my hair colour. This is more than I've paid for in the past, but it's also very reasonable and well worth it. The staff are not only talented but are incredibly nice and easy to talk to. I know that I will for sure be a long time customer at this salon.","date":"2017-02-09 05:06:21"}
{"review_id":"ExCAKMyynjBVjiRG0HfUtQ","user_id":"CaaGjAM1yL_t4yhNLD3f_g","business_id":"UaYpgH8ATDNNY7Uoa5utdA","stars":3.0,"useful":3,"funny":3,"cool":2,"text":"I don't have a lot to say about this pool hall as I was here for a birthday party and was socializing most of the time and not playing pool. This venue lent itself perfectly for this type of occasion. The food was fantastic and the service was great. I did heard my husband make a comment that he'd played on better tables but all-in-all we had a great time here.\n\nThe hall is close to the subway which made it easy to get to... probably easier than trying to find parking around there. I would definitely recommend this place for booking a party, you won't be disappointed. Although I would highly discourage anyone from getting 'obliterated' and attempting to walk down the front stairs... I wonder if that guy ever made it.\n\n3.5 stars","date":"2014-04-19 13:00:26"}
{"review_id":"86lrZK2UOAnD6oTN-KIDvQ","user_id":"9KIGNO7qJ6366VBAzO0Npw","business_id":"tDYcVluqZwieulc1iqxGXg","stars":1.0,"useful":2,"funny":1,"cool":1,"text":"I'm disappointed to see so many Yelpers give this place any more than one star. I would take Panda Express any day over this joint.\n\nI ordered to-go from their lunch menu: sweet and sour chicken with vegetable lo mein and rice ($8).\n\nIt took nearly 30 minutes for it to arrive so now I'm rushing back to my office to chow it down. It's a good thing I didn't have to rush because the food was so bland I didn't even bother finishing it. \n\nI should have known it was going to be gross when my server pulled the lo mein out of a giant rice steamer. The noodles were not seasoned (btw- where were the vegetables in my vegetable lo mein?!) and way over cook. Maybe it was because the noodles have been sitting in the rice steamer all day!\n\nThe sweet and sour chicken was pretty much non-seasoned, chicken nuggets swimming in sweet and sour sauce. There were some chunks of green peppers too but I couldn't get over the canned sweet and sour sauce that was infiltrating into my rice pile.\n\nThe best part of the meal were the fortune cookies. Mine said-- Next time, drive a bit east and you will find Pei Wei... or maybe that Chicago Hamburger Company across the street will do too!\n\nDon't waste your money folks. Judging from the 4 people eating there during rush lunch hour, this place will be closed soon.","date":"2009-10-13 06:13:19"}
{"review_id":"rqifsnzUv15foBPQaO476A","user_id":"KU9KO4JpZY_leDvzJp6OCw","business_id":"LeuGZImVz_IG1e-SMYTSXw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I believe the cover is $30 if you're on the list.\n\nWe had a table and the table staff was very friendly.\n\nThe club itself wasn't over crowded and the patio was great to chill at if needed.\n\nThe music was also a little lower in volume than most clubs so it's def more of a lounge feel.\n\nI would come back here.","date":"2010-10-05 20:06:43"}
{"review_id":"_DuuesNe-iV1iDostgRvlg","user_id":"1xElgkCA7vgtRA3X0sjnuQ","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I have eaten here and in NYC a few times and it is delicious. My recent visit to Vegas is what has brought my review stars down. Went to the bar for a margarita. The bar was mostly full, waited behind a woman who was buying 5 margarita's and she stood there sipping on one for some reason while her friends sat a table. Luckily 3 seats became available at the other end and the 2 of us sat. And waited and then waited some more. The bartender on our side never once acknowledged us. Not even a glance for almost 10 minutes. She was getting a bottle of wine for man to take out somewhere. Going into detail about how she could not give him the Mesa glasses. I understand helping customers but sometimes a small glance to let one know you exist is all it takes for good service.I don't mind waiting but I do want to know we will be served at some point. But after 10 minutes of sitting there when she only had the 2 of us, the wine customer who already had his wine and a single man who was already served well that is not acceptable so we left. I am certain she did not notice or care but her attitude made me question another visit.","date":"2010-01-08 06:19:04"}
{"review_id":"aM5WYKamEI-n6K5L7V3mkQ","user_id":"zMOqDmUHg8n_edQTHfQXIA","business_id":"uUEKndnFbHD8mVkGiirtpA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"We found this place on yelp. We were a little confused when we walked into a clothing store looking for restaurant. The restaurant is in the back. It is a really nice atmosphere with really fabulous wait staff. We enjoyed all he appetizers and the recommendations for our lunch entrées were spot on. They help you make the best choice by asking good questions and even brought us a free appetizer to sample. It is a lovely place and I wish we had one in my hometown because when I return to Las Vegas I will be looking forward to going back to this one.","date":"2017-12-02 20:19:13"}
{"review_id":"e608dv4-_0ZjTTxhYr0mxA","user_id":"aMYF3HQr-V6bYIEZYHExQg","business_id":"sLhPQEYQpSgFpc9xV4M3HQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I purchased my first vehicle from Pinnacle Nissan. My Nissan Juke was very good to me so I decided I want to stay with Nissan. My first experience was great with the first vehicle. \n\nI've been looking around at the new Nissan Murano. I recently visited Avondale Nissan just to test drive and discuss costs. The people there were very rude and turned me off on buying a new car any time soon. \n\nThe other day I received a personal text from Bryson asking if I was in the market to buy a new car, which I have been. I told him what I wanted over text and about my Juke and finances. He was able to write up a deal and call me with the info which made the process easy! Saved so much time that could have been wasted at the dealership if the numbers didn't come out right. And they got my interest rate at 3.24 when Avondale Nissan was trying to give me 7% which is higher than the rate of my first car when I had zero credit. My credit  is in the 700's so there is no way I should have been ripped off at 7% like Avondale Nissan tried. \n\nI was offered a trade in value of $9700 at the other dealership. At pinnacle they gave me $12000 which significantly more and paid off my previous loan; even giving me some extra towards the price of my new Murano. \n\nI was impressed by my experience. John in financing was fantastic and very good at explaining the process. Bryson was also very helpful in making the process as easy as possible. \n\nI'm picky and the Murano i wanted wasn't available in Arizona so they found it in Nevada and had it shipped. I was told about 4 days and put into a loaner Murano. My new Murano came in a day in a half and is exactly what I wanted. \n\nI appreciate the professionalism of the staff here.","date":"2016-07-14 18:57:56"}
{"review_id":"1C_xrhp8oA2zSVpToPISCQ","user_id":"uCac1IRj7f1mfOSOxrQIvQ","business_id":"ztu1Wrxe5USdQ0iAum-xvw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"They did a great job! I just got my car back and I am over the moon happy with the results. I had coffee, soda, and food stains throughout the interior. Shadyside Detail got stains out from years ago that other detail shops could not. The exterior looks so sleek! Plus, the other shop charged more! Shadyside Details prices are very reasonable especially since they have top of the line equipment like carpet extractors.It's expensive equipment and It's not unheard of to be charged a hundred dollars just for carpet extraction alone on top of interior detailing!  Finally, they are friendly and organized. I would recommend them to anyone.","date":"2017-12-15 23:30:25"}
{"review_id":"v88WzlTAUyt3X7puw-uA6A","user_id":"bPaM-qlIR2Y6YZJ6SYHgtw","business_id":"cth3pA7Mj_v2Ka9GeOd0Ng","stars":5.0,"useful":3,"funny":0,"cool":2,"text":"Using the groupon for $27 for one person to get two races and $48 for two persons to get two races was easy.\n\nMy first car was awesome and so is the curvy and perfectly banked course. My second car had some issues but still managed to get me to speed and the three of us had a blast. But do be prepared for a upper body workout while you are having a thrilling experience.\n\nThis experience is such a good deal, and the staff are very organized, helpful and polite.","date":"2016-09-18 15:24:51"}
{"review_id":"N9qzkqF6RXbQ3LMbbeVinA","user_id":"aBeAPFrNONyUwItU3ZcLHg","business_id":"E5-BcXKtQ1_cA87yY_Apww","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I'm only interested in the skatepark. Overcrowded with scooters and bikes. So much so that people learn to be cooperative. Push the button every 20 minutes after dark. You will not like this park if you're a spoiled brat. Every aspect that is good also has a drawback. Lets also throw in some pebbles to keep you humble, assuming you are skateboarder.","date":"2016-02-11 23:40:06"}
{"review_id":"WQk9zHy0PegvnIbq46Yd8w","user_id":"Ont3QJAQ4UHBuCDZpuvS6A","business_id":"iTwYEwBqer2O4OkI_7Ef9A","stars":2.0,"useful":0,"funny":1,"cool":0,"text":"i've had better. it is really nothing special, but you could not tell that from how crowded the place got after i sat down in my booth. \n\nthe burgers were on the thin side, but the fries were really good. i ended up eating all of my fries and my friend's when he wasn't looking. \n\ni ordered a milkshake, but it really was not a milkshake at all. it was a soft serve ice cream with hershey syrup frozen drink disguised as a milkshake. how can you do that and call it a milkshake, i will never fully understand?\n\nso either i was really hungry after spending the day at hoover dam or it was actually a decent meal. i think i was just hungry. the jury is still out on that one.","date":"2010-08-20 19:07:40"}
{"review_id":"3cP4QDOafGeNOgHDfnM26Q","user_id":"j5gIWUi1HCT6ZHovx6NqDw","business_id":"MjOk1rCc0puNfBYWdm2Ocw","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"This place does an amazing job with Sns. This was my 2nd time there. I made an appointment the first time and was taken back at my appointment time. This last time I made an appointment and was seen 30 minutes after my scheduled appointment. I was a little irritated. I was there for a total of 2 hours; however, I would go back because I love the quality of work.","date":"2017-12-29 16:45:27"}
{"review_id":"ScjCU1eeW7m_E7-9nQcLhw","user_id":"Z-Zi-W05QwM0phkIVrmLoA","business_id":"XTtNTWH_Nqv27RC7OtS7dQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Delicious food, great atmosphere and wonderful service. Nice options for vegans\/vegetarians, including an incredible coconut tapioca pudding for dessert! Special shout out to our server, Alicia, who was friendly and efficient.","date":"2017-03-27 02:16:04"}
{"review_id":"sgEDLBbczB6RSlESYXW4Tg","user_id":"F2cMAsmFfxT1iy92fVCmFw","business_id":"U6Jf5-cUyxkMbXdxLLq6IA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"If you are looking for decadence, Juliette's is your place.  Don't think about calories as you'll not be able to try any of their delectable treats.  Think about decadence and you are off and running.\nWe had a mix of offerings and they were all fantastic.  From the made-t-order dipped homemade ice cream bar (caramel sea salt ice cream dipped in dark chocolate with orange rind chucks) or the lava cake that oozes goodness.  The lava cake has a side of ice cream with hot salted caramel sauce.  It was all soooo good!\nFor an added bonus the cappuccino was huge, the milk light and frothy.  Soooo good.","date":"2017-11-06 17:50:04"}
{"review_id":"z2cTmKSzU3Uo4ZI-LKYeAQ","user_id":"d_DR2kDeEQy5su7tvssyEA","business_id":"OjnRf8yDGEBCoUDdchSViw","stars":5.0,"useful":6,"funny":0,"cool":0,"text":"Oh yum. I was driving around with my little guy asleep in the car, new to Downtown Phoenix and hungry. The friendly food truck person waved with a sign as I passed and I quickly made a loop around to see what they had to eat. \nPurchased a catfish burrito and the only thing that bothered me about it was that I wish I had 3 other people to share it with because it was huge. I got through half of it and was beyond finished. \nDelicious stuff and friendly people. Good street marketing.","date":"2013-04-10 17:31:27"}
{"review_id":"HOSINJdt20uyd8rbM_zVTQ","user_id":"P0iN-Rqp1T8qdqSDyO6LTw","business_id":"pNpq-Y5SVa-jDMmzp2VsEw","stars":1.0,"useful":0,"funny":2,"cool":0,"text":"Ugh! From hostess, to 15 minutes for a waiter, to mediocre at best food (flautas were blandly acceptable).  Don't waste your time or money.","date":"2018-02-23 23:17:21"}
{"review_id":"1rCNtAP7ZHBX9bN2O8_qaQ","user_id":"8tdpq4NS0rd9c0eyy9M2lA","business_id":"ii9kqE9s4456Jn9asz-BPQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We opted to stop by for a sangria and glass of wine and I think we wished we ate here.  They have a beautiful street side patio (on a side street, so less traffic) and good service.\n\nThe inside is pretty hip looking - dark walls\/floors and red decor.  I can't rate the food, but we enjoyed our happy hour cocktail enough to consider giving this place a try next time we are in town.","date":"2015-09-23 23:42:36"}
{"review_id":"aC-EOJ77C6h5zQhzMOx5Sw","user_id":"C8W0VzsXaTg4YvciNTy3bg","business_id":"0-8DTqVaY9RJU0PAWD2l6Q","stars":4.0,"useful":3,"funny":0,"cool":2,"text":"Pork bone soup seemed to be the specialty here but I wanted to try something different so went for that sweet\/spicy noodle dish with squid (cant remember the name! grrr...) and some chicken bulgogi. I was not disappointed with my choice and was quite happy to try something so interesting and tasty.\n\nWith the Korean staff, customers, and kpop shows on tv, I have to deduce that they serve pretty authentic Korean cuisine. t I actually found the non stop boy and girl band performances quite entertaining making my meal a memorable one. \n\nPrices are pretty standard. around 10 bucks average per dish and you have the option to get bigger orders that serve 2-3 for $20. Not a bad deal at all. I'd recommend this place to anyone who wants Korean food.","date":"2010-11-22 05:44:14"}
{"review_id":"s648ZUDXZ8wCk3Ty8PHHmw","user_id":"81VIwNUOYQG4zTuSQEdkGw","business_id":"bx2KK3t9RHD0FmLYFLE_jg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Awesome location, beautiful room, and jets in the tub! The staff is very friendly. Free Wi-Fi. The only con was that when I stayed there was a LOT of construction in the neighborhood. \n\nI really can't add too much to the other reviews here - I highly recommend it for a romantic getaway to Montreal!","date":"2010-05-14 20:32:00"}
{"review_id":"PxIf6iUhDblVVg6SdHpIJQ","user_id":"J2SBfFoVK-7QTvErIUWwvw","business_id":"5X7TQsA3iDbBc8yy2YkCnA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Normally I wouldn't write a review on a sandwich shop but the group of people working here deserve recognition. Always friendly, clean and consistent. Some of the best sandwiches I've had and they got eegees which is a plus!","date":"2016-03-30 23:12:20"}
{"review_id":"frWiAZN5SBTIPMdfrlQaxA","user_id":"K9gKVmzKBLxMyk-iOeHQuA","business_id":"sLhPQEYQpSgFpc9xV4M3HQ","stars":5.0,"useful":5,"funny":3,"cool":1,"text":"I don't think there's ever a great time to take your car to get it fixed, but I will admit this was pleasantly seamless. \n\nI felt compelled to write a great review because looking at some of these posts I get the impression a few people may not have been to some of the other places in town. I'm a bit old fashioned when it comes to my vehicles and only use dealer parts. My service adviser Sean was helpful and explained the entire process thoroughly. \n\nTook a tad longer than I wanted to wait, but just as soon as I'm writing this my service adviser is bringing my keys.","date":"2012-03-30 02:20:47"}
{"review_id":"zg0hYXiDGOTuWM_bp72CmQ","user_id":"vqR_vXPPp28QzSVnC0GLqg","business_id":"M0pkmBUi_CI0qrzN7ee80Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Best Creme brûlée in charlotte! I have tried almost everything at this wonderful place and nothing has ever disappointed.","date":"2018-06-19 13:18:02"}
{"review_id":"StYt6OI82XjO4lFunOGAdQ","user_id":"qjddKSyR-pYTJG7VDuK6Sg","business_id":"Rj3wnYT1QAxpJlRT5mMc-g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Wait wasn't bad considering the huge crowd of people outside the place. The food came out quickly and my husband and I loved both our plates. The French toast was bomb.com and he got the breakfast special. Servers were nice. My first time there, and an annual trip for hubby(spring training) Will be back next time I'm in the area!!","date":"2015-04-01 18:00:41"}
{"review_id":"kl38MVibDT0DDvA6r4dlVQ","user_id":"j18uEQfl68ZL-Xa5KlunLQ","business_id":"nmpPmJpNJHnG3b-x4KNTEw","stars":5.0,"useful":4,"funny":2,"cool":1,"text":"First I know lots of people do pools around Vegas but we search all around town for a pool builder we met with about 6 different builders. Keep in mind we went to California Pools first waited a year and realized that Danny was our guy from the moment we met him it was top costumer service first and that's what brought us back everyone else just wanted our Money. At California pool there are no pushy sales talk Danny just wanted to make sure that we are happy with our choose. My neighbors are putting in a pool and started 7 weeks before us and we are already done. So not only quality pool but it was fast. Only took 7 weeks from when they broke ground. Keith was our on site manager and he was awesome very communicative on what's going on what's coming up next. I would recommend CALIFORNIA POOLS do t go anywhere else they are professional at what they do. Don't fall for a company who does Landscapping and think they can do pools we almost did that and thank god we didn't. Thank you to all the California Pool people and Danny and Keith for all you help!","date":"2018-01-09 20:36:46"}
{"review_id":"0tdOf3x8jN3430KzPLdgOA","user_id":"IQ_O4H2fdVjjV1KEXPx7OQ","business_id":"NFm869_w6cvVaWaNpAzjeA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Why don't more people hang out here? I'm yelping as I'm sitting by the DJ booth. Love the vibe, the music, but I wish at least few folks would groove on the \"dance floor\". This is a really good soul spot if you just want to do a couple of two steps and do a few spins. I will for sure be back.","date":"2013-12-07 05:02:38"}
{"review_id":"EBuJ_bPW3pTuDOApe226Ug","user_id":"XxHvYvv4nH-WeVqrbuv9qA","business_id":"wArcCMVnrl_tc9MULW-0CQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great beer, good food, but don't come hungry, you'll be disappointed. I ordered what I thought was a burger and assumed fries would come with it, but instead I got 3 sliders, and that's it.","date":"2016-01-30 02:32:27"}
{"review_id":"bt8H2yUMudclBJMyagfFAg","user_id":"pn-rIREjI6gg8im8oUQCHg","business_id":"PEWqLRLzzUIeucqYdkjxYA","stars":1.0,"useful":3,"funny":4,"cool":0,"text":"Five dispatches were sent for me and none arrive.  Confronted one cab driver who turned out to be nice. Told me that all the drivers had been told not to go to Oakland because the congestion was terrible.  She surmised that they were deliberately ignoring the call.  It turned out to be a ten minute trip and she received a nine dollar tip.  Dispatchers began hanging up on me. I was lied to several times - told that you couldn't books fares online anymore and etc. Very disreputable company with sleazy and amoral employees. Update July, 2018: why is Uber under attack? This is a perfect example of why I avoid cab companies.","date":"2011-08-25 09:28:38"}
{"review_id":"yaI-OJimNPZZVuYCqVT_ng","user_id":"MOxrDJLQRZCQyD_zj6TKxA","business_id":"e4jR-BWPxAl1d013F34Qpg","stars":5.0,"useful":4,"funny":1,"cool":3,"text":"After multiple return visits, and money spread about (3) three different tire and custom wheel shops..... none could take care of the tire shaking problem. There fancy rode force balance and inexperienced discount staff drove me crazy. We have all been to similar shops. \n\nI was all about to give up when this week while having work done by Aloha Automotive, I mentioned my frustration and expense $200+ to remedy very bad rear tire shake at 60-65mph.  Aloha Body shop manager mention HubCap Annie fixed his daughters bent wheel and re-balanced for a very reasonable price. He said that's where I would go, they are a honest shop. Since a whole heartedly trust Jason the owner of Aloha for my auto repairs, I welcomed the referral from his staff. \n\nThis morning, I was greeted by Terry at HC Annie's who listened to my concerns and offered to take a look at the problem. Terry personally removed both rear tires and quickly identified one tire was indeed off balanced. Terry fixed the issues and sent me down the road. The car rode smoothly down the road at all speeds without issue after 2 months of frustration.  \nHubCap Annie's fixed what 2 national box store tire shops and 1custom wheel & tire could not do...... Balance a tire properly. \n\nMind you while completing my balance Terry was interrupted by a man looking for a used tire. Without skipping a beat, Terry continued my install while addressing the gentle men's question and showed real compassion for the mans plight. Unfortunately, we just don't see that anymore in business, you all know that's it's sadly becoming a rare occurrence. \nWhomever hired Terry, you have a great employee who understands the true meaning of helping people while helping your business. Terry has earned my trust, therefore so has HubCap Annie's. Thank you for making my day.","date":"2015-10-07 21:15:16"}
{"review_id":"bJt7HRs7qtHq7jUgNNkREg","user_id":"06B4HhdQXE49MD31_RK4FA","business_id":"V9w0PMp-igumKpym0lWB9w","stars":1.0,"useful":0,"funny":2,"cool":0,"text":"I have been a petsmart customer for years. Even make a donation to their charity every time I shop there. Tonight's treatment by Chris and the cashier was unaccepptable. I was trying out different brands of dog kibble. Bought a high quality brand  a couple weeks ago. My dogs wouldn't eat it. Exchanged that for two different brands a week ago (Purina beyond and Hills diet). My dogs wouldn't go near the food. The Hills brand smelled awful. So I went to return the food. I walked in. Saw only one receipt was in the bag. I went to my vehicle to find the other one. When I came back, Chris is standing a few feet away from the register holding my receipt watching for me. I asked if there was a problem. His reply \"well yeah.\" He begins questioning me why I am returning the merchandise and mentions I seem to be continuously returning items. His question felt like he was interrogating me. I immediately took offense to his attitude and demeanor towards me. I said, my dogs wouldn't eat either one and one brand smells horrible. And proceeded to say I only returned one bag of food previously. Never returned any items prior to that. The prior cashier who helped me last time let me know food items can be returned if the dogs won't eat the food. Chris continued his line of questioning asking me what am I feeding the dogs now. Am I exchanging for another bag. I answered his questions and I shouldn't have had to. It's none of his business what I feed them now. And I do not want another bag. I'm upset. Frustrated by his actions and I rightfully tell him so. Telling him how I feel he is making me feel. I grabbed my receipt from him which he was holding onto tightly showing I am not liking his service. handed it back to the cashier and Chris continues to tell me, he is allowing the return. Absolutely right he is. Their no hassle free return policy was a huge hassle. I'm clearly unhappy and Chris continues to be a condescending on purpose by asking if there anything more he could do for me. I responded with after they way he treated me, I'm going to ask him for help. He continued his belligerent responces in which I told him to stop. How dare he treat me with such disrespect. As I'm walking out the store he continued to berate me with have a nice day. That is unprofessional. Awful customer service. Petsmart has lost my business for good. My treatment doesn't end with this review. I will be following up with the store manager and their head quarters.","date":"2016-08-25 07:15:20"}
{"review_id":"BuGYEz_VDsCYdQCyqG1yLw","user_id":"UlNR5x1kgycKwlEQSQezAg","business_id":"6TvB1PZCY1Ap2S-yNJPs4w","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Girls were pretty. Food was good. Nothing special.  Had the original wings and fried pickles.","date":"2017-05-13 05:17:50"}
{"review_id":"mkEI10kPGYfPOnWGRnc4mQ","user_id":"XX--i6RiqjGGTUg4XFNxfQ","business_id":"XA0pYWe90wgr1XZJyBPIqg","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"5 stars for Karissa! And also a big plus for the cute shop she's in! Cute set up and great vibes with a bunch of fun upbeat workers who (who can totally tell) love what they do!\n\nBefore going to her I did a lot of research on hair stylists for the best quality and of course, price. Having such long thick hair I had to make sure I chose someone who I can trust and who does GREAT work for a reasonable price and I found Karissa!!!!! I showed her the picture of the hair I wanted and the goals to where i eventually want my hair to get. I knew she was going to get me to my goals based off the work I seen on her Instagram @karissacutshair. My hair is naturally dark so I know it's going to take sessions to get to my hair goal and for my first session she already got me super light and my hair still feels super healthy! We still have a few sessions to go to get to my goals but I am already in love with this first session so I can only imagine how the end results are gonna be!\n\nI will NEVER go to another hair stylist after this. And I will continue to refer people to her. Thanks Karissa!","date":"2018-01-21 06:19:13"}
{"review_id":"lwlyXu5u3hkjE1ri6aWWbA","user_id":"AvC5XQAElcGAAn_Wr5auEg","business_id":"VeFqptSzekFAc3FZOpi81Q","stars":4.0,"useful":4,"funny":1,"cool":1,"text":"Wow. Using the overused term \"hidden gem\" really doesn't do Alexander Michael's proper justice. This place is so tucked within Fourth Ward, you most likely wouldn't notice it even if you were to traipse the entire neighborhood. Which, in my opinion, really makes this place shine. There's no grandiose entry way or signage laid out in lights. Just an old house on the corner of 9th with low lighting and a cozy interior. \n\nHINT: If you've never been here, I'd recommend cutting all the way over to Graham St and then turning onto 9th. You can't turn down 9th from Tryon, as 9th is split into two sections and you won't be able to drive direct. Also, parking is sparse. Find a place around the neighborhood and walk a few blocks. There is plenty of residential 2hr parking on the streets. \n\nSat at the bar and loved every creek and crack of the old floors and pillars. It's kind of tight quarters, but it gives it a cool pub feel. The taps coming directly out of the old cabinet style system is just gorgeous. Tons of local brews and some other fine beer choices were available. Didn't indulge as it was a 1pm lunch. I ended up order the london broil sandwich. Goodness gracious I'm glad I did, too. It was just right for lunch and paired with the pasta salad, you can't go wrong. \n\nService is so friendly here. You really get the feeling that these people have been at it for a long time and keep it old school. \n\nIf you haven't been or are on the fence, I highly recommend. Definitely one of the Uptown staples.","date":"2012-12-04 14:27:31"}
{"review_id":"LeeV2eJKQMLNyOAB-XKflQ","user_id":"P3B7FfBpXERa-KdxwIGkHA","business_id":"wJY74R0zAgjxvBf-d4gm9g","stars":5.0,"useful":4,"funny":2,"cool":2,"text":"Love love love Kelly's!   I just discovered this spot while I was doing The Taste of Scottsdale tour.  We stopped there for dessert.  The restaurant gives you the feel of an elegant Irish pub.  They have a pool table, dart board, putting green and HUGE patio!  In the past, I always thought of Kelly's as a bar or late night hang out (which is not really my thing) but I was very wrong!  Their menu looked amazing!  They have an \"award winning\" four cut burger--which I will try next time!  Dessert was delish!  We had the doughnut holes and Kelly's twinkie.  Both were excellent! \n\nI was most impressed with the service!  We were greeted right away.  While we were eating our dessert both a manager and the chef stopped by to check on us.  I was most impressed that the chef and manager cared so much about our experience!  A+ service!  I'm glad I found this new gem in Old Town Scottsdale!  \n\nI can't wait to go back to Kelly's!","date":"2013-09-04 02:03:42"}
{"review_id":"noPfnmtgMnNr7G-DnzU5yA","user_id":"wtjAxyHZJR-4EtwRJfOFHg","business_id":"XSY26vVt9qvLh3SAECPzkg","stars":5.0,"useful":4,"funny":0,"cool":0,"text":"I went to the opening last evening and it was AWESOME! The owners are great and the food is wonderful as always.  The restaurant is beautiful inside and I can't wait to go back soon and often! Please check it out and tell them that I sent you! I am so excited that The Melting Pot is finally in Huntersville!","date":"2011-11-30 03:28:05"}
{"review_id":"WB6RHVBJrz-xFdguyKd7rg","user_id":"Vrj6spfhP7VM6MP86IUrvA","business_id":"wHq1efQVz17338k_aUOX3w","stars":5.0,"useful":2,"funny":2,"cool":2,"text":"This place is awesome!! The atmosphere is very cozy and if you are a veteran you whole meal is free! I've been in the military for almost 4 years and have never been to a place that has offered something like that to veterans. It was a pleasant surprise. The staff is very nice and the food is great!! Definitely worth the stop!!","date":"2015-10-17 01:05:08"}
{"review_id":"biyjJjT4Wp4Q9TlYHB-3Yg","user_id":"0s-tbEVgztPxpxNTZtrv3Q","business_id":"Vg1C_1eqwIwkZLIXGMTW3g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"My only gripe was not the food at all but the amount of the food has decreased over the years since i first started going there. On the dish is use to be alot of food but the last few times i been there its very little and was ready to eat again in less then an hour later.","date":"2018-07-26 08:53:21"}
{"review_id":"fTy-R5cLgIiK3ihJfGGA9Q","user_id":"-guyVbrMJxVeBcfdRQc6xw","business_id":"Cdywb13_07M1_g3U85VKTA","stars":2.0,"useful":4,"funny":0,"cool":1,"text":"Slim pickings at this buffet.  Half filled containers of cold food.  The food was a little better when they finally refilled.  The shrimp and hot and sour soup were good.  The deep fried stuff was mostly bread with a little piece of meat.  The salad was basic, lettuce only and maybe a carrot or two.  Wasn't really worth the $6.99.  Rather pay a bit more for something edible.  We won't be back.","date":"2015-10-07 21:56:07"}
{"review_id":"BYUN-tH9-GJsDqRVE7KbFA","user_id":"IwlJBNZ_jTP08v-Mq2Ho7g","business_id":"7gHdVSAz_Dm1wS1ZImJSiQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"It's ok. Customer service lacking. Not the \"fun\" experience its made out to be. It's a $5 ice cream sandwich. Definitely not worth the trip.","date":"2016-08-13 00:17:32"}
{"review_id":"alqObKqzmzj5zF0aZllZ-Q","user_id":"H4UHK4Z9kTHbMFOU-xzkpg","business_id":"U9aA5H13y7t9xWnoQslV0Q","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I visited this restaurant last time in 2015 and gave low rating then. Two days ago while we stayed at Caesars Palace, my friend insisted to have some to-go order of Chinese food within the hotel despite my objection. So, we went.\n\nWe ordered a BBQ Platter ($29.99), a Pork Ribs in Sweet Vinegar Sauce ($19.99), and one order of custard bun - Egg Yolk Quicksand as they called it ($6.99). In total, we paid over $60 for these three items. \n\nI was astonished to see the BBB Platter when we got back to the room and opened the box. This platter was about half the size of the same dish I ordered once there two years ago. In the combination platter, there were three kinds of meat - 4 very small pieces of Poached chicken, 4 very small pieces of Roast Duck and BBB Pork. I almost couldn't believe they were serving so few pieces of so tiny size at such quite high price. As to the BBB Pork, it was chopped (not slicked) into pieces about 5 times thicker than normal sliced BBQ Pork served at most other restaurants. Their poor and tacky knife cut made the BBQ Pork look as dull as a portion of pig's frozen dead body, totally unappetizing and iffy. I was wondering how they could charge $30 for a small box of food with quality level lower than that of a food court vendor. \n\nI must give a low rating to this restaurant again. I am a Chinese and I know how good Chinese food should look and should be prepared. They still don't think they should upgrade, instead they shrink the portion and size of the food and raise the prices with no business ethics at all. Doesn't Caesars Palace feel ashamed to allow such a low-end place sitting there to fool and rip off non-Chinese tourists and suckers?\n\nAfter this bad experience, I checked again their recent ratings on Yelp and found they've got more and more poor ratings. They deserve for what they are doing, and I believe if they continue doing so, they won't stay there too long.","date":"2017-08-16 04:15:55"}
{"review_id":"qoU_2iXsbqPEoZU_f013JA","user_id":"o4nm1HukYbeTHxuORkSiqQ","business_id":"bT0Vjx-ylhz3OeYWlqxMXw","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"This a very SMALL museum and at $8 A head which includes anyone over 2 years old, My wife and did not think it was very good value for the money spent.\nWith my wife daughter and granddaughter plus tax it was almost $35 for the four of us and it took maybe 30 minutes to go through. At the end I said \"Is that all????\" expecting more but it ended quickly even going out doors and walking the nature trail down to \"Fort Wild\" an outdoor play area. Now I wasn't expecting The Museum Of Natural History in Raleigh, and we did enjoy some of the exhibits, but at  $8 a head plus tax we were expecting way more than what we got.\nAfter our granddaughter finished playing outside, we went back through again to feel like we at least gotten a little more for our money. If your trying to find an activity with the kids to beat the heat this summer, this place won't give you a very big bang for your buck. Also with it as small as it is, we had several summer camps coming through with small children and it was getting way to loud in there, so thank goodness we were leaving.\nAs most reviewers have said, save your money and go next door to Freedom Park, Its free!\nTwo visits in one for us, first and last!","date":"2016-06-22 20:56:18"}
{"review_id":"BMwgtDCfCokZ3E3lWFhIrQ","user_id":"gU7p5fvJqDnh8q_L8HlgOw","business_id":"1_SbdpAt9n8C1p8UOE9KQw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is the best! Just got a pedicure, usually my feet end up sore after a pedicure, but she was gentle on my feet. So nice and easy going. The price was very comparable to other places I've been. I absolutely recommend this place to anyone!","date":"2017-03-15 02:39:21"}
{"review_id":"x5VZ4O0J69cLREKmQk22Uw","user_id":"igMjA-LubNppfTltNReJtA","business_id":"nnDLapJk1z2NJE0-XzwMlQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Wow!  Decided to check this place out tonight.  It was popping!!! Drinks looking great. Bartenders were hustling and killing it.  Servers were professional looking and great , speedy service.  The food ?!! Wow!!!! Even the managers were walking around making sure all was well and one stopped too say hi and he was very nice.  I will be back.  Great job!!","date":"2017-02-19 08:03:43"}
{"review_id":"P7Ckm9Sx_SLn-EvIHwjeNg","user_id":"EDMOLtMyZg0yx5NwnTdJ_Q","business_id":"aYyj9OdH059CoEXadmldXA","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"I'm over 30 years old and I'm a big girl. You can just imagine how many buffets I have eaten at. I have NEVER been charged for not finishing our food. I can understand if it was a whole roll of sushi, or if it was self served. Nope. The food was served to us, not knowing the size of the portions. We couldn't finish the plain noodles (no meat, no veggies) and fried rice that we ordered because we thought, being carbs, it would be smaller portions. Nope again! Then BAM! They charged us for NOT FINISHING our noodles and rice. Wow. Not coming back here. I'd rather go and drive an extra 10 mins to Oyshi or Goyemon after this!!","date":"2017-09-08 23:59:53"}
{"review_id":"QBc_q4-iOaSo8VpChPeRQA","user_id":"vncHI0PdoiXnrE74BQM_BQ","business_id":"tDYcVluqZwieulc1iqxGXg","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Absolutely terrible service. Ordered take out, showed up at the time they told us it would be ready. Sat at the bar for 20 minutes without a server or bartender asking us if we wanted a drink or talking to us at all. Over an hour after our food was supposed to be ready, the guy, supposedly the owner, comes up and hands us the bill. It was very overpriced. He didn't apologize and didn't explain why it took almost TWO HOURS to make 4 people's take out Chinese food. \nThe food was also terrible quality. On a scale of 1-10, 10 being the best, I'd give it a three at most. I had beef chop suey that had very little flavor, and my brothers both had chicken chow mein that had almost no noodles in them. \nThe staff was inconsiderate and there was no excuse for their tardiness, as there was maybe 5 other patrons in the restaurant. \nThere are many other good Chinese\/Asian restaurants in the area, and needless to say, I will not be coming here again.","date":"2010-11-22 02:57:41"}
{"review_id":"roLilzTnCPoXSVjmbd6Ajg","user_id":"MQ8sd9yND2YiGvKkXOnLjQ","business_id":"Jd4MFJT3N0i8SK-NEocsKQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Tried this place on our way back from the CAK airport. Craving Mexican and yelp had pretty good reviews, so why not? Obviously love the chips and salsa after being seated! I ordered the carnitas tacos with salsa and onions and cilantro. The tacos are doubled wrapped and stuffed with meat! I turned one taco into two and couldn't even start on the second two. My mom ordered the same thing and was able to finish two. I took home three of the tacos and had lunch for 3 days! Also enjoyed the fried beans! My dad ordered one of the soups and really enjoyed it. My husband loved his dish with rice, cheese, and chicken - he's a little more basic with his Mexican food.","date":"2016-12-04 02:13:51"}
{"review_id":"SQUzwGGboMfnBfYaRQsGMw","user_id":"V0aoC0HIIO5Ghr0V2ZJJIw","business_id":"BbYKk_QbDLNcY0w4fWrrCA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Not fancy decor-wise, but the service was great, it wasn't overly crowded and there were VEGETARIAN options. Hurrah! :)","date":"2011-03-20 15:11:04"}
{"review_id":"Iq3Kw7WpXv0t65asHPA7bA","user_id":"dL-GREYbV6YMzLIeeWIQfg","business_id":"Gr-2oBg4XyduSKbvnE-i9g","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Chips and salsa sub par.  Cheap tequila in the margarita.  Green chile enchiladas were saucy and too tangy, without any real definition between ingredients.  Atmosphere open in a bad way--one big room with a bunch of tables.  Overall, dive quality food at Scottsdale prices.  Will not return.","date":"2017-05-26 04:07:51"}
{"review_id":"mQ5x9M40ez5ngZZzKnP_7w","user_id":"tru1wOy_MyyJc7OH2KtFww","business_id":"NEZCr0zLIPNYWNF57KsJJQ","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"So excited to find this little gem!  Right by my work and I am so excited!  Friendly, fast service, clean establishment, and the food is great too.  I will be back!  Thank you Yelp for helping me find this place!","date":"2015-03-18 20:49:09"}
