{"review_id":"TLDkttZB7QqraRebeFHbwA","user_id":"UA7eCROEYywPrDQDopNDGA","business_id":"somNslYhaw-amdfh2Ol6Qw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"if i could give them zero stars i absolutely would.   i closed my personal and business accounts after 13 years   Bad service. Understaffed.  Sad to see a formerly good bank in decline.   Stay away from here unless you enjoy long wait times  corporate red tape and frustration.   Last and final visit i wanted to get 1000 cash and there was one clerk. 1 person in line ahead of me and it took 23 minutes.  ridiculous   Bofa. you need help. fast.","date":"2018-03-15 19:21:56"}
{"review_id":"jNIDJpc7YwhrQ4wlm5NdVw","user_id":"vxRgc6S1mgXbZGXOE5nylQ","business_id":"4IGaWH9jUYMtP2uHIFEqFQ","stars":2.0,"useful":2,"funny":1,"cool":0,"text":"Update: wasn't surprised to see CLE ranked dead last among medium sized airports in North America! I got a glimpse of the outside renovations\/entrance and it looks good. Now just fix the shitty airport operations....\n\n------------------------------------------\n\nHopefully the airport completes its rehab quickly... The check in area is in disarray... People walking all over the place with no clear indication\/signs for where each airline ticketing location is... I agree construction can be a disruption but clear signage and airport staff guiding passengers will be helpful. \n\nJust a note: I have been flying out of CLE on a weekly basis for the past 2 months...\n\nTo add to the chaos, TSA at CLE is the worst (not that they are good anywhere but you can't get through security in less than 30 mins). One Sunday evening the security line was all the way to the other end of the airport, and guess what there were 3 TSA Pre agents and no one for the regular line??? What were they thinking...\n\nOnce you clear security check, the boarding area is clean and organized. Airline and restaurant staff are helpful and there are multiple flights leaving to all major hubs. \n\nThere is a Starbucks right after clearing security and the line moves quick. They are open early am (5:30am) so you can get your fix. \n\nWhen landing, I recommend using the departures\/ticketing level to exit as the arrivals level can get crowded pretty quick.","date":"2015-08-30 14:53:41"}
{"review_id":"XUndPH3ky3jpAHd56_GQ1g","user_id":"saVZEM3MD_pAFsoNgFHAQA","business_id":"a7O2gMrv_yc8rX7dAkrTPA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I love these girls. I have two schnauzers, Sasha and Corleone but Corleone is a very nervous guy. This is the only place where he will actually leave unstressed. We have been here and there trying to find the right groomer for him and this is it. My two pups come in and out without any issues. Thank you girls! (I promise to take names down next time)","date":"2017-12-02 21:32:57"}
{"review_id":"gI2rh6BWvFlHSvFh62XFGA","user_id":"avPTevvQPxbzmqYydeU2Jg","business_id":"ZBsEMR5GauziaStzU1m-ww","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My favorite steak house ever. All guy waitors... i feel like a queen when i dine there. Top notch service.","date":"2016-12-19 13:01:31"}
{"review_id":"oLKqp2iPKDSC33kAnGcdvQ","user_id":"IQ-Mt-LI6SsVzgqSl4IwNQ","business_id":"UCpUOtvqR-NBWBNVMzJleA","stars":1.0,"useful":2,"funny":1,"cool":0,"text":"If pretentiousness had a capital, this place would be it.  Went there with family to go hang out.  Apparently, there's a dress code there which prohibits Nike Shox.  According to the bouncer, they are trying to foster a business casual dress code.  Ok, fine.  More on this later.  Luckily, I live close by and grab some nicer shoes and it met the bouncer's approval.  Unfortunately, he didn't mention the cover charge, which took me by surprise when the cashier told me to fork it over.  Even though it was $10 for locals, who ever heard of charging people to get into a bar?  Whatever.  I pay my way in and met up with the gang.  Service was slow, music was way too loud and for $8 for a domestic beer did not impress me.  Remember that policy about the business casual dress code?  Funny thing about that.  As I was out on the patio, I happen to spot a guy in shorts and tennis shoes wandering abouts.  Selective enforcement perhaps?  In short, it's over rated and overpriced!","date":"2011-07-28 10:38:26"}
{"review_id":"bqB-ENALeOwQnebyBCPHtQ","user_id":"4wp4XI9AxKNqJima-xahlg","business_id":"ysJo5Jdo29XOBCnKrbUKWg","stars":3.0,"useful":6,"funny":4,"cool":1,"text":"Paris 66 is one of those places you hear a lot of buzz about and are dying to go to.  One of those places you EXPECT will be incredible!  This was a sorta mediocre experience....but I do expect more from this place.  \n\nIt was totally my fault that I set up a breakfast meet up at 10a and a lunch meet up at noon.  I'm either looking to gain 1000 lbs or am busy.  I'll take the busy option.  So since i was stuffed from an incredible waffle from Sugar Cafe I decided to get my fav salad of the moment, a beet salad.  It was a pretty big disappointment.  I'd say it was MAYBE 1\/3 a beat with TINY little cubes of beets, lettuce leaves and blue cheese.  Blue Cheese with beats?  No feta, really?!  Ok, I'm looking too much into this beet salad, but for realz, it was sorta lame.  \n\nOur server was OK, but sorta seemed like she wasn't into serving that day.  She kept forgetting to bring my friend her drink and she just seemed pretty lackadaisical.  No big thang I guess, I served and I was horrible!!  The outdoor patio was also really cute.  I was actually really into the whoel feel of the place, inside and out.  Very romantic in and very casual and comfy outside.  \n\nService was pretty slow too.  ALTHOUGH, what I will say in their defense is it looks like they only have two small grills in the front to make the crepes (which my two friends got) so I can see why it would take a while.  I did get a small bit of my friends crepe and it was awesome!  \n\nI will come back because I feel like I didn't get into the really good stuff on the menu....but I'm not sure what kind of service I'll receive and I definitely will go back expecting slow service at the very least.  So remember you'll need a good hour and a half at least for lunch, perhaps more for dinner.","date":"2011-08-24 22:33:30"}
{"review_id":"QVAwKHqbEycINze6wENb6A","user_id":"u5lzUAnMRYCSgxGCKmFkug","business_id":"hihud--QRriCYZw1zZvW4g","stars":4.0,"useful":1,"funny":1,"cool":1,"text":"FOOD:  overall tasty and fresh with most of the basic side dishes as standard.\n\nSERVICE:  is friendly and professional.  They check in fairly regularly and are responsive to requests.","date":"2015-12-05 04:12:01"}
{"review_id":"U9jQZoZ-WJeBHJCmX8yKwQ","user_id":"3NAxl1iNmLAGU4Wf1hfD4Q","business_id":"Hdzo5ggPswyv-8ZlW0PVLw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"This surely isn't artisan gelato, but it's tasty and the price is fair.  You can get a large cup with three flavors for under $5, which is pretty reasonable.  Their selection sets them apart.  They have some really interesting flavors, and change up the rotation often.  \n\nFor those who have only experienced gelato at places such at this, I only wish you could have tried Arlecchino Gelateria before it closed down.  That was the real deal.","date":"2011-01-09 04:02:42"}
{"review_id":"PghDfy8_4XfR5l40Las-CA","user_id":"EvOn3tsqrOapQKUPyhr2IQ","business_id":"D4xv7_wwYpZEZar4DwwYYQ","stars":3.0,"useful":3,"funny":0,"cool":0,"text":"I went here today, Wednesday for lunch. I sat inside. It was busy but not too crowded. I ordered a burger with American cheese, fries and a strawberry banana shake. My order came to around $9. The burger was just regular , nothing special. In fact the burger was fairly slim although it did cover the whole bun. I like my burgers a little thicker. The fries were thick but tasted just plain. Not as good as McDonalds fries, but they were edible. The milkshake however was outstanding. It was thick and creamy and had real strawberry bits in it. Oh my gawd, it was delicious, I was slurping on it till the end and still tried to get every last drop when it was over. This place was A-OK","date":"2015-03-04 20:40:09"}
{"review_id":"Rx-zkt9jZjxUEs5QmGDZTA","user_id":"CmahoXBP17HudYGYt2Brdg","business_id":"0KUyFnaBC9DyuB3swdiOCw","stars":3.0,"useful":4,"funny":2,"cool":1,"text":"Download the free app \"Skate Universe\" to earn up to 1000 free tickets sent instantly to your email. Its works, and its much faster to get then playing games lol","date":"2015-01-18 14:53:31"}
{"review_id":"Bu_CY9lN8ki3SftU0themA","user_id":"0k970YkgE7aOXKlXL2GAKw","business_id":"FFGoEGNDGdYc9ZHqfkcB3Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Love!! The yogurt is so so yummy and the employees are friendly and fun. I'm an addict. My only, albeit small, complaint is that the employees are a tad too quick to dust-buster up any toppings that spill from the bowls...kinda makes you feel bad for using them. But not that bad. Oh, and more outside seating please! All in all, divine!","date":"2011-03-20 05:22:14"}
{"review_id":"WXY8Gi5kjSHY8p8eXWogXw","user_id":"psSJdH2V1fNlwfuAk4D7KQ","business_id":"c0yPNU-BqS65u0vIKP7P0w","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This restaurant is fantastic, but nothing mind blowing. \n\nIt has a menu comparable to legume in the sense that everything is made with the freshest seasonal ingredients.  However...I prefer legume. \n\nWe started the dinner with 2 appetizers: \n- Spare ribs with BBQ sauce \n- Smoked tuna strawberry salad \n\nBoth were delicious.  The spare ribs were meat falling off the bone tender and the sauce was bbq sauce but more refined.  The smoked tuna on the salad made the appetizer worth it. \n\nFor my main course: \n- arctic char and scallops with couscous \n\nThe arctic char was nothing special but the scallops were AMAZING, unquestionably FRESH. Best part of the meal hands down (too bad there were only 2 pieces).  A friend had the ribeye which was also very tasty. \n\nI definitely enjoyed my meal at avenue b, but with a meal that comes at a hefty price, I don't know if it's worth another trip =\/ If I'm paying that much, the food BETTER be mind blowing.","date":"2011-04-22 04:20:59"}
{"review_id":"N_A_Rv9-3iHG24eqMCL4cQ","user_id":"m9F6ttvUOH6hm3ZH1ofzYw","business_id":"iHo_6xcSj3TvHc8cTU__uA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Walked in here expecting just a full bar and restaurant, but was met with amazing energy, good music and even better VEGAN food. Also couldn't stop freaking dancing while I was eating, the server Israel was kind and had super amazing suggestions on his favorite bites and drinks. \nWe had the street tacos set, Amelie Lens, Dubfire, and  I forgot the last one. (Amelie Lens one was my personal favorite). The wasabi tofuna poke bowl was so amazing!!! \nWill definitely make it a habit to come back every time we are in Vegas!!!","date":"2018-09-25 05:01:52"}
