{"review_id":"j0zzod7uY4f6-OeXiGBdow","user_id":"QbcQtpcI3E_GKcidOnni0w","business_id":"OjnRf8yDGEBCoUDdchSViw","stars":5.0,"useful":7,"funny":3,"cool":2,"text":"Great great food! Very nice owners. I have never had anything I did not like. The only bad part is when you get there too late and they have run out of something you were craving! This place is a must!!!!","date":"2013-01-02 16:32:58"}
{"review_id":"CI-XcT2XrBpC2RHmeVGaxg","user_id":"Mrudkq5duCOoiuhL61ZBcQ","business_id":"FKQUxOfW_W5R4OTut4G1Vw","stars":4.0,"useful":2,"funny":0,"cool":2,"text":"Definitely a spot to check out when looking for a quality sandwich at a reasonable price.\n\nThe shop staff are very friendly and more than willing to accommodate any request. \n\nDo yourself a favor and get one of the steak sandwiches off of the menu. They are amazing. The ultra is my favorite.\n\nAlso the Cancun fries are awesome. 1 order is for sue big enough to serve 2 people maybe even 3! \n\nThis is one of the Peppis that takes credit cards as well. Not all do FYI","date":"2017-01-14 21:30:10"}
{"review_id":"rlewaaIzJ3n7dqLJa87yvQ","user_id":"Hv_q_ZnSIoZwdcoH0CyV2Q","business_id":"1SE9f6TEV5XhnTuuK01xwA","stars":5.0,"useful":6,"funny":2,"cool":2,"text":"I've been a Wingstop fan for quite some time now.  My friends and I would got to the Green Valley Ranch location about once a week until it was closed down.  Then we started going to the Tropicana location (although not as frequently due to the location).  We recently found about this particular location on Maryland and wanted to give it a try.\n\nThe manager, DJ, transferred from the Tropicana location.  He remembers our names (even though we only go a couple times a month these days) and is always welcoming and friendly.\n\nThis location is a bit different than most Wingstop locations.  There is a bar area.  There is more seating than normal.  The walls are lined with TVs showing sports.  I like all these things.  At the other Wingstop locations I would feel cramped and would want to leave soon after finishing my meal.\n\nThe wings I got on this trip were exceptionally large.  I've never had a problem with wing size at Wingstop and these were even bigger than usual.  I typically get the hot sauce which has a decent amount of kick.  The wings are never undercooked or overcooked and are quite tender and juicy.\n\nI love the ranch sauce.  It's thin without being watery.  Hard to explain, but it's perfect for going with the hot wings.\n\nThey have TWO of the coke machines with the touchscreens.  I love those touchscreens, but people can be slow figuring them out.  With two of them there I hardly saw a line waiting for them.\n\nThe only negative about Wingstop is the price.  A small soda, dozen wings, and a ranch cost me over $12.","date":"2013-10-03 13:42:56"}
{"review_id":"Lx3VrXV9GpqYRu46iNApsQ","user_id":"jc0O62hRw_dqZtvXPrQ3AA","business_id":"cNNOcuykCG0yNDzevqBKIg","stars":5.0,"useful":0,"funny":1,"cool":0,"text":"This place is not on my favorite to eat spot because of my detest of seafood but our waiter Caleb definitely made it into one of my top 10! He was such a great server and a nice guy! I'll come back for the service (and brownie) alone! Thanks so much! Look at the super cute brownie picture I posted :)","date":"2015-01-03 21:12:19"}
{"review_id":"ErRH8EV90GJMh3wMO1FKtA","user_id":"yW9ZYlz6azfDerQLOWFJcg","business_id":"t3AWGr757V4Fvcun6sDsuw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great staff, great food! It's a sandwich shop, not much to complain about. Clean, generous, and nice! Got the cheese steak and it was tastyyyyy. Highly suggest for a quick bite to eat.","date":"2016-01-30 01:33:43"}
{"review_id":"5sln9f42t-1a59_ruuYjVA","user_id":"GJj9os-AgcBEExrxDRZRtQ","business_id":"G-LwYGh6NdXKjqCKKSxQfw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Pretty good place. Great ambience and service. The jackfruit sandwich is really excellent, so make sure to try that.","date":"2015-07-03 20:11:58"}
{"review_id":"d7zhFQPQma32y8MD_A2a4Q","user_id":"o-MqJk6YXahjpGP8Ue_nUg","business_id":"_l6VUKNX5TXanrQvbVpDiw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"We chose Dan over 4 other landscapers and found him to be honest, dependable and someone who stands by what he promises.  He delivered our beautiful backyard in 3 days and was on-site and working along with his team.  He not only incorporated our vision but added special touches that just enhanced our backyard.  We haven't seen this level of competence, work ethic and overall professionalism in many years and Dan brings all of that to his projects.  We couldn't be happier with his fair price and workmanship.\nLucy & Chris B","date":"2017-04-19 14:02:07"}
{"review_id":"i8ezP4KfpEo7AHYyxUuOaA","user_id":"FzUi87Kg99g9Kyvo0e9Q4w","business_id":"UCpUOtvqR-NBWBNVMzJleA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Recently was there with a few friends. Have been in the service industry for nearly 20 year from bartender to security to GM and like. What I expect for service execution and attention are often rather high. The attention received from the staff was wonderful. Our bartender Cassandra was one fastest and attentive I've ever had the privilege to watch. A smile and a thank you with every single transaction as well her head on a constant swivel. Paying attention not only to guests but her teammates as well. As we had no food our drinks were never empty and water was offered at nearly every exchange. We'll be back again soon!","date":"2018-08-04 20:39:04"}
{"review_id":"vOo4IO3Ct30NTGMUSp7KKA","user_id":"BcJTMU2UrdtPiLreF0oV0g","business_id":"d_q4avZYM1sOlQP7noJKVg","stars":4.0,"useful":1,"funny":0,"cool":2,"text":"This location mirrors the Tucson location! Same food, set up, and relish cart area. \nThe grilled green onion bulbs are so soft and yummy! The variety of the salsas are great! The Sonoran dogs are authentic. No need to drive to rocky Point for my dogs anymore. \nI'm not a huge fan of their beans tho. The parking lot is small.","date":"2017-11-06 18:28:23"}
{"review_id":"iBEMN_Ql7cVnRW0Lt1ZEwQ","user_id":"1JsIkzuyPLfwYAdWVwe3KA","business_id":"lcPyhwecLnx3ylTGHTTpKw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I really like this place. They are very friendly. Pricing is reasonable. And they seem to be ahead of the trends.  I definitely recommend them!","date":"2018-09-14 02:32:39"}
{"review_id":"9Jb2PeUWJzjXk4CfITc4Iw","user_id":"yXl-JUla5qr8TeitOu0C4A","business_id":"8nP8ghEpT6WFcM6tfqAaGA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This was a wonderful little throw back!  Had seen the place in Family Circus cartoons and it was neat to go in and have ice cream.  Great menu with a lot of different things (not just ice cream).  Super pleasant staff and a cute atmosphere made this place a winner.  Left without finishing my ice cream and stuffed after we had lunch elsewhere.  It was an old fashioned ice cream parlor and was a pleasure.","date":"2015-10-23 15:09:15"}
{"review_id":"uhfI5FUmaRXmHNhqYUFanA","user_id":"hIG5qvEbM0qLavmUet7qNw","business_id":"KGiObVBRve0oEyMBfOywcQ","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"yo, this location is as bad as these other reviews make it out\n-staff didn't know menu\/ specials that we came for\n-dropped one of our orders on the floor in front of us \n-packed so that my food all fell out of containers into bag anyway\n-one order of mashed potatoes didn't even have gravy\n-lobby a mess\n-watched someone order and pay for a large order of spicy only to be told they don't have any \n-no napkins\/ utensils\nall of these seem minor but all in the course of a 3 minute stop? naw. just go to a different location. this one apparently doesn't even participate in the monthly specials\/ promotions which is the reason I go to this chain in the first place","date":"2016-06-03 17:01:33"}
{"review_id":"iOuav9AAmHCfhp8Sn7kP-A","user_id":"MBcuJ3kluVPqoDGpYCJrcw","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I was real worried about eating here due to reviews saying the food was bland. It was anything but. We had the blue corn pancake with duck WOW. For entrees we had the pork tenderloin sandwich and green chile burger. The pork was incredible, the burger had a lot of flavor but not green chile, this was probably the most tender burger I have ever had.\n\nWe ate here for lunch because of my concern. It was definitely worth going for dinner, we will be back.","date":"2011-07-28 15:53:57"}
{"review_id":"Io3rRy12dfDDRCaNZugWKQ","user_id":"_NioYQLO669GVuwNYgsMvA","business_id":"3iyQGSZSmUWLXIe3CkBsjg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I was very excited to order from Mr. Falafel this evening.  I placed my order around 4:30pm directly on their website. Anyway, it is clearly marked that they deliver to the H9R area.  One can also find this restaurant listed on the Tasty Boom food delivery service as well.  I have double checked that I am indeed part of the delivery zone.  I received an order confirmation from Tasty Boom (as they are in charge of all the online orders).  After waiting for an hour and half I called the restaurant's direct line.  The person who picked up told me that a representative from Tasty Boom was supposed to call me because they had decided to cancel the order.  I never received any phone call, text, or e-mail stating that the order had been cancelled.  The Mr. Falafel employee also asked me, \"If I just placed a bunch of things in my order to make the minimum?\"  I then explained to him that I ordered what I wanted.  Also, I am not sure why \"what\" I decide to order is any of his concern as long as I meet the delivery requirements.  I expect that even if I was just ordering extra things I still would expect the food to be delivered.  I then called Tasty Boom and they told me that the restaurant had chosen to cancel the order because they felt like it wasn't \"worth it\" for them to deliver.  I would like to note that the website states a $20.00 minimum and my order was $25.00.  Also, the restaurant is located on Saint Jean's Boulevard and is a less than 10 minute drive from my location even with lots of traffic...what a joke and what a waste of time.","date":"2018-03-03 23:23:37"}
{"review_id":"_CF2P58EJbHkYyzJgNp2jg","user_id":"b7Jvo1SQDEseTS0L-JVN4A","business_id":"NM9A38hqiOAYbnUPpNz-UQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is the 3rd time I've been  to this restaurant and all of the times the food was awesome and the staff was Reay friendly. I will definitely be going there again.","date":"2016-01-17 07:00:24"}
{"review_id":"d9-H40-ykIaM6zbKCSRVIA","user_id":"6sHvM5vaCyNalyBq-rYWZQ","business_id":"eNcYNWN1e5zgIwxebVV6PA","stars":5.0,"useful":2,"funny":1,"cool":2,"text":"Got the brisket sandwich. Was not drowing in BBQ sauce which I appreciate. Great flavor, great texture, nice and soft. With onions and brioche. Nom nom. \n\nAlthough the food was great, the gents running the place try to really do what they can for you. They let me try a sample, very engaging and fun. I will be going back.","date":"2017-03-03 22:00:18"}
{"review_id":"0ekTNzjUf-WViTRqGPRKOQ","user_id":"EZ6RX5HMD3DXRxZjF2j6VQ","business_id":"KTPRYqiFdLowAUEAnN7e3g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Came here with husband and bonus daughter while on vacation. Love the texting when your table is ready concept. \n\nThe shakes are very yummy and incredibly filling. I got the expresso one. my husband the caramel bourbon and the 8 year old got the Smores. The Smores one comes with a roasted marshmallow on top! You get your glass of shake with tons of think, almost Fluff-like whipped cream on top plus the metal container that the shake was made in with all the extra that wouldn't fit in the glass.\n\nMy husband got the Farmer Browns' burger and enjoyed it.\n\nI got the Hot Chick sandwich and it was incredible! The perfect combination of flavors and amounts of sauce, cheese, etc. Chicken was perfectly seasoned and grilled. \n\nThe Bonus Daughter got the grilled cheese and for an extra $1 (only homemade chips come with the sandwiches) got the fries. She did not care for the fries. The fries were a bit overly salted and also had pepper and I want to say rosemary on them. I loved them but did try to scrape off some salt.\n\nThe waitstaff was very friendly and we got to eat in the outdoor covered area. Great spot. Wish we had something like it close to home.","date":"2015-07-03 20:07:31"}
{"review_id":"zqmYCsLxWqIbZJhqqtlAlQ","user_id":"PcqR5MR4oCGPio_F3v4u0w","business_id":"CzqYP9VKJBzGLnp14naScA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Chelsea's Kitchen is awesome. It's hard to find anything bad to say about it, so here are the good things: they have plenty of great beers on tap, as well as a ton of great wines. The food is amazing. I got the short-rib taco platter this time, and it is awesome. It's cool that the menu has a little airplane icon next to the dishes that are fast to make so you can make it to your flight quickly. And they have several tvs is the bar section so you can catch the end of the PGA Championship, if it happens to be that day for you (go Rory!). \n\nOverall great place. Friendly wait staff, food that arrives quickly, and great drinks. 5 stars!","date":"2014-08-10 22:29:40"}
{"review_id":"bsq8pGi2rKMzqOItHrebTw","user_id":"ddcLIt50rxLuv7R6r2xQ2A","business_id":"wAUUgvSJqKdx6x7Lzy79Og","stars":5.0,"useful":2,"funny":0,"cool":1,"text":"I had a 2pm appointment, arrived 15 minutes early. At exactly 2pm, \"Chad\" came and escorted me to CPAP room. Although I have been on a CPAP machine for at least 10 years and I knew the drill, Chad was very professional and explained the machine, functions, equipment, etc. He also recommended a different mask and headgear than what I had previously requested and it was much more comfortable than the one I wanted. I was very satisfied with the treatment I received from Chad. He is an asset to Bennett. I will point out that I left another local CPAP supply company last week after getting the run around from them. My pulmonary Doctor ordered a new CPAP after I had another sleep study done. I had to contact Preferred CPAP Supplies and ask the status of my new machine. I was rudely told that I wasn't the only customer and the insurance paperwork took awhile. I reported that company to my doctor's office and was referred to Bennett Medical by them, and immediately cancelled my appointment and scheduled with Bennett. Bennett had my insurance approval and paperwork done in two days where the other local company wasted 3 weeks of my time and gave excuses. I had been with this other company for 4 years. I called Bennett on a Friday, had my appointment and machine, etc, the following week. Thank you Chad for your expertise.","date":"2016-05-07 02:29:22"}
{"review_id":"8Ix0to65hjcRx1am3E9WkQ","user_id":"b_FgVSPofxK_j5-u-dT7sA","business_id":"R05ZRXWkYuEcvRGok5fiDA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I dropped my car off at fabulous Freddy's yesterday while I was getting my hair done. When I came to pick up my car I noticed the back still had some dirt on it. I wasn't going to make it a big deal and was just going to wipe it off at home but when I got home I continued to look over my car. The cup holder was never cleaned out and other parts of the car looked like they were never wiped down. I have a really nice brand new 2016 BMW and I was highly displeased :(. Save yourself the $27 and do it yourself.","date":"2017-09-20 16:54:28"}
{"review_id":"ALEKgz1V4trc0cEUCl5FqQ","user_id":"k2qyzc1yQc6UppJLKDCHCg","business_id":"XXqDY5ji8k29I-kKzLm8yA","stars":2.0,"useful":1,"funny":5,"cool":0,"text":"I wish I could give a better rating. It really isn't a bad place. It's chill and hipster. But what I had there tasted awful.\n\nI ordered iced tea but what they gave me was not lemony nor did it have any citrus flavour typical for iced tea. It wasn't even sweetened!! Furthermore the color was blood red! What are they playing at? Sorry, this iced tea detered me from wanting to go back. Maybe the coffee drinks are good, but definitely not this damned \"iced tea\".","date":"2014-06-27 21:26:27"}
{"review_id":"XIAbKQrpX6RRenmehnfzww","user_id":"bFsHp1NPcbXhvNpTBzkpgg","business_id":"EUhjQecCVsyxPXE20DFsaw","stars":1.0,"useful":0,"funny":1,"cool":1,"text":"Empty restaurant at 8pm, bar closing, no chef cooking and absolutely nobody in the restaurant.  We made the mistake of staying.  Fish restaurant with two choices of fish, but mostly fried.  Stay away","date":"2017-03-15 02:16:04"}
{"review_id":"yBPq4NPYlTxzlUXNdEkaUg","user_id":"EnIJz6JaLgPE4JA8eyZjbA","business_id":"n-5dPbGyziS0SOkVDTquFQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Hmm.. I never write reviews on here, but I felt I had to with this place.\n\nFirst of all, it was expensive for the quantity that they give you. If the food was actually good and they had the atmosphere to match it would've made more sense to me. That was not the case - the restaurant was basic and to be honest, pretty run down for a restaurant on King West I'd expected better. The staff was rude with answering any questions and when the food came the ingredients were old and tasted like MOLD. I didn't even finish it before the waitress took it away and didn't think twice to ask why I left it (most staff will ask if you enjoyed the food at a good quality place - not here!) \n\nI would never go back here or recommend it to anyone in the area AND I agree with the post about food poisoning I was sick for two days after eating here!!! YUCK, disgusting. :(","date":"2016-08-23 00:14:39"}
{"review_id":"HCm280C7wr0NgGPxUW_mCA","user_id":"F-Mn8UkZr9qwySs_s-Z-nA","business_id":"U9aA5H13y7t9xWnoQslV0Q","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"So I was in the mood for Asian food and after countless research on yelp and Google, this place looked like it would deliver. Boy how wrong I was. The service was terrible. The server tried to get my friend to order two separate entrees when she just wanted a side of rice to go with her general tsos chicken. After we got our meals he disappeared and didn't return until about 15 minutes after we were done eating. My friend ordered the general tso chicken. It was bland and more breading than chicken. I ordered the chicken and mushroom noodles. The hand pulled noodles were slightly undercooked but still really good. The chicken was horrible and didn't even seem as if it was chicken. The texture was more of the organs than the meat. Needless to say it was very questionable. The experience all together was crappy but our server put the cherry on top when he took the bill and never returned with the change. Normally I tip 20% or above but he seemed ok with his 10%. I won't be going back there, I would have been more satisfied with panda express.","date":"2015-04-15 04:48:06"}
{"review_id":"hdaqoZR2K7wy6dF2CXOO0w","user_id":"R-79-e7_0AHvrCclOTYLog","business_id":"aNaMJt-qwRbUVKj6Jl5-5g","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Pulled in for an oil change. Have no problem waiting. Dude is posted up against the wall doing nothing, sees me, does not acknowledge me. Drive around to the other side. Roll my window down. Looks at me, still nothing. See another guy who's actually working on a vehicle who I believe was on his way over to acknowledge me, but i had already started driving off. No worries, I'll spend my money elsewhere.","date":"2017-01-14 20:40:55"}
{"review_id":"jhnV0gL3jF1t1AUqVBiWEQ","user_id":"qRJQFRwFbKFx5-j3pwGRPQ","business_id":"Gc8xWVpbUlBYHAoOT9MTyQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My wife really enjoyed the tasty foods, had the pork shoulder & the achiote roasted chicken dinner plates complimented with a pressed Cubano everything was spot on, not to mention the dessert, we will revisit and we recommend to anyone looking for some soul in their food.","date":"2017-01-14 20:43:51"}
{"review_id":"k1aq0nqK8oiW81nY8O-zyw","user_id":"_3A1fEJhu7A86viaOafMaw","business_id":"VrGI7_nRjXpn0415S3coGQ","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"I liked this place a lot \nThey have a few duck dishes that I was very happy about. I want to try everything on the menu\nSo I'll definitely try to come back more often","date":"2017-11-06 16:55:19"}
{"review_id":"O3nsfpHbrLeTxK9olhS1pg","user_id":"s4cki7AiOrOjb5r-ZpbJUw","business_id":"y3nhGBZagfj3tZe48v0pLA","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"This is probably the best Moe's in the area which explains why it's always busy and other ones are always empty.  The people are friendly here, they don't skimp on the burritos, and they have the freestyle Coke machine.  Their sanitation scores are typically far and above other Moe's in the area too.  It's not gourmet or authentic Mexican, but for $5 on Monday for a huge burrito, chips, and a drink, you can't go wrong.","date":"2012-06-26 02:36:16"}
{"review_id":"vBb7ZVYCaWGbMmLji1umVw","user_id":"_6qzYTyQ3lV9DJqoep7_og","business_id":"R5yo30FD1jBoRsfz1trosQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Healthy option.  If you like their FB page they will upsize your order.\n\nBees flying everywhere - must be really fresh.  Though I wish they rinse the juicer a bit more after each order.\n\nInteresting mixes which I will try at home myself.","date":"2013-09-04 00:30:43"}
{"review_id":"LimL8Ht4FFQy2fFWYbeWCA","user_id":"aPlobPqz1DBDVdvqzSz5aA","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":4.0,"useful":1,"funny":0,"cool":2,"text":"Took us a minute to find it, but after some searching, we found it (located on the 10th floor of Venetian). Mrs. Ninja's favorite meal is breakfast so we had to try Bouchon. First, they served bread with butter and jam. Something about the butter was so good, like they were slaving away in the kitchen,churning butter. For our meal, she ordered the chicken and waffles, not as good as Roscoes, but still got the yes nod from her. I ordered the mussel in wine sauce w\/ pomme frites (fries) and it was also very good. Mamosa (champagne w\/ OJ) was good but I finished it in two large sips. Definitely worth checking out if you dont want to stuff yourself with the buffet or if you need something to deaden a small vegas hangover. 4 Hip to the Hops!","date":"2008-12-03 23:01:31"}
{"review_id":"oODtrJhr5vUzx6WD2YKI8A","user_id":"op0NIiwJpIi9OXUdbuXtQA","business_id":"krkgXOMQ4rUCkFn43gvnSg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Simply put: These guys are amazing. Two of my friends had their Tacomas worked on by these guys and they recommended I check them out when I needed some work done on my truck. I had them do my timing belt and water pump on my 04 Nissan Frontier. They did exactly what they asked and when it ended up taking an extra day because a part needed to be ordered they set me up with a loaner car. They told me about a few other things that might need to be taken care of in the future but they didn't push me to get it done right then and there like most shops would. They are very trustworthy and honest with what they do. They won't BS you and they definitely aren't the kind of place that's just looking to make a quick buck off an unsuspecting customer. They will tell you what you need and what you don't need without a bunch of salesmen like antics. I highly recommend Yota Pros.","date":"2015-06-08 17:05:06"}
{"review_id":"YhqU0Xz3hDHaO9lrN8JjIw","user_id":"1f9d6R0fSmQX99uf7AS9Gg","business_id":"UT6L3b7Zll_nvRidijiDSA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"If you're in the area and have a hankering for pizza, head on over to the five50. Let's call this place a 3.5. Midwesterners beware, this is a thin crust pizza joint!\n\nWe were pressed for time and had a 30 to 40 minute window for eating. The service was accommodating, and they got us in and out just in time. We ordered one pizza, half North Beach half Margherita. The slices were large and thin, so one pizza was enough to make two people full at three slices per person. The pizza was thin crust, but still had a slight chew to go with the crunch which I enjoyed. The North Beach had smoked mozzarella and clams on it, and was described as bbq chicken pizza with the chicken swapped for clams. It was unique with tender clam pieces, but I think they planted a dangerous seed since I found myself wishing it had a dash of bbq sauce! The Margherita pizza was nothing special, just a big basil leaf on each slice.","date":"2014-01-17 04:29:50"}
{"review_id":"PmYEM7gSty3LWK-kOB8vxA","user_id":"uMeSBbQaP0waX2750AX-8w","business_id":"Xs2iTWxbczvfEapAFH3cyw","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Best breakfast in the Phoenix area. I normally get the Irishman omelette, it is an omelette packed with corned beef. It comes with potatoes and a side of toast. The service is always fast and the food generally congress pretty quick. It is almost always packed on the weekends but if you're solo out with your significant other, ask to sit at the bar.","date":"2014-06-28 00:21:58"}
{"review_id":"FLZ02qYicNQgNu__keDgaA","user_id":"bDsAF4zw7Lslk4N6BkILbw","business_id":"5A_sjC9ULLt4UkDNtr9dkw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Cool interior with fun mix of draft beer, coffees, and I believe - full bar. Servers we're engaged and efficient. Loved option to eat\/drink at the bar. Tho too hot to enjoy on this visit, looks like cute and accommodating outdoor dining available. Will return for the entertainment offerings!","date":"2017-07-28 19:58:26"}
{"review_id":"QL1JloDoHf6JlfW8p3bJGg","user_id":"0I2qPIm0JqcA6hAB6Qid7g","business_id":"OD09pm-MzynigAvD5KoGPA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We've been coming here for a couple of years now and it is Awesome!!  Really cute place with Amazingly delicious food!!  You tell them what you want and they put it together right in front of you..  Barbacoa is Best in the city!!  Highly recommend you give em a try!!  You won't be disappointed!!","date":"2014-08-24 20:48:13"}
{"review_id":"CnxgHZ84hdSblElUB__4-Q","user_id":"5QBtIy-aUrg9BdsxqhqORA","business_id":"_5inlOVvlrCOKcI772RqJQ","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Hour wait even with reservations. We made 7:00pm reservations for a party of 2 and did not get seated until 8pm and that was after having to ask the host several times, and then finally for a manager. It took at least 15 minutes for the employees to find her. This location has just really gone down hill, I've been to many Benihanas throughout the country from locations in Atlanta, Detroit, San Diego, and this location is the absolute worst experience I've ever had at a Benihana's. It looked as if they were short staffed there were at least 4 grills that were not being used. One positive experience was our chef Joseph made the food delicious and of course entertaining. The manager did seem understanding and apologized and was willing to try and make our visit better. But, still will not be returning to this location.","date":"2015-08-30 14:20:03"}
{"review_id":"gAjPoxtNFiJoUyzVWc2NKQ","user_id":"MaG-AO9wy7a_AYooatmtJQ","business_id":"jYB3FHXjS491zFlCoLZ91Q","stars":5.0,"useful":2,"funny":3,"cool":0,"text":"Went for my moms 60th birthday and had a blast. The wait was a little longer than I would have liked but well worth the wait. The hibachi chef put on a great show and made my mom feel extra special. The soup was tasty and the tempura shrimp appetizer was fantastic but expensive for only getting two pieces.  \n\nOur group ordered, lobster, filet mignon, shrimp and the kids steak hibachi. The filet mignon melted in your mouth, and the shrimp was delicious. The lobster was a little salty but still really good. Dishes were also served with fried rice and vegetables which were also really good. \n\nIf it's your birthday the staff gives you ice cream as well as sings you a fun birthday song! Highly recommend coming with a group of friends or family. Tables seat 10.\n\nOne downfall is they do not take reservations on the weekends.","date":"2016-05-07 03:19:17"}
{"review_id":"Fu68eE-wzIjNsho1v0nhnA","user_id":"A96c00iAOMVxjhd50Ncgjw","business_id":"XwJ6fZRVbxQYRsryy4-qDw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Service was just as good as the food! Kim and Raju who was our servers was super friendly and knowledgeable of the menu. Definitely recommend the shared meals!","date":"2017-04-30 06:08:48"}
{"review_id":"UItG7g91Fl0ErwsLj5qwYA","user_id":"HvQ45V3LxGbY6-YZ97cvqQ","business_id":"bx2KK3t9RHD0FmLYFLE_jg","stars":4.0,"useful":1,"funny":1,"cool":1,"text":"Yes, this place can be pricey but it was a great stay in Montreal.  We paid ~ $750 for three week nights in October.  \n\nLocation:  Fabulous because it was near the quaint old town area with plenty of areas to stroll through and pick up breakfast.  1 block away from the metro stop and about 3 blocks from China Town.  About 5 blocks from the water front and Archeology museum.  \n\nService:  Very friendly and tried to be professional but some odd answers to my questions.   They seemed to always try to sell their own restaurant whenever we wanted suggestions from the concierge...even when we asked to find St.Viateur for their famous bagels.  I also tried to get a room with a good view - one of the customer service reps said she would try, since the rooms were not ready when we arrived.  But then another service rep looked at her and mumbled something in French... She then said that our room does have a good view and then within the same sentence, said that really, there were not good views in this hotel.  Then, our toilet had very low water pressure so I called the front desk who said they would relocate us to another room. 15 minutes later, after frantically packing our things, a guy comes up to the room and says no other rooms are available and they would fix it in the a.m.   \"A\" for effort but \"C\" for the odd answers and possibly... lack of experience? \n\nRooms:  Loved the brick walls and hard wood floors INSIDE the rooms - a lot of personality with very high ceilings.  Big bathroom with full bath.  Good blow dryer in the room, iron and board, umbrella, robes, iphone\/ipod dock on radio.  Bed was a bit firm for me (I am soft biased) but otherwise comfy.  \n\nFitness room:  small but my husband said was good enough - had cardio machines and weights.  \n\nWe received a free drink voucher for their restaurant upon checkin.  Our friends also stayed in the hotel and opted to buy package deal that included 4 free metro passes and coupons... not sure how much more they spent but they also got a bigger room.","date":"2012-11-06 08:11:22"}
{"review_id":"owbGzZHNimeE_urgjmMvlg","user_id":"tYOG_NUb3cjN3KGaT9lwbw","business_id":"q2GzUNQj998GSC8IhkN9hg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"love love love. Everything about it.  Has been consistent since they opened.  I wish there were multiple locations around the valley.  The chicken is so tender and juicy.","date":"2018-02-11 04:26:43"}
{"review_id":"39Jh1toqD26U8IfwYgN9Ng","user_id":"BroKsxDqK3MCQtbq4v9GqQ","business_id":"E3UzOSUQyoEFohk_MeLslg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"There's nothing they can't do. Harry and Jack are great people and true experts. Their price was more than reasonable. I've gone to them on numerous occasions for shirts, winter coats, suits, pants. All came out was tailored as if the original piece was made for me.","date":"2015-12-05 03:31:43"}
{"review_id":"5r4hmj22pCNg4c0QL8MrDw","user_id":"Zqk-ye_OHeH_sS1JsdsLgg","business_id":"eaNenRk_liZBERFFLCXqqQ","stars":2.0,"useful":3,"funny":6,"cool":0,"text":"The quality of the meat amd the banchan varieties were good. Ive been meaning to go to this spot for a while and finally got to try it out. The wait is horrendous of course but expected, 30 min turned to 1 hour and 10 min. So dont come here hungry. Lol\n\nThe prices and quantity is expected as well very small, its not an all you can eat joint and dont expect alot of meat. We had to order another plate pf meat and cold noodles on top of our combo. We told our server maybe we shpuld have ordered the 3 to 4 people portion, he said no its too much food. The portions are really small, the pictures are deceiving. Our server was in a rush on everything, our food, the cooking and when we said we want to order more meat he kinda got dissappointed. Lol. \n\nWe had to ask for cups for our water, more water, rice, napkins pretty much all the basics. Top it off with a piece of hair on our salad which we pointed out and he just said oh I get you a new one. No sorry, oh my gosh, nothing. \n\nWell I tried it and everyone seems to give this place a 4 and 5 star which Im sure at times deserves it. Its just not this time.","date":"2016-07-25 03:55:28"}
{"review_id":"nqbiAs4r0DnnB4WEbqFT3Q","user_id":"Y-eXFpVQcxGB4-EBYsdgWA","business_id":"y0pTeRLBftD__abekOFj6g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I called HoneyComb for an appointment for full highlights, cut, and blow-out. I couldn't come in during work hours but I was able to get in with Tia Hunter within two weeks (which is pretty good for a 2 hour appointment after 5:30 pm)! The salon itself is neat, clean, simple and whimsically decorated. Tia took time to listen to me describe what I wanted to do with my hair and she offered advice and recommendations. She took the time to explain what she was doing and gave me some tips for maintaining the style. Tia updated the color and cut with some very subtle changes but it definitely freshened up my style! I am still super happy with her work two weeks out. Thanks Tia!","date":"2016-07-14 18:52:45"}
{"review_id":"Auw9XDjmu4lnMVuY0mh8MA","user_id":"ELcQDlf69kb-ihJfxZyL0A","business_id":"mecL8UGi_Qm5be2t1L4B3w","stars":3.0,"useful":4,"funny":2,"cool":2,"text":"It was $7 for a 6 inch turkey sub. Now Subway has real turkey and charges under $5, so TOGO's needs to match that price. Nothing really stands out in the #3 (turkey and cheese), so there is no compelling reason to eat turkey anymore at this chain. Perhaps one final pastrami run in the future. The kids making the sandwiches also don't listen to what you want, so watch them closely. Not sure how many hours they pre-slice the turkey ahead of time, but no fresh slicing involved here either.","date":"2016-06-21 17:16:50"}
{"review_id":"OP9wo9LY76qW05sIIMozHA","user_id":"vzDWwGeOCXkWFB8r-hDe4Q","business_id":"-uhY6pq54YB1-kOVFUBPlw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Like all the other reviews say, this place is AMAZING\n\nAwesome staff, great selection of wines, lots of unique beer options (lotta local places too), obvi liquors, some good mixer choices AND free wine tastings on Saturday afternoons \n\nI just love it\nYou should go","date":"2018-07-07 20:57:38"}
{"review_id":"2b_16PmlXFn8l8xpJfQUbQ","user_id":"d6fmjxN7lUxajB4vAV0RGg","business_id":"2qjvYspb3bEmCaw1vmSk0g","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Got take out sushi today - half of the avocado was brown - like really brown.  If this is a sushi place you would think the products they use in AVOCODO sushi would be fresh.  Or at least call the customer & say that the avocados aren't good - would you like something else.  Not just send the product on it's way - my hubby picked it up - so not sure if he even looked at it before taking it.  I would have taken one look & refused it.  Got all the way home & it just looked gross - feel really bad cause my little daughter was the one that wanted it .  We picked out the good ones & tossed the rest.  Now - saying this to the manager - he didn't even offer a refund or an apology - second manager did - & offered an apology which the first manager didn't even offer.  Really disappointing.  Feeling sick  with stomach pains - which is what prompted me to call.  Very disappointing.","date":"2014-02-23 23:32:33"}
{"review_id":"0NRNA8qIq9nKw5FcwyOxcQ","user_id":"54kpqrxF9DEPpwa51hO_Bw","business_id":"jzveTy7ogH7cg9axZ78ENg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very nice eating environment and the food are quite nice. Very native Japanese style.","date":"2015-04-01 13:31:35"}
{"review_id":"s2ax2wTNoa5v4Q7jXvEs4w","user_id":"6gL9KyY04VchdaqhYYoKUQ","business_id":"7sb2FYLS2sejZKxRYF9mtg","stars":1.0,"useful":1,"funny":0,"cool":1,"text":"I really liked Sakana when it first opened, I went there for lunch a couple of times but because the 'word wasn't out' it was very slow, I was immediately seated, the service was quick and the sushi was good.  You could tell they were really trying to make an impression.  I returned there about 2 weeks ago for AYCE and the experience was quite different.  I went early, about 11:30 a.m. because I knew they are much busier.  There were only 4 other people in the restaurant.  I ordered my first round and as I waited, the restaurant filled up quickly.  I waited.  And waited.  And waited some more.  When my first order of sushi arrived, it wasn't everything I ordered but I was glad it came because it took the edge off.  I slowly received more sushi.  The 3 orders of eel that I ordered never came.  I reminded the server.  She said she would check on it.  I waited some more.  I asked her for the 2nd time about the eel.  Even though the restaurant was practically full, she was the only server working, ping-ponging from table to table.  Since I had nothing to do I kept an eye on this poor guy at the bar who wasn't even acknowledged for at least 1\/2 an hour, not even to be given water.  He kept trying to get someone's attention!  Finally about 12:15, what I thought was another server arrived, turned out he was a bus boy and could only pick up plates and fill water.  FINALLY my eel arrived, it was super mushy, was much larger than the other sushi and didn't have that warm toasted crust.  You could tell it was thrown together.  Since I made such a big deal out of it, I ate it all even though I didn't like it.  I felt so sick after that, even though I didn't get my money's worth I didn't want any more (she wouldn't have been around to take another order anyway).  I was in the restaurant for well over an hour even though when I arrived I was one of 5 people there.  Then on the way out I noticed a dead roach on the floor, I nearly threw up.  The quality and service went way down with this place which is unfortunate.","date":"2015-07-16 06:55:28"}
{"review_id":"291ihm3Jn7NnPOJnTsyzNQ","user_id":"CrInIRBSZA7HERD_ZzZSdw","business_id":"YfsNZho-s38tB9H30Umpqg","stars":3.0,"useful":1,"funny":0,"cool":1,"text":"My first time at this joint and I will be coming back. My boyfriend ordered the adobo fried rice omelette and it was delicious, a little salty but I'm Filipino and adobo is always salty. I definitely want to try more of their food, when I came here I wasn't too hungry and just ordered a manapua and some fried Mochi balls; it made me reminisce about being in Hawaii. The mochi balls here reminded me of the ones I use to get down the street from my house in HI, sooooooooo ONO!\n\nI wish I had a bigger appetite so I could've ordered the oxtail soup but I'll save that for next time.","date":"2017-02-19 06:53:24"}
{"review_id":"pkQ5fBJLS8hqnq74P1TICA","user_id":"QfJXkZpYFEy7UV_-95N_BQ","business_id":"S4qUsi44l5D9BbUCkhwQEA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Better meat than most buffets I've had in the valley. Pretty new place, but the owners were previously owners of a different restaurant that was sold so seem to have the mixture and admin down right. Very nice people and good service. My favorite on the buffet was the goat---which is usually difficult to find. They did a good job and didn't skimp on the meat.","date":"2016-02-23 19:17:30"}
{"review_id":"KxKoVFyLoT0p21TRZxW0Ag","user_id":"E1vQ3DYxer6IFYKPrrBSxg","business_id":"R9TTzn-Q31vSeFywvVZoTw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"My husband and I are not quite the handy people we wished we are. Now that's where Daniel is a heaven sent!\n\nWe just moved in to a new house and have tons of paintings to put up along with some curtain rods and bidets for our bathroom. \n\nDaniel quoted us a price that was over our budget but he was willing to negotiate. And that was the best money spent! No headaches, no worries. Daniel took care of everything. \n\nDaniel and his coworker were meticulous and got the job done perfectly!\n\nI foresee us calling Daniel again sometime soon for any little jobs around the house!","date":"2017-07-18 18:47:57"}
{"review_id":"Cucq5z4omuIoYgD6gzkZdA","user_id":"yvhQFRshaeLsgoKRkf7YFw","business_id":"2DmTw0k3bcXuHdAyxO_bkw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Breakfast was amazing and the service is swift and friendly! We sat at the bar and were extremely impressed with the morning spirits as well as the food. Our bartender\/server was Daniel and he was excellent as well. When I travel back to Phoenix I will make a special trip back!","date":"2016-09-18 16:39:48"}
{"review_id":"8ldoLBwEriIKitEzY7O2BA","user_id":"p3nNtlww0rZFADq7zAH2KA","business_id":"F9rBpCtu3HhNc1Ktij-x3g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I was a box dye type of girl for years, so much that my dark brown hair was turning my hair black. I was told by many salons I would have to pay so much money to lighten my hair. I had found Heidi on yelp and really liked her work. I schedule an appt, she was affortable and really talented. Although getting your hair from dark to red was a process. She really cares about taking great care of your hair. It has been over 2 years I've been coming to Heidi and she always makes my hair look and feel fabulous.  I love coming to the Hive, to see Heidi and Alli you are always greeted with a warm welcome back, and great coversation. Thanks ladies.","date":"2017-07-28 18:45:18"}
{"review_id":"A1sEC4YVwUJeiRvwPrydZA","user_id":"SEUZc7uDyodRo-bYtrzVBg","business_id":"9F3N2jWo_kqK9A9pC3z74Q","stars":4.0,"useful":1,"funny":2,"cool":1,"text":"Saw Slipknot \/Lamb of God\/Bullet for my Valentine\/ Motionless in White last night freaking amazing show! Parking was free and easy but we were an hour early. Security did good getting us thru...pat down and made us take all lids of water bottles. We were general admission lawn and lots of space to stretch out . Clearly there's gonna be pot smokers everywhere..we were fully surrounded and people never asked to put it out at any point. People were lighting up and roaming around with it in broad daylight.  This generation seems to have no fear of the law.  Guess they knew security wasnt going to be around. ..during the whole 5 hour experience we saw security just once escorting someone out and medics walked by twice. Good time good venue!","date":"2015-08-30 15:52:02"}
{"review_id":"4CZt_I_5PR3Z9LuZSFE--Q","user_id":"mLClww2RMHEEMT8Xk9elkQ","business_id":"-PGsEXB6DFTVKa1eDOlzWA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"MINDY MINDY MINDY MINDY!!!!!!!! She is literally the best waitress I've ever had in my life! She deserves a raise and praise and anything else in the world. I never had an experience like this ever at any restaurants. My husband and I have been to 5 star restaurants and the service doesn't come close to here. Thank you so much you rock!!!!","date":"2018-09-14 02:26:21"}
{"review_id":"po27ncw4oNaa1Y-sRqv-rA","user_id":"U5Sd7-mM5DkOeCuO1igk5g","business_id":"CvonRhKDJaH155xhtpz_iw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Surprise has needed a place like this for some time. Food was good, but the local beer and wine selection and ambiance made the entire experience fantastic. We'll be back many, many times!","date":"2016-07-03 18:42:19"}
{"review_id":"ZgVHHdLebB1gZ2M2eWE05w","user_id":"RNUV7k_Ng4KdasXQMsOo6w","business_id":"ErxACeMyF4hSQyGhpEt4Tw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Very popular lunch spot just off the circle. While there is a rather direct sign on the hostess stand stating cell phone use can lose you service, try the Pad Thai as it's tasty and well balanced. Eating in is better than carry out but can get loud.","date":"2016-11-10 00:02:33"}
{"review_id":"YIMS3PGxfWN5iFIIcYJHEg","user_id":"m7rosN4Yh__tXkWP0_myqw","business_id":"9MnbQg7kfb_WgxoV0hXKSQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This is the best restaurant under $30 per plate in Champaign-Urbana, and it's the best food in that price range that I've had in extensive traveling in downstate Illinois. It's nationally recognized for quality, and it shows in every aspect of their food. The barbecue is flavorful but never dry. The sauces are varied and incredibly tasty. Their sides are delicious. Their sweet tea is to die for. They have a great selection of craft beers. \n\nThe only problem is the wait - they're such a popular destination that you'll frequently have to wait 15-20 minutes (or more) for a table at peak mealtimes, But with their new Champaign location starting to kick off, that might start to get better. \n\nIf you're just passing through and only have time for one meal in Champaign-Urbana, do yourself a favor and make it Black Dog.","date":"2015-06-21 01:54:38"}
{"review_id":"BHg0G81dMJGfV40c4dGJ2A","user_id":"e7vvovEzNPh2D8eY84PIgw","business_id":"uR2GNRdrkY2KeYggp4bCUg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"A good location, right on the Strip outside Ceasers, with good amount of outdoor seating. The food itself was pretty standard; had a decent Denver omelette with uninspired side of overdone breakfast potatoes. Expected a bit more for the prices here.\n\nDecent option if you need something relatively quick in the area, but nothing too memorable.","date":"2017-02-09 06:56:43"}
