{"review_id":"ESFZGfiNmQDBJwllhSk48Q","user_id":"QRxz_IKYAZ-nvMSu-kgfXw","business_id":"fdSvxboyo2-6vTMCvTyRWg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"McKenna Property Management are very professional, well responsive organization.\nAfter finding my townhome to rent on Zillow McKenna contacted me fairly promptly.\nWhen I need repairs McKenna again responds promptly. Their repair people are very professional, respectful of my home and my time. They work closely to schedule repairs on my behalf.","date":"2017-07-18 18:26:20"}
{"review_id":"a4hhwVkd1zOLNk9gs7HARA","user_id":"Q5DxWMyvHgHRA8AX6NIfHw","business_id":"T_YWS3Rp7-iu69VS5jcQPg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This is a new place right by my house. Thought we would give it a try. It was probably the best sushi I have had in a long time. The service was great everyone is very friendly and on top of it! I highly recommend this place!!!","date":"2018-07-17 02:45:17"}
{"review_id":"SbO23moU7jzTebRf-Ru0xw","user_id":"QQfQ-C2MbbJtZJ15WrMzrw","business_id":"Z0c9-Eoxz7SQ__68bl3TQw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very sweet romantic little corner restaurant with excellent service, food & ambiance. Would highly recommend for a nice romantic date or to have a quiet dinner with a friend with beautiful ambiance. We had a steak and fish and they were prepared deliciously and fresh. Prices were very good for such a high quality meal. The restaurant accommodates about 25-30 seated plus there is a small bar. This place could easily be rented out for an intimate gathering as well.","date":"2017-04-19 14:37:35"}
