{"review_id":"LGQzpIajVGjpVWYgDe_lPg","user_id":"ONvLxgKqaB3CThRVh4Dhaw","business_id":"T2tEMLpTeSMxLKpxwFdS3g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"TRY THE BBQ MAHI MAHI TACOS!! This place was on point. Busy as hell and the service was amazing. The food came out fast, hot, and delicious. Chicken Tacos, Diablo Salad, you cannot make a wrong choice....and their Sangaritas are to die for.","date":"2017-06-17 18:10:45"}
{"review_id":"BqSYUYFkUkc6tDqeqQnTlg","user_id":"PyKaQR0VX8KvPUMk7jy8FA","business_id":"ygmzwA3ZHu50TYpMlM45uA","stars":5.0,"useful":11,"funny":0,"cool":1,"text":"A friend had been trying to get me to try acupuncture for years (every time I mentioned that my back hurt), but I would say, \"Needles? No thanks!\" I was recently in Las Vegas the week of Independence Day for a poker tournament and my back was hurting so much that I was having difficulty sitting at the tables for long periods of time. I got massages for three days in a row but got only a small amount of temporary relief. I thought about going to a chiropractor, but remembered how many times my friend had tried to get me to see her acupuncturist and decided I should give it at least one try. Boy, am I glad I did! \n\nThe needles are very, very fine and I only felt a small prick with a few (not even close to either a vaccination or finger stick)-- this was NOT a painful procedure. He inserted 16 of them from my neck to my ankles and then asked me to guess how many were there. I guessed 6-8. I seriously didn't even feel the others and none of them hurt. They then hooked some kind of electrodes to 6 of them (I was lying face down and couldn't see what he was doing) and sent weak electrical pulses through them. If you've ever had TINS treatments, the amount of current was far less (no muscle twitches) and felt as if someone was gently tapping my back in each spot. Then, they turned off the lights and played New Age type music while I relaxed. I don't know how long that lasted (maybe 15-20 minutes?) because I didn't have my watch on, but it was like taking a nap. After this time, they disconnected the electrodes and removed the needles. I felt very calm and a little groggy at this point. I had told him that I would be playing poker later that evening and he recommended that I take a nap when I returned to my hotel. I took his advice and when I awoke, I felt great! In fact, I was even able to walk from Caesar's to Bally's later to catch the free shuttle without any pain. Sure, that's not a great distance, but there is no way I could have done that prior to my acupuncture treatment. I got a second treatment the next day (my last full day in town) and when I left Las Vegas, I was pain free. Just today (about 10 days later) my lower back pain has been bothering me again (though not as severe), so tomorrow morning I will look up the local doctor whom my friend recommended. I hope he is as good as Dr. Lok! If you are in Las Vegas and have back pain, you really need to go to Dr. Lok.","date":"2012-07-16 04:33:37"}
{"review_id":"CByR0CEt_x4kCOYstF5lDw","user_id":"cJshXISsMBDVIiUO_mCl1A","business_id":"AXhTU2DzkI0xhHwqSmqY8A","stars":1.0,"useful":3,"funny":1,"cool":0,"text":"I don't know if this is the correct PODS location, but this comment is about the entire PODS company, not a specific location.\n\nThe whole notion of loading all your belongings into a box and then having the box shipped to the city you're moving to is brilliant and simple...unless you're dealing with PODS. These folks have less than no clue about what customer service is. My brother moved to Scottsdale from Minneapolis. He arrived well ahead of his PODS container. However, when the container did arrive no one bothered calling to let him know his unit had arrived. When he called them he was told, \"Oh yeah. The container arrived last week.\" It never occurred to anyone to let my bro know that his container had arrived.\nNext was the issue of trying to schedule delivery of the unit to his home. Problem is, no one at PODS location has any discernible grasp of how production scheduling works. All they were interested in telling him is that there will be extra fees for overtime because they're so busy. Since when are the internal logistics problems at PODS any concern of the client? Thankfully, my brother is a very persuasive bloke and he takes very little guff from incompetent lackeys. Of course he paid no additional fees, but a more timid individual would likely be held up for extra charges.\nAnd then there's the challenge of trying to contact PODS. All communication and billing are handled at a centralized call center, and it's a typical call center staffed by individuals who are paid far too little to give a crap about people calling in with questions, problems, and concerns. So, if you want to contact the local location to see if the unit has arrived...no dice! You get to deal with a call center lackey.\nMy brother did give a positive shout-out to the guys PODS sent out to empty out his home in Minneapolis and load the container. They damaged only two pieces of furniture and they didn't break near as many fragile items as he was expecting they would, so he was pretty pleased with that.\nBottom line here is that until PODS matures and figures out its logistics issues, timing issues, and customer service issues, you'll do much better with U-Haul or Atlas Van Lines.","date":"2015-11-18 19:10:00"}
{"review_id":"g3qp30wwH1-lgjp1fezMjw","user_id":"1ITKg7Tcga4OmyRh44aNeQ","business_id":"GX9W1U-wsZPqWTgs1_-wRA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I had my hair done yesterday at another salon, by a different stylist. The results were, to say the least, not favorable. What I had asked for was not what I received. I was in a panic as I have an outing planned for Saturday and could not wait the week that the stylist wanted me to wait. My coworker referred me here. I called made appointment, was scheduled today after work and I found Christina A. She literally is a color genius! She turned my orange, uneven hair into exactly what I wanted and what I've been told by many other stylist since moving to Vegas, would take multiple sessions to achieve. They were WRONG! My hair feels healthy and shiny and is the color I have been wanting. I am so happy that I found her and will NOT be going to anyone else. Her prices are super reasonable too! And she makes you feel comfortable and walks you through the whole process. Thank you for fixing my hair Christina!","date":"2017-05-13 08:02:26"}
{"review_id":"FHkko88bs2S7Ec_xxdjdoA","user_id":"Azo9HLEoLJ3T52sO4xRY5g","business_id":"LT0y32F1w2_KGltoU0fSYg","stars":5.0,"useful":9,"funny":4,"cool":3,"text":"These guys just left my house.  They.  Are.  Awesome.\n\nBy way of full disclosure, I'm a male single parent of two (and a dog) that wishes he could afford a cleaning lady.  As such, the carpets in my house were pretty, um... nasty.  Like 'my girlfriend doesn't want her feet to touch the floor' nasty.  Anyway, these guys came in right on time for the appointment and made the place look brand spanking new.  I would give them five stars even if they were some mega-corporation-chain... but they're not.  They're a small family owned and operated business... which feels even better.\n\nThanks, yelpers, for turning me on to these guys.  I wouldn't dream of using another company.","date":"2014-09-09 18:12:09"}
