{"review_id":"yTIAeqL_lKbVkt5S21Tp2Q","user_id":"5gRUrSccw0FQ4QsOTk8gvw","business_id":"6eWtqUKQ73s3xwbT-aYzig","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Took my family to Ohio for a Cavaliers game and we stayed at a hotel near by so we decided to stop at max and ermas for dinner and we loved the food and the service. Definitely recommend this place to anyone visiting the area.","date":"2016-10-13 23:17:37"}
{"review_id":"-qfQLwX0sbiBhOv3iTX9Tw","user_id":"eZfHm0qI8A_HfvXScwIYsg","business_id":"gxfvv12xZo81YcndEusSLQ","stars":4.0,"useful":10,"funny":5,"cool":10,"text":"A Yelp Talk query called my attention to the fact that I'd never posted a review, even though I've enjoyed this spot at Tivoli several times over the years. Yes, it is a Cigar Lounge, housing a large humidor with excellent stogies, but it is more, and worth exploring, even if you don't smoke cigars. \n\nOf course they have a wide selection of single malts, cognac and typical spirits which accompany puffing away; they also have a full bar. The decor is dark and rich, and seating is comfortable; very men's clubby feeling to me, in a good way. \n\nStaff has always been knowledgeable and welcoming, friends who dig cigars like the variety, and the live music we have caught at times added an extra cool vibe. A nice place to have a nightcap in Tivoli. \n\n* cigars to suit any taste or budget * \n\n** nice selection of single malts, whiskey, cognac, and full bar **\n\n*** knowledgeable, friendly staff ***\n\n**** live music some evenings ****","date":"2015-11-18 17:40:51"}
{"review_id":"xy6fh6z0BLTJTrlBP4RT_A","user_id":"L1q7JmtgVNiUC7W5QWuixQ","business_id":"HmsCerK_rub0Ulo0aC0f9A","stars":1.0,"useful":2,"funny":5,"cool":0,"text":"Please thank your head server for telling us to sit far away at a table far away from everyone because according to her our 2yo twin boys are loud. We had just walked in for 20 seconds! \nHer actions made it possible to have an excellent dinner at Bachi Burger. \n\nWe have been there three previous times with the worst sounds made being the little soy sauce dishes being tossed on the floor. \nWe were seated at the last table in the restaurant closest to the restrooms at the time. The same person sat us that time as well. She is a shorter Asian woman with glasses. \nOur boys are not children who cry throughout dinner, in fact they do not cry at all when they are out eating. Because they love food!\nThey are the type who flirt with the other very friendly tall server and wave at the man who brought our iced teas. \nYou lost repeat customers who will take every chance that we get to make sure everyone knows what kind of a person you choose to employ.\n Very rude and poor customer service! I have never had heard anyone works in service industry would talk to customer like that.","date":"2016-11-10 06:59:17"}
{"review_id":"XCkCUTxT_XQ_H-6uhLaiNA","user_id":"GkFG2e5wsr0xOZ6m2dgUeQ","business_id":"oWQaP9yP77B3Au0LAEevdQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is a great grocery store. The staff is extremely helpful and pleasant. I never have to wait in long lines. Whenever I need help there is always two or more workers to assist me. I just can't say enough good things about this place.","date":"2017-07-08 19:16:02"}
