{"review_id":"QFyOAv_6MhRlffV4ScLBUQ","user_id":"V_IVAdPgrwU8AHZN9XT86A","business_id":"ctDi8gEBYcGOGTnlWeiKKA","stars":5.0,"useful":3,"funny":0,"cool":1,"text":"My girlfriend and I came here to get a quiet coffee and snack, somewhere away from the business of the strip, and could not have been happier! The food is delicious and prepared fresh in front of you in an open kitchen area, the owner is incredibly sweet and friendly and takes a lot of pride in what he serves up and the huge selection of pastries looked phenomenal (I was too full from my food to have one unfortunately, but next time for sure!).\n\nI would absolutely recommend this to anyone stopping by for a quick coffee or brunch\/lunch and will be sure to come back anytime I'm in Vegas!\n\n5\/5!!!","date":"2018-01-09 23:57:59"}
