{"review_id":"AsDgK_bOzu_2qhCyOOiDGw","user_id":"kvVzvO0zN3cpCjuMeqGoUw","business_id":"7xt24dNXMG2uqYpp6j6J-Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Food was delicious! Steaks, prime rib, salmon and ahi was cooked to perfection! Sevice was fantastic and friendly! Nom Nom Nom","date":"2015-03-18 23:25:52"}
{"review_id":"87M9v18CMOmGDFFN83KU5Q","user_id":"0DtYzXkkX2LkZ9h6ToP9wg","business_id":"kG_EB5RAsSA3f9HJikI1rw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I went here over the weekend and it was AMAZING. We were told it would be about 15-20 minute wait and it said that was fine and sat down to wait. About 10 minutes later, we were seated. Wait staff was great and food was wonderful. It's not cheap, but you do get what you pay for in my opinion. Great food, great environment!! This will be a regular place to visit!","date":"2015-09-09 19:57:08"}
{"review_id":"TNnD43_dtv_pdGX2r4Xufw","user_id":"L6TOp937H1lZPdcIAdAfOA","business_id":"2qjvYspb3bEmCaw1vmSk0g","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"Been dining with Muramoto for a number of years and generally been pleased with the sushi. However, today my wife and I waited at lunch 40 minutes for 3 rolls and a chicken teriyaki. This has happened several times in the past and seems to only happen when ordering one of the less expensive lunch specials. I finally asked our waiter to check on our order after 35 minutes. When the sushi finally arrived about 1\/2 the rolls we falling apart. All 3 rolls were warm. The tuna roll was about the size of my little finger and tasted as though the fish was off. The cucumber roll was simply chopped cucumber in rice (no flavor or seasoning at all). My wife's lunch arrived about 5 minutes later and it was fine though probably should have been served a bit closer to the sushi.\n\nThis has happened several times in the recent past. I think this is strike 3. Don't see myself going back again.","date":"2017-01-28 01:02:04"}
{"review_id":"qcVRMZ8oBLXLcNf3MtiQTw","user_id":"nuaTD85KOCN6iJIL0d0ltA","business_id":"XUjg4CEx_z51cIKGh_8MXQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Great place, volunteers are very helpful and know a ton. Some of the people who work on the bikes there also know as much. Even if you know what you are doing you will learn something. Having all the tools available and piles of used parts is awesome.\n\nHighly recommended, really fun to work there.","date":"2016-05-19 17:01:21"}
{"review_id":"JecoOwDQe4qQKYbO6fHgwg","user_id":"ESSWEfZZp8vJpldwp2G3bA","business_id":"sFPwx3V1kzXP-N6ZjqAk2A","stars":4.0,"useful":5,"funny":2,"cool":1,"text":"Located out in the sticks, you'll find an apple-fetishist's utopia, The Apple Factory!\n\nI've been familiar with this place since I was a kid, and used to LOVE taking the drive over there. The place is just so laid back, with the giant apple-shaped apple stand on the side of the building, which used to sell candy apples and apple cider, though I haven't seen it open in some time. Maybe I've just been arriving at the wrong time? There's also currently a petting zoo on the other side of the building, with a coin-operated machine that dispenses feed for the animals. \n\nInside is your typical tiny grocery store\/butcher. They do sell many specialty items that you may not find at a regular grocery store, along with pretty much anything Apple that you can think of. But all of that is foreplay to the main attraction: THE PIES. They have their own little pie patrol that bakes the freshest, most delicious homemade pies, I don't think I've ever bought one that wasn't 100% fresh and amazing. \nI've never really been a pie-guy, but this place is different. And if you don't want an entire pie, they also sell slices. Their strawberry rhubarb is amazing. I've never Jason Biggs'd a pie before, but the s.r. has definitely gotten a couple of suggestive glances from me.\n\nAs for the service, the employees are always very sweet, helpful, and have been known to give out free apple cider at times.\n\nI also can't complete this review without mentioning the Apple band. That's right, a Chuck-E-Cheese-esque Apple band is occasionally available to play on their mini-stage...you just have to catch them at the right time. Those apple rock stars can be pretty big divas.","date":"2011-05-27 07:01:13"}
{"review_id":"8S1jQNgcJMsRjgHHC7NRDg","user_id":"-NZ6Eg18X_3zzdNshvpoqQ","business_id":"I-pZYQOdSd7if1Dzxp_UFA","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"I signed up through a Groupon offer. Had I paid full price, I would have given this two stars. The place just opened up, so hopefully it will improve over time. It is disorganized, and we waited for around ten minutes for the one staff member upstairs to help us. I believe he was helping a customer on the phone, but it would have been best for him to have addressed us as paying customers upon our arrival (Hi. Be with you in a few minutes. Have a seat.) When he  worked with us, he was helpful and tried to find games we would like. While two folks can be assigned to a booth, I would recommend only one. I also would recommend that he give an orientation to the whole group to save time. Each person was given an orientation which cost us time, but we were able to stay a few minutes over, so this was less of an issue. Finally, there is a maze activity on the same level. I do not recommend that at all. Some of our party tried it for five dollars a piece, and it was lame.","date":"2017-03-27 01:08:46"}
{"review_id":"mZUaZQx8AdYy2gttlcYFpQ","user_id":"QxODdbA4_IrGIZc2f9Qqnw","business_id":"5_WIWhfkAiKr5FsFQqYN1w","stars":4.0,"useful":2,"funny":2,"cool":1,"text":"Just voted best community pool in Pittsburgh! You'll find the regular pool amenities: shallow and deep ends, lap lane, diving board and snack bar. They also have a slide, mushroom fountain, slide and ample \"lawn\" to sunbathe and relax.  The community \"pooled\" (ha ha!) together to raise money to repair and save.  The staff is friendly, helpful and keeps the pool in tip-top shape.","date":"2011-06-29 02:32:55"}
{"review_id":"4sVS52f0GcBWkYB0ohh2Cw","user_id":"ZLiZlffoD4IdfYitKtnzzQ","business_id":"HKCGlqLNzHJLtFKD7qUVww","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Great service!\n\nOur dog had jumped up our window when he saw a cat outside causing us to be unable to fully close the window.  We were able to get an appointment quickly and Brandon fixed it right up for us!  Would definitely recommend!","date":"2018-02-23 22:55:02"}
{"review_id":"regZBSr4pLm3nrx3BDfPCw","user_id":"dwOyqcUeLZ-CXvK3vLQ0BQ","business_id":"Y3vtXQz3zPc5AVyUAsAj5Q","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"We always come here to eat on lazy Sundays. Servers are always attentive and polite. Pho is always yummy as usual. \nWent here today for lunch and tried their hot pot, 'Lau' or whatever it's called (sorry). It was pretty good and filling for two. Mmmm","date":"2016-07-25 04:28:32"}
{"review_id":"sCaOA17zQ7ZogPQzoM67ZQ","user_id":"hXv_8LrL6yqriayLDfXwIA","business_id":"Jt28TYWanzKrJYYr0Tf1MQ","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I'm surprise this place stays open, I assume it does good business since it's conveniently located on the strip.\n\ntake my advice and save yourself and eat somewhere else.\n\n-they charged ridiculous prices for Mexican food. Expect $10-15 per person for a small plate. I order the 2 combo with rice, beans, chicken soft taco and tamale. It was not filling, and definitely not tasty. \n-chips and salsa was below par. \n-the guacamole was $10!!! for a small serving. The waitress did not bother telling us how much it was. \n-incompetent workers. Seriously, how hard is it get hot water? first time, you brought out cold water. We asked for hot water.\n-Don't bother asking for suggestions, their not at all familiar with their menu!","date":"2010-11-22 03:34:45"}
{"review_id":"wi_iqktwvKdTBwkVj-t9Lw","user_id":"jvyqi5lUnSEjY7uky_ZtFA","business_id":"84WYW7OfV-IXUJk95EL5_Q","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"We went there fairly late in the evening, and the staff was fine with two of our party trickling in late.  The atmosphere is awesome, I'm not sure if they actually revamped an old theater or just faked it very well, but it's quite beautiful. Totally 'date worthy' surroundings.\n\nThe 1st course salad bar had everything from heart of palm to pickled vegetables and cheeses, hot garlic mashed potatoes, wasabi potato salad, as well as the normal greens and veg. \n\nWe were really happy with the meat course - 8 different offerings. The only one i was iffy on was the lamb, which in itself tasted good, but seemed more like it should be it's own dinner thing with some milder food to complement the heavy spicing. It didn't really go well with the other offerings. I love lamb, and wish they could have had something a little less wacky. The Parmesan pork was ok, not great - a little bland. The various beef cuts were amazing though, and I loved the garlic chicken. Our whole party pretty much burst into laughter at the waiter 's suggestion of dessert. Their poor pastry chef doesn't get much call for work, as I think most people do NOT save room for dessert. \n\nThe on tap list was very nice, was pleased to see Crispen cider there (as I am not much of a beer drinker), and the wine list was quite large. Going to have to attempt a brunch sometime.","date":"2011-10-27 15:21:25"}
{"review_id":"kvZ_j-BvvCPHEiMmAkVCCg","user_id":"9oOYZvQRL7qgk3yTxmwYlw","business_id":"KUOa1acSFn6DkO9jp-sn6A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Stopped by this Dave's around 3 on a Saturday for a late lunch.  Food was awesome.  Service was great!   My husband had never been to a Dave's and said he would definitely be back.  We sat at the bar and played Keno.  My husband won $400.   Pulled Pork, Brisket, Beans are just some of our faves.  Give em a try!","date":"2017-12-02 18:18:11"}
{"review_id":"ENQ_OjuToJEyGeQT7W8EmQ","user_id":"51UaY_JKrEOzA1CeEbuDNg","business_id":"TX6BBY9rXOrNlHZdGmbrIQ","stars":4.0,"useful":5,"funny":1,"cool":3,"text":"Las Vegas is a :\"copy cat\" city. If one show goes then all the hotels must have one like it. \nThe tribute shows are making the rounds ( Elvis, Neil Diamond, \"Ledgends\") and this tribute show to the Beatles is one of the very best in Vegas. \nA real  benefit of this show is that the ticket prices are $40 -50.00. A great value when compared to other shows with ticket prices spiraling up towards $175 -200.00\nThe show is presented in two parts, the first part is early Beatle tunes with the four dressed in the neru jackets. The second half is later beatles music with the Fab Four changing into Sgt. Pepper Lonely Hearts Club outfits. The final song is a solo rendition of John Lennons \"Imagine.\"\nGreat stuff, great music and a dynamic ending with \"Imagine. \"\nThis show gets you singing along with all the songs you know by heart - and it does not take much imagination for you to close your eyes and swear that the real Beatles are performing right in front of you. They play their own instruments ( unlike the Monkees ) and have the songs down pat. They even look the part. \nJust really good stuff. Well, well done.\n I just wish it were a little longer. The time just rockets by.\nTry it - you'll like it ....","date":"2007-12-08 22:09:07"}
{"review_id":"sn6ww1iAv5HnbgyEiHm4VQ","user_id":"-fYl3jQQEwmftlTGNERNvA","business_id":"CvonRhKDJaH155xhtpz_iw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Enjoyed a fantastic selection of both theirs and other local brews. Also, had an amazing PB&J Burger!!!!","date":"2017-02-09 04:56:13"}
{"review_id":"G18ecgVZ8RO3mgM8nCc1hg","user_id":"-Cwg2o01k7InVnljQmncQA","business_id":"xlD0MntJ8B0eP_mZJSpggA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Beware the sushi...Not only is the rice extremely dry, but something about the fish is off (for the salmon, tuna, and eel). Honestly, the premade sushi you can buy from your local supermarket is better than this and definitely fresh.","date":"2017-07-18 17:19:59"}
{"review_id":"SCFY3S_8_t3c0KFiuVPsag","user_id":"8x8nzYX3E6n3EtgzRnAXrQ","business_id":"T2tEMLpTeSMxLKpxwFdS3g","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"The tortillas for the tacos were by far the best part.  Delicious.  I am sure that the tacos were very authentic, but all of the dishes were a bit heavy on cilantro to me.  Next time around maybe I can ask that they hold cilantro.  I realize this next comment might sound crazy, but the Mahi was a bit too fishy to me.  In my experience, well-cooked Mahi isn't all that fishy. Check out the queso though, and enjoy the tortillas.","date":"2016-09-06 01:08:25"}
{"review_id":"eNrpm4TpTMvmFfoSyDdKjA","user_id":"4wp4XI9AxKNqJima-xahlg","business_id":"Ph7iO3to0eyvZKqQ1kJ4PA","stars":5.0,"useful":14,"funny":4,"cool":12,"text":"Love love love! I cannot tell you how much I love this winery. It's right in the heart of Pittsburgh! WAIT, better yet... right in the Strip District! Our very own urban winery!\n\nYou must go visit their digs, I promise, you won't be sorry when you're sipping a delicious red or white! This space is really beyond words. As soon as you walk in you feel like you've traveled to some far away castle in a romantic foreign city. It's dimly lit, with beautiful dark wood and a fully stocked bar waiting for you to imbibe. \n\nThey have six wines right now, but the grapes are crushed fresh in house (or at least in the presence of the winemaker, Tim), so you know they're not rushing to produce a mass amount of products, just a handful of marvelous blends! My fave of the moment is the Malbec. I've been really into it for a while now and really love their blend. I honestly have had some pretty bad ones, and this is true to form. I also think this is such a white wine type of area, I'm glad to see a place putting effort into promoting the reds.\n\nBut here's the other cool thing. They have a downstairs area that matches the same cool vibe of the upstairs. It's thee perfect place for an unique event. It apparently fits around 100 and would be the perfect pick for a small reception or a hip party. I wouldn't care what kind of event it was, I'd want to crash it here! \n\nThey also offer custom labeling, so if you ever need a unique gift this is the way to go! This is seriously the way to go for a nice night out. Just go for the winerific experience and leave with a happy buzz!","date":"2012-12-04 03:01:04"}
{"review_id":"XDE7Udyu8KysKK5hNIwOhg","user_id":"trV3UzJZi2vUSMVrHaDIFg","business_id":"ErxACeMyF4hSQyGhpEt4Tw","stars":4.0,"useful":2,"funny":1,"cool":1,"text":"Coming from California, a land of a huge variety of authentic Asian cuisine, I wasn't expecting much of a Thai restaurant in this area. \nBut I was proven wrong.\nThey make some awesome curry! The menu looks great; real good variety of dishes.\nOverall, very impressed. And since I am now living in the area will definitely keep them in mind when I feel like eating some Thai food.","date":"2011-09-26 00:45:55"}
{"review_id":"uQDWkZPmSQ0E903Fwt9L1w","user_id":"N2JbGLHvN8Fmgd03rMJUrw","business_id":"AWgQS5gCddiRcK9ciMhe-A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Sara has been my family portrait photographer for the past 4 years and I cannot rave enough about her skill and the amazing finished product that I receive each time.  After their first session with my 2 month old I was so impressed that I vowed if I ever got married that they were going to be the ones to photograph the special day.  Fast forward to today, my daughter is almost 5 and the wedding is only 7 months away.  They were the easiest decision I made, no need to shop around.  I know for a fact that they are going to capture the day perfectly.  You can't go wrong with Love My Life, they are an easy decision.","date":"2014-05-07 19:18:58"}
{"review_id":"xoW9f2ADGB8805EAQP1nfQ","user_id":"pu_AQig2fw40PshvtgONPQ","business_id":"i066yR2IDP4FWt6p-k9aFg","stars":5.0,"useful":3,"funny":3,"cool":2,"text":"When I saw Ike's had opened up in Mesa, I couldn't believe it. Did my beloved sandwich shop from San Francisco that's always a must-visit actually makes it way to Mesa? Once I verified that this was the real-deal Ike's, I started texting friends and family who share my love of Ike's with the good news.\n\nI must confess that I haven't been to this location yet, but it's only because it's so close to my husband's work so he picks up our order. My guy says this is the best gluten free bread he's ever had. He almost sent back his sandwich the first time he ordered it because he thought they put it on regular bread. He's also a fan of the vegan cheese and dirty sauce since dairy doesn't agree with him either.\n\nBeing a vegetarian, Ike's is like heaven to me. Whenever there is more than two veggie options on a menu, I start to seize up with indecision (in the best way possible). Their fake breaded chicken is so good. It reminds me of the patty used in McDonald's spicy chicken sandwich (again, in the best way possible). The vegan bacon isn't as gross as it sounds although the fake fat stripes are silly looking. I added it to the Reading Rainbow, and it was delicious.","date":"2014-04-01 04:10:21"}
{"review_id":"N5NLeu8i5ofDn0sL3WtFKA","user_id":"eEyoCzTF1ICvs_8hpZk7TA","business_id":"qbiyJvvqK8w8a0Z2rgg8Hg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Marshalls always has good deals, but I hate that the store is very unorganized. I know the store employees can't keep up with all the jerks who pick something out and then leave it in a random spot. It seems that the Marshalls company runs with skeleton crews. It's hard to find help in store some times.","date":"2014-08-24 23:29:36"}
{"review_id":"CWjzk0w-OZwzOmCut-6bvQ","user_id":"iYwDTxhYStsIDHB514ltjA","business_id":"t_yiQnxUDdPPCN2z4QyezA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"If you want REAL, AUTHENTIC asian food, this is the place you want to go. On the wall, you'll find their entire menu in chinese - I love the character it brings to their space! They offer an english paper menu as well - and more \"americanized\" asian dishes. \n\nWe went for an early dinner and did not have to wait for a table. We ordered our entrees and they were brought to us very quickly. Great portion sizes and *amazing* taste. Additionally, the staff were very nice and attentive, and we were in and out in no time at all! \n\nThis is one place that I would bring my asian grandparents to in a heartbeat. They offer tripe, duck, and a wide variety of other dishes that make many feel right at home!","date":"2015-09-23 23:23:51"}
{"review_id":"6ijnT0-Wk14bvh7i1sRHCw","user_id":"6HBNW19BUM4Ngcf0jDC1tA","business_id":"xmARZ_MuSfrQCXP4e8RQjg","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"They have such good pizza. OMG their cheesecake is to die for literally. I think I am addicted to the cheesecake.","date":"2015-08-06 22:43:06"}
{"review_id":"dRwovTzUu1Ne--MkycDo9Q","user_id":"TFpxH4z2iKgQ1HRfAUPrOg","business_id":"8EMNnEN3nQy-T78KXoQxvQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I had a fantastic day here. My husband surprised me on my birthday by taking me here. The horses are absolutely beautiful and the trail ride was really relaxing. The people here are very kind! This is a really great place to go on trail rides I really loved it!","date":"2015-08-19 16:44:41"}
{"review_id":"R2ZOB_-ieTPC-keCv2zVgQ","user_id":"LLsyjn2GZ715AwIPlWZ4Pg","business_id":"tZy8IQbEWVB8DW8NdGc9FQ","stars":5.0,"useful":4,"funny":0,"cool":1,"text":"Great selection and yes they have it in stock ready to go in my case. I went to 3 other established places had selections but nothing on hand.  Either it was 2 weeks away or we only have a few boxes somewhere. I needed over 1000 sqft. upgraded laminate job and got it done with American quality stuff none of the overseas issues on Formaldehyde off gassing.  Thanks Ramin.","date":"2015-05-12 21:10:07"}
{"review_id":"edKwpJG9owOe78QQja9XhA","user_id":"0ZcvUmCe_K2Nely78YXWGA","business_id":"IZKjHtCuRlbhyD1WtGd8uA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Chris is awesome! So easy to work with, allowed us to change plans and add another club on another night. Didn't charge us a thing. And, the best of it all, on our last night in Vegas we chose to go to a different club (Blush), and the whole experience there was just awful. But Chris came through when I called him at 1230am to see if he could hook us up somewhere. Not only did he get us into Playboy and Moon at the Palms as VIPs last minute, we also got free drinks, and a complimentary limo ride there. What a fantastic way to end our Vegas trip! I would definitely work with Chris again and recommend him to everyone!","date":"2010-03-12 22:02:54"}
{"review_id":"plmRyt5TuqjxPXm3lQZHkg","user_id":"48NgfYXLGjyIb42TDIja-A","business_id":"ypfFfR3-PbtoslIhohNstw","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"This is the second time I've been here with my mom. \n\nWe ordered the cold noodles, kimchi soup. \n\nThe cold Noodles were still raw, you could even bite through them. The kimchi soup is suppose to have pork in it, and it had no meat. But it was still okay. The service was another thing that got me. The waitress, she wasn't friendly at all. She came up to our table after we were sitting here for 10 minutes, she didn't even say a word to us, just looked at my mom and myself as if we were just ready to order. Do they normally not greet people here ? Even if there was a language barrier, my mom speaks fluent Korean. She could at least tried to greet us. My water wasn't even refilled. I've been a server at numerous places , this isn't how businesses are handled. It was $40 dollars for lunch speical for 2 people and it didn't even taste good. Ugh!\n\n2 stars because we still ate the food,but taking home a lot of it. I don't think I want to come back here though.","date":"2016-08-12 21:20:06"}
{"review_id":"3jzsvc7iNpyppcPG0dMSrA","user_id":"CK-W4WhlmLKOZF-50WmmpQ","business_id":"7EZ4Eu7YJ1ltRCC5jXFJrQ","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"I was staying across the street at the Wynn and my post-Disneyland Half Marathon legs weren't really up for a lot of walking, so I suggested we check out TI for dinner. I think the buffet at Treasure Island used to be called Dishes or something and I remembered it being pretty good. Unfortunately, \"The Buffet\" as it's now known has declined quite a bit in quality.\n\nFirst, all of the meats are pre-sliced which is crazy. The slices of prime rib were totally dried out and starting to turn grey. The turkey fared a little better, but gravy rescues pretty much everything although either the turkey or gravy was very salty. Speaking of salty, I was curious to try the pho which was, you guessed it, super salty. There is no salad bar here and instead you can get various salads made that looked really good - too bad no one was manning the counter. And finally, the most ridiculous thing of all was the pre-scooped ice cream in dishes which had melted into a soup. On the plus side, the crab legs weren't bad and I enjoyed the mini donuts and chocolate covered strawberries.\n\nI hope this buffet gets their act together soon. Sightly unrelated, but this was my first time at TI in a long time and I couldn't stand the smell of the casino! They pump some weird coconut sunblock smell all over the place which is way worse than stale cigarette air. Yuck","date":"2013-09-04 00:28:40"}
{"review_id":"YKFmBOxN5KxhGNse9nV5TQ","user_id":"o6__ZWGttmlxG87FuHcF0w","business_id":"rP8nyNI_ZWJv8x5mgqMUAQ","stars":4.0,"useful":3,"funny":2,"cool":2,"text":"Amazing service and quickly completed! Other places make me wait over an hour for an oil change or request to keep it in for longer times. Must go, this place is in a slightly hidden location, which in a way is perfect in case you need speedy service!","date":"2016-01-30 03:15:07"}
{"review_id":"8BQThyq6JGmTJ7fpMUGOhg","user_id":"JXe6kxlIEiT0gkXDD8bsMA","business_id":"hIUKufhwR6Ifn7bi0-phLA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"It was my first time eating breakfast here and it was good. The croissant was just like the ones in Paris with a touch of sweetness on top. I had the croissant breakfast sandwich and it was good. The ham was not warm but it was tasty.  The mocha cafe was one of the best I had. I will be returning for more.","date":"2015-06-08 17:33:20"}
{"review_id":"48YT48A1T7Z0W2d4G5h-8A","user_id":"9AXgrU2M4baavs31OjW-XA","business_id":"eoJfl5vG7X87QhcKb0nt5Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"First visit here! Won't be the last!! Bier was Amazing, food was Amazing and service (Beth) was Amazing ++! Great fun environment and felt very authentic.","date":"2018-10-04 18:04:02"}
{"review_id":"NJaMH6_omx796ZxCSf0vag","user_id":"gxhirCx10a8yi0d8rYyigg","business_id":"VlDTUr3y-bdVZDKXEILKfQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Horrible place to watch the NFL playoffs!! With about 25 tv's they only have 5 tv's with the game on. Thought this is supposed to be. Sports bar!! Not coming here again to watch any NFL games. Even asked the younger owner and he wouldn't change the tv's or put the sound on to at least here the game.","date":"2015-01-04 01:21:12"}
{"review_id":"QiyzR5tI-PKuD6qpMLEwYw","user_id":"RF85D8K4ugyKvJns44nPAQ","business_id":"On_ns0CHXLHblOQGwsUF-A","stars":1.0,"useful":6,"funny":0,"cool":1,"text":"Frightful experience. The front staff was very unhelpful and gave me the wrong results and when I pointed out that I was given the results for the wrong hip, they gave me the run around and insisted they had done the reading on the correct side.  Absolutely no concern for the patient and told me to drag myself over to my primary care and have them sort it out.  My primary care doctor was appalled and promptly had the receptionist call them to insist they re-process the results on the correct hip STAT!  \n\nIf you have any work done at this place, make sure you double check the results. Good thing they're not surgeons - gulp!","date":"2013-04-10 23:35:38"}
{"review_id":"NpLb-n6MhplK3MFGL6fD0w","user_id":"ueQFngzO3y1iMSb4GRCMHQ","business_id":"ZOwhzeTaDBO0MY3BBgWhLA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Anna is AMAZING at what she does! After a very frustrating battle over many months with David's Bridal (the devil) and other bridal shops in town, I ended up at Bridalxoxo. Anna was very sweet and comforting. She found a dress that suit me perfectly AND added an illusion neckline. I could not have been more pleased!!!","date":"2017-06-28 00:54:42"}
{"review_id":"hFFprCrcY_zvZ1Bhu-o_SQ","user_id":"eRdQFwGEHvy4ifUYagzsTA","business_id":"bqMEml5HIFSMo4CPfjlG0A","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Gelato. The only places I've tried are Angel Sweet and the place next to Lee Lee's. This place is decent.\n\nThere isn't much of a flavor selection compared to what I'm used to at the aforementioned places, and to be quite honest, this was a slight issue. WHERE IS MY MANGO?!? \n\nI had to settle for Strawberry Sorbet and some chocolate. The strawberry sorbet was more like a smoothie or something, kind of unappealing. The chocolate was pretty good, and I think I might be down to try some cookies n cream next time. I guess if you're in the area and want some gelato, check this place out. If you want the best and a large variety... :)","date":"2010-11-22 06:17:18"}
{"review_id":"mLbWAS1l7DOGbfav-fzqMQ","user_id":"Gh6sagblKhuMpWUDWeQjNg","business_id":"hEUAUdG4fBdYWvPeEASnng","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I was told by Jason that the dim sum menu will begin Valentine's Day! Can't wait to try it then.","date":"2014-01-17 04:24:23"}
{"review_id":"nLcEOljoPcRDOjk7cjt22A","user_id":"pOWp1nbaGLTvIqSXd4BmZg","business_id":"w57TpTKCHN47Cgtajm7_KA","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"Spent over $30 trying to order a new 52 comic book with a hard cover from this store. I attempted to cancel this order via phone today during business hours with nobody answering at all, three weeks after placing this order with nothing to show for it. When I arrived to the store in person to cancel the request, they claimed it could not be done; their reasoning was nobody would ever buy the hard cover of this book, at a COMIC BOOK store. This comment was than followed up with the idea of getting a fraction of the money back as store credit...\n\nGot the same hardcover book for 12 dollars on Amazon in two days.\n\nMy bank agreed, I had every right to not process the transaction due to lack of service, and it was canceled on my behalf and determined to be fraud.","date":"2015-06-21 03:29:49"}
{"review_id":"ksCBNQcdjizeJrI33kxJOQ","user_id":"yLxsIzIBAMNtbSkXEpCvAg","business_id":"surU3O61Ik5CQ_8fbHgdGQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I decided to try this place based on the reviews. I had an appointment at 2 and had to wait until 2:30 to start which is fine because my nails ended up looking good. I was probably in the salon for 2 hrs and all I got was an acrylic fill so it felt a little slow. Also, it cost $50 which was more than I normally pay for that service. In the end, I love my nails but don't think I'll be back because I've been to other salons in Scottsdale that I like a little better.","date":"2018-02-11 03:49:46"}
