{"review_id":"oXCmCKr6GBLhnXwzVt1a9A","user_id":"ruHz-qN-j21kg0iyIgGE9Q","business_id":"zPEYgVqJ2QNKi45FJi2jvg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Slow service. Neglected our table repeatedly. Food came out cold and drinks were delayed by 20-30 minutes.","date":"2018-07-08 06:36:05"}
{"review_id":"iNJJgPGh_9AC2cvyg-R8Cg","user_id":"1iWBY-YEBttE5yhAiWgDmw","business_id":"XZ5eG2IEqu_MuZyTZTcpSg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We have been going to this particular Home Depot since 1989. The customer service in every single department is top notch. Specifically, we had an issue yesterday where we needed help immediately with our vehicle. We had run over what we thought was paint on the freeway. Several employees grabbed different products off the shelves, along with some rags and headed for the parking lot. They worked on trying different solvents to find one that worked. While working on it, they realized it wasn't paint, but instead, roofing epoxy. So, once they discovered what worked to remove it, they donated all of the supplies to us so we could go home and finish the job! We are so grateful to Albert and his team for all of their help yesterday. We knew we loved out local Home Depot!","date":"2012-10-08 15:24:20"}
{"review_id":"HbhEj-zOPHHOZcmVfF1IHw","user_id":"SFrZZViC1lSzTUjEHKm8nA","business_id":"dYmm5468BdWxWgksXpy2TQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I like being given a choice of rice\/noodles\/vegetables or a combination of 2. The turnover of dishes is fast at the time, so the food is hot and fresh. The vegetables are crispy, not limp and overcooked. The food is tasty too.","date":"2016-12-17 02:49:37"}
{"review_id":"Wj2R49IwoJt_XGPopEnXsQ","user_id":"RQlnSCjuqMnhR3Qk6j4KoA","business_id":"PM0A7ZgbxvtbRCj931PbyQ","stars":4.0,"useful":9,"funny":5,"cool":7,"text":"Kitchen items\/appetizers now limited to 3 orders per person. It used to be unlimited, along with all the thinly sliced beef, pork, and sliced chicken, seafood (including crab legs and shrimp), veggies that you can DIY cook in the hot pot at your table.  But for what you are getting and what they are charging, it is still a good value proposition. Come on, for $20 a person without the hassle of getting all the ingredients yourself and the cleaning up afterwards, totally worth it! \n\nI first came to Shabu Grill all the way to this section of LV because of an UYE hosted by Debbie N.  The event was a resounding success, and we pretty much got to try as much of their menu as we were able to stuff down our faces.\n\nSo when a guys night out event was recently organized at this very same location, it was a no brainer for me.  The food is still very good, the service was just as attentive, and the experience just as positive.  The restaurant even accommodated us with extra portable hot pot setups, so 2 instead of 4 or 5 people shared each hot pot.  It just worked out better for us.\n\nThe main reason I like this place is the fact that everything for the shabu shabu portion of the dining experience is DIY, including getting the ingredients from the refrigerated cooler nearby.  I love the fact that I can get as little or as much of something, instead of being forced to finished big plates of one item before I can order more or something else.  \n\nThe DIY sauce and condiments bar is pretty cool.  Not as extensive as comparable restaurants in SoCal, but you get to customize your dipping sauces as wonderfully or not so fantastically as your creativity and inner toque wearing chef would allow.  But it is pretty hard to score a TOTAL FAIL in this minor endeavor, so relax and just have a go at it.  The important thing is to have fun and enjoy this interactive meal solo, but preferably with a small group of friends.\n\nI would totally go back, especially when the weather is still very nippy in the evening.\n\nNote:  There is a \"bar\" in the front when you walk in, but they do NOT serve alcohol at this establishment.  But if you have room for some beer or other adult beverages, there is a PT in the same strip mall.\n\n\n\nReview #2 of 2014","date":"2014-01-17 04:05:45"}
