{"review_id":"aZ_zkRXBbv6vGk5IwmD_1A","user_id":"khgmH4ZcVjxWIyype11kAw","business_id":"AcjO26DmOhqWlfo2s5DUow","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Husband went to get us some food to go from here last night. Burgers were tasty, our steak fries were overcooked and had no salt or seasoning on them. Zucchini rounds were tempura fried and just ok. We also had an order of boneless wings and those were pretty good.","date":"2015-12-05 02:22:08"}
{"review_id":"3vMC1NY-LvfdT4Jq0Umrsg","user_id":"jhAvwTRlr_5wY84M4wELxw","business_id":"tUFMDX155FxhNX3sQb2dDQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Love shake shack.  Came here the first day they opened and have been coming back since. To reviewers complaining about having to wait....you're lucky it's only an hour. Some locations are way more.  Also those complaining about costs, you're getting SOMETHING BETTER THAN MCDONALDS. Seriously.  \n\nGet the shack burger.   Skip the new bacon shackburger.  Any of the shakes are great.  Strawberry is my fave.","date":"2016-07-25 04:04:03"}
{"review_id":"I8ZL3cZoTWqwcJYipihbtQ","user_id":"-koQoVsEGgN03TAgQd_DWA","business_id":"hvOE0XwbC4UPfuHHiC_frg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Dos Mas has to be one of the worst Mexican food restaurants we have ever been to. So where do I begin, we got the menu and there was not much of a selection. So we decided to order from the appetizer side and had the Mini Chimis, rice, beans anda quesadilla. The server brought us some chips and salsa. The chips tasted like old oil and the salsa was clumpy and watery. We got our quesadilla and Mini Chimis. The Mini Chimis had no flavor unless you call the taste of oil flavor. The beans also had no flavor and the rice was under cooked. I would like to say the only thing there that did taste good was the water but that was before the server put her finger in my cup to refill it. Can't say that we will ever make it back there..","date":"2015-11-05 02:49:24"}
{"review_id":"TomwzhbWKwhXgrkjM_5Q9g","user_id":"bHXujstlLp-QuNr72Meprw","business_id":"CprGqTJeCTQQDrl9_Z-IKA","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"Boo!  I was excited to use my groupon for this nearby salon in upscale Dana Park, unfortunately I was quite disappointed.  My first visit I waited on my hairdresser well past my appointment time and was disgusted that the previous client's hair was still on the floor around my chair as well as on the chair.  Then I was covered with a dirty apron, also covered in hair.  I decided to give them a second chance and again was disappointed.  I struggled making an appointment and when the receptionist finally offered an available appointment I was told that they could not take any groupons for that day.  I did finally get an appointment and when I showed up, I was told my appointment was for days later!  Then the hairdresser said I couldn't be accommodated because she had paperwork to do.!?  Too much drama, hassle, and lack of professionalism.","date":"2013-10-24 02:24:02"}
{"review_id":"i0_p9YC3HXjkf2k28y8_yQ","user_id":"VQrHL8gzDlFz0jGbrXq3yw","business_id":"AbHdwEfXJWqGHqabTb5S5A","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"My fave vape shop. Always accommodates me they run out products and they list my number down shoots me a txt once they have stock and i go straight there this vape shoo is roughly 25-30 minuted away from my house and i still go and take the drive to get to this place . I buy all my vape needs. And my favorite\n juice i can only buy here","date":"2018-02-11 05:07:12"}
{"review_id":"fdnYkWFGL7c4EI_fDSGkaw","user_id":"jMgQQwSLjyqSvckG_DvZIw","business_id":"5YKRcvDRdXQBkuL54B_-MQ","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"This is by far the best coffee I have ever had. The owner goes to great lengths to get the highest quality beans he can find and it shows in each cup they brew. They roast the beans on site and take great care with each batch. The cafe itself is cute but the patio is very special. I think the complex used to house art galleries and the patio reflects that. Cosy, eccentric vibe. Check it out.","date":"2009-08-04 00:28:06"}
{"review_id":"JFIaA360N7tI6tVQAvQOFw","user_id":"82ksBgi3GcayHuPE87zD-w","business_id":"kBJfBVaXJtPEKLTov1hJdQ","stars":1.0,"useful":13,"funny":2,"cool":0,"text":"Before I get to the reason for the 1 star review let me give you a little bit of background.  I \"Yelped\" banh mi sandwiches for Phoenix last night because I was craving one and wanted to find out what Yelpers out there think are the best.  I was a bit surprised to see Reathrey on the list as they are not a Vietnamese restaurant, but having patronized the restaurant at least a half dozen times, I decided to read through the reviews.  \n\nMy boyfriend and I originally went to the restaurant after reading the glowing article in Phoenix Magazine.  Our first visit there was pretty uneventful.  We ordered the Mi Keaw soup, spring rolls and the crepe (which by the way was served slightly burned with that side facing down- but I never complain about my food and ordered it again on later visits).  My only real complaint that first evening was the incredibly uncomfortable bench seating.  On subsequent visits we opted for the tables in the center of the space.  I have tried a number of different things on the menu and while having no other Cambodian food to compare it to I find it to be just meahhh.  My boyfriend on the other hand loves the Mi Keaw soup and has ordered it as take out a number of times and is the reason for our repeat business.  In my opinion the Pho at many valley Vietnamese restaurants is much tastier.\n\nOkay - back to the reason for the one star review.  So here I was reading through the reviews when I started coming across the owner's incredibly RUDE, SARCASTIC, CONDESCENDING, DISRESPECTFUL and downright UNACCEPTABLE responses to his less than stellar reviews.  I have three words for you GET OVER YOURSELF!!! I don't care if you are running a Michelan star rated restaurant (which CLEARLY you are not) that type of disgusting behavior will run your business into the ground.  I, for one, will be spreading the word and NOT in a good way.  \n\nSincerely,\nA very disappointed EX-patron","date":"2013-05-07 20:01:31"}
{"review_id":"B4892AsZEEBgTHhNnqU1qg","user_id":"_5hoVyqm1ghfXVymvZjzKQ","business_id":"IhNASEZ3XnBHmuuVnWdIwA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I have nothing but great things to say about Brew Tea Bar. Hands down one of the BEST Boba places in Vegas. I've been here so many times that they know me by name. I've tried their milk teas, slushes, hot tea, & crepes. You can't go wrong with getting anything from here. I will say that the salted foam that they put in some of their drinks is an acquired taste that I have not yet acquired. But, that's just me though. They have a stamp card too so you can get a free drink after you buy 10. I easily went through 2 or 3 of those cards. :)","date":"2017-09-20 18:23:52"}
{"review_id":"SsAH06MwFfe75ooqGww5DA","user_id":"xUhKi3p2BRTEbTHtJz-Hhg","business_id":"I37npEJQHTaodl8pnxp2uQ","stars":1.0,"useful":4,"funny":0,"cool":1,"text":"This last year, I finally saved up for the down payment on a car. I needed one very badly, having been using a relative's vehicle for several months, but that they now needed back. I had planned ahead and done my research, and wanted a Ford CMax Hybrid. My work offered a discount\/cash-back deal through Cars.com, so I submitted the request and my info was sent to Berge. My plan was to take advantage of the 4th of July weekend specials.\n\nI was almost immediately sent an email from a salesman named Chris. He wanted to know what I was looking for in a vehicle. I replied right away with the details... But the only email address given was a generic one, nothing direct. There was no response. A few days later, he sent me another email, this time with a map to the dealership, but with no indication my reply was received. I replied back, asking for some quotes, but again got no response. I was anxious with the impending July 4th weekend, but held hope I could still make contact. I decided to call. \n\nUnfortunately, the only number he gave me was his personal cell. That Friday after work, I called and was immediately sent to voicemail. I got a text saying he was at dinner, but would return my call. I left a voicemail explaining that I badly needed a car, either from him or someone else at the dealership, and that he hasn't actually replied to my emails (maybe he forgot to check the general inbox?) and I asked him to call me  back ASAP. I really needed the July 4th specials. \n\nThe weekend came and went, no reply from Chris. Frustrated, I went to a different dealership in Scottsdale and worked with wonderful people, and that next weekend negotiated a deal on a beautiful CMax that made up for missing out on both the holiday weekend deals and the cash-back deal through my work. TWO WEEKS LATER Chris emails me to say their servers were out of commission, which is why he didn't get my emails, and he would love to help me into a car (this all being said in poor spelling and no caps or punctuation ).\n\nMy brother was a car salesman for awhile, so I have a pretty good idea how it goes. I was only given his personal cell number so he could make sure he got my sale instead of anyone else. I'm also an IT student, so I have a very hard time believing their servers were down for two whole weeks. Either they have the worst tech support in the history of ever, or I was put off so I wouldn't have to be offered a holiday deal. Plus, what, did you not check your voicemail?? \n\nMy experience here was beyond unprofessional. I'm glad, now, that I went where I did for my car. Berge only saw my business as a number. I will never shop with them.","date":"2015-01-03 21:02:26"}
{"review_id":"gDcYkFdvITrNf2TqsCQ3bg","user_id":"M6-A6F0B3kM5i94Kr0XHcw","business_id":"F7EuGx19ChOlv__ov2G9bw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Since moving to the area we've been here a number of times. The place impressed me at first, however lately it seen the food has become a bit normal and giving you the wow factor. \n\nSushi is decent not great, and the hot food is ok. I'd pass this one by until they updated the inside and maybe add or change the menu a bit.","date":"2018-02-01 22:05:01"}
{"review_id":"ztES1_BPxsRazb7Uxr7t3A","user_id":"YLyFQ9VVBoqqPIiUeDvVZw","business_id":"0cf-w9PK5gLkBkitL3bdqw","stars":3.0,"useful":1,"funny":0,"cool":2,"text":"I highly recommend coming here ONLY during the lunch buffet. It is a pretty good value and always delicious. Fresh naan is served upon arrival and the buffet always offers some type of chicken curry or masala and tandoori chicken,palak paneer, veggie curries, salad, sometimes goat curry and a few other options. It also has Chai, but it isn't good. I don't recommend coming for dinner. The menu is a la carte and a bit pricey for what you get. The portion sizes are very small and you don't get any rice or naan. We ordered a goat curry dish and chicken curry dish and there was only about 5-6 pieces of meat in the dish servings. They ran about $13-15 too! We expected a lot more for that price. I think rice and\/or naan should come standard with dishes here (especially in that price range). The service is always spectacular and super friendly.","date":"2017-05-13 05:44:56"}
{"review_id":"07sAml_QmtxYqOHWpjUXWg","user_id":"2NkVhK4-yLprEBeYqqn3xw","business_id":"ZuNJelvkJD4wsXNBRg6t5w","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"First time ordering from here, but was VERY disappointed. Delivery took almost an hour,  but I can forgive that on a Friday night. Food was generally terrible,  but maybe I just ordered poorly. \n\nSummary of my order:\nTofu Pad Thai - bland and awful even with medium spiciness\nCrab Rangoon (cheese wontons) - not terrible, very cream cheesy. I prefer China One for theirs. \nEgg rolls - strange filling  (I wasn't a fan)\nPot Stickers - Fair, but dry by the time they were delivered to me.","date":"2016-05-07 04:35:17"}
{"review_id":"LlDTVW7XMJm9tda61CaohA","user_id":"4r2M6cFPugL7cJmc_6VYGA","business_id":"TBWis7BxQfSxDLWs_3DpoA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"This business is amazing. I was almost finished painting my bedroom when I spilled the remaining pint on my carpet. We called and Sandy answered- immediately told us what to do with the situation and said found us a technician to come out within an hour and a half. She was so sweet and helpful especially when we were freaking out a little bit. The technician gave me tips on keeping the carpet cleaned and got all of the paint out. He was prompt, professional and I wish I had cash so that I could have tipped him! Highly recommend this business, and will be using them from here on out for their services.","date":"2017-12-02 21:28:15"}
{"review_id":"C5q4b-U6t5zA4BkeHTSabA","user_id":"BMm9-bo1Xar-Vm8VMnQ88g","business_id":"gBQH64vIkA-kIDFGM290dw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"From the service to the food this place is always on point. My favorite is the gyro plate with rice and a salad with their special made creamy dressing. Ooo and do not forget the homemade hot sauce! I absolutely love this place. We frequent this place at least three times a month since moving to Vegas in April. I would eat here daily if I could, yep it is that good.","date":"2015-09-09 19:23:55"}
{"review_id":"QpYlzwQSX4bFmThgpT4xgw","user_id":"jmyunODJvYT7n7LCgotAyQ","business_id":"ai8nfTBNvL579cjIuqZajQ","stars":3.0,"useful":4,"funny":9,"cool":4,"text":"In a world gone mad there is very little someone can hold on to as true, as right, as constant. Rex Marvin is that person. Rex Marvin's search for the greatest food and the most huffable gasoline makes him the tragic figure that in literature would get the girl, save the day, and have the most severed heads in jars in his basement (if it was a Disney book).  The good news people, is that all of those things in real life are true.  If you consider a graveside ditch near the freeway to be a \"basement\".  Rex does. Recently, Rex was accosted for no reason.  Rex and his woman, Three Legged Midget Maggie, were minding our own business.  Rex was casually tossing TLMM up in the air until she was able to grab onto a ledge and let herself in.  Rex tossed her and she didn't come down. A sure sign that TLMM has accomplished her mission. Rex turns around to have 4 metro cops staring at him. They were big. They were not smiling.  Rex decided to break the ice.  Rex asked \"How many buy one get one free garden hose or industrial blacktop sealant coupons does it take to get 4 cops to walk away and pretend like they saw nothing?\" The next thing Rex knew he saw flashes of light. Rex smiled. Darkness. Rex woke up on the floor of a squad car while the cops talked about the loser they beat and were taking into custody. It must have been someone else.\n\nRex's left eye was shut but he saw that they had stopped at a gas station. They talked about food. They were getting gas station pasta. The smaller one looked back to check on Rex, and said that he was in the mood for \"frozen noodles in sauce\". Rex closed his eyes and tried not to vomit at the idea. He felt with his food that the back door wasn't closed all the way. Rex dislocated his wrists, slipped off the cuffs, and pushed the door open...and much like the time Rex woke up in Candice Bergen's bedroom...he was out before something that could never been taken back happened.  Not going to jail...no Rex can do hard time...but smelling heated frozen pasta is something that Rex will not endure.  Rex has endured more than most. Remember, Rex lived in drag as Jodi Foster's lesbian lover for 3 years...Rex HAS ENDURED! Still everyone has a line not to cross. One of Rex's is frozen pasta...the other is participating in the underground black market 8 track tape racket...lucrative, but Rex only needs to lose 3 toes to know that some money just isn't worth it. Rex has brains.\n\nRex needed to cleanse himself from the memory of that awful experience...so Rex ran. He crawled. He climbed into someone's trunk. He eventually reached the closest place he could find...Manhattan Pizza.  It is in a strip mall behind a bank and near a place that sells fancy popcorn, and none of that bodes well...but ignore the warning signs and go in.\n\nThere are a few staples in an Italian restaurant, and one of them is the Chicken Parm. If you can't make a lights out Chicken Parm then you should close your doors. Manhattan makes a very good one. The chicken is tender, the batter is crispy, the mozzarella is good and the sauce is great. Their red sauce is excellent. Just the right amount of garlic and acidity. The pasta is always cooked well, never over cooked and mushy. The next is meatballs. Manhattan makes a very good meatball; it is almost all meat and no unnecessary fillers. Lastly, can it make a pizza...a great pizza...and Manhattan...excels! Rex is more the New York style pizza kind of man. If you like a doughy crust, you are a hick, and this place might not be for you. They do put a lot of toppings on it, and that is a good thing. \nThe truth about Manhattan is the same truth people say about Rex Marvin...almost everything is good.  There isn't too much Rex hasn't tried he didn't like. The fried foods are all good, with a nod to the mozzarella sticks.  The pastas are all good and have good sauces.  The Alfredo could have some more parmesan cheese in it for Rex's taste, but you shake some more on and it is good.  \n\nThe prices are too high. Period. The food is good, but Rex finds himself not going because for the same amount of money there are better options. If they dropped the prices Rex would eat there a lot more.\n\nThere are a lot worse places to go than Manhattan especially for the pizza. They do a very good job at New York style pizza, not perfect but a very good job.  They obviously care and try hard to make a quality product.  Sometimes they succeed better than others, but it is never awful. Rex can appreciate that. Just like Three Legged Midget Maggie, sometimes it takes a few throws, but she always tries. She always gives an effort...and in the end of the day...that means something.  Rex doesn't know what it means, but it means something.\n\nMahattan isn't Rex's first choice. It isn't even his second or third, but in a pinch it is good. It is really a 2 1\/2 star place. Order right, catch it on the right night, it can be very good. Normally it is just above good. For the money, you can do better than good.","date":"2012-03-01 00:26:47"}
{"review_id":"iFKNo8gEgKwuWTmRPmJ-MQ","user_id":"SbsUVsP2gkQhJf4L2q4kjg","business_id":"ZWq8Fq13JPDAqt7rPjSwcQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great breakfast! Sunrise special: two eggs, a pile of bacon, hash browns and toast just $5.99. Tasted better than Bob Evans breakfast. I  will be back!","date":"2016-05-19 14:03:48"}
