{"review_id":"84rxDywElzPU2zTaIefdUw","user_id":"Ibl1msXxcsHrzBp8oxTr0g","business_id":"vhKUBKcOm8zOLxeS3XM9iA","stars":5.0,"useful":2,"funny":1,"cool":1,"text":"Stopped in for late lunch, and my son & I agree, this was freshest tasting pizza we've had in a long while!  The girls working here are extremely nice, waited on us, refilled drinks, and cleaned up our table when we were done, and kept smiles on their faces the whole time.  Place is kept very clean too.  I'd definitely recommend!","date":"2016-07-14 23:56:46"}
{"review_id":"RvLD_OLfh1E4R3fVb5YTlA","user_id":"Q4-IBfwUPk3uitiaho_dqw","business_id":"akE-J8ZeBB49YkWzQXvuhg","stars":5.0,"useful":4,"funny":0,"cool":3,"text":"Brought my car in to the dealership (Toyota Autonation) to get my brake pads changed and rotors resurfaced and they charged me a little over $400 on top of trying to hit me with more things I should have done to my car under their care, I also had it appointment with them and it still took them 5+ hours.\n\nI decided to not get ripped for my wife's car (same brake change) so I took it to H-Tech Auto and was charged under a fraction of the what the dealership charged me for the same service AND it took only and hour to do not what seemed like half the day at Toyota Autonation.\n\nThis is the best place to take your car for servicing, but where ever you decide to take your car, just don't bring it to any dealerships ESPECIALLY Toyota Autonation, unless of course you like getting ripped off.","date":"2015-12-05 18:31:43"}
{"review_id":"GZm96aaXZp-wTM03zIS1kQ","user_id":"Fds6mttIFKPsSmY8xfC_XA","business_id":"TspQ9jCczz436RiJHJQYZw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Good place to go and eat. But the meat was a bit dry, but that might be because we waited a while before ate the food. The taste was really good. I think it would have been better if we sat in the restaurant and ate. \n\nI definitely would go back to get some more food here.","date":"2013-11-14 18:20:15"}
