{"review_id":"0S8ZTRohX_Ft0FhN-bzO0Q","user_id":"ZBlSML8YMmfcxNo-zdH1_A","business_id":"kLKtlA3s4Z6wPefSLKDHmA","stars":1.0,"useful":4,"funny":0,"cool":0,"text":"Honestly the looks the girls give my fiancé and myself when we come in for each appointment is disgusting, to feel judged and looked at a certain way for absolutely no reason bugs me to no end, they don't know my life they don't know her life they don't know our ages or one single thing about either of us, to add on to that we have had 3 reschedules for 2 appointments now, 2 reschedules for one single appointment in which we were pushed out one week further and again one week further until they got their stuff figured out and can successfully schedule a consistent appointment schedule, we had our first ultrasound today and the woman who did the ultrasound was just an angry woman in which you are putting your trust in to measure and check your babies health and anatomy, she was rude to my fiancé when my fiancé was asking one simple question she replied with I need to focus right now, just let me do these measurements, to add to this whole ordeal, the environment of this office is just not good at all, who watches murder shows on TV with children present in the lobby and blood and gore all over the screen? We were anxiously anticipating an answer on the blood work we did from our last appointment and was not given a single answer and why you ask? Because they showed that we missed our appointment to get it done and we were told that we needed to get it done ASAP, well if you guys actually communicated to the lab office and did your paperwork correctly you would have seen that we went in a did do the lab work just as you told us to do so, we do our part as parents and are consistent with our things in life, don't try to blame us for missing an appointment to get the most important lab work done, which was testing for Down syndrome and other birth defects, would have really loved to know the results to the blood work for our first child. Thanks! One last thing, to the girl who has the short black hair at the front desk and the dermal on her neck who keeps giving myself and my fiancé dirty looks, if you don't like what you do then get a different job and quit staring you may be unhappy but don't make everyone's life as miserable as yours, all of these reviews speak for themselves I would suggest going somewhere else, ANYWHERE else than this place, I would avoid this place at all costs, save yourself the headaches and anger from the disrespectful girls at the front desk","date":"2017-05-13 09:25:39"}
{"review_id":"48EC-YU6t3B6lipEn2ZotQ","user_id":"uBSMteq_cq9iT1MMGmXtvQ","business_id":"CK-Gv3vqIlWOrKP4fhT8_g","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Home style food was a nice change. Didn't have to wait for a table on a Sunday afternoon. I'm not sure if I enjoyed their appetizers as much as the entree. Everything was really oily. The pizza small is a good size for one.","date":"2016-09-06 01:36:27"}
{"review_id":"lWdYpYvQLVFb2UEXEkB8hw","user_id":"zlQy2mGCbiYzhcbgJ60rig","business_id":"qUPUCcBbn-ugXFSItXLmGw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We ate here about a month ago, on a Friday night. Unfortunately, we had just missed their happy hour pricing. I'm not a sushi (or seafood) person so I tried to go in with an open mind since I was the only one in our group who didn't eat sushi. They all loved most of the choices of the rolls they got, the only exception was the appetizer that was ordered. For the price, it was NOT worth it! Was maybe 4 bites worth of food. There was one other sushi roll that wasn't worth the price but I do not remember which one it was. Other than those two things, the rolls were awesome and they almost couldn't finish everything. \n\nSince I don't eat seafood, I got the chicken katsu. I do believe that it was overpriced for what you got ($14 for 1 chicken breast, a little rice, soup, and a tiny salad) BUT, it was delicious! We are planning on going back to celebrate my husband's birthday there this weekend and I can't wait to order the katsu again and he's looking forward to the Vegas, Dragon, and Blue Flame rolls. \n\nShort version- good options if you don't eat seafood, awesome sushi rolls but go during happy hour, somewhat overpriced but not enough to keep us away for right now","date":"2015-08-06 22:22:55"}
{"review_id":"5QrOT0QGEoFvtGuWk09fsg","user_id":"X4cwQL_JZZnAUyCbOwz3pw","business_id":"ffVS_RgDJOJZNtT79RqS0g","stars":1.0,"useful":4,"funny":2,"cool":3,"text":"How can this place still be open !!!!\nI order a large ox tail $16. Plus tax .\n\nTo start off food was warm looks  like food inspector  hasn't been there for a while .\nA few pieces  of meat that was very plan tasting. \nWorst that I've ever had .  There was no spice bottle around  .\n There a great place just on 10  or sure what made me even go there .\nI blame YELP for my bad decision .\n See picture  of my shiny oxtail \n.","date":"2018-04-27 18:50:17"}
{"review_id":"pUYiK09Tp3lHJVmKgr289g","user_id":"9Jpq9Rtg6xx3nisN-FgGFg","business_id":"yNPh5SO-7wr8HPpVCDPbXQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"We got the chicken club and the prime rib dip!!! French fries and side salad!! It was yummy!!!!!!:) Only problem was not a kids menu. They will make a few items for the kids!!! The chicken tenders... The kids did not like them... Not your normal kid friendly kid coating!!!","date":"2014-06-27 21:04:25"}
{"review_id":"T0UrQPLsEB6zdpMTTK38Ug","user_id":"2xfTH1pK3gPtpEh4Gz_Y3w","business_id":"s6EMPZrpNorn9KP2TSkc_g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Joe, Mindy and Terry were so helpful and friendly. Great affordable but elegant wedding venue for ceremony and reception. I didn't know a place like this in Phoenix even existed with all the trees and rustic house.","date":"2011-10-27 18:17:17"}
{"review_id":"j3u0SAkXNcaKQXxdUVDL4A","user_id":"SehV0pAEJNVJvd5_5rtTyg","business_id":"tSJTbxhAO1tJMSdeTCiZwg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I've been here a few times before and thought it was decent. A friend is moving out of state and we were gathering for a good bye party for her. I worked a very long day but made a special effort to get to the party at OP. I did have my 2 yr old tot on my hip as I didn't get to see him since he woke up this morning and his bedtime wasn't far off, so I didn't want leave him with a sitter and therefore not see him at all. I wasn't planning on staying long. When I asked the hostess about the party that I knew was already seated, she informed me I couldn't go in since I had my son. She said they have a strict no one under 21 policy at all hours. I read a review from January that mentioned  kids, and they don't say that on their website, but ok. I explained the situation, and asked her if I might just visit the table to drop off the card and let my friend know that I couldn't stay. She said no. No offer to take the card in for me, no offer to let my friends know that I was outside and not allowed in, just simply no. And so, that will be my last visit there.\n\nUpdate: the GM reached out to my friend who booked the party, and then mailed me a personal letter of apology and a gift card. Went there after the first of the year, received great service, the food was wonderful. Nice change from the prior visit.","date":"2014-02-05 17:57:19"}
{"review_id":"zqZb_gF0JUeG3bMIurYduA","user_id":"EBwGWhbi49i2DBF61hVybg","business_id":"Er5XAY2UFGGqBHdqpeCFkA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"A while back I reviewed this restaurant, and just went there for lunch today with my friend Keith. As always, the food is so fresh and delicious. I had the Asian Pear and Goat Cheese salad, and Keith had the Poke Salad and a sushi roll (not sure what it was). All were beautifully displayed, and tasted amazing. As always, the service is impeccable and prompt. Very romantic for dinner, and a bit lighter for lunch. If you are looking for a modern style Japanese restaurant with super fresh and beautiful food, try this place, you won't be disappointed!","date":"2017-07-18 17:59:57"}
{"review_id":"te0ERBUawu-23UljhIYGRQ","user_id":"yOM891kAdwni5ecnGsQcWw","business_id":"irz64oYL4VYgHWyzvO6_FA","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"I haven't been to this place in years, although it's painfully and tauntingly close to home.  Reason being that the service sucked, and the food was marginal.\n\nBut, Ari was closed last week when I had an afternoon craving, so I thought I'd give EE another chance.\n\nBIG mistake and waste of $25.\n\nI order tempura and sushi to go.  The sushi was beyond aromatic (smelly) and the seaweed wraps were so stale, I couldn't get my canines to rip through it to even chew the food.  The tempura was made in what seemed like pancake batter, it was so heavy and unappealing.  How hard is it to screw up something fried?  Ask EE.\n\nBasically ended up taking a bite of everything, and then throwing all of it out.\n\nNever again.","date":"2014-01-17 01:59:01"}
{"review_id":"VA1a9iSDHFjvgjjgkJQyaw","user_id":"dEDId4Rp2JpblIfYIoH00w","business_id":"bPABsVXUwS8RlVd5uZS8Pw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"The first time I was at El Cafecito, I wasn't all too impressed. I remembered a number of dead wasps or flies on the windowsill beside me. Ever since then, I dreaded going back. It was not pleasant being in a cafe that wasn't so clean (chilling with the wasps, does that sound like a good cafe experience to you?).\n\nBut second time was the charm when I came in, impressed with how full the cafe was. The previous year I went, there were a lot fewer customers. However, despite being full, the cafe was quiet as people worked away or kept their nose behind the newspaper. And no more bugs on the windowsill! Yayy!\n\nTo get in touch with its Latin American roots, El Cafecito offers dancing lessons after the cafe closes down and changes the place into a dance floor. They have tango every Wednesday and salsa every Thursday between 7 PM to 10\/11 PM. So if you are looking for something new to try, why not with some fun dance lessons to bring out your inner dancing queen\/king? With some coffee on the side of course.\n\nOverall, I think this is a sweet place for people who would like to study or work in peace but still be surrounded by people (does that make sense?). It's one of the reasons why I whole-heartedly love cafes: in order to work with an environment full of people. Despite it being full, for this trip and the one I did after, it was as quiet as the library, except for the light instrumental music in the background.","date":"2013-05-28 21:05:17"}
{"review_id":"_jGgv0Obavm9Z8eztRRMPg","user_id":"o8gCgAuBdy7OdmU7jxjW1g","business_id":"VUADGMPLJoWqhHb1G4LIcA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The staff here are so friendly and happy it's impossible to leave in a bad mood. Huge portions of a variety of vegetables for a cheap price. Everything on the menu is delicious! By far the best vegetarian joint in the city.","date":"2016-11-21 22:06:59"}
{"review_id":"WsfafXYazTJURlxKWEXnag","user_id":"DzQqwNMb1v5fZtW6urXd1w","business_id":"ypfFfR3-PbtoslIhohNstw","stars":1.0,"useful":5,"funny":3,"cool":2,"text":"WORST SERVICE EVER . AVOID AVOID AVOID \n\nI came here for my birthday dinner and made a reservation for 10 .when we arrived we got two tables one got all you can eat and another got the woonam and couple choice. Each one you can choose 3 meats and get soy bean soup. So while we were ordering our meats ( that was available on both sections ) she was saying how we choose too much from one list , so we ordered 4 meats and two portions of two of them.\n\n- we asked for water, received it after 20 minutes of asking and we never saw them again \n-asked for soybean paste never got it \n\nAs we started getting full I noticed that we had only gotten one soy bean soup and nothing else, later when I had to go pay I asked about our soups and she said \"oh, you didn't get it, I guess I left it at the wrong table \" like wtf? not even an apologize.\nAfter we received the check and people pulled out cards and cash she started to sigh and look annoyed so I just paid and left. It wasn't until after we paid and left we realized we never got one of the meats. \n\nThis is out raging how horrible the service is , the food was good but it can't make up for how horrible the service was .","date":"2014-09-09 17:40:51"}
{"review_id":"8W4vZqxcddWEampxEIH6Og","user_id":"g-_TsZNEJ_hls717NuGekw","business_id":"TShoU62Hm-4wH2EzwkJbrg","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"Way over price for the entree. Too much msg ! Got so thirsty afterwards. Sad that we don't have a decent pho places in the north Scottsdale area.","date":"2016-01-30 01:29:14"}
{"review_id":"rnBpIijl7PBBb8lCmWYnyg","user_id":"M1mSvucWF3V1h0L98okb9g","business_id":"nQxYkbV4P2h2HqJB0nfpxw","stars":5.0,"useful":5,"funny":1,"cool":3,"text":"I went to their pizza \"rodizio\" yesterday, which is happening every Thursday of this month. For those who still don't know what a rodizio is, I'm saving you a Google search: you pay an amount and waiters keep bringing you food until you say you're full or you explode, whatever happens first.\n\nI was expecting to eat just pizza, but they had a small pasta and salad buffet that was included in the price of $20\/person. The lasagna was awesome - of course I didn't try everything because I was there for the pizza, after all.\n\nThe pizza slices are smaller than normal so you can try many different kinds. The \"Portuguese\" (ham, cheese, egg, peas and onions) and the four cheese (mozzarella, parmesan, gorgonzola and catupiry) were the best ones, in my opinion.\n\nPlease, go ahead and make your reservation. You won't be sorry.","date":"2010-05-14 15:59:54"}
{"review_id":"p7ld33-FT5GeiSXJdo7bmw","user_id":"Dln9H9qc9EbKaC-c0FCFFA","business_id":"08JPvTyVYt6I4PbGkQ76jQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Today was my first time at firehouse! Never have been before and decided to check it out. Cool atmosphere, clean and I love the firehouse theme! The staff was very friendly and food was out super quick! I ordered the medium beef and cheddar brisket sub- delicious! Everything was very fresh! \n\nI drive  by here all the time but never stopped! I definitely will be back!","date":"2015-12-05 02:47:33"}
{"review_id":"3x6IbtwzL0o1U_JX2nvwXQ","user_id":"xftnxppMN_gUt5oknMu4dA","business_id":"NWlNMG_eBIvDjCcHK46eDQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great atmosphere. Good food. Big Blue Van beer has a great blueberry flavor. The Texan and Patty melt are delicious.","date":"2017-01-14 20:33:03"}
{"review_id":"sxLt8xvD5gFoxRRmeN5q_w","user_id":"xSiaSnRfXBVZstO9LBNRaA","business_id":"c2YDEpYQ-2IqB57tN0HKbQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I have loved this place ever since it opened. I've never had a bad drink here, and I find it fascinating to watch the incredibly hipster staff make them with so much attention to detail. I love the way they serve you a glass of bubbly when you first get in.\n\nI also really enjoy the food - you should definitely consider ordering snacks to go with your cocktails! They rotate the menu so it's hard to keep up but everything has been delicious.\n\nWhat keeps me from giving it 5 stars? The prices. The price of even standard drinks (e.g. a gin and tonic) is a little high for my liking. I would come here all the time if it were just a tad less expensive! I still come here at least once a month because I just can't resist.","date":"2015-07-03 20:44:01"}
{"review_id":"9Y6ljiEMFcU2PTKHg-zsow","user_id":"ibJb_abK_o19V28_MB33qA","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Stayed here again June 21-24. Elevators are fixed. Most rooms updated. I really like this hotel :)","date":"2017-06-28 00:16:26"}
{"review_id":"xcOO-2QQMENaosTGjStEhg","user_id":"eqav5CqqFPgqEjCTUVH_nQ","business_id":"8le6TQQwjAw_UQ67L8-Hpg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Tried it for the first time, I got the 2 tenders with fries, came by fast. You dont order through a soeaker, someone comes out and takes your order. The girl who took my order was extremely nice. Everything was great! i will add, the tenders were a bit salty, but still good!","date":"2017-04-07 22:00:53"}
{"review_id":"QE6JCyys7Mijp5bLVBu2zQ","user_id":"P72XL2i5H1a_pd4wiGvkdg","business_id":"pWJoOfYUWSkro0WNxHspFg","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"What a awesome meal! The chicken pastina was served hot and serving size was big, enough for 2 meals. The lasagne was a large portion and perfect temperature!! The atmosphere was not your every day restaurant, when we walked in there was fresh baked bread cooling on the tables! It was delicious!","date":"2013-08-03 17:47:13"}
{"review_id":"_8DNICsYCbIm8-zxWKZPxg","user_id":"7XXcCSOP1j6Kz2A2EZpaew","business_id":"7xHbnGo4MXFkBm6gYSu_xg","stars":2.0,"useful":1,"funny":1,"cool":0,"text":"Oh my gosh!  Italian tuna sandwich?  Honesty, it had about three table spoons of tuna with TWO HUGE pieces of focaccia bread and a hint of vinegar!  THAT is not a tuna sandwich.  THAT is  focaccia bread with a hint of tuna!  Pizza was really good!  Fountain drinks we're $3.00!   Never again will I eat here for the money they charge and the conservative portions.","date":"2018-06-25 02:39:57"}
{"review_id":"6y1RrPT-NflaPyIiN1UaQw","user_id":"_J4u2AOsuWhUmCAPnnAIiQ","business_id":"lGy7jJ9oVZUJNkmZj7ewgA","stars":1.0,"useful":0,"funny":2,"cool":0,"text":"Garbage! How do you mess up breakfast? Was on vacation in Vegas, tired from a full day of traveling, just wanted something quick. The eggs were mushy,\nTaste like instant eggs with powdered cheese. One slice of toast, burnt on one side and not even brown on the other side. And to top it off the potatoes were French fries. Please don't waste your time and money eating at this place.","date":"2016-02-23 18:55:05"}
{"review_id":"U6r-_yAmvNCnE5w35c7dWA","user_id":"VmRad5bBsorlNZbE1gyNFQ","business_id":"tInrGCzll4k9hF34Ye1rvQ","stars":3.0,"useful":3,"funny":1,"cool":0,"text":"I went for restaurant week and I will say the service was on point once we were seated.  For starters I made reservations online for when they first opened at dinner.  After making my reservations online, I was promptly called to verify the reservation and to be informed that if I am more than 5 minutes late then I will get bumped to the waiting list.  Well, I was 10 minutes early and ended up waiting 15 minutes after my reservation to be seated...double standard?\n\nThe salad bar was on point with many different things to try.  My favorite was the seafood salad and the assortment of cheese.  As for the meats...I would say nothing particularly stood out in my mind.  I do remember thinking this one meat I tried that garlic flavored was good but clearly not memorable since I can't remember the name of it.\n\nI can't say I will personally be back but it is worth a try if you have never been to a brazilian steakhouse.","date":"2015-08-06 21:03:16"}
{"review_id":"zQeJzep_nGoxq7Z98xJ2BQ","user_id":"eTqEEhDaNPby1oZXFL1eoA","business_id":"7_LXJ_VFRMGT0NvuY0sgRQ","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Absolutely recommend this organization. First class experience. I used the valet service and when I came back they had my car running with A\/C on and trunk open and a person there waiting to help me with my bags. When I gat in the car it had cold bottled water in the cup holders for me and my wife.  Quick and easy on 99 degree day. \n\nI highly recommend!!!!!","date":"2015-07-16 13:26:27"}
{"review_id":"QXfjeiE5fNvq50lLEcv1yw","user_id":"-WnJbMzRQVBQv5sWfZJi7A","business_id":"nFR7dDedxRuBeZz_6Cdalg","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"Great service and atmosphere. The food and drinks are way overpriced though. If you like your Mexican food mild to bland, this is the place for you.","date":"2013-12-07 03:50:25"}
{"review_id":"8-eTobMdNAntA9tCtHkHvg","user_id":"BWFF5dX7oE5F-IB8hc36Kg","business_id":"ESzO3Av0b1_TzKOiqzbQYQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Microbrewed beers are only a plus to me when they're better than the beer I would have drank otherwise.  One waitress I had while there tried to split the uprights between macrobrew and trendy by describing one of their beers as \"kind of like Coors Light\".  If I wanted Coors, I'll pay half as much and have one.  \n\nThe food is actually a saving grace, as it was pretty good.  Head next door to Sing Sing for drinks, though.","date":"2008-12-03 19:20:36"}
{"review_id":"-n5wYHOGauD-DlPCV9vlew","user_id":"UXytoH5MrajQsxbSFliPrQ","business_id":"40-eN4XnHWSpERxbjW8rcA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is why I am giving this place 5 stars. Let me start from the beginning. I was invited to a wedding for November 26. I planned my whole trip from Denver, Colorado the whole month. I bought an expensive dress and made sure I had everything I needed for that special day. On November 25th I don't know what the heck happened but my neck Popped! \n\nYeah my next popped and I could not move my neck! I swear I cried all day because I was in pain. I stayed home thinking by the next day I would feel better. Nope. I was worse. So I looked up for a chiropractor. Keep in mind I also don't have health insurance because that is expensive as hell. \n\nI find this place and it has 5 stars. I call and this amazing nice lady answered the phone. I forgot her name unfortunately but she was so sweet. She told me to go in and the doctor would see me. \n\nI go in and immediately they start working on me. I apparently tore a muscle and that is why I was in pain and could not move my head! I was scared and I talked to Dr. Brandon Wentzel about the wedding I was going to be attending at 6 that day. He promised to make me better and that I would be able to move. \n\nGuess what? He did! I left the doctor place able to move and even though I still had pain it lowered from a 10 to 1! \n\nSO happy to have been able to go here and have two people take care of me and make me better. Thank you so much. \n\nPlus it was not pricey and did not cost me an arm and a leg!\n\nThank you so much!","date":"2016-12-04 02:17:49"}
{"review_id":"Gsb3NmP9vDgKOf_1iQPZvg","user_id":"S5oMD5z3sQ2K93UunjBBUQ","business_id":"LkmRdUKz7cKNls3BpKHxRA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This place is super nice and has a really cool trendy ambience, which is something you don't see often with Mexican restaurants. \nCame here with a big group friends and they were playing pretty loud Latin top 40 which was really fun for us but would maybe not be a great place for a date night\nThe food and drinks were a bit pricey but the flavours were definitely there and from my little knowledge of Mexican cuisine it did seem pretty authentic! I got the stuffed pepper which was around 20$ I think but it was delicious and I would totally recommend it! \nAll in all a really cool and authentic place that I would recommend","date":"2017-07-28 18:59:46"}
{"review_id":"kDmK2q5WBiboWkSAVjeWZQ","user_id":"qSH7p_vKcDY02LhxHjjfMw","business_id":"EjzMHfwqAmj7BgdzQjquRQ","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Wow! Was invited to lunch there last Saturday and it was awesome.. The owner greeted us at the door and showed us around.Great Atmosphere and you  can actually watch  them make your food. The Murals were breathtaking and the staff was incrediably Friendly!  Our Food Server was Talia and she was AMAZING! This is a place to put on your bucket list!\n Great Service and Awesome Food!\nASK FOR TALIA!!!\nWe'll be back!","date":"2017-07-18 18:42:55"}
