{"review_id":"KPTzkqn84CuTRAvvCwCCeg","user_id":"UTkvIBuXLX75HSm-7DAmmg","business_id":"luPvNx4XSxaM7pka8EifuA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I'm writing this based on the service and not the food... since i didn't stick around to taste anything. My partner and I wandered into this restaurant and were seated almost immediately. The restaurant was 1\/4 full and that may be an exaggeration. I noticed right away that the wait staff looked disorganized. Eye contact with several of them was made in hopes to get a greeting and drink order in. Ten minutes later, new guests walked in and were greeted\/served, while I sat around waving my hand to get attention. Nope didn't get any. Walked right out of there.","date":"2014-08-10 21:33:29"}
{"review_id":"Inwlsqdts6deoFNpkqPetg","user_id":"kJ4F3mKCwVt-eC6qqoTysA","business_id":"x9p1WdRz7FSRy0Q38PiGlA","stars":4.0,"useful":1,"funny":0,"cool":2,"text":"Great Italian sandwich, made to order! The milkshakes are fantastic as well! Excellent lunch and solid customer service. I'm a fan!","date":"2015-08-30 13:11:55"}
{"review_id":"TMifuTTKWPvCijgxYmKuWw","user_id":"We3Bp7FXfnvBz4742UGsXQ","business_id":"AMN3Sgns9tB2x-b3eWk0qQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I have been going to this place for a few years. They made a point to know my name and it gives me the warm and fuzzies! I would say everything is good except I am not a fan of cold spring rolls. I love the presentation of the pho...you get a friggen salad to make your own little creation. The mango chicken is awesome and something I crave often. They make a great Mango spicy shrimp salad that rocks with a little kick. And their Chicken fried rice has ruined me for so many others. It is so good that I can't eat it anywhere else! Great for Carryout or dine in.","date":"2010-11-22 16:56:54"}
{"review_id":"Ktos7oPUijzxG_DOEjPiHw","user_id":"SLyyJdW0TDljb8BhLvugIg","business_id":"AFgPDQm_pczo5uV3yQBgwg","stars":5.0,"useful":1,"funny":0,"cool":2,"text":"Our first time here and I have one word for it... DELICIOUS. I ordered the club and their pesto is perfection with the havarti cheese. The waffle is buttery, not sweet and not too much where it would be too filling. Even their fries are amazing. I will be back!!","date":"2015-07-03 21:52:56"}
{"review_id":"J6i39t1UDEJdcJS3bQ5AWQ","user_id":"9Wn0uZZuLN6_NCEQ-o9n7A","business_id":"UByM7N0mF-ylIGUuIWHCtA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I think I reviewed this already but....\n\nYou expect a great steak with great service to be a bit  expensive.  You get what you pay for.  \nThere were 8 of us and we had reservations..  The service was great.  The food was great and the wine list was a book of great wines available at all prices.  I will be back to try their dry-aged bone-in rib eye.  All of us that the whole evening was wonderful.","date":"2017-08-28 19:32:27"}
{"review_id":"89qSBHnkQ9p2VysSi-1tsQ","user_id":"L5JFnETi16y2gNiESXBYeA","business_id":"6kkxRV8H9SQLybj0xnEbMw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"7-18-2015  I don't normally  write reviews for places that have been reviewed many times by others as I think it's redundant, but I recently ate lunch at Green Valley Ranch Buffet and was pleasantly surprised that the quality of the food was so much better than the other Station Casinos that I thought it deserved to be reviewed.  I visited on a Saturday and the Casino was very busy.  There was a line for the Buffet and it took about 20 minutes to get in.  I was seated and noticed that the chair was comfortable, something I hadn't noticed before.  I tried samples of various food.  The Chicken was cooked properly and had a good flavor.  The Mexican Rice was really good as was the taco meat, seasoned well and was tasty.  The BBQ sausage was good, and so were the BBQ Chicken Wings.  The BBQ Ribs were tender and tasty.  I had Apple Cobbler and Carrot Cake with frozen Vanilla Yogurt (Ice Cream?) on top.  The quality of everything I ate was better than what is served at other Station Casinos.  The service was good and my drink was filled as needed and dirty plates were removed in a timely manner.  The wait staff was busy but were friendly and asked me if I needed anything several times.  Sometimes it's the little things that make the difference or add to a pleasant dinning experience and I think GVR got it right this time.","date":"2017-01-14 22:33:58"}
{"review_id":"tNJT32EwUYoIZEIGjTNRJw","user_id":"oWkqynBXgPy9db7GijMTwQ","business_id":"hIUKufhwR6Ifn7bi0-phLA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"What I love about this place is that the owner Olivier and his parents (The Chefs in the back) care for you as a person and prepare your food and coffee with that in mind.  I was speaking to Olivier and mentioned my dietary changes and he offered to make me an Almond milk Latte with stevia, and his mother made me a healthy spinach omelet.  You can't find this type of service and care anymore.  The Baguette Cafe experience is well worth it every time!  God bless.","date":"2013-08-15 15:59:45"}
{"review_id":"v-AjqZQGqLNrs0cy8VjNJA","user_id":"gtbTQDg1vmtnmgOcnbp_zg","business_id":"wjLgM9Ybe5shoUPRrGMmsQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"New favorite brunch spot in Pitts! Notorious for a wait but great coffee nearby at Espresso a Mano and shops to explore while you wait. Ordered the Eggplant Benedict. Never seen this on a menu before and did not fail to impress. Crispy fried eggplant, poached egg with a pesto hollandaise sauce and roasted tomatoes. Extremely delicious and was worth the wait!","date":"2012-11-06 03:20:51"}
{"review_id":"2isZMSpy-_PCd0Erja_5lw","user_id":"SGoRQS17lLzewYPFEZ4yrg","business_id":"I7ZzsHeuf1IQyrG3JyECmg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I just moved to the area and ran into this restaurant. They staff was super friendly and took their time to explain the varied menu selection. The food was delicious and on top of everything, the place was super clean. I will definitely be coming back!","date":"2018-07-07 21:57:08"}
{"review_id":"i4piJ8E8XX4FY6HZjnoFfw","user_id":"SL32HFx_HMtO_tOpjkF4MA","business_id":"1u_FbiGTSTCc1XvvoT2txw","stars":1.0,"useful":15,"funny":3,"cool":1,"text":"If ZERO stars were possible this gym would be getting that from me. My husband went to this gym today with the 14 pass and at the end of his workout inquired about membership. The lady he spoke to was extremely rude. She told him that he should not have come in without checking with someone first ( mind you that the staff does not show up till 9am and he began his workout at 7am). After scolding him for being at the gym she asked him to leave and said that they were very selective in the people whom the allowed to join their gym. I'm not the type to write reviews but obvious racism is a very good reason for me to break a habit. The lady was very condescending. She is Caucasian and my husband is Latino.","date":"2012-06-26 05:44:51"}
{"review_id":"9HPFq0BPuNYAadgcyzrFcA","user_id":"_Gxh54UrguA_Nz673I5bqQ","business_id":"ZCzey5aPhd7jYIoHsUfjmQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"If you're ever in Phoenix for whatever reason, this is a must try.  I am a huge fan of pork so of course I got the pork belly ramen bowl and it was amazing!  However, my first choice would have been the duck curry bowl, but my stomach was at odds with me that evening. I must add everyone at our table felt the same way with their choices on the menu.  Didn't have a problem getting seated on a Saturday evening and we even sat outside with the heat but that was even a pleasant experience with the misters outside and no we didn't get doused with water;-)","date":"2015-09-23 23:51:27"}
{"review_id":"g99VuaOffUjEMUaMdPOzlQ","user_id":"Qh4s4cirOrG8MdaIbH6Udw","business_id":"ysJo5Jdo29XOBCnKrbUKWg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"The food here is phenomenal! But the service was awful the second time we went there. They rushed us and said they could only seat us until a certain time. The server (blonde) was very non engaging and made it obvious she was annoyed. Their food is unbeatable but sorry, I won't go back there no matter what after the horrible customer service.","date":"2017-12-02 19:21:02"}
