{"review_id":"BpIvHTbbxN26jbpmr0MISQ","user_id":"C7M0oEttXPDR4efWeSXMUA","business_id":"cLx7rt6JTTMU6aO4kBPLnA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Amazingly Awesome!! The food is amazing and so tastey. My taste buds had a party in my mouth its so good. You can see the rotisserie so you know everything is fresh. The staff are super friendly, inviting, and laid back. We came in 20 mins to close and we were going to take our food to go so not to hold them up from closing and they invited us to stay and told us to take our time and enjoy. We also got samples of their bac lava and it was so good (not too sweet or sticky).  We will be regulars here and bring friends with us as we just moved into the area. \nWell done.  Love the food and customer service.","date":"2016-09-06 00:47:02"}
{"review_id":"SgPy23x-lFnkHB2NUGWbPg","user_id":"oerw70Uc1dQl8t-86fOUsg","business_id":"uPa5hrWmHm0n1l4MSyVMGQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"We dropped in for dinner at Aloette for the first time this week and I'm glad we did. This is my favourite  new restaurant of 2017. Aloette is the casual sister to Alo, upstairs. The room is long and narrow, and feels like a cross between a classic diner and an upscale train dining car. Waiters bustle around the tight space creating a fun, busy atmosphere.\n\nWe sat at the bar. No reservations are taken but we walked right in at 6:00.\n\nWe started with beef tartare and fried smelts. The tartare was good and went well with the fresh horseradish included. Smelts were crispy and lightly battered. A nice surprise were the fried jalapenos that went surprisingly well with the fish. The real star though was the free cheesy toast and butter.\n\nThe mains were absolutely delicious. The cornish hen was cooked perfectly crispy and was an umami explosion with mushrooms and spinach, but could have used a tiny bit more salt and\/or sauce. The burger with fried cheese on top was fantastic. Now that the Harbord Room is closed I think this is now my favourite restaurant burger in Toronto.\n\nFor dessert we had the apple pie sundae and a cup of strong coffee.\n\nService was impeccable. My wife was given samples of two wines to compare when she couldn't decide, a touch that I always appreciate. The wine list could be a bit more extensive but this is a quibble. A fantastic new spot. We will be back.","date":"2017-12-29 15:35:07"}
{"review_id":"bRnjwRKc-omT6t2VXc9VbQ","user_id":"LF6aUpdc2KUkbk4Y9SOKsA","business_id":"2aWV8Rx4TwtB0x2pfIPNxA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"The most important thing to note about this restaurant is that the service is not good nor quick.  As others have noted, make sure you have ample time before your flight.  If you do, this is a great place to relax while you're waiting for your connection.   \n\nFood quality is not great.   I chose this restaurant over Burger King and actually regretted my decision afterwards.  Pluses are: the good atmosphere of the restaurant and the cold beer, which helps, especially when your plane is delayed by a few hours due to weather.  \n\nOverall. I rate this two stars based on the service and the food.","date":"2014-02-24 04:07:45"}
{"review_id":"tgbPHf6UJl1abcU3mzL-sQ","user_id":"488KrW58ryVduy0Me8DRxg","business_id":"rlXgCJVxf5wP4sPhxH_2XQ","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"My sister and I have visited Gib's twice and both times had a great time! It's an old house that's converted into all sorts of seating areas...on the porch, in a living room, etc. Each area is unique and has it's own flair.","date":"2017-11-06 16:31:44"}
{"review_id":"cqSQgctx3lVe3oEsvfWsAQ","user_id":"3QCugmCSsCOHsC3fE0NBjg","business_id":"_4tCeVrLRmI18BscMiHr7Q","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Unfortunately, I failed to inquire whether their injera was wheat-free, since I assumed that it was (at least at every other Ethiopian place I've eaten at as been). So... no good for gluten\/wheat intolerant people (oops!). My parents, who have never had Ethiopian food before liked it pretty well, and I thought it was very yummy up until the point that I found out about the wheat used in the injera. The outside of the location is not attractive, but inside it's very nice. The service was very good as well. I would return if I could, but I can't.. would love it if they made wheat-free injera!!","date":"2013-03-18 17:37:50"}
{"review_id":"eHwJCcIyFapryZ49HV_fAw","user_id":"W0HE4BZjIu2l0d-0uPsmew","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"OK, maybe my expectations were set very high because this is a celebrity chef owned restauant.  The food was good, but I was not \"wowed\".  I would give it another try because maybe what I ordered was not the best choice on the menu.  I will check back after I give it another try.","date":"2012-08-15 00:11:41"}
{"review_id":"CwVPsBftuOfeCsD_nYHkbA","user_id":"be4Y79c85n3Dk_TlssM08Q","business_id":"I2gsUx1W5-gQzBFbhIxcRQ","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"At this point we have 98 check in's.  Good thing they are a good ways from us.  If not, we'd probably be broke,  and wouldn't be able to fit through normal doors.\n\nFood and service is wonderful.   Although yelp classifies this is a bar, this is not typical bar food.  In fact, almost everything is made from scratch - including great desserts. \n\nIf you have never been here, you are definitely missing out.","date":"2014-12-17 20:18:29"}
{"review_id":"_x42ylMzHxoQm01vh4UcSw","user_id":"mVVfJBBJ8OvhHsxncB4OWw","business_id":"-U0liwRSHGYBEMYVj8kFmQ","stars":4.0,"useful":1,"funny":1,"cool":1,"text":"One of my favorite places to eat in Charlotte!  The live music is entertaining and the older crowd seems to enjoy dancing and drinking on Friday and Saturday Nights.  I was introduced to Mickey & Mooch during restaurant week a few years back.  I am heavily addicted to the wedge salad, filet mignon fondue and the crab cakes.","date":"2015-03-04 21:27:07"}
{"review_id":"S0grmYpQX-hs5YQlcwGYqg","user_id":"k6oUsuhyJ2VtsdqIiD2oRw","business_id":"_iEl9sCLsvXEFHUWPvgsAg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is simply amazing! They have a marvelous selection of tequilas and make some of the best drinks I've ever had with it. We had their chips and salsa, as well as most of their happy hour items - which shouldn't be skipped! Our server Joe was on top of everything with helpful suggestions.\n\nSome of their dishes take 15 hours to prepare. You won't find the cheapest fare here, but quality costs. I promise, they will wow you.","date":"2017-06-28 03:15:14"}
{"review_id":"UfsfK7N5s3C9yYfq-vidDg","user_id":"2-2qFkXeGh4jG7MkAevdQg","business_id":"uoUa8ugZLrly0bA268IqEg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Went here on March 24 in the morning. Had the blueberry coffee cake, blue berry pancakes and a scramble with gravy. Portions are super big. Would definitely recommend going there. Best blueberry coffee cake with lots of blueberries","date":"2017-03-27 02:25:33"}
{"review_id":"FkwZksPnxhkV7mPSF8ZGDw","user_id":"A3el6ctiVe6HIZj6y74Bsw","business_id":"r4d__bKwzs3vE7GoI_MrAw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"If anyone is looking for quality electrical work, choose Next Generation Electrical Technologies. They have performed work twice now at my residence and have exceeded all my expectations. Most current job was switching outdated lights in garage to LED lights mounted to ceiling. Not only did they come early, they did the work in record time and I didn't have to wait all day! They called first to make sure I was home, awesome follow up!  Thank you Next Gen for providing quality customer service.","date":"2017-03-03 20:27:21"}
{"review_id":"dnX-mtga4DN-lZpZYji4YQ","user_id":"rCWrxuRC8_pfagpchtHp6A","business_id":"TqUFwP0mQJBPFHql0tLVsQ","stars":5.0,"useful":11,"funny":8,"cool":10,"text":"Note: CASH ONLY!\n\nI have yet to conquer their titular menu item, but I can say with absolute confidence and honesty that The Original Gyro of Castle Shannon (formerly a pizza joint) has already vanquished every other Baklava and order of Stuffed Grape Leaves I've ever had the fortune of eating. \n\nThe grape leaves are pouches of gastronomic pleasure that nearly burst with rice and a most delicate ground lamb.  The lavish, honey-kissed, nut-embedded Baklava will simultaneously exercise your jaw muscles and seduce your sweet tooth, suggesting flavors and preparation far beyond their $2 price tag.\n\nP.S. Dig those late hours!","date":"2011-09-25 19:54:50"}
{"review_id":"GLu3_J_a4Sy8EUs6u0oqqg","user_id":"UtcbovfseS92JPloUWfNsg","business_id":"qTmuW0C9XXuxWwumvn89sw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We weren't what sure what to expect from a 1:00pm comedy\/show.  Maybe we weren't expecting a lot since the tickets were very reasonable (expecially through one of those half-price tix places) however we thought the show was great.  Glad we noticed the good reviews here on Yelp. Definitely a good choice to fill a couple of afternoon hours if you want to get off the casino floor.","date":"2011-09-25 22:33:13"}
{"review_id":"ea4un5C91F_sO6_Hoaj3ow","user_id":"LAIGnIbhrmwjJYovnwQ-4A","business_id":"AtD6B83S4Mbmq0t7iDnUVA","stars":3.0,"useful":0,"funny":1,"cool":0,"text":"Gave this restaurant 3 stars mostly because of the service. \n\nWe ordered \n- Spring Rolls (average)\n- Crispy Egglplant (AMAZING)\n- Kung Pao Chicken (good\/average)\n- Chow Mein with Vegetables (good but very oily)\n- Fried Non-Vegan Cherry Chocolate Chip Ice Cream (Would recommend but ask for flavor availability)\n\nI came here with my family of four while the establishment was somewhat busy for lunch. The biggest issue was that there were only 2 waitresses who were both taking orders and serving food, which made the service very slow. The waitress took about 10 minutes to come around to our table and forgot to ask for what drinks we wanted until I mentioned it. In addition, it took a while to get either waitress' attention when we need ed napkins or extra utensils. Lastly, we had ordered the the Fried Ice Cream with Mango Ice Cream, however, our waitress failed to mention that they only had one flavor of ice cream. When we told her about the mistake, she just curtly explained that they only had one flavor in stock. It was just a frustrating experience.\n\nOverall, the food was good, but the service lacking. I would come back to eat the Crispy Eggplant because it was SO GOOD.","date":"2014-07-28 02:41:12"}
{"review_id":"82MTbTQQwmRG-Or2lp_XGA","user_id":"wfu1YP-mLfxZSb0zDGbXaA","business_id":"yxLVwItd1Wnhy6SeUUcNYA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Great beer selection, friendly bartenders, fun trivia night, better-than-average bar food.\n\nThis bar is located where I grew up in southeast Charlotte. I make it a point to stop in whenever I'm home. During the day you'll find families eating in the dining room and at night the typical crowd is local twenty\/thirty-somethings. Not quite a dive bar, not quite a sports bar. There is generally live acoustic music on the weekends and trivia is every Tuesday. Trivia night really brings out the local characters and can get competitive. The first ones to the bar on gamedays get first pick of what games go the bigscreens in the bar, kinda cool. My only complaint is the location- I wish it were stand-alone and not in a stripmall. Try the fried pickles!","date":"2012-11-06 04:04:20"}
{"review_id":"3SnmcGgqYF_UZLQzA1EdbQ","user_id":"-xlOz4tH5iEbh2mcyoLWzA","business_id":"STWeDYptg4-GOce1lW9W5Q","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"The restaurant manager called me and comped\nFor my boyfriends dinner and also mine..he's mailing me two coupons and explained the situation and apologized(in which I appreciate) Of course I will be wary- but I'll return...but I will leave if it's super busy cause I don't think I want a repeat..","date":"2015-07-03 21:09:44"}
{"review_id":"ez1BVLO06sqqSOUXklcAOQ","user_id":"F1Snbo0Rw3VZ2m04LMCnPg","business_id":"PpN4wDnmMxA2vQoSyj1yKw","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"I've been here a number of times now and have been satisfied every time. I always get a custom salad, and they have pretty good choices for regular and premium add-ons. I usually get the spinach with black beans, red onion, red pepper, and mushrooms. I add avocado, and just get their house vinaigrette. It's nothing special, but the ingredients have always been (and tasted) fresh and crisp. They also give a very generous portion of avocado, which I really enjoy. It's nice to have this option around campus. Sure, there are some great restaurants around, but as far as fast food goes, nothing else very healthy is nearby. I'll be going back.","date":"2013-10-03 17:33:19"}
{"review_id":"ma5X8SfBUffo_7Nk5MvKEg","user_id":"tvateFfxBXqHMFWleOHGYA","business_id":"qUPUCcBbn-ugXFSItXLmGw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"We came during happy hour 8-10pm on a Saturday.  Reviews are dead on for this place. Wait staff was a bit inattentive, but was nice and food was served fast.  Four stars because the food was excellent!  It was also inexpensive. We had a salad and four different rolls.  The bill was $26!!!   All the rolls were beyond our expectations and when the bill came we could jump for joy!  This place is definitely worth checking out.  Cravable sushi.  I recommend the kodiak roll (that rocked), an el pollo roll-- also yummy!!","date":"2016-03-07 01:37:31"}
{"review_id":"8NfaQ-Nfd_wxzeNNwvKjeA","user_id":"5GCRxbF59G1ae38H7SdMOQ","business_id":"x1Cd2gSPZVeNxDPzzqlClQ","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Having just moved to the area, Casey's has been such an amazing place to have available.  They truly have a little bit of everything available 24 hours a day.  Everybody who works here has always been so friendly and helpful. Their pizza is also really, really, really good.  It's my favorite so far in the area.  Who would've thought???  We have only done carry out up to this point, but they do now offer delivery.  Delivery hours are 4:30 p.m. - 10 p.m. There is a delivery fee of $2 per order with a minimum purchase of $10 required. Forms of payment accepted include major credit cards, cash and check.","date":"2015-08-19 10:13:44"}
{"review_id":"lY8VgoPENiAfZT3WFJ8QaQ","user_id":"WMv42g9xwWDZQGcDQfIfrg","business_id":"Gr-2oBg4XyduSKbvnE-i9g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Visited during that shoulder time of the day between lunch and happy hour.  Seated outside on a wonderful sunny day. Immediately given chips and salsa. Nice thick, rich salsa and not pico  de gallo like some restaurants serve. Ordered a carne asada burrito enchilada style.  Very tasty and huge. Great layering of flavors. Black beans were just how I would make them, so it's a winner too. So why only four stars? The food could have been warmer when served. I'd come back","date":"2015-03-04 21:38:43"}
{"review_id":"oNl-kj3-NGjKG_We8bCn4A","user_id":"TNhrTCVgDJ0lLxM0CBqssQ","business_id":"-2ToCaDFpTNmmg3QFzxcWg","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"horrible.   Never again.  I booked this through the airline  (Allegiant). waiting no less than 50 minutes so far and no hope of the shuttle in sight.  I've seen a one driver go by twice, we still wait.  I came to Vegas for some much needed R&R.  So far I can't get away from the airport.  Call Uber, probably about the same pride.  Never again for this outfit.","date":"2016-11-09 23:07:34"}
{"review_id":"cOu6mHTTWIJ3Dd6gpKRNQQ","user_id":"7OPBkeJT4He4XEWLDfw0_g","business_id":"hvjgF-vnPw2jyL5DBuB0qg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Small venue, big flavor. Homie vibe as you walk in there is a nice sense of ole Montreal in the brick veneer. The staff was friendly and there was an eclectic collection of seafood based fusion plates to try. That night I disregarded the house recommendation for seafood and went with the pork tenderloin... and let me tell you, I regret nothing. It was the best pork tenderloin I ever tried. Ever. The wine selection was great, and the cozy ambiance was just what the doctor ordered for my party of 4. They take reservations, and I do recommend that you call in advance on the weekends. When we left the place was packed. Great experience, be prepared to spend s lil $$$, 5 stars.","date":"2017-12-16 00:07:01"}
{"review_id":"x20Vhj5qcBbW-08vEbFHOw","user_id":"lg1UvP-7KLtjSdxbFbt3Aw","business_id":"9MnbQg7kfb_WgxoV0hXKSQ","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"This place is without a doubt, the BEST BBQ IN ILLINOIS. My boyfriend went to U of I and we somehow stumbled upon this hidden gem. Well, I suppose it's not so hidden since there is usually a long wait. But don't be discouraged! The wait is well worth it, I promise. \n\nTry to make your way through the door, find the guy in charge, and put your name on the list. There's not much space in this place. I guess that would be my one complaint. It can get pretty crunched, especially if you're waiting. However, what is better to tide you over than a delicious beer? Now, let's talk about this beer.\n\nThey have new selections on tap all the time. Please, do your beer pallet a favor and don't order the usual domestics and imports (Miller, Bud, Heiniken, Corona, etc). Those are just fine for any regular restaurant. Why miss the glorious opportunity to try something mind-blowingly good? Seriously, these beers are amazing. They come from different breweries across the country. Places\/companies you've never heard of. Combinations of flavors you would never think to try. I once had an oyster beer here. Sounds disgusting but it was so good. Trust me on that. I'm very picky and I liked it. You can also get a flight of 7 beers on a dogbone shaped tray (how fitting!). This flight has all the beers that are on tap in 4 oz glasses. You can share them with a friend and then order the one you like best!\n\nNow, on to the food. So SO good. There are a few different sauce choices you can get. Not being one for spicy, I get the Georgia Peach. It is soo good on anything you get. There is no bad item on this menu. The pulled pork is amazing as are the hamburgers. Hard to believe a hamburger could be so good, but it is. The brisket is also amazing. They cook it for 12 hours. How could it not be? Try to get here relatively early though, because some items like the brisket run out later in the evening. While it's a bummer, think of it as a good thing. This way, you know they're not just heating it in the microwave. They cook it, and once it's gone, it's gone. Oh and the fries are amazing, whether you get the regular or sweet potato.\n\nI know this was a long review, but I really can't say enough about this place. I'm obsessed. It's a bummer that my bf graduated so we can't go all the time since we live near Chicago. However, I will make any excuse to go down. Going there this weekend for Halloween. Can't wait to visit my favorite BBQ place in all the land!","date":"2011-10-27 15:48:15"}
{"review_id":"dv1R1q7hVW_sw2dAxad5VA","user_id":"VC08sCbP8AXjUhwl5VNhHQ","business_id":"0NhylBPrcpXUXZmqZL4T7w","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very clean, fast service, friendly staff. Would be 5 stars but they were out of what I ordered.","date":"2013-08-15 15:50:04"}
{"review_id":"xlNRXwap_zqfJuovElaEQQ","user_id":"Hxjcloe2LCoG5HZratFsHg","business_id":"X0J4h0kzWTbmgMClf0_Tgg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I started going here more than 15 years ago (I think, more than 10 for sure).  I was referred here by my relative that knows the now famous Clarance, the owner of the place.  I told him I am the niece of such and such and he said he remembers them.  I didn't have insurance for glasses then he gave me a very reasonable price.  He is very friendly and chatty, and despite our age difference (I am probably not much older than his children) we became quick and great friends.  I even go over just to chat after I got my glasses.\nNow years later, he is still a good friend, and everytime I go in he always ask about my grandma.  It is hard to find good service nowadays, and he kept it up all these years.  His business had grown (and I have to admit I had send some friends there also) and you might need to wait a bit longer for his \"personal\" service, but the other workers are very nice and helpful too.  His prices are still reasonable and with great selections.  I can't imagine to go anywhere else for glasses now.","date":"2016-07-25 05:06:20"}
{"review_id":"U3_5IY8X5lbfii5qG0dKFw","user_id":"K9nSjJPsMdRrJciaTGd6SA","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Excellence. Convinced my wife and kids to come to this \"French\" Inspired place ( i think they were reluctant because of that) ... fast forward . Everyone loved their meals. The ambience is relaxing, classy and conducive to anticipating something special. We'll come back","date":"2018-08-04 21:24:32"}
{"review_id":"_z4MVb1je6Nh8dA0K1XPXQ","user_id":"vNbr4JUZtIDB34xT-1n8ew","business_id":"PA0UJYogQTd5MIuKMs3tfA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I wanted to explore Brookline and decided to stop here based on the reviews.I have to admit that I was expecting a lot more. But sometimes they say, \"less is more,\" right? The place is definitely really old school and fairly run down, a grease pit. The menu that I was ordering from confused me a bit because I was wondering, where were all the Greek items such as pastitsio, moussaka, saganaki, bakalava, and spanakopita?!?!? \n\nPeople have said that the menu was downsized but the only thing I could find that was greek was Gyros, Falafel and dolmades and souvlaki and I went with the Gyro. The Gyro was indeed huge and the meat was flavorful but the veggies were close to the end of their shelf life. The fries that came with the meal were crap actually, I know that they are fresh cuts fries so lets make sure that they are cooked all the way through and have some sort of uniformity in size and the oil that they were fried in was obviously fairly old. The fries were on a greasiness level of their own. I have never had such soggy fries. \n\nThe service was certainly some of the most friendly I have had in sometime and the proce for the Gyro combo really is hard to beat it came in right around $6. So if anyone can tell me what I'm missing since this place is such a renowned Brookline establishment please do so.","date":"2013-05-07 13:11:36"}
{"review_id":"TIo8vN70k-rl-Z9XoTeV_Q","user_id":"JUeGFCsprKVUYok4oLsdEA","business_id":"t6ZIBNrQjvtwor8W-u3sUg","stars":5.0,"useful":3,"funny":1,"cool":1,"text":"Chop Chop Wok is as good as it gets for me as far as Chinese food is concerned. I feel it is more of a 4 1\/2 star place, but I had to round up because they are just so pleasant here & when you are waiting on an order, they will actually walk it out to your car. Now that is like Nordstrom\/Nob Hill type service right there! Btw, Nob Hill is an upscale grocery store in NorCal & I know all my NorCal peeps will get that reference ;)\n\nSo...the food is really tasty here & the ingredients are nice & fresh. The beef broccoli is some of the best I have had. The beef is really quite good. Not at all like that weird tasting & texturally displeasing mystery meat usually found in this dish. And the broccoli is nice & crunchy & has a nice fresh, bright green look to it. I also LOVE the Lo Mein! Lol, which is actually Chow Mein, at least where I'm from. Either way, it is on point. They also have really good lunch specials & you definitely cannot beat the prices here.\n\nI am SUPER picky when it comes to Chinese food & I will not just go anywhere. There has to be some sort of buzz or word of mouth about a place before I will try it. So, I would like to thank all of my fellow Yelpers that helped me decide on trying Chop Chop Wok. And to the staff, I think you all are great & you treat people with great warmth & friendliness. Not as customers, but as friends or an extended hungry family member ;)","date":"2012-12-04 17:00:16"}
{"review_id":"jCHaWXgppmZjkOdpFltWGA","user_id":"D5ywfFmwtJxLReqAYlDDmw","business_id":"poSV39UqEg-gpESXafS9-g","stars":5.0,"useful":3,"funny":0,"cool":2,"text":"I couldn't be more excited to have found this new place.   Food was yummy and prices very reasonable. Service was great and they even showed the kids the lobsters! Will be back and will certainly recommend to all the people I know. Felt as if I was in New Orleans :)","date":"2016-01-30 01:13:29"}
{"review_id":"JmzaYoV596HcAwicchmSgA","user_id":"nF8BqK9o7prWfuZCwiOYkQ","business_id":"-hAFDLTPzrPA8zVqD9-Agg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"The food is very amazing. I had the rice and chicken steak and the chicken suqar and rice. Both dishes were made with excellent taste and I and a blast eating them. I would recommend this place to my friends any day of the week. Great customer service and great ambience. Also the mango shake was pretty good with the ice cream topping and I also like the strawberry shake as well. If anybody lives in the Rex dale area, stop by this place and order something off their menu, I guarantee you will not be disappointed.","date":"2017-01-27 21:41:33"}
{"review_id":"lrjO6_qTdLVqPzaZkOZ2Yw","user_id":"LNybdWRnPgauhsJwxfGbBA","business_id":"4qCK4PdaVyCDpOHqN1-Vlw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Thank you J &M for the paint and repairs in my home.  I know I'm not easy to work with, but the guys were great and stuck it out.  I'm very pleased with how everything turned out and will be happy to recommend your company.","date":"2017-02-09 05:57:37"}
{"review_id":"7gcYMK26cY1xbk6zAcwGvw","user_id":"5UQFZg5Vek6JHTIIhKxOiA","business_id":"uLL2uKqYnPAFwBw11LzDUQ","stars":3.0,"useful":1,"funny":1,"cool":2,"text":"I guess the restaurant was ok. we are vegetarians so we picked this spot. eh not bad. we ate in the diner, and it was quiet, and nice. however I think it's overpriced for what we had. and they charged me $.50 for a card swipe. way to go to raise my bill.","date":"2011-08-25 01:31:02"}
{"review_id":"ZIr2PI0I7BhaI4TPrYum-Q","user_id":"C0SxQ9hRe2HhTjmIrFEcaw","business_id":"RNi6tW22UMgHwWLAb0mYdA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Went here for the first time last night... The best calamari , prime rib California cut, mash potatoes, the best salad ever!!!! Nice and clean place to eat... Employees are all so professional... I love that there is a dress code here... Gentlemen must remove hats... Ill definitely be back & will definitely recommend this place to family & friends!!!","date":"2015-04-15 07:02:57"}
{"review_id":"uUukEqaoy_-xUCDB3gvGeQ","user_id":"Y-eZiZcWFbjgFUyGNdQ7Dg","business_id":"TWkL-VHo6P-WwL8iTvqlYQ","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"I've been dining at Pei Wei locations all over the Valley for years and years. After moving to Ahwatukee from Central Phoenix a couple of years ago, this location became the closest to me. It used to be reliable and consistent but the last several times I've been, the quality has really suffered. \n\nA few months ago I ordered some take-out for my family.  After getting it home and going to eat my meal, I realized that my order was very wrong.  Now I'd become accustomed to this location forgetting things like sauces for the appetizers, napkins, soy sauce and fortune cookies (things that are supposed to be included with take-out), but my dish was inedible to me.  \n\nI called to complain, the manager was apologetic and offered that I come back and pick up a replacement OR he would send me a gift card to replace my meal.  Since I have an infant that I needed to get to bed, I opted for the gift card.\n\nA month or so went by and my husband suggested Pei Wei.  That's when I realized that I never received the replacement gift card!  We ordered and when my husband picked it up, he mentioned the issue we had the last time and they gave him a discount.  As usual, things were missing from the order (no appetizer sauce, napkins, fortune cookies, etc.) and the food was just okay.\n\nTonight we ordered again, this time the food was just horrible.  Bland, no taste whatsoever for either of our dishes!  I ordered the new Korean BBQ with chicken (I had it before) and really liked it.  My husband had the same but with tofu and vegetables.  Neither of us thought the food was good at all.  The sauce which is normally very tasty was so bland and watery that it literally ran off of the chicken.  The 'salad' that comes with it was wilted and soggy, clearly not fresh.  And as expected, no sauce for the crab wontons, no napkins, no soy sauce & no fortune cookies.  \n\nI don't think we will be going back anytime soon - at least not to this location - they really need to get it together.  We're tired of the issues every time we eat in or get take-out from here.","date":"2011-03-20 02:04:11"}
{"review_id":"ONTpZGM0H_UMdb2ddtPdjw","user_id":"PdgpUK6fHArEXsPcKFHXOg","business_id":"ZYr2feXiGYTbWyho_1oUiw","stars":5.0,"useful":3,"funny":1,"cool":1,"text":"Very different place for breakfast and I loved the food. This is a place you can go back to many times and get something different each time and love it.","date":"2016-02-23 20:46:29"}
{"review_id":"6DFMhsGwrNhmV7E2q0020Q","user_id":"PWJ1Q4DUzJO_XL3xU8XtYA","business_id":"Gr-2oBg4XyduSKbvnE-i9g","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Wow, sooo disappointed! Our first time here and the brunette waitress at the bar had no personality and was very unfriendly, obviously hasn't smiled in a very long time. Pretty sure it's the same one in the other reviews. We waited 45 minutes before anyone came back to see if we needed anything. Would of been great to have a couple more drinks and another appetizer but apparently we had our invisible attire on. We like to find places for work events etc...but will never come back again. Too bad, the atmosphere was great but the service is terrible and so is the bartenders attitude. Tried to contact the manager Sandra, had to leave a voicemail.","date":"2018-04-04 01:54:15"}
{"review_id":"Z81ZNU-3--n_gJD11aCC9g","user_id":"4fNHV9nkjf84BmmKiP1Npw","business_id":"0FUtlsQrJI7LhqDPxLumEw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Tough menu.  A lot of choices, so I was vacillating a lot.  I finally decided on the Ahi Tuna sandwich with sweet potato fries.  I also ordered the beet salad just to try it.  I liked everything.  Including the onion rings the hubbie ordered.  This would be the place I would go for onion rings.  Very tasty.\n\nWe sat outside. Not sure if it would be enjoyable in summer, but mid-Feb, with it finally hitting the upper 70s, it was wonderful.  Several people were there w\/ dogs because it is really a picnic area.\n\nWe will go back.  I want to try the ahi salad...maybe stick w\/ the ahi sandwich.  I think it will be the way to go when I'm craving a burger.\n\nW\/o a doubt, if you go, you HAVE to check out the bathrooms.","date":"2011-02-13 16:54:56"}
{"review_id":"IW1EWprVfLpyUww6CWfbOA","user_id":"yruTLOggpeMXoHu_O_Zd3A","business_id":"ZtkplJBLUa4PmZh_noUHEQ","stars":4.0,"useful":9,"funny":2,"cool":4,"text":"The neighbourhood needed a place like this! It's a little piece of King West transplanted at College and Yonge. Above Toronto's landmark breakfast place Fran's, Screen Lounge is a 2-level resto-lounge - I can see hanging out in the sleek indoor bar area this winter, but during this extremely hot summer, it's the roof-top patio all the way. It's got a huge outdoor seating area, comfortable and modern red-and-black-cushioned patio furniture and back-lit bar that looks very Miami as the sun goes down. The chill-out music sounding from the speakers adds to that 'sit-here-and-chillax-for-as-long-as-you-want' vibe.\n\nPrices are a bit steep for this area (like I said, think King West!) but the staff is super-attentive and the food portions are a good size.  They've got some creative sushi rolls (try the Canadian, wrapped in bacon) and tasty tempura appetizers. It would be great if you could order Fran's brunch on the rooftop patio on a Saturday or Sunday morning...I hope that is in the works!\n\nThe lounge is pretty new, so it was quiet, but I can see it picking up once word gets around. The place is called Screen Lounge because at dusk, they screen old black and white movies on the patio - complete with old fashioned popcorn machine, should you get a craving.","date":"2011-07-28 13:52:43"}
{"review_id":"lsu3LX20l_6qJM3NcNX7cQ","user_id":"o8WTNcicyvJzR9FfpqOibw","business_id":"woXlprCuowrLJswWere3TQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The portions are a little small, but seriously the best tacos I've ever had!! My only complaint was how warm the water was when they brought it to the table. However I asked for a glass of ice and problem solved. Highly recommend!","date":"2018-09-25 06:38:41"}
{"review_id":"V8QRJ-cyk5i6O0pMmEC6Dg","user_id":"k3enC3w7N-EZG5vkQ4B_Sg","business_id":"Hy9DkWITFbB88kfybJtweg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"One of the best if not the best sushi restaurants I have ever been to. Tempura is so light and script. Sashimi is amazing. Stampede roll is delicious. Soft shell crab rolls too!!","date":"2013-09-04 00:30:07"}
{"review_id":"AD-HYQpEQJc_dpNcTulyBA","user_id":"ODjhHdynpv4g9y0lmKvaiA","business_id":"FyV3uSgmNQNArRBydU3q-A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I heard about this place from shark tank so I obviously had to go check out. It was everything I expected and more. The presentation was not only adorable but the tea was amazing. I'm a full on coffee addict and I told my boyfriend I would drink this tea over coffee any day! Tastes just like how I would drink my tea while I was in London. Definitely telling all my friends about this place and next time I'm in need of any custom cakes or pastries I'll be ordering from here as well. Thank you guys!","date":"2016-09-30 20:17:27"}
{"review_id":"z_mTw48JPmPvhd9OcXWDSA","user_id":"cCke3VtFLtqgzkgYSrSE2g","business_id":"Flxxmmegf_qLsjDog0j7xw","stars":4.0,"useful":3,"funny":0,"cool":1,"text":"Imagine a dreamy, Anthropologie-feeling store filled with dried flowers -- and that would be Roxanne's! I love wandering through this beautifully filled and merchandised space. They carry dried flowers, candles, lighting, and garden decor. Sadly, the reason I can only give this store four stores is because it is very pricey... Perfect place to ask for a Christmas present from!","date":"2012-11-06 02:58:59"}
{"review_id":"5lcmg-2XFE6wjwWYruhCnw","user_id":"Oq1so04OApsXLnw1Kaz8YQ","business_id":"P8IsTiHq5Hesa6UPL604ww","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"This is hands down my favorite place to go for tacos! Anybody I have ever taken with me enjoys it just as much as I do. Every time I go I leave completely satisfied- I'd recommend it to any one!","date":"2013-10-15 17:52:17"}
{"review_id":"ge9cF1rhVME7xrupU8d1QQ","user_id":"cAxlIVBNys8MkHjUqDibAw","business_id":"K-iqIqMTTvESaAz2KgwulA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I am not a cake fan. BUT OMG!!! HOLY MOIST CAKE!!!! Absolutely delicious!! In fact, it's the only place I buy cake. Ever.....","date":"2018-01-09 22:27:33"}
{"review_id":"zFHEkwRddFXsa_2CCxJRsw","user_id":"MopyJvrcBSgQYfyA4wyP7w","business_id":"x_eIYAOPCSM1BKvID2Vcbg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"We needed something to eat before a show.\nThe options were to eat at The M or drive back to eastern.\nDecided to give the deli a shot.\nDepressing tots, fries and onion rings, they were warm, not crisp at all.\nHad a corned beef, it was pretty decent, no where near NYC standards though. The best part was the Beaver Deli mustard, it was awesome.\nWife enjoyed her fish tacos.\nSeating is limited and self serve on the drink machine.","date":"2018-01-21 06:03:58"}
{"review_id":"KvJ8yT-dODmCYe21J-Pp_A","user_id":"gjoN4q-f61kwjmmU4mm1_g","business_id":"poSV39UqEg-gpESXafS9-g","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"The craft beers are very good, but that's about it. The BBQ had been sitting under a warmer far too long, and I wasn't really clear on the seafood\/BBQ connection. Might be a nice place to hang out on a Friday or Saturday night drinking with friends, but the energy is lacking, the food is overpriced and not all that, and the menu doesn't make much sense. AVOID ANY OF THE FRIED ITEMS on the menu since it's pretty obvious they never change their cooking oil and everything tastes the same-- terrible-- and is WAY over-cooked. Their fries, cajun or otherwise, are like eating a mouthful of table salt. Awful! Stick with the bags and corn and you'll be OK. \n\nThere's really nothing special about the place that would recommend it over other similarly-themed sports bars in the area, and the manager could use a visit from Jake Tapper at Bar Rescue. No effort is made to make the outside patio tolerable during the summer so nobody eats there. What a waste. The restaurant itself is located way in the back corner of a strip mall where the confined location guarantees it will be like an oven.","date":"2016-03-30 22:28:36"}
{"review_id":"_6VcN8FnXjPHSebNJIqr3w","user_id":"9hBGfpru1ytlpHrUpzCi2w","business_id":"tDYcVluqZwieulc1iqxGXg","stars":5.0,"useful":7,"funny":1,"cool":1,"text":"Positive: The food! We had soup, chow fun, and the Peking duck. The chow fun was exactly like at home. The Peking duck  was served exactly how my sister liked (lean, less fat). Also, great service. My sister and I felt incredibly homesick after eating here. \n\nNegative: I wish the Peking duck was served on a bao instead of in the wrappers; however, my sister informs me that the wrappers are more traditional.","date":"2013-01-27 21:30:01"}
{"review_id":"BTDBNxb7m6wuSTy09_Zz4A","user_id":"oV4PUFp4O2brd3bGhu5cjg","business_id":"m97jaBYRscg-hqDjMVIIWg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This is our go-to place for lunch and just a friendly atmosphere. Very consistent food. Always good.","date":"2017-03-03 22:35:42"}
{"review_id":"QE5SM2PfWFMQiZfPtHLU6w","user_id":"Dmvll-f-wn3rSaOR5h8HVA","business_id":"6V4ZAD-iThq8V9czBTDoOw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This guy is the best. My washing machine pump went out and the company that was originally suppose to show up on a Saturday never did. Late Saturday I called Allstate and he was easy to talk to on the phone and assured me he would be at my house between 7 and 8 am Sunday morning. He was on time and replaced the pump in no time. With all the shady businesses in Vegas it's nice to finally deal with a down to earth businessman. . I have found my repairman from now on. Thank you so much","date":"2015-01-18 18:38:20"}
{"review_id":"uaRk3qA4UdW1YUuCmF1wtg","user_id":"ON0jdQyZH9H3laAvP4eXfw","business_id":"HhcBx0LSDkxRBKMkvkwSoA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Love the look of the restaurant when you first walk in. The staff were very friendly and the food was delicious! Plan on coming back again.","date":"2018-02-23 21:57:50"}
{"review_id":"TX498VVt6dA0Ky_wrP86pA","user_id":"9ontWyBnS0a1rOdxQI8Rww","business_id":"SZEFE5hL7aN5nM-A44iPwQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Cooked to perfection. I mean perfection. Red mashed potatoes were puréed. Bacon wrapped shrimp were beyond flavorful. Peppercorn steak spot on. Request to sit on the patio and the fountain debuts every 15 or 30 minutes. The view is breathtaking. The wait staff is there for every need or accommodation. All high class professionals.","date":"2018-01-21 16:08:55"}
{"review_id":"0k_o7fFRNTFOe2kjBmNgnw","user_id":"Nh75diBuPgSSBMNoT5IGDA","business_id":"KalAJyO0Zpg3K1wVwYXBHA","stars":4.0,"useful":3,"funny":2,"cool":3,"text":"On every Las Vegan's \"Off-the-Strip-Dining\" list probably lies Marche Bacchus, a charming bistro and wine market overlooking a peaceful lake away from the main strip.  The diverse French cuisine will appeal to Francophiles, and the comprehensive wine selection will appeal will oenophiles.\n\nThe French have always done brunch well (partially due to their social belief that drinking after 12 pm is acceptable, even admirable).  Marche Bacchus is my favorite place to go in Vegas for a brunch that makes me forget I live in the Mojave dessert.  Also, the restaurant offers both their brunch and lunch menu at this time, which offer many more authentic choices than just their dinner menu.\n\nIf it's spring in Vegas, I order the Moules Frites, mussels in white wine butter sauce with crusty baguette, a light and delicious classic that Marche does well; don't forget the Mimosa.  \n\nIf it's summer, I order the lobster avocado croissant, pair it with a Riesling from the market; the sweetness of the Riesling highlights the lobster and brings out the richness of the avocado.  \n\nIf it's fall, I order the duck confit & fettucini pasta, it's a calorie splurge but completely worth it.  \n\nAnd if it's winter, I get the Les Oeufs En Meurette, three perfect poached eggs in hearty red wine sauce with ham and mushrooms; it's a dish that warms your stomach, and your heart; break some rules and order a glass of Cotes Du Rhone with it: red wine works for daytime when it's Vegas harsh dry winter.\n\nDessert is their weakness.  I haven't fallen in love with any Marche Bacchus sweets; although I daydream about imported truffles from La Maison Du Chocolat or Patrick Roger whenever I visit.","date":"2010-11-22 04:06:25"}
{"review_id":"_ZefWfefCuyNbKq-bN9IkA","user_id":"xmnNNP8xOwld10AdbTq27g","business_id":"Pzs43Fkub-6A9hA1zqpF_w","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"Can be better if they put bit more attention to finishing foods and customer needs...masala tea is ofcource nor good","date":"2015-05-26 12:30:00"}
{"review_id":"3_JSg8ws2Ep4_KUAEAH3bg","user_id":"MagAoZ5NutB5tHw1wzVHeQ","business_id":"LGEIsxeJQATo9J1IA-TEdA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Fabulous food! Cadillac fajitas are the best fajitas! Love the homemade tortillas! The customer service is great! The drinks are fantastic! Always a great time in fajitas and it really is the best place in Arizona to eat fajitas! I highly recommend it and enjoy! Cadillac fajitas 1\/2 pound can serve for two people- or if you have more than that then go for a pound. Love the fresh flaky chips! Yum!","date":"2016-07-25 06:59:13"}
{"review_id":"5rxn3-ur3otwLpeZj0YkEA","user_id":"HGTdyEDygTqANThO64WDWQ","business_id":"GI-CAiZ_Gg3h21PwrANB4Q","stars":4.0,"useful":2,"funny":0,"cool":1,"text":"The food here is pricey, but well worth it. The sides are served family style so you may only need two or three for the whole table. The steaks are perfectly cooked and the cuts of meat are the best of quality.\n\nThis particular location offers a cool area to sit in if you are fortunate enough to be seated there. It is a pod-like structure that is in the middle of the hotel atrium. It feels very cool and adds to the experience.\n\nIf you are looking to go big, this is a great place to do it!","date":"2010-03-12 21:21:18"}
{"review_id":"THzz1zB62bHitYSGeVUjsg","user_id":"z9VJ-I_RGqNEyku4E7en2A","business_id":"EKI6veiozSUZ6Ho7L5hfRg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I was craving a bagel sandwich but was pretty tired of TH's, so when I saw this place online I was eager to try it out.  The other reviews didn't hurt either, so I made the effort to go there.\n\nI cannot begin to say how bad it was.   I ordered an egg salad sandwich on a bagel and coffee. A simple enough order, or so I thought.  How bad could it be, you're thinking?    Let me tell you:  undercooked eggs with bright yellow, hard jelly-like yolks, chopped in HUGE chunks with an enormous amount of tasteless, gooey mayonnaise on a Montreal sesame seed bagel (the bagel was good).  \n\nSalt, pepper or any kind of seasoning never saw that 'egg salad'.  It was served with potato chips and a side order of POTATO SALAD??  and a pickle.   Talk about a starch redundancy!   The coffee was tepid at best, and the milk I poured into it had some suspicious looking 'flakes' on the coffee that made me think it's last good day was yesterday.   \n\nThe presentation was attractive, but what good is that when the food was almost inedible??   I spent almost $9 for food that I could not stomach.\n\nThere is a sign on the wall announcing a change in management, which I could possibly have forgiven their lack of knowledge of menu prep if the changeover date wasn't listed as 2010!!\n\nThe people serving me were Japanese, and I suspect they don't know anything about Jewish deli at all.  They really should stick to what they know best, and that isn't deli any way shape or form.  DO NOT WASTE YOUR MONEY.","date":"2013-12-28 22:21:04"}
{"review_id":"oOkN_ZxHVYPAepIMa1UL3Q","user_id":"VtLdzz_1olnpRU6AuSsEVg","business_id":"brMJ4liXM1Sy5s05IAt9YQ","stars":5.0,"useful":3,"funny":0,"cool":0,"text":"This is a gym that takes a more personal approach to fitness and nutition.  The trainers will tailor your workout to your goals, take into account your injuries and provide a lot of encouragement.  The members are very welcoming and friendly.\n\nMy session today was led by the owner, James Wong.  He tailored the workout for me, since it was my first time and I had a lot of stiffness and injuries to work around.  I really appreciated that.  This is my first time of ever joining a gym like this so I really didn't know what to expect.  What I found was a lot of personal and individual attention to your specific goals and fitness level.  \n\nMy package includes an initial assessment, unlimited training and yoga sessions, The Fit Labs Diet and Exercise Journal, The Fit Labs Diet guide, up to 2 sessions per month with a Fit Labs Coach and unlimited email support. \n\nEven after my workout today, James texted me to find out how I was feeling and see if I needed anything.  That's amazing personal attention!  \n\nIt's going to be fun working out here and meeting new fitness friends!","date":"2013-05-28 21:15:55"}
{"review_id":"w_6tqFbVdjJZAih4PJRSIQ","user_id":"0Kv8gDSK5iaXiT9LnVNb1Q","business_id":"hl0bjKRXnEZ2waTWoTCjBQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I've been a member since it opened and I've built  more muscle mass while losing body fat during this time. The trainers are motivating, friendly, & knowledgeable in the fitness & nutritional area. Jamison, Stephanie, & Nathalie are helpful during each class making sure everyone has the correct form & lifts correctly so they don't hurt themselves.  I love that that each class is 45 min of intense cardio or weight training except for Saturday which is an hour class. Saturday's class is my favorite with a live DJ. We live DJ Lee too. It's a great workout with a group of people, but everyone works at their own level. It's a family atmosphere were everyone gets to know each other.","date":"2018-07-26 13:33:34"}
{"review_id":"VG-TamJFBuvpgi_6R9RAAQ","user_id":"bV0rm1txz0T4UTWd8LTC6w","business_id":"p0iEUamJVp_QpaheE-Nz_g","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"I had heard good things about this hotel but in my first and only stay it was pretty miserable. Vending machines on my floor didn't work the entire 3 days I was there. Internet was down more often than not. Room service unavailable because ovens were down. The 45 minute fire alarm at 3 am was the icing on the cake. I would not recommend this place to anyone ever. I'll make sure my company travel agent also takes this off the list.","date":"2015-09-24 02:29:32"}
{"review_id":"JDm-3KGQO43qAgiT8HbosQ","user_id":"XaeLIqtoOqzEo4KH56Z2KQ","business_id":"OD61KMut0q5t2XBMZazFeA","stars":4.0,"useful":0,"funny":1,"cool":0,"text":"The Peoria Red Robin is super convenient for the avid movie goer since it's located right across the street from the best movie theater. \n\nThe service is fast and friendly and the atmosphere is casual and modern. We have been coming to Red Robin for years and I will say I miss their old decor of old movie posters and random nostalgic trinkets from years past. \n\nThe seats are comfy and the booths are roomy (fluffy friendly). And each table is equipped with a tablet that lets you order drinks, appetizers, desserts, and your meal (or you could just wait for your server but it is a time saving tool for sure)- and pay. \n\nThe food is hot and fresh! You can customize your burger order with a variety of buns which is a plus and they offer bottomless fries AND broccoli. Kinda nice that they offer healthier options but I'll stick with the steak fries. Be sure to sprinkle the table-side seasoning on your fries too for the extra kick in flavor. \n\nAnd did I mention there is a full bar here too? Let's also not forget about bottomless root beer floats! Yes, you read that right - bottomless. Root. Beer. Floats.","date":"2016-09-18 18:27:27"}
{"review_id":"k8o9Wf4FJukzk6WIGm-Qfg","user_id":"ypm9IB9iZkwY71FKkYeLkg","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":4,"funny":2,"cool":2,"text":"I am a huge Bobby Flay fan and was so happy to finally try his food firsthand.  At first, I was really turned off by the \"tex-mex\" concept and even the name \"Mesa Grill\" didn't sound too appetizing, but we took a risk... and Bobby delivered.  We came here for my husband's 27th birthday and he had a wonderful time.\n\nSERVICE: \n5 Solid Stars!  The hostesses sat our party right away even though not everyone was there.  We were immediately served water and asked if we wanted any cocktails.  I really loved our waiter.  He wasn't just polite and attentive, but he was also engaging us in wonderful conversation throughout our meal.  He talked to us about how long he had been working there, and what Bobby's like... and he knew the menu like the back of his hand.  It was like having a new friend dine with us throughout the duration of our meal.  I wish I caught his name so I can give him props!\n\nFOOD:\nBread Basket - 2 stars.  They start you off with a variety of breads.  There was a jalapeno one, another one with some blue corn in it, and a third one that I can't recall.  All were very unique, but unfortunately, I wasn't a fan.  I didn't think the bread was very soft or moist, and the flavors didn't do it for me.  Kudos for thinking outside the box though.  The butter also wasn't the soft, spreadable kind.\n\nBlue Corn Pancake - 5 stars.  This appetizer came highly recommended by our server.  There was barbecued duck inside pancake (like a glorified taco), and a habanero chili star-anise sauce drizzled all over it.  The flavors all worked so well together to deliver an explosion of flavors in my mouth.\n\nSpanish Chorizo Quesadilla - 4 stars.  This was larger than expected!  It is pretty filling and could easily be substituted for a meal as a filler.  Or you can split this between 2-3 people and share it as an appetizer.  It's a pretty heavy dish and hard to eat too much of.  There's a large fried egg on top of a tortilla.  Embedded in the tortilla is smoked tomato salsa, grilled green onion, and crispy artichokes.  \n\nFor our entree, my husband and I shared the New Mexican Spice-Rubbed Pork Tenderloin even though I was realllly eyeing the 22 ounce bone-in Ribeye.  The waiter said the pork tenderloin was their signature dish so that's why we ordered it even though I'm not a huge fan of pork.  It wasn't until the dish arrived that we were convinced we had made the right choice!!  WOW, that was one tender, delicious, savory, melt-in-your-mouth piece of meat.  The spice rub added a bit of heat, and I can easily say this is the best piece of pork I've ever been served.  It came with a side of the most amazing tamale.  I can't even begin to describe how good it was.  You just have to try it.  5 Stars for this entire dish!!!\n\nI sampled some of the other dishes from my friends, but the pork dish was the definite standout.  My friend ordered the lamb chops, but they tasted a bit gamey and weren't as tender as they could've been.  The pan seared Halibut was tender and flaky paired with a lovely curry spice reduction.  I'd give both these dishes 4 stars.  \n\nAll in all a wonderful experience.  Glad I finally got to try one of Bobby's restaurants!","date":"2010-07-07 19:41:57"}
{"review_id":"xztEYAKRAHUymN3YKUPjFA","user_id":"MJSapWZVwpihOrebvo9KNw","business_id":"8kW60GovVJJWdyA0AyS0OQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Mandy was a great bar tender,always kept our drinks full and kept non paying customers out of the bar. Great local bar without all of the strip bs","date":"2018-01-21 14:22:55"}
{"review_id":"mOLR3CH-4pynrGunhorFWw","user_id":"WWOiE3X0hNC7x2R7Q-xK1g","business_id":"7gHdVSAz_Dm1wS1ZImJSiQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Wow  wow wow. Great ice-cream and pure fun to eat.   Our group ordered the following combos\n\n1. Cookies and cream cookies with strawberry cheesecake ice cream with hot fudge on top\n\n2. Peanut butter cookie and white chocolate macadamia nut with butter pecan and Heath bar bits\n\n3. Chocolate chip cookie white chocolate macadamia nut salted caramel fudge ice cream with Heath bar pieces\n\nThe ice cream is rich and thick.  The cookies are satisfactory. The chocolate chip was similar to a basic  Toll House recipe. Which I find rather boring   The blandness of that type of cookie is a good platform for the ice cream \n\nThe strawberry cheesecake ice cream had chunks of strawberry cheesecake in it. The taste was excellent \n\nThe butter pecan was lacking in flavour ..... Would give that flavour a miss next time\n\nThe real winner was the salted caramel fudge ice cream. The caramel was so warm and inviting and then the super huge chunks of fudge were amazing. \n\nThe heath bar tipping added that extra toffee taste the was \"the icing on the cake\"\n\nThe fudge on the strawberry cheesecake combo didn't add much to the dessert. Also made it near impossible to pick up. Although ordered on the side (if possible ) and dunking the cookie ice cream creation sounds rather like a good option. \n\nThe servings are really generous and the three of us left with a sugar overlaid. Next time I am going to share one","date":"2016-05-31 03:16:43"}
{"review_id":"_fu2IGUY0podVfGdId4nRg","user_id":"2dUCHVOx0jt37JKa-oVEQA","business_id":"Kj_qx2Qs8GKHG4dzexbJzA","stars":5.0,"useful":1,"funny":1,"cool":0,"text":"This place is so yummy, reminds me of my vacation in Kauai! Visit it before they hibernate for the winter. The tigers blood is my favorite - a combination of three flavors. The pricing is affordable, and they always hand out a 2-for-1 coupon to use on your next visit.\n\nWe can usually bribe the kids to do any chore, in exchange for a trip here! :)","date":"2014-09-25 19:48:27"}
{"review_id":"U4ukuv64eTWU0UNmdUHI3w","user_id":"k3NJaBzzhOV5z3eKNhaBOQ","business_id":"g3eWha-h2RctPulJolBCkg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Excellent coffee shop and very conveniently located to pop in and go or sit for a bit with your coffee outside. All of the drinks are amazing, I have been 3 times, today will be 4 and each time I want to get another. All of the employees are so nice and they are quick to get you your drink. They also have waffles, I haven't personally tried one but I have seen a couple people order them and I always want it! Definitely give this place a shot, personal favorite is the iced vanilla latte which on the menu is probably named after a bird.","date":"2017-05-13 13:39:31"}
{"review_id":"D1EXx4ycx0KZ8a9CfuGvjg","user_id":"BLpj-KA7J6vdZvsol5YAYA","business_id":"wE3p_qPaM7N11fnWzyRtNw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"First time at this Discount Tire (just moved to AZ from Spokane, WA and was very happy with the Discount Tire there) to have the front tire of our truck checked as it was losing pressure overnight.  Was helped by Benjamin (name on the work order) who was great.  Told us they would check the tire and rotate them for free.  Went outside to look at the tire and measure the remaining thread on each tire (still OK).  They did find a nail and fixed it.  I will return here when I need a new set of tires.  Discount Tire must train their employees well as I've always received excellent service.","date":"2015-07-16 18:35:55"}
{"review_id":"AeFT9TR-tsuhwY9WgxpPeA","user_id":"z2Gi5vo-8j544qN_g6ziEg","business_id":"E7VRsyNQWPteH6_qI4j7bw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I ordered the yellow curry veggie style because it's my favorite and because all the positive reviews on yelp about the yellow curry. IT WAS SO YUMMY!! the veggies included, onions, carrots, potatoes, broccoli, and cabbage. I ordered a 3 because reviews had said they run hot and they were right I love spicy food and a 3 was the prefect amount of heat. My total with tax was 8.61$ I am super satisfied and am wanting to try the lunch special next time I have a layover!","date":"2017-06-28 00:38:38"}
{"review_id":"Nk_aQxBT-NVoFOE60b6oLg","user_id":"lgJ9IAvN6YfV2GY9y1nENg","business_id":"6TvB1PZCY1Ap2S-yNJPs4w","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Absolute WORST EXPERIENCE. I do love Hooters Wings, but won't EVERRR GO BACK HERE. Extremely EXHAUSTED I DECIDED TO GO DOWN TO THE HOOTERS RESTAURANT. Unbeknownst to me it takes over 45 mins to get a 10 pc wings to go. So I thought. After waiting over 40 mins while sitting at the bar, I asked the hostess \"does it normally take this long?\". She replied \"what did you have?\" I stated a 10 pc Hot. She turned grab a bag and said \"well we didn't know where you went\"........ ummmmmm at the same bar you brought my water and receipt to. ON THE SAME CHAIR!!!!!! \n\nI asked for the Manager and Mikey comes up and immediately starts to explain how long the wings take.......I'm looking really puzzled now. I'm focused on the customer service aspect of being notified that my order was ready then handed a bag with cold wings. I verrrrrryyyyyyy calmly stated Mikey I'm simply providing feedback on my experience and food takes time to cook I understand that, HOWEVER BETTER POLICIES SHOULD BE IN PLACE IN REGARDS TO YOUR TO-GO CUSTOMERS.","date":"2017-05-26 05:20:56"}
