{"review_id":"LRg39spNc-7wud7EVUDQ6g","user_id":"BLWDwhP8ddPSsW2NNhlUrA","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":1.0,"useful":0,"funny":3,"cool":0,"text":"DO NOT SETTLE! KEEP SEARCHING! WASTE OF MONEY!\n\nThis hotel was NOT what I expected for a Las Vegas property in the center of the strip. Do not be fooled by the lobby, the rest of the hotel is old and outdated?\n\nHallways smell, scuffs and dirt marks on the doors, directional signs missing from the wall, moulding was breaking off. Inside the room, outlets barely work, furniture was chipped, my dresser was missing a top drawer, vents clogged with dirt. There are about 15 elevators and only about 5 were working! The pool is nice....but all vegas hotel pools are nice.\n\nAs much money as they make daily; there is NO REASON this hotel should look like it did. I will NOT stay there again. Keep searching for place to stay. I've stayed at Super 8's that were better than the Flamingo!","date":"2016-07-25 11:37:45"}
{"review_id":"5OhiIkw1KC8Jvbfp7dz9zg","user_id":"2LLO9HbhgUULhctJpFSqJg","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":3.0,"useful":5,"funny":1,"cool":0,"text":"Meh.\n-Very centrally located on the strip, makes walking easier.\n-Somewhat dated.\n-Parking garage is absolutely disgusting, although it is free.\n-Rooms are just OK.\n-Adjacent to the Linq which is a nice new property.\n-Strip view rooms do indeed have a great view.\n-The live Flamingos are cool.\nI probably would choose a newer & nicer  place if given an option but I would not rule the Flamingo out.","date":"2017-01-14 21:37:42"}
{"review_id":"lVFrXB-lxYUj6qkO329qQw","user_id":"EdjKaXZPI1f1ohLjtbnehw","business_id":"-H3hHmLfDmXQyuAlb3qFfg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is awesome. The tuna tataki is amazing. Sushi rolls are great and the Indonesian soup is great as well. I recommend stopping in","date":"2017-06-27 23:24:08"}
{"review_id":"WEJ4eDXzFF8wuTq99Gxtaw","user_id":"5tFUXNnFh7g1V2waWvQfbA","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":1.0,"useful":3,"funny":2,"cool":0,"text":"I love being proven wrong about celebrity chef-endorsed restaurants;  Carnevino in the Venetian put me off making fun of Mario Batali forever.  His emblazoned name means some tasty meats, let me tell you.   But this restaurant has done nothing for Mr. Flay's Southwestern recipes.  \n\nA friend and I had lunch at MESA today, and before I get into the gory details, let me say the wait staff and bus service was very great.  Helpful on all sorts of problems;   for instance, there was a bug that crawled out of my friend's salad, stretched its little bug legs, and sat around for a minute while we waved down the help. \n\n  We assumed the bug had been knocked senseless by the over-seasoning of the lamb in the Cobb salad.  And over-seasoning is ridiculous here!   My pork tenderloin sandwich with Southwestern fries was like being double-teamed by rubs and seasoning salt.  Now the tenderloin was tender, but like my friend's lamb, there was no tasting of anything but chilis. \n\n  Without like an aioli or some kind of dill yogurt to give your mouth a rest, it all just blends into generic spice tastes.    Adding in the heavyness of the dishes such as the recommended goat cheese queso fundido (Which was very delicious, but served with generic and easily breaking nachos)  you are left queazy and overfilled.\n\n20 minutes after our meal, on which the salad was comped and we were given free creme brulees (chocolate toffee, so rich and creamy), I began to feel very ill.   I ended up doubled-over in a forums restroom, the final and worst part of it all.\n\nI think of it as a science experiment, and sometimes science produces great things.  Sometimes you irradiate yourself.  This was more of the latter.   A lot of nice little things, such as the help and appetizers, but outweighed by a couple unforgivable offenses.   I also don't like a meal so poorly spiced that it causes my body to actually reject it.  \n\nSorry Bobby, maybe you should return and retune.","date":"2010-08-20 22:26:25"}
{"review_id":"pnBO5k20cEMDf6WIj4uqaQ","user_id":"1qXH9y2-j0tQImA1pU4WeA","business_id":"ZqElInc6h7apsXcX0QrC4w","stars":5.0,"useful":3,"funny":2,"cool":2,"text":"My boyfriend loves this place! They have about the nicest staff you could ask for. There's no stereotypical haughty, know-it-all, jerkhole comic book clerk (think the Simpson's comic book guy) at Samurai. They know their product and enjoy discussing comics, toys and anime with anyone and everyone. Their selection of current comics is unbeatable, although they really could use more back issues. When the death of Captain America issue came out, they sold out pretty much immediately. Because the owner knew my boyfriend was a fan and a regular, he saved an issue just for him. Ya can't ask better service than that!","date":"2007-05-17 01:17:55"}
{"review_id":"nPZ3pKNYB_nAT4Xrs29EFw","user_id":"TK7208ZMWAERUUY2dEtD6w","business_id":"rLTa-PztQLafDf70aKrNOA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Things I liked: The homemade chips (mmm), the red salsa, the tender chicken pieces in my enchiladas and the service.\n\nThings that just didn't work for me- The green sauce was so blah I couldn't eat it without dousing it in the red to get a little flavor. The beans and rice were disappointing as well. Perhaps it is my lack of familiarity with New Mexican cuisine, but I was not impressed.","date":"2010-08-21 00:12:54"}
{"review_id":"GUxiu89Pp0_NE34EJTaqqQ","user_id":"b3ZKOwdxzCJU7msKt3lhAQ","business_id":"HP8mkVdLa9F4Amsp2thKhQ","stars":2.0,"useful":0,"funny":1,"cool":0,"text":"Went there last Friday before going to see a movie at the Queensway cineplex, the food there is good. I ordered the small chicken burrito and it was more than I can eat. Thought the food was good, the service was, lacking, to say the least. The staff there were doing everything but providing good service. I was the only person there and it still took 15 mins to make my order. I didn't even mind the long wait time, but the unfriendliness from staff there was awkward and not welcoming at any means. Though like the food, I WON\"T be returning due to poor service. I will however, try a different location in the future.","date":"2013-12-07 04:52:30"}
