{"review_id":"lu3GFxK0Hz-IVvx9i4euBw","user_id":"J11QeKHyB-419kegkzkbXw","business_id":"X5uxdU9GHoUAqo2wmbg3OQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Island must be a Malaysian word for bland. We had the mango shrimp which tasted like water boiled bland shrimp with a green mango shredded and drowned in sweet and sour sauce. Chicken fried rice was bland and the mango sticky rice tasted like house brand rice flooded in sugar water with a half ripe mango. If you like food, this isnt the place to go. Maybe just a bad day for them, but no excuses","date":"2016-05-07 01:48:56"}
{"review_id":"g3twCFEwCFvRYEiPqflSXg","user_id":"ts0ZvjsuxmABOC263rnp3A","business_id":"xXZw2v10FbaqRiibXhAhlg","stars":1.0,"useful":0,"funny":1,"cool":0,"text":"I know you're salty because your food tastes like it, chefs are creepy and sweaty mixed with frump and seems very unsanitary, waitress is a huge snail yet there is no escargot on the menu? everything sucks.. looks so dirty i swear i sat in the chair and dust flew up. if I could give zero stars I would, 1 even seems to be too much. Party of four wishes we would've went to our regular Ballentines spot for a steak and fries.","date":"2015-11-06 00:03:13"}
{"review_id":"zZUM0CEuiBScOd1vWrGoLg","user_id":"6YSn58Mj36E2gkp4O0XfRg","business_id":"IRkTGseCN83g_BwDjHXaAA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Clean, friendly and very user friendly. Close to Wonderland and a great choice of fun for a rainy day. \nReasonably priced and food available for purchase. They are generous with portions as well. \nShoes are typical and very used as expected. \nBring your own socks!!!! \nSensors for lanes actually work! Don't pass the line:)","date":"2015-10-07 21:01:44"}
{"review_id":"lMAHUcyye-Gi8csK34X8hA","user_id":"Hylg642xNVl1NXIRw7LMow","business_id":"cTJjTKz2huGZ-ElScC2pSw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I love everything about Windsor. I've been here a couple of times, and I loved them all. The last time was my favorite. We came here on Saturday night for my boyfriend's birthday and got a candlelit table on the patio. Patio's are perfect in October, and this one rules. The music they play is really good, but loud..which we enjoyed. It's busy, but not so busy that you have to sit and wait forever. I've gotten the brown bag chicken sandwich and the Windsor burger. While the brown bag has all the amazing ingredients to make an amazing choice, it lacks just a little bit of flavor and is a little dry and \"herby\" tasting for my liking. The burger however, is amazing. The sweet potatoes and fried okra are delicious as well. Four peaks pumpkin porter is a seasonal and we had that and the Sam Smith's cider.  (Two of my favorites). One of our friends ended the night by getting the birthday boy a Chocolate Elvis...which is ice cream, bananas, peanut butter and whipped cream.\nWindsor is awesome!","date":"2014-10-27 02:28:38"}
{"review_id":"oFjzZ84dSCHG8yTdqI4KLA","user_id":"W9clRCd_1mVk-X2E29JQ2Q","business_id":"DjzKWJMuv4Ga9JNcJvrLUw","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"Very very unprofessional place. A few weeks back I got my hair cut by Mustafa and It was wonderful as he gave me exactly what I wanted. Came back again yesterday to get a bang trimming and they were clearly NOT busy at all but I heard the receptionist say \"give her a few more minutes\" and we waited like 20-30 minutes. \nThe hair stylist I had was exceptionally rude for no reason and cut my bangs way shorter than I've asked and even handed me the straightener and told me to straighten it myself if I wanted to so bad. Like ? Are you kidding me? Bang trimming was free but I would've been happy to pay if they were to even remotely try to do a good job. Receptionist was always rude to me no matter what as well. Never EVER coming back to this place. This place is a gamble and really a hit n miss with their service. I used to tell all my friends about this but I'm telling everyone to NEVER come to this place again.","date":"2017-07-18 17:21:22"}
