{"review_id":"oFLELQr5BfQDaElCx_Bk-A","user_id":"b8wLdoDo6_5bHVIo_q6XXg","business_id":"MqdyrBn-zyHqUtz0wtnZlg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Best comics best owner in town! Definitely have to check this place out! Great deals and prices as well!","date":"2016-01-30 02:07:33"}
{"review_id":"ZOPJlE9IYpNk--eGlxWPmw","user_id":"hFLeGUGZkFpciz4I0MvRZw","business_id":"Lox6-6gfbRXgc4VMMwPb7g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Skip the game and just hang out here. So close to the stadium, all the pre game is here. Cheap beer, great waitstaff. Huge crowd hangs out and goes late to the game. By the time they clear out, the early leavers from the game are coming back. They have the game on TV. I came back for the fireworks. Great view from the bar.","date":"2015-06-21 02:15:13"}
{"review_id":"1mkCFnruaCSeIXvqehqhkQ","user_id":"h-ajC_UHD0QAyAzySN6g2A","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Mesa Grill is good, solid food.  The prices are pretty outrageous at dinner, but brunch\/lunch are very reasonable. The mesa burger is great. Also had the Pork Tenderloin which was really solid (should have been at $45+).  Margaritas are EXCELLENT and its a good place to get a primer into Tequila options.  I love the bread basket they bring....really really good.","date":"2008-08-18 06:25:17"}
{"review_id":"v1aCLMjO3RWpMQC48ojW7g","user_id":"NtF-0oHNy67kIrJIorhcHw","business_id":"j9bWpCRwpDVfwVT_V85qeA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is my neighborhood go to for Thai. I've always enjoyed the dinner food over several years, both in restaurant and delivery. I tried their mango smoothie for the first time the other day and I found a new favorite place for those now too. Yay!","date":"2018-05-08 18:19:37"}
{"review_id":"LkT4o0BPo1QiCwGDMaWkIg","user_id":"e6oF0WUxgtl5hTszMZzINg","business_id":"4V2KN03EJMzaoOmLOy5UhQ","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Crazy place with awesome music. Although it can get crowded I loved the place for the music.","date":"2016-01-17 06:59:23"}
{"review_id":"7WvAUcIw3TIR6F22Er46QQ","user_id":"CwzhFRwIkYFGkaggG0sTlA","business_id":"gBy6UXTpoSHhW6qd15XU0g","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Great find right in the Lakes area. Much smaller than anticipated, but that didn't affect our visit. The place is physically split in half; one side is the bar, the other is the dining room. For the happy hour specials, you'll need to be in the dining room. \nWe went on a Saturday around 6 and it was pretty busy in the dining room. The bar not so much. \nService was prompt and friendly, food order was taken quickly and food delivered on point. \nWife had the prime rib - very good, plenty of food for 14.99! I had the prime rib dip sandwich, tasty as well. Definitely will be back, especially for breakfast.","date":"2017-03-15 03:49:33"}
{"review_id":"pyNzb53SNVXsK_rV7ARokA","user_id":"GbE4b9qRrrOEAvRFXvZrfQ","business_id":"jb0-JZMt-6Khsh-VwsDtLQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"sadly I have to write a bad review, I got food poisoning from here, I called to speak to the manager just to inform, but when I asked for the manager one of the employees told me to call back later, so I did, then I kept trying to call back and I never got an answer. Other than that when I ordered the food, the front service was very polite and nice.","date":"2018-03-15 19:36:12"}
{"review_id":"XHphdbw5ScwcwwdYEgbsUQ","user_id":"6e0Ixt00zD2J8ytITeYhTw","business_id":"IjeyNYr4kefZ2uZfrtJqZg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Here for the Arsenal Challenge tournament.  Nice enough facility but mosquitoes are out in full force. Has playground for kids and a small pond.  Decent soccer fields and good baseball diamonds.","date":"2014-10-11 06:17:01"}
{"review_id":"Gd2f_CkUaW6neyftMjdpGg","user_id":"JIKywBVrWyfKYqhZAt0D-g","business_id":"DxbdfvNYPCyiLJDDPJK3Tg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"First time trying and really enjoyed the food.\n Take out order, so hard to tell you about in house service. But  Paul was a great\nFood was prepared very well and fresh. It was steaming hot. \n\n\nLollipop chicken - 4\/5\nChicken Wings - 5\/5\nManchurian chicken (gravy) - 4\/5\nKungpao chicken - 5\/5\nBeef w\/ beans and mushroom - 4\/5\nSzechuan fish(gravy) - 5\/5\nHouse fried noodles - 4\/5\nYeng chow fried rice - 4\/5\n\n\nPortions are large, economical.  And they gave me order of white rice with all gravy orders. Order was loaded up with condiments and cutlery also. \n\n Place looked clean and very spacious.\n\nWill definitely go back.","date":"2017-04-30 04:07:30"}
{"review_id":"juS6bsFJq7ATeRKq5IFaDg","user_id":"6tdCcvKIRLJnfOaXgEqnJg","business_id":"1WtUgLhdBdQ39aBvEUbsnw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I've eaten at Akahana 8-10 times. I love sushi and can't resist a bogo offer. But I've never been completely satisfied with the food. We've had the salt and pepper calamari on multiple occasions - sometimes delicious, sometimes over cooked and inedible. Food inconsistency is such a bummer. Most recently I called in an order for sushi take out. When picking up my order, I asked the attendant (whom I later found out was the manager) for some low sodium soy sauce. He seemed annoyed that I asked, grabbed a small, unmarked clear plastic container and handed it to me. Upon arriving home to enjoy my meal, I noticed an odd fishy smell about my food. Noooo! After a couple of bites of sushi I had to stop and toss it --- the rolls tasted like funky fish! I called Akahana and spoke with the manager who gave me the soy sauce, and while he offered to make some new sushi for me, I didn't take him up on it. I also didn't ask for a refund. I did however ask him to visit his kitchen and investigate why my two different sushi rolls shared the same fishy taste and smell. I suspected it was the rice or the nori, but who knows. I'm sad to say it because I love supporting Plaza Midwood businesses, but I will be taking a break from this spot for a while. I hope things improve.","date":"2014-03-14 06:20:44"}
{"review_id":"6J9yBGSma6RWC2p9CZUzMQ","user_id":"h81ALA54rAn7YD8mES90yw","business_id":"_4Gpn_NIM94D9OFucgfaJQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is probably my favorite steakhouse in the country.  Steaks are the main attraction,  especially anything with a bone in.  Apps are delicious and sides are served family style.  Don't skip dessert","date":"2018-05-08 16:16:42"}
{"review_id":"pW0YWe0xoQQZIfc-NKvUnQ","user_id":"oCkYYt7KZVvoF40pDWg-iA","business_id":"-DHKF52ALa4B2ls1V6OlxA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I was sent to Vision Source South Hills for a second opinion. I enjoyed my appointments with Dr. Strain and found her to be knowledgable and attentive. However, I was incredibly displeased with how I was treated by the staff. I went through my vision insurance with a staff member and assumed this information was added to my file. I called a month or so later to order contacts and was told I could not pay for the contacts when I came and picked them up; I needed to pay for them over the phone. I have never paid for contacts before picking them up before but I figured it wasn't a big deal, just differences between offices. Once I got the statement for my order, I realized that they had charged me the full amount and not run anything through my insurance company. I called back and was met with no answers, saying they would call me back later. They never did, so I called back again and finally learned that my vision insurance had never been added to my file. After going through my information a second time, they then assured me they would file a claim with my insurance company and I would receive a check soon. Never once in this back and forth did anyone from the staff apologize or recognize that they had made a mistake. In fact, everyone I talked to seemed more agitated that they now had to reprocess the claim. A month later, I received my refund along with an updated billing statement. Amongst the revised patient\/insurance payment was a statement describing why the revision was necessary. It read: \"patient originally did not say to use insurance and paid in full for contacts-decided a few days later she would like us to bill vsp and refund her the remaining balance\". This is the first medical establishment I have come in contact with that required me to advise them of my desire to use my medical insurance. Professional medical establishments run benefit checks and inform the customer of their costs prior to performing the service. While I feel Dr. Strain is a highly qualified ophthalmologist, I am exceedingly disappointed in the professionalism and efficiency of the office staff. At this point, I do not see myself returning in the future.","date":"2018-04-04 00:37:04"}
{"review_id":"BAPTfBszw7opbMY2O-3ihg","user_id":"74vQRzh-duzm7zQuvhRVuQ","business_id":"wuZcVcG2EJHQIEKEbLFRwQ","stars":1.0,"useful":6,"funny":0,"cool":1,"text":"I'm loathe to have my first review be a bad one, but I feel sort of compelled to write this review.\nOn a lovely holiday Monday, after some frisbee in the park, some friends and I decided we needed some food.  The Abbey seemed to fulfill all necessary criteria.  The criteria being: patio, beer and tasty food.  \nWell, it had two of the three, however, those two were not enough to redeem this place, especially in light of the laughably awful service.\nNow, I'll admit that three of the people in our party got their food and enjoyed it.  However, two of us were not so lucky.  \nFirst we were given the wrong food.  The one other person who ordered at the same time as us (we sort of ordered in two shifts) got his food.  They took back our messed up orders, with the excuse that the computer wasn't working and thus the orders were messed up...uh okay.  Twenty minutes later we recieved the food we ordered, just as our friend was finishing his meal.  Unfortunately, my greek salad came topped with fetid feta cheese and the caesar wrap came complete with bugs squished on the lettuce.  \nThe good news was that the food was comped.  However, it took us a little too long to pay as the debit machine phone line was being used by a disgruntled employee to complain about her employment situation and to utter expletives in that regard.\nNeedless to say we won't go back.  There are too many awesome restaurants and patios to waste any more time there.  \nWe did enjoy the beautiful sunshine though : )","date":"2009-05-20 13:47:18"}
{"review_id":"LrfOiHY3A9xAeXH2NU83og","user_id":"RG1b-ni8PGUWHkEXnxnDVQ","business_id":"Aes4MuZLnFqglFJNMZxRbw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Lydiah's Coffee House is a prime example of what makes small business so great, particularly those in the food service industry! The owner (Lydiah) is incredibly kind and friendly, and the food she makes is very delicious. Every different menu item I've had thus far is of the curried variety, which is expertly done. Not too much, not too little, just the right amount of delicious curry flavor. The small lunch special is economical, but also jam packed with a great amount of food.\n\nThe Kenyan chai tea is also quite a treat which I will be enjoying the next time I stop in for lunch.","date":"2017-01-27 19:58:46"}
{"review_id":"-IDmwise_l0qm7-hnYYxjw","user_id":"WOw9TLTaTzJd4Do4MBbcHA","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I have had dinner here two times, and loved both times!  Personally, I think there is a lot of mediocre food in Vegas, but Mesa Grill is definitely not mediocre.  We had dinner before seeing Cirque's \"O\".  The bread basket, as everyone says, is excellent.  I had the Partida margarita, simply divine.  My salad was great, with a little spice.  The spice rub pork tenderloin is the best pork I have EVER had.  It was so good, we raved about it so much, that the couple at the next table both ordered the pork tenderloin as well, and thanked us profusely for the recommendation!  I was a bit disappointed in the pear upside down cake for dessert.  It would only get 3 stars.  But the total experience is still 5 stars.","date":"2010-11-22 05:16:31"}
{"review_id":"JyJL6HGustm2p3Mi7wVNdQ","user_id":"TyHO4S-Y9dGNYiS-CBztnA","business_id":"q6Wa5iJwcuBxMpI2kZXUAQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Great food but don't go if you ate in a hurry.  I was in the drive thru for 20 minutes with 1 person in front of me.","date":"2015-07-03 19:54:37"}
{"review_id":"OjOc6BH_PySJ0rlTUWictA","user_id":"V2t_oLWYP1TPVdNQhk1L3Q","business_id":"fYLCKglfKHjgzcOeo4ZDaw","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"I am a big fan of fish tacos, some people cringe at the thought, but that's because they have never had a fish taco from here. Rubio's by far has the best fish taco, it is absolutely delicious. After 2:30 pm on Tuesday is \"Taco Tuesday\" and fish taco's are $1.50\/ea.","date":"2012-01-03 17:23:55"}
{"review_id":"Ci2BFg4Fg-9bFGX8jqSk1Q","user_id":"Wx7cbLDqYEL3_aVZwh82Ww","business_id":"DXR2ipGkgM68uVeusJPbSA","stars":4.0,"useful":0,"funny":1,"cool":3,"text":"Any place that has jars of candies lined along the ceiling is your first clue that I'll love it. Second clue? The fact that ALL they serve is dessert. \n\nThis Marble Slab Creamery is tucked away in the corner at the food court inside Market Mall. It's hard to miss however because when you step into the vicinity, all you can smell is the sweet scent of waffle cones. And considering you can smell THAT in the middle of a food court - that's pretty damn good!\n\nTheir ice cream is made daily in-store and they definitely hold true to their slogan: \"The Freshest Ice Cream On Earth\".\n\nMarble Slab has an insane amount of flavours. Everything from Vanilla Cinnamon to Cotton Candy. And of course to celebrate the holidays, they also have Egg Nog and Pumpkin Flavours. Oh, and did I mention that you get to choose mixins?!?!? So not ONLY do you get to pick the flavour of ice cream you want, but you get to pick the mixins you want mixed in. We're talkin anything from chocolate bar pieces, to fresh fruit. So it's basically like a blizzard or a Yogen Fruz but in a cone, and with the freshest, most delicious ice cream you can imagine. Once you've picked your ice cream flavour and your mixins, they mash everything up right in front of you on a frozen counter. Then once it's all perfectly mixed, they scoop it into a cone (or a cup of you prefer) and you're good to go.\n\nI haven't even mentioned yet that they also sell cakes, take-home pints, shakes, floats, smoothies and frozen yogurt.\n\nI know, RIGHT?!?!??!\n\nIf you hadn't guessed it already, I'm definitely a fan. In fact, it's 'Ice Cream Break' time! See ya there!","date":"2009-10-13 16:43:06"}
{"review_id":"dm9JV5FVHQrP_DvrT4CJEQ","user_id":"8cxlAgkDaQk5hYPZhTQe5w","business_id":"oS96aJIHFWcFAlGHKKXjaw","stars":5.0,"useful":0,"funny":1,"cool":0,"text":"WOW!!!!\n \nI have never walked into a bakery that smelled this good.\nThat is the first impression. The pastries are unique: not dried out, crusty pretty pieces. Fresh, flavorful, not-too-sweet... just the right touch of flavor to leave a vibrant aftertaste. Only a few variations. That is because everything is fresh, made from scratch. No commercial mixes here. \nI really can't pick a favorite item, but the small loaves of bread are really special. Large enough for two. No leftovers. \nIf you have ever been to a bakery with dozens of different cookies, pastries and cakes... this is not that kind of bakery. \nBetter than I have tasted in Germany, France , Denmark or Switzerland. Fresher. \nRemember the word FRESH. It defines La Gourmandine.\nI wanted to add photos... but, sorry, I ate everything!","date":"2011-10-27 15:39:50"}
{"review_id":"2e3msjtZO8zVhecB3jROqQ","user_id":"FYmGxLIB68Z6wxwnqRohXg","business_id":"kG_EB5RAsSA3f9HJikI1rw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I don't like gristle in my hamburger so that did it for me. I doubt I will ever return. I don't mind paying $10+ for a burger if it is good quality. Also, way too much gunk on my burger. I like to be able to taste the meat. We shared onion rings. They were wet with grease but they didn't taste greasy nor did they give me stomach issues later. I'm more a fan of batter dipped rings than breaded but I liked these.","date":"2017-01-02 04:51:24"}
{"review_id":"VV6OcgMNSllqwyWV04lMRQ","user_id":"QJI9OSEn6ujRCtrX06vs1w","business_id":"DyVteo8Blf5gEfC9QbJE9A","stars":2.0,"useful":2,"funny":2,"cool":2,"text":"The Better Half (TBH) and I were antique shopping next door and she decided to stay much longer than I expected, so I walked over here to watch some basketball in the Sports Book.  This place is a dump!  It's old and very smokey.  The last time I was in this casino, was in the late 1990's and it still looks the same.\n\nI watched basketball games for around 2 hrs while TBH shopped and when I walked back to see her, she said I reeked of smoke....yuck.\n\nReturn Factor - 5%","date":"2013-05-07 11:41:51"}
{"review_id":"Qyzm4mYkHpkevR3KQ1NYhA","user_id":"kxsZCrVvaXl0gTDMfrCUOQ","business_id":"QhcdPMvz9FopgMaouZrQdQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I remember very well now, why I always avoided this particular joint.  \n\nFor a place that seem to operate within the Fashion district-  and I assume they make big $$. I strongly suggest to the owners to invest 20$ in the hygiene and look of the place. Feels like you're eating in a 3rd world country cheap noisy cafeteria.\n\nYes they might have good coffee but if you decide to eat there....they  will trick you into taking a plate and will slide in side orders. They will not be shy to charge extra ....so be careful. Portions are small but taste is ok. If you want something,  you'll have to chase for the waiters -  they will never make the effort to ask if you need anything else.\n\nOther than that- its good place to keep up with the industry gossips or the annoying sounds of the sport tv's.","date":"2016-06-22 20:13:37"}
{"review_id":"J8GYvxQVBM8E7FiV4ZWOqw","user_id":"phqw923eSkcwvoNca5ZSxw","business_id":"uteI0OIVarN_qkmORgPPgg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I normally don't write reviews but this place deserves one. I am not from Madison and may not visit Fast Biryani again for a long time but already know I'll be having cravings for it that will make me want to visit Madison again just for this place alone. Food was really tasty, the Paneer Tikka Masala I tried was not overtly spicy, and the restaurant was clean and nicely maintained.","date":"2016-07-25 12:18:44"}
{"review_id":"fUdA3KIdtXU72enMd5a6kA","user_id":"jajJjYV6WBVUx30mUFJkaA","business_id":"VvDAR0N0TOBAAXkIst4oHg","stars":4.0,"useful":2,"funny":0,"cool":1,"text":"Ok, I'm being generous  here and giving 4 stars, I really should give 3 and a 1\/2, Here goes...I'm an LA resident and over the Summer I work in Vegas, this weekend I'm not going home, I'm traveling East to a family reunion so I wanted to get a Mani-Pedi before I go...this place is within walking distance and open late so I decided to give them a shot. The young lady who did my pedicure was very sweet, attentive and friendly. However, I was supposed to get a manicure as well and what I got was, well...half of that.(hence the 1\/2 star) while getting my pedicure, another young lady came over and grabbed my hand and pulled out the small shelf. Then she put my hand down and walked away for maybe 6 or 7 minutes. She returned with a nail file and I jokingly said \"oh I thought you forgot about me\"...(the look she gave me let me know that she didn't get the joke). She proceeds to file my pinky nail then her friend walks in and she runs to hug her and never returns. My pedicure and massage are done to perfection and I am assisted to the table to get my nails done by a different nail tech who just came in the door for her shift. I assume she will perform the \"actual\" manicure, She doesn't. No massage no cuticle oil no trimming or pushing back of cuticles...I had decided to try the SNS dipping powder and she just jumped right in, proceeded to file my nails and apply the powder. She was very nice as well and very funny as was Danny who was beside us performing color application on another client. The nail tech finished my SNS but the top coat was taking too long to dry and was dull looking. Danny ended up fanning my nails by hand to help them dry then finally had the first girl (who walked away from me) to remove the top coat and apply a gel coat instead and use the UV light to dry it. All in All The finished product looks pretty good, however I've determined that I am not a fan of the SNS powder as it looks thick on my natural nails as if I have chunky acrylic nails and I've never been a fan of those...not their fault, just not my cup of tea but for $70 (plus $15 tip) I should have gotten a complete Manicure. I think next time I'll get my nails done while at home over the weekend, save myself some $$ and get full services.","date":"2018-07-26 13:31:33"}
{"review_id":"cxlmjp82rhDM90iYfQosqg","user_id":"XjskV6kcNxlfCDObRspEcA","business_id":"1HRSElW1HgBiTtSNrhjMeA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Not worth it. My friend and I both felt sick after ordering take out. I suggest going somewhere else...","date":"2011-06-29 02:23:30"}
{"review_id":"Iz02-PuaqEL71FhsknPZYA","user_id":"d0kLd-ENvX6P-pS_StWqeQ","business_id":"tnvZOd2vNCLPQS1KEZxqog","stars":3.0,"useful":2,"funny":0,"cool":1,"text":"Service was ok. The place was clean. We ordered each item off the dim sum menu and honestly, the only thing I really like was the soup dumpling.","date":"2018-02-11 04:06:40"}
{"review_id":"kukJja_A_cPXE0j-kb98fg","user_id":"oiS3KxE45BK05OqGjoRRxg","business_id":"PW-D85ugk-IJp1x3nKe62A","stars":1.0,"useful":7,"funny":0,"cool":0,"text":"The artwork is great.  Very striking and captivating images that seemingly pop out of the frames with the vibrant  hues and colors.\n\nThe studio and it's salesmanship\/service is decidedly less than impressive.   I ordered two pieces, Gorillas in The Mist and Tree of Truth.  The original art dealer who made our transaction was let go for untold reasons and was replaced by someone else(Mike?).   I only know this because I called to get a follwup on the delivery of the photographs because I have yet to hear from the guy who took over the account.  I think if someone took over the account, they should be taking the initiative to notify the customers of that change.  I basically had been getting no response from the emails I sent to my original dealer, and I had to call to find out what happened.\n\nAbout four weeks later, I received the Tree of Trurth(alternatively called Wisdom Tree).  However, it was only by accident that I received it.  I stopped by my local USPS office to pick up an article by another merchant, and to my surprise the clerk brought me a package from the Rodney Lough Studio.  I have no idea how  long it had been at the USPS office, because I was never notified by Mike, or frankly anyone from this Las Vegas studio that the piece had been shipped out.  I wasn't notified by USPS either, but we all know and expect crappy service from the USPS - the main difference is that I didn't pay USPS thousands of dollars for a certain level of service.  \n\nI am left wondering:\n\nIf Rodney Lough Jr. Sells their pieces of artwork as being something of value and something to treasure...Why would they send it via the UNITED STATES POSTAL SERVICE like its junk mail?? Why not give the customer at least an email notification that it has been sent out???\n\nI wonder if the people at the Peter Lik galleries provide better customer service?  Something that extends beyond the swipe of the credit card?  \n\nI am glad the Wisdom Tree was not lost or damaged in the USPS office, but I certainly expected better service than I have received.  Still waiting on the Gorillas in the Mist....hopefully it will be delivered to my door like they originally promised, and not by USPS.","date":"2015-06-08 17:28:58"}
{"review_id":"MpZZvM7j1Nkjlt7VIGqX9w","user_id":"iIy3Gj9IYFXApiaR3U6QAw","business_id":"zJGtD3y-pAIGNId4codEEg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is so good.  My wife and I have been here a lot since our first visit, just a couple weeks ago.  Can't stop thinking about that carne asada burrito!  Get the pork belly taco(s)!  All tacos are very tasty, but the pb stand out.  Just had the Inca salad with grilled shrimp... Delicious!  Outro does it right.  Oh... The chilequiles are just like the ones I've had in Guanajuato.  Real deal folks.  Great staff, tunes, vibe.","date":"2016-05-31 04:08:36"}
{"review_id":"SImlb2ECy9KvSkGpwr0XBw","user_id":"zWf87_AWr2tFijICtnLF1g","business_id":"cKRMmytHxaSt8F0SMEzKqg","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Arrived at 130pm for lunch. Seated ourselves on the patio as usual. We frequent this location. But not anymore. It's 212pm and and we have received chips and salsa, and a menu but no service. No order even after my wife went in and asked for the server. Seems the place is back to the ridiculously bad service we have had some years ago!\nGood luck.","date":"2017-01-14 21:15:57"}
{"review_id":"h9SN_e1A3BHPzfgBRysT4g","user_id":"wZhzg_DXPx0c9djWBc9Rvg","business_id":"dnBQZpWTyJzTe0QJf7YK5w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I'm in love with this place! The food is amazing for sure. They have my favorite bourbon, Bulliet, on special on fridays. They play amazing music as well! They crowd is always very eclectic and the bartenders are attentive and very nice. I'm so happy I have found such an awesome local place!","date":"2017-05-13 03:53:03"}
{"review_id":"_-JXvQPHwL9FFDKlTHzRXg","user_id":"XfngSpRUH7BlO8yXc_ohXw","business_id":"lZ8T7NFAo1JGAAopTV_OTQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I live around the corner from here and thought me and my daughter would give this place another try as our first visit wasn't so great.. Turns out the second visit wasn't much better. \n\nI will say the patio is what got me to go there.  The service is disorganized and slow. I ordered the nachos with cheese and salsa. Adding guacamole and sour cream is a add on (3.00) and adding meat is 4.00. We also ordered calamari. \n\nNachos came before the drinks and were served with all the ads ons ( that I didn't order ). The drinks came and they were great ! Then came the calamari which was deep fried to a crisp. My daughter who loves calamari actually gagged on her first bite. The salt was intense. \n\nWe waited another 20 minutes before a server came back and told her I would like the bill and I would pay for my drinks, she said sorry brought me the bill without the food on it. I don't usually dictate what I'll pay, however I wasn't paying for that food.\n\nUnless I was simply going for the patio I would never chose to eat here.","date":"2016-05-07 02:55:49"}
{"review_id":"ycnPepLgJo7v2KnfgWjJ3A","user_id":"aTwSBCBEN1vNNX-QBKxYWw","business_id":"0qSKZhVC_BHPuKro4QGWJw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"For the money I expected more. Food was ok, nothing to ooooh and awww over. Service wasn't great, more like a diner and not what I would expect in fine dining. Ali gratin potatoes were undercooked and my steak was also underdone, but my husband's was over done. The decor was very nice in the front rooms but we were seated in the back overflow room with none of the nice features. Overall it was just ok and I wouldn't go back.","date":"2018-07-07 22:27:20"}
{"review_id":"7U8ievSMUGXMV-t7BfunBg","user_id":"m3HdPTagMUMZbuPdrtCZ8A","business_id":"QeGkAHAKUT-TkyPUsl2PIg","stars":5.0,"useful":3,"funny":0,"cool":0,"text":"Tip: Don't forget to get a punch card for a free wash!\n\nMy dogs nails seem to grow an inch a day and he will fight to not have them trimmed. I have taken him multiple places but haven't had the success I have here. They let me in the room while they trim his nails so I can hold and comfort him, plus they do all their grooming behind a window so you always know what is going on. I drive twenty minutes out of my way to come here because we consistently have a fantastic experience. \n\nI prefer to wash my dog myself (so I don't have any experience with the additional grooming services they offer). The facility is always clean, easy to use and the employees are super helpful (and seem to really enjoy their jobs). They have everything you could need to groom, including toothbrushes, brushes, and towels\/dryers. I always go with the basic wash and have been very happy with it (about $15). Their pricing is the same no matter the size\/breed. My dog is about 45 pounds so for me it's worth it but might not be if you have a tiny dog. \n\nThe food\/treats are great too. Super healthy brands that I can feel good about feeding my dog. They sell toys\/leashes\/collars as well. We always end our trip with one of their bakery items, which my dog gobbles up.\n\nThey have a super sweet resident cat that doesn't seem to be bothered by much which we always say hi to on our way out. Can't recommend this place more!","date":"2016-02-23 20:44:09"}
{"review_id":"RlR_lUx4R_TFozzl9woNkw","user_id":"nXehm6zt294ZswIgh5LpbA","business_id":"kYZJ94hdzbhZIIXhIZU5Dw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"More like 2.5 stars. I'm giving two so the owners will have more incentive to make the necessary tweaks.\n\nI really wanted to like Strada 241. It's a beautiful space and the service is friendly, but the food was lackluster. We split a salumi plate and each had a pizza (I had the 'nduja). The salumi plate was nice but a little on the small side and lacking in variety, with only three meats. The pizzas looked good but were pretty tasteless - the cheese was bland, the sauce was bland and missing the necessary balance of tanginess and sweetness, and the crust was dried out and lacking flavor (probably a result of the electric oven).\n\nI would come back to try the pastas and also to see if the pizza improves. There's no lack of effort here and the food is honest.","date":"2013-01-27 19:04:53"}
{"review_id":"3wYyO3740bTVJgqK0liGUg","user_id":"PiaUF9SsbXlRDkOVdFsEwQ","business_id":"I0Ms_lndgwqflsTSzhL_AQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Awesome burgers and friendly staff! Loved that there was a pool table and corn hole. Great place to hang out with friends and throw a few back. Definitely recommend the sweet potato tots! Excited to go back and try another new burger .","date":"2017-09-09 04:03:24"}
{"review_id":"CdaxP8QJ7btK7PLAm7AGaQ","user_id":"mpCu1C5Pb3z4nPndTrrpyw","business_id":"tuTAKHUm7ErDRZ2Yll8LzQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"One of my favorite spots on queen st east.  There's nothing bad to say about anything on the menu but my favorite dishes are the completo sandwich either steak or chorizo are really good.  Also, the tacos are really good and authentic and again I enjoy the steak or choriO tacos but chorizo being more on my favorite side.  Check it out !","date":"2018-01-21 05:06:34"}
{"review_id":"wHCBqIMw1I0Xr7g1u9B6lQ","user_id":"MFavFOBxWmyX3usK6e15ug","business_id":"FZXdI7r9PJVWjzS0S64kog","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This little place is so cute! i honestly loved the intimate\/ family owned atmosphere. Its Quiet and the service is great. The chef is really nice too.\n\nI only came in here for a fast fix so i only tried their kiss of fire roll, another roll which i dont remember the name of and some garlic edamame..\n\nThe kiss of fire is absolutely amazing!! it super spicy though but it doesnt take away from the flavors i am definitely coming back for this roll.\nThe second roll was good too but it was really limey and im not into that too much but still very delicious! their tuna is great\n\nOnly thing is that i probably wouldnt do AYCE here because i didnt see alot of variety for my taste.. but they do have 50% off any roll when you do a la carte dine-in which i think is great","date":"2016-06-22 21:19:53"}
{"review_id":"xpHdPwt5-F-HIl5qGZS1Cw","user_id":"TfPoBNbVwDzagjiR3cPX0g","business_id":"N1LjEaUVBdaOki71VZHT_g","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Very clean and the staff is friendly!! The specialty coffee is good when available (runs out fast on Sunday mornings).\nToday's choice for coffee is \"Butter Rum\".\nYogurt Parfait is always good and a great morning starter.\nLots of choices for omlettes, I would suggest the Palermo.\nCan get busy and crowded sunday mornings by 9 am so get here early if you can.","date":"2015-08-30 12:55:18"}
{"review_id":"d32CGDepp--zf6Dtvk_RGg","user_id":"ymaFC3h-gqHwtzVznQw5JQ","business_id":"E-wETrdq1uImd6lX6x8Qxw","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"If there is negative rating, I will choose for this place. We came to this place with group of 5. After we finished disappointed dinner, we asked the waiter for the bill, they add 15% tips on top of it WITHOUT notify us, then we tiped them again, before we left the restaurant, one of our friend figured out the number was not right, so we asked the waiter for the receipt, he told us \"Sorry, we don't have your receipt anymore after you guys paid\", then we asked if the bill add tips already? The waiter did not willing to response and just told us\" I don't know\" then walked away. What a shame.\n\nAll in all, very bad experience, their cheap price come with the consequences. Cheap quality of the broth and food, especially their \"famous\" lamb slices, bad services, unethical business conduct.\n\nWill NOT come back agian.","date":"2016-07-25 07:27:02"}
{"review_id":"WjqHkpGB2jJEU49gIV5rww","user_id":"SmELFXyMwQM02PK9RXkFpQ","business_id":"El23BmTa2qKSWTl5BJdfqg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Never have had a problem using Al Phillips.  The staff is friendly and they get the job done quickly.  Not to mention that they are very affordable.  I always use them for my dry cleaning needs.","date":"2014-05-07 18:55:04"}
{"review_id":"MncupucdztMCAQvkaHC4eQ","user_id":"J-hAKK0E7LGfqYSdfPRLQA","business_id":"Mz84cEdPFAkY1FlsbcSpVg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I came unannounced at 730am on a Wednesday for 1x tire replacement and 4x tire rotation. John sped me to the front that morning and had me out the door in under an hour. Perfect.","date":"2013-10-24 03:20:59"}
{"review_id":"pUkot_06Spt91H5qh7tMcQ","user_id":"AZQVHDmLdZsIV-VsezxRVw","business_id":"pP31xhEnnSuGX9Hc133TJg","stars":4.0,"useful":6,"funny":0,"cool":2,"text":"First of all, this is a budget hotel currently under renovation.  Therefore all the mediocre reviews below should take into account that this property is in transition.  I first stayed here back in the 80's and gradually watched it deteriorate.  So its current condition is great in comparison.   The rooms no longer look like photos 11 and 12 posted above. The rest are up to date.\n\n* Positives:  Flat screen TV's on wood laminate TV walls, furniture has been updated since the photos posted, IKEA lighting, temperature controls in each room (but older units), very clean and loved the wood flooring over nasty hotel carpeting.  The current internet rate is $72\/night.  How can you beat that in a central Toronto location? I like that you need to use your room key to move the elevator. This stops strangers from accessing the upper floors as the desk can't see the elevators.  There is a security guard on at night.  A concierge will also be located in the lobby in the future. \n\n* Negatives:  The awful drapery and the bathroom still needs some improvement.  The room is small but no different than any other budget hotel.  The lobby and restaurant are being renovated so you have to deal with that.  Paying $10 a day for wireless is a bit too much.\n\nI would stay here again.  Another plus, the Airport Express bus stops right at the door taking you to Pearson aiport for $20 (or $18 online).","date":"2010-01-08 02:38:45"}
{"review_id":"W5si6kBw8dInU56nDJTrdw","user_id":"KZFzcTqETO2nWgl8A57cmg","business_id":"GToXts6iAc_zioKmIIdXtg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"English Laundry has landed! A favorite label by many stars not for the name but the style, cut, and fit. I was excited when I was walking around Town Square in Las Vegas and stumbled upon this gem of a store. \"Could it be? Yes, it is THE English Laundry brand! And they're having a sale!!! BONUS!\n\nTheir cut and sew button up shirts come pre-tailored and tapered to contour your body for a very nice looking fit. Everything they have is quality.\n\nStylish bowties will turn any nerd into desired.\n\nAnd if they have their men's fragrance in stock, you're in luck! Buy one or two. They usually sell out very quickly.","date":"2011-11-30 04:33:59"}
{"review_id":"1zqNrqYRw-9WtMubomlp7w","user_id":"GQz1as9Y9vlovTxiw54BFw","business_id":"Rt1DVTPqRAeC-5ZP__V91w","stars":5.0,"useful":4,"funny":0,"cool":1,"text":"In a world of big box stores and impersonal chains, Safrans' is a glimmer of hope for those of us who want to make grocery shopping personal again. The store is not overwhelming and people are always glad to help. It is a family run business and the owners are very big community supporters and this shows in every aspect of their business. I think they have the best fresh meat selection in Pittsburgh and its all available at very reasonable prices. If you have not stopped into Safran's before make sure you make it in, you will not be disappointed!","date":"2010-05-14 20:50:14"}
{"review_id":"qR3xEQG1bb1C5YcKhGqFiA","user_id":"mDjdzP6MsUoFX7U1Y9lAOg","business_id":"PUlqWr19YeeAz3IOBd3DYQ","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Staff\/family are soooooo nice and pleasant every time I've been here.\n\nDonuts actually only get 3 Stars.....while they are awesomely fresh, there's not a lot of variety with the donut itself or the icing. I'm also comparing this to Jack Frost donuts which sets the bar really high. \n\nPricing is fair and place is clean.\n\nMy favorite donut is the cinnamon & sugar.","date":"2018-07-26 12:46:03"}
