{"review_id":"TIUqM6qiwiQziVrZhWRXFA","user_id":"SfNfXuYfLxywOtgf2mYoJA","business_id":"46Ld9Qc9nAx_A0jwclNZiw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very tasty panini and crisp salads with fresh ingredients in a lovely though crowded and noisy setting. We split the Pomme - bacon, cheddar, apple slices with vinaigrette. It was delightful!! Wait staff was helpful and pleasant - until the end. We were unaware that we were not supposed to leave the table to go to the bakery shelf and order some take out. We were scolded a bit - which was fine but rather silly. I mean it's more money in the bank and there was no signage or warning we'd be breaking an unspoken law! Any way - the almond croissant and banana chocolate brioche was little better than average and tasted a day or so old. So, maybe skip that part!","date":"2017-10-24 19:56:37"}
{"review_id":"g424UgFNq3MWVRGGls0A7A","user_id":"e7cjjGj6hERQT71xVM7sPg","business_id":"jqQwHUrZk8M6uPPw3CPoFg","stars":5.0,"useful":0,"funny":0,"cool":2,"text":"Basically the only place with the people I would trust with my brows! They're so great at what they do & my brows have never looked better. I came in for 3 appointments so far in the past & I can't wait to go in & see them again! I never felt so confident walking out of an establishment such as this. They also keep their work stations very clean & tidy. The staff is also the friendliest around!","date":"2016-12-19 08:03:20"}
