{"review_id":"XFmUHob4QCD0d9UhUBmMOw","user_id":"AhWzruKxZZh6X0BJjukBSw","business_id":"r388dQHh4aYgmY6JCThYUQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I had the grass jelly milk tea and it was pretty decent. Milky, cold, and the sweetness level is customizable for individual preferences. The wifi here is also surprisingly good too!","date":"2016-08-04 02:28:16"}
{"review_id":"fyDljFX4Y11euLt798NRDQ","user_id":"6yAcVxTDPlhOVu8QHSgRqQ","business_id":"cTJjTKz2huGZ-ElScC2pSw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"A great new addition to the DeMarco family of ventures.  This was a pre-opening tasting, so they're still working on all of the fine points.  Nonetheless, it is a terrific spot.  The structure itself is very appealing, as they restored a 1940's-era building and exposed its beautiful brickwork, which is complimented with a stained concrete floor.  The bar is a proper one with a wide array of liquors and fairly ample seating for the size of the space.  The patio definitely will be the preferred seating choice so long as the weather cooperates.  We tried macaroni and cheese as well as the cole slaw starters; for $3 each, you could make a delicious, reasonably-priced meal from a collection of the starters.  The double dip starter (cobb dip and posole salsa with chips) was very good, though I almost preferred the dip and salsa without the chips because they're so flavorful.  The mixed grain salad was a good choice, too, though I might try to find something other than the orange vinagrette to put on it.  The wine on tap was tasty, and they'll also have a small list of about 8 bottles.  Again, the official opening isn't until the 25th, so they're still honing the fine edges.  In any event, we'll be there far too often for our own good!","date":"2011-04-22 14:18:46"}
{"review_id":"1Qt0ckQVYHwmSBCzVlZFLA","user_id":"QA0pMo4Q8BUa2Y-krAtChA","business_id":"V44iFD8LIm33krIlK68kwA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"As I was leaving the store I found a pair of white Shimano on the clearance table for $100...a perfect fit  YAY, loved the intense workout in Billie's class at LVAC this am thanks guys and thanks Billie for teaching me how to clip in","date":"2016-03-17 16:36:17"}
{"review_id":"C1cnr8K7om6xUYOwy3--fA","user_id":"RmVeNKqaC2Db3a36lK1FTg","business_id":"9MnbQg7kfb_WgxoV0hXKSQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I just wish this places wasn't so packed all of the time, but with food as good as this, what do you expect. I have only tried a few sauces (Carolina and Georgia Peach) and they are awesome. I get the wings every time I come here. I have tried the pulled pork, catfish sandwich and even a burger. The food is always great. I just really wish I could sit down and enjoy lunch here without a ridiculously long wait.","date":"2012-04-28 15:18:13"}
{"review_id":"poXsw3IhQDg3F3aCJifSrw","user_id":"Yp0XAzUWc6Q8kQMoncxKCg","business_id":"_hML_SleB40KkUrMHOZ_-Q","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Love this place! Delicious, creative small plates, and our server Holly was wonderful!","date":"2013-12-07 04:08:56"}
{"review_id":"JXvFXSMNQPxhwZYTTyW1tA","user_id":"yZdfEKXGAnEISaSMYTRPuQ","business_id":"lAQTjlPMxIXdrQyZ-X7rcQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Ran into this place while headed to BJ's pub.  The manager was friendly, the selection is awesome.  So many they are piled up on the floor.  One customer pointed out a box and raved about them for a few minutes.  Overall good time, will go back.  Prices were a little on the high side, but the choices are great.","date":"2012-07-16 04:11:45"}
{"review_id":"0djBPR8q-bpC6LJ7Wnj8bg","user_id":"9w4vI3LRTA4JdJyzOxeEMw","business_id":"KyZkW3PYaeoq5jNgPVlTrg","stars":5.0,"useful":3,"funny":0,"cool":1,"text":"Back in August, I was wanting to get a massage so I asked my girlfriend Jenny if she had any good but affordable recs. She suggested Suzanne & I called right away to try & make an appt for that wknd. Unfortunately, she was already booked but had an opening the following Sunday, so I immediately took the spot for a 90 min classic massage. \n\nI had a lil trouble finding the location but I called Suzanne & she was able to guide me, even with my horrible direction skills-I am by a, uh building with balconies. Lol bless her heart! \n\nSuzanne is very personable & makes you feel at ease. We spoke some during my massage but not too much where I couldn't enjoy it. She applied the right amount of pressure for my preference & I was in heaven the entire time. \n\nMy 2nd experience with Suzanne was late September, my mom got me a massage as a gift. This time I chose the lava shell massage. If you have ever experienced a hot stone massage, this is similar. But in my opinion so much better! \n\nI am going to try & see Suzanne once a month or at least every other month. I used to think massages were not necessary & just too expensive, but that was before I experienced Time For You with the amazing Suzanne! :) \n\n*Also, she has a website with a ton of info on it: www.timeforu.net","date":"2010-10-05 22:34:32"}
{"review_id":"DBJL-h0kPEH8oFsIb_w_ew","user_id":"g4wOvxjgncbMCvgChOgPnQ","business_id":"2GmGT-7QjowR1ihup3FbVA","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"I love this place. My friend introduced me to this place about 5 years ago and I eat there when ever I can. The food is great and the same people have worked there for years. If you're looking for a fancy restaurant this is not the place, if your looking for good food look no further. I like the Chicken Sharma and the Hummus is the best I have ever eaten. The portions are big and the prices are really good. It's hard to find a cheap, fast good quality restaurant but Haji Baba has it all.","date":"2011-03-20 05:32:53"}
{"review_id":"eXlWba_RVLAfF4XhPhOFLA","user_id":"7sTlqVT13DC0qwTEirxA2w","business_id":"hIUKufhwR6Ifn7bi0-phLA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"If only I was able to give them more starts. This place is THAT good! \nI usually order the curry chicken sandwich w a organic green tree and oh my $&:xbs- the meal is to die for... Makes me debate whether or not to get more than 1 order. \n\nOh and did I mention he owner is behind the register! Such a nice guy friendly guy!","date":"2016-07-14 19:31:32"}
{"review_id":"7sJ7UHJA6ICB5v-o2j376Q","user_id":"A8hV_ETv_yV4RePyFdutqw","business_id":"Ra5fI9BEAuWWaLJSfkiCiQ","stars":4.0,"useful":5,"funny":0,"cool":2,"text":"Before deciding to make a long overdue trip to White Oaks, I was under the impression I was making a mercy mission to save this prohibition era speakeasy given the probable dominance by Crocker Park and sprawl to Avon Lake.  Boy was I mistaken.  The parking lot was jammed and therefore forced to eat in the lounge without a reservation.  In the end, probably a better choice.  The lounge, though seperate, actually shares the main dining room's huge picture window view of the heavily forested ravine and Cahoon Creek.  The rustic decorating and dark tones with a glowing fireplace makes you think you might be in a roaring 20's hideaway.  The bartender was a pro - courteous, efficient, \"healthy\" drink pourer.  The lounge menu struck us as pricey at first but fears were quelled when our neighbor's order arrived.  We opted for the steak sandwiches which came with potato or salad. Prepared perfectly and just enough to satisfy. We felt very good about our choices all around.  I was taken by the sheer number of people and traffic when compared to the prices, Cleveland economy and aforementioned new options.  It looks like White Oaks has not changed, serving excellent food and taking caring of its customers.  Definitely worth a re-review upon eating in the main dining room.","date":"2010-01-08 19:58:13"}
{"review_id":"IQ7s_l5jjclIqkREXvBL4g","user_id":"CxDOIDnH8gp9KXzpBHJYXw","business_id":"w9pwbsusI9DI637UYqMctQ","stars":5.0,"useful":6,"funny":2,"cool":7,"text":"Blood Brothers Brewing is worth the trek to at least a visit. \n\nI have been drinking Shumei and Paradise Lost for awhile which are available on taps at Good Catch Boil House. And here I was, finally here and able to try out more of their beers! \n\nYou can either order a sampler or a half pint or a pint from their ever rotating draft list. And in case if you rather just want to pick up a bottle or 6 of them from the shop, you can also ask for a taste before committing.\n\nIf you are into sour beers, you would be delighted with their interesting IPA, Sour Ale which used different kind of fruits. And their Sour Ale White Lies series uses different grapes was also quite interesting too. \n\nCome by for a drink or 2 and enjoy their casual setting with friendly service and of course some good beers!\n\nPS. You can even order bottles delivered to your place via their online shop.","date":"2018-07-07 21:26:22"}
{"review_id":"YwRR80jEvggXPPjvW4kr3Q","user_id":"xdoG4kMgMNf3IQ1Wszd3qA","business_id":"YXwYUDFAQD1sNm2c_5rT7g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very Modern hotel and easy access to conference center. I enjoyed the one night I stayed there for an event. The staff was good and they were very attentive with my requests. The restaurant is ok and the iCafe is good.","date":"2014-04-19 21:15:16"}
{"review_id":"OrgqbRuDA4qEIEit5Z67ew","user_id":"dv4NLvKYWlTGzj89WxlZZw","business_id":"3n685UjMonF4fjBcILXkJg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Explain to me why I need to pay for parking when they do NOT have enough spots, they do NOT enforce parking, and we had a handicap guest with us and no handicap spots were available because NON HANDICAP vehicles were parked in handicap spots.  Mangement basically laughed in my face and did not seem to care.  So not worth it NOTHING worse then RUDE STAFF!!!!","date":"2016-12-04 04:13:35"}
