{"review_id":"UrAS0BPBbO27bWQMJhh30g","user_id":"Tu3EqdHkeEJeRzOvdvGORw","business_id":"-fiUXzkxRfbHY9TKWwuptw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I really like the atmosphere of this restaurant\/brew pub.  The beer selection is pretty good here if you want to try different beers, and their food is pretty good.  I came here for brunch which was average, but I really enjoyed the pizza I ordered on a different occasion.  I would recommend this place as a nice spot to go for dinner.","date":"2012-04-28 21:37:12"}
