{"review_id":"FuVFVsb-tcXjABMjAsSBYg","user_id":"U7RwNZfExdDWRxGCDnQ2mw","business_id":"ZVSGswtLoZLAH9gzRAGf7A","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"I was worried after reading the negative comments below.  But i am pleased, very pleased with my cleaner that arrived early enough before the set time to meet each other.  She was friendly and so was the service by phone i received when I called to book using my deal voucher.  I have set another appointment for next month requesting her again.","date":"2014-10-27 16:38:23"}
{"review_id":"6GNIVJCqvvPAKXKL3oa9Sg","user_id":"w1nr-eZ04z-Cq4ErAN2otg","business_id":"VGxJbglGlx-a7Gdc55Q6jQ","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"I gave this place 2 chances. i love japanese food and really wanted to love this place because it is close to home. I was underwhelmed the first time and disgusted the second time. the food was tasteless and not what the menu stated. Soba noodles are not white, they are buckwheat and are beige at the lightest and brown at the darkest. When I called (i had delivery) to tell them that I did not get what I ordered, I was told that it was correct and I was wrong. Food was tasteless and service was Awful. Do not waste your money or your time.","date":"2013-05-08 01:34:24"}
{"review_id":"mjUetdM7COWj4Ds2RwGcaA","user_id":"W1CZ9u_xdba6JHTUGOXm5A","business_id":"NFm869_w6cvVaWaNpAzjeA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"A friend took me here for my birthday. Seating is first come\/first serve. Upon arrival, I gave hostess my phone number and they would text me as soon as a table became available. Watched people come and go. An hour later and we still hadn't been seated. When I inquired about how much longer it would be, turns out the hostess wrote down the wrong number. We were seated immediately after that, but it took a while for waiter to bring drinks and take order. As far as food selection, menu is unique in offerings. I went with the pita chips and tzatziki dip, fried goat cheese on bruschetta, and mini burgers. Server did not check in with us often and forgot my burger order. I finally got it and manager apologized, but due to lack of attention I passed on ordering the sushi as we had already been there a long time. We also got free drinks because of the inconvenience. Even with the poor service, the food was absolutely delicious and I would be willing to give it another try.","date":"2014-07-13 21:45:41"}
{"review_id":"uto8vXbdIoKEg4UCkRM_Ew","user_id":"dUVc0paBMIyqmsC3tw_g-w","business_id":"cl_ykWIJqQqv8j9_f5jaPA","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"Absolutely AWFUL!!! The most incredibly unprofessional establishment I have EVER been to. Not only are their prices stupid expensive but they do a terrible job! I think it is pretty pathetic when i can do my own nails and they look much better than someone who is supposed to be a licensed professional. When I went the other day not only were my nails not straight but the technician (Her name was Lin I believe)  flied the skin off the sides of my fingers and made them BLEED!! When i said \"uhm I am bleeding\" she wiped the blood off (not gently) and tried to act as if it did not happen. I was still charged full price even after being injured! I walked out literally crying because my fingers were burning in so much pain. Later my fiance and I went back to speak with the manager\/owner about the situation and he LAUGHED TO OUR FACE!!! He did not apologize, all he said is that he would fix it, but last time I checked you cannot just magically heal someones cut fingers. When I asked to see the license of the technician he said \"I do not have to show you that\". I find it highly likely that he refused to show us the license because she probably does not have one. There is so much more I could say about how awful they were but I think people should get the idea. I WOULD NOT EVER SUGGEST ANYONE GO HERE!","date":"2017-12-16 05:04:07"}
{"review_id":"ZeslEVphLbZVASnTMsB8gA","user_id":"RuHi9ZIA_C1EuexwuwLAEg","business_id":"Yp1swb-8pO8i-6-jaK2tsA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I came here on a Saturday and the service was horrible. There was no refills on the bread, the food took over 35 minutes to be served. Mind you, I only ordered a sandwich. Please stay away from this place, especially if you're used to good food, service and atmosphere.","date":"2018-08-05 00:00:00"}
{"review_id":"cvXY6YDzqG7VW86N-j2JSA","user_id":"aWzOSZyu42cObrTWkU2taw","business_id":"ac3laXcJnclYZAO65XAcmA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"The restaurant is open and well laid out. The staff are friendly and quick. The menu is packed with the comfort foods.","date":"2018-03-15 22:19:22"}
{"review_id":"iQ01WcOwOAik3lNEC3Sjaw","user_id":"Cjnz2nNqhCCcD9dZOMzBGA","business_id":"4lCTd6-EzOuKl4YbH9gnxw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Well, I'm not quite sure how they were lucky enough to get a 4 out of 5 on Yelp. My trip there last night was less then stellar. We were out for my sisters birthday (a table of 12 of us all drinking). The place was dead inside . By 10pm they closed the kitchen. By 11pm they did last call, yes last call at 11pm on a Saturday . Yes there drinks are nice but who does an 11pm last call on a Saturday night ?!","date":"2015-12-21 00:57:03"}
{"review_id":"o89GV9WEXrwoo3vhTRQlgg","user_id":"VVIJ4BErUjxLikGTaMoSXA","business_id":"PViWXTbiRkRjZhAdH0xLxg","stars":1.0,"useful":2,"funny":0,"cool":1,"text":"I have been going to this restaurant on and off since we moved into the Richmond Hill area 16 years ago. Tonight on our way back from the hospital and being Labour Day we thought we would call them to see if they were open. So I got Siri going and got the number. I dialed it and asked if they were open. The lady on the phone said that they were very busy and that I should make a reservation. I did and off we went. When we got there the first clue that something was amiss was that the place was nearly deserted and they could not find my reservation. We took our seat and proceeded to order. Not five minutes into this and we get a call from a local number, it was the first restaurant we called wondering where we were. As it turns out the owners of Cynthia's created a tangent restaurant called Cynthia's Paradise and put it literally right next door. Talk about confusing your market. Given the way the night was going to unfurl we should have packed up and gone next door.\n\nI ordered the Hot and Sour Soup to start. This is one of my favourites and when I looked at the $4.95 price tag I assumed we were going to get a bowl big enough to share. When it came I got this little golden globe before me which revealed inside an even smaller ceramic bowl which if it held 1 cup of soup I would have been amazed. The soup was adequate. It has a nice balance of all the flavours I am used to but in no way was this worth 5 dollars. I mean for just one dollar more at another chinese restaurant I got a bowl of soup so large that it would have filled that little bowl before me 20 times over. What really drove the point home though was the little tiny $3.50 Egg Roll and the 2 HarGow for $4.50. This place was way over priced. So maybe the service was going to be exceptional. I mean, there were more people on the floor, behind the counter and that could be seen in the kitchen than there were patrons sitting at the tables. The 2 HarGow came one at a time in the tiniest steam boxes I have ever seen. We ordered Moo Shu Pork, Chinese Broccoli and the House Special Fried Rice. The food took way longer to get to us than was comfortable for me but taste wise it was very good. Far too expensive but very good. Ended the meal with the Deep Fried Creme Brulee and with a 13% tip the meal came out to $94.75.\n\nFrankly I can think of a number of places that I would like to spend that kind of money for 2 people. Cynthia's Chinese Restaurant is no longer one of those. As a comparison the meal at Cynthia's Paradise would have cost $54 for two people all you can eat. I will do a review of Paradise when I go there but this place will never see another dime from me.","date":"2016-09-06 02:10:35"}
{"review_id":"Puav6hcgT06TPGfBWws-Ow","user_id":"dj5CgTnsWD5bIoKIW0OmsA","business_id":"HHpmT7KqOwUp1z2B-OfLtg","stars":2.0,"useful":1,"funny":1,"cool":0,"text":"I really hate giving bad reviews for small businesses but I wish I went to Harvey's :(  the people Are very friendly but they forgot my coleslaw and my gravy. When I got  to work to eat it they gave me malt vinegar for my halibut! No lemon wedges either. The fries are the only thing I can eat and they are nothing to brag about. The halibut is very greasy too","date":"2014-09-09 19:10:19"}
{"review_id":"ZkLaRrwrrn6DsygdWR6FKQ","user_id":"_ykg4Fp8j_tU83q2tYC2FQ","business_id":"UIwxNIaqnxcLBr1f3xSTfA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"After my first visit here blew!  I contacted Ashley furniture on their website and the Sales manager got back to me the following day.  He said he would honor the price of the 7 piece bed set and we had to order it because the stock gets rotated. Okay understandable.  It's $79 to deliver on the weekdays and $89 for the weekend.\n\nI will consider my options I'm still thinking that set is a steal for $595 and the style is gorgeous.","date":"2014-04-01 02:12:56"}
{"review_id":"zbmdJsCWvbd9IUAemNvCdA","user_id":"6rjLhfryUZgxpxPfMiH_8w","business_id":"t7b_86s_Q__P35H9NXedhw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Best gyros ! Great portions and their fries are wonderful ! Employees very friendly and polite. We will be going back every chance we get. I've only had one gyro better and that was at the stand at Westside Market, but these are  close to a tie. Love them !","date":"2018-04-04 02:53:02"}
{"review_id":"pSjHIDBjt0lCTI9NnmiazA","user_id":"aX5i6wJy56uyxFtO03hDIA","business_id":"YLwWi9r9S2LXzZlMG1O2FQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This store has some excellent customer service.  I've been going here for years and always get asked several times if I need help.  I'm a needy kind of person, lol. So I know  I  will get  some great advise when I go here.  In this day in age with service it's nice to know where I can find some awesome assistance.  \nDon't forget to ring the bell when going out the door, they have that up there to tell the employee's they were helpful and you were happy with your service. :)","date":"2012-06-26 00:40:39"}
{"review_id":"XIn3_kT2Kd5t9xP-ToU3-A","user_id":"CyPLi2BMi3N2z-E7Qpp26A","business_id":"NrJSy3dgcXErFtOKGREmnw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Aft Kitchen and Bar was opened not too long ago in Riverside (on Queen East). The place is small and properly furnished with wooden tables, wooden counter top, and wooden light fixtures. The brick wall gives some needed warm and character. \n\nWe may went there on a cold evening but reality is that the place was fairly cold and I had to keep my jacket on while in there. Not very pleasant.\n\nThey don't take reservations but as long as you arrive before 7PM I think you should be fine.\n\nI opted for having their featured dish, a buttermilk fried chicken with coleslaw, biscuit, and collard greens. At first I thought that the chicken was moist but it ended up being somewhat dry. It was a bit on the flavorless side (disappointed). The collard greens were great and so was the biscuit. The coleslaw was very average. They did not win me with that dish.\n\nAft Kitchen and Bar  did not have a cocktail menu but they had a list of available wines. I had a chardonnay from Estrada Creek and the wine also did not wow me. \n\nI don't have any reason to come back there and I quite did not understand what was their strength. Oh well, I don't expect to find bliss at every bite.","date":"2013-05-28 22:52:04"}
{"review_id":"E9VaIGOkYrBITn0M_ztOGQ","user_id":"KeuwC8E1238SP6xyKpBM6w","business_id":"oZcbn7ENit23xbCsyu9xbA","stars":5.0,"useful":6,"funny":7,"cool":4,"text":"Miso happy! This is the best sushi I've had in Phoenix. By far. Hands down.\n\nBest miso soup - ever. I had their salmon oyster roll thing - raw oyster wrapped in a piece of salmon with salmon roe on top. It was divine! (I fantasize about this, seriously.) Their soft shell crab is... wow. Melt in your mouth perfection. \n\nThey don't do happy hour, but the prices end up being very reasonable for what you get. I tried their baby yellow tail and a huge piece of clam. Tasty! \n\nYasu is small, so get there early. The place can fill up quick! I love the atmosphere inside. The service is superb and the staff is uber-friendly. When we walked in, the guy behind the bar waved at us. \n\nIf you don't live nearby, it's ok. The sushi is definitely worth the drive. And if you live close-by, I hate you. (Just kidding. Or am I?)","date":"2008-08-18 23:06:08"}
{"review_id":"cPMeFwVoXrXOrQXJRZ9EnQ","user_id":"8YFuOsizo4pVFxq6x6iu9Q","business_id":"udY_aLOwTk2bipoZOGIKng","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Nice place for kids to play at the castle and have a picnic.  It has a restroom and walking trail.  Great that the community put it together and it's free.","date":"2016-08-25 15:23:32"}
{"review_id":"6Egrf46WFVwx87OVkfPlPA","user_id":"TNPSnVokcRh6evw6tsG-rQ","business_id":"5CJL_2-XwCGBmOav4mFdYg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This place is good. I haven't actually been to the restaurant, but had the food delivered to our hotel. Me and my friends had just got done clubbing at XS and it was around 1am (my friend was really drunk lol) so I told them about Krung Siam because I had them deliver food before and it was good. We ordered food and by the time we got back to our hotel, we only had to wait a few mins and the guy was there with the food. The food is good and they deliver so yeah i was happy lol.","date":"2011-11-30 07:50:53"}
{"review_id":"eVhuGCQ7i7717KKf5BGbKw","user_id":"EmrahJMelcioolXzG8TVng","business_id":"H6skMpg_g-sOrfTQf_Q5LQ","stars":1.0,"useful":5,"funny":3,"cool":2,"text":"Hard to explain how bad their Shrimp Pad Thai is. But I'll give it a shot. Imagine cooked rice noodles and cooked shrimp. That's it. No sauce, no flavor, no complexity, no effort, no passion, no purpose, no sustenance--need I say more? I have no clue how this passes as Thai much less a restaurant. I would ask for a refund but I'm going to pretend this experience never occurred.","date":"2016-09-30 22:41:48"}
{"review_id":"e1wrj2KI8RL9iZKEoxR4zw","user_id":"KBLW4RujERLotEYjU5LKew","business_id":"V4sPxg8y29QDskQmMM1FIw","stars":2.0,"useful":1,"funny":1,"cool":1,"text":"I would give this place one star for customer service but I'm giving it 2 stars only because my nails turned out nice...  my original nail shop is in green valley & ever since I moved I was being lazy to drive all the way there so I decided to check this place out.. I just wanted to change my nail color (shellac) so I called and asked how much would it be and the guy said $20 so once I got there I picked out a color and told her I wanted silver glitter on the top. She picked out the glitter that was more pricey and didn't even tell me it would be another $5 charge.. I knew it was gonna be extra $5 because I get my nails done all the time & usually get that kind of glitter so I didn't mind but I feel like they should tell a customer ahead of time if there will be more additional charges.. and so when it came to paying she charged me $30 to just change the color without a manicure.. I asked her I thought it was $25 for shellac nail color change & the glitter and she made up some excuse which I couldn't even understand. So I will not be coming to this salon again because they just make up there own prices depending on the customer... \nOther than the lady being kinda rude and not talkative, the guys that work there are more talkative and friendly so if you go there make sure you go to the guys instead of that lady..","date":"2016-01-17 06:23:03"}
{"review_id":"akh5k_pGUXT5XlDm57RoXQ","user_id":"KEF5A094wOUdBG7SsS7qKg","business_id":"TUrQG_XfJA_kCOSN0oUbTQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"My first time at Smashburger and it was a positive experience.  The staff was friendly and accommodating and my Mushroom Swiss Smash was flavorful and juicy.  I made the mistake of ordering large Smash Fries to share and they were a bit oily and seemed completely unnecessary since we ordered shakes too; that was the only part of our meal we didn't finish.  The Oreo and Peanut Butter Chocolate shakes were delicious but a bit small considering their price of $4.29.","date":"2016-01-04 02:54:10"}
{"review_id":"64m1rDrIoTA8pObyMIjbiA","user_id":"1ACN3vsgonynOysu5BzONQ","business_id":"K8oElS51Fyvz3mhH6qljBw","stars":5.0,"useful":4,"funny":0,"cool":0,"text":"Have been here for about 3 years now and really enjoyed staying here. The staff is great and always there to help you with smiling faces! The location is great and very quiet neighborhood, \nThe pool is amazing and is very clean. \nAll of our maintenance requests have been taken care of on the same day.","date":"2015-05-12 16:33:20"}
{"review_id":"PlSguJy2BgMhB86mA1ZCjA","user_id":"mGrZUDk3-I7SSCOglpt5Ng","business_id":"5Yc1owD5Unq7Ko8H-ZAdYg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great show. It is a very fun show and it is truly very interactive!!! It is definitely for adults and if you get offended easily then don't go. It is definitely a bargain and a great time. As far as the seating I would definitely do more towards the front. It is a better view and a lot more fun to see everything up close. Grab a drink and have a fun time!!!","date":"2014-09-09 20:47:13"}
{"review_id":"BMIQ4z4GGR_vfUPhejGmNQ","user_id":"bldxmfv96Yn0aampk4H9Bw","business_id":"QnfAHUr5-HTiaA5-va3glQ","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Used to be a good place. Has gone downhill the last few years. I already know their pizza is not good anymore, it was when they first opened, but I was in the mood for pasta and decided to give them a chance to redeem themselves . \n\nI ordered to go and when I got their at 8 pm on a Saturday night and there was only one two person table and no other people in the restaurant, I had a feeling something wasn't right. \nSpent $23.17 on two pastas to go. One the was spaghetti with meat sauce, I would compare it to a can of Chef Boyardee. The other was a pesto pasta with chicken, not very good either. \n\nThrew them both in the trash\n\nAfter this meal, I also threw my Streets of New York takeout menu in the trash","date":"2017-04-30 03:50:36"}
{"review_id":"ltJkDYTP41YLg4oJSwPsnw","user_id":"ijqAxf083C8NRaoIUsLQuA","business_id":"VMr8sgoQOW0fo0qVJENajA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is the real deal. Everything was super fresh and very tasty! Our server was also very knowledgeable about the menu and all the ingredients in all of the chefs dishes.","date":"2017-11-06 19:12:22"}
{"review_id":"tkt9unA3To9IOCPyo3F9IA","user_id":"7308lEhM1lrH2cYCOk3SJA","business_id":"N5tz1ZQqeIyGtvB0yoLI4A","stars":5.0,"useful":0,"funny":1,"cool":0,"text":"After 2 years of trying to go at it (unsuccessfully) alone on a short sale, I was referred to Xenophone by my real estate agent. I am so grateful I found them! \n\nI first met with Xenophone and he spent about an hour answering every question that we had during our first meeting. When we arrived, Xenophone had already reviewed our file and had a recommended course of action. We learned a lot about the process and had a sense of comfort about his knowledge and track records with success on our type of short-sale. We were able to work out a convenient payment plan and retained Panda & Associates services when we left.\n\nIt took four months and countless hours by Xenophone's staff to get this short sale approved. We are in the final stages now so its not completed but looking encouraging.\n\nThe staff here is extremely responsive, very good about communicating and always prompt with updates. We had a few close calls with the sales date looming and the staff put in overtime with late\/early calls to work on our account.\n\nIll update when everything is finalized, but at this point, I have been happy to refer my family and friends to this firm and have only positive feedback.","date":"2013-09-04 01:09:29"}
{"review_id":"cKMsiu-Fdhsn369kSy1OLw","user_id":"OafODJJ3Ck58V95pgcniog","business_id":"STmbtI-ivQnh0KM_2sptcg","stars":5.0,"useful":3,"funny":0,"cool":2,"text":"The next time your in need of a eye exam and\/or any eyewear I would strongly suggest that you give \"ALL THINGS EYES\" a try. Their front staff members are exceptional as is Dr. Wong.\nEveryone bends over backwards to make sure you get just what you want, great selection of eyewear. You won't be dissatisfied. I'm so glad that they decided to make the move into the South West area of Las Vegas.\nI definitely will be going back there the next time I need an eye exam & any new eyewear.","date":"2016-10-26 15:40:06"}
{"review_id":"RfF0DmyE1VyzFY3DaJZn4A","user_id":"FBj6OZ5ks9wLmRJOAeGoXA","business_id":"emDWwpE1dcUhP-raIExhVQ","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"Ripoff is the only to accurately describe my experience.   To further explain the price was too high for what you got in return which was overcrowding to the point inhibiting participation.  The experience could all be had on wii and a local gym.","date":"2015-01-03 22:18:19"}
{"review_id":"NT-zOFnpLcFCDhlCxv_xGw","user_id":"Rmr5rK4gGlG7cEb6-N31nA","business_id":"eoJfl5vG7X87QhcKb0nt5Q","stars":4.0,"useful":3,"funny":0,"cool":1,"text":"I was so excited for this to open and was hesitant after reading some reviews but I finally went and loved it!  I think there are some issues because it is new, it is popular, and it gets crazy on Fridays and Saturdays. I went on Sunday and still had to wait in a line but it went quickly and wasn't and issue. I think in time it will get more efficient on busy days. Service was great, our food was surprisingly good, beer was tasty, and the place is just fun!  Definitely feels like Oktoberfest with the great German band they had playing. I look forward to coming back in the summer when the outside area is all open.  If you can, check out the Hermit Club portion of the complex. A very cool historic building that fits perfectly with the Hofbrauhaus!","date":"2014-11-12 15:24:22"}
{"review_id":"nm-AGOTRLqQIisz9maAwuQ","user_id":"UhlXS6NdA5k4SRunpcKHJw","business_id":"eZG3ldsHielH2FZDqEFuEg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"lots of selection, decent service, cold beverages.  Whats not to like.  I had the teriyaki wings and my guest had the medium bbq, and we shared some fries, veggies & dip.  Wings were awesome, fries were OK, veggies were OK.  But its not called wild fries and veggies for a reason i suppose.","date":"2017-08-16 13:17:48"}
{"review_id":"Fw_Fi1SD_cR6aAbycZDd8A","user_id":"QIy3iLXjBUBqRzwd2lnWGQ","business_id":"c1JoHp602zilpDU_57DsMg","stars":3.0,"useful":3,"funny":0,"cool":2,"text":"WHY SO EXPENSIVE?!?! \n\nI know the reason why is because of the rent, but damn. I used to work at Starbucks so I know the normal prices at a Starbucks that's not located on the strip. The 3 stars is not for the service, but for the prices. \n\nThe staff here was very friendly. They had a good 10 people working which was a shock to me since my store didn't have that many people working at one time. Everyone was doing something and they made my drink within a couple minutes which was pretty quick. \n\nOrdered a simple grande iced coffee, no classic, 2 pumps white mocha. \n\nTasted like how it should have. Great service, but not so friendly prices. When you need coffee though, you need coffee. So the price doesn't really matter when you are tired! \n\n**A plus is that it's located in between the casino and the convention center so if you are headed to a meeting\/convention you can easily stop by here for a drink.","date":"2013-10-24 05:05:39"}
{"review_id":"7noFtR1eZ0oNydH5WM2Grg","user_id":"f5c8CE4W-lc2HzgGmRuaEA","business_id":"3SozmlI5K7xapJBE41Ah1g","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"First visit here and I can not find any faults.  The place is nicely decorated and in great shape.  I only say this because so many Chinese restaurants I go to look like they never repair or update their furnishungs.  The menu has all the popular items but is not overly huge.  We ordered egg drop and wonton soups and then  Mongolian beef and Curry chicken.  Everything was served in a timely manner, looked great and tasted even better.  Very happy we decided to drive a little farther for this experience.  I think too many times we settle for what is convenient instead searching for better","date":"2017-07-08 17:28:41"}
{"review_id":"TExy_lSWCgo___G8nT8TlQ","user_id":"or3PrD6u5QG5SQgooGvYHw","business_id":"OhC1OHgp3TCj9_N27SPy8w","stars":5.0,"useful":5,"funny":0,"cool":0,"text":"There is a good reason this shop has 5 star ratings.  This is my second time using them I am very pleased with the work they performed.  As the case from my previous visit, my car was properly diagnosed and I was promptly called with details on the repairs.  I have owned this particular Mercedes for 10 years and do most of the work myself.  I knew what the issue was with my car before I took it to them, so I can with confidence say that they are honest with the repairs they recommend, and they are done properly.\n\nIf you have never seen this shop before, it is clean and orderly.  The last time I visited,  the bays where filled and they where working on some old SL's which was nice to see.  Instead of going to the dealer come here and like myself you will end up being a repeat customer.","date":"2015-04-28 18:59:07"}
{"review_id":"pVO7Mrc_VMbOc8f1m22FAw","user_id":"0wvKkHp6e594Ag3ip8zIgA","business_id":"bupMXFUaZfranBLdaVcRww","stars":5.0,"useful":0,"funny":4,"cool":0,"text":"I've got good news and bad news. \n\nGood news: Ginko is a little bit better than a Conde Naste's 2015 Gold Awarded 3-Star Michelin rated Sushi restaurant with a 1-month waiting list in Tokyo Japan. \n\nBad news? I had to spend $230 dollars on dinner in Tokyo to figure that out. \n\n- Jay Zarkovacki","date":"2015-10-23 15:38:13"}
{"review_id":"79o7Ln9Q8pPEKdljnv8IbQ","user_id":"IJ6gGLRvJHtRaj84Puo6qw","business_id":"JLC7GX4d0qkd5lm14QKZ-w","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Today I had my three dogs groomed by Victoria. \n\nShe did a wonderful job, arrived on time, was very friendly and my dogs look great! \n\nThey scheduled me within a couple of days. I will definitely use their services again, thanks for doing a great job","date":"2015-10-07 22:12:02"}
{"review_id":"q9Wgm8fFafx31H6VxgPGvw","user_id":"Ag7qJldGLMWHnFwUY4O1-A","business_id":"Pl_B2D5aP21R-u9rdSwLAQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Tom is on his truck working nonstop, very impressed with his work ethic. For this reason forgive him if he doesn't pick up his phone. He did return calls.\nDemo'd my 40,000 gallon pool in 3 days. Lowest quote, and also handled city permits and is licensed. Very impressed.","date":"2015-09-24 00:33:15"}
{"review_id":"Ce7Pa7CsmC6ysa2QIAFUvQ","user_id":"okKdWCZSbztCx3kGvMcIJw","business_id":"aGiISkkcEhciE7LCj7MekA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I loved this place and so did my kids. They both received great haircuts. You know someone has a good haircut when people stop you and asks where you got it cut!!!!","date":"2017-06-06 20:09:19"}
{"review_id":"TiXZgTVC5GWlvqe941IFUQ","user_id":"Pj9YpaP0T7A_5S_PT8IpNg","business_id":"NXWWlAJi2kDltKRiSzAk2w","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"As others have indicated, perhaps this store could have done a better job coming up with their name, as they are much more than a wine store.  I didn't know that for a long time and I'm disappointed that I spent so much money buying my liquor at supermarkets.  Now that I've discovered Total Wine it is pretty much my sole stop for not only wine but beer (I am incredibly non-loyal to beer brands, I like to try new beers from all of the world).  I also stock up on my hard alcohol at Total Wine and have recently discovered they have a decent selection of cigars.\n\nThe store is pleasant, with kind of a woodsy warehouse feeling to it.  Most of the staff are knowledgeable and pleasant.  The prices across the board are reasonable.  They have long hours and tons of parking.  Maybe the only slight downside is they chose to locate in Desert Ridge, which is not a mall that is easy to just pop in to.  I think Desert Ridge is more suited to stores like Target, to the movie theaters, and to the food court than to a food\/liquor store that I might want to go to for one or two items every few days.","date":"2012-11-06 17:17:16"}
{"review_id":"MWYD5mUR2mwt7dEuL6_WEQ","user_id":"z5TgzjEw8YfEbD4KkgKRxw","business_id":"G_1M9_yX5ThAROn1zKKpQg","stars":3.0,"useful":3,"funny":2,"cool":3,"text":"I'm amazed I've never reviewed this location. Guess it's been awhile. But I had to write a review since I've been avoiding Panda ever since they started substituting corn in their fried rice due to the egg shortage. But I decided to give it a try. Got half fried rice, half chow mein, with honey sesame chicken and teriyaki chicken. Everything was pretty good. Even the fried rice... the corn honestly had no flavor. No taste whatsoever. I don't know why they have to put it in there. Because it sorta looks like egg? Just leave it out! Geez. But the food was good. Had to wait for them to brew some more iced tea cuz it ran out. And they didn't give us any fortune cookies. =\\","date":"2015-11-06 01:37:51"}
{"review_id":"0SQC0qxU2kJpigFbKaRscA","user_id":"-OvPeDVhr4wWK00G_GQBMA","business_id":"eqQnIjAAhOUuHqK6gTWRXw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I went here with my sister and nephew, it's a little dark but our waitress was super friendly as well as the other staffers. The food was also delicious. Hostess was helpful even the waitress who was on break was friendly. I will be back. \n\nI","date":"2015-10-23 15:42:42"}
{"review_id":"x7hJCYTO1KsRgkNEqj7zIQ","user_id":"mm55g049o2nj09b96Byxlg","business_id":"TZl7YBuzo5awZP8QJDLg_w","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I've been going to Jordan's since I was a kid.  The food is consistent and good, and the staff treats you like you're family.  It's a very relaxing neighborhood restaurant and a great value!","date":"2011-08-25 00:43:44"}
{"review_id":"fLsgJj9XIxkuo1aPO70eeA","user_id":"robx0qSlEYlB3HuM0N9fwg","business_id":"9wM6SK5Q_syHE1P89kyUzQ","stars":5.0,"useful":3,"funny":3,"cool":3,"text":"The Master Spa has the best foot massage that i ever had...i am from Los Angeles.. there are many of foot massage places there...but none of them like this one..so friendly and has very good skills..especially the therapist Lin-Lin...wow..so amazing!! Definitely recommend and will come back every time i visit vegas~~~ Nothing more but A++++++++++++++++++++++++++++","date":"2013-02-22 00:21:08"}
{"review_id":"IgrMY_M5orFfa53MGR8CqQ","user_id":"JZZtgn4z4NvicjG9CceaNg","business_id":"wkKlpSx3OcoGJiv7p8VZzw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My new favorite restaurant in Las Vegas. Do yourself a favor. Go, sit at the bar, let them choose what you eat and drink. The kitchen and bar are both killing it! Watch this place blow up on the Vegas restaurant scene. Mark my words.","date":"2017-09-09 06:25:25"}
{"review_id":"-GSNtaX3AYXBs429V2obWw","user_id":"eOn_uuDX8scLqonnmu6PmA","business_id":"CXxJkD62XtDrt3pRYNDspg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I'm sooo surprised to read all this negative comments and star rating of this place.  A couple of my friends and I were around the area and wanted to grab a quick bite before we went to explore hard rock!\nOur first impressions when we walked in was that the place was really  clean, they had jukeboxes and it was playing 50's music.\nI ordered their regular hamburger as well as an Oreo shake, which was recommended by our server.\nOur food arrived in about five minutes and wow, this is not your average hamburger!!!!!\nIt was delicious! The shake was thick and well worth the money.\n I only wished the hamburgers would come with fries as they were all separate but considering how yummy everything tasted it doesn't matter!\n The manager was in fact the person who served our food, she was very nice and had a Russian accent.\n She was nice enough to even split our checks 3 ways after we got the receipt and told her we forgot to mention separate receipts.\nIf I am ever around the area I would def come back.","date":"2014-02-24 05:04:18"}
{"review_id":"rDd2y43XMEathCyc-QuEsQ","user_id":"V6iWMj00-rDP56SIqvMnFQ","business_id":"sorCDsROnGIZ36DHzhi9Ig","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"EXCELLENT ‼......this one word sums up my experiences since 2012 at this Sprint Store. Joseph, Brandon, and Anna have been VERY helpful when I've had issues with my phone. They care...and that very important attitude combined with their product knowledge makes for an \"A+\" skill set.","date":"2017-12-29 16:51:10"}
