{"review_id":"j80Z8YEyg4ktXfTlCzYCdg","user_id":"XKKciCV2XqhRYd3k4fluJA","business_id":"Gc8xWVpbUlBYHAoOT9MTyQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Stumbled on this gem on my way to Bang Bang... and I am glad I did. This was my first time trying Cuban food so I wasn't sure what to expect. All I can say is that it is delicious!! It was a cute narrow restaurant with a diner feel. It was well portioned and had a good balance of flavours.","date":"2017-05-13 06:15:09"}
{"review_id":"oV0JzRPHBCklimo-ElfWJQ","user_id":"LrsX8ioOG6GEIHfsXI_9GA","business_id":"-NIpCMONu69292q9Itiipg","stars":4.0,"useful":3,"funny":1,"cool":3,"text":"Asked my manicurist twice to round out my nails, twice to make them even lengths, heck she even tried to pretend not to notice that she was missing 1\/2 cm off the side of one of the nails (that one I refused to let slide). All in all, my nails look ok, but after spending a frustrating hour and a half having to repeat (with photo) of short acrylic nails, I left feeling flustered, and that's the third time in a row. It's a cheap place to get your nails done but if you're the kind of person who pays particular attention to detail, beware. I leave the 4 stars because they'll correct it if you point it out to the manager, but I don't like the fact that I would have to. None else will ever notice, but my left thumb nail sticks out 2-3 times further from my fingers edge than my right, and I shouldn't leave the salon to go home and fix my own nails.","date":"2018-06-08 23:53:40"}
{"review_id":"FABZApqi20CfnP6EejuHwQ","user_id":"7sikF_3ShQLGqpbKG3hYiA","business_id":"1aVqiz43klXaFJUUx0H5fw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"First timers here! Super friendly staff, ordered a Rebel, Freeze and Birthday cake. Great drinks!","date":"2018-06-26 19:52:51"}
{"review_id":"dmXXkBDSe5mm14uZw_-8BQ","user_id":"SEZVQUIxNukcowUAR14VUQ","business_id":"wEisic-u9Yj543iYzfpAhw","stars":5.0,"useful":4,"funny":0,"cool":4,"text":"I have been here about four times for lunch over the last two years and each time it has been consistently good. I am not a Mexican food aficionado but it definitely seems different than the usual Tex-Mex a la Laredos.  \n\nOn my last visit two weeks ago, I had the 7.95 grilled steak lunch special.  Rice and beans accompanied a nice grilled piece of flank steak covered with a deep dark mole sauce hinting of chocolate. Subtle + simple = sophisticated.  Nice. Tasty and fresh guacamole too and homemade tortilla chips!  It is not a large restaurant and some would say it is a little cramped. I call it cozy and serene.","date":"2016-01-30 06:16:52"}
{"review_id":"HK5oP5mY2rxygcHhkVp0_w","user_id":"0Pj91NFPtXWeIDaLp2kuyw","business_id":"zuUWG7OdMv6awFRYhEYT5Q","stars":4.0,"useful":1,"funny":1,"cool":0,"text":"This place really does it right. They have a small but focused menu, and the food is pretty basic: burgers, wings, pizza, and a few sides. But you can tell that they do everything from scratch and the quality is outstanding. I dare say the burger is better than Fatheads right down the street (also a great burger). Highly recommended!","date":"2011-04-22 16:41:20"}
{"review_id":"YBIKzz8l1YU_SiZLlpxLAQ","user_id":"USMm3mKNzIGS8L6y6fH9hA","business_id":"z_1n_57ANGutdEnfbWpTGw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We have visited this location about 5 times. Most recently right before closing. The food was hot and fresh like always. Good burgers for a good price. The milkshakes, in our opinion, are not very good.","date":"2017-03-15 04:31:41"}
{"review_id":"vUea3ZadrtjNXMFNlwuNIw","user_id":"tWC-WDw5fl0kmGMuZ9CEfw","business_id":"C9QNd6qXSRgSy8n4OBf2mA","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Some of the best cookies I have ever eaten. I am a big fan of oatmeal cookies and my favorite so far is the oatmeal peanut butter chocolate chip! Yummm!\n\nIt is a chunky cookie filled with lots of good stuff and tastes like just out of the oven. The owner says they do mail orders and also gluten free.\n\nThe shop is charming with unique one of a kind items. Owner is friendly and welcoming. The shop seems like a comfy place to sit and enjoy your cookie and tea. Maybe next time I will try their cookie sundae with ice cream drizzled with caramel sauce.","date":"2014-06-28 00:05:26"}
{"review_id":"-0ISwybjwdng4aoUVmaaXg","user_id":"nC1Q1lfY8O0sKN9d2sMz0A","business_id":"vhKUBKcOm8zOLxeS3XM9iA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"The food wasn't bad. We had pizza, ribs, and fried chicken. We are in town for an event and found them on Restaurant.com. Our server Melissa was awesome. Very friendly and attentive. I hope to come back.","date":"2014-09-10 00:36:54"}
{"review_id":"W2V1gEORJpupX6Ltl9g0yA","user_id":"l1VoG-0-bDF-us7xbWxfeg","business_id":"tvYID0arhN-shKGUrC1Wsg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We were one of the first into the restaurant, a large group of about 15 on a Friday night. Food was hot, delicious and constant and service was great! Favourites included: garlic sirloin, signature steak, cornbread and of course the pineapple! Several times during the meal they checked to see if there was anything we wanted more of.\n\nLive music was a nice treat.\n\nWe were reminded two hours after arriving that it was time to leave due to the time limit.","date":"2017-03-04 02:07:33"}
{"review_id":"yVT6JAOiLIW5UaXSgek74Q","user_id":"9iox_UzLC-81so8d5vceww","business_id":"x_eIYAOPCSM1BKvID2Vcbg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"WOW! The sandwiches here are off the hook! Not expected considering it's sitting inside of a mega resort. My wife had a club sandwich and I had a pastrami sandwich. Both were excellent! The bread was fresh, the meats were utterly tender, and oh so flavorful. You get a whole pickle with your sandwich, not just a spear. Here's a tip if you want your sandwich quicker. Have a drink at the 32 bar right next door and order your food from there. It took less than ten minutes for our sandwiches to get to us after we ordered them. That's fast considering the line for this place is always super long.","date":"2018-06-09 00:50:37"}
{"review_id":"jAy2upJfJvKS9zkOtDntAA","user_id":"af0Dl5kpKsms8lloC4i3CQ","business_id":"SwqXNCoaqhX5Oj1tKbrxkw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"First Star - The price is great and affordable to fit any budget.\nSecond Star - The location is conveniently located in a spot.\nThird Star - The customer service provided by Melly \/ Melli was great.\nFourth Star - The place was clean and no spills on the floors.\nFifth Star - My overall experience was better than expected. I definitely recommend going here if you need your clothes washed.\n\n(Thank you for reading this review - I am writing reviews of everywhere I eat when I dine out, places I shop, movies I watch and much more. \nStay posted with #ReviewByMariaMescal)","date":"2017-10-11 08:15:56"}
{"review_id":"h8ISZthfwC66gSphCC54Gw","user_id":"MAEqpYRNbKwtgdZZL61zOQ","business_id":"4kDLEb1OgE7IrO54lCkn3A","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I didn't know it is a Playa Cabana chain restaurant until I see the bill! It was yesterday, a day with freezing rain. When I called in and made reservation in the Morning, I didn't think it'd be a full house on a day like this( April snow). I'm so glad that I did when I arrived this hidden gem in a not so busy neighbourhood. \n\nWe ordered cheese Jalapeño for starter, osso buco and braised lamb for main. Everything was delicious!!!! So richly infused with all kinds of spices! The cheese jalapeño looks a little unpleasant under the red neon light, but after the first bite, we are totally sold!! Both osso buco and braised lamb come with tostadas and beans and rice, no need to order separately. The portion was quite generous for two girls, next time we will probably cut one main and do one more starter. \n\nMy only criticism would be the size of the table. For Mexican food, it'd be great if we have a little bigger table for the many dishes. But I understand that it is built upon a small townhouse, won't be able to have so many people if the table is bigger. \n\nAdvise before going: \n\n1,it's going to be fully packed, make your reservation early. \n2, it's going to be loud, don't expect to sit in a quite corner. \n3, ask the waiter for recommendation, they give great tips!","date":"2018-04-15 14:42:51"}
{"review_id":"RNuxeB7iIU2A0sRQ-GB_FQ","user_id":"s6DMttJcJwME8p5sSiRFdA","business_id":"N6BDiFk2CyJTMPGUlcOfAg","stars":2.0,"useful":2,"funny":2,"cool":0,"text":"The flavor was off, hard to describe but it tasted weird. I had the thai tea and my friend had a milk tea, both tasted weird and we've been to dozens of boba shops. The boba was old and very hard, when I asked about it the staff said that's the way it is and he implied I really didn't know what I was talking about. In addition, staff was abrasive and frankly kinda rude.","date":"2016-10-14 01:42:03"}
{"review_id":"SiC7yVZP8URH9f6rkWipCA","user_id":"9df8KToLljo-v--Wke2W1w","business_id":"Rb2s2-2kIvbPXnPEuM_OBg","stars":3.0,"useful":5,"funny":2,"cool":4,"text":"Fun place...good food and an oxygen bar. My friend did a deal at the oxygen bar where she got a massage and some essential oils to relax so I thought that was a nice touch. We ordered a few apps and drinks. The vibe is fun and makes you feel like you truly are on an island somewhere. I enjoyed my tortilla soup and a friend had the spinach dip which was pretty good. If I'm ever at the Treasure Island hotel again I'd definitely pop in to hang out and enjoy some eats.","date":"2015-11-18 19:28:46"}
{"review_id":"YIe20tW6WOPL9sGefIY2cQ","user_id":"9Dyg4GhZ9Dj3zoTOu5SKVA","business_id":"KMoGrkbhRsy1jYlwiZx7kQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Better and better needn't get any better. I was once drawn in by the specials in the window, until I realized that all of the prices were just that low. It is a quiet, reliable, and friendly spot to grab a bagel sandwich or a banana muffin and coffee in the morning. If you come to study there is ample space and the music is not obtrusive. Parents can feel free to bring their toddlers here to sit a spell because its clean, cheap, healthy, and the environment is unpretentious. A great place to patronize-the owner is an asset to the Korea Town community.","date":"2013-05-28 22:32:00"}
{"review_id":"FGfB9royRBNIJGn7p546vA","user_id":"fR9KByM822R3HmUkbQxhqQ","business_id":"WunR7VclAddvbCnc-97jzg","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Great service, food and atmosphere. One of the most comfortable and well designed restaurants I've ever experienced.","date":"2017-06-17 18:10:20"}
{"review_id":"XDFBMbJx0mZQ3IbWpXOksg","user_id":"BEpNYLOIQPaC6QJsnw1Lbw","business_id":"GI-CAiZ_Gg3h21PwrANB4Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Took my love here for an early birthday celebration. Our waiter, Johnny, was the best, so funny and attentive. \nWe started out with the lobster bisque and it was heaven! I had the petit filet with scallops, my bf had the Kobe steak with sautéed shrimps, we had the lobster mashed potatoes and Brussels sprouts for sides. \nThe filet, steak and shrimps was delicious! My scallops was a little salty and slightly overlooked but still yum! The brussel sprouts was also salty and could use some shaved almonds and cranberries but overall good. \nWould definitely come back despite the whole meal cost me an arm, a leg and probably my first born.","date":"2016-02-12 01:59:08"}
{"review_id":"nIyIUCjpGXfaPYT3NvVlVw","user_id":"uC3xmlRiunB4qG3cKPk0Ow","business_id":"hDa63HeG4J43pbeE3DUw8w","stars":5.0,"useful":8,"funny":0,"cool":0,"text":"My kids' allergies were really kicking up, so I started looking for someone to clean our air ducts.  I called a highly rated air conditioning business to ask their opinion and they told me their customers were extremely happy with All Ducts.  I called Brian (owner\/manager\/employee) and he got me an appointment exactly when I needed it.  He gave me an estimate for both cost (very affordable, in my opinion) and time and both were spot on. He has all of the right equipment--he is not a carpet cleaner that is trying to moonlight as a duct cleaner. He is thorough and professional.  I had him clean my dryer vent as well, which was a tricky job, as the builder vented the dryer from the first floor to the roof. However, Brian had the proper equipment and was able to do the job easily. I highly recommend All Ducts.","date":"2013-03-18 19:59:44"}
{"review_id":"GlFLcRTMlMq3HfYT7CAZ0A","user_id":"mroZWz1I4udEHcZTb0Pffg","business_id":"8dwHni4w40DaJVo68eQY0A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The BEST smoothies ever!! When my nieces visit from Belgium they always ask me to take them.","date":"2015-01-18 14:54:11"}
{"review_id":"OYtxpiW0hnaP5DSACoSSZQ","user_id":"41Fjh2xtadUTRWcP6Hr45A","business_id":"VtwmWMGcpNf14twndon73w","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Got my haircut today by Crystal and I love it! I booked an appointment last night around 5pm through Yelp so i wasn't sure exactly what I would be getting. I asked her to give my fine limp hair some body and fix up my bangs. She did exactly what I hoped and my hair feels so much healthier! Crystal was so pleasant and spoke to me without any of the pretense that can accompany conversations with some beauty professionals. One of the owners came over and spoke with me for a bit and he was so kind as well. These interactions were super appreciated in what is probably one of my last \"lady\" days before having my first baby. I will gladly be back and already recommended Crystal to my bff!","date":"2016-06-11 21:27:50"}
{"review_id":"tSvHAIiaxZ_EczTMqUEgIw","user_id":"cqOIg8EAMEzjO4Mz-knvdQ","business_id":"feagypDw9NbOsBZgaxmy7Q","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"We were seated immediately but sat with our feet in the water for 15 minutes without anyone saying a word to us. After our water got cold, we ended up just getting up and leaving. It wasn't until that time anybody said anything to us. Poor service. Would NEVER go back.","date":"2014-06-27 23:32:51"}
{"review_id":"4zGGoB6jswINk7iv26xmGg","user_id":"D2PY0xlsj5DZh34VjTDwZg","business_id":"OBW5Yw9LVQwe2Bem5oM7ng","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I don't get all the good reviews about this place. I came to this place too many times because all my colleagues come here because they don't want to walk outside of the building to have lunch. But if i had the choice, I'd go anywhere but here! They have a lunch menu and i tried all the plates on it in order to find something decent to eat but everything is disgusting. If you want asian food, this is NOT asian! The pad thai taste like spaghetti. Service is ok. Prices are high for the poor quality food. I don't recommend this place.","date":"2014-11-12 14:31:43"}
{"review_id":"vw8BSkI465O-U60eLJ309A","user_id":"ZSJ_x_gxaeGE0d2dEQqv2A","business_id":"RNi6tW22UMgHwWLAb0mYdA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I've eaten at a few of these.  They are OUTSTANDING!!!!  If you don't have one in your home town it's great. \n\nLittle known fact is they have a lunch menu till 2 that is much cheaper and just as great.\n\nThey definitely train their servers to be the best!  Go.","date":"2012-06-26 05:08:08"}
{"review_id":"1xYF204MvFImeedD4y485A","user_id":"pm5agIB13HAoibwqqs5S7g","business_id":"mM5XynUk82upOm43mIJFHw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I've been here 3 times now and every time was fantastic: very reasonable prices, great food and awesome friendly service from this fully family-run resto.\n\nOur favourites are the deep-fried cauliflower and the royal jade house special soup. On the latest visit, we asked for the ginger crispy beef made instead with chicken since we had one person that couldn't eat red meat.  The chef kindly obliged and it was AWESOME!  Definitely should be added to the menu. :)","date":"2018-06-08 23:38:13"}
{"review_id":"MHfeGf3hrX1AYa7XSn9x0g","user_id":"P2E31XC7SP4v_3hXC2o0Xw","business_id":"Zn6cXli_5ZjgW67z8vA0pg","stars":3.0,"useful":4,"funny":4,"cool":2,"text":"About 2.5 (close to 3) Bo Bo is another shop in P-mall that specializes in chinese silk dresses. They have a store on the ground level (D75) and upstairs in the Heritage level. I liked the styles at this shop as it had diff colours. Plus the display is quite clever, lining up all the dresses by the window. I found the red silk material is better than the other coloured ones. So if you're looking for a red qi pao u might be in luck!\n\nThe shop owner(s) were patient and nice. I tried on a gold dress... the material was honestly too thin and loked cheap on me. On the display it was exactly what I'd like... sad sad. I felt like Chung Lee from Street Fighter in the dress @@ If i have to fork out $80, I do not need a constant reminder of where my flaws are. Somewhat  frugal here approx $80 + for a chinese qi pao. Perfect place for petite hk girls or anyone looking for a red qi pao.","date":"2011-02-13 20:45:30"}
{"review_id":"Ps6RPgmSNyqhSO4bbPMgow","user_id":"kTbENMo1lXimAg-4JsIGBw","business_id":"jq8BDvTygfKYMvEd7BvSeQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I tried the cheddar poptopia gourmet popcorn and I was disappointed to say the least. I found it to be tasteless and greasy. Normally I get regular movie popcorn with the white cheddar cheese seasoning, but the movie theatre ran out  (again). I expect at $6.50 for a 125g bag it would  taste \"gourmet\"...not so much. Suffice to say I will never buy this brand again.","date":"2018-02-11 04:20:54"}
{"review_id":"Z_E363pH1C_HWJrPQoCczg","user_id":"ErL97r9TKDLrfDIwnJMKkQ","business_id":"1d6c6Q2j2jwVzBfX_dLHlg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"As someone who doesn't like the taste of salad (generally), but who isn't anti-vegetable by any means, I gave their signature Stetson chopped salad a try, and I'm a convert--so, so good!  The salad has a lot of elements to it, which give it great texture and keeps it from getting monotonous, as each bite is a little different in flavor but still cohesive.  \n\nMy husband really enjoyed the burger he got at lunch time (we didn't see it at dinner time).  It had a lot of good flavors going on and was cooked well.  It was also a massive portion!  We've tried their truffle macaroni and cheese, which my husband said was decent, but I didn't love; too bland, no truffle taste at all, and too loose for my taste.","date":"2015-11-18 18:38:40"}
{"review_id":"0uOUiyke35VhpyhaU7aHGg","user_id":"Wz8BXsPQrWkI3qSLtW-d1A","business_id":"MNaPOkqm2vKeNG8EqkZWCg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Every dish we touched and filled our bellies with is delicious!!!! Thank you Joe!\nWe will be back with the entire familia! \nCiao!","date":"2016-08-13 02:53:01"}
{"review_id":"LZhBVX5InaovoMsg5ZMBLg","user_id":"zSqMbeNZXI-qippJ_vLmfw","business_id":"_V0yJdpXrbdKzBDoVSJGWA","stars":1.0,"useful":3,"funny":9,"cool":0,"text":"I wish I could give this place 0 stars. By far the worst experience I have ever had in Vegas. \n\nTypically hotels in Vegas are known for being extremely catering to their guests. This was not the case. Plus the whole hotel looks like absolute crap filled with the scummiest people. \n\nNext, my room was absolutely filthy. There were piss stains running down the toilet to the ground, it also smelled like someone died in my room. The bed felt like I should have brought a black light and possibly a hazmat suit. Best part about my room was the AC actually working, but the shower\/tub looked like someone had just washed their cars undercarriage in it. The towels felt like sand paper and were barely large enough to be considered bath towels....more like hand towels. Getting a cab is nearly impossible since no where does it say you are required to tell the front desk to call a cab or just call it yourself, since they don't employ someone at the entrance to wave cabs for you. Their room service isn't insanely over priced like most Vegas hotels, but there's a reason for that, everything tastes like it had been made 24-48 hours earlier.\n\nLastly and most importantly, after surviving 3 nights in this dump, I was brushing my teeth the following morning when I noticed a fairly large cockroach scamper across the sink.\n\nAfter all this I literally slept at my friends hotel the final night to avoid puking in my own mouth or getting some rare form of malaria.\n\nIf I told you how much I paid to stay at this sh*thole, you would kick me in the d*ck for being such a dumbass. \n\nIn the end I feel like I got raped for my hard earned cash just so I could save a little. Definitely learned my lesson and going to spend the extra cash to stay at a real hotel next time.","date":"2014-07-13 15:06:35"}
{"review_id":"6ovHcHq10d6Am0_oopwheg","user_id":"8sNsxW6h9oahdCeL8wlIGA","business_id":"ATErtjbLCxEPOD8ICKKr5Q","stars":4.0,"useful":7,"funny":6,"cool":7,"text":"Ended up eating here on 3 occasions while at the GVR. This is a small space, with only a few tables, but plenty of seating at the sushi bar. \n\nLots of creative and traditional rolls on the menu. I pretty good selection of nigiri, and a nice variety of sake. My favorite was Sparkling Blueberry Sake, very refreshing and you can taste the berry flavor.\n\nThey offer an all-you-can eat option from 5-7 pm for $28.95. This is a very cost effective way to go when you are hungry and the all-you-can eat menu has almost everything on it. Beware, they will always serve rolls first to fill you up, so if you order nigiri make sure to specifically ask to have it brought out first.\n\nP.S. You have to try the steamed chicken dumplings off the fresh sheet.","date":"2011-10-27 17:59:16"}
{"review_id":"AAlGCs6Wv647BIz6x_MKQw","user_id":"GcIlbmbXGcE5j2_p3cnc_Q","business_id":"eetlD3KXlb8cTwgrQVfquw","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Coffee and food is a tad more expensive than other places but you get a lot of bang for your buck. Leather chairs and booths, carpet floors, very friendly servers, free refills on coffee and soda, tasty food, and a mature customer base.","date":"2014-02-23 22:19:23"}
{"review_id":"HKYk1_eTSh1AcdpqcqqESA","user_id":"vEXQPLOCIgYoNXeekjL2aQ","business_id":"oWQaP9yP77B3Au0LAEevdQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Welcome to Steele Creek guys. I love going here and every time I leave here I feel good about myself. They even help you with your grocery's to your car every time. They give you coupons to free stuff. Make sure to get there before the evening to try the many samples.","date":"2015-02-02 06:02:45"}
