{"review_id":"YqlyfBCtB11Vdl_9Bnfg9A","user_id":"nQtzqKs_6RWJOSJe2tfpkg","business_id":"IghwtXL8ZgK2dEL62Pzhrw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is a regular taco stop for me, and if you love tacos it should be for you also!  Al Pastor tacos here are the best I've ever had in the state. It is not an exaggeration, but if you come here and do not try them, you've missed out on one of the valley most sought after gems.. \n\nIn addition their other meat selections are very tasty, asada and cabeza being my next two favorite..","date":"2018-08-04 21:39:41"}
{"review_id":"vZJPUzyJoyyhMFdo0Dcamw","user_id":"hvQB1LPXvQivDI9mzb9P1g","business_id":"5fpFcCDkin0Up_3j2GBvPg","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"I've been to the salon 3 times now - after the last, I dont think I will go back, even with the price in mind.\nThe owner is very nice, and was cleaning and constantly busy. But the lack of hygiene is what really turned me off this time, and the other times I have been. Even though there is a pan by the sink with rubbing alcohol for the tools, I never see them disenfect the tools between customers. I watched in horror as they took a file just used on a woman having a pedi and bring it over to me and use it on me. They dont even wipe off the tables in between customers. \nI wish they took more care to show that they disenfect the stations properly. I know this is the 'no frills' of nail salons, but cleanliness is still an expectation, even with a basic service.","date":"2015-06-21 02:23:38"}
{"review_id":"h_XeMr1VxTu9sXL1zNtSlw","user_id":"M9TjYmTgHayJ22cNkyvW_g","business_id":"-WVF5DKZeEWlMK8Cucto-A","stars":5.0,"useful":4,"funny":0,"cool":1,"text":"I love Savoy. In fact just thinking about Savoy makes my mouth water a little, that's how much I love Savoy.\n\nThe first time I sampled some bites from Savoy was at a Yelp event last year; unfortunately it took me quite a long time to make my way back, but I after the meal I had last week I think the wait was worth it. I went here for dinner with a family member on a Wednesday night - as a result the place was pretty quiet when we arrived. After checking our coats (this is more or less mandatory as they don't let you drape them over the chairs) we were seated at one of their comfy downstairs lounge tables, and we explored the menu, ordered, and proceeded to enjoy an excellent meal.\n\nFirstly, there was the fresh free bread with oil and balsamic for dipping. I was quite hungry so this was a great start. One note, though - beware the spicy bread! We're pretty sure jalapenos were baked into a couple pieces. Tasty for some, not ideal for people like me though.\n\nThen there was the drinks. My dining companion ordered a blackberry Cosmo (made with ingredients like blackberry moonshine - quite a nice touch), and I ordered the Starburst. Both of these drinks were superb; the Cosmo was a first-rate drink and oddly enough, my Starburst did indeed remind me of Starburst candies - but was still muuuuch tastier!\n\nAs for the food - just, YUM! My companion ordered tomato soup and a pear salad. The salad was flavorful (though pretty standard in terms of salad ingredients), and the tomato soup was simply amazing - in addition to its freshness and being the perfect thickness it came with grilled cheese sandwich squares instead of croutons. More restaurants need to do this with their tomato soup, it was just so good! As for me, I ordered the 2015 restaurant week special - hen with bacon mac and cheese and a side of kale - and this was simply divine. I have yet to find such tender, juicy and well seasoned chicken in the city, plus the mac and cheese wasn't overly cheesy and had the bacon flavor infused into it. The result was that it wasn't too rich and it went well with my chicken and kale. The entire meal was also served with a side of tomato gravy, which was basically a thicker version of the tomato soup I'd sampled and fallen in love with already. I couldn't have been happier with what I ordered.\n\nThe clincher for our excellent meal was the fantastic service we received throughout the night. All in all we thought Savoy had amazing food, fantastic staff and a very chill but warm atmosphere. We would absolutely come back - hopefully my next meal here will involve sampling the amazing looking brunch menu!","date":"2015-01-18 18:49:53"}
{"review_id":"JHXpToOwlnTAQM3FDmihPg","user_id":"-c_t-8ORqOZBuKE-jdY8aQ","business_id":"wjLgM9Ybe5shoUPRrGMmsQ","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"So...I have never made it in here for their famous brunch, because it always looks so darn crowded, with a super long wait!  Regardless, I have had their food at any number of events, and it never ceases to amaze!  In addition to eating in at their charming location, talk to them about catering if you want your event to be really remembered.  A high number of vegan and vegetarian options, in addition to those with meat.  These gals are truly accommodating.","date":"2007-05-19 00:19:16"}
{"review_id":"HxGWuXLIrZnTGfq4-OzBOQ","user_id":"qURtaMkkiSUEKm7Fy_1jtg","business_id":"VlMRR74NjdysPIfaUUSoBA","stars":1.0,"useful":5,"funny":2,"cool":2,"text":"We had breakfast at the D Grill. We were all too tired to trek to another GOOD place to eat for breakfast. Plus we had to get to our convention early.\nHow can you mess up breakfast? I mean really? overcooked eggs, burnt coffee? Hard as rock toast and cold?\nMy over easy eggs were fully cooked hard egg yolk inside.\nOur party were all smiles when we finally left\nWe returned the food back 2 times and it still came back horrible.\nThey wanted to comp us for a free breakfast for the next day. We declined, nope not again!","date":"2018-07-26 15:23:03"}
{"review_id":"aU3Ihm3cz4WgoM_lp_xsHQ","user_id":"fZ3x2OUShqfTmSsIVNJcQw","business_id":"T2tEMLpTeSMxLKpxwFdS3g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"All i can say wow!!  Best taco ever had. Beautifull Ambience, nice music. Servers are very attentive. Loved it","date":"2017-07-28 17:46:10"}
{"review_id":"U0u2wB-kAvQUjem5FSbUeQ","user_id":"cVeJB7E_YE8FrKpZyi2JRw","business_id":"ID5wWJ9C7G0hfbQilvlfxA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Had early Friday night pre-theater dinner here. Once we got a waiter's attention the service was very good. Attentive with good suggestions but not intrusive. Casual open air atmosphere, causal but lively ambience, perfect for dinner with friends. My wife & her friend enjoyed a \"prickly pear margarita\" not too sweet very tasty!  Excellent food overall chips and salsa were fresh. Guac was tasty & paired well with the chips. We had 3 dishes perfect for sharing. Mexican street corn nicely spiced a bit messy but worth it. Nice fresh updated take on classic fare. Will certainly go back!","date":"2014-04-19 17:40:08"}
{"review_id":"tfzvh5kRfNjnNzd_8YHv9Q","user_id":"E_FPsrWZkodhyhZwJcf8gA","business_id":"JFNv5sKeKAf1ZVPnfbzpXw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I recently ordered here for the first time and they are pretty good and I will be ordering form them again! I was really happy with the menu which offered pastas and salads. I usually order from Pizza Hut so it was nice to have other things on the menu. I ordered the chicken parm with spaghetti and it was pretty good. I also ordered a cobb salad, also good (get extra dressing). I have been eating those 2 things for 3 days! The portions are BIG! Anyway, overall 4stars for this pizzeria :)","date":"2016-11-21 22:11:35"}
{"review_id":"wU4kV0cfwBVzVfkSsrEQrw","user_id":"1UwJVPsIiQ1VpzRZhLftSw","business_id":"4gwh0q7JsdzHIm_pdYUlZg","stars":5.0,"useful":12,"funny":0,"cool":12,"text":"Shinbay was everything I expected it to be and more (which is pretty impressive as we had built it up in our minds for months before we went). We went there for my fiance's birthday and ordered the 5 course tasting menu. Each course was more phenomenal than the next. Keep it up! Phoenix is lucky to have such a phenomenal restaurant.","date":"2013-02-22 01:15:53"}
{"review_id":"1ze3nXy2XOO93quZbhwrbg","user_id":"1pbnrEYKJIPVU5V5p8WBHQ","business_id":"nMo0ozHO7cqsPaxw_7N6ow","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I learned quick you have to be aggressive here and demand people bring you food if you are ordering dim sum plates. I enjoyed the food and would return to try other items on the menu. We tried sliced pork, meatballs, shrimp noodle, shrimp and bacon wrap, fried dumpling, and something like oxtails.. I would recommend for those who are looking to try something new. It is definitely not Americanized so if you don't like traditional flavors then this place isn't for you.","date":"2016-01-04 04:53:38"}
