{"review_id":"McJ-pclfoLxzY9-MoyG-yw","user_id":"aRQeYJHfEG8C52UqXOGhlw","business_id":"I7HGSg1OfAbO9X-mbDYdxg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I haven't tried anything but the El Jefe burrito which is often except for this last time they forgot the chorizo and the salsa but I called back and Travis was nice enough to give us another burrito he explained they we're very busy that morning with a huge order and could have gotten mixed up. I still love this place and just because Travis was so nice I will keep coming back.","date":"2017-06-17 18:32:15"}
{"review_id":"owi4MUn_2PNdplN0C6i2rg","user_id":"Fxd4u1AFuOqxUkwxKRf_yA","business_id":"CY36lbBvN5R-1ep46k0RQw","stars":5.0,"useful":3,"funny":1,"cool":1,"text":"Grant his crew have been amazing. Had a few different repairs done there and very happy. Got a used car that knew needed work. Took it to BMW and they quoted me $2700 for the cooling system. Munich did a full repair on that, plus a valve cover gasket plus fixed another leak and found that my check engine light was bc a bad air\/fuel mixture and the total repair was less than one at BMW. Then had my shift mechanism go out after I picked it up from those repairs and was like \"this is weird\". Talked to Grant and he said there wasn't a direct connection to their work as they were in a different part of the car but was willing to fix it at cost using a used part with a warrantee and it runs great. \n\nHad them do a little more like a battery and stuff and they will defiantly be my shop of choice. Having a German car isn't cheap but finding someone in the battle with you is key!","date":"2015-12-20 04:23:00"}
