{"review_id":"Wg4x92-gPLN_qKOBbS2l4A","user_id":"rR3KgAwuJxk9Roz4J5_jtg","business_id":"QNfh79NwsNnl-AngRhg2ww","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I came here for a birthday dinner and man is this a cool place with It's a lively yet intimate setting. The loud Japanese greeting as you're seated helps build the setting of the place. They had Ultraman playing in the background, I mean for people who know what it is how cool is that?\n\nThe service came quick and the food started coming fast. I strongly recommend the following items:\n\nHamachi Carpaccio: A well balanced fish dish, with a hint of citrus flavour. It delivered an amazing Japanese and south american fusion flavour that you need to try!\n\nBeef tongue on hot stone: the thinly sliced tongue is cooked on a hot stone. The thin meat just melts in your mouth flavour with a citrus punch. Watching it cook on the stone was entertaining to watch as well!\n\nIf you haven't gone here yet, book your reservation and go!","date":"2015-06-21 05:28:50"}
{"review_id":"OWZBhBh0I8te5UudkSchiQ","user_id":"JVmVNOO6VjKhrF0gJUtL7w","business_id":"fvf3em_k-5-zsjx_VM-JoA","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"These guys are amazing.  Great use of time.  Amazingly friendly people.\n\nThey use all of the latest technology and really get your teeth crazy clean.  As some of the other reviewers stated, some of the newer \"deep cleaning\" services are a little on the pricey side (few hundred dollars) -- but, this not your grand dad's cleaning -- I mean, when I was a kid we went to the dentist, got a little scrape and a polish and on you went.  If you get one of the deep cleaning they do a *lot* more to get your clean, namely using a ultra sonic water scaler, scrapping, then using a laser to kill ever more bacteria, then they inject an anti-biotic into your gums etc.  The upshot: your mouth feels amazing clean, fresh and just *happy* afterward.  Do it, the next day you will feel great, and its well worth a few extra dollars to get cleaned right. \n\nI recommend them to all my friends... and you!","date":"2015-11-18 18:54:57"}
{"review_id":"SlRqylnJdgId16sDnqpglw","user_id":"InnEjkdcAxD-CCtQTP8EyQ","business_id":"ou3C2Cnot1gitNoQIu5Uag","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I came here Christmas Day 2017 to grab a few items the cashier didn't acknowledge me I asked how she was doing she ignored me was absolutely disrespectful. And I came back 15-mins later to return one of the items I bought, I  was with a new cashier and the original cashier made a scene asking if I was ok I had been sniffing my nose but her co-worker who was making a purchase tells me that the original cashier who rung me out says I looked tense. It was humiliating, customers began to stare and I got the manager involved. I was in tears over this. NOT everyone who does returns is a criminal.","date":"2018-05-29 09:09:16"}
{"review_id":"jLH5AUzY6-SYvrKQBSkfpA","user_id":"q_rgLyDEIP2GRDfwoYr0_Q","business_id":"7TuLqwMPIUIRwTHga4pD1w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"So here I am AGAIN.\n\nWhy again do you ask? I just purchased a 2011 Chevrolet Malibu from this dealership, and I went here after work to pick up the green slip so I can register the car with the DMV. \nTIP: Customers who buy or lease vehicles here: DO NOT have to go to the DMV to register your vehicle. You simply use the dealerships control number on the green slip to enter in the DMV website and it will bring up the vehicle you bought. You can then transfer or request new plates (standard only plates) and the DMV will mail them to you. This is handy, because we ALL hate the DMV. \n\nBack to my review of AutoNation Buick GMC of West Sahara round 2. So I got the green slip and I was \"just looking\" at some of the Buicks on the lot. Buick has come along way in the last 10 years or so. This is NOT your grandfather's or grandmother's Buick anymore. I had a 2013 LEXUS ES 300h that got 39MPG highway and 40MPG city. It had quite a few bells and wistles. Anyway, I began by driving a V6 powered 2016 Buick Lacrosse and Devon and Denzell were my points of contact again. I really liked it. This one didn't have the same equipment that my Lexus does, so I didn't really want this particular car, as I didn't want to go down in car quality or caliber. Then I drove a 2014 Chevrolet Impala V6, and loaded with everything for that model year with 22k miles and they were asking 25k for it. I really liked this car. It wasn't a Lexus or a Buick, but it was cheaper than either one of those and it was fully loaded. But I was contemplating replacing my business car, which was my Lexus, and I already had a V6 powered Malibu that I bought for 16k with 32.5k miles two weeks earlier from this same dealership, and the same sales people (Devin and Denzell). It took me forever to decide even after driving a brand new 2015 Buick Lacrosse that had just about everything my Lexus did minus the front parking sensors and the dash cam, but I can replace the dash cam later (which I will at this dealership for both my Malibu and Lacrosse). I got a Heads Up display system with forward collision alert, I got a Bose audio system, a panoramic sun roof, remote starter system, and a wifi hotspot powered by onstar. These features my Lexus didn't have. \n\nI was given multiple options, and a lot of time to decide which vehicle I wanted out of the three, the Chevrolet Impala, or the 2015 V4 eAssist Buick or the 2016 V6 Buick. I ultimately chose the 2015 eAssist V4 Buick Lacrosse based upon what I was going to be doing with the car, showing Real Estate. I was offered an unbelieveable deal too. Because this vehicle was a 2015, and was sitting in the showroom, and the 2016's were already here and more were coming, this car was priced at 35k. Originally it was 41k which was understandable. If I bought my Lexus ES 300h brand new, it would have been 47k easy. I know cars, and how to shop for the ones I like or want. So I knew I was getting a deal on this new car. Also, I was given a 2k tax credit for my Lexus, and AutoNation gave me another $800.00 off on the car, because I am a repeat buyer, and I didn't waste anyone's time. Thank you David! \n\nSo I still had 1k of negative equity to deal with, and that was done by lowering my interest rate from 4.9% with Lexus to 3.9% through AutoNation Buick GMC's contacts. Can you say Credit Unions anyone? If you want great financing go see the fine people at AutoNation Buick GMC, they WILL find you a good deal, if it takes all day. They don't just use traditional banks or manufacturer banks like most dealerships do, which all charge higher interest rates, trust me I've been there. \n\nSo in combination of lowering the interest rate again to 3.45%, and further dropping the price of the new 2015 Buick Lacrosse, I wrapped up my negative equity and came UP about 2k. This shows in the contract as down payment money which is true because I verified how the dealership got the numbers. So I got a brand new Buick Lacrosse, with an extended warranty, prepaid oil changes for 3 years on top of the 2 years given to you by GM (General Motors), theft protection and GAP insurance and my payments are $616.00 per month versus $647.00 a month with Lexus without the theft protection, or the prepaid maintance plans. Lexus doesn't offer standard oil changes for the first 2 years either. \n\nWhat's more, my Buicks engine, transmission, and final point of assembly are in the UNITED STATES OF AMERICA. Just like my 2011 Chevrolet Malibu. The major components of these cars are made here. Just read the window sticker, it will tell you where the major components are made. We need jobs in this country badly. I don't need Bernie Sanders or Donald Trump to \"bring back the jobs\" to the United States. We can all do our part by giving GM, Ford or even Fiat Chrysler a chance. Personally, I am a GM man. I loved my Lexus, but I love my country, my Buick, and the sales team at AutoNation Buick GMC even more. They also hire the veterans! Thank you again everyone @ AutoNation!","date":"2016-04-11 18:23:24"}
{"review_id":"mgZVmV873N2dT9uJEzTPKw","user_id":"cSzEBzXGQFj_P0LQLNI1fQ","business_id":"tgFRjCbtcm0fBBq3hJ2L-g","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"My review is of a particular line of products carried by Home Depot, rather than of this great monstrosity of a store itself. I am in love with Eco Mist products -- I interviewed the founder of this company for an article I was writing -- and then rushed over to HD to try the products for myself. They are scent free, all natural, non-toxic cleaning solutions that leave your countertops shiny clean without any chemicals! I'm in the process of switching over all my cleaning products to environmentally-friendly alternatives and I'm planning to stock up on Eco Mist!","date":"2009-03-02 16:40:31"}
{"review_id":"1pfOkSqJfw3d04f4qiAy2Q","user_id":"qiknhA6ZDBHsAVW3qf5Jfw","business_id":"GIfZNMP0oIJCje_Xp0Bgrw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This was my third trip to GHT. \n\nI'd put GHT in the category of \"Very Good\" restaurants.  I enjoy the food and beverages, but they're not mind blowing \/ life changing.  Even the more challenging dining options are just on the tip of being amazing, but it's just not quite there.  \n\nI'm still very big on GHT. It's a place that must be visited. I'm continually impressed by the smaller plates over the mains.  Things like the Brussels Sprouts, confit wings,  and  Animal Frites are really solid and flavorful. My favorite visit has included the rooftop bar, (on those few sunny Cleveland summer days), with drafts and some of the best fried chicken in Cleveland.","date":"2016-01-04 16:39:27"}
