{"review_id":"dNF0CmWAsZJEWaORg_7C0Q","user_id":"vMrnL8HA0OvnME8PC0Dg1A","business_id":"cicPsia8Wj-DNRkmLbD_xg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Consistently good, as the Keg tends to be.\n\nHighlights: great lunchtime filet and side vegetables; great service that checked in with just the right frequency; bowls and bowls of those great chocolate mints scattered throughout the restaurant so that you can pocket a few extra ;) directly across from the south entrance\/exit of the Eglinton TTC stop.\n\nMedium: parking available underground, but it was a bit expensive; side caesar wasn't served a lemon wedge.\n\nLow: opens exactly at 11:30 am, or shortly after, so if you arrive a bit early be prepared to wait outside and not in the lounge.","date":"2017-01-28 11:52:47"}
{"review_id":"UoFX-tckDHQvT-P0j-D1zw","user_id":"1wQ3QG1DkewI5SYf0n8IiQ","business_id":"CfxVkwEJk1NAqgqMSesLzA","stars":5.0,"useful":2,"funny":0,"cool":2,"text":"Loved the place. Delicious food. Advice for the manager: make sure noodles with beef are cooked in less than 15 minutes of waiting and that chicken is properly cooked through.","date":"2015-10-23 17:01:54"}
{"review_id":"rT_Ku_4TNsryOs6hgbalUw","user_id":"A-IkCqnYosZa49XD9qiSww","business_id":"J31x0oi8tjYutAzVJJgPzA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Dropped in on a Saturday night....thankfully prior to the rush beginning. \nWe found a seat immediately and our server was over shortly thereafter, told us the wing\/beer special, took our drink order and off she went.\nWhen she returned, we ordered our dinner and some appetizers. Appetizers were Mac and cheese triangles...absolutely the greasiest, worst tasting item I've ever put in my mouth at a restaurant. Potato skins were very dry...no flavour at all.\nSome of us ordered the wing dinner, which was wings, fries and a soft drink (no refills). The fries came out as an appetizer...not with the wings. They were basic fries and pretty flavourless.\nWhen our food came out, it came out at different times. 2 people got their order (one was a wing dinner and the other a burger dinner) while a 3rd was returned because the person who brought out the wings could not tell us which type of wings they were. She said she would be right back with them, but she answered a phone and talked on it for an awfully long time. 10 minutes later, those wings were brought back out, with the other 3 wing orders. WTF?\nWings were a huge disappointment. While meaty, they were sprinkled with minimal sauce....no  flavour at all. We would have sent them back but we never saw our waitress until 20 minutes later....she was serving other tables, on the phone, settling bills, etc. \nWe will not go back","date":"2014-02-24 03:34:44"}
{"review_id":"KfMl96-xURAMPxpBH8zWwA","user_id":"UhEITrCcKXfADwO_YNakig","business_id":"woXlprCuowrLJswWere3TQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"One of our favorites. Reservations are tough to get but well worth the wait!\nI don't want to invite my foodie friends from NY. \nEverything we've tried is amazing! It's quickly becoming our go to place whenever we're in town.","date":"2017-04-30 12:24:01"}
{"review_id":"4j-N3NxmCsUg_Zp1TnibWg","user_id":"8LFdBIiNw9oM3FPQjph7yQ","business_id":"eqQnIjAAhOUuHqK6gTWRXw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Didn't have a good experience with this restaurant.. The service was slow, the tables are too close to each other, and most importantly the food was horrible. My steak was undercooked and the waitress took it back TWICE until it got the way I ordered it which was well-done!! We waited more than 30 mins to get a table and after that another hour and a half to get our food!! Never going back again\nThe only good side was that the fact that they removed my order from the total bill..","date":"2015-05-12 20:52:58"}
{"review_id":"i9WcWsyCz5H6xmTGZPpOKg","user_id":"z84Lv1rmc1yX_yjGYyf0VQ","business_id":"cxsN3mkioAXuOLKy04QpyA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very good food & service on our visit.  It's a little pricey, but for quality Chicago deep dish pizza, I don't mind blowing some coin!  I would recommend giving this place a try!","date":"2017-10-02 05:16:57"}
{"review_id":"F5nlDbBYbKmA8j40BrxB9w","user_id":"SlgpAnj2gQd44EM_Uq6DkQ","business_id":"59TfbZxeX7qLOISeZ-f95A","stars":5.0,"useful":6,"funny":1,"cool":1,"text":"It looks like it is almost finished.  The greenway now extends from behind Park Rd shopping Center (breaks a little near Freedom Park) and then continues on up to CPCC.  \n\nThe new section is a gem along the creek with various plazas and artwork and the animal life returning.  \n\nI walk this greenway often and often see various animals from purple martins, robins, ducks, geese, fish, turtles and even snakes.  \n\nThis is a wonderful addition to the area's urban trails.  I expect to see a lot of festivals popping up in using the new section of the greenway.  There's already the Kings Drive Arts festival which will be huge in a few years.","date":"2012-04-28 18:19:04"}
{"review_id":"TQkIsmSx4Plwo3il0c2Mmg","user_id":"fNLg_HsUFyK4hQIYa4yecg","business_id":"UCpUOtvqR-NBWBNVMzJleA","stars":3.0,"useful":1,"funny":0,"cool":2,"text":"One thing is for sure...having a hospitality card is such a perk. 50% off everyting! including food. \n\nIf you show your \"grinder\" app on mondays you get a 50% band.  We tried to show the bartender, but I think you have to show it upon entrance.\n\nLobster Dip - My favorite by far.  The crackers are really good.  it has sesame seeds on one side of the long rectangle cracker.  Can you say addicting!\n\nI've had a bunch of their pizza and theiy're all not bad.  \n\nI haven't been at martinis for over a year now and I was surprised that they didn't search much  in the extra shaker anymore. = 0( I was a little bummbed\n\nThe bartenders were very nice and accommodating! PLUS!","date":"2011-06-29 06:07:28"}
{"review_id":"SdOypm1uOeR0D09mn01VhQ","user_id":"Gq8OwMLyRRdL71NWp6VM9A","business_id":"_V0yJdpXrbdKzBDoVSJGWA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"If you lost your ass and hungry ass a homeless person.... this is the place for you! The selection and quality is absolutely horrible. I would not go back to this dump if it were $4.99.","date":"2018-06-19 20:14:59"}
{"review_id":"CU44i3WEudjQFyhVVdPLhA","user_id":"AOcBQ6FZAfeHX6P7JvwRcA","business_id":"f1TS6CtGYNJiS7odJLgMlA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I have known USA Collision for the past decade or so. They have always been consistent, and consistently excellent in their workmanship and long lasting results in quality.\n\nI would say body shop work is one of those things in life that last as long as you own your vehicle. To put it into perspective, from the time you get your car back after the repairs are done from an accident, and until you either sell or trade in your car, you'll know with certainty if the work was not done right.\n\nIf the repairs were performed at USA Collision, I know with certainty that I will never know from looking at the vehicle, that, it was in a collision.\n\nWell done, guys!","date":"2014-12-17 21:46:19"}
{"review_id":"w8ZaGC07pbx59gaE0A6Zcw","user_id":"5qwFWbRzT2WPBf_B_h4k0A","business_id":"ttb3llgRxWL1WYc1Vo-EzQ","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I was also scammed in exactly the same way described as Faith!! Unbelievable! I feel like an idiot!  The sales girl pretends she sees the Beverly Hills Dermatologist who developed the product walking by and she asks him to consult. He pulls out all of these little lights and meters and tells you how Susan Sarandon, Mike Tyson And Gov Browns wife are all his customers among hundreds of other stars and reads emails from all his satisfied customers. I googled him when I got home and there is no such person! He says he is Mica. The most elaborate scheme you will ever see. BEWARE!","date":"2015-12-05 06:09:18"}
{"review_id":"CrTTwnFfsjJofVpcHO7tqw","user_id":"jnC1CcEF9KjCs2gw82SfSQ","business_id":"cTbFJzHQzFSX-z3JF4abKQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Omg, the best ravioli I have ever had in my life. Landed up here with work colleagues. I was highly impressed with the service and food. Presentation was great and very tasty. Everyone in the party loved their food. Cream corn and prawns also excellent!","date":"2015-08-07 02:28:58"}
