{"review_id":"yO2buKRIfyRDGJH93oapbA","user_id":"nzVIuR_6GkxTCOsHw8gMsg","business_id":"FdrZJQL_FYKqR96L05gzcg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Sad to hear that this place has possibly closed for good. \n\nAwesome little hole in the wall shaved ice joint. My favorite flavor is tiger blood and banana. This place was great during my summer pregnancy last year! \n\nThe owner is friendly and seems to love what he does! You absolutely cannot not beat the prices! Try adding a scoop of ice cream in you next shaved ice!","date":"2014-04-19 21:06:55"}
{"review_id":"46_Ez4CVCk-0X5wX58n5sQ","user_id":"wXOa9i1XKLrkmZa9_a_cxQ","business_id":"QITVudxg4pCScJnEUw46xg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We came to Henderson after a horrific experience at Fairway Chevrolet. Patrick was our salesman,  Joe and Tony handled the sale without any hassle. I felt I was treated with respect and honesty. We liked them and will defiantly drive the extra miles to Henderson.  Thank you guys. After being treated so poorly at Fairway I'm happy that we took a drive to Henderson. Your customer service is awesome.","date":"2017-07-08 21:51:07"}
{"review_id":"hWV771i18E-_B1hQCKx6Nw","user_id":"Ut_hEKW4-t9NYy9UsDmkJQ","business_id":"MAKG_gI_r0nlDvh8ciYrhQ","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"Needed some batteries replaced for a couple watches and I live close so I walked down. I showed up 5:20 (40 minutes before closing tim)e. Their open sign was on but the door was locked with a sign on it that read \"Out to lunch. Back at 5:30.\" I thought that was weird to take a lunch right before closing time, but it was only a 10 minute wait, so not really a big deal. I waited until 5:55 and no one ever showed up. A few other people also came by but, just like me, were unable to get service. One of the people said they came by much earlier and said the same sign was up then too. Can't be good for a small business to turn away so many customers.","date":"2016-02-12 01:07:32"}
{"review_id":"jhPE5qiLloYkfbkC4GZIbw","user_id":"7KMO5yGSx5Vypb-jzHVTrQ","business_id":"szhJLmdLDVFTevm8fu0T4A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Dim sum - Excellent choice, fresh ingredients. Be adventurous, try the rice noodle - beef, pork, or shrimp. The coconut bun is stab-your-neighbor good. Good price as well. The staff is hit or miss, friendly one visit, rude the next. I do not always care about that, though, as long as the food is good.\nMenu - Noodles are great. House chow fun with gravy and e-fu noodle are great. Otherwise, go wild. Pick your favorite choice and then try everything around it for fun.\n(5 stars on good staff days. 3 stars on really bad staff days. Average is 4 stars)","date":"2015-10-08 01:26:21"}
{"review_id":"gyGCAUgmWWPpauesed1YMQ","user_id":"lMIm1Ye7BeVE21xqlImqEw","business_id":"hgCpzHx5IGvLRzMdFGWl6w","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I always come here for the Hainanese chicken. Vietnamese noodles isn't authentic. I wish they will have more selections on appetizers. This place can get very busy during lunch time but you won't have to wait for too long. Decent food and service! Good price","date":"2017-05-26 01:30:47"}
{"review_id":"bNaTfd98aSrCHnZkIQqVsw","user_id":"Lyp38LJbanx1m4TeJgLtyg","business_id":"szlxlViCHJhC73hBAU38YQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I always like to find a juice place as soon as I get somewhere new.\n\nThere isn't a huge selection of juices here but the thing that really sold me on these guys is how good their acai bowls are. Everything is just SUPER fresh and tasty, it actually feels good going down and you can change up the toppings too! \n\nI haven't tried the cold pressed juices here yet but the fresh juices are great too!","date":"2014-05-07 21:12:55"}
