{"review_id":"trDrFVrtbPeiSK28IYa1CQ","user_id":"ytEllP13Y-Uejxm-ZDs6OQ","business_id":"tf4FoM-A_I469qTUbLZs5Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"A haven on the PATH - fantastic cappuccino and nice place to sit and watch people.","date":"2016-11-21 22:24:22"}
{"review_id":"ikYGuq8Cl30TFHApzJtrtA","user_id":"g3VuJ_pnQyPz_HFMzQLhoQ","business_id":"LHXisknIbUy_XtdEQc7x9w","stars":1.0,"useful":1,"funny":1,"cool":1,"text":"I was incorrectly billed $11.52 for fuel charges.  When I called to dispute the error, I spoke with Lian Santon.  At first she told me the charge was because the company undercharged me for the vehicle.  When I explained that I made the purchase through hotwire, she then switched the reason for the charge to me upgrading my vehicle at the counter, which was incorrect.  After being placed on hold for a while, she told me the fee was for fuel, yet I brought the vehicle back on full.  After being placed on hold for over 30 min, she told me that they would only be able to credit back $8 and not the full $11.52 because the other $3.52 was included in taxes.  Another representative called back to tell me that the company would have to call the car rental location and verify that the car was brought back on full before I could receive the other $3.52.  This is pointless to me because if an associate entered a fuel charge in error and the transaction happened weeks ago, it would be difficult to remember this particular transaction given the large volume of rental returns that have taken place since then.","date":"2017-04-07 21:37:48"}
{"review_id":"6LQf8MA90U_-5nlkxSI8eA","user_id":"Oazw0yQC7t_O8qBoJF9Ssg","business_id":"osJfovV0FGBDo4n7eD4-AQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Wow, what a great place to grab a light lunch! Jacob and Troy prepared an asparagus appetizer for my sister and I while we waited for our food, and served with homemade ranch! Very small bistro, unexpectedly located in Monogram's salon, but very well kept and clean. \n\nThe asparagus was impeccable and delicious.\n\nI ordered the Caesar sandwich. Chicken was tender and juicy and sandwich had the perfect cheese to chicken ratio. Homemade pesto was a great addition to the meal. Everything was made fresh and Jacob really knows his stuff!","date":"2015-05-12 19:42:14"}
{"review_id":"Ro1Z-SrWAvqbTyxwZ0kK7g","user_id":"76a62TPgJG7ZYD3-ZYzXoA","business_id":"q5W3sxES7piOdju23eWNuQ","stars":5.0,"useful":1,"funny":1,"cool":0,"text":"My wife and I came home from a trip to find one of the drip outlets had been \nrunning for hours.  My yard guy admitted he had no idea.  I called these folks and the next day Jake showed up.  After some looking he was not sure what caused it.  To be on the safe side I had him replace a valve that was old.  He did it well, quickly and checked everything, including all the settings.  Will definitely recommend.","date":"2017-12-02 21:37:21"}
{"review_id":"2cspjIaT-uiheyc2lgh_Ig","user_id":"0vnF9En8gZfjipND_pzF4w","business_id":"0ED9PlLogo_HYWuoSRaTpw","stars":4.0,"useful":1,"funny":1,"cool":0,"text":"FYI: This isn't like a super helpful tip but they give you these tiny hard candies with your check that I found were adorable lol.\n\nYes...I saw this place on a video on Facebook, and yes the necessity of me going here was urgent. Like life or death people.\n\nWHAT I GOT: Cheese ribs\n\nPROS: Repeat after me. You can NEVER go wrong with meat and cheese. EVER. And my goodness, James Cheese Back Ribs is winning the restaurant game. You get a pool of gooey cheese that the server wraps around each rib along with extra corn, two different mashes (sweet potato and regular potato), mini sausages, and scrambled eggs. The ribs themselves were coated in this beautiful and super flavorful sauce, and the meat was super tender as well. Literally fell off the bone with one bite. They also give you scissors and some plastic gloves to keep your hands clean, along with the option to choose the heat level of your ribs. We went with mild, which honestly is not spicy at all, so if you're looking for even a little bit of a kick, I would suggest the regular spicy option.\n\nCONS: Ok well the price is pretty hefty. Not gonna lie. And the sides aren't exactly the most tasty things ever but combined with the cheese, usually anything will taste good. But be warned, the server will turn off the gas stove that melts the cheese once all the ribs are wrapped so the cheese will start to get hard again. If you wanna dip your sides, eat those first. And the ribs are a bit on the small side so this meal won't actually fill you up, if that's what you're looking for.","date":"2017-10-02 02:17:24"}
{"review_id":"Tw2xMEgH5fhFoQzCynafjg","user_id":"GMq7_GqrU7YQjeTv5Osz3w","business_id":"uUEKndnFbHD8mVkGiirtpA","stars":5.0,"useful":2,"funny":1,"cool":2,"text":"Went in a few days ago and had the BEST server,  Shannon! She was so sweet and attentive! She also suggested the really yummy goat cheese app and my fiance also loved the blackened fish tacos she recommended.","date":"2015-01-04 04:58:45"}
{"review_id":"xxNIAwU4M5_57w6HscYbig","user_id":"5sDwUoGQqGh_Xsn7yZR0QA","business_id":"K-iqIqMTTvESaAz2KgwulA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We got a ton of bundtinis in addition to a small cake for our wedding. They were perfect. The guests loved them (one ate 5, at last count) and they really fit what we were looking for. Plus, we had them delivered and Jim was very patient with us and our wedding site when there was no one there to receive him\/them. Plus, the delivery charge was more than reasonable. Great business, great employees, easy decision.","date":"2012-09-10 16:15:35"}
{"review_id":"DVZdsAwqsJRPHnTFz1CaOg","user_id":"85Jq6l707HWj2XpFw7qPGg","business_id":"0k-WPC8TGbdSdl7qKHcRvg","stars":3.0,"useful":3,"funny":3,"cool":3,"text":"En faisant des recherches sur Yelp (et sur d'autres sites aussi mais shut), je cherchais le meilleur endroit de sushi à volonté à Montréal (et quand je parle de Montréal..je ne parle pas de Kirkland, West Island et des endroits où le métro ne se rend pas..). Selon mes recherches, c'était le Sushi Plus. En plus, seulement 13 minutes de chez moi en auto..et comme ma date Tinder a une auto et c'est lui qui m'accompagnait, c'était très bien. Il y a beaucoup de place de stationnement et le métro Acadie est à proximité pour les gens en BMW (bus, metro, walk).\n\nDonc, nous sommes arrivé au resto, je m'attendais à quelque chose de plus grand..mais bref ce n'est pas ça l'important. Nous avons attendu un petit 3 minutes avant qu'on nous assigne une place.  \n\nUne fois assis, on voit les \"serveurs\" passer..mais ce sont plutôt des préposés à l'eau ou bien à apporter la nourriture. Après une dizaine de minutes, je demande de l'eau. Une autre fille nous apporte un Ipad, mais sans aucune explication. Le Ipad est sale..tsé le nettoyer avant de le passer à un autre client ne ferai pas de tord. Vu que je ne connais pas ben ben les Ipad (je suis team android) et le gars avec moi aussi..on était un tout petit peu perfu quand l'app ce fermait. \n\nC'est ben cool de commander par Ipad dans un à volonté WELCOME TO 2018 tsé..tu peux voir ce que tu as commander comme il faut, voir l'historique, voir le prix admettons si tu prends de la boisson et faut payer en plus de ton repas..pour tout cela c'est nice. Par contre, les images de sushis ne sont pas très claires..Il faut tapper comme 2 fois pour voir ce qu'on les sushis. Aussi, pour voir mieux sur le Ipad, vous êtes casiment mieux de vous assoir côte à côte. Bref, nous avons commander...mais il fallait aller appuyer sur un autre onglet order confirmation..quelque chose de même...on a quand même été nono et attendu comme 15 minutes avant qu'on dise que c'est long...Finalement, on a pu arrêter une serveuse et lui demander..elle nous a expliqué..Bref. La nourriture est arrivé très vite..on finissait un plat et un autre arrivait. Mais figurez-vous donc que même avec la technologie, ils avaient oublié un plat de Kamikaze. \n\nBref, tout était délicieux..à part le Octopus bbq...il n'était pas tendre du tout et pas trop frais au goût. \n\nÀ notre deuxième commande...on était plus capable de manger...oups...il nous restait 7 sushis on assumait de les payer et on voulait les apporter..mais personne n'est venu nous voir et le plat a été ramasser. On a pas mentionné nos 7 sushis perdus, en croyant qu'ils allaient se passer le mot et nous faire payer 7$ de plus...mais non! Bref, les sushis sont excellent..mais le service est à chi***..comme dirait Gordon Ramsay. Je déconseille d'aller en groupe car devant nous il y avait un groupe de 10 séparé sur 3 tables...et plus loin aussi un groupe de 8 sur 2 tables de 4.","date":"2018-03-04 03:32:01"}
{"review_id":"a-Orpcmwx6uAAFx-jtxDCg","user_id":"VQhvTClcf_Wcxm0Ei4GpqA","business_id":"079CV1EE5WLdQqVEVYFeHQ","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"The Prime is a great Chinese restaurant. I have been going there maybe twice a year for several years. it is a bit of a drive, but the food is great, the service is great and it is affordable.\n\nThey will also specially prepare items that are not on the menu. How many places do that.","date":"2008-05-01 00:47:57"}
