{"review_id":"uifNJJWlAZfhvazTEgfkfA","user_id":"yjAopbJkhIrguNBvQ7Z3Pg","business_id":"CeqWpwHBoaxwRcv5btnv6g","stars":5.0,"useful":1,"funny":0,"cool":2,"text":"Custom built pizza with high quality, fresh ingredients, a decent price, what else could you ask for? Oh, and it tastes really really really good!","date":"2013-08-15 19:03:17"}
{"review_id":"yuUPHTfSgKVwAfTuO1FO1g","user_id":"cJR2dSsbg7Z8zDklnan-Cw","business_id":"hihud--QRriCYZw1zZvW4g","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Hit and miss.   :( We were really in the mood for Korean and had high hopes for this place. \n\nThe good: The seafood tofu soup had great flavor but it was seriously the smallest portion I've ever seen in any Korean restaurant.  The original bibimbap was yummy (nothing extraordinary but solid and at least normal portion size).  The chocolate lava cake was delicious.  Warm and gooey. \n\nThe not so good: side dishes were icky.  So sad because half the fun of Korean food are the yummy side dishes.  The seafood pancake was tiny and for $9.50, so not worth it.   We are normally huge fans of seafood pancake but just so tiny here (two small silver dollar pancake size ones and at most places you get one the size of a dinner plate).   The pork belly app was so so.  \n\nOur waitress was really nice though it took a while to get seated and for someone to come and take our order.  \n\nOverall: small portions, pretty good service... But there's gotta be better Korean places in Vegas!","date":"2015-06-21 05:33:00"}
{"review_id":"Fks6k3YvTRbZSxLBIzkySA","user_id":"em8n7IUsqMtWPY7ECmYDEw","business_id":"q3YnYPjLuBGRDi_59yTC5g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Love this spot . I love their broth . Great service and clean restaurant I come here often to dine in or pick up food . Their pho is one of my favorites .","date":"2018-08-14 10:32:14"}
