{"review_id":"hjTGfEEKTu_mWxclLux8uQ","user_id":"VThiGFyaOzEQKe2xXysVaQ","business_id":"WQIvHDD4hNa8SDVxdQt56w","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I was on a road trip and stopped in Phoenix for a night.   A local resident told us about this coffee shop so went there. Had a great experience.  I like independent coffee shops and a great ambience.\n\nGreat decaf soy latte (w\/honey)\nClean bathroom\nGood music\nGreat seating\/deco.\n\nIt was just chill environment.  I loved this place and would recommend people visit and enjoy awesome lattes.  I didn't try all the pasteries but chocolate croissant was pretty awesome with moist chocolate.\n\nThank you for great service you guys.","date":"2012-01-03 21:54:39"}
{"review_id":"fvmXieWEASmmJCRY5O_J7A","user_id":"JoKxzSvlqAhlsgrzRZTeFA","business_id":"9MnbQg7kfb_WgxoV0hXKSQ","stars":4.0,"useful":3,"funny":0,"cool":0,"text":"Who doesn't like good BBQ?  I ask you?  Good, though...like so many things in Champaign, I found the ooohing and ahhing pretty over-rated.  It's good food, no doubts, and their burnt ends?  You'd travel the globe for these suckers!  But.. their brisket is often dry(ier than I'd like), and I am SOOOOO not a fan of pulled pork that sometimes has globs of fat in it (it might be that _all_ pulled pork is susceptible, I am just not a fan! =P).  Regardless, you have so much to choose from (http:\/\/www.blackdogsmoke.com\/menu\/), and don't be stingy with the sauce!  I'm a true Carolina girl at heart, and Black Dog does this Carolina Red that's vinegary and tomato-y, and has a bite to it that'll just.. well, it'll make your mouth water.  Other's really like the Hot Georgia Peach, like the most exquisite combination of both heat and sweet!\n\nAll in all, you're going to get a fabulous meal here, and for Champaign-Urbana IL, it's some pretty legit BBQ!  Pair it with one of their amazing beers (and the choices are endless! http:\/\/www.blackdogsmoke.com\/beer\/) and you'll leave stuffed and satisfied!","date":"2015-10-17 10:30:02"}
{"review_id":"1dEL47cxmasfPyThAcY21A","user_id":"FbD6y9sOkXLqcAx3zhw3Pw","business_id":"8_yIeiC_tyRIlVR2P_OYQw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"No wifi. Very small, low ceilings. Equipment is very close together.","date":"2014-07-28 04:24:36"}
{"review_id":"dhFky9daVRixHfr8Rp66lw","user_id":"cg56OXRAt279OXlkjYInzg","business_id":"rLyGCFULUSbLCt8J3U0_kA","stars":1.0,"useful":0,"funny":1,"cool":1,"text":"The signage really does catch your eye as you drive by on Sheppard Av. PEKING MAN in large, faux-Asian font on a bright red back drop. That's definitely a holdover from the 70s or 80s. After struggling to find an actual entrance (you see, it may be listed as being on Sheppard, but you have to turn on Ambrose to actually get to the storefront. If you're heading east and miss Ambrose, there's no chance to U-turn til Leslie, unless you want to run over city-owned flowers in the median.), we finally parked the car in front of some convenience store in the same strip mall\/mini-industrial park building area. Given the PEKING MAN sign is all you can see from the main road, I don't know how other businesses can persist here. \n\nThe moment we went past the doors, we were greeted with a motorcycle arcade machine. What is this, Chuck E. Chan? Ah ha, ha., there's a Chuck E. Cheese down the road. A waitress came up and we were promptly seated and presented with these ghastly menus, with cartoon depictions of, presumably, a Peking man in various states of labour (labour as in work, not Chinamen giving birth!).\n\nOn to the food! A family of five orders the following for dinner: Bamboo and Dried Scallop Soup, Deep-fried Soft Shell Crab, Peking Duck Special, Lobster fried in salt and pepper, and Shanghai Noodles with beef. I'll spare you the details, because there are no details. It was all bland. It was as if everything was frozen for Walt Disney's first meal after being brought back to life from his cryogenic sleep. The soup wasn't watered down, but it tasted like it was. The crab and the lobster were fried in the same tasteless junk probably used to grease door hinges. The duck was somewhat of a saving grace. First course, slightly crispy duck skin (though not nearly crispy enough to my liking), with fine slices of duck meat, to be wrapped in rice paper. Spare yourself from attack of the living bland and eat the duck straight up without the wrapping. Second course, stir-fried duck meat. More meh. Basically, anything these guys actually cook gets turned from gold into lead.\n\nAriel G. may want to take that trip down memory lane, but this meal was a memory I'd rather repress.","date":"2009-10-14 05:44:40"}
{"review_id":"0jQXPmR2YlaEtgG5-6m_YA","user_id":"3vVyzNzz4zkvyWtGjJ37tA","business_id":"7S_L-3ggy4YpFr50Q08fcQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Rebel Auto is by far the best auto service shop in Henderson and Las Vegas! I've had my car serviced there probably a dozen times. Their prices are great, they have a free arcade to play in while you wait, and the customer service is amazing. I've recommended them to everyone I know, and will take every car I own to them, for as long as they are around. Thank you Lee and Rebel auto for being so helpful every time!!","date":"2014-02-05 22:02:18"}
{"review_id":"bq-EYF92X-_YQD3OSzyg5A","user_id":"8wL-S95dOaBGTnkK3nyWrg","business_id":"tOhzbIoz_UHhzuXiGOEYgQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Been here many times! Friendly, helpful staff, Never had a bad experience. Clean place, comfortable seats, popcorn & nacho chips are always fresh +++++ . Rooms here are smaller than other theaters, which is why you probably should arrive 1 hour + early if you are watching a new release! Hint *** Before you ask for your tickets Buy a $25.00 gift card and receive a free medium size popcorn voucher(You can pay the difference to upgrade for larger size at the concesión stand)  use it to pay for your tickets\/snacks. Keep it and Reloaded it over & Over! :)","date":"2015-10-17 03:20:19"}
{"review_id":"3U5-6e_R-eVZi6HXpk20KQ","user_id":"TVkU2gHhe05v_lgsE_NccA","business_id":"TlCEWYAfcOudP7j6zupYeQ","stars":4.0,"useful":1,"funny":1,"cool":0,"text":"This ULTA had the longest holiday shopper line & it went fast believe it or not. This staff is sweet & helpful. Love this Ulta location for shopping. I haven't tried the salon yet so stay tuned for that.","date":"2014-12-17 21:21:08"}
{"review_id":"rMSWvyqzTPbzvjnw2Oo_kQ","user_id":"aSNQVN-cSf3OEiYAlZwzNA","business_id":"LycxY2dXOBcCP_1pc_dIsw","stars":1.0,"useful":5,"funny":5,"cool":0,"text":"They treat patients like an ATM. \n\nI cracked a tooth. EXTREME pain right now. Got a Saturday ( today visit). I told the front desk BEFORE I went back that I didn't get paid until Wednesday ( a few days), and that I just paid to fix my roof so money is tight. After being examined and X rayed they explained what they could do and that my portion would be $160. They weren't sure they could even help m today as Phan's schedule was tight. I told them I could only pay $100 today. I was told by their office manager they don't do payment plans , they could try and get me some dental credit plan. I told them I didn't want to do that. It was $160 today or nothing. I told them I was unable to do that. So I came in pain , left in pain- they did nothing for me - I offered to pay my bill (around $60) as I left. They wanted to bill my insurance etc but I didn't want to hear from them again so I insisted I pay it all now because I wanted nothing to do with them ( contact me after insurance etc). . I complained  and to shut me up they wiped the bill clean. \n\nThey are all about the money. My $100 today plus insurance ( and $60 in 3 business days) wasn't enough to help me. Forget about helping me because I was in pain - they did nothing - nothing - they wouldn't even do it for 2\/3 my portion today , the rest in a few days ( as well as gouging my  insurance) \n\nTHEY ARE ALL ABOUT THE MONEY. They don't care if you hurt. They are very high tech - and I understand they need to pay off all their high tech equipment - \n\nMy opinion : Pham sucks! Palo verde dental sucks!  \n\nCame in pain , left in pain - they use your pain to extort money from you. It's just white collar crime - they knew exactly my finances before I even went to a room , and then after exam it was \"pay up or get out\" - the officer manager specifically said \"we do not do payment plans\". \n\nThey wasted my one day off when I could have found someone who would help me when I am in severe pain \n\n\n===== \n\nAddendum 7\/1\/16 \n\nYep ... These lying SOB's billed my insurance \n\nLying , cheating dishonest !!!!","date":"2016-07-03 17:45:46"}
{"review_id":"7CIPZxwyA0yjxAFnUrteYQ","user_id":"AqYVnKbwUsOSFy-DcYzz9A","business_id":"xEH00X_VoRepWKXQrragmw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Came here many times during my stay at the Mandarin Oriental last time. I tried almost all of their sushi rolls. Their sushi is not excellent but it's pretty good. I really like their green curry with chicken. Service is pretty good, and it's conveniently located.","date":"2016-09-18 18:12:47"}
