{"review_id":"py1h_vm5p6jrWHSKr1x9KA","user_id":"CZOdzs35tYEHEI1zti64nQ","business_id":"Swwm6ALeYYLhsYGx5y1rWw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Tasti was one of the first places I used to run to when I visited NYC, and I was ecstatic to learn we were getting one in Scottsdale! Mmmmm...bananas foster is the best! If your favorite flavor isn't on the daily list, you can make it for a dollar extra- which is a great option when you have a craving. I love knowing when I eat Tasti, I'm not eating a whole 600 calorie wreck like I'm sure I do at the self serve shops and honestly, Tasti D-Lites flavors taste soooo much better to me than those places too. I'm so glad trips to Tasti are now a whole plane ticket cheaper!! ;-)","date":"2014-01-17 00:32:32"}
{"review_id":"y6460kPSClP4LONAazKNCw","user_id":"rwjb4f7CXWzo696C_y2OOQ","business_id":"2ROJpByFqGaMdsWSleHg2g","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Total ripoff.  The supervisor was sent out because the first guy they sent (twice) couldn't clear the clog.  He poured some chemicals down the drain then gave us a lame story that my pipes were old and we would need to tear into the walls and floor to replace the lines. My husband went to Home Depot and bought a $14 snake and after about 15min had the clog cleared. They still charged us $135 and when i called them to tell them we cleared it ourselves, they just said \"that's great\". Really???  Buyer beware!","date":"2015-01-04 00:56:38"}
{"review_id":"S8VBOztjwZPN6gtdqaY6NA","user_id":"e7vvovEzNPh2D8eY84PIgw","business_id":"U9aA5H13y7t9xWnoQslV0Q","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"The beef brisket soup noodles were very good, I could tell the noodles were fresh. The pork soup dumplings were excellent as well. Open 24\/7, so a great late night option.","date":"2017-02-09 07:02:57"}
{"review_id":"TYcgJZyKVgR3lIXpJ-nKNA","user_id":"7OM-RdJmmd2MAZuQ5CyBIw","business_id":"UhCSu92r2XVPmhQET1c2Bw","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"I love this place. \n\nI am never disappointed in the flavor choices. I usually get overwhelmed and end up putting more yogurt in my cup then I really should.\n\nThe topping choices are always fresh looking and there are lots to choose from. The price is very reasonable.","date":"2010-08-20 22:23:07"}
{"review_id":"vkErVLQKeBFjvhfqiHgO4g","user_id":"_WDhO6yeZQoVo5agXH3Tbw","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":5,"funny":1,"cool":1,"text":"Mesa Grill is located inside Ceasars.  Its nice that we were able to make reservations for a party of 5 people.  When you make your reservation, you have to give them a credit card number to hold your spot.  \n\n We arrived about 15 minutes before our reservation time, and we were still seated immediately.  I loved how the servers was very attentive and chatty.\n\n The complimentary bread basket was very good.  I loved how there was different selections (jalapeno bread, cornbread, walnut bread).  For an appetizer, we decided to try the chicken quesadilla, and it was really good.  I would highly recommend it.  \n\n We decided to order the 22 ounce Chipotle Rib Eye Steak for our entree.  The steak was huge and can definitely feed 2 people.  The steak was cooked pretty well.  I loved dipping the steak in the sauce.\n\n Overal, service was really good here.  I really enjoyed the bread and apps.","date":"2015-05-12 16:36:00"}
{"review_id":"NUIDJLVi9WKKgDtcbRFJ2Q","user_id":"u0JoB0Vm1ZhwF8nysxPnfg","business_id":"KyZkW3PYaeoq5jNgPVlTrg","stars":5.0,"useful":7,"funny":4,"cool":5,"text":"Do you ever feel all crunchy and wish someone would pick you up by the ankles and shake you out like a sheet? That's how I had been feeling before my massage appointment this weekend. \n\nSuzanne is a great massage therapist because I felt great by the time I walked out of there and I'm still feeling great 2 days later! \n\nThe location is tucked away in the office complex just east of Max's gas station on the southeast corner of 12th St. & Missouri. \n\nI had a 60-minute aromatherapy massage ($80). I got to pick the scent I wanted her to use and she blended it with the coconut oil to make a custom massage oil just for me! She also put some in a diffuser and near the head rest. The scent was never overpowering. It was just right! \n\nThe massage pressure was perfectly firm. While I felt relief from the tension I had come in with, I didn't feel like I had been beat up to get there. \n\nAlso a nice touch, she popped a roller ball in the top of the vile with whatever was left of my \"custom oil\" and I got to take it home with me for a olfactory reminder of my awesome massage.\n\nNext time I treat myself to a massage, this is where I'll be going!!\n\n(PS I used a Spafinder.com gift certificate to come here. Waaay better than going with one of those chains that seem to be the dominant offering for redeeming those certificates.)","date":"2010-10-05 20:56:45"}
{"review_id":"ESbzSayMcfbiuw1brDUQjA","user_id":"Oay68SoCl5BcM4XAbt47zw","business_id":"ZqElInc6h7apsXcX0QrC4w","stars":3.0,"useful":1,"funny":1,"cool":1,"text":"As far as comic book store go, this place is pretty standard. I'm not saying that in any sort of negative way at all either. They've got a really solid collection of recent issues as well as graphic novels. Their manga section is so-so, their toys are slim, but what taints my experience here is the back issues selection. I was looking for some issues of Fathom and could not for my life find anything. The girl at the cashier was really great and friendly as she tried to help me find what I was looking for, but even she commented on how disorganized those boxes were.\n\nLike I said, don't get me wrong because this place is still great; comics, staff, and all. I guess I'm more of an Atomic Comics kinda fan just in terms of what they offer overall.","date":"2009-02-28 23:09:45"}
{"review_id":"qOEszSLbOBdxUHnsjeFqig","user_id":"l5x4wzz9VOcQ22XMthU6uw","business_id":"0TBTV3q6QXCn9vNhy3Xi2w","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I took my mom here when she was in town for Christmas.  We stopped in for lunch and neither of us had ever had Ethiopian food before.  I had read about them on their website and in many of the reviews here on yelp, so I kind of knew what to expect.  We were seated immediately, but it took about 10 minutes for our server to greet us.  We immediately ordered two of the lunch specials which we had brought out on one big plate, and it came out super fast!\n\nEverything was wonderful!  We had a lot of fun eating with the Injera and trying to decide which dish was our favorite.  We tried all six of the vegetarian items listed on the lunch menu.  My favorite was probably the Azifah (the cold lentil dish).  The Misir Wat (red split lentils) was really good too, and my mom's favorite was the Fosolia (lightly spiced green beans).  When the big dish was set in front of us, we looked at it and thought, this isn't very much food....but boy were we wrong.  We couldn't even finish it.  The Injera really fills you up I think!\n\nAll in all...a great experience for a great price.  $20 including tip.  Can't beat that.  I will definitely be back!","date":"2012-01-03 15:28:10"}
{"review_id":"lN9JU_pjR0ktf4HT6dl3Xw","user_id":"h4Gv9ySB07PpKd_68IZ5Bg","business_id":"HGuHk935tyokX6kveEviJw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Ordered some dimsum to go plus the salty calamari with jalapenos and can i just say that their serving for almost just 5 bucks of calamari is pretty hefty. The dimsum that i got are shrimp shu mai, taro dumplings, and the crystal shrimp (not sure that this is the name). Anyway the guy that i talked to on the phone was nice. When i picked up the waiter wasn't bad as well. But when I got home i was missing one order of taro dumplings. :( i just let it go since 2.36 isn't worth arguing for. But all in all yes for dimsum, just double check stuffs to make sure u get what u paid for.","date":"2012-08-15 01:45:36"}
{"review_id":"e0gApKuk6CyzRHsLrpY1TA","user_id":"SqB5SYiam8PAADeTAxu46Q","business_id":"owsVSnllxn994EpBR8ZFwQ","stars":1.0,"useful":11,"funny":2,"cool":2,"text":"I was told when I signed up the gym was supposed to be open in january, never received a call that they had postponed the opening date.I had cancelled my membership with my other gym and now i have been left without a gym for a whole month. I had to call them in order to find out. Haven't even started going to the gym and already dissapointed.","date":"2016-01-17 06:13:48"}
{"review_id":"5G3s3YwRSVdljwG4VMmLEg","user_id":"KnkiyXZDt8hVdq_kw1iWuw","business_id":"td1uEmND7zG8X9aNQyKCbg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Utterly fantastic!  This place is as much an art gallery as it is a patisserie. It's a delight just to walk in and gawk at the sheer artistry of it all.  The croissants here are the best in the city. I particularly like the pecan croissant, but they are all good. Sandwiches are awesome and arrive warm without ruining the texture of the breads.  Everything is pure art.","date":"2016-10-14 00:31:55"}
{"review_id":"fRpesVE4Rds7K6UR8SA6-Q","user_id":"pvaPYTl2NcuTawFcwF_bOQ","business_id":"iCFCzEzA01LbhfNY93MGDQ","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"Awful experience. My girlfriend gifted me an Amazon local deal for an ultimate detail valued at $275 dollars.  I made an appointment for 11 am during my lunch hour so as I can drop the car off and pick it up by 3:30. Long story short, Diego from the shop and his coworker told me that I would need to pay $55 extra because there was dog hair in the back seat and I would have to leave it over night. I told that that that's not possible so they said to get a refund on Amazon and that they could not help me. I wasted time and gas to bring it to the shop and my buddy from work did the same so as he can drive me back to work. Unprofessional outfit with unrealistic value for money.  They also expect a tip on top of the $275 value that the voucher is for. Ridiculous and definitely not worth the money.","date":"2015-04-01 16:36:55"}
{"review_id":"uwpkYRubR-68djDvne1hrA","user_id":"YSLbVgjkLc_Xp9nEDSyCLA","business_id":"VlMRR74NjdysPIfaUUSoBA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Service is always really good, servers are friendly . Food is beyond expectations always a goto for a good comfortable spot to eat with my family when we are on Fremont.","date":"2016-07-03 20:56:50"}
{"review_id":"wqwgRouFIAi29XGhSiZoDg","user_id":"m5ID0Dpz6IxbNPmhgZQyEQ","business_id":"lpxj6LFir23Ds6swW8a6fg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very fresh food and authentic Italian taste. Tried the eggplant Parmesan and it was so awesome. My friend had portobello mushrooms burger which was also very good. The view of the Pittsburgh is scenic from the patio. Must visit when you come to Mt Washington.","date":"2014-08-10 20:30:28"}
{"review_id":"hRZBUQUXQbjYHAOrtN3DRw","user_id":"MQq_1AlcDWsyNs7Ot8J4OQ","business_id":"39sCYNzSYk_z8v_KoLH0KA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"A really great date place if either of you are into chocolate. In the winter, definitely try the grandma-style hot chocolate...it's out of this world. On the weekend, expect to wait 10-25 minutes if you're coming in the evening...it's quite busy.\n\nBe a good date and share some a fondu :)","date":"2009-05-20 04:36:19"}
{"review_id":"RIWfHarys5tJ0Zb366r8tQ","user_id":"0l3x4EgoWVYdla3CPpAKag","business_id":"OmZ_Ub_0egPc6eDPD1OWSw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Wow.... good food here.  This place doesn't look like much, I have to say.  And it was a bit hot inside, I can imagine as the summer warms up, so will this place.   The food did take a little while to come, and I didn't quite understand what our options were.  When we were seated, the waitstaff asked us if we wanted a menu or if we wanted the daily specials we should speak to the chef.  We didn't know what we wanted so we opted for the menu.  Those more familiar with the place seemed to understand and ordered specials which came out much faster then our cooked to order requests.  Lesson learned.  I had the chicken souvlaki dinner which was HUGE.  It came with an amazing greek salad to start and then I substituted cooked veggies for the potatoes.  For $14 it was an amazing amount of food that you could easily have shared between two people.\n\nLoved it.  Loved my leftovers.  Would definitely return.","date":"2015-06-08 18:05:35"}
{"review_id":"EkopC7IHqz1gaMwnfpgXag","user_id":"aWkLowqiglzLO3r1Jg266w","business_id":"e2ApirIzYID9xIye0r_gKQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"My favorite thing to eat is onion rings and mine were way over cooked and dried out. They were nasty. The burger was good but it is pretty hard to mess up onion rings so I was very disappointed. Not sure if I'll go back. Deep fried foods are one of the easiest things to make and a lot of the food on the menu there is deep fried.","date":"2018-04-15 08:21:56"}
{"review_id":"nd4LTx6eqvKnWJoOU7nUiQ","user_id":"AimNBjjD7Pg9ykWBT_pjjg","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Breakfast at Bouchon in the Venetian.  We had Croque Madame, Corned Beef Hash, and Jambon et Oeufs.  My croque madame was serviced with slice of brioche, ham slices, another slice of brioche with a sunny side up egg on top and a white sauce on top.  There may have been other stuff between the broiche slices, I just don't remember.   To fill, I mean really fill up the rest of the plate, a huge mound of thinly sliced fries.  I would have liked the fries to be a little more crispy.  The sandwich was good.  Even though it looked small, it was a lot of food.  \n\nCorned Beef Hash was just how I liked it.  Corned in small cubes, potatoes about the same size.  Peppers and onions.  with your style of egg on top.  This is how, I think corned beef should be served.  5 stars for this meal.\n\nHam and eggs were just ham and eggs, with some scallopped potatoes.  Nothing special about this meal.  For some reason it was $25 and in my opinion, shouldn't be more then the other meals.  \n\nThe pan d'epi bread was good, with butter and the homemade jam.\n\nOverall, a good place for breakfast.  Good service.","date":"2013-05-07 01:49:07"}
{"review_id":"U0tkmNc1P_5E6Qc9XPNJFQ","user_id":"v6YMoQUDJ5SbjsCFdDV4-w","business_id":"McoGYpK3JgrX377D7Crs6Q","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"A-OK might be overstating this place for a \"sports bar'.  While they had plenty of TVs, I saw at least 15, they had Rage Against the Machine playing and no sound for the games.  I heard a bartender say that unless it was a \"big game\" they could not turn up the TV volume when asked by another patron.  There were plenty of pool tables, maybe 20 and at least 7 darts games.   Loosely this place fits the sports bar definition, the lighting was good and staff seemed hurried but friendly.  It was not crowded with tables and such which left plenty of space to move about and mill should you like.  The restrooms were clean and did have the sports TV sounds on so you could stand in there and watch the small TV if you like.  For a sports bar I would rate this at 2 stars but the cleanliness and lighting made me rate it at a 3.","date":"2018-03-04 00:05:15"}
{"review_id":"hCe3lEfyhyZ0bSmwM3Zrbw","user_id":"WbEula_5BKJgfNHxrkxF-g","business_id":"wHlLjTBWPEbxHw6ZysSKIg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My favorite place in pittsburgh to get whole bean coffee.  Amazing selection, daily specials, reward card, reasonable pricing.  What more is there to say??","date":"2014-11-12 14:36:14"}
{"review_id":"-NDcV6PTtLjFophUXHyW8g","user_id":"eYFpFiwEthBBTUQJe1ttCg","business_id":"emDWwpE1dcUhP-raIExhVQ","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"One Star because I can't give it negative stars. DO NOT WASTE YOUR TIME OR MONEY. This was the worst \"experience\" of my life. Disorganized. Pathatic. No one knew what The hell was going on. Half the electronic features weren't working. 3 VIP tickets and gave us nothing extra. Weak ass \"hands-on activities\". Wish I would've have listened to the guy in ticket line telling all of us not to do it and get money back. Marvel should be ASHAMED to have their name on something so amateur and embarrassing. Save your money. Buy an action figure and play at home.","date":"2015-01-03 21:43:13"}
{"review_id":"9VrPFzixvLjdBbXLhB_U9A","user_id":"FzRxr6E-3kjOb9wpsSOJ4Q","business_id":"vYbpodi9utup_njMK5PAfw","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"Freshly made noodles and flavorful broth.  I'm not sure if this place has a Taiwanese cook, but their Beef Noodle Soup was fabulous.","date":"2013-12-28 22:41:32"}
{"review_id":"NEH9L2m-jEWFRP8u16ldtw","user_id":"OqX5J5l9aPHzxYZ2EAD1YQ","business_id":"k1c_bC3DK6mKg797vH1T8w","stars":3.0,"useful":0,"funny":0,"cool":1,"text":"We went to Beckett's Table the first night of AZ Restaurant Week.  The atmosphere is a little like Chelsea's Kitchen, but I really liked it.  My husband and I started with the chopped salad and the chicken meatballs.  The salad was super fresh, really nice.  The meatballs were amazing.  The sauce was very smokey, which actually tasted better the longer it sat, the meatballs could have been served \"naked\"...they were delish!!!  We both got the green chile stew for our entrees, my husband enjoyed it, I thought it was a bit on the sweet side, especially as it cooled off.  Dessert was the s'more with chocolate covered bacon, a dish you definitely have to try to appreciate.  Took a few bites to get used to it, but it was really tasty, the marshmallow was fantastic.\n\nI look forward to going back and try some other things on the menu.","date":"2011-09-25 17:55:20"}
{"review_id":"SabkWuchp-5GRpj8eLgsLQ","user_id":"KE3fPgfxEmfsutKxMlssvQ","business_id":"YCzPKhPgfUI9j1-mxJFpnQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"No need to review this fast food chain in detail -- but it generally is one of the more healthier choices out there.  Unfortunately this location is *extremely* chincey on both the vegetables and the meat.  More so than any other location I've been to.","date":"2011-06-29 04:26:34"}
{"review_id":"p1iBQlsZW3djeigdnVbs-w","user_id":"ghC_-3uK25V9pcmixuWatw","business_id":"IjeyNYr4kefZ2uZfrtJqZg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I've only been here once, but it was a good experience. \n\nThere are several dog parks in one large park area, including one with a water area for some doggie swimming. The space in the fenced in areas seemed ample. \n\nThe only thing I did not like was that you had to leave the fenced area in which you were to access the water fountain for your dog to get a drink. There should have been a water fountain placed in each of the park areas. \n\nThis place is kind of far and I was only down there because of an errand, so I may return on another occasion when I'm not too busy.","date":"2017-05-26 01:46:13"}
{"review_id":"-gSp9O8U40sOi6_loQecCQ","user_id":"4_f4_KVJgzKb94t6xJTZHA","business_id":"Os1n1_idfw9vv9kwULGJnQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"There was three of us who came and tried this restaurant, we all love korean food so our expectation is pretty high, especially after reading yelp reviews...this place did not disappoint...the location is not the most attractive place in vegas and most visitors will never try coming to this local gem, but if you are like me who is looking at las vegas as a vacation resort instead of just gambling and party destination, then you will love mingling with the locals here...the ambience is great, service is good amd most of the guest are very relax...the decor is nothing to be proud of and the location is caterred to locals, but you will not leave disappointed...start with their combo...share your orders so you can try more of their menu...if you are with group, try not to order the same item and just share...","date":"2015-06-21 02:39:08"}
{"review_id":"PiJ7HhRAPyIoBk80xS12Vg","user_id":"en833jC9FhoqQKhgMCMVUA","business_id":"NFm869_w6cvVaWaNpAzjeA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"PORK BELLY TACOS. Amazing! You have to get them - probably my favorite food in Charlotte","date":"2017-01-14 23:59:21"}
{"review_id":"Dt5ycvTBE3C-eerB3mcHnw","user_id":"Ev6-teGZr9snjkLQeRHECQ","business_id":"JM8E_t9ILXzPpUgc61FQiQ","stars":5.0,"useful":0,"funny":1,"cool":0,"text":"Excellent second car we bought here. Love our Sales man Rick Muller!  Looking for a good guy to work with ask for him. Tell I sent you","date":"2015-07-03 22:34:26"}
{"review_id":"ZhEcEZw7oswCARDriLxAcw","user_id":"jbOJV077QCGzduE6zFYO_A","business_id":"AqpiBApzrd30LA-vmU3Rvw","stars":4.0,"useful":12,"funny":9,"cool":13,"text":"Despite the drinks being an arm and a leg with the inside usually jam packed - if you're in without the huge line and go with the right people, Bar at Times Square can actually be a humorously fun time! Planning on tossing a few back? Grab a few before going in; Outside at a slot \/ table rum & coke - $1 (tip) \/ Inside bar rum & coke - $12 w\/o tip.. I'm just sayin'.. I haven't been during happy hour, as it seems the place is bursting at the seems waiting for a Fire Marshall to be called. It might be best to go during that hour or so if you're trying to have more than one beverage at this place. \n\nAnyways, it's a dueling piano bar with two fella's who know all the bangin' hits from the 50's all the way up to today's Top 40. A patron can request a song (once one ends and \/ or hasn't been interrupted) and if someone in the crowd isn't pleased - he or she then has the opportunity to walk up to the the non-playing pianist, offer a cash tip of higher cash value than that placed prior and have the song changed on the spot.. keeping both the patrons and musicians on their toes. It's really an interactive environment - in the sense that the pianists continuously receive requests, talk to the crowd, with the crowd itself shootin' the breeze, minglin', singing and dancing if they know the jam being performed. If you can't see the performers, they have tv's lined up throughout the bar so you can catch a glimpse. I'm not the tallest human, so it's often I end up in somebody's armpit while they're singing their favorite track and I'm gasping for air. Kidding, I'm actually the guy who has YOU in the headlock; You'll be blissfully swept away by my beautiful renditions of Bohemian Rhapsody, I Want You To Want Me & my jam - One Bourbon, One Scotch, One Beer in an overtly joyous manner. \n\n*They also have that lady you see at all the shows.. she dances & looks like Dee from It's Always Sunny, tries to get you to boogey with her and you can't understand what she's saying, though, she sings every song on cue without a slur.  She's an interesting human who needs help, so you push her towards the random person next to you hoping they'll do something about it. Do some people observing and find em'! \n\nThis is a place of action, sound and movement. You might get bumped or pulled to dance and sing. Good music and a giddy buzz is found at the Bar At Times Square; so be forewarned - most people here are on a good one and are trying to maintain that vibe! Don't get upset if someone just wants to sing with you btw - it's probably me!","date":"2015-03-18 19:12:29"}
{"review_id":"oOVbko2nKt-K0d7-kykpOQ","user_id":"5x6njXK0KKFW1xFbnTfFvg","business_id":"OK0ba4X5seibH8oMWh4bhw","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"Food is suspect but service is very good. Haven't been there for a while but went a couple times in the last month. The nigiri had a bad odor and the chef did not do a good job trimming the fish. Screaming O and jalapeño yellowtail sashimi were also cut poorly.  To top it all off the rice had a rock in it which resulted in a visit to the dentist to fix a filling!  I would choose many of the other local sushi restaurants long before this place.","date":"2015-11-06 02:56:13"}
{"review_id":"wqPtNPN89WZMDsk4t8IRfw","user_id":"5j0iuaFe8IrfOTJzkCIyLg","business_id":"PAuSe4-JzDLq6YO6OKPeTg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I was all set to give them a 5... until the last half a day.  I bought 2 Groupons and waited two weeks to get my pre-paid for appointment (1 set for one house 2nd set for another). #1 was scheduled for a Thurs-Fri two weeks later and house #2 the third Thurs-Fri. I got a call from Jimmy on Mon-Tues of the Thurs before House #1 was to be completed putting me off another  week (now we're in week 3).  I had two potential buyers come by that weekend to see house #1. They went with the other house on my block because of my ugly brown paint (that I had scheduled to be done)!\n\nFinally my long-awaited for Thursday came and Jimmy showed up with two men promptly at 7:00 and gave me the trip charge, charge for baseboards, and for an extra room.  It was VERY fair.  The men did a good job... maybe an 8-9 and cleaned up well.  They had to schedule my 2nd house for Saturday (I had told Jimmy I'd need 4 full days - two for each house). He did not come out to give the men direction for house #2 on Saturday or give me the price of things the groupon didn't cover  (I had high ceilings in both houses and needed an extra room done, wall paper removed from one small wall, etc.)  \n\nHe finally came out Monday around Noon to quote prices on #2 (again reasonable) but his men were upset that he hadn't shown up either morning to give them direction.  Plus the men had some conflicts with my handyman.  The men disappeared Mon around 12:30 - they got back at 2:30ish and left by 3:30 with the RR undone and wallpaper stuck on the tub and counters (from the removal) of my bathroom. The baseboards were done poorly, paint dripping was all over the tub, counters and floors and 2nd coat was never completed.  \n\nJimmy told me that he'd come finish the job - said I was getting the \"best of the best.\"  Because I wanted a slight color alteration (lighter) in the RR, he told me there would be a charge and a small charge for one other wall.  Once the paint had dried, I realized that Jimmy had not cut in the new color or cleaned up the wall paper and paint drippings from his men. He also didn't redo the messy baseboards.  My handymen and I were shocked by Jimmy's paint job (drips, no cutting in, unfinished baseboards). Then Jimmy called and asked me to have my handymen bring him his forgotten ladder??? What?\n\nBotton line... Groupons appear to be LAST priority for timing and you'll be paying weeks before you get the work.  They may also send you new, untested employees (my two workers told me I was their first project with Jimmy).","date":"2015-08-19 05:17:03"}
{"review_id":"PPwP8bNGU0uBYS2qcRxeYA","user_id":"BJIhb2jtpvV_Ivhq46aqnA","business_id":"J9QNmxUyp7Dn5pLZt2-IZA","stars":5.0,"useful":7,"funny":0,"cool":0,"text":"ALOHA!  I found myself in Las Vegas and in need of a massage.  Because I run a very successful mobile business on Yelp in another state, I thought to follow my instincts and turn to YELP for a mobile provider.  \n\nI called two places.  The first one did not get back to me in a timely manner.  The second one, Body Restoration, picked up on the first call!  Barbara was a joy to work with and we enjoyed a laugh as I was having a moment being the one on the other end of the transaction when I am so used to being the provider!\n\nShe dispatched Becca to my room within an hour!  Wow!  Amazing follow through.  Becca showed up on time with all her equipment and ready to work!  I enjoyed my massage very much, it was needed and I love that I did not have to leave my MGM Grand Room to receive it.  \n\nHere is a tip, and not meant to be anything but a helpful tip....if you are a massage therapist, or in need of an advanced skill set, please tell Barbara this so she can send the right therapist.  In my booking haze, I did not mention that I needed a certain something and I did not get that with Becca.  However, Becca is a wonderful therapist with great healing energy.  If you need deep tissue or skilled work, ask for someone else.  \n\nI would most definitely use Body Restoration again.  Thank you!","date":"2015-12-05 17:53:28"}
{"review_id":"OdNtQ4G5N0zzeSfB3jE_KQ","user_id":"1ZY7MTzf8TABN3Lk1_SNVA","business_id":"aeYjLZ0t15D3Rtiz7Woy3w","stars":2.0,"useful":4,"funny":0,"cool":0,"text":"If you're able to get fiber internet, it's worth it. Fast and had minimal downtime in the 2 years I've had it. I work full time from home and I only had a handful of issues over 2 years.\n\nSo why the 2 stars?\n\nIf you have to deal with customer service or god forbid the billing department, prepare to spend most of your day if not a couple of days on hold and repeating the same issue over and over again until you finally reach one intelligent person that helps you. Their downfall is their customer service. It's probably the worst I've dealt with and I've dealt with Cox and Comcast. \n\nThe bonus to having fiber internet is that you get L2 local phone support. As a software engineer I understand networking and computers, their L2 fiber support is great because they are knowledgeable people, not some tech moron reading a script. \n\nAlso, never settle for their advertised prices. Don't get a contract either. I was paying $80\/mo for the fiber internet only and not on a contract. \n\ntl;dr\n\nFast and stable fiber internet if you can deal with complete incompetence when you need \"customer service\"","date":"2017-09-20 17:33:22"}
{"review_id":"FguTE5it31iUPPG_s6CrAQ","user_id":"mnJvynzRIYptrjyKtEBiTA","business_id":"DKqhCd3Vwl3CEo8vUHhLYg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Mediocre as far as Indian food goes. It's relatively more authentic than fast food chains, substantially more expensive, and definitely doesn't hit the spot. Very disappointing.","date":"2016-08-13 01:01:27"}
{"review_id":"TvSs5lMQG5Ht-CdkAWiEtw","user_id":"nDn9-IEz6JUGY0SJEYXnBw","business_id":"VeFqptSzekFAc3FZOpi81Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Favorite restaurant in Charlotte... Food is amazing!! Only complaint is the size of the place... Really small so it can be difficult to get a table. Although part of the charm is that it's a mom and pop type of place.. I highly recommend it!","date":"2015-12-20 20:19:35"}
{"review_id":"F49cE6UmBt8bf-XL-sPoYQ","user_id":"kjaUSiRWhR9bF9KxOMbVvg","business_id":"odyYR1Bg2bqmp1kVlm8OYw","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Just under 50 million visitors a year to Las Vegas, and so many of them no nothing about Red Rock Canyon! Granted you'll need a car, but about 20 minutes off the strip you'll find what nature can provide that Steve Wynn can't! Natural beauty that leaves you staring in wonder and listening for....nothing! It's deathly quiet out in the desert and especially so out at Red Rock! Beautiful red rock formations for the experienced hikers to even the casual novice! More importantly it's just breathtakingly beautiful and well worth stepping away from the Blackjack table for a afternoon! This southern gentleman does every time he's in Vegas!","date":"2015-08-30 13:28:09"}
{"review_id":"mX62VaJ5QolfPucWWaXMxw","user_id":"fNVasTnyNV2bdkqS8deEGg","business_id":"bsSI_KSp40qfMPjww14QLQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I'm reviewing the Minute Clinic here. Imagine feeling ill, checking in on the kiosk, and waiting an hour, and knowing you're next in line. Only to be cut by an entitled woman in her mid 20's and her mom, who had just spent the last 15min chatting it up loudly in the waiting room. Coming here was a huge mistake...","date":"2016-04-11 16:43:39"}
{"review_id":"pgGfYq9QYZpUhG-QIT72wA","user_id":"La9n2AMQUs6GWc0UGVWvDQ","business_id":"tY4OVzzaiRdo4sObLWhZSg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I was very happy with Greg and GC Glass.  What I thought would be an expensive window replacement was actually a quick fix with minimal cost. Greg is honest and knowledgeable.  Will certainly call again if I have any further window repair.","date":"2016-09-18 15:57:12"}
{"review_id":"eocYWge29kTnYzpqXd03iQ","user_id":"ZmKGF8ZZUo16g2ISrz4ahw","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"First things first - I like Bobby Flay.  I like his television shows.  I like his personality.  And I like his style of cooking.  So I ought to like Mesa Grill.  And in some ways, I do.  But there are also some issues.\n\nThe ambiance is bright and colorful, with high ceilings, lots of windows, and an impressive bar.  But the tables were packed in pretty tight.  Hey, I understand why.  The place was full on a Tuesday night!  If you can cram that many people into a space, and they still want to come, then it's just smart business.  But it isn't my taste.\n\nMy wife and I decided to try as many dishes as we could, so we shared a menu made up of appetizers and side dishes.  Our server was friendly and helpful, but he did not bring out the dishes in the order we requested.\n\nSome dishes were what you might call \"just fine\":  The chopped salad, the blue corn pancake, and the double-baked potato.  The goat cheese queso fundido was better than \"just fine.\"  The chile relleno and the tiger shrimp were both spectacularly good - snapping with unique flavors.  The smoked chicken quesadilla, on the other hand, was sub-par and not very flavorful.\n\nSo, Mesa is a perfectly acceptable restaurant.  But when we go to a high end, pricey restaurant we really want nothing less than five stars, and Mesa doesn't quite get there.  Lots of Vegas restaurants do get there.  So we won't be back at Mesa for a while.  Sorry, Bobby.  We'll catch you at Bar Americain next time we're in New York.","date":"2015-11-18 18:59:44"}
{"review_id":"94S0qLGSFLZIpjksRUgVxw","user_id":"ZctCT67EFyBmeUoydLTquA","business_id":"s_466owgNXqmQRuSluHHEQ","stars":4.0,"useful":2,"funny":0,"cool":1,"text":"It's hard to complain about this hotel. If you're into the trendy\/modern establishments this place is probably up your alley.\n\nThe service was pretty near perfect. The clerks make sure that everything you want is provided for you. They'll even make reservations on your behalf to nearby restaurants. The location of the the W is nearby a mall, there's also a Yardhouse, Starbucks and a Grand Luxe Cafe within walking distance too.\n\nThe W hotel boasts a pretty jam packed pool party in the summers. The pool is located on the roof with lawn chairs and circular couches placed everywhere. Not to mention that they have a 'beach'; An area that if full of sand and tents for you to lay on. You can also order food while soaking up the sun and alcohol.\n\nThe hotel rooms are clean, semi-quiet, but very small. For the price you pay to stay at this hotel, they sure give you a tiny room. But the service outshines the room so I can bear with it. The pool area becomes a club\/lounge at night, and you can hear the music from your room (thump thump thump). After a while, it can get annoying.\n\nThe toiletries are straight from their in-house spa, Bliss. Flat screen in the rooms, a desk for you to do any office work on and modern-esque furniture and lighting to set the mood.\n\nI suggest trying out the W hotel. Their pool party rocked, the service was near perfect, the rooms were nice, they have an in-house spa, Japanese restaurant (Sushi Roku), and a lounge (The living room).","date":"2010-01-08 04:13:19"}
{"review_id":"_ouQ6j_kHz5WiCdeUxFe4A","user_id":"Qc69D3sD1zzGLpjSkSoSew","business_id":"cj_9eTPR0JBqk9qt2VmzFw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This place sells walnut cakes and a few other dessert items.  I'm not partial to anything with red bean paste so I only had the mashed potato \/walnut and mashed potato\/almond ones.  They were great and I wish I had bought more than six.  They are only $2.25 for 6 cakes.  The cakes are really shaped like a walnut from the special molds they are made in.  I got them when they were fresh off the conveyer and I think I would want to do that again.  I went back a few days later and tried the pancakes stuffed with sugar which also really good.  Will be coming back here again soon.","date":"2016-05-07 01:08:36"}
{"review_id":"aVozRweRmtlvEDx2C32pLA","user_id":"LNPX66Z4-jJRejisPF_8TQ","business_id":"cTPdZ9Va0HCLESf5gNnXwA","stars":5.0,"useful":3,"funny":0,"cool":1,"text":"The food and vibe here is outstanding. It's definitely a place where I'll be taking all our friends when they come into Madison.\n\nFor starters, the fried chicken is some of the best I've ever had. If you like buffalo sauce, it's a home run. \n\nMeatballs - pretty tasty themselves, but the red sauce is magical. \n\nEntrees:\n\nThe pizza sauce is perfect. While I love a good wood fired pizza, the steel pan pizza is Madison's pizza. I mean spotted cow in the dough? It's a thicker pizza with a cheese baked onto the outside of the dough. \n\nThe black mushroom truffle wood fired and Calabrian sausage pizza were the two our table tried.\n\nDessert:\nThe only dessert currently in the place is the pizza cookie, but it's all it needs. A partially baked cookie covered with vanilla ice cream. Drool... The entire table can share it and it's a whopping $5. Get 1 per 4 people and you're set.\n\nThere's a lounge downstairs, amazing beer selection, and much more I could talk about. Check it out. You won't be upset.","date":"2016-05-31 02:34:30"}
{"review_id":"myIPliOpsNFCs-vV1IbMOw","user_id":"BPh-OMqPul6HXsnCHxsk6g","business_id":"YgBQEX8dB27FdYj7PaPhPw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Simplicity at its best. G&B offers a nice touch of good ol' bar food in a clean, warm, and inviting feel atmosphere. Nice bar with plenty of TVs to catch any of the games on. Nice selection of beer as well.\nI'm a out of towner and my cousin brought me here for their awesome cheese curds and they did not disappoint. Extremely light but well seasoned batter encasing bite sized little curds of heaven with their home made dipping sauce was well executed. The fried smelt was a pleasant treat. Again with the light batter but full of flavor with moist tender meat on the inside, paired with their homemade tartar sauce, it was one of my favorite things I ate on my trip. Their burger was simple yet bursting with tons of flavors that elevated the humble american staple. \nThe service was good and I'd say it was a pleasant experience dining here. Simple food done right with subtle changes that elevate it is what makes any restaurant stand out. G&B do just that and do not disappoint. \n\nStay fat mother suckers","date":"2017-06-06 20:25:01"}
{"review_id":"5qo4ck5IfLr2-yOby0IdLQ","user_id":"cM5nBvgS1Lmmto_dCfwY3Q","business_id":"V_jIfMz9Z7a5mthleRq0_w","stars":3.0,"useful":0,"funny":1,"cool":0,"text":"Quick serve Indian in uptown Charlotte that doesn't scare away Indian food newbies?  booya!  Nirvana II instantly catapults itself to the top of the list for Indian quick serve in Uptown Charlotte.  Partly because it's decent, and partly because the competition is weak (read non-existent).  \n\nNice, clean place with a few dishes to satisfy both the vegitarian and carnivorous Indian cravings.  The korma sauce is a bit sweeter than I'd prefer, but the Pratak was impressively good.  Like the other reviewers pointed out, the Naan leaves something to be desired - it's blah, at best.  \n\nIt's a good value too, you can get in and out with 2 dishes for about $8.  \n\nHam it up with the owner and what appears to be his wife.  Super nice guy who likes to chat and appreciates a decent joke.  Actually got an extra scoop of Chicken Pratak for getting him to laugh, I'm certain of it!","date":"2012-12-04 17:52:37"}
{"review_id":"dLA-_6aDWtnqi7eb6Lf5NQ","user_id":"bYUMmGsOBM2f1Ldx4dEEoQ","business_id":"TFKB3U0th0ryO5Nb9Qghtg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This place is AMAZING!!!! Excellent service, delish food.  I ordered ramen. It was the only place open past 9 on a Monday. I am so glad we came. The Ramen was so flavorful and yummy. I ordered it with the egg. Normally when I order Ramen they give me a hard boiled egg, not here! That sucker cooked with the heat of the broth....for me it was too mushy since I like my eggs hard boiled but everything was amazing... our waitress was super nice and had amazing hair! Lol.... I will be coming back, excited to taste what else is on the menu.","date":"2018-09-25 05:15:58"}
{"review_id":"N_ROc2i7p7CQrj10aSCHZA","user_id":"vSJCDeql1VvuR8W9CfT22w","business_id":"woXlprCuowrLJswWere3TQ","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Trendy and expensive. But the food is pretty good. \n\nHad the al pastor and thought it was a bit too salty. The duck confit was flavorful.","date":"2016-05-19 06:22:05"}
{"review_id":"k9SQpDQ4RkfaSHdlX5MIuA","user_id":"Fy1ASW-F80S5pB7_jgTC5A","business_id":"maUGKOLNdvYKUVQoyh0-gg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This guy is awesome. Brings down every ticket to a parking ticket and charges less than other attorneys. The office is kind of hidden but definitely worth looking for. $29 for my speeding ticket. Can't get any better than that!","date":"2014-08-24 20:42:16"}
{"review_id":"fv9LrU54Iw1YUZVP5xb3xA","user_id":"GeI-CAxqzza5AbFO8Mim4A","business_id":"QWsykEGl2ZxZDTKhN5RYGQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Excellent work by sergios crew. Had them come out this morning to clean my backyard which was in really bad shape.  They made my backyard look great. Definitely recommend this company.","date":"2015-10-17 01:23:07"}
{"review_id":"dCT7PeTr9E4WBMOtiPYUZQ","user_id":"3jX9ecmXpHi0CbbH_ZMerQ","business_id":"T2tEMLpTeSMxLKpxwFdS3g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Kid friendly environment, noisy atmosphere & great service. Love that the salsa was fresh chunks of tomatoes & corn. The chips were a bit hard & thick. Avocado pasta salad was delicious- definitely order it again.  Tofu tacos were perfect. My 5yr old liked her shrimp kids meal. Beer batter white fish was heaven for your mouth....moist fish with oh so good batter. \nPlenty of seats inside or outdoor patio.","date":"2015-06-21 01:02:45"}
{"review_id":"udn3bIIyWexDCW3am35i5A","user_id":"XRJrdUpE4ZlOlcshvwSNaw","business_id":"jNhxnj9j_spThcSzJMaeTw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"cheap and authentic  Hong Kong dim sum , love the spare ribs and siew mai , you can't beat the price ($1.80\/plate) ! But I don't like the pork bun and the shrimp ball , that's why I only give them 4 stars. I would recommend friends to visit them and I would definitely going back next time  .","date":"2010-10-06 08:44:00"}
{"review_id":"i1BhlqdQ70lupPISxs95BQ","user_id":"jKw5cGjQkTV1T2Qv7u5qwQ","business_id":"JHyv6TwbNfIcjpos8_espA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Love this nail salon! I've look high and low for a fabulous nail salon, it's been hard to find a place Since I've moved here from Cali.These is the spot Eric does an amazing job. I've been here twice and always leave a happy camper hands down!","date":"2016-01-17 05:11:29"}
{"review_id":"H6ORxprOpEXC3oX-k7UyHA","user_id":"onkC79tUF3aCwEHrN25VuQ","business_id":"OmZ_Ub_0egPc6eDPD1OWSw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My girlfriends and I came to visit Toronto and we were staying in Greek town. We decided to eat after a day of travel into town from Chicago and this place was among some of the best food we have ever eaten. We shared the spicy feta stuffed peppers which the lovely waitress recommended to eat with a drizzle of olive oil and it was divine. We had the gyro plate which was unlike American gyros with pita, but instead was served with a fresh Greek salad and lemon potatoes. We also got the lamb dinner special which literally fell off the bone because it was so tender. And we also got a sort of Greek lasagna with a rich white bechamel sauce. The service was super friendly and very attentive. We got to see the kitchen and saw everything that the chef prepared for the days specials which only made our mouths water more than they already were. Prices were very affordable as well. We left with an incredible impression and longing to take this incredible family owned business home with us.","date":"2017-05-26 03:15:10"}
{"review_id":"7gxp3Wtf1f7RtUiwKX07EQ","user_id":"Qhm_AsABsR6h8fgzz846VA","business_id":"-74zTQjLpOTzgvPTsN2Z8A","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I'm very upset with how this whole clinic works all of them, you call one number for all locations so your never able to get through with the medical assistant at the location you visit. They take forever to give you a call back and the customer service Representatives are mostly nice but when you haven't gotten any calls back after being told to keep your phone by you someone will call you in a few mins and its been four hours!!! Its very disappointing. And they all give you the same run around and at this point your a bit annoyed they have sarcastic attitudes. I've been waiting since 9:30 am and its now 2:00 for a call back for a simple precipitation and nobody can give me a answer. After my first trimester I am leaving this place. The first nurse I saw was nice but not a people person which made my first visit uncomfortable. I suggested things to her to make my blood work done, she should have just brought it up. Anyways I hope to have good things to say but at this moment I don't and am very displeased with the service everyone's experience is different this was mine.","date":"2015-03-04 22:25:03"}
{"review_id":"0663Q4JmeVKV4TXraWKtGg","user_id":"v79Gh7TLajk-xNOKMGTBbg","business_id":"M_v9BN9QHosc8kohmUj-cg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This is really a hidden gem in Richmond Hill. My girlfriend and I were craving pasta tonight, so we resorted to Yelp and found this place in the nearby. We ordered the Penne Al Vodka and the Baked Lasagna take-out.\n\nWhen I got to the place, I was a little skeptical as there werent any customers. The place looked cozy and comfortable though! Got the food and brought it home. Had a taste and we were extremely impressed. This is a true definition of \"You can't judge a book by it's cover\". The food tasted fresh and homemade. I was so relieved that I didn't see a lot of steam when I opened the box, as that usually means the food was microwaved. \n\nI will say though, the online menu prices are outdated. The actual prices are a little more expensive (at least for the lasagna).\n\nCan't wait to try this place again.","date":"2017-03-27 01:18:23"}
{"review_id":"_L9JrteDFM0Z2oBqjljkSA","user_id":"GG7LW-UL1SCcwcJgT1-Jvg","business_id":"ZAu2dg-4mwCy20biGgmV1A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Wow, nice restaurant, nice people good food , and adjusted menu  to suit my need ,even with a full house,  and reasonably priced","date":"2015-12-05 05:15:27"}
{"review_id":"m7pz7SBiXmjZTKDy28LfPg","user_id":"A9PzIlg1jlezCcpuN9V8UQ","business_id":"kmF4ghAzgUNlKj0qifeSRw","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"really? TWO AND HALF inches room from the top of my grande frap. i asked why it's not filled to the top, it's for the whip!? that's what the rounded cap is for. hogwash!  \n\nas for lattes, poorly made as well. taste more like a cup of steamed milk, barely espresso.  baristas should be better trained in making drinks here.","date":"2013-05-07 15:58:09"}
{"review_id":"41-zhqrm4mZG2FY6DDoJiQ","user_id":"DUXu2fG_I50xLkXcNzYIbg","business_id":"xfzDtGxx6B4a27RAyah69w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Awesome often overlooked sushi buffet. Creative menu with lots of unique choices. Stay away from the flamingo roll thou...no bueno","date":"2016-01-30 04:25:10"}
{"review_id":"BembISiP0C0Rp_wNFhZLBA","user_id":"uSCT3OTpJ0NAwGr1tjit7A","business_id":"Atk1wlFBAjbxczwL0uwQVg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Good food\n Great service. You get alot food..friendly service. I can never finish my breakfast. Give you so much. Clean. Good location. Love they give discount to veterans.","date":"2017-08-07 21:22:20"}
{"review_id":"r1p6yrOwmbsMbMEkXTsWUg","user_id":"CtGsDzpUrCipaN2dNKKsoQ","business_id":"ID5wWJ9C7G0hfbQilvlfxA","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"Place and food was great... but we came in as a group but per our server they can not so separate check... and we have to calculate our bill and plus tax... ahmm ok.. we end up using venmo... in one check... so for those who plans to go in a group... not a good idea... FYI...","date":"2017-12-02 21:28:06"}
{"review_id":"C63BA6gd1PPbflkTdSz2WQ","user_id":"LGk3boz5dZgFmslaz8ugjw","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"The flamingo is one of the older casinos but it is right on the strip the pool was nice the staff was friendly. The room was fine it showed s little wear and tear.\nWhat they need to improve \nCheck in was a nightmare almost 2 hours of waiting in line that is not good customer service. The parking lot is a joke they share a building with hertz and valet so not much space left we parked on the roof #7 the elevator stops on #6 so u need lug your stuff down the stairs. But it is right in the middle of strip so the location is the major plus. We walked or rode the bus (8$all day)","date":"2014-07-28 01:53:16"}
{"review_id":"IXS2dx-CsYnZ5S5In3WFdQ","user_id":"0EhPIlDozxGKpbbHRr6vZg","business_id":"pHDLRIG2Xu1_1mkGAbyEmw","stars":4.0,"useful":2,"funny":2,"cool":0,"text":"I've been frequenting Harris Grill for a few years now and it typically doesn't disappoint. Their outdoor patio is delightful on warm summer evenings, and the inside, while dimly lit and a bit hipster-y, nevertheless feels welcoming and cozy. The menu is written with a heavy dose of sass and snark, which makes it a fun read. Who wants to order boring old chicken tenders when you can order \"Britney Spears\"? I should probably look into hiring their menu writer to help me jazz up my tech reports for work.\n\nAnyway, I've ordered many things here, and their food is usually solid. My favorite meal begins with a plate of their \"church basement pierogies.\" They cook up a legit pierogie, with a soft, tender shell browned to perfection and housing a ton of delicious, fluffy, flavorful potato and cheese filling. They are *almost* as good as actual church basement pierogies. Then I like to wash down my pierogies with an order of their mac and cheese topped with blackened chicken. Their mac is addictive -- creamy, rich, cheesy and topped with crunchy breadcrumbs. I really like the blackened chicken paired with the mac, as the spicy cajun seasoning on the chicken cuts through the fattiness of the cheese sauce quite nicely. Supremely delicious. I will admit that once in a blue moon the mac and cheese will be a bit dry, which is a bummer. So the consistency is not 100% there. But nine times out of ten, I'm graced with a good amount of cheese sauce and I'm a happy camper. And then I pass out in a carb-induced coma.\n\nThe downside here is, of course, their prices. They are pretty expensive. I recently got my standard pierogies-and-mac meal for take out after not having visited for awhile, and I had forgotten just how pricey they are (it was $25 + tip for my meal for take out).  So be prepared to have your wallet cry a little, but the mac and cheese should help cheer it up.","date":"2015-04-01 20:26:40"}
{"review_id":"wJZOFIz9BR1ic89PzBXkMA","user_id":"6_51CQPE5GyIX29t_DkRYw","business_id":"N6BDiFk2CyJTMPGUlcOfAg","stars":2.0,"useful":3,"funny":2,"cool":3,"text":"Very hot inside!!! They charge more than all the other boba places I have been to... They're okay though, no real complaints. They take their time when making them though.... A very very very long time...","date":"2015-07-04 01:00:05"}
{"review_id":"QHBWISPEZY_0s7-4c7xywQ","user_id":"c7tkuOoLCrBzfkdC1bvwLQ","business_id":"uh7DUWtPoZkuEE05fghJ_w","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This place is cool. Walking thru a pawn shop into a speakeasy setting was a first. Inside was great and the small plates were too. Really good place for a group of friends to share dishes. Expect to spend $50pp since you'll be ordering multiple dishes.","date":"2017-07-08 18:20:10"}
{"review_id":"h2I0keNERIZchc3XBPIGOQ","user_id":"qvrhOkIzXJ-Jd1cPOEnjBA","business_id":"EjzMHfwqAmj7BgdzQjquRQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great ambiance, gives a authentic but modern vibe. First time seeing such a unique and appealing design.\nThe color coordination of the restaurant blends smoothly but stands out as well. \nThe food is great, you can actually taste 'fresh' in all of the items. \nThe whole staff of the restaurant is great starting from the manager to host to kitchen crew.\nI highly recommend this place to anyone that has seen it while driving by or browsing on Yelp.\n\nIt's a must try everyone! Don't miss out!","date":"2017-07-08 19:29:46"}
{"review_id":"UulHWWxEXPDHy_qYFd6YDg","user_id":"CFhujYMimmWbEGRN7oKyJw","business_id":"o9GrvE8Py7jLxYU71ImboA","stars":1.0,"useful":1,"funny":2,"cool":0,"text":"WOW that is really all I can say about this outfit. \n\nI went to the Full Service Plumbers website and when I read \"There is no job too big or too small for our highly skilled team of plumbers\" I thought maybe this the the plumber for me. I was going to have them install a brand new bathroom. I clicked on the link on their website that stated \"Have a question about a possible repair? Not a problem click here\".  \n\nWell I guess it was a problem because the response I got to my request for a quote on the job was (this is a quote and the full response) \"sorry we are just too busy to get to it . thanks\"  I replied \"I will remember that for future reference\" Their response came back immediately and it was (again a full quote) \"Good\"\n\nAs I said in the beginning WOW!!!\n\nHow about stating something along the lines of \"We are sorry for the inconvenience but we are busy at this time of year but you can get to this in such and such a time-frame\"? \n\nHow do folks like this stay in business. I will never use this company, when they slow down in business maybe they will hire someone who can properly answer requests for their services. \n\nI am very sorry I was a bother to this company no worries I will never call you again and fellow Yelpers should not either!!!","date":"2015-10-23 18:43:45"}
{"review_id":"gpJEGAYbvW0L-nksVR0sFg","user_id":"QyScH8Ef-7RosWQch4Ikcg","business_id":"-MC7EFxTsyKMKB3zeP_FIQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This is an awesome, cheap family diner! Such nice people run the place and they're very good for what they do. It's basic stuff - bagel with egg and cheese, omelettes, egg salad, soup, etc. Good diner food that comes out decently quickly. The donuts are also very tasty and there is always a trivia question for a free donut if you get it right!","date":"2013-01-28 04:01:14"}
{"review_id":"OE0zKgiL-Oo0ybGDhsgnpw","user_id":"GriRJ25olEQx6ZHoTsmwcg","business_id":"gwVl_QdunT1VzAhGSEheqA","stars":1.0,"useful":1,"funny":1,"cool":5,"text":"Advertised specials are in very short supply. All the advertised products I wanted were out. This was not the first time. A Coke promotion of a 24 can purchase gave a free 1.75 liter simply orange juice. As no 24 can package was available, I picked up 2 - 12  packs of soda. No manager or supervisor would honor the promotion. \nAs these disappointments happen too often, I have finally made up my mind NEVER to shop here again.","date":"2014-06-28 02:41:43"}
{"review_id":"TKIVXRmrnCSvmlJPovFgnA","user_id":"RvdWOF9kC5Q4qgjw9PbVow","business_id":"qTsSY0m4wlfhqGrUVWdA8A","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Workout is always changing this keeps it fresh.   Instructors are great and I like the balance between cardio and resistance.\n\nGreat atmosphere and range of fitness levels from Superhero to beginner.","date":"2017-05-26 13:55:08"}
{"review_id":"1sgT_eeJ8qd96jYdMGgVeA","user_id":"5v_AHgJ1Rupkz8FtsOVZbw","business_id":"tJcpzXzykNSLuzWwa1JQUw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"There's always a line at the warehouse whenever I walk by Queen West. Now I understand why! All food items were only $5! Drinks were yummy too. Came here after work on a Friday night but luckily my coworker had her cousins already lining up so the wait wasn't too bad. The decor inside was very hipster and the DJ was playing some throwback hits. I ordered the works burger with yam fries and the mini donuts! The yam fries were delicious, but the mini donuts stole the spotlight. Hot and fresh with some cinnamon sugar and butterscotch dip? Perfection. I'll be back for lunch when there's less of a line!","date":"2017-12-02 20:23:02"}
{"review_id":"wRD0xEdbO3TeRlw-ueMhzw","user_id":"Yfv5s2k4kyStydDx20OVrg","business_id":"DT35ycaAVzbq83vVGRCoIQ","stars":1.0,"useful":0,"funny":1,"cool":0,"text":"Seriously?!??? How in the world do you get rid of the red pepper asiago chicken Cesar salad?!?! The whole reason i kept coming back... Now i wont be back unless zupas brings it back!!!! You don't have a Cesar salad!!!!","date":"2015-01-03 21:20:46"}
{"review_id":"TcaspzgEvhgVMwhTfELnXQ","user_id":"cgRKSmpD7dEWREKI_jZriw","business_id":"zJGtD3y-pAIGNId4codEEg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"On my last review I noted how I thought this restaurant was good but did not compare to Gallo Blanco. I was encouraged to go again,  which I did,  yesterday with a group of 8 people.  To start,  they would not sit us because we only had 6, the other two gals were on their way. The restaurant was pretty empty,  but they stated they had other reservations.  I never saw a group of 8 come,  so. ..our table should have been available anyway.  We would have ordered many more drinks but instead we had one, two at the most.  The guy that finally decided to sit us was not very nice,  and rudely said \"come on! \" to which I responded that we weren't a bunch of cows being herd to our table. He didn't say anything.  Our server was alright,  her voice was a bit much on the ears, have you heard of voice fry? The food,  great, guacamole and queso fundido were tasty. The tacos great as expected, the mijito, though  not on the menu was well done. We came during happy hour,  but when checks came the bill didn't reflect that. The waitress seemed annoyed when we asked about it.  We are by no means a difficult or demanding group. So I am inclined to think it's an attitude issue on their part. I was  completely done with the experience when a plate load crashes on the floor. It falls from the hands of one of servers. It was literally next to us,  soooo loud,  pieces flying,  and not a word to apologize or something!? We weren't offered desert and at that point I was too bothered to stay longer.  I said bye and thank you as I walked out,  but there was no response from the staff. So maybe I'll go again,  to eat tacos because they are truly amazing but I am now even more sad that Gallo Blanco is gone. .. the charm,  atmosphere,  attentive service is clearly not at this but the Otro (other) restaurant. Sigh...","date":"2015-02-16 06:04:36"}
{"review_id":"xQdvvJBCiIsSso0XFj52Fg","user_id":"xSiaSnRfXBVZstO9LBNRaA","business_id":"ysJo5Jdo29XOBCnKrbUKWg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"A true French eatery. I've been here for brunch, and had La Bastille, a wonderful savory vegetarian crepe. Make sure you take a box of macarons to go! They are the real deal.\n\nThe only reason I can't give this 5 stars is that it is a little too French - the portions are very small for the prices. A nice treat for myself once in a while.","date":"2015-07-03 21:04:12"}
{"review_id":"K-1cv59MQ4H_qlimNQO0bw","user_id":"7mG79qLYU_CJ_HLr8B4hbQ","business_id":"ac3laXcJnclYZAO65XAcmA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Attention Las vegas the black bear diner this place is ridiculous with the portions and I'm talking about the light menu they are crazy. We all ordered from the light menu the meatloaf,Patty melt,tuna melt,a burger which now that I think about thats the only thing that wasn't on it and that was huge. The food was surprisingly better than I expected. I'm really glad I took some culinary advice and listened","date":"2017-06-06 21:27:43"}
{"review_id":"3s8uY7ucUBrovfujAd2TrQ","user_id":"3p_YUoTXOe2aML4GbDsBdQ","business_id":"3kQarjSJYYo9nGAkFjbWYg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I stayed here twice in a short period of time in April 2014.  The first time I liked it, the second time made me join the Hilton Hhonors program and recuse myself from Marriott for a while.  I requested connecting rooms (traveling with my son and one of my parents each time).  The first time we got that, the second time we did not.  Disappointing, but it was more the way the woman checking us in clearly could not care less that my son couldn't stay near his Nana--good acting is the key to good customer service.  The second time we stayed the heat was very loud, which I didn't figure out until my son was asleep so no way to get it fixed (assuming they'd care more about that issue).  I don't much understand why housekeeping couldn't have filled out a note that the heat was broken--it was LOUD, they would have noticed.  The bathroom was very small, very.  \nBut it was clean, the pool area was nice (although had not been cleaned during the night when we went down the next morning).  Breakfast was fine, nothing special.  I won't be staying here again.","date":"2014-06-11 17:55:35"}
{"review_id":"gUSd1Msd5TPo3MuZYmHBdg","user_id":"BvDI3EUPf1yJQJh-P7Uqjg","business_id":"AueEbb9kao4lt6CYt06hqw","stars":5.0,"useful":4,"funny":1,"cool":1,"text":"Hooowww have I not written a review about this place yet?! I'm dying to stand up on my soapbox! \n\nThe fiance´ and I have come to Okra twice now, and both times we've sat at the bar (everyone knows the bar is the best place in any restaurant). Let me just narrow down this review to our latest experience (hub's bday - and btw, I know he's not my hubs yet, but it's way easier and a lot less annoying to type, IMO).\n\nSome highlights: the bartenders are so nice and SO talented. Their juleps are to die for!\n\nNext, the apps: you shouldn't come here if you're not planning on getting appetizers. Just turn around and go home. The Fried Chicken Skins are unreal. Think about the best part of friend chicken, and then imagine having JUST that on a plate covered in spicy honey sauce. I die.\n\nOn to entrees: you can't go wrong with both styled of fried chicken. I always go for the Tennessee Hot because I like a little bit o' spice and the sauce is killer, but my hubs goes the Umbrian style (your regular run of the mill fried chicken) and it's equally delicious and fall-off-the-bone.\n\nLastly, and truly I'm saving the best for last, dessert: You have two options: you need to either go for the pie or go for the donut...\n\nThe pie is from Pie Snob (if you don't know about Pie Snob, look it up on Yelp RIGHT NOW, and then order an apple pie, and then thank me later).\n\nThe donut and pure caramel heaven. It's drenched (not drizzled) in the most delectable caramel sauce I've ever tasted, with just a pinch of sea salt to top it off. *drooling*\n\nOne pro tip before you come to Okra, since you're obviously making a reservation this very minute: it's a little hard to find. The sign is on 7th so you might be tempted to pull into the parking lot where it is, but you have to turn down Palo Verde (small side street) to get to it - it'll be on your left.","date":"2016-06-22 20:42:59"}
{"review_id":"IAgYvcT2YqX2x0f_dbklVw","user_id":"rYD6A3VdjCp2KCyHqKv03g","business_id":"pKk7jCFIm96qDdk0laVT2w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I had a wonderful time at this steakhouse ordering from the bar.  \nThe bartender was attentive and offered me some wine tastes to see what would go best with my meal.\n\nThere was a small mistake on my appetizer, but the one that they brought me by accident was awesome and much better then what I had actually ordered so that was great.  And they took off my first glass of wine which just shows how awesome the service is.\n\nThe skirt steak I ordered was wonderful and I was almost tearful when it was gone; the side of scalloped potatoes were equally amazing.  It almost tasted like there was a hint of truffle oil.\n\nI think that they were supposed to give me some complimentary fries, but I never got any until I called up my friend to come and join me; and then I ate some of his.\nBut I enjoyed the meal so much I didn't mind the few mistakes.\n\nIf I had more time I would have come back!","date":"2010-07-07 20:37:20"}
{"review_id":"CrgmAxnP-i9EbynvUidysg","user_id":"GhyyCJRA7lOijm5iVUaUUg","business_id":"SoX1KYN-59_0HyOWA4-Zfg","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"They are awesome I found them on craigslist. Sean was polite and strong. His crew were also awesome and on point. Didn't just move our very heavy furniture but they reassembled it too. Priced very reasonable.","date":"2015-08-19 13:46:26"}
{"review_id":"QyPiWspG7OJa8YQWK5lpxw","user_id":"9Rq3rTYXmo8S6ZHCxT52iQ","business_id":"KVwflracbADEUzLn1wTEKg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Love this location, super friendly staff. Very courteous and accommodating. Clean and quiet. Love those onion rings and all day breakfast!","date":"2017-09-08 22:56:59"}
{"review_id":"lIluHRrqAKzxAiWocsn78w","user_id":"0rrTPc96cOejT2lnHmP3Fw","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This was a great dining experience.  I had never been to one of Bobby's restaurants and I can honestly tell you that I had very high expectations.  There were met and exceeded!  Our server was very friendly and extremely knowledgeable and the food was absolutely incredible!  The appetizers were perfect, we had the ceviche and the tuna sashimi and it was great.  The drinks were pretty great too!  All in all, this was a great place that I would return to.","date":"2008-12-03 14:35:47"}
{"review_id":"u04j9Cv6x3fVfJk9V1Kj3A","user_id":"HTBIsZuDfmiGBIEXSTw5FQ","business_id":"XZ5eG2IEqu_MuZyTZTcpSg","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"No customer service as the \"help\" wander around doing nothing. One star for having a greeter that says nothing.","date":"2016-07-14 19:30:01"}
{"review_id":"eWTuxSlruTuFH8W3JCN1YA","user_id":"tlAnz_Xs0jjg4K0nuv50Bg","business_id":"MjWwjPErWyFU9nv6NQKYgA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I came here as a young little kid with my uncle Peter in the 60s from the back door in those days he was a regular, knew the original family and he intoduced me to food decadence ,unlike the restaurants he and my dad owned in Montreal that were on the faster side luncheonettes and Diners ,Uncle Peter and I went there up until the late 70s when I would go with my dates and even my first wife. \nThis place is a classic and I remember being schooled in the art of the Maitre D ,there was no room for error because if there was a glitch it would be fixed ,fast with I am sorries and quick replacements. Ah What a place the last  time I went there was with good old Jim S and Nico with some dates in 97 and Red Fisher of the old Montreal Star and at that time the Gazette came over as he new Jim and told us that we were the best decorated table he ever saw at Moishes . I had my usual T bone steak rare and a bunch of apps. I look forward to coming into Montreal again 1 day ,perhaps I will go to Moishes,maybe I will go with Angelo if his wife lets him. ,,true story,.","date":"2012-03-30 03:16:25"}
{"review_id":"oTfK6opDLRIBn-6NzsVBUg","user_id":"iJAggBw5LzKC3JtLu4i7dQ","business_id":"Pthe4qk5xh4n-ef-9bvMSg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My friend and I went to eat lunch last weekend and I was amazed to taste such fresh and traditional Thai food.  Flavors were excellent and food cooked to perfection.  Their was a very sweet Thai lady serving us.  She was extremely attentive and asked us several times if the flavor and spices were okay.  I give this restaurant a 5 star because it was truly a perfect experience!","date":"2017-05-13 13:46:48"}
{"review_id":"z4nMzGkNLo9q6hvflc4N_w","user_id":"gMRbRiQdam0Wgb_K6sR_sQ","business_id":"6pKR-h3KN7AwgGOOYBbE2A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Visited this place for the first time today on a rainy Sunday afternoon. We were the only customers there, and had the pleasure of spending time chatting with Mandy. We were greeted by what must be the most cosy and homely cafe in Pittsburgh. It felt like I was walking into someone's home. The room was filled with local handmade items, freshly baked goods, and of course, an extensive tea room with every kind of tea you could want! All teas are blended in house, and they are working on using herbs grown in a community garden in Millvale in some blends! You can even sniff the tea that you want in little jars that are laid out. We spent more than an hour there relaxing, browsing through the many gifts, books, and other goodies, and enjoying our tea and cookies. They are a vegan cafe and usually have a creative food menu on weekdays. What an amazing spot in Millvale! Please visit and support this local business!","date":"2017-03-27 01:13:50"}
{"review_id":"0yrKmkzFsGY5fqRRAb2Y0w","user_id":"MWkAFgV73v3XGer74varrw","business_id":"Lg238Ittk3KO3lqHyBAcYA","stars":5.0,"useful":1,"funny":0,"cool":2,"text":"I took my parents to this location to get their drivers license renewed. We were able to get a number quickly because my dad is handicapped. We got forms to fill out and they said our number would get called in 10 minutes. Within 2 minutes of sitting down our number was called but unfortunately my parents didn't have their forms filled out. However the lady was nice and said to just fill it out and she will call us after she is done with the next person. That next person took forever but then she called us back up about 15-20 min later. Her name is Agnes. She is from Austria and has a strong accent. She was very very nice and friendly, smiling and talking the entire time with us about other things while she was processing the renewals. She is probably the nicest person I have dealt with at a DMV. We were done within an hour which isn't bad at all.","date":"2015-08-30 15:14:20"}
{"review_id":"oqoiddALumWolkasD5u2pg","user_id":"1MpcnGOWWloEBB6gEj5rrw","business_id":"tInrGCzll4k9hF34Ye1rvQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We ate at chima for valentines weekend. The service was great, a nice salad bar, and great food. I have been to comparable Brazilian places that weren't quite as pricey, but this is a nice dinner for a special occasion.","date":"2017-02-19 12:54:47"}
{"review_id":"UhFJBRfk6e6pMVNLet3tkQ","user_id":"-bwJZB1PL3rATVDlWcZ63Q","business_id":"dn59ZYm5fHOZwSHBtjTo9A","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We were with our friends when they adopted a puppy and we were impressed! The employees were super helpful and walked them around to find what they would need. When we adopt, we will go here!","date":"2017-05-13 03:58:56"}
{"review_id":"N5EJSy7_PFqBw-1ybNNDLw","user_id":"krWmVP2kIEIxP-H9RnOURg","business_id":"KPqcax8EHZiPyJ0ZzfaOjg","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"We had an emergency plumbing issue and our home warranty couldn't find us anyone to come on a Sunday. We had no water and couldn't shower, etc. I looked up plumbers on Yelp who were open today and they popped up with 5 stars! I called and they answered right away! They were to our house within 30 mins too. Landon and Manuel were very nice and did a fantastic job explaining everything. I would recommend them again 100%! Thanks guys!","date":"2016-03-07 00:01:12"}
{"review_id":"YP1IyJ9jjIlZMxv1En94Wg","user_id":"yIJsQx2oWsLQDVTBuqaGsQ","business_id":"-fiUXzkxRfbHY9TKWwuptw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This is a fun place with a trendy atmosphere. It's one of the few places in town that allow you to mix and match beer flights at a fair price. The food is fun and tasty. I recommend the mussels, pizzas, and wings.","date":"2011-07-28 15:37:13"}
