{"review_id":"0aoePeeO8Qem6TDCnrJlHw","user_id":"FaWAb5TlzZj9k7-quO-3sg","business_id":"bCh7vrbbxSKx0mtZnOvQoQ","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Wow!  Everything is so fresh and pretty. It's almost not like going to the movies.  There's a patio and full service bar.  The staff is welcoming and friendly.  Loved it!","date":"2017-04-30 04:51:44"}
{"review_id":"IEhbUxP6qjQmvMHBTKsBJA","user_id":"HNKHkneWn0FC1O1I0KCKEw","business_id":"nCAqeub9ERwzSoQwGzr1QQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"AMC Westgate, it is really disappointing on how you defuse a bully!!!!\nSHAME ON YOU!!!!!!!!!!!!!!\n\nWe arrived 35minutes early for the movie, & after the movie started this man & his wife came & wanted us to move from our seats so he & his wife could sit there.\nWe said no!\nThe man started threatening us.\nI got security, explained the scenario, they came  & let me say.... They asked us to move so the other couple could sit there, & since we didn't, they were offered movie tickets for there inconvenience.\nThe guy sat next to my husband and kept shoving himself into his space of the seat, it was either leave or this guy getting hurt!\nManagement gave us a hard time on getting reimbursement......\nWE WERE NOT REIMBURSED OUR FULL AMOUNT!\nWe should have moved, so what that we got there early for a seat.\nIt was Unbelievable!\nSHAME ON YOU!","date":"2015-02-16 07:01:04"}
{"review_id":"lksNCbPZUb2eiKaHx8rG_A","user_id":"lgxCqDMnowyx1Q5fLdLPCA","business_id":"XIcq5zKaAkGSN6cIJzBKRQ","stars":4.0,"useful":2,"funny":2,"cool":1,"text":"when I'm in the mood for fake Chinese food this is the place to go.  Unfortunately they no longer serve pork so the char siu is no longer on the menu.  So disappointed about that.  i'm not sure why they no longer sell it because the employees don't seem to know themselves.  I do love the fact they offer free samples so you can see if you will like it before you order it.  I do wish the prices was a little cheaper but you can get 2 meals out of a 2 item combo.  Other than the no park, they seem to have good customer service and are very friendly which is a plus.","date":"2013-12-07 03:54:13"}
{"review_id":"MvJyEt2I-qFEr3rq2_Ojqw","user_id":"apqqR9bJe8uMcc4yXD_o_A","business_id":"2pzfPQ6-A3OL9yHhgWhuNg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This is my favorite McDonalds store in the local area.  It's clean, the staff is particularly nice and friendly, and the wifi is very fast.  There are electrical outlets in several locations if you want to work on your laptop.\n\nYou can purchase food at the counter, drive through, delivery (uber eats). So convenient!\n\nIf you want to save even more money, check out the McDonalds app. There are a half dozen coupons to get a free drink, fries or cone when you make any purchase and often have buy one get one free offers. Check out the overhead board for additional regular promotions as well.\n\nI help restaurants with their social media and online reputation and think the 2-stars they currently have is totally undeserved.","date":"2017-12-29 13:49:58"}
{"review_id":"e3R37IGpvCvqWt0eWlhnbQ","user_id":"2lmBAfQWAI06ziEfN5NkCQ","business_id":"OGNv45615-ni06lUvkV62w","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"I originally came in here in January for a dislocated big toe that happened over the weekend and have been here a total of 6 times at $35 co-pay each time. Every time you show up for your appointment, expect to wait 15 plus minutes in the lobby and another 5-10 minutes to see the Doctor once you get a room. My last 3 appointments I see the Dr probably a total of 5 minutes each time. I'm satisfied with the initial care in resetting my toe, but these last few appointments have been a waste of money and time.\n\nAfter my sixth visit, the Dr also recommended a customized orthotic to fix the way I walk, I honestly didnt think I have a problem walking, but the custom orthotic cost $550 that was not covered by my insurance. Needless to say, I passed. \n\nP.S. My brother also went there for a fractured ankle, after his surgery procedure and after many follow up visits, the doctor also recommended orthotics to him as well.","date":"2015-06-08 18:29:38"}
{"review_id":"RfAo_T04NWqvOOLdhkdblg","user_id":"jFHLmE5S3PJYca2_3kU5cw","business_id":"KfuNW67ZM3jegHT4txnHbg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Small casual atmosphere. EXCELLENT food. Best Thai food in the greater Phoenix area. The wonton soup is fantastic!!! I had a spicy beef dish with peppers and onions requested spicy and it was fantastic.","date":"2011-06-25 11:32:31"}
{"review_id":"tiaZpJMVv3qEkUXxWo68ig","user_id":"g5JS5EUIOnIzkz3clvTfnQ","business_id":"gwd1W_0Mgzqo3QxgXrt16Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Stopped by here to grab lunch with some colleagues and it was awesome! The patio area outdoors is just delightful and cozy and it was a perfect day to eat outside. \n\nI ordered the Reuben Feffer (I think) which was an organic brown rice bowl with lettuce, black beans, cheese, and steak. It was delicious... I loved it. I would definitely come back and have it again. \n\nGreat spot for lunch!","date":"2015-06-08 17:34:48"}
{"review_id":"YLoFAtbpqoHf5OJg8negSQ","user_id":"K0ZArBXsfOgG0b7eK-cbyA","business_id":"FBd6q_qzEFixvhV3KdzvJw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Love the fact that there is no cover charge to play, just purchase of a drink\/food item. Get the lavender london fog and the japanese popcorn! great space with friendly servers and a ton of new games with legible instructions. Will be back!","date":"2016-02-23 18:45:57"}
{"review_id":"ymootDvsVAbov6-JYWkpBQ","user_id":"_xM0dU_rR4NLkCcS9Eu44A","business_id":"LeuGZImVz_IG1e-SMYTSXw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Got on the guestlist via a promoter. Went to another club before coming here. Getting in took awhile since we got there at around 12 AM or so. They made us (4 girls) wait in line for about 40 minutes and almost made us pay (saying that guest lits had closed), but I made a fuss about having to wait so they let us in comped.\n\nThe place is pretty. That night was DJ Aoki, very good. The place indoors has benches and stuff but also extends to and outside patio as well (with heat lamps!).\n\nThe drinks were not very strong but pricey (Not that I had to pay for them, so it's all fine in my boat). It was my first time drinking Fiji water too! Crowd is a bit older. Overall had a fun time at this small lounge\/club.","date":"2010-08-21 04:06:59"}
{"review_id":"iji9FL-bHoU3RDhhERHXmg","user_id":"B9TzKVHf7P9ePODjMaVfmw","business_id":"SqoscicPMzL5mJC5JNaD0w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Stand-out seasonal menu, great food, and great service.  Local beer menu is a plus.  House-made charcuterie and satisfying portions.  Will be back.","date":"2016-04-23 01:59:24"}
{"review_id":"EAT9S1znJxyP5UnjR6en6w","user_id":"xawNFay_E0_cDlm8SVCzuw","business_id":"7wHLFohwCw8l6WS-feLjeg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I decided to check out this place with a friend based off of a recommendation and i'm so glad I follow through with it! This is one of my new favorite spots. Totally worth the drive across town. Happy hour is from 5pm-6pm and the selection is great. We ordered the Calamari, Amberjake Ponzu Salsa w\/ Sweet Potato Chips, Blue Crab Hush Puppies, and the Spicy Tuna TarTar w\/ Waffle Fries. Everything was flavorful. Everything was delicious! Reasonable prices, delicious food, chill atmosphere and friendly employees. Cannot wait to go back!","date":"2017-02-19 07:07:58"}
{"review_id":"dPg0TXk24Ut-CeFom0p8WA","user_id":"d9wXPl_im8nRhFy0ooo8_g","business_id":"0fW77t7I2673JY27JWC-yw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Just ate at Moreno's for the first time. First they brought out fresh chips that are thin and warm and they come with bean dip, red and green salsa that are all good. I had a chicken tostada and a fish taco. The fish taco was served on two fresh corn tortillas and the sauce was full of flavor! Loved them both. Also at our table we had a Moreno's chicken burrito with green salsa and it was very good but the green salsa was a little spicey. We will make this a regular spot for good food at a reasonable price.","date":"2017-01-14 21:40:09"}
{"review_id":"tAk_OZmecrIL3pJfjHiy_w","user_id":"sK-Yd-UScvLjAHRfTDaRDw","business_id":"jo4KmAqlZ7vxjHIP7IIkAw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great service, good food and reasonable prices. The lamb shank was excellent. I would recommend if in the area.","date":"2015-04-28 18:39:45"}
{"review_id":"iHvrpPfff-EaDiHEE118PQ","user_id":"WtXa80CoDZFpOwL54T--bw","business_id":"EFGnaa8HtGpplOPCaJgL1w","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Although this location is in a busy spot, it's a cute little place. You have to ring the doorbell to get in. I guess because of homeless. The pharmacist is extremely nice and so was the gal who helped me. They have free delivery too. The only reason I couldn't give 5 stars is because they don't have an automated refill line to request refills. Other than that, not a bad pharmacy!","date":"2018-09-03 01:27:30"}
{"review_id":"-5pP4o7XUpFWL2Kb9u5B_A","user_id":"SIpBqzGhRM7T5cDFiuIryg","business_id":"SZEFE5hL7aN5nM-A44iPwQ","stars":5.0,"useful":98,"funny":75,"cool":93,"text":"I stopped by at Prime tonight after a grueling 9 hour business meeting.  When I arrived, I was seated at a great table close to the window where I could see the Bellagio Fountain Show in the background.  After I ordered my Whiskey, I had a chance to truly appreciate the beauty of this restaurant.  The decor is very upscale, romantic and very ornate.  A great place for a power business dinner or a date.\n\nFor dinner, I ordered the Butternut Squash Soup, Bone-in Rib-eye Steak, Potato Gnocchi and their Banana Tart for desert.\n\nMy entire meal was amazing.  Each dish was perfectly prepared and super yummy!  \nIf you want a great steak dinner in one of Las Vegas' most romantic places, come to the Prime!\n\nThe food, fountain show and sexy decor rocks!!","date":"2013-10-24 06:28:58"}
{"review_id":"HRWvZeNDL9mHr8yeICQCjw","user_id":"xHMq2fBArXBp881TVlRt5g","business_id":"tvYID0arhN-shKGUrC1Wsg","stars":5.0,"useful":2,"funny":0,"cool":2,"text":"This place has ruined  my view of all other Brazilian restaurants that I thought where amazing. Where do I begin the all you can eat food, I'm about to burst as I write this. All I can say for the food is I made one trip to the galleria, after that I was at the table. Why? The frequency of the carvers bringing meat to my table was ridiculously fast,How fast? as I was finishing my meat and trying to eat my side dish  I was being offered more meat. I literally never had an empty plate from the time I sat down until I finally tapped out to sit and enjoy my drink and the entertainment. The entertainment is one of the things about this restaurant that will make others seem bland. From the guitarist, to the capoeira fighters this place is an over all experience, and one I won't soon forget.","date":"2018-01-21 05:35:07"}
{"review_id":"2x8Sc-cqlupfrPxrte4yow","user_id":"rKPb9VJlmHhOd4ciAnFD7Q","business_id":"phJAiadcWTtERPmiDrQfBQ","stars":1.0,"useful":6,"funny":0,"cool":0,"text":"I took my car to Ganley Lincoln service department to try and find out why horrible gasoline\/raw gas odor were entering the cabin of my car, likely coming in through the HVAC system.  I suspected a likely fuel leak somewhere near the firewall but could not locate one.   I took my car to Ganley  Lincoln Service Dept. and paid the $129 diagnostic fee (steep!).  Service advisor Beth P called to inform that I needed $1900 in repairs as the exhaust manifold gaskets were leaking and had a bad seal. Yikes!!   Keep in mind this is a 2007 Lincoln Town Town in meticulous condition, always garaged, and only 65,000 miles and has barely been driving in winter.\n\n I was quoted $500 a side for new exhaust manifolds and bolts at another service facility.  However,  the mechanic of 20 years said he has never seen a town car or crown vic needing new exhaust manifolds at 65,000 miles.   He did some further research and discovered the left rear cylinder spark plug was not seated properly and only needed to be rethreaded.  Total cost was $75 for retap and INCLUDED his diagnostic time as well.   Problem was fixed!!!\n\nI know enough about engines as well to realize that $1900 sounded sky high and didn't think the new manifolds solution sounded correct.  Good thing I went with my gut and got a second opinion.   I would have been out $2000 in repairs and the problem would not have been corrected!   Stay away from this service department.   Far far away... unless you don't mind paying $2000 for repairs you don't need!","date":"2016-11-09 02:43:17"}
{"review_id":"bo8QjFLsZ_K5iONg149GYw","user_id":"MSqNBOR2SHnEjAktYg4qIQ","business_id":"dfHA5n6e3f58nMCNHt589Q","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Mediocre Lao food. I thought it was kinda odd when the hostess\/waitress handed us the menus and told us to seat ourselves. Other than that she was very nice. We ordered sticky rice, paradise beef, pad Lao, BBQ pork, and chicken wings. The only thing worth raving about was the padlao. Noodles were a little firm for my liking but flavor was on point. I told her just a little spicy and it was just that. Everything else is not even worth mentioning. Sticky rice was brought out cold. I wouldn't go back.","date":"2015-07-03 22:03:10"}
{"review_id":"c3KNv7keMTeBg-NFeFqtGA","user_id":"hRxyYgI7POX5C0UIPKo3Dw","business_id":"HZRTSC7R0JWThNTCqVLnsQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The food was delicious and the overall experience was great! I can't wait to go back!!","date":"2013-11-14 02:07:54"}
{"review_id":"aKgjXfdh2t2YpFyuO40YkQ","user_id":"CvYCxl4F4u0L2Ko4EsHywA","business_id":"8jHLEXfoy3Q9TdvJYvtWvg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Waited an hour just to get someone to cook at my table and there was one other party, last couple times I have been here service was not good, I hope management can get it together sometime soon.","date":"2018-03-15 19:18:25"}
{"review_id":"BTq7ZjggdNPlnYG8BlPBsQ","user_id":"nnbG-XPXHeomn7KtHItmHg","business_id":"ibkwcLZwaJ1pnPJVaI_-uA","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Been there three times, and have tried out different dishes.\n\nFirst time i got pad thai, omg, that food was sooooooooooo greasy and salty, but i swore that i was not going back there again. \n\nBut my coworker wants to go there for lunch and said the curry was good, so i went back again. This time i had the green curry with beef, it was pretty decent, flavorful yet not too strong. however, the veggie inside is a little bit more chewy that i would have prefer.\n\nThen we went back again for lunch, this time i had the noodles, ca'n't remember what it is called. it is those very thin and transparent one. It was really good. i ordered 4\/5 spiciness, but still not too spicy. \n\nSo basically it might be a hit or a miss, and it is not super spicy so if you are looking for that you might be disappointed;. overall a decent lunch spot.","date":"2013-05-28 21:59:36"}
{"review_id":"MVf93CBaR0xzQBLfalTB8w","user_id":"wnFWoQ63F9-ohUQ-C0AeIw","business_id":"1bXC3NewRsBL1gecvGXA-g","stars":3.0,"useful":1,"funny":1,"cool":0,"text":"3 stars as a restaurant 4 as a bar.\n\nBTW:I apologize for my lackluster previous review.  When I first discovered yelp I went for quantity, not quality.\n\nSo this place used to be Jack Straw's which was probably THE best music venue the the town has ever \"scene\".  Well its not that place anymore.  Its still worth visiting and has more than just a bar or restaurant vibe to it.  On nice sunny days the deck is beautiful.\n\nWe had a going away party for a friend today.  We made reservations for 30 for Sunday brunch.  Only place in town with a mimosa deal that would take a crowd like us.  You would think that they would maybe tell a couple of extra servers to come in at least for the hour or 2 we were there.  We had 2 servers for our group and they also had other tables.  They did well, but felt I pretty bad for the other tables.\n\nThe brunch menu was large, but mostly it was just slight variations on eggs and meat with some major exceptions.  It was a cheaply made paper menu, but the one thing that stood out \"the hangover\" which was a breakfast sandwich on a doughnut.  But, they don't serve it anymore, even though it was on this cheaply made menu.  I tasted many peoples dishes, they were good but over priced.  Everything was roughly $9 except for biscuits and gravy and french toast.  Although, the $2 mimosa's and $4 bloody mary's is hard to beat.\n\nAll in all, this place has a history that it doesn't live up to.  Its good, but plenty of other places to go.\n\nSide notes:Parking lot sucks, but its made up by the fact that they have SKEEBALL!!!!!!!!!!","date":"2011-02-14 00:21:55"}
{"review_id":"94paBl57gYsLlKxKZQp9Tw","user_id":"5EN5_vGCRsWkP22JbFlZvw","business_id":"IhNASEZ3XnBHmuuVnWdIwA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I'm from CA where we have many boba joints, but this one is my favorite. My 3rd time to this place and I've been to the Eastern location once. Since I discovered Brew Tea, I always pay a visit very time I'm in Vegas. \n\nService: Fantastic. The staff here are very friendly and accommodating, even when they are busy. If something isn't right about your order, let them know and they'll fix it in a heartbeat, hassle free. They do it with a smile and apologize profusely. I appreciate businesses that own up to their mistakes, and make every effort to make it right. \n\nDrinks: The Brew Milk tea with grass jelly is what I normally get. Delicious! I have tried Jasmine milk tea, and that's great as well. My other half got the Jasmine Green tea and he liked it. Overall, great!\n\nCrepes: I've had both the classic and berry lovers with whipped cream and green tea. So tasty, I love it! \n\nWill I Return? Definitely \n\nDo I Recommend? Absolutely","date":"2018-01-21 05:59:59"}
{"review_id":"oc7KfedeKJ9FGqAC3wpVOQ","user_id":"uyAz_YWYQ2DIVWF2O2erLQ","business_id":"4K5NUsinIgtq-yuxdp2HdA","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Don't pass this place by.  Got the grilled shrimp taco and it was spicy and the right kind of tangy.  They also put feta in it which I never would have thought of for tacos but it worked!  Cute atmosphere in the heart of the mill street district.","date":"2014-04-19 14:25:09"}
{"review_id":"Ly50swlXYOaUT1tpEng5Dw","user_id":"gCqdvoZoECTwk6clyR_ysQ","business_id":"LPhFORzrfa5_c6o2YXLBUA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Sadly disappointed on my last visit. We sat at  rooftop bar & service was terrible except for one waitress. Wish I had gotten her name because she knew exactly how to take care of her customers!  \n\nFirst, took forever for the waitress to even take our orders. Then, when the food came over (after we asked for it because it took too long) waitress was in a hurry to put down our plates that she spilled all the drinks!  Water & other drinks soaked our clothes, phone, and purse. The waitress ran off quickly to get towels & came to clean up table. Never once asked us or gave us towels to dry...other customers had to until we asked her. Mind you no apology for the spill. The manager even came over to clean up with no apology but rather cracked jokes!  Moved to a new table & she quickly drops off more drinks (on the house) & almost spilled them all on us. Thankfully the new waitress took care of us.  I mentioned our meal should be on the house, when  manager comes over to say they can do the drinks only. After all, it was only water!!  The nerve!! We had to tell him it was drinks other than water. Poor customer service from manager and waitress.  Had to ask to comp dessert. Not recommending to anyone!","date":"2016-05-31 03:49:42"}
{"review_id":"ClHoA5DGRovnfgSW5tldLQ","user_id":"m6N_0OYueQi8UuilO-qABg","business_id":"bM1upMzv7Xl-qElyxp0OKA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Worst place I've ever been , they don't care at all about you. It is badly run and badly organized, just terrible truly terrible","date":"2018-01-21 04:41:15"}
{"review_id":"b0WEUNjDcN5cMTDcicemcQ","user_id":"uPkCD4YtxhibudR2yo-YZQ","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"Okay, we all know this restaurant is a love child of the most celebrated chef in America, Thomas Keller.  It is expensive, but not more expensive than the other upscale restaurants in the Palazzo\/Venetian complex.  We also know this is Mr. Keller's \"bistro\" play, it has been much documented.  And I love French bistro food, my favorite kind on earth.  So 2 stars?  Here's why:\n\nService: At these prices you expect excellent service.  We had two tables of 8 each, next to each other, and all I can say is that the service was no better than what you would hope to receive at a Chili's.  Timing was off, smiles were rare, it took forever to deliver a glass of cranberry juice to the one person not drinking wine.  Clean-up was either too early or too late.  Just a mess.  Unacceptable at a restaurant of this rep.\n\nFood:  Yes, pommes frites are a staple of bistros, and Bouchon is known for theirs, but the volume of fries was overwhelming.  At the end of the meal we all sat looking around and laughing at the endless piles of frites that nobody could finish.  I had a flatiron steak, asked for it medium rare, it arrived well done.  I could have sent it back, but given the service I didn't want to chance it, so chewed (and chewed and chewed) it down.  Steak quality was mediocre.  Had a endive\/watercress salad that truly was nothing special.  The walnut vinaigrette did nothing to enhance the bitter endive, think it made it worse.  Ostensibly there was some Roquefort cheese in the salad, but about 4 little nibbles, added nothing to the rest of the salad - disintegrated.  I know times are tight, but this is a double digit priced salad, c'mon.  Nobody raved about their entree, in fact, I think people were expecting something special and kind of stared at what was delivered.\n\nWine:  A pretty fair list, and while not reasonably priced, I've seen more outrageous pricing elsewhere.  But it was predictable, mainly French, with a nice representation from the major regions, but nothing unique or intriguing.  Very safe list.  If this is a bistro there should be some more fun, and less pricey, bistro-y choices like Cru Bourgeois from Bordeaux, a longer list of Provencal wines, some unique choices from Cali.  I could have put this list together in my sleep, and the sommelier and wine service was pretty sleepy and sloppy as well.\n\nI've been here for breakfast\/brunch, and I guess this is their speciality, it was super, a 4 or maybe 5 star breakfast, love that.  But for dinner?  A disappointment.  This restaurant needs an overhaul.","date":"2009-05-21 14:42:13"}
{"review_id":"kVomD4qUKa5wcfkXGtq8rA","user_id":"cX33jHi65SWD9KmDpA4VpA","business_id":"7sb2FYLS2sejZKxRYF9mtg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"The best sushi bar in the United states the service was amazing they where going to close and still late us in too have a nice dinner at the bar where we sitting the cooks where great kind and happy and made our dinner great go here 100%","date":"2015-01-04 03:58:42"}
{"review_id":"7n6I5vKrjCpKLN2fiO_RdA","user_id":"kvtutnLD2al2-Kk8K7SNmA","business_id":"EnSwLkFQUy1QHgTA0vSbEQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Now closer to where I live! Might be a problem for me. Just opened 9\/26. I picked up dinner and lunch for work yesterday. Salmon tacos w salad. Lunch I got brown rice with garlic steak. Comes with a side salad. Quick and easy. Great quality. Meal prep available and they deliver too.","date":"2016-09-30 20:22:33"}
{"review_id":"yqZsA08aY7Vl0NqBOJrddw","user_id":"ebMJ9QZj8WhjbR5DrCHyZQ","business_id":"AsgwKCJqyBqdiHdEBqeq3w","stars":4.0,"useful":3,"funny":7,"cool":4,"text":"There is an unfortunate amount of hate-on going for ol' Sam's, so I've decided to come to their (honest) rescue. First, let me give you some context:\n\n1. This is not the place to come for authentic Chinese cuisine. Abort mission if that's your goal. Go somewhere with a name that you can barely understand.\n\n2. This is not the place to come for personalized service and attention, especially not at 2am on a weekend. You will be treated like what you probably are - a starving drunk person just as likely to skip out on your bill as you are to vomit on their floor. \n\nSeriously - these folks put up with a lot. A LOT. Can you imagine taking care of hundreds of drunken morons every single night for the entire weekend? It'd be like babysitting 100 children with ADHD who are also carrying loaded pistols and have an undeniable urge to hump on your white tablecloths. So I chose to cut them some slack.\n\n3. I liken this to being the Denny's of Chinese food. It is greasy, unhealthy and oh-so-delicious. You love it while your eating it. You tell yourself it's the greatest meal you've ever had in your life and you want to marry it.\n\nBut in 15 minutes it's going to sit like a stone in your stomach and you will question every ounce of your judgment. If you can survive this brief period of remorse, your overall experience will come out on the positive.\n\n4. On a diet? Yeah, no. Not for you.\n\nYes, I too have been part of the raucous crowd that convenes here late at night after a night out in the Beltline. I have slithered their noodles down my throat and I have savored the juices of their finest ginger beef. I literally can't imagine coming here for a sit down meal at any other time.\n\nI've also come here for the lunch buffet - as take out. The place isn't quite as fun when the disco ball isn't a-glowin'. Now if you're a student, a cheapskate or a person in need of large quantities of food (as much as you can physically force into a styrofoam container) - this place is a great option come lunchtime. Just make sure you bring CASH. They get a bit ornery if you try to pay with Debit\/Credit.\n\nPro tip: Stuff as much as you can into your styrofoam container and just hold it shut, even if it won't close naturally. You might get dirty looks, but I've never been yelled at - yet. Mmmmm, 5 pounds of Calgary's finest imitation Asian cuisine. \n\nIs 4 stars probably pushing it? Yes. If I could I'd give them a 3.5. But as someone else mentioned, Calgary owes these fine folks a bit of thanks for giving us an option other than late night pizza or microwaved Alphaghetti.","date":"2011-11-30 07:11:58"}
{"review_id":"Wu9jZNaNijaoP6mP9Z5WSA","user_id":"whqfWVBj4x5EDboIVDOymQ","business_id":"rYziPPEILDXJ_F5uKR--YQ","stars":4.0,"useful":13,"funny":9,"cool":10,"text":"Holy god, this place is delish. But if you're stuffing your face with deep fried, hot toddy S.Indian goodness, tables in full 95 degree sunlight don't work as seating - an umbrella, perhaps, would make this an easier lunchtime sell.\n\nFav? Lilva Katchori - tiny nuggets of buckwheat groats and mustard seeds, turmeric, curry leaves, covered in pastry and fried. Crunchy, textural, rad. Comes with their house hot tamarind sauce - a sweet, gradually crescendoing spice experience, thin, and everything tastes better dipped in it.\n\nGot some sort of sandwich, let's go with curry and lime pickle and chickpea spread - and damn, it was awesome. A slider by way of Punjab. Killer.\n\nPrices are low to mid - and there are things being made here that you can't get anywhere else, plus the classics are fab - samosas, two huuuuge pastry-covered piles of fennel seed, potato, unidentifiable delish, for 3 bucks. A garlicy, smoky dal, multiple legumes, a cup or so of Paneer Masala, a perfect amount of rice, papadum, and thin, pancake-like Naan, for 7. Sweet.","date":"2011-05-27 15:16:31"}
{"review_id":"HKkmd1Yrld6lXtOTa2r02w","user_id":"-4G_Jo6EKowmALu-_S-p4Q","business_id":"QARy4UUOQogMjDp9jP-YVg","stars":4.0,"useful":1,"funny":1,"cool":1,"text":"Hubby and I shared the pork belly and the short rib small plates. I Loved the Pork belly. We also ordered 2 desserts. The alexis michelle terrine and the ranndy jackson presents: \"the sundae\". Both were really good but OMG the sundae was so delicious the bacon caramel popcorn was a unique idea and was such a great addition to the dish.","date":"2013-10-15 17:42:34"}
