{"review_id":"XhPaA9GYvpzBsMDi6hOTLA","user_id":"-9BOs3rdWFMot0tlky983Q","business_id":"mDoLWEOFmxcQ5TAPqxoJLg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Went here to grub but was disappointed. The Baja chicken rolls were flavorless and the fried pickles were rock hard salt licks. Even their ranch dressing was a solid. lump.Never eating here again.","date":"2018-02-23 22:16:55"}
{"review_id":"s7BiEw3Mx--nwffG74LTOw","user_id":"tLQjrTvidY_0HGtzHemhSA","business_id":"Zsz_dLOEwihJHvMTK9a8Vg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This is a place you can drive by 1,000 times and not think twice but, take our advice and pull in! It is completely worth it! The staff was super nice and the food is totally different than what most of Charlotte offers! Using your hands for utensils and having homemade honey wine! Great experience that will keep us going back!","date":"2015-09-24 00:17:25"}
{"review_id":"3xbM3MmFHS5tWj4XkgEUQw","user_id":"fVOZsa26aYUAos3ACZo7iw","business_id":"PtwW1Hwme8Y0wy54zNr8Xw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Good for breakfast,  they have a dog friendly patio, kids liked the mickey mouse pancake, the breakfast potatoes are delightful and the atm5is nice, they have a train that runs along a track through out the restaurant that really entertained the kids","date":"2017-01-27 19:33:14"}
{"review_id":"pypVz2gUfoy92zO5eJfRAg","user_id":"rcZmGvLPPnzgPLd-JQqf8A","business_id":"ZFyJ83LJkkO1dP82kzXKNg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"There's just not much that can go wrong with deep fried chicken! The meat fell apart so easily, and it was so tender and juicy. The outside was really flavorful and crunchy, and the chicken was extremely hot, fresh out of the fryer. \n\nDAT SAUCE THO! Dip it, drizzle it, drench it, bath it, slurp it, lick it, either way it's D-E-L-I-C-I-O-U-S.\n\nTexas Toast! I was thinking that this would be like french toast when I heard about it, but it's more like a really yummy dinner roll. Coming back to Raising Cane's again.","date":"2013-06-24 17:14:49"}
{"review_id":"7bepcs7wkhYhzQ9PtyFDMQ","user_id":"edfPTK-mfKMyPgIPelk1Ew","business_id":"rLPcsnWnDWAOjUknKQG9MQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I visited PMI Green Valley today for an annual mammogram. From the front desk to the mammogram itself, the staff at PMI is absolutely wonderful. My tech (Emma) was patient, informative, and best of all, very personable and funny. I've had several positive experiences with this imaging center in the past but after today's visit, I can't recommend this imaging center high enough.","date":"2016-09-30 21:45:41"}
{"review_id":"umbCJEE9ouFhmysIdxBo2g","user_id":"igj3Yoli6tht8_1tRhbyEw","business_id":"-8F04F54iDT6VgWPCgybug","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Beautiful and functional space, good food and drinks, friendly service. Highly recommend!","date":"2017-09-20 16:23:47"}
{"review_id":"mp_Ecq6SyD59v7I-S-D_8g","user_id":"BIWnH3yjzrcdgw5ADX9nvw","business_id":"uR2GNRdrkY2KeYggp4bCUg","stars":3.0,"useful":3,"funny":0,"cool":0,"text":"This is a diner. On a Tuesday night between 6 to 730 this place was completely empty except for our table. We were a party of 10. Our server was very friendly. The service was good. This food is basically diner food, mainly fried food and fast food. I had the fruit plate which was very vague, came with yogurt and granola which was good. My husband had the chili cheese dog. The hotdog was a foot-long. However no matter how big a hotdog is, unless it's some kind of gourmet sandwich at a fancy place, I expect to pay less than the $22 this place charges. The menu is extensive, and I get that this is vegas, it was still way too pricy. The Gordon Ramsay restaurant has cheaper burgers! Anyway, unless you just want a quick bite or can't find reservations anywhere else, i would skip this place.","date":"2017-01-27 21:04:04"}
{"review_id":"fXYzBWfWrimOl9jvMHrNig","user_id":"hmrBmVuneoNOynp331zCVw","business_id":"Xs2iTWxbczvfEapAFH3cyw","stars":5.0,"useful":2,"funny":0,"cool":3,"text":"perk is great!  the food is really good and comes out fast.  the staff is the friendliest around.  there is an einstein bagel's a few doors down - why go there? honestly - i wish more people in the community supported locally owned places like this instead of chains. the money stays right here in the community instead of being shipped out of state - and god knows this state needs jobs and money!  \n\ni'd highly recommend this restaurant.","date":"2011-07-28 14:29:09"}
{"review_id":"xoZRgeZ0Lo32Hd3BLzJHtw","user_id":"lOOx1rNylC1g-Mq_hpajQA","business_id":"NEVA0IYbawceL6kz5v5DAw","stars":4.0,"useful":2,"funny":2,"cool":2,"text":"In my view, in the US there are generally three types of Sushi places.  The very small, packed place that has the run of the mill sushi, the convert belt sushi, or the fancy schmancy type with renamed sushi rolls and a few not so common.   \n\nIn my view Kofusion is, at least this location is the fancy schmancy type and the prices to go with it.   Nonetheless they have some unique rolls and have more than just sushi.    So if you have friends who are adverse to raw seafood, they'll be able to find items such as hibachi chicken or beef, along with rice or noodle dishes.   \n\nThe service was, just okay.  For as few people there were at the time we visited, I felt the service could have been far better.  My suspicion is the kid was nursing a hangover, but he was friendly and he did get our order right.   \n\nAs with most sushi places, when the two platters of sushi rolls came to the table they presented well and certainly there was pride in the work.   The rolls were nice and tight and didn't fall apart from plate to mouth.  The fish, especially the salmon was very fresh and I liked the special sauce used on the spicy tuna.    \n\nI would certainly come back here again, although if you've not been to the Mongolian place just up the road, I would suggest giving that a try too.  Both places are excellent.  \n\nOne other point.  If you happen to be over by the collage, there is a small Kofusion place by the Music hall.  I've not been there myself, but just thought I'd mention it so you didn't trek through congested roads.","date":"2016-08-12 21:56:17"}
{"review_id":"S7MO2mdJVtiKeNghkGX1uQ","user_id":"cajlPtBnHaI06Tq7iuovyA","business_id":"qFAw6wHMMcr4ctF-ZdGhEA","stars":4.0,"useful":12,"funny":10,"cool":12,"text":"Outstanding Italian food in the Venetian Mall! If you're lucky enough to be in Vegas and at the Venetian, don't skip this very popular spot in the Mall. The atmosphere on the patio has the urban street scene feel with all the mall customers walking by; lot's of hustle and bustle but it's not distracting like having a slot machine ringing in your ear. It was loud, boisterous... but nice! Very cool joint that I can't wait to visit again.\n\nWHEN YOU GO- Ask for Sergio and wait if you have to. The guy's worth it! DO NOT skip the Filet Mignon Meatballs. They're as good as they sound. Lobster Ravioli, Chicken Parm and lobster ravioli are winners as well.\n\nVery nice spot that is from now on in my regular Las Vegas resto rotation!","date":"2015-05-26 17:52:41"}
{"review_id":"spxz0UQXza5j4nCaiyskEA","user_id":"cPg9sxzlw_ChBEyJENRmXQ","business_id":"BP5vZh8HTUHKKG5Z_2sIEw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Wow this place was super nice and fancy. A lot of people stay here for their work. Everything feels very new, modern, clean, and has elegant interior design. \n\nThe workers here are very friendly and always tend to your needs. All of the furniture and decorations have a very minimalist feel to them. Which is probably why I'm so drawn to this hotel. I've only had the breakfast here and it's pretty good. I only wished we got bigger cups and plates. Not a deal breaker though. \n\nThe room I stayed at was very spacious, and big. We had 2 full size beds, a couch, a desk, and a big bathroom. The rooms also had a minimalist fee to them. The beds were so comfy. Once you lay down, you sink in. I slept so well there. The desk was kind of small however, and it only came with 1 chair. This kind of sucked because there were 3 people in my room and we each had to do some work in our room. The bathroom was amazing. It had a glass shower, and 2 sinks that were aesthetic af. \n\nWe had a huge window that spanned the whole height and width of the room. It was a nice view and we could see the beautiful Skyline. \n\nI would definitely stay here next time I'm in town.","date":"2017-08-16 04:39:32"}
{"review_id":"OGMEpUsAmjcWTWRPWYi8tg","user_id":"6a68uJTE0vCNdHfDGv2uyw","business_id":"yvPkA1ZXz1M59G6e64jZGw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Awful Awful Awful!!! I made an appointment to get my hair colored and the front desk women recommended a specific stylist based on what I wanted. I arrived with a photo of the type of color I wanted. Also described.... Darker color at roots, golden color towards bottom no stripes. What I received 2 hours later was ashy dull highlights all over the top of my head, the bottoms of my hair looked so broken and dead, when looking at back of head there were 2 dark stripes down length of my hair that went from top of head to bottom which is very long to my mid back. I was embarrassed and just wanted to leave salon ASAP. The following day I found a new salon to fix my hair. They described my hair as looking like cousin it. Every stylist in the salon was astonished as to what was done to my hair. They actually stayed open late and arrived to their Christmas party late in order to fix the mess made of my hair.  The stylist took photos of before and after photos of my hair to send back to etch to ask for refund. I did this the following week as I had a lot going on with Christmas and family in town. I spoke with Emma the salon manager at etch... She informed me that they stand by their work and since she didn't see my hair in person, and since I waited a week they would not be refunding my money. I will never ever go to this salon. I strongly suggest that you don't try this salon not only do to the poor work performed but also do to the incredibly poor customer service.  I spent $200 to ruin my hair at etch...and another $200 to get it color corrected at snap dragon salon.  Thank goodness for snap dragon!! They saved me!!","date":"2013-12-28 22:05:55"}
{"review_id":"JJoCqgiSdJ4HudyAWML8mQ","user_id":"LYTMPdWWXA9lhimymvmd1w","business_id":"xJzJpTYC_1k_EE0AWTOPXw","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"Prices are in line with other theaters for tickets food and drinks, I like the concession set up.  The theater seats are designed like a medieval torture device.  I have gone her twice and had to visit my chiropractor the next day.  Good theater sound and close to home to bad the chairs are so terrible.","date":"2014-02-05 19:40:30"}
{"review_id":"9Y8r1SnXD-6UWUCx4_OS9g","user_id":"WfaukdRoD7hWVa6541nZAg","business_id":"Xfod0UWr_9B-TOM6qxVIwQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"First time I came here, it was pretty empty. Not that it's a bad thing, the food actually came out better. Then today, I came again. Except it was busier. The food- (BBQ Beef) came out oily and kind of gross. They also mixed up my father's order and gave it to someone else. If you come when the restraint is empty, you get better food and service.","date":"2016-06-22 20:21:36"}
{"review_id":"oie7YcixA2wR-96Tka-PEw","user_id":"Uv1gSdXPrHimlGHDkyDXKQ","business_id":"qCSWNJ2ClIaO5XTfzsiYFA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great Mexican at a great price. Margaritas are awesome too. Servers are polite and service is quick. This is our go-to place for Mexican around the gaston county area.","date":"2014-06-28 00:11:44"}
{"review_id":"f1au_H1ZgwWoXiCXBBGglw","user_id":"4LaykoNBTcxGgNnx1Mp3Hg","business_id":"miQ3j6ts2p6WUEs3XjSEOQ","stars":2.0,"useful":1,"funny":1,"cool":1,"text":"Met a friend for lunch today as he wanted to try this place. We sat inside the restaurant as opposed to the food court. The server was very attentive and got our meals out quickly. \n\nThe bean soup was okay, nothing special with very few beans. The laffa bread left on the table was very tasty.\n\nInterestingly and strange is that we were told that they didn't have any chef salads with only vegetables but had these salads were available if meat were added to them!  Odd.. Ordered the  tabouli salad which was fresh and tasty. \n\nOdd that coffee refills aren't free. Lots of mishegas!\n\nMy experience over the years with kosher restaurants has lead me to avoid them. This one wasn't as bad as most but not good enough to bring me back.","date":"2016-08-04 00:46:13"}
{"review_id":"B6oi8ZKXSKJ7D0yu4I3zWQ","user_id":"bHVOl1xrtHH2HfXlreIk_w","business_id":"XgRljuEUyaHBKIpIz-PRAA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"My friend and I were excited to check out the burger that's rated #1 in Charlotte and couldn't wait to take our first bite of this juicy delight.  Well I hate to admit it but, I was very disappointed once the order hit the table.  We both looked at each other and asked the same question...is that it?\n\nWe ordered the Cowboy burger and if I had to describe it in one word, I'd have to say it was BLAH!  No flavor at all, dry bun, tiny flat burger that looks like I cooked it at home and barbecue sauce was on the side in a little cup.  The only thing that saved this meal were the French fries and the free refill of beverage to wash the burger down.\n\nAs far as I'm concerned, I won't be going back to that establishment for a $13 burger, fries and a drink.","date":"2017-12-02 21:28:46"}
{"review_id":"Tf-SMHRbaAAMytB9CRuJPw","user_id":"c56uMJ-i-9TmKQmgnDHjKA","business_id":"YxzKvetngCbuPH8IiI1RyQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"So disappointed in a floral arrangement I had sent to a funeral. Flowers looked like something you would pick up at a grocery store. I will not use them again.","date":"2016-12-19 18:25:46"}
{"review_id":"f88r8XKT_rPrKfyqfwRs3w","user_id":"zJOGWBbq1mt3RLbKe9XgBg","business_id":"poSV39UqEg-gpESXafS9-g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great HH and awesome catfish dinner for only $9! The king crab with the trifecta is my favorite. Remember to order bread for all the deliciousness!!","date":"2017-04-19 11:40:31"}
{"review_id":"3RnkBO-x3QI6rH9cxGJJSQ","user_id":"GCOZkJN8SXqk9shkpkfovA","business_id":"i066yR2IDP4FWt6p-k9aFg","stars":2.0,"useful":2,"funny":2,"cool":1,"text":"Not sure why all of the 5 Star ratings. Food was just average at best and with price considered it's less then average. Fries were meeh, sandwiches the same and service slow. The only saving grace was the pleasant young man who took the order was both knowledgable and courteous. Too much money and slow delivery, not a good combination.\n\nRemoved from my bookmarks, won't be going back.","date":"2014-08-24 20:42:27"}
{"review_id":"KDFXm0dmFbzfvjqwzV0EJw","user_id":"hsi7zmwZCnxOq675lsEB8A","business_id":"cVETjwDQeK0SeHLZG8XXqw","stars":2.0,"useful":2,"funny":0,"cool":1,"text":"I agree with Sean, as a Chicago native every good 'street food' type joint has the hot dog statue outside and the sports posters and stuff lining the walls.\nToday saw me ordering a gyro and I really would not recommend this as a gyro place.  The pita was good enough, but the meat was weird-dry and VERY lemony...tzatziki would hold it's own I suppose but the meat totally took away from the experience.  Seven bucks for a gyro and small pop.  Take that for what it's worth..........\nI've eaten lunch here previously and I thought the beef sandwiches were okay, not great by any means but I'd order a beef sandwich way before the gyros should I lose my mind and patronize this establishment again.","date":"2009-05-20 01:09:43"}
{"review_id":"O6f6i8ncyyeXgoetzphy1A","user_id":"z908ldotiE_K0-gJv0qk8Q","business_id":"AEzBTGx4oJwJl6vsMjOjTg","stars":2.0,"useful":5,"funny":4,"cool":1,"text":"the store looked awesome.....\n\nthe kid behind the counter was super annoying !!!!!!!!\n\nHe must have been like 19 or 20.....trying to test me on gas mileage and math....im a 32 year old grow woman who just got off work, all i wanted was a few bucks in gas and be on my way....NOT be on 'are you smarter then a gas attended' game show....really turned me off....","date":"2013-10-24 17:11:42"}
{"review_id":"KBxUt6Yl3KBauqX1vt9YRg","user_id":"nYulSKTApPqME3sL0O7psA","business_id":"WfroD4iB5M1nFw8j8iwAdA","stars":1.0,"useful":11,"funny":1,"cool":0,"text":"NEVER TAKE YOUR CAR HERE!!!\n\nThis place is a complete rip-off and has the WORST customer service I have EVER come across.\n\nWe went there and asked what package we needed in order to have the interior of our new car cleaned out. (not shampooed, just the seated sprayed off and wiped) We were told to get the $39.00 VIP package, and it would take care of cleaning off the front and back seats. Not only did the wash on the outside look horrible, they barely wiped down the front seats, doors, and dash, they also didnt wipe anything in the back. I had to argue with the manager for almost 10 minutes about wiping down the back, that took him a whole 2 minutes to do, and it was still so half-assed that I had to do it myself once I took the car home. We paid $39 for what would have been the same wash as the $7 was.\n\nI had then taken my car in for detail since I had received a detail job certificate from a friend a couple weeks prior to this fiasco, and being there are no refunds on detail jobs, I had to take it in or lose the money. So, this past weekend, it went in. They took 5 hours to detail the car. I was expecting it to take between 3-4 like they had originally told me, but, that was just the start of the frustration. I paid to have the car detailed with a clay bar to remove swirl marks and find scratches. There are now more swirl marks on my car than when it went in, not all of the wax was removed, so I had to use my microfiber cloths to remove it myself, I specifically said that I DIDNT want any armorall or leather conditioner on my interior, and to just clay bar the outside, they didnt listen to that, so I spent 30 minutes wiping greasy armorall off my interior and leather. I told the manager that I was completely dissatisfied with the job that was done, he refused to give me any money back and said I would have to bring it back for them to do the job again. I will NOT take my car back to have more damage done for another 5 hour job. I could have purchased the stuff to do the job myself in about 2 hours of time and had it done right.\n\nPlease head this warning and DO NOT TAKE YOUR CAR HERE! terrible wash, and even worse customer service.","date":"2013-05-07 15:57:59"}
{"review_id":"-Gj9_2xE5g4HJB5YVgUsdA","user_id":"ZGvDaPrflHWqH0lpdziCXQ","business_id":"A7waf6G3cvnLfAqKeLL8DA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I went here last night, and I loved it!\n\nFirst, the atmosphere is really good - I'm a sucker for bricks though so I generally like any restaurant that has brick walls.\n\nMy friend and I started with the trio of cheese (I think it was around $18 for 3).  We asked the waiter's advice as to which cheeses to choose and his reco was excellent.  Each cheese comes with its own condiment so we had a baby mozzarella with a rhubarb compote, a paresan with strawberry and another cheese which I can't remember with marmelade - fantastic!\n\nFor my main, I had the gnocchi which was really good and my friend had some kind of pasta with lemon and ricotta (she really liked it but it wasn't my thing).  Both were around $20\n\nWe wanted a little something extra so we split a trio of sorbet - bergamot, rhubarb and mango - the rhubarb was my favourite\n\nAll in all, a great night.  The service was excellent, the room was really nice and the food was awesome (and reasonably priced).  My only complaint was that our cocktails were really small and didn't appear to have much alcohol in them.  I'd stick to wine if I went again.","date":"2011-05-27 13:08:27"}
{"review_id":"70KkVpjziF8QFpZPwAfB9A","user_id":"uH85BLTrX3EzcifImYvIDw","business_id":"PNbX4mT6krRy_I0il8Il4Q","stars":5.0,"useful":1,"funny":1,"cool":0,"text":"Okay guys what the hell... did you open up the transmission and fix it or did you put the timming belt back on like just right? It's seriously never ran this great before it used to not shift gears very well at all now it drives like a dream and all you supposedly fixed was the radiator?  I don't believe it my friend. Will be back for some more of that magic touch!","date":"2015-08-30 18:00:42"}
{"review_id":"WSFmPbV17d6LzYk5QsRzwg","user_id":"6B3qn5EABE_jlL2ai5LhKQ","business_id":"WXR0ND0KqbArMZDvFMA-bw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"The burgers and fries w\/ Maine Root soft drinks are all tasty. This place has nice patio and very dog friendly. They even have dog bisquits for the dog!  Love their happy hour special pricing.","date":"2016-10-26 19:23:30"}
{"review_id":"EQpoY3n_LMvbNhYPZSk7-g","user_id":"A-ltE_RC99lnyX9wG_-eNw","business_id":"v0byOL8VL6v6muGa1anxFA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"This restaurant is one of my favorites! Their pita bread is the best I have ever had... it's fluffy, light, & super fresh! The hummus of course is to die for and they have all different types as well! \n\nThe flavors here are exceptional, and I could eat there food on a daily basis. \n\n\nThe staff is also super friendly, and the vibe and atmosphere there is top notch.","date":"2017-05-26 04:22:44"}
{"review_id":"WxeBty64kKUtPVFxooTDqQ","user_id":"2aneEHobGmnWoeQzvaymSQ","business_id":"ppobG2P-YmqTPy0s4MTRtA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This is a really fun place, especially considering there was no wait and everywhere else around was an hour and a half wait! We wish we'd seen the specials on the board when you first walk in because there was a lot more to offer than what is on the menu (Standard British pub fare) The staff was awesome, yummy food, prepared beautifully!","date":"2016-01-30 03:13:11"}
{"review_id":"upYb4s8-g1uUQbGDazYq2Q","user_id":"nXPD461oNkjVF8wRYXSRtw","business_id":"u-SvRRAfYgpbXZRfQgcTzA","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"Very fun atmosphere they do have the best fried chicken with wasabi mayo. I had their ramen noodles. Lacking in flavor and their pork belly could have been better. Best ramen so far is Ippodu in NYC.","date":"2013-08-03 20:23:36"}
