{"review_id":"n7lY7n6WDcyCS9urUxZh9A","user_id":"-amU7LifraSNgbUh2lzCMg","business_id":"dPGs5b0N9MarZjVgQVelGQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Came here at around 1pm on a Friday afternoon. Not crowded at all and was seated right away. Ordered avocado egg roll for appetizer and had 'Evelyn's Favorite Pasta' as my main. Ordered my pasta from their lunch special which is just a smaller portion off of their regular menu and for this particular one, it was only $2 less than regular. However, I thought the portion was still pretty good and I even had leftovers. Our server Jesse was attentive & came back twice to fill up our drinks. Would come back.","date":"2017-09-09 01:17:40"}
{"review_id":"1tWdnPGH1OyFFIenqUFStQ","user_id":"6zbzFl8u36bHu6MYdzKtuw","business_id":"LeuGZImVz_IG1e-SMYTSXw","stars":4.0,"useful":2,"funny":0,"cool":1,"text":"was told it was a lounge but it felt a little more clubby than that.  we went on a friday night and it was quite a lovely scene.  like everything else at the wynn it's pretty damn gorgeous.  the dj was working his ipod and the crowd was a good mix.  i'd def go back but i heard there's a $40 cover.","date":"2008-12-03 03:53:14"}
{"review_id":"aIFlhqKJeSaTTvffITlFUw","user_id":"YbdrUXB6GZ-ErPqAcmSP6A","business_id":"nDn2h-_c7Xk4UwM0aiXZlw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"So many choices running up and down the street.  How do you choose?\nActually this place has been on my list for about 2 years. So even though I had to steer my husband here, and we kept looking up the road a bit, we ended up back here.\n\nFor starters the inside is nice, BUT, it kinda looks like a blacksmith vomited in there.  Someone needs to put the reigns on this tangled mess of metalwork.  There was some decorative painting along the stairs to the downstairs bathroom...kinda nice, and a soothing relaxing blue and cream palette that was quiite nice.  The noise level was loud and festive.\n\nThe appetizer dip plate Kria Polikiliea is an array of Taramosalata--a caviar and potato spread that was new to me, eggplant based dip, houmos, and Tztziki.  The serving was generous, but we had to ask for another pita.\n\nThe Quail appetizerwas delicious as my meal.  My husband had the Lamb boneless \nI'm not a fan of the texture of the rice, but it seems pretty consistent through all of the Greek places I go, so I suppose it's me, not them.","date":"2013-05-28 21:30:25"}
{"review_id":"uZ_d2lbOjkr4XSzJDySBTw","user_id":"Sl7Am16ASkNv6e-hcLpxoQ","business_id":"TA_S0PxHIlkZEKfXB8oTzQ","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"I have a 2003 Jaguar S Type R which needed some basic break and suspension work due to the age of the car being over 10 years old.  Sean at Top Gear Motorsports recommended this shop with high confidence.  Coming from working with Sean for so many years, I was very impressed at the level of communication and high customer service I received from Joe and the family.  So far I have had the following done:\n\nRear calipers re-surfaced\/new pads\nRear suspension components (end links, bushings, tie rods)\nFront Struts\nProblem solved a clunking sound (figured it out in less than an hour)\nAlignment (to my own specs, which is great)\n\nJoe always calls and explains the situation thoroughly, giving me a range of options, with absolutely no pressure.  He has never forced me to do something I didn't feel comfortable with.  He always makes sure that I leave happy and satisfied with the process.  There has never been a weird story or something that has made me feel like I was being taken advantage of, and that matters because I have a great BS meter and am a huge car guy.\n\nAlso the labor rate is very competitive and i was able to procure my own parts rather than buy from Jaguar, which has saved me thousands in $$$.\n\n5 Stars, my only complaint is there is no shuttle service or car that can pick me up from work.  Great shop, highly recommended for your Jag or Euro import!!!","date":"2013-09-04 01:50:50"}
{"review_id":"YgPXsU3NpjRzl95KWhHuhg","user_id":"SoTMjAyKKpTKAy6OHOhikg","business_id":"Zmfq3DVhHdtVChhSxzoUHw","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Worst Thai food I've ever had I ordered scallop asparagus and shiitake I couldn't have more than 2 bites... It was tasteless and after I had the first bite there was a paste of oil on the top of the inside of my mouth it was so gross!! Also the scallops were like rubber so chewy!!.. I also ordered basil noodle with beef it had no flavor the only thing that was decent was the BBQ chicken from the grilled section... And I asked to get some peanut sauce for it which I didn't get.... I'm never coming back!!","date":"2015-08-19 06:32:59"}
