{"review_id":"uRPUL-YSYuaJZLQp3Z0QlA","user_id":"dSeYpzf0JkCeARr_CyCh7A","business_id":"tOhRQqiupLyJdBJVQMGOEQ","stars":1.0,"useful":1,"funny":2,"cool":0,"text":"Montreal, what did you do in a previous life to be punished with such crummy bagels? Seriously, eating these bagels made me want to start a public service campaign called \"It Gets Better\" and I'll recruit people in other cities to show you how good bagels can be. This bagel shop must be build on an ancient Iroquois burial ground. \n\n Seriously, on a weekend trip to Montreal, I had a goal to try these legendary bagels. These things are shriveled up, flat and taste like someone left out the salt. Matzoh Bagels. Blech. 4 hours later, they were inedible. \n\n I love bagels. I've had bagels in New York, Boston, San Francisco, Seattle and I've even taught myself to make really good bagels at home (Google \"Peter Reinhart Bagel recipe\"). These Fairmount bagels were a huge disappointment. If I made a batch of bagels that came out like this, I'd toss them out and try again. Hope I save some other bagel loving visitor from shlepping up to this shop.","date":"2012-06-26 00:43:59"}
{"review_id":"BOld3A3n7bmt-Y3QCyYhvA","user_id":"_aueaU3ZeK_Dzcd0UbtVGA","business_id":"wjLgM9Ybe5shoUPRrGMmsQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Food is consistently good here. Portions are adequate, but the service can be slow.\n\nThe space is tight, and parking can be an issue in lawrenceville.","date":"2016-03-12 10:16:21"}
{"review_id":"JWo30SHSuQXfxJ-AkHorqg","user_id":"u7gpQzS21j-OMr_ArUWrRQ","business_id":"01SiPgdiOskMC5bUJoyy_g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Driven by this place a bunch if times, decided to give it a try since it's right by our house. Glad we did!  The good was excellent, service was fast & friendly. Good pub-style food. Definitely would recommend it and the prices are just right!","date":"2013-11-14 02:42:31"}
{"review_id":"p4EPOuxm4x8TyMMAfF4uEQ","user_id":"P5uRLwVRpv8OGv1eEvpvhQ","business_id":"sCPNcNxYuTnTdlAZohMyQg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Was there in a Friday night for oysters and cocktails. Not happy hour proces but the oysters are great. Bartender crafts wonderful drinks and is helpful in suggesting others. Not a sports bar (tv is tiny lol was fun watching people try to see the score) pricey but excellent drinks. Nice place alone or small group can't see it being a large group spot at all.","date":"2015-08-30 14:26:30"}
{"review_id":"gxOtty1O4xWwHyg3leJIxw","user_id":"a-6rCPy9CwC9i1P31flTHQ","business_id":"xfadwwQ7RICcAeinHz5YVQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Best cupcakes I've had from a store!  They are light and airy, not dense like some of the cupcake chains out there. Very dangerous having this place so close to my house. Love love love!!!","date":"2018-04-15 10:00:16"}
{"review_id":"JIItfXuyaVhZu-Y6LDJ4aQ","user_id":"_syH6ryl48-UFYL5KsXqZA","business_id":"IMb5BpDLlSbr7yn19HhltA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"If you like it hot, this is your place. It is a bit pricier then other Mexican restaurants but the portions are large and don't taste like it was frozen and just warmed up... cough, cough Macayos! Great specials on the happy hour menu. Friendly staff, nice atmosphere and the hatch chilies are their staple. The salsa is great and the bean dip is a nice change with the chips.","date":"2011-05-27 15:55:21"}
{"review_id":"FKlNbCgL8cI_lZ_tIdnwxw","user_id":"wB-R_Q9nC45hmHYxjjaLNw","business_id":"J7fekWie4ZwR03AZVBisFw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"The baked goods seem to be home made and are really good (I loved the cookies I got). The food portions are really big. The staff is super friendly. That's the good, the not so good is that the food is just ok. Nothing I had was bad nor was it that great. I had a burger one trip and I had some sort of pasta the next trip and I wasn't impressed by the taste but for the money and the amount I got I felt like I was ok with the whole situation. I recommend you try this spot out for yourself. Loads of people are always coming and going so maybe my tastes are off on this one. You be the judge.","date":"2018-03-23 13:58:04"}
{"review_id":"P-_FHM-03gXRzp01hBJFmQ","user_id":"66Vg7QNkY8nRAufAnVKDqg","business_id":"ATnRWnNk5iwwIbwS8VmuKg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"When I went to school at Pitt, Taiwan Cafe was one of my favorite places to eat. Their lunch specials are delicious, cheap, and filling; what more can you ask for? I'm particularly fond of the General Tso's tofu (yes, it's not at all authentic, but it's still really yummy and you can get it spicy.) Unfortunately, I moved away, but whenever I make it back to Pittsburgh, I always stop by here. And although I haven't been going to this restaurant regularly for almost two years, when I stop by on a visit, the people here still recognize me. Now that's customer service done right. So in short, there's nice people and great food, and I can't recommend this place highly enough.","date":"2012-12-04 03:24:54"}
{"review_id":"R3HHa-sO-JD8XkzGKDmx4w","user_id":"cCke3VtFLtqgzkgYSrSE2g","business_id":"oCvxJBOs-Mbg-4oanPO7lQ","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"I tried Pita Pit for the first time a couple years ago when I received a free gift card from work. I was flustered from beginning to end--- I handed the cashier my gift card as payment, and he just thought it was some sort of promo card. He then asked for my debit card, which I passed over. When I questioned him why my gift card did not run, he was very perturbed and snapped at me when he had to cancel and re-do the transaction. Then, I ordered the Gyro, which anywhere else would not require much description. Well, I was confused by the fact that I was asked what I wanted on my Gyro (um, the usual Gyro ingredients?!) and that Hummus costs additional (which is not ever mentioned at the register when ordering the Gyro).\n\nMaybe I've never gotten over this initial experience, but I have yet to truly enjoy Pita Pit. I think the Pitas are over-filled with meat and sauce and under-filled with vegetables. Though initially tasty, I always feel very ill after eating here... I only plan on returning when I get dragged here yet again by a co-worker trying to avoid the other two chain options on this block of East Carson.","date":"2012-11-06 04:50:15"}
{"review_id":"-hmReuY7aGizy4ZlVsB1RQ","user_id":"fH_LSNzKCcscj8H9o9KBMw","business_id":"E9Gnux898nomZK0fYErQVw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My drink was delicious! I had an iced sweetheart mocha. I also had a sandwich. Really tasty!  Best of all. The nicest people! I will continue to go there!","date":"2018-03-03 23:21:24"}
{"review_id":"RRAifS039-GwSjcIiKkrMw","user_id":"la4Y5u_v7hcp2zpPqcya4Q","business_id":"nvJjfEPYFXj8sJZcbt0k-Q","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"It's like an Ohio classic. We got carry out, placed order online, it was ready when I arrived to pick up, still warm. I got the blueberry pancakes. You get four large pancakes filled with blueberries and topped with blueberry syrup - a little too sweet for me, but still pretty good. I wish the sauce was a bit fresher and less....corn syrupy. I also really like their sunshine skillet - so delicious. Probably will get that next time.","date":"2016-07-03 18:36:53"}
{"review_id":"G55CunzD-xKjVEvAa1fXow","user_id":"aIqDek9d1fDEgLIAWXMGSA","business_id":"wM8QNs7uSyDqMJKjBYFPCQ","stars":5.0,"useful":2,"funny":1,"cool":2,"text":"I am not a person for Buffets unless I am in Vegas but I was totally blown away f=by this place!!! First of all just the deco of the place was one big investment as the had it all in there including the Eiffel Tower, Greek wind mill, part of china and italy. \nThen there was the food and since I am careful what I am eating they actually had lots to offer. plenty of veggies, 7 different types of pizza. A complete turkey which I had but they had roasts of all types. Which I was told are slow cooked over night.\nChinese food was good esp. the spring rolls which I have a friend who makes and these were exactly like his.\nThe owner gave me a complete tour of the place which seats 800+ yes 800. He told me saturday nite he is full. They even had private rooms for conference or weddings etc...Out door on the roof for the summer. Mind blowing. Everything is cook in house.\nI will be back.","date":"2014-04-01 02:39:26"}
{"review_id":"_8tSNHAC74W_eqdigxVCVQ","user_id":"HHJUmPxqUaycybnJ_zsgFA","business_id":"ZLG7N4VDGzo7V0ViITi93Q","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"I am not sure what all of the hype is about. Based on Man vs. Food recommendation we had the Torta Del Ray sandwich and it was VERY disappointing.  The meat was dry, sausage was not browned and it was totally tasteless. I think the cook neglected to season the meats. My buddy ended up dumping salsa on his sandwich and I put hot sauce- anything to get flavor. Don't waste your time on this one. MAJOR disappointment.\n\nOn a positive note, the service was excellent.","date":"2014-10-27 03:37:15"}
{"review_id":"5OXOgaDMJhfSdZ3xodPHtw","user_id":"_JZvPkrqN06Nc7F18-p2Fg","business_id":"F2pfjAZ_3dMTGCKv6c5wOw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Cucumber margaritas and guacamole are remarkable\nI almost always get the machaca and am never disappointed\nThe scallops entree is delicious, I literally could eat an entire plate of the poblano creamed corn it comes with \nService is always attentive\nHappy hour is always jammed so you pretty much have to be waiting at the door when they open to get a seat at the bar but the deals are worth it","date":"2013-08-03 20:42:12"}
{"review_id":"yMizbhSnZKUCY4-ApDt-mg","user_id":"w8q1hum7FsGb6hb9T_2j2g","business_id":"y0kIBav53i8OruU9e0ZqQA","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"This place is packed on Wed which is the discount day.\n\nThe chicken isn't bad at all, and the service is ok.  It's only\na pickup place.  Nowhere to eat inside.  Kinda warm inside.\n\nFood is pretty good and have a good variety of sides.","date":"2013-05-07 16:14:53"}
