{"review_id":"RQcYJnsOcuyl1qY8uxXvDQ","user_id":"Wp63IAT78zUF2_dpVr6p-g","business_id":"ID5wWJ9C7G0hfbQilvlfxA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is a true gem!  Well worth the short block and a half walk from Fremont Street.. The food was delicious and surprising, more than just authentic Mexican, it was new, fresh and original.  I loved every bite.  BEST guacamole I have ever had.. We will come back again and again.  Cool casual vibe, super friendly staff, and fun atmosphere.","date":"2015-04-01 17:11:25"}
{"review_id":"ZMg8Fn_6EdfbCURb825QLw","user_id":"CC32nG1bK456zJdjDg0MLw","business_id":"H8rjk0XlGSaTGBNLrBLhXw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Spent the New Year at this place after a brutal Fiesta Bowl game.  Had a nice meal and complementary drink for toasting the new year.  Took the edge off before the 4 hour drive back to reality. Thanks.","date":"2017-01-02 05:37:14"}
{"review_id":"c4_BcnjSLtBuF_3O4JNnfA","user_id":"mXQjS9WLNzHlb8R45VinIw","business_id":"lpel3pRFAzlow7u2TJMz4Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"If you come on a Friday or Saturday after 6 or 7pm, expect to have a bit of a wait. One nice perk is that they have an open table that you can stand at to enjoy your pre-dinner drinks so you don't have to crowd around those sitting at the bar. I absolutely love the atmosphere at this place with the big wood-burning pizza oven behind the bar where you can watch your pizza being cooked. They have a great selection of wines from different countries and their food options are not overwhelming, but always deliver big. When I went a couple months ago, they had caramelized brussel sprouts that they cooked in the wood-burning oven that were amazing!! I've tried many of their pizzas and haven't had one that I dislike. My favorites are the Quattro Formaggio and the Spicy Sopressata, which despite the name, is not too spicy. In the summer, a huge perk to this place is their outdoor patio. They have a couple long picnic tables and also have smaller tables along the fence. On a warm spring\/summer night, it's very relaxing to sit outside and enjoy the nice weather.","date":"2014-01-17 16:49:06"}
{"review_id":"ZtQiWMgujD0xspNZhS9DEQ","user_id":"bQdw9RuyZ1c3Lg5zjurxgw","business_id":"D2D2qsxifHaRqNlVhP3YTA","stars":5.0,"useful":4,"funny":0,"cool":0,"text":"I am new to Nevada and was so happy to stop into Half Price and get exactly what I needed! Got a super comfortable mattress for an unbeatable price and was in and out in less than an hour. Phil was a great help and made the process quick and painless and even had me laughing most of the time! I definitely will be recommending my family and friends!","date":"2016-07-03 18:58:56"}
{"review_id":"6eoppikjRJH-JzzvTwQcYQ","user_id":"YmfOia9Ryxv3wnMXcGYDTA","business_id":"m9idUZWCBQB_owyaSeO2dw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Asada nachos are pretty good. The waitress was super nice. I would come back here when in Vegas!","date":"2016-06-11 21:04:56"}
{"review_id":"FrIj5SZHud0G4nkznvgEPA","user_id":"yjT8vV1Z0rqZc-sxj1nB1g","business_id":"5bwXaN3-TmBMrHPPxOuTeg","stars":1.0,"useful":12,"funny":0,"cool":0,"text":"If I could give negative stars I would! These people are very nasty, rude, uncivilized scum of the earth. They towed my sons vehicle and he is a MARINE OVER SEAS I got the paperwork they requested and they still will not let me get my sons vehicle back! Trying to charge me almost $900.00 and it increases daily! I can not even start to tell you how horrible these scum bags are! I am filing several complaints against them with who ever will listen, DO NOT TRUST THEM!","date":"2014-09-09 19:27:49"}
{"review_id":"e_FWsEGUoDVr2omDsnlkHQ","user_id":"EumK5NjRJaO8Gz2PDTlvEw","business_id":"IjeyNYr4kefZ2uZfrtJqZg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Take your dog somewhere else. This park is fantastic, but bringing my dogs here has become a hazard. People do not pay attention to their pets and let them run free. My dog has been hurt twice now. A smaller park is much safer. Do not recommend.","date":"2016-08-03 23:49:31"}
{"review_id":"3F3EqxOUpJYd6plUSbiZpA","user_id":"n4ok43w1rzRmeBfMKkvsEQ","business_id":"bsrj9_hFAql3dlSf244zpg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"So many great things to say about this place, but it didn't hit everything so that's why I had to mark it down one star. Check in was reasonable and the staff are friendly. At first I was taken back by the mandatory valet, but I like that it's based on gratuity\/tip. I love that it's smoke free and still basically on the strip. The one bedroom suite is super spacious and could honestly comfortably fit four adults if tight on cash. Rom service provides good portions for the money and is prompt. So the markdowns come for the cleaning and the gym. There were two obvious strains on the curtains, which I know if I can see, housekeeping should be able to and thus CLEAN! Also, I was curious as to why there were a pair of men's dress shoes under the bed. Did housekeeping vacuum under the bed??? Clean with their eyes closed?? I dunno. Also, my friend went to get extra pillows from the closet and said there was hair on them and they were dirty...not acceptable. Lastly, I do workout everywhere and was slightly disappointed from the size of the gym. I was still able to get a mini workout in, but I guess I was expecting more variety and no kids. Typically this would be 3 stars bcuz if the cleanliness, but the customer service and space superseded the issues this time.","date":"2016-01-17 09:22:49"}
{"review_id":"NpYQqNJokaeFoaWQc36PvQ","user_id":"_5HFgadpCIaSVINVvse2Kw","business_id":"aRqxT28Tdz2aDiZ7Vkyejw","stars":5.0,"useful":13,"funny":3,"cool":5,"text":"Warning: This review contains a lot of gushing and high praise. If this sort of unabashed adulation makes you uncomfortable, you might want to turn away now. You have been warned. \n\nI HAVE NEVER HAD A BETTER BRUNCH EXPERIENCE IN MY ENTIRE LIFE!  The White Brick Kitchen really knows what they're doing and I don't have even one solitary complaint (and, believe me, I'm very picky and thoroughly enjoy complaining when it's warranted - so I would if I could, but I honestly can't).  Allow me to regale you all with the delicious tale of my delightful brunch. \n\nMy friend and I were fearful that we would have to wait for a table when we arrived at 10 am on a Sunday.  It was such a pleasant surprise when we were seated immediately and quickly presented with both coffee and freshly squeezed orange juice.  The atmosphere of the restaurant is very welcoming, laid-back and cozy.  I already felt very content as I sipped my OJ, little did I know that I was about to be sky rocketed from content to off-the-charts-euphoric.  It seemed as though we had only just placed our orders for the Scotch-ish Eggs when they were set before us, as if by magic. The service was so fast that it verged on ridiculous, but the quality of the food did not suffer in the least.  On paper, the Scotch-ish Eggs sound super tasty (two panko fried soft boiled eggs, hollandaise, greens, buttered baguette and potatoes), but nothing can fully prepare you for how transcendent this dish truly is.  I am awestruck by how perfectly cooked the soft-boiled eggs were in spite of the fact that they were breaded in panko and deep fried.  I have no idea how they still manage to maintain the optimal runny yolk consistency while creating such a crispy coating on the outside of the egg; it's nothing short of incredible.  Every component of the meal was outstanding - from the dressing with a subtle hint of Parmesan on the salad to the golden brown potatoes.  I can't say enough good things about this dish, you really have to try it!\n\nI'm excited to return to The White Brick Kitchen soon to try their other dishes (if they're anything like the Scotch-ish Eggs, I am definitely in for a treat).  I loved that even though they're offering high-quality food, the prices are very reasonable.  Great spot, great staff and sublime food. You really cannot ask for more!","date":"2013-01-02 18:17:53"}
{"review_id":"ZLkIeXLcvKTsNr6j8SEJZQ","user_id":"pQ8qmUnAZH0hYToenRS57Q","business_id":"cw4m6QjZVG2PkdSYeim1Gg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I love this park, and my dogs do too!\n\nIt's beautiful and well maintained. \n\nEven on a busy day there's still plenty of room to walk around, exercise, or have a picnic!","date":"2012-01-03 20:14:55"}
{"review_id":"SCKQ-1XjI-E1tNEeh2nLtw","user_id":"8KWR1qLgN2rTZ4VSGW9yvg","business_id":"dX90qyHzfC4Cxh-lNBAEgQ","stars":3.0,"useful":1,"funny":1,"cool":0,"text":"It's probably exactly what a reasonable person would expect from a recently renovated, small 'locals' casino -- clean & modern 24\/7 cafe with a basic menu, decent food & cheap to fair prices.\n\nI ordered the onion rings as an appetizer, & the Meatballs & Spaghetti as the main course, however, as a vegetarian, I asked for just spaghetti marinara -- no meatballs!\n\nFirst out was a small salad, which comes with the entree.  It was good.  Next out were the onion rings -- about 8-10 rings of various sizes, and Ranch dressing as a dipping sauce.   The onion rings were pretty greasy, as I suppose most are, so I'm not complaining, however I do expect a big stomach-ache from them at any moment -- hopefully I'll be home by then!   I do wish more places would get rid of (more of) the grease before serving onion rings, or set them down atop a diaper or something! \n\nThe pasta course was good.  Instead of them bringing Parmesan cheese on the side, the entree came with it already atop the pasta -- fine for me, but beware, if you don't want cheese.   Also included with the pasta entree were two fresh garlic bread sticks -- they were very handy in absorbing the excess liquid in the bowl of pasta.\n\nI was sad but not surprised to see that instead of deducting a dollar or two off the price of Meatballs & Spaghetti ($8.99) since I asked for pasta & sauce without the meatballs, I was charged full price.\n\nMy bottom line:  Decent food at an OK price & good, friendly service, but neither the casino (I don't gamble) nor the restaurant will be a 'destination' for me -- I came here because I was curious, my curiosity is now satisfied, and I don't see a reason to return.    But if you're a local looking for a small, clean & friendly place to gamble or hang out at the bar & watch a game on TV & while you're here already, you're hungry for some basic food, Sarah's Kitchen will meet your needs.","date":"2016-09-06 01:16:53"}
{"review_id":"Em8ADPYe150y-weAFpHfwQ","user_id":"wu8Qh6QzgdoFuXux59p8QA","business_id":"7T1XVTSocHcOu2H5v2Iqog","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Apparently this place is much better at 4:00a (according to some locals). However, as a tourist visiting the Toronto area, the fact that \"poutineries\" is even a thing is amazing. I thought this place was really good. Definitely not a healthy choice, but delicious! Love the 80's rock theme too.","date":"2017-10-11 03:31:50"}
{"review_id":"gHxcwQIWXDF3yA2SQBO0Hg","user_id":"sfLTjzc1ceEpzZRnXz512Q","business_id":"6kkxRV8H9SQLybj0xnEbMw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This is a very nice casino. It is yet another of the Station chain, which I very much like. We enjoyed the gambling, and the buffet even more. If you are in the Henderson area, this is a very good place to go.","date":"2012-03-30 02:20:00"}
{"review_id":"FsmPVAC4pRP7zr19BGNYVQ","user_id":"-tdsrQ3QIkGmmP2n6-DTeg","business_id":"sjJOsKnXxsQodXMr1i8fsg","stars":1.0,"useful":6,"funny":9,"cool":1,"text":"I'm convinced that the Eaton Centre is the modern incarnation of Dante's \"Inferno\". As in, it is hell. Pure hell.\n\nBelieve you me, I love a good shopping mall as much as the next gal, but I avoid the Eaton Centre like the plague. Oh Eaton Centre, how do I hate thee? Let me count the ways:\n\n1) Teeming with truant teenagers and tired tourists, travelling through the mall itself is a true testament to tenacity. The layout of the centre is confusing, and combined with the constant crowds, navigation can be complicated and challenging (cue applause). \n\n2) It is said that \"variety is the spice of life.\" Consider that the Eaton Centre has 3 Aldos, 2 Bell Worlds, 2 Feet Firsts, 2 Nutrition Houses, and 2 Sunglass Huts, to name a few. Is this really necessary? Is it a secret ploy by the city of Toronto to encourage everyone to be getting proper nutrition while rocking fabulous footwear, sporting sunglasses and chatting on a cell phone? \n\n3) The one redeeming quality of the Eaton Centre - the prime, central location - is also, in several ways, its downfall. Parking is expensive. Hordes of people travelling to and from Dundas and Queen stations and the PATH converge here. Trying to hunt for deals isn't easy when battling major pedestrian traffic.  \n\n4) The washrooms - if you can find one, that is - are always in high demand. High demand washrooms equate to dutty, dutty washrooms.\n\nFor decent mall shopping, Yorkdale is just a hop and a skip away by subway, and is far less congested with pretty much the same (if not better) selection of stores.","date":"2011-05-27 21:08:20"}
{"review_id":"YCrZdG9ts5gRUWBAm3Lmhg","user_id":"XYl43Jgcl_AgM5YXDFVy5A","business_id":"Evxn0mYSOZ23ijer4W4Nvw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"THE WORST!!\nThe line up is outrageous just to get a number, you still hve to wait to be called after that. The line has over 50 people in it and there is only one staff member handing out nunbers. The other staff serving thise w a number are just sitting there. Super under staffed and slow. Never coming back here again!!!","date":"2018-07-26 14:21:17"}
{"review_id":"9EDFJHPKYr9Zx7xYmXsYzQ","user_id":"nM1UrsgKerPBwB-07v-PEw","business_id":"lmxA0dJM0XsPCIHPXhEQ-g","stars":4.0,"useful":0,"funny":0,"cool":2,"text":"Went here before a concert. Literally just steps from the t mobile arena. You walk and your assaulted (in a good way) by loud music and flashing lights. They have a crazy host running around with a mic singing and getting patrons to do sake bombs. When you go to some place like this you think the food is going to be sub par - it wasn't. The toro sushi was so good and fresh as was the yellow tail and salmon. The spicy tuna roll wasn't nearly as good as the sushi but still decent. You can imagine that the service was spotty with our waitress breaking to jump into a song and dance - but the management felt so bad that we had to wait so long that they took care of a large part of our drinks. Wouldn't definitely recommend - but it is a party atmosphere so be prepared.","date":"2018-04-15 14:37:45"}
{"review_id":"hnAehPcPvGOT8uu14yl-lQ","user_id":"CMO_ZaPejMw47kFnTIqEhw","business_id":"C6C_dc78Zhzei9wrZs-tdQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"You know, for the price, this isn't a dump.  If you're looking for something cheap and acceptable, this is it.  However, what I really didn't like was the deception.  That's why I'm dinging them down to two stars.\n\nI booked this through expedia, and the Website clearly stated that there were no resort fees, just $45 total for two weeknights.  Okay, no resort fees.  So on check-in, I asked what the final rate would be.\n\n\"We can't tell you, because you booked this through expedia,\" she said.  \"They don't give us any numbers.\"\n\nOkay, all right.\n\nThen upon checkout, they charge a $20.22 resort fee for two nights.  WTF?!  That brought the total for two nights up to $65.  Okay, so that's still a good rate.  But why deceive us?\n\nThis is an old hotel, and it shows.  It didn't disgust me.  The room was clean.  There were some small problems.  I had a problem with the shower when it suddenly went cold on me.  And for some reason, they don't put blankets on the beds, only sheets, and it took me a couple hours to figure out how to turn down the A\/C.  Small things.\n\nBut hey, they had free wifi and all the cable I could consume.  I felt safe in the parking lot because they have some pretty strict guards making sure that everybody who comes into the lot has a room key.  So I used the El Cortez as home base to do business away from downtown.\n\nWhen I did stay downtown, it was fine.  At 2 am, I saw a couple hookers, and even one walking into the hotel, but during the day, it was nice to take a stroll down the Fremont Experience, which is just a block away.","date":"2014-02-24 01:21:24"}
{"review_id":"PXhURAvvQYa6Lpy5ut7DlQ","user_id":"hqp-UAn5cyLAShRacUJ68g","business_id":"F2pfjAZ_3dMTGCKv6c5wOw","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Delicious. Found out about it from Diners, Drive-ins, and Dives. It is none of those, but it was fantastic! On the trip through Cleveland we decided to stop here. Unfortunately, it didn't open until 5pm, so we waited four hours for dinner. It was well worth the wait. We sat outside on the large patio, it was a beautiful day in Cleveland (yes, it happens). The service was very good and helpful with what to order and how large the portions are. The machaca, coffee and ancho braised beef was amazing!!! Also, enjoyed the goat cheese guac and chips. The camerones (shrimp in a garlic wine sauce) was delicious. Dessert was fried ice cream. It was fantastic. More than enough for two people and very satisfying. The machaca and fried ice cream are must orders when in Cleveland.","date":"2012-02-01 17:40:48"}
{"review_id":"8V62LSRH1HKOLFMHWXSi4A","user_id":"z1tGfRDgfhfkV8ehNLiJrQ","business_id":"3uS4F9GNtMbujrnszfFaeA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"They sent us coupons to try them out. Printed on the coupon is their hours. But in the one month that the coupon was valid, they changed their hours. Now closed on Sundays. Not happy that I drove all the way there just to find that they were closed. Not likely to go try again.","date":"2014-08-24 22:12:28"}
{"review_id":"G9zHYuUIntCTrML245aRqQ","user_id":"DU67B6HXh8jE8GiCg2hzUQ","business_id":"THRgKl4gGgM9ZSnkE5sp0Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I have no complaints about my experience with my laser hair removal package. It was sold to me without it feeling pushy and the consultant was as knowledgeable as she was beautiful, which led to choose with confidence. I never have to wait, am always in and out. The women at the desk are always pleasant. I love the convenience of texting confirmations. Sneha is saving lives one zap at a time! They were recommended from a friend, and I've certainly told many more.","date":"2018-03-15 20:12:53"}
{"review_id":"gf-HmOnPkSlyaO0dE-cYag","user_id":"xILLJJViIjT8mFkWBmumJQ","business_id":"mUQ0ffOfaBn_E5kyZUkvOQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I booked this trip through Viator.  Got a decent deal.  I initially booked the South Rim.  Later, I requested to be picked up at my hotel.  They said that they have 6 people being picked up at a nearby hotel.  I realised that WE were those six people.  THe woman at the phone seemed to be exasperated at my persistence to be picked up at our hotel.  I later found out that there were no people to be picked up at the other hotel, and the number at our hotel increased to 8 people.\nI then asked for her manager who accommodated us in about 5 minutes.\n\nWhen you arrive at the station, there is a guy who says that the trip to the Grand Canyon's South Rim is about 5 hours, where the trip to the West Rim is about 2.\nAlso, that the temperature  at the  South Rim is much colder.\n\nSo we changed to the West Rim and nearly paid 50 dollars more per person, actually paying more than the higher priced WEst Rim ticket.\nHowever, we saw the Hoover Dam from two vantage points, got to see the WEst Rim, and got home in time for dinner!\n\nDefinitely get the West Rim!\n\nOur bus driver was ok.  His name is Kemo.","date":"2012-01-03 18:55:52"}
{"review_id":"JGkSgws9lPKYLfmyVbYOdQ","user_id":"fo2ImH-I7R35qwmN4W2kvQ","business_id":"qFAw6wHMMcr4ctF-ZdGhEA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The food here was so delicious! I can't wait to come back! The space itself is tiny, but worth the cramped quarters once we started eating. The bread is great, as is the pasta. You can tell everything is made fresh, it's just so good.","date":"2013-03-18 23:36:14"}
{"review_id":"lU9Cvqk4ZkG5nywqY2npiA","user_id":"n9UivJ4DJZmuXg_PMM9-AQ","business_id":"RRpHuoXpxcuLk4LdB_YrOg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Baught my glock 19 here came with friends to the range.\nOverall nice place for locals 10$ for range entrance and 13$ for 50 9mm rounds.\n\nThink this place will become my local best spot for some shooting","date":"2018-02-02 01:22:34"}
{"review_id":"RteHrNH4QUL2MzvU2h_avQ","user_id":"HtThhuFnksLAAZdiC__1Qw","business_id":"UAXz2KC1aXpxzV-MLdXbmQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The food is delicious. Everything I've ever ordered has been amazing. The dining lounge is large and clean and the service is good.","date":"2018-01-21 11:25:06"}
{"review_id":"IZUapydWWl2uBFBt2EyC4w","user_id":"FO8hILdACBsZrVDur5x8RA","business_id":"hr0vxeTzlHx6fTpSSmu2AA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Found good reviews on Yelp and decided to stop in prior to a concert at Blossom.  What a great choice we made.  Sat at the bar up front and enjoyed the interaction with both the bartenders and cooks who prepare the food right in front of you.  Had the grilled oysters as appitizer (awesome must have) along with the halibut special which was off the charts. We will be back again for sure.","date":"2014-08-11 02:06:40"}
{"review_id":"YWD1MbdxBsVvYvRTS9iG3g","user_id":"zIRmG2_ib4pALbT3NVsmOg","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The food here was ridiculous, stupid good, whatever the cool kids are saying. Bottom line DAYUM. My wife and I wanted to try this place simply because we watch way to much of the cooking channel, and we love Bobby Flay! We did the dinner pairing. My wife had the Sophie's salad and I started with the tiger prawn tamale, yum! Main course was 16 spice chicken for my lady and I had the Ancho chilie salmon, both stellar choices! My wife had to pass on the dessert since they pretty much brought out the largest portion of chicken ever served in a restaurant. Being the gluten for punishment that I am I went in on the coconut cake, it was extremely decadent! Even though we didn't have a whole lot of interaction with our server, the entire staff worked as a team which made for a pleasant dining experience.","date":"2016-08-04 01:49:26"}
{"review_id":"hbdwjL7ec03fXU7Yq8wh5w","user_id":"-u4-SgZLFbnuAhWEl0hlUQ","business_id":"DJnDtWvKX-_f1VMzbI6ZaA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"As a hair colouring novice, I am a little apprehensive about who touches my hair. I have been on the hunt for the perfect shade of cool ash - trying to shy away from red tones as much as possible. But no matter what salon I visited (mainly in the Durham Region), the colour always ended up having a brassy tinge to it. I set out to find someone who could dye my hair exactly like I wanted. My office recently relocated to King St. E, and I looked for a salon within walking distance - finally landing on McManus and Campbell in the Distillery district. I booked an appointment with Sharon McManus (one of the owners). She listened to my concerns and helped me pick a cool ash tone out of a book of samples. My hair looks amazing, and I can finally say that I am truly happy with the result!\n\nAnd as an added bonus...THEY HAVE A SALON DOG. A sweet black lab named Rita who they rescued from Mexico I believe. She is a sweetheart who roams around the salon looking to be petted and will occasionally sit on your feet as you're getting your hair washed. The prices are also very fair... I have long, thick hair and after tax my full head of colour comes to $90.  \n\nDefinitely worth a visit!","date":"2017-03-27 12:35:46"}
{"review_id":"SeKWUooQA-xpMuviVWdzQw","user_id":"XHOyuaYEhETRu6r9Bzbvvw","business_id":"TQ-FgDYJbJhIXTvSdv-jUw","stars":3.0,"useful":2,"funny":0,"cool":0,"text":"I ordered a brisket sandwich with mac and cheese on the side, and wasn't disappointed, but not really impressed either. The beef was decent, with a pretty good barbecue sauce. The mac and cheese was probably better than average.\n\nI had a cobbler for dessert, which was also pretty decent.\n\nOverall, I'd say this place is worth going to, but not the kind of place I'd put in my group of favorite BBQ joints.","date":"2011-02-13 19:51:41"}
{"review_id":"NpWMGfw49sYS6RO9cEhzqg","user_id":"XW7LSSGZKFFurIcpIOwSdA","business_id":"ULAz5fw2r3vm0N-_FTMzGg","stars":1.0,"useful":1,"funny":0,"cool":1,"text":"2 servers on a Saturday night? Place is packed and the table next to us just waited 15 more mins additional than us when we all ordered drinks at the same time. Food took a while to come out. Sorry Hard Rock, your service sucks.","date":"2016-12-04 04:21:39"}
{"review_id":"g2OgJZ20-WwtL3qIOq19Ag","user_id":"gEThKNhbQ2-qcRZETf7dQA","business_id":"AnpkAaA0yA3tfn_mAwWaZg","stars":2.0,"useful":5,"funny":1,"cool":0,"text":"The only reason I gave this two stars and not one, is that they have a half-decent selection of modern lighting.  But if you need to special order something, go elsewhere.\n\nTry Living Lighting or Royal Lighting.","date":"2009-05-20 18:13:10"}
{"review_id":"R6sRhOWSk7DGJyUn3ZDGWQ","user_id":"VkWUgLZkholyRWagwDpgHw","business_id":"KRE8xP36FN1STOoZKU_FSw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Retro thrift store aesthetic meets indie backroom music show stage meets alt food scene, all wrapped up in a resto-café. I've been here just a few times and it gets just above a 'meh' rating from me. None of the food I've had here is remarkable in any sense, though I do like very much that it's a health-conscious menu. To qualify, I haven't had a full meal: just lattés, tacos and treats. I tried an iced tea, which was watered down so as to not have much flavour at all, but my friend liked it fine. She drank my iced tea and bought me a chai latté instead, which was honestly still just... meh. My date square treat was also nothing special, taste-wise. However, I will report that my friend's goat cheese sammie was very tasty according to her. So, seems it's a bit hit and miss. \nThe music is LOUD. \nThe seating is eclectic but comfortable enough, and you're definitely welcome to hang out with your laptop for all eternity. \nUltimately, it wouldn't be my first pick for places to meet and chow down, but I did catch a really fantastic music show there one night, so I'd go back for another sometime.","date":"2015-08-06 21:50:53"}
{"review_id":"DaCfCIg3LbzOEV1IuUTP1Q","user_id":"nLADCnXaYRlx4jYJcHcGdA","business_id":"tVVDQitHYUMGECGArOqjxg","stars":1.0,"useful":1,"funny":1,"cool":1,"text":"One of THE worst pizzas I've ever had. The cooks are really cheap when it comes to cheese (the pizza was almost all tomato sauce) because the cheese was missing. Absolutely no taste. I don't usually bad reviews unless earned and these ppl working here certainly earned a bad review. Maybe the owner is a cheap person and is forcing cooks to be cheap with toppings.","date":"2018-07-07 21:56:23"}
{"review_id":"qZ-eBkr9xKvQxieoR7p6Ew","user_id":"Jp2QpvGGLFQ8erDAqicQOw","business_id":"ivgKHakMYMpsV1RIjQruOQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Logan's has great food but very weak margaritas. We ordered the onion tower which was delicious. The onions were heavily coated with breading and fried perfectly. It came with two dipping sauces. They also bring you complimentary buns with butter, and peanuts are also on the table. My husband got the cheeseburger with fried cheese, which he said was amazing. It looked good. I ordered the anything and everything salad. I was surprised how good of quality the ingredients were. The chicken was thick and juicy. My sons kids cheeseburger meal was a disappointment and totally an afterthought on the restaurants part. The hamburger was the size of a sausage patty and it came on one of the buns they serve you as an appetizer. Lastly, I ordered a moonshine margarita and it was the weakest margarita I ever had. I question if there was even any alcohol in it. If it weren't for my sons meal and the margarita I would have given this place 4 stars.","date":"2015-01-04 02:32:32"}
{"review_id":"01mF6IylF2ztjauryTpgPg","user_id":"zaCd7fARVmxywzCT16Scjg","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Poker room is awesome!\n\n$1 and $2 limit\nAnd $2 and $4 limit\nAs well as the no limit tables of course\n\nTip your waitress and they will keep coming is all I can say. My husband and I were tipping $3 for 2 drinks and she said she was letting the bartender know to make them good for these nice people\n\nBe kind and you will have a blast in Vegas\nLoved our room and for $35 can't beat the location, free parking, nice room, great restaurants","date":"2016-02-12 03:53:31"}
{"review_id":"4CcX4VmVYs2FZzlPZ-b1dw","user_id":"ebdYf8YGTYa40v7OaTUAIA","business_id":"xnVkYE3iMp_aZniiCIuD0g","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Live downtown and there isn't a lot of option for good food and coffee without all the fuss. Found this gem. Easy to deal with, amazing good food and reasonable prices. Super convenient and one of a kind downtown.","date":"2016-10-13 20:46:13"}
{"review_id":"CkU7dYkQ2_PdMG6ztpjgxg","user_id":"YPVEDPGqxIbcFElZd2iRzQ","business_id":"rcaPajgKOJC2vo_l3xa42A","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"My friends and I were very excited to have brunch in a nice French restaurant while in Las Vegas. However, our experience was quite disappointing.\n\nThe 20 minute wait to be seated was completely reasonable. But the 20 minute wait to get our order taken and then the 40 minutes it took them to prepare 2 sandwiches, a bowl of soup, and one pastry is unspeakable for such a high-end restaurant. We were wondering what took them so long to prepare our food and then realized it was so they could turn a \"medium rare\" steak sandwich into an overcooked piece of wood. We probably would have sent it back, but it would have taken another 40 minutes and we were very hungry by that point.\n\nOur waitress did not offer much detail or information about the menu to our group, which was clearly not well-versed in French. She was also very slow to refill our water glasses, and when she did, the water was lukewarm. I was wondering if this was a French thing, but saw that other tables were offered pitchers of ice water.\n\nGlad I decided to eat an egg and cheese biscuit in the Venetian food court before heading up and waiting an hour to eat a $10 cup of soup in Bouchon.","date":"2013-09-04 02:00:58"}
{"review_id":"VubPhdwdL7c5ZAa51jTESw","user_id":"WyD3JNbZRifNp7X6lC6FVg","business_id":"IhNASEZ3XnBHmuuVnWdIwA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I don't think words can describe how much I love Brew Tea Bar! What makes it even better is that it's only a couple minutes away from my house! I literally go here every day, it's pretty embarrassing..\n\nOn my first visit, I ordered the Honey Milk Tea with honey boba and pudding, which was alright. I also tried their caramel slushy (I don't' know exactly what it's called) but it was waaaay too sweet for me. My boyfriend then introduced me to my favorite drink, Hokkaido Milk Tea with honey boba (also good with grass jelly) !!! I'm so in love with this drink, you have no idea! It's all I ever get and I refuse to drink anything else, because it's THAT good. If you like milky drinks like I do, then I highly recommend getting the Hokkaido Milk Tea! I recommend trying their crepes as well!\n\nNot only is their boba perfect, but they also have excellent customer service! I love how they are willing to adjust your drink to your liking. I also love how the employees remember me and my boyfriend! We come here so often that sometimes they give us a large instead of a regular drink, which is AWESOME!\nThis place just has really chill vibes and a friendly environment. I don't think I'll ever go to another boba place, because this is honestly the best one we have in Vegas.","date":"2015-09-23 23:52:08"}
{"review_id":"BWUWI7Zxci4x2CO8E_bofw","user_id":"j1ft-sKE4ERt_QUGWQE3kA","business_id":"M0pkmBUi_CI0qrzN7ee80Q","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"In Charlotte for one night and we needed a place to grab breakfast before we got back on the road. This place was by the hotel and we saw it the night before so we decided to try it. In glad we did. \n\nThe ordering can get a bit confusing, they weren't overly friendly, but not bad, and they didn't have crepes, even though it was on the menu board. Those are my reasons for not giving 5 stars. \n\nThe pros: the blueberry cream cheese muffin was probably the best one I've ever had! It was perfectly moist and flavorful. I ate more of it than my son did because I couldn't help myself!\n\nI had the quiche which was perfectly flakey and delicious\n\nMy husband got a sandwich of some sort, o don't remember what it was but he loved it. \n\nI also got a chocolate croissant, mmmmm I could use another one right now.","date":"2016-05-07 02:12:07"}
{"review_id":"CfsMa4uvPm1yh_MOWdK5kg","user_id":"-TkSjT0DokgCH01zQd5_MA","business_id":"_iGvLfEsqDwPUxRUAe6tUw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"I decided to hold off on writing this review until I finished my transaction elsewhere and now that it's done I can address this dealer. The dealer was nice and seemed well kept, the people were friendly and didn't feel attacked when we pulled up. We had an appointment with a salesman who was actually great and a pleasure to speak with until his manager got involved. I've purchased\/sold more cars than I've ever wanted to so I knew where I wanted to be with my trade in and where I wanted to be on the new purchase based on the current sales and rebates. The manager came in about $1000 lower than where I wanted on the trade which wasn't a deal breaker until he told us the price of the new truck. It was a few thousand higher than I had figured based on the incentives and I told him that I've already gotten better pricing in writing from other dealers but they were a little further away drive time. He said \"they're not going to honor that price but go ahead and try, you'll be back when they don't\". Let me just tell you that speaking this way to my wife and I assures we wont be back and we did end up saving almost $2000 buying elsewhere. This likely could have been a positive experience but this managers arrogance cost him and the dealer not only the sale but any\/all future service's and referrals.","date":"2017-08-07 19:46:06"}
{"review_id":"HgCY_k1pR9uIauoTCrTcuw","user_id":"KGYM_D6JOkjwnzslWO0QHg","business_id":"ri_uhKinWUEAij7EpuHumA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Wow! I called this company based on these positive reviews and I was not disappointed. It was the first time in ten years of homeownership that I had to call an electrician. Grateful I haven't needed one before, but pleased with the service!\n\nI called on a Friday, mid afternoon. I spoke with Andrea and let her know we were having an unknown issue with something in the pool area. I asked for Saturday service, but she said the next two Saturdays were booked. I was ready to scoot off the phone, but she then asked if the next hour would be a good time for the servicemen to come out. \n\nI was stunned that they were able to come out so promptly and diagnose the issue. It luckily turned out to be a minor issue and the cost was less than $150.00. They didn't charge a rush fee, didn't try to upsell, got to business and got the issue resolved. Dennis and crew were professional and efficient. \n\nOur pool pump had been inoperable for months. We were having out of town guests in and didn't want them to see our discolored water and stagnant pool, but problem solved. Our guest also complimented the pool. Yaay.\n\nThank you very much!","date":"2015-04-15 04:41:19"}
{"review_id":"NtbpWWpWj28UnDyhIl5egA","user_id":"DB4eOe83368MnjJ8nh4QQw","business_id":"RvpSsArnUXRZgC4-I7AyTQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This shop combines coffee, breakfast and coffee break items and a yarn shop (which made my wife happy). During a recent visit we enjoyed well made asparagus and ham quiches with well dressed side greens. There were three regular and one decaf offerings from two area roasters. Service was friendly and helpful.","date":"2015-07-16 10:30:25"}
{"review_id":"7vsixeZiFsfGoI7JxTpqLg","user_id":"URig1W1Y_6P2viLKDx5hkQ","business_id":"d6VYQbeTZ_WdD8Uuhh35dg","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"This is my favorite happy hour place in all of Madison! It can be a little pricey for dinner, but their happy hour is perfect! They have an amazing list of their cocktails, beer, wine and their incredible seafood for insanely cheap. It is comparable with Sardine's happy hour for their oysters, but Tempest has much more to offer than just oysters. I would recommend trying all of their food offers. They are each delightful in their own way. The atmosphere is lovely- simple, elegant, transports you to a warmer climate with their ocean-esque decor. This is truly a hidden gem in Madison.","date":"2016-11-09 21:15:28"}
{"review_id":"OhQ9mROSpzXHvW4MkGgfCg","user_id":"gIWzYF7HQ8FPhPZ8e1xhuA","business_id":"y9xrabvHzo1qgv4UwAiYog","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I'm starting to really like Kohl's as much as I like J.C. Penney. (I like J.C. Penney)","date":"2013-03-18 21:38:16"}
{"review_id":"lkoQOcfylbTBzeqXUGRsCA","user_id":"NX-kJpedLaPNqUJLrmQ7RA","business_id":"xTW5PkLEdMBs2f2W8RGy0g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"So far I just ordered over the phone EXCELLENT Customer service by Jeffery! Can't wait till the food is here. Another review coming soon !","date":"2017-03-15 02:23:56"}
{"review_id":"qdU1O2_ERYJlk6zAlR5kkw","user_id":"AIHzJz0AvTq0FxCLtBhOZA","business_id":"ms7cmWkPiSBDTnz-1sv2kQ","stars":4.0,"useful":11,"funny":9,"cool":10,"text":"I'm the newest fan of Ticoz after trying it last week for the first time. Myself and two wonderful ladies...shout out to Dottsy Z!..hit up happy hour on a beautiful Wednesday evening. Only happy hour turned into happy HOURS! \n\nThings I loved: \n*the over all vibe and styling of the place. Great decor and great hint of Spanish flair without over doing it. \n*the food was excellent. I had some chips and salsa which were pretty standard. The tacos, although, were outstanding. I had one chicken and one beef. The beef was AWESOME! I am trying to eat red meat only two times per week and I may just have to have both meals be these tacos! \n*The service was great as well. I've heard people say this place is \"gay friendly\". This day and age, \"friendly\" anything is wonderful. But seriously, our server\/bartender was very knowledgeable, friendly, and prompt. \n\nI can't wait to head back to dine on the patio and explore the menu more!","date":"2009-10-13 05:23:11"}
{"review_id":"FR9rskLXjcJPJwLPEWyqxw","user_id":"WfvvwznNNm-gLUzd6hEE2g","business_id":"5DDumAHRKumv3gZiPKW6iw","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"I only have one complaint about nami. If you order brunch togo, they have no system to handle it and you can end up waiting in line for your pick up for about 10 minutes. Other than that, everything is phenomenal. Their pastries, great. Their coffee bar, great. The soy-namis, are a vegan blizzard alternative that are way better imo. If you are vegan or vegetarian this is a must, and soon to be your regular spot. Please come up with a system to continually call out for your to go people though, thanks!","date":"2015-12-20 19:43:44"}
{"review_id":"61AzPGWjBi7XYSGFF7y6YA","user_id":"Rikv4FMxgUmrdxTK6wzYTA","business_id":"oLeNHOEqeuFFgDTprUNXqg","stars":1.0,"useful":2,"funny":0,"cool":0,"text":"Awful!  Went to AT and T bc my pictures are fuzzy and was told phone was defective- the lens.  Went to this store and although they had people swarm me anytime I looked at any product - NOBODY could see me about my phone.  Service after the sale of my six plus= zero.  This is exactly why American companies are folding.  Worship the dollar- big bucks.  The customer is last!  The atmosphere in this store is equivalent to a used car lot meets a strip bar.  Never again!  Sorry Apple- for being such a \"liberal\" company you love the dollar- but care little for the people unless one waves $$$$$$$$$ in the air.  Your store is a big silver pile of dung -","date":"2015-06-21 00:18:30"}
{"review_id":"yAtzlRwK9z1M18f5G-61Hw","user_id":"VZJ8zIZ-B3RKGddjeCI8tg","business_id":"S-RaYhvlDg8rgEOxaFeLHw","stars":1.0,"useful":3,"funny":0,"cool":1,"text":"Worst Chinese delivery I have ever got. Food arrived in a small bowl size for $12-$15 each. Delivery took 45min and had no sauce or utensils. Food was poorly seasoned and some vegetables were raw in stirfry.","date":"2013-10-24 03:02:55"}
{"review_id":"u6-xiS0Yz7yJ7MZqaJrf4A","user_id":"fRrLGNlpn3_3QItwgS_uIg","business_id":"0CElIQnJdQYF2bmsAiWczg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Had such high expectations from all the recommendations I got to try this place. I must say that I didn't see what the hype was all about after my visit. We ordered the traditional breakfast and build your own omelet. For starters, the toast was burnt and the eggs weren't cook as ordered. The hash browns, eggs, and omelet needed some serious seasoning. I ordered bacon and ham in my omelet, but if they were there they were masters of disguise. The person that brought our food was helpful, but nothing to rave about. She got us non-burnt toast, scrambled eggs, and jelly. Nevertheless, we won't be returning anytime soon. For the price paid I expected more, could've got better tasting food somewhere else.","date":"2016-08-12 22:28:06"}
{"review_id":"rG-tybpMLispBrCLX0YmtA","user_id":"MdTzTTeRk_6VIKvG5KNknA","business_id":"e6W3BJwtPE7VzwkCNrjcKw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"This is a clean friendly establishment.  The tech did a terrific job on my gel manicure.  The price is a bit higher then what I typically pay at my regular nail salon in Queen Creek.  But, it was my choice to go here so  I paid the few dollars extra to squeeze my nails in on my lunch break. My one complaint is the lotion they used on my hands and forearm after the manicure.  It smelled like old lady!   And don't get me wrong I love old people.  I am very close to being elderly myself.  But, I do not to want to walk around not being able to stand the smell of myself. DO NOT let them use the lotion on you.  I had to scrub my arms and hands 5 separate times before I got the smell reduced  to where my husband could stand being in the same room with me.","date":"2018-08-23 20:59:00"}
{"review_id":"vIyj4OgSimM93C9avVQg3g","user_id":"LvsYVLTJb8bA5EBMWAeVzA","business_id":"Ns20WGWn6s6niKAGIQB4UQ","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Came here yesterday with a group of 5 for their 2000s R&B\/Hiphop partaaay! Great atmosphere & great music reminiscent of the good ole high school\/college days :) Some friends went to their 90s R&B\/Hiphop event a few months back & enjoyed it too so go check that out! I want to come back for a flamenco show. Anyways, my 5 stars has to do with the set-up of this place. (Note: I've been here once before for post-dinner dinner since the fattie in me got hungry again. Ate their chips\/guac & Sonoran dog & it was good. Get it if you like dirtydogs). \n\nAs I was saying, the set-up is nice because the outdoor area allows you to enjoy the food while having an audible conversation, but if you're curious about the live band\/DJ\/show or want to just vibe with the music you can sneak inside and grab a drink by the bar. And perhaps you like what you're hearing and want to dance it off ... the dance floor is yours! Our cover charge was $5 at the door for guys\/girls ($3 if purchased online), I'm not sure if that's always the case. I REALLY liked that they have these \"bleacher seats\" extended across the back wall so if you're tired from dancing or maybe you don't like to dance at all but just want to enjoy the music, you can just chill back there without having to  pay for a table or deal with all the inconveniences of a swanky club.  Big plus for all you ladies in heels who need to rest your poor little toes!\n\n*Parking: Plenty of metered parking and lots.. use them! I thought we snagged a great non-metered spot for free on the side street, but it was a fail & I got a parking ticket for being too close to a fire hydrant :( So watch yourself!","date":"2015-01-04 00:59:33"}
{"review_id":"RiTql8ihU6Dw3ht_n08Oig","user_id":"AjVmvF5eSoznZNKjmd_Spg","business_id":"PL3cimEUfNHlenOGSOAdJg","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Amazing! This place has the freshest tuna tataki I've ever had. All of their appetizers I had and all the roles we ordered tasted amazing and fresh. This is probably the only time I can say I don't have a picture to post specifically cause I ate my food too fast","date":"2016-05-19 06:11:44"}
{"review_id":"ZfbvauDmg9tjRvJ35wKZOw","user_id":"3WVLDJ6u578iC5E6rO4eZw","business_id":"aqMfCbFNeWn1a4Evds83fg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"$12 after tax and tip. The sandwich was really tasty and the Dutch bread was outstanding - both crispy and chewy - but I had a sour taste in my Christhole after spending so much for a sandwich.","date":"2014-10-11 12:12:37"}
{"review_id":"hetUqJDhs4Dur1wVE-iSlg","user_id":"xApIDag8sgxCiguyPHMWsA","business_id":"F2pfjAZ_3dMTGCKv6c5wOw","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Had a date night with the wife recently and decided to try Momocho from a recommendation of a friend.\n\nI saw all the reviews and decided to go with the Guacamole sampler.   We got an original, crab, and pineapple habanero as our choices.  Original was just regular old plain guac.  I wouldn't get that again.  Not with so many different choices to choose from.  Next, the crab didn't do it for me.  My wife liked it, though.  So if you don't like seafood in your guac like me skip the seafood options.  My favorite was the pinapple habanero.  Simply outstanding.  Next time I may opt for just 1 guac and some salsas.\n\nMy wife ordered the pork carnitas and I had the hanger steak.  Both meals were completely cooked to perfection and was more than enough food for dinner.  Heck, the guac was more than enough.\n\nI ordered coffee and jalapeno bread pudding for dessert.  Coffee made with cinnamon and brown sugar?  Was amazing.  The bread pudding had the jalapeno taste without the bite.  Was also to do for.  I highly recommend it.\n\nThey tell you when you make the reservation that your experience will last about 2 hours.  That was spot on.  We didn't feel rushed.  Nor did we feel it was too slow.  We thoroughly enjoyed ourselves and will easily go back.  The best part was I didn't spend as much as I thought I would.  So its very reasonable.","date":"2013-03-19 00:19:06"}
{"review_id":"3984mdgQ8W_ORofktoUkyA","user_id":"yrTZ3Z_k-bYS4q5izF8d5w","business_id":"zeKmH-EPyxEugnuJsjpYlg","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"It seems this Lenscrafters has two account, so I don't mind post on both. \n\nTheir policy(30 days adjustment guarantee) is great and the specialists are professional and nice. However, the managers(a man and a woman) are terrible. I deeply felt I was treated unfair and discriminated either because of my race, or because the purpose of my visit was to fix the glasses's problems.\n\nInstead of fixing the problem of the eye glasses they provided, the male manager would prefer to spend time on getting new customers. I went to Lenscrafters to fix a problem of my new glasses and unfortunately it was a busy day for them. He said to me that he would recommend me to come another day because they were busy. Before and after he said this to me, he didn't say the same words to all other customers who needed to get a new glasses or to pick up a glasses. He quickly assigned them (many people came after me) to specialists' tables and let me wait at the shopping area for 30 minutes. Was that because I was Asian, or because he didn't taking my request(fixing the problem of the glasses) seriously? Both.\n\nWhat the female manager only cared about was getting you out of there as quick as she can and getting more customers. The third time I went there to pick up an adjusted glasses, the female manager assigned me to a specialist's table. I had been waiting for 20mins at the table, which I thought it was totally ok because they were busy. However, when a specialist finally came to me and started to help me to adjust my glasses, the female manager came to talk to the specialist right away and said \"after you get this done, I want you to go to another table.\" She pointed at the table where two white female customers JUST CAME 1 minute ago. That specialist hadn't even started helping me yet and I could sense that he felt awkward, too. He was nice and tried his best to adjust my glasses. During this time, the female manager came twice to our table to rush him go to another table to serve the white ladies. I ignored her and kept talking with the specialist about my glasses. I needed to get my glasses adjusted right since that was the second time to fix this problem. The female manager kept standing 1 meter away from our table and starring at us the whole time. I guess to this female manager, white customers were more important, their time was more valuable and they should not be waiting for a \"long\" time. Therefore she believed that she could rudely and frequently interrupt the service I was receiving and ask the specialist who was helping me to quickly get my part done and to run to help the white customers. If this wasn't her logic, I didn't know what her logic was.\n\nI wouldn't go to Lenscrafters again. Terrible experience.","date":"2018-04-27 23:33:29"}
{"review_id":"aMykY1iH3ObA2-BhqrY8aA","user_id":"cpG9KsQSYpKRx8fp4ZzQ7Q","business_id":"dWXZEl9XQ9wa0e7W6aRs-Q","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"So as I was checking my mail I seen a flyer on the mailbox, I wasn't going to call, but 1 day I was in need of house work due to family coming in town. I called them and they came over the same day maybe 2 hours after I requested service. That was 2 years ago and they still clean for me, and they also clean all 4 of our family businesses.. Great company and very professional.","date":"2016-12-19 20:38:47"}
{"review_id":"p2p2DnQ2E7tz9EP-RORvvA","user_id":"9gGBWOizovVfaR7fxeXzHg","business_id":"nnDLapJk1z2NJE0-XzwMlQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"This \"was* my go to steak house place in Vegas. I come very often. This is my anniversary weekend and this place just ruined it. I asked for a certain bottle of wine per arrival....and once arriving I was told it wasn't available anymore. They has a different bottle as an alternate. Fine. Once getting the bill I notice it's a good $25 more than the bottle that I usually order. I ask then about it and (what i assume is the manager) comes over.  He asks me if I was made aware of this by our server. I inform him I don't even know how are server was because we've have at least 4 people serve us. Which is not the norm when we have our usual server serve us. He informs us that hes going to ask the server if she informed us. If she did we would be charged accordingly..if not he would fix it. He finally came back and told us that she had informed us in which we said we would that's impossible. End of story they weren't going to discount us a dollar and we're paying whatever they say because they said so. \nI haven't even mentioned that not once did we get our wine refilled.....and we had to wait 1 hour to get our order fulfilled. Worst experience ever. Especially for a anniversary. I never not come here on my visits but this could be the last time I ever come here. I will reach out to the higher above. This was just unacceptable for a $200 meal for 2 people","date":"2018-09-14 06:06:38"}
{"review_id":"QPn6Y6QfeIA5p4_E4XqiEA","user_id":"5zhcJBcdPFiN-JAooU1T2Q","business_id":"9Jo1pu0y2zU6ktiwQm6gNA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We have been there twice now.  The fish tacos are absolutely the best I've ever eaten in a restaurant, period, and I am a fan of fish tacos.\n\nThe coconut shrimp appetizer is also very good.\n\nI gave it only four stars simply because we have only tried a couple of items.\n\nNeed to try the clam chowder (when it cools down a bit), and the fish pasta before I can give it the 100% five star rating!!!\n\nThat said, the fish taco's are a 10 STAR in my book.","date":"2016-08-25 14:12:37"}
{"review_id":"MCHdwf5oVa33OTahTaGEeg","user_id":"fGQs_qMMIwPUugPYnd4O4g","business_id":"6kkxRV8H9SQLybj0xnEbMw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Went for my birthday....we got a discounted rate ( but it's more then we usually pay). We got to our room....first all the curtains were closed...very very dark when you walk in...the room was nice, but then we had a balcony ( with a view...she said). There was nooooooo view....other then a view of a roof and a big wall. I wasn't happy with it and called down to the front desk and asked to be moved. They upgraded us to a bigger room that overlooked the pool for $ 10 more a night. The room was HUGE and a beautiful view. The hotel is just beautiful. I just love the fact that you don't have all the party type people from the Strip mentality here. It's really not that far from the Strip...if you go, but there is tons to do right near there. We will be coming back!","date":"2015-05-26 12:26:24"}
{"review_id":"gpc8RQrpaYwCmLphtGHmaw","user_id":"BQzpZ07bFYVsUwpvsACVYQ","business_id":"wjLgM9Ybe5shoUPRrGMmsQ","stars":2.0,"useful":3,"funny":0,"cool":0,"text":"Food is good, coffee is good, location is relatively easy to get to and park at...so why the 2 stars?\n\nThe service sucks a lot.  Started going to Coca a few years ago and the service staff used to be super nice.  I always expect a long wait, but they always made you feel welcome, so I didn't mind.  However, the past 3-4 times I've been there, the service has gone WAY downhill.  From the greeting to the service at the tables...wow.\n\n2nd to last time I went I was told \"1 hour\" for 3 people.  Stood around outside for a bit...got cold and went inside to buy a to-go coffee (which I've always been able to do before).  Was told by one of the servers that it was \"discouraged\" to get coffee before we sat down, so we can go get coffee down the street...in a condescending \"why are you bothering me\" tone.\n\nUm...you discourage people to buy coffee from you?\n\nLast time I went, another 1 hr wait for 2 people.  Came back 30mins later, and wanted to see how far we were on the list.  The server snatched up the list, and said \"An hour from whenever I first told you\" and walked away.\n\nNice.\n\nSo we went to Square Cafe instead in Regent Square...just as busy, just as many people...but far nicer and actually apologized for the 20min wait time.","date":"2011-04-22 02:24:43"}
{"review_id":"gE-LzWhYlevHLJYlcE57og","user_id":"v1FpDzIX3zfBkcNlW_eAsw","business_id":"Iq1P8S3--gqd50xoQJxpqA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"For fans of Basik Cafe or the Hawaiian acai bowls, this is the place to come. Great selection, plus ability to add extra toppings. My favorite is the North Shore bowl with added cocoa nibs and bee pollen. Perfect for a hot day","date":"2016-07-03 19:17:49"}
{"review_id":"ivgEqtt58Fm2U0HXDK5eOQ","user_id":"60skTN6p8SdQ2sGNKL0vRQ","business_id":"q3YnYPjLuBGRDi_59yTC5g","stars":4.0,"useful":1,"funny":1,"cool":2,"text":"So glad this place is close to home! Been here a few times and I'm happy to say their food is always consistent. You can't go wrong with their pho (I like the combination pho) and the rice dishes are good choices too. When I'm feeling extra hungry, I'll order the fried egg rolls which always hit the spot. Service has been great the multiple times I've been. They also do a great job of keeping the restaurant clean.","date":"2017-12-02 18:47:33"}
{"review_id":"3_RgLiyIVlow2vRQiG_CGA","user_id":"bzapbb28xMO0NE9oRK27gg","business_id":"i066yR2IDP4FWt6p-k9aFg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Fantastic sandwiches, especially if you go with the legendary Dutch Crunch bread. They also have authentic SF sourdough which is very good. Sandwiches are huge, though quite pricey. Service can be a bit slow if there's anyone in line ahead of you. Be aware that all sandwiches are hot \"unless otherwise noted\". Found out the hard way when ordering a ham & swiss by phone that I wanted cold - wasn't asked which way I wanted it, so hot it was. Also had more stuff on it than I asked for. Still quite tasty though.","date":"2014-05-25 21:31:09"}
{"review_id":"CH__aL1d1Xm9AmEG-Khghw","user_id":"kWKBVdF0HW5A7wH8B9Gi-A","business_id":"3eexaenBq8HvkTiYjVl3Pg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Finally a good sushi place close to home. Ordered the double rainbow roll and it was fantastic. Well proportioned and presented. Also had the pad Thai and the coconut soup. Both well flavored but the soup could have been thicker. The staff were very friendly and the space was very clean. Will definitely visit again!","date":"2017-06-27 22:55:36"}
{"review_id":"keDg7NWPivsdbRlYvY6D8w","user_id":"yExLpVbCfVqVixYwzMaeZw","business_id":"EkOqxlglUpw9YUdnTbbJKg","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"If your Open sign is on, it's twenty minutes until your posted closing time, and all the lights are on, don't look at me like I'm an idiot for wanting to place an order. (The floors were already wet and they'd been in the process of closing for awhile judging by the bleach smell.) \n\nSeriously, I wonder if the manager knows about shutting down a full half hour before closing.","date":"2013-12-07 00:51:45"}
{"review_id":"c30DKR56Ajqdh7b6hvOttQ","user_id":"gnF5zBp0n-PxNtE9ORgEOA","business_id":"V3Hz6fC1w4TQJj-PkXMiRw","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"Tower City Center\n50 Public Square\nCleveland, OH 44113\n\nIf you ever find yourself in Cleveland, you cant go without visiting the Tower City Center. This Historic land mark used to be know as the Cleveland Union Terminal and signs of its history are everywhere. \n\nThis unique center is connected to two hotels (Ritz Carlton & Renaissance) a huge casino (Horseshoe), an 11-screen movie theater, 100 shops, 6 restaurants, and  Cleveland's mass transit system. (RTA). They also have connected walkways to Progressive Field, and Quicken Loans Arena.\n\nThe Skylight Concourse is definitely something to see; this four story (+) tall atrium overlooks the Cuyahoga river hosting a food court and cinema. Here you can grab some stir-fried veggies at Sakkio Japan, Bourbon Chicken at Kelly's Cajun Grill, or just a warm pretzel from Auntie Anne's while enjoying the scenery of  downtown Cleveland and Ohio City.\n\nThe holidays at Cleveland City Center is truly a sight to see. In December they have a 40ft tall Christmas tree with larger than life hanging mechanical ornaments, Gingerbread village, and the best thing ever, the Twigbee Shop! Here you can bring kids under 12 with their shopping list for parents, grandparents, siblings, aunts, and uncles and a volunteer helps the little ones buy gifts under $10 that are pre-wrapped. \n\nBesides all the cool shops, you can truly just get lost in this place and enjoy the sights and sounds. Eat, drink, shop, eat, drink, shop... How can you go wrong with that. If all else fails, go blow your shopping money at the casino.\n\nOne of my favorite amenities at City Center is the subway. Cleveland's RTA rumbles below the center giving you the feel a bustling metropolis. Here you can jump the sub and go pretty much anywhere you want in the city, and the mall resembles an oldtyme train station. Just the architecture alone draws me in, I can spend an entire day meandering the halls, people watching, sipping coffee and munching on some delicious treats.\n\nTower City Center is a safe, clean, and fun place to take the kids, watch a movie, or blow your paycheck, just remember to get your parking ticket validated.","date":"2013-10-03 13:18:24"}
{"review_id":"I0gHKauDYq1NfJL4WCD78g","user_id":"OnXhnZQPTCENYVE1pCGXOw","business_id":"tMdgY7Ou4k3bYZZulJCiuQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The Bronze Cafe' is my favorite little gem in town!  From the chef,  the staff and food you will never be disappointed!  Everything is made Fresh with the highest quality products!  I have dined in,  taken out and catered and without fail each time was phenominal! You will never be disappointed!  They offer GF, Veg, Vegan, Healthy and homemade.. try a sandwich or make a sandwich into a salad.. the \"bizzness\" is YUMMY and the vegan \"cheescakes\" are to die for! Make sure you try this little cafe' that will surely become your favorite place too!","date":"2015-01-03 23:40:40"}
{"review_id":"7FST-sBd5BWxuEzWWHjSnw","user_id":"jsOz-dWToun2VsFcFAfGww","business_id":"G8WVrozcBBKZozhU7Gf6zA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This location is convenient for meeting my husband for dinner after work. The food is consistently good. Service is okay. Love the ribeye and baked potato.","date":"2015-01-03 21:18:40"}
{"review_id":"oUT4p8SUtHFJIRG_-ItWcw","user_id":"EIOEHrQER66zrgHjvDFxIA","business_id":"TYZIMuHwhZo_Hizenmf8Pg","stars":1.0,"useful":1,"funny":1,"cool":1,"text":"Wandered in today to watch some of the Steelers game. We ordered some spinach and artichoke dip which came out with greasy tortilla chips and was cold to lukewarm. We asked if they could heat it up and after waiting another ten minutes we were given another batch of lukewarm dip. I was starving so we stayed for some Mac and cheese which again was... You guessed it... Lukewarm. Since no bartender felt compelled to check on us at any point, we let sleeping dogs lie, cashed out and left. Will. Never. Return.","date":"2015-12-20 22:01:47"}
{"review_id":"xCTr59dDkbBZW-ECpp9-OA","user_id":"FTuP9fCw4zJXgI-1xSSjVg","business_id":"4sPB5HKm2-r_zOTIsyVpXQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Food - YES! \nNot much on the bar part; but the care taken for the preparation of our food today was unparalleled. I ordered the catfish special today - panfried to excellence, the coleslaw (homemade, not outta plastic container) was extraordinary. Also ordered were the open-face turkey sandwich and turkey sliders - reports were great on them too.\n\nWe will be back for the food for sure.","date":"2018-02-23 23:26:58"}
{"review_id":"uCnEqsIDozNk6XKr0MJNCg","user_id":"OqX5J5l9aPHzxYZ2EAD1YQ","business_id":"yNPh5SO-7wr8HPpVCDPbXQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We went last night for AZ Restaurant Week...I really like the atmosphere, much bigger than I thought it would be!  We had a reservation so when we got there, it just took a few minutes, then we were seated.  I got the spicy sausage and vegetable soup, it was really good, nice and spicy!  My husband ordered the meat and cheese plate, it was fine, just average.  I'm sure if you were to custom order this, would be much better.  The entrees that we ordered were the Jambalaya and the Short Rib Stew.  The Jambalaya was a huge portion and quite tasty, spicy, smokey, delish.  We were really looking forward to the stew, we had seen it on the cover of Phoenix Magazine, kind of disappointing.  It seemed a bit bland, it if wasn't for the amazing cornbread, would not have completed the dish.  For dessert, we both had the salted caramel pudding, best dessert I have had in a long time.  I don't think I have enough descriptive words in my vocabulary to explain this....just salted enough, creamy, decadence, perfection.  \n\nAll in all, a really nice meal!","date":"2011-09-25 17:48:07"}
{"review_id":"SFOUTC_P_3PomPvYIILfZQ","user_id":"lbPuJJAT5YsgAh36mU3dDA","business_id":"KWojrEKjUqHCRI5HO7pB4g","stars":4.0,"useful":0,"funny":1,"cool":0,"text":"my friend and I had a marvelous time at the gallery, though admittedly we didn't leave the first floor. we got lucky because I found out that free night coincided with our very first night ever in Canada!\n\nI really loved the room that juxtaposes the French Academy style with more progressive impressionists. I couldn't stop staring at the big Monet landscape. I also thought the temporary exhibition of Japanese photos from Hiroshima and Nagasaki were really special, albeit sad. My friend particularly enjoyed the medieval stuff. all in all, a nice mix, and a good way to spend an evening","date":"2015-09-24 01:21:11"}
{"review_id":"0YYee5a_4dKRIwX7eFgn-w","user_id":"oF8Efb3fBrwWZvmsl6e-pw","business_id":"P3dBcZh_Hmr1wVWFZn2b-g","stars":2.0,"useful":3,"funny":0,"cool":1,"text":"I've totally given up on this place.  \n\nThe staggeringly bad choices for Asian food around Moon \/ Sewickley are just all around.  \n\nSince I live nearby, I hit this place as a default setting.  Kung Pao Chicken ($11) and Shrimp Toast ($7.95).  It adds up in a hurry and by the end of the meal, you wonder, \"Where did it all go?\"  Or if you are feeling a little on the existential side, \"Is that all there is?\"\n\nFor the price, the Kung Pao Chicken tastes cheap and rubbery.  On the good side, you get plenty of this cheap and rubbery chicken.  Flavor is just meh.  A bit on the bland side sometimes.\n\nThe Shrimp Toast is OK.  Most times I have ordered this, it comes burnt.\n\nSince it's mostly pizza places that deliver to our house, Hunan is the only non-pizza option that delivers.  If I order Kung Pao and Shrimp Toast, I easily get to the $15 minimum delivery threshold.  But, in the end, I should have just driven myself to Leetsdale or Robinson for something better.\n\nOn the upside, if you do end up eating inside the restaurant, very nice people work there.  But, the food coming out of that kitchen is just bland, bland, bland.","date":"2013-10-03 13:08:49"}
{"review_id":"E-y_6Q-QAqbl1Q08dGowYA","user_id":"bzlk2220emHP6GLwijWEUg","business_id":"mGcNhuOzpgc3colTDjI1bw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great pedicures, complete with rose petals in the water, but would skip the manicures.","date":"2016-07-25 04:47:27"}
{"review_id":"IjsmSX4vao-5VSkZtQOXUw","user_id":"ZSnkv1FIThtGxScir26jvg","business_id":"_wzOIEtLYEp0FftxGwV2zg","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I like the food here. They are not American Chinese food and really delicious. However, the service is not good. I ask for less spicy several times and the waiter always promise but the food is the same as before. Another issue is that it is always full of people and you might end up sitting with strangers together. Since the business is so good, I think they don't really care about customers. For example, if you ask for some drinks before the meal, they always forgot and you need to push them several times. I hope they could increase the number of tables or rent another bigger place, so I don't need to wait every time. Hire more waiters. Work on customer service.","date":"2016-02-23 18:01:33"}
{"review_id":"13AWsnaqkGTpOtYl7Wfjug","user_id":"AUpjuj0NsY5piiFHRVGaCA","business_id":"TFdLM8R_7Pf1xVeBNKl0hg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We had a great dinner here last night. From the calamari app to salad soup dessert it was wonderful. There were 5 of us we sat in the front area. Service was wonderful as was Brianna who made it all special. Thank you Casbah and staff for a lovely night.","date":"2017-02-19 12:59:09"}
{"review_id":"uQ-5vCbs06A9_YTiFII10g","user_id":"1-c5fkvmpp6RqOLlJYd98A","business_id":"AwlvIsKDqB5LeKNWC6k4kQ","stars":5.0,"useful":4,"funny":0,"cool":2,"text":"I have been going to the museum since I was little, and I've been completely spoiled by it! I've visited many other museums but nothing can rival it, the modern art collection is superior to the Tate Modern, the antiquities selection (especially the armory) is better than the Louvre. \n\nThe CMA benefits from great editing, every room flows from one to another and every piece is beautiful and selected for a reason. You don't have to fight through the crowds in order to see pieces, and there's a relaxed feeling- you can come and go as you please and take the time necessary to truly appreciate an amazing collection.","date":"2011-05-27 16:29:43"}
{"review_id":"aW88dYwi110a5f1s0schmw","user_id":"KW-JxC5MVovsKs4s7XlQYA","business_id":"q4CjxLPsMCAPeST0lcQlOg","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"Okay can this shop be any cuter?!\nThe staff were so happy, and nice!\nThe cupcakes were amazing! I had a cannoli cupcake and it was the best thing I've ever had in my life! Cannolis are my life!! Growing up Italian I love me some cannolis but a cupcake cannoli?! Holy moly! \nI would recommend this to all my friends and family!\nI need these cupcakes when I have a wedding!!!","date":"2015-01-18 18:33:32"}
{"review_id":"442KgoqN5hnwJNEmN4NkCA","user_id":"Zdd1Ewoe8iR-gheniT0yow","business_id":"7sb2FYLS2sejZKxRYF9mtg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"This location is located right behind my office building. We start work at 6am. By the time Sakana opens at 1130 we are well ready for lunch. \n\nThe food is so very good, however the service and lack of regard when it is mentioned is atrocious.\n\nIf I call a business at the time they open(1130am) I would expect for someone to take the call. Not the case with this location. I have had the phone answered, been asked to hold, then proceed to wait 20 mins for the person never to pick the phone back up.  \n\nIf you advise them of multiple orders, they still pack everything together in as few boxes as possible making it hard to separate the orders. \n\nWe call in our order due to only having 30 mins to eat.  Pre-ordered food is a blessing as it literally takes 4 mins for us to get there and pick it up.  Going in and ordering takes 25 mins just for them to prepare it, which means no time to eat. \n\nSo sad that I will now have to find another sushi spot that can be delivered because I can't spend any more lunch hours hoping they will answer the phone.","date":"2018-02-01 21:30:21"}
{"review_id":"M1qHKvyvAipW1IMghPhZEg","user_id":"kiifWjFj0hjdMST9ly_AUQ","business_id":"7sb2FYLS2sejZKxRYF9mtg","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"What a great little place! \n\nThey offer a 2-for-1 drink specials all day everyday with All-You-Can-Eat for Lunch and Dinner 7 Days a week, including an appetizer and dessert item! \n\nThere are literally over 100 rolls to choose from, categorized by style (Baked, Tempura, etc.) Be careful though, anything you don't eat (unless you don't like it) they'll charge you for individually. I suggest (as do they) ordering little-by-little and opting for half rolls, when you can. This is to prevent people from ordering extra rolls \"to-go.\"\n\nMy friend and I sat down about 2pm on a Saturday and the place was occupied but not packed full. Our waitress was also very patient as we perused the menu over and over each time to decide what we wanted. Running staff was attentive at refilling our water glasses regularly but the one odd thing was our soy sauce bottle was replaced...three times. THREE! The first bottle was half empty, the second 3\/4 full and the 3rd completed filled. It wasn't obtrusive to our meal, just comical. \n\nEven without the All You Can Eat, the prices were incredibly reasonable. It's not much for ambiance, but it looked beautiful and tasted great!","date":"2017-08-28 21:04:07"}
{"review_id":"SuLiHxGI6oEVvG6wbgIBCA","user_id":"-3L0d2OoL7KOVgHrxybdjw","business_id":"ZJ0gQp0fcnIDiZv0m9--Gg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Nice little restaurant, very clean delicious food! I Recommend to anyone that enjoy healthy and exotic food","date":"2016-01-30 04:55:21"}
{"review_id":"X2tt3i0cOgQjBZbzcM_yVw","user_id":"opPG4vzwLiDaSS3wkbjVLw","business_id":"kJ_Rke1dt9zpbJp9lX6sXw","stars":1.0,"useful":2,"funny":2,"cool":0,"text":"Let me start off by saying i am a local and brought some friends from out of town here.\nThis is by far not only the worst IHOP I have ever been to but the absolute worst  restaurant. We asked for one extra mozz stick so we could all have an even amount. The waitress didn't say it would be extra just said she would see If she could get us an extra one. When our meals came they were cold. My hashbrowns tasted like they just chopped up a raw potato and put it on a plate. Our waitress never came back to see how the food was and just brought the check\n When we went to the cashier she was too busy talking it up with a coworker to help us. Her coworker said \"you have a customer\" and she said \"oh do I?\" And continued her conversation. When I asked her about the extra food charge she was complete bitch. Needless to say I will not be going back. \nI wouls give zero stars if I could.","date":"2015-07-16 18:40:05"}
