{"review_id":"VtKdH_RC3lUBqYfwVASvcg","user_id":"31vWyBOQK3jEOa7uI5BItw","business_id":"HThLR9ln5hLPL24-7TyWtA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Tasty authentic Caribbean food. The staff ensured a great experience. You could tell the ingredients were fresh. Highly recommended","date":"2018-07-07 21:25:36"}
{"review_id":"uwrAdGCzMajeaL3jfTanZQ","user_id":"rzogkr0IdZ3kMsjtCFnNTQ","business_id":"BsvCTCVG7lrzXZ68VyyIcg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Dinner at Lago was fantastic, from the setting to the service to the food and drinks. We sat outside on a beautiful fall evening, with the sights and sounds of Cleveland's Flats gradually coming back to life. It's a great menu, with lots to choose from. We had the calamari (sauteed, not fried, in a delicious tomato sauce that was perfect for dipping lots of bread in) and the homemade pasta with meatballs. It's the best of comfort food, with enough imagination and elegance to make it special. I had a delicious easy glass of pinot noir and my boyfriend had a gin martini -- we agreed it was exactly how we like our martinis: extremely cold, with just the right balance, and awesome cheese stuffed olives. Our only disappointment was the mushroom pizza--the crust is nothing special and the toppings were just ok. We were so happy (and full) at that point, the so-so pizza didn't faze us at all. We'll just stick to ordering pizza at Humble in Lakewood, and come back to Lago for the pasta. A great evening all around!","date":"2014-09-25 12:49:26"}
{"review_id":"Kt81ltQCzVqC4Yp2FCfxwg","user_id":"rHSVWkn3mKI76_Ya94e5pw","business_id":"Y-hmtitiRfg7vmc3N-lTww","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Had dinner last night there with my boyfriend ! \nWe both had the specials which we should have shared !\nSo delicious we didn't ...thank you Chef Habby for amazing dishes once again ! \nMaria for your outstanding cream puffs & cheesecake ...\nA must try in the Fountain Hills area ...\nOpen Tues through Sunday night !\nGasper & Maria put so much love into this restaurant & always make you feel like family !\nAlso great happy hour in bar area :)","date":"2015-08-30 16:57:03"}
{"review_id":"LMXYGWn6ZLHZhJoxzeDWsw","user_id":"wcetZS9uBBDk0oo0Ke8QlQ","business_id":"4vkOZ0kW4Hor43XqqNc0Og","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Excellent Thai food. I had the red curry with duck and my wife had the spicy noodles. Both were great. Very fast service too. Definite recommend this place while downtown.","date":"2016-10-13 21:37:34"}
{"review_id":"-2zgXooVg1btx8-9zvQhhA","user_id":"frWrWdOAdHF3vgeZN4n1kA","business_id":"U9aA5H13y7t9xWnoQslV0Q","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Pretty tasty!  We ordered the Pork and Shrimp Dumplings, Beef Bejing Pancake, and Beef Chow Mein.  I'm not a fan of seafood, but I did try the dumplings.  They were really \"shrimpy\"  which I guess is the point.  LOL.  The Beef Bejing Pancake was interesting.  It kind of looked like a burritio that was cut into slices.  The outside was crisp and the inside was very flavorful.  There was something cold inside of it.  I didn't take it apart to see what it was, but it kind of threw me off.  It wasn't bad, just different.  I still ate it.  The Beef Chow Mein was great and it was enough for me and hubby to share.  I also had Shanghi Wave (drink)?  I think that was the name of it.  Soooo good.  We will definatley be back.","date":"2016-02-11 22:13:20"}
{"review_id":"rTleiLjf5hZTRo2Pm9WhAg","user_id":"2FQYeCcKvmKkFZjBbLwPNw","business_id":"dUxjXr192ci5pjlSKxflxA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"The Broadstone Stetson is very helpful. I have called multiple times asking questions regarding my new apartment, and they are always responding quickly and are happy to answer any questions I may have.","date":"2016-05-31 03:18:07"}
{"review_id":"8OR3JAl_gwCbJqQslHd7vQ","user_id":"gp4Nwsy6V-2txXz02Tiajg","business_id":"YTCCJ3ShO-zg0dlx1nk6dw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Absolutely fantastic. It was our first visit and our server made some great recommendations. Highly recommend the Devils Advocate as a cocktail. The ribeye was awesome and the sushi was incredible. Don't miss out on the sticky ribs and the duck confeit fried rice.","date":"2017-01-14 23:02:40"}
{"review_id":"3mY_dYqCVgBPHIt2aXfg_w","user_id":"pOaggzSl7NLYl2562tej9w","business_id":"Quayv4ZFz7z9xKQHnXbQQg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The service was excellent! Try the stuffed pork chop it was amazing. Ask for Tracy he took great care of us. For the dessert try the chocolate caramel souffle it was delicious.","date":"2014-10-27 02:39:45"}
{"review_id":"-v6qMsfFPY4VZvGj0sbTvA","user_id":"ko06Ptkr1YtZWR6FIDqubA","business_id":"T8jY7FB0JEK62CwOeXBa9w","stars":5.0,"useful":3,"funny":0,"cool":1,"text":"This building in the heart of the \"18b\" arts district in Downtown Las Vegas may be the saving of culture in the city. This two story building situated on the corner of Charleston and main st. echo a past of Vegas as well as carving out a unique future for the art community of Las Vegas. As the heart of First Fridays, a collective of usually 10,000 people every first Friday of the month, it serves as the standard for whats happening in Art. There is always some controversy, and always fantastic art. This is a must do in Vegas.","date":"2007-05-20 19:10:16"}
{"review_id":"UJSQOrStBH3MeASArQtlcQ","user_id":"VGqf8HfYwkEnBKQ1Y6yrhA","business_id":"3gnQUW3pzKE32RenMfuf9A","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"We really enjoy coming here for breakfast on the weekends! The food is always delicious and the staff is very friendly and courteous. HOWEVER, during our last visit, we noticed a gentleman standing around, near the hostess stand, performing the duties of the hostess. He had such an unfriendly personality, never smiled and was not courteous at all. This was so uncharacteristic of First Watch! When we inquired about him, we learned his name was Tim and he was the regional manager. We were so surprised! We expected a manager to visit with the customers, not stand around and get in the way! We were quite disappointed in his behaviour and demeanor.","date":"2017-09-20 17:34:18"}
{"review_id":"yWFN7jSU-y-hUl8QQ59uvw","user_id":"F-XkGoU9tZxZLdGI6JAtZw","business_id":"cHGu7VWETFPGSWrNUdXGeg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Not really any different than most gelato places. It's just an Italian place in Greektown. Perhaps that's why it's attracting so many locals.","date":"2016-07-25 10:03:40"}
{"review_id":"pVQql9djXWWXO6NyZDf9HQ","user_id":"zXBH5QYe1WJCvQdkYBs9JQ","business_id":"2GmGT-7QjowR1ihup3FbVA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"You have to try this place out if you love Mediterranean food and if you are REALLY hungry. Yes come here really hungry because the portions are huge! \n\nThere is a small market that is attached to the small dining area. It's not too pretty but don't let that stop you from trying out their food! \n\nWe stopped by for dinner and it was starting to get busy when we arrived. There aren't too many tables but they were definitely doing their best to clean them as soon as people were done. \n\nWe were helped right away and menus were given to us. They have sandwiches and a ton of entrees to pick from. We decided to order one shish kabob, one gyro plate, and a chicken schwarma plate. \n\nMy chicken schwarma was delicious! It came with a ton of chicken, hummus, delicious basmati rice, and a piece of pita. My husband had the shish kabob plate and the also came with rice, grilled vegetables, and a side salad. He also had a small guava drink for $3.50 (no refill) but it was well worth it.\n\nEach plate was priced about $10 each. We spent about $45 and were there about an hour. Portions are really big and so we still had food leftover. \n\nI would definitely be back to try the chicken schwarma in the sandwich style.","date":"2018-02-11 06:40:41"}
{"review_id":"LnbCfuhnSdWf-TAiSPPZPg","user_id":"965QDYAn8jXQ9Wj7whuHsA","business_id":"MH_8eiwDpmSAs59FUAB35A","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Loved this place! I'm a Las Vegas resident and my regular sitter went MIA last minute. I called Love & Care Sitters less than 24 hours before they were needed and a great sitter showed up the next afternoon. Our sitter was extremely punctual and professional. She sent me pictures throughout the afternoon to keep us updated. The price was a little more than what we were used to, but hey, you get what you pay for and they were definitely worth it. Will use again!","date":"2016-03-17 16:46:07"}
{"review_id":"huKH2GSoTks9xf2BylRQFQ","user_id":"IYOetH5--BXt1iXTfw7ZkQ","business_id":"MdKHl4NBaSdAMHsiGRtlBg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I am usually skeptical about public pools, but Cactus is always clean, well managed, and with a friendly staff! The front desk is especially great. The people working there were clearly trained well and are approachable enough for me to go with them for any question at all. The locker rooms have quite a bit of space, and the showers are relatively clean (as public showers go); in the summer time, there's no better place to be. Do recommend the pool, especially if you go for one of their fitness classes!","date":"2016-06-23 00:59:52"}
{"review_id":"lOma6w15xTJP_1_DfnHp4g","user_id":"gsWHMddVl6HrF5QPmBkprw","business_id":"uvjJi6j6uxP2G8Vlg9aX8A","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"This was my second visit over the past year.  I confess to enjoying it more the first time although I can't for the life of me remember what I ordered.  I came for lunch again, but this time ordered a steak sandwich.  It was dull.  I guess I had it in my mind it would be something like a cheesesteak sandwich, but it was basically a thin slice of steak under-seasoned open faced on bread.  Meh.  Not sure this is worth a repeat visit.","date":"2013-02-21 20:30:56"}
{"review_id":"NZPn9IZyIsNcJJVXCIrR8Q","user_id":"KFKfrdWHB3jVDg9X2keRUg","business_id":"P8IsTiHq5Hesa6UPL604ww","stars":5.0,"useful":4,"funny":2,"cool":2,"text":"Taco Tuesday!? Los Taquitos is my favorite Ahwatukee Taco Tuesday joint.  \nWhether taking out or dining in, you head to the register to order and pay. The line can get long sometimes, but it is worth the wait. However, I typically call my order in a head of time to try saving some time.\nDepending on my mood, I enjoy their burritos and tacos.  Their fish tacos and pollo tacos are my favorite! At the counter, they have a few different salsas to add some additional flavor to your meal.\nI guess Guy Fieri had an episode of DDD here!","date":"2018-09-14 02:18:49"}
{"review_id":"qvr0i-Cc-AJ7tIKwatdulg","user_id":"1O638BDK_fWuxgTVJwff-A","business_id":"H464UiJ5c7q5dAJ14h731A","stars":5.0,"useful":2,"funny":0,"cool":3,"text":"What a hilarious situation. My friend from Belgium won $100 gift card for Gus about 2 years ago and he's been traveling the world with it in case he made it back to Montreal. Last week we both ended up in Montreal at the same time and we're able to use the beat up voucher. The meal did not disappoint and the restaurant was charming along with the staff. \n\nWe ordered the surf and turf for two for $79 and that alone would have been enough food for us. The scallops were great. The shrimp was great. The meat was great. A little thick on the sauce for me but my friends loved it.\n\nWe also ordered the horse tartare which I wasn't crazy about and the Caesar salad with caviar on top. Now that was a delicious salad and there was such a large portion of caviar.\n\nWe didn't save room for dessert but somehow we ended up with a piece of blueberry cheesecake in front of us and it was one of the best pieces of Cheesecake I've ever had. Very light and a blueberries were a special variety from Canada. \n\nOverall a fantastic dining experience. I recommend sitting at the bar and being part of the open kitchen. Thanks to all the staff at Gus for a great last night in Montreal!","date":"2017-08-07 20:12:34"}
{"review_id":"RlgnoQswutd9EDdOYJtU9Q","user_id":"_beegHoE4OXN0CKpo7nPcA","business_id":"3cJ3wf6g0sCwATTaM1o8DA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Good Folks\nGood Food\nGreat Place to Eat and Meet Friends\n\nBreakfast is Great.\nTry their Steak & Eggs. Steak is very tender and flavorful.","date":"2018-02-23 23:13:40"}
{"review_id":"0y-wiv-076zJW4xFXxi4mg","user_id":"hlcHT9yysI-W7DBWMtAt9A","business_id":"1gQrMs-I8oKg2p-iRxznzQ","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"The fried chicken is perfect- very crispy and the flavor of the coating is great. The bbq sauce on the side is just the right amount of sweet. The collard greens and mac and cheese that came with my dish (the \"Late Night\") were awesome as well. The pre-meal biscuits with jam and rosemary butter was 10\/10. \n\nI really enjoyed being in a restaurant where the music also isn't loud and you don't have to shout over one another to have a conversation. Friendly and timely service to top it off. Overall, an excellent place, highly recommend!","date":"2018-04-15 13:51:13"}
{"review_id":"pQY2yuZOTmCDlg1AeDydrA","user_id":"TGsvAP89lhlKcYZ6yeYfEA","business_id":"tIvDO_1WNbb6UAifErQ-Ug","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Coffee is coffee and I love coffee. \n\nThis place is super cute, warm, inviting and spacious. Just like an other coffee shop around. Lots of varieties of drinks and treats to pick from.","date":"2017-08-07 19:37:16"}
{"review_id":"I8DkUt50Eix8y1yIbrtEZw","user_id":"OG8x_lT4MR9RoQ38BXSZVQ","business_id":"D6RDpCS1lfgZdPuLHlpsHA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"After eating at this place for many years I was disappointed at the higher prices after the remodel. I liked the old place more and wasn't too thrilled with the change of market they want. Sorry guys but $23 for a pasta dish puts you on par with some of the pricier Italian places. Rigatonys down the road is just as good for half the price.","date":"2014-02-24 02:25:54"}
{"review_id":"13ZB4dGqiCKymeIIiv3FGw","user_id":"yp8LtdQlZnT-CWI_XsUzgg","business_id":"O3PiNOj1vv5dCCywdw3_og","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I've had hit or miss with this location, and Panda Express in general. Sometimes the food is soggy, burnt, or just old. They are also stingy when it comes to portions. You'll get a lot of rice but not a comparable amount of entree. \n\nHowever, more often than not I have a good experience. I usually order fried rice, orange chicken, and sweet fire chicken breast with a water cup! \n\nThe restaurant itself is very nice and modern. I often have seen corporate representatives at this location so it must either need help or is just a special location. It's usually clean with nice seating, however when it's busy the seating can be limited.","date":"2018-03-04 00:32:07"}
{"review_id":"OuuXX8GBLexumtgN4xtpzg","user_id":"_ee95opWLnHPT_u38BY9WQ","business_id":"Q-ZznSrHKOHdSFrK7dEVwQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I had a really nice lunch here today - their sandwiches are delicious!  The restaurant was pretty quiet for the noon hour, and I would have liked to see some meal-sized salads on their lunch menu, rather than just sandwiches.  I had the chicken salad sandwich and it was a good portion.  I would definitely come back!","date":"2012-05-28 21:33:39"}
{"review_id":"AwShAgdol0xUFNhQmhqXCg","user_id":"TK8Nf2vUC_aJgtDlBNAoBA","business_id":"5yPp5388EpT8CXxCGut7Bg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I attend these every year and wouldn't go a year without going.  We went 4 of us this time and had a fun time again.  \n\nTons of food choices\nTons of booze choices \nTons of dessert options\nLots of hot sauces available for sale\n\nSO Many options!  \nBEST food this year was:\nHawaii's restaurant - Beef ribs over rice with crispy onion OMG!!!! This is the only business card I took as I would order catering for sure from them.  Lawaia Poke Bar - www.lawaiapoke.com \n\nSorry I don't remember the restaurant names that I will mention below.\nBest dessert was the Lemon Rum cupcakes and the Pineapple rum cupcakes! \nIndian food not so good so don't waste your time trying it.\nJerk chicken was ok.\nFilipino food was delicious but terrible service.  Too much staff \"working\" there and not enough helping hands.\nThe spicy pickled asparagus and olives were amazing!  \n\nI HIGHLY RECOMMEND for you, your love, your friends and family to go.  Something for everyone!","date":"2016-11-21 21:12:35"}
{"review_id":"8ehWSWVgk-rk3va03EINeQ","user_id":"6dUTPTvPPtfYJSvFBRn8AA","business_id":"MLRu3fZjJuem-6dGuUoqgA","stars":1.0,"useful":5,"funny":0,"cool":0,"text":"All these people care about is getting paid. This is not a review by someone who has only been there once. I have taken 2 dogs and a cat there for years and spent thousands of dollars.  They are condescending and do not communicate with each other.  They are not good at checking previous history of our visits.  I am glad others have had a positive experience but every time I go in there it makes me cringe inside. My wife did not share my opinion and that is why we continued to go there. After today's visit where they were rude to her and accused her of being a bad pet owner she finally agrees with me. We will be switching vets and would not recommend this place to anyone","date":"2014-08-24 21:09:13"}
{"review_id":"M-cjT63pIuLgCB830h-GFw","user_id":"e7z6sT_K9Sv2Pd-9ZIsfyA","business_id":"LT0y32F1w2_KGltoU0fSYg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"What can I say, these guys did an incredible job! I've been let down by a lot of carpet cleaning companies in the past. Fortunately, that's not the case with Noble.  They showed up on time, were very respectful when doing the walk through and made my carpets and tile look brand new! They're also veteran owed and operated which you can definitely their work. Give these guys a shot, you won't be disappointed!","date":"2018-04-04 03:35:21"}
{"review_id":"okFXZDCQ5NSvcuXm40-cyg","user_id":"FwzqEPhOZJAvUO3VEAh3XQ","business_id":"xTW5PkLEdMBs2f2W8RGy0g","stars":5.0,"useful":3,"funny":0,"cool":2,"text":"NEW LOCATION. The original Miele's was in Tempe but recently moved to Mesa. (I didn't realize that when I called in my order so ended up going to the wrong location at first.) The Miele's that is still operating in the Tempe location is a totally different restaurant, not affiliated with the original. A bit confusing to customers? Indeed. And I don't think it's right for the fake Miele's to be piggybacking on the original Miele's reputation and essentially stealing its customers. But I digress. The REAL Miele's, now in Mesa, still has the same menu and lunch bargains that I have enjoyed for years, and they apologized profusely and genuinely for the location confusion. I loooove their garlic knots, lasagna, salad, and house dressing. Miele's in Mesa...I'll be back!","date":"2016-03-30 22:19:36"}
{"review_id":"R0jOOJKNpiSNucDDu2kNug","user_id":"_J7sqDS-xquMsMfi0PA_zA","business_id":"HtIDJhLEUUmIyOGsBEs1Rg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Lunched it here today.  Burgers are are good... eh... better than good.  The meat is certainly a couple notches up from say, In & Out.  Which I like.  The bun is high quality as well.  I ordered the Green Chile Burger.  I was very happy with it.  My family both go Cheese burgers and they loved them.  I was surprised by the Fries... they are not up to the standards of the other food.  Bland.  \n\nThe service was good and the staff was friendly.  Not sure how long it's been here, but Yelp brought me today.  Constructive criticism?  Slightly up the scheme, change the colors and bring in some more images etc... for the walls.  Up the menu look and feel and brand it!  \n\nParting shot?  You already have the hard part down... good food!","date":"2015-08-07 00:31:21"}
{"review_id":"G7os5q9RQo09Sp8cwnVk-g","user_id":"3GpGgUCFrcM7JJbMIUhYSQ","business_id":"KalAJyO0Zpg3K1wVwYXBHA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I should have learned my lesson last time I was here for brunch when I had a bad experience with both the service and food...however, I thought it was just an off day, so when they advertised for their Doubleback wine dinner I just couldn't resist.  Service was non-existent, the food was not good and the entire event seemed like it had been thrown together at the last minute - very disorganized.  Such a shame the way this place has gone downhill.","date":"2017-05-13 17:02:13"}
{"review_id":"VUTPmJf5l40RKJr5XnatsQ","user_id":"fBO-AauqOjPX2UBp9RgeQQ","business_id":"TFdLM8R_7Pf1xVeBNKl0hg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Good food - Great atmosphere!\n\nService will depend mostly on where you sit - They have a nice covered outdoor seating, if you're out with a group of friends - The bar area is pretty neat with lounge seating facing the bar.\n\nTry the Short Rib Ravioli","date":"2012-09-10 18:43:14"}
{"review_id":"1H5PlGKzNbf5dbGl5KXZgQ","user_id":"tTnSnlNMWc5GILdvLgih7A","business_id":"ApG6TS7aDiYSZaGjcuzEHA","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Sales-Adora Fryant I have now bought or leased 6 cars from this dealership, all from Adora. My most recent experience was unplanned as my car was totaled in a rear end collision. The first thing Adora did when she heard was offer any assistance she could that was NON sales related. She was genuinely concerned for my well being as a friend which was highly appreciated. She knows her product and does the best job of getting to know you, the customer. There is never a sales pitch. She's honest and thorough and will work her tail off to get you the best price possible. Trust me as I have never been one to pay a penny more than I have to. Patience, integrity, and incredibly thorough answering any and all questions. Excellent follow up after the purchase.","date":"2016-12-19 19:13:59"}
{"review_id":"zPF6yKBmSG-IFKfWYvqSwA","user_id":"xV5hrI1JP5pf1z7Iot8epw","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We really had a good week here recently! We arrived in town early on a Sunday, checked in (surprisingly short line!), but rooms were not ready yet as they had had a busy weekend. No problem, we checked our luggage and went to get something to eat. We checked back in at the desk and were given our rooms (we always upgrade to GO Rooms), and shortly after that our luggage was brought up to us! The staff was very friendly and helpful. Our rooms were very nice, cleaned daily and always while we were out. I loved our view, best we've ever had in countless trips to Vegas. The bed was very comfy. We even had a fridge in our room! There are plenty of elevators in this hotel and you can use different ones to get quicker access to different parts of the hotel\/casino. We loved meeting for breakfast on the patio in the gardens where we would sit with a muffin and coffee and plan our day. The pool was nice too. We did not get a car due to traveling with a group this time so it was nice to be so centrally located with access to everything we wanted to do. We tried the new Carlos N Charlies' restaurant and it was good. We also like the food court, very handy with plenty of options. Our only complaint was with the restaurant, while the food & service were pretty good the problem was when it was time to leave we had to wait in a long line to pay our bill! They could have used a few more staff people to expedite this process.","date":"2012-10-08 19:08:16"}
{"review_id":"gPD3ask3kh5S4tVX9mW9Jw","user_id":"XE36pmSiByd4YtSiPkn9_A","business_id":"HF6XT6l-dF2l1ZhMlnKB1Q","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Good flavorable chicken at Mr Pollo!  The lunch special includes a bowl of soup, the sides are small. Two plantains and side salad, the bleu cheese is good, it blended well with a spicy sauce they brought to the table.  The grilled beef steak is tasty but a tad chewy.  Chicken is the way to go.  The drinks are 2$, refills at the station, the order is taken at the counter and a friendly staff member brings your order to the table with a smile.  Small, clean spot in the plaza.","date":"2018-03-15 23:41:02"}
{"review_id":"4vCX01_c9SzmA3KzzZKRRw","user_id":"Q_QsCiaeQ5T_CfmidxEM7Q","business_id":"hjcNB15RewDgxoS4EYomLw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very nice and clean location with plenty of parking. Employees were friendly but the wait was kinda long. We will use them again because of how good they did and how well we were treated. Even my 5 year old got a mani pedi for the first time!","date":"2017-10-24 22:39:04"}
{"review_id":"XzfIjYWcbQSEeySImZagHw","user_id":"MpzdyORV5bUIM26Sb_SsIA","business_id":"zuVvDYJkKAbXQTTBauAqJQ","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"If you are not here by 9 am or so, expect a wait. Even the call ahead for a large group was futile. We still had to wait 30 minutes. Definitely try the Wolfpack if you are watching your figure, Your figure expand!! This thing is awesome! The brioche french toast is delish as is the Hopple Popple and the Over Easy...i think that is what it is called with brioche, spinach and poached egg. Sometimes things come out in pieces like sides first, then entrees or vice versa. Patio seating nice too.","date":"2012-04-29 02:34:25"}
{"review_id":"hPj7hfE7bLvLuTVWwwvplA","user_id":"7qZOnT_l5gMDYXUa8JKpQA","business_id":"oeW0vIYd3rUnAPgmD4fEFg","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"My dad and I went to deluca's for breakfast while we were in Pittsburgh. We had heard that deluca's was very good, we also heard that it was always hard to get a seat. When we got there the line was just coming outside the door a little so we didn't expect much of a wait, but when we got there their was no wait. We were seated almost immediately at the front counter. I got the banana split hot cakes while my dad had the Pittsburg slam. My food was delicious, my dad also enjoyed his meal. The only thing that I could see as a problem is that a party of 3 or more would have to wait a while for seating.","date":"2016-01-17 17:58:31"}
{"review_id":"HGuEnMRcOrhFPLIFalnezQ","user_id":"iYmCNX6I_dItGc81RUpZGw","business_id":"IKYC89dNASgiPI6iIZj8Sw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"The service bumps this take out sushi place from a two to three stars. The service is quick and friendly, however the food is pricey for the quality. Ordered three rolls including the beef roll, inwhich the beef was too chewy and dry to enjoy, had to force it down. The spicy salmon and tempura roll were tolerable, maybe it was too close to end of day though.","date":"2014-09-10 08:08:08"}
{"review_id":"G5JKV0Mzfdz2cvy6pngswg","user_id":"K8j3LpYqWTeRPNkemMtqnQ","business_id":"T0NKethAB-FFR05EeZCzuA","stars":1.0,"useful":0,"funny":2,"cool":0,"text":"I don't know why I bother. After a log day at the park and really no urge to cook I figured why not and have some fast food. Being vegetarian really the only place to go is Burger King. When ordering my childrens meals I specifically asked for no pickles and no mustard and not to any surprise when we got home of course there was pickles and mustard. For my vegetarian sandwich I asked for mayo (which they charged me .75 for) and yup that wasn't on there either. The person taking our order must have been doing something else brig the fact that I had to repeat myself 6 times and then drive thru girl well let's just say her attitude wasn't any better. No smile, no hello, and no here's your food. Needles to say I've been staying away from fast food for a reason and Burger King you pretty much proved my point.","date":"2014-05-26 03:27:58"}
{"review_id":"Owsv_uwOHoQwL20t-YFgzQ","user_id":"3UTd34qUasSmCT5RSwsqKw","business_id":"3p410D9YzcmgyXQWCcCPiA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"First time here and won't be the last. Food and service was great. Definitely recommend if you're in the mood for Cajun","date":"2018-03-15 19:25:24"}
{"review_id":"7HgPdQM1lEyU8JfGa7EnWg","user_id":"ZJDvoG6iMtYYQhrzN4POFw","business_id":"J1UT3YsSmFP-DvIVArdwTQ","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Worst Sprint store in town. Their staff are theives and the managers cover up for them. I'm currently disputing  fraudulent charges from this store. No one wants to take responsibility and I'm out 500$ \n\nHorrible customer service and untrained staff. \n\nI proved one of their sales people stole from me and threw manager did nothing!\n\nI'm also reporting this store to the BBB.\n\nDO NOT GO HERE!","date":"2015-01-03 20:44:33"}
{"review_id":"_OF1AhXqV3muIOGXJLGU2g","user_id":"3U4ApefTdjbTv0R17Z3XgQ","business_id":"9F3N2jWo_kqK9A9pC3z74Q","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"What a cluster fuck parking! ZEROstars.... They need a better system on how to handle the crowd of cars. Been sitting in my car for an 1 1\/2 hr waiting to be directed to where to park! So glad i got to watch the concert better yet so happy i got to listen from the outside!","date":"2018-09-14 03:21:58"}
{"review_id":"vO1W7fq-PBA89Yn48rj5bw","user_id":"8Hx2CwZBLVPNw03q20uQog","business_id":"lpYFsXFrojiBZ1kbWR2lZw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great selection of Four Peaks brews along with guest ones.  The pumpkin porter was excellent. I'm not a great fan of beer, but this one I finished.  The quesadilla was crisp and not soggy.  Try it with chicken.  My dining partner had the salmon BLT and it was very good.  Huge place with friendly staff and a fine variety of beers.","date":"2017-09-09 00:29:50"}
{"review_id":"jnM3Dt3-VYCwEpy2gInntw","user_id":"mC3k14eB3Uy9L_IjtaNGXQ","business_id":"3p410D9YzcmgyXQWCcCPiA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Found this restaurant through Yelp. Really good catfish and excellent service. Must try!","date":"2017-12-29 15:33:16"}
{"review_id":"0ECM07JaUZyWvozM2sLb4w","user_id":"ws35xFOQVjY-vnxhSwbI3w","business_id":"LwZ6MkBSkrxbniHE1vthww","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Been meaning to write this for few weeks. This is the real deal barber shop. Stop in and forget about it! I had many comments that it was the best cut I've had in quite some time. Old school barbers laying the barber law... Take notes amateurs!! Neal thank you!","date":"2016-01-04 06:53:44"}
{"review_id":"VOGY5Rq9Sdb2Z5hDV3vF7w","user_id":"OBUFlgbdtHYaFjKBGBnGIA","business_id":"ETSHD1lX0xcd2qInwiXxzA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place reminds me of my grandmas cooking when I go visit her in Mexico. Cheep prices for great food. There is little shops around so you can go shopping around once your done with your meal. Restrooms are kept clean, tables and chairs are always clean. The employees are amazing and sweet to all. This place is the place to go if you want real Mexican food in chandler!!","date":"2018-03-15 19:32:12"}
{"review_id":"AXx1hDGdjbMnW5PZzXTvXw","user_id":"fiGqQ7pIGKyZ9G0RqWLMpg","business_id":"LEASX4wn1U1TAmwQfsDtIw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Small place with cheap food and cheap drinks- so don't come here with high expectations. Known for footlong hot dogs. No frills ambiance. If you're on a budget, come here. Again, don't expect much.","date":"2010-10-05 19:53:30"}
{"review_id":"mY_y_MsfEdLthxwxaB_7yg","user_id":"H1KxT6STHcMuN7VTVeytoA","business_id":"tamr4J75GguGhF1hm1wEaA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I was hungry for a sandwich and it was a lunch rush so I understand that you won't get the highest customer service and they try to crank people through. I got the club which was okay the bread was dry, but I can only give them two stars because when I got to the veggie section of the ordering process the sandwich wizard started just throwing things on it, luckily I noticed it was mine and I had to speak up and he grabbed the things off the sandwich which I didn't want.... always love when they just grab them off. Then the real reason I cannot give them a positive review was the manager told the man in front of me he could not get a cup for water..... and told him he would have to buy a water bottle..... come on now.... how cheap are we getting that someone can't get a glass of water with their average sandwich.","date":"2018-05-08 17:15:36"}
{"review_id":"3X1P68wedu84JGGj8v2rQQ","user_id":"owWexZUKme3ZxZW-J8mmLg","business_id":"QpmKI2ycbMPOznAspemLpA","stars":5.0,"useful":4,"funny":1,"cool":1,"text":"I have used Oasis Springs for several projects and each time they have been reasonably priced, arrive on time each day of the project, communicate with me if any delays are expected. Best of all they complete the project correctly and completely. \n\nI highly recommend them for all your contracting needs.","date":"2011-11-29 23:56:40"}
{"review_id":"KCzjdGOt61bXgfIrHHvEQQ","user_id":"NQ-qIjTAQlRJ66igs8wN3Q","business_id":"QCCVxVRt1amqv0AaEWSKkg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I cannot say enough good things about this place! Not only is the location awesome, but the service and food is impeccable. You feel as if you are in a hip downtown city like LA, NYE, or Seattle. The cacio e Pepe pasta is my favorite. We will be back as much as possible.","date":"2018-01-21 04:45:12"}
{"review_id":"Yc00oKpo8GCjzoTEG25O2g","user_id":"-dESN64UjtSoOr6HYPRa7A","business_id":"XWxYHSld0T2TfANwt1KmqA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"I stay at Caesar's a lot and never went here before, so I tried it out. Big portions. Hella expensive. Mediocre food. Alright service. Not coming back here again, so many other places to go then here. Plus my waiter was kinda judgmental. Must've thought there was no way someone so young could afford all that I ordered. Was happy to prove him wrong. Two stars for the fake nice treatment","date":"2018-07-07 21:21:36"}
{"review_id":"bYSjGtsWcuAqLc9W4H5YPQ","user_id":"FX_mfpXSq8LV9sPmzbtvsA","business_id":"aybwecuzAa-OuIt1i3_IDQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Charburger was about a pound, it was huge and delicious! Ice Cream Shakes were great too.","date":"2011-07-28 10:09:34"}
{"review_id":"OlwgTlZm6gkS_xZW4I0-JA","user_id":"3LwO5lqgkM2BQMyAiJ2xcA","business_id":"EjzMHfwqAmj7BgdzQjquRQ","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"This was not a good experience for my family and I we love enceladas they said they have the best?? Well the meat was on The outside of the tortilla?? Just did not like that one bit l. Will will pass others can eat hear??  Food was ok just not what we were expecting??","date":"2018-08-23 22:33:05"}
{"review_id":"A3sXXDkwobWM8VHH6_KXzQ","user_id":"2CtTm8qpTzub-obhLU56SQ","business_id":"LAKs5UatFvOhlaF4sZ1obA","stars":3.0,"useful":3,"funny":1,"cool":1,"text":"First off, I'd give this place a solid 2.5, but since there's no option for half stars...3 will do. Just because I feel generous. \n\nService: okay. When we walked in, a guy behind the counter just stared blankly at us and asked if it was dine-in and handed us menus and told us to sit where ever, so ok cool. It took about 10 minutes before the same guy came to us to approach us and ask for drink orders, and by this time, 2 other tables have sat. He was the only apparent server so I was trying to cut him slack (I work in the restaurant biz), but if you were the one who handed us menus and serve us...10 minutes is a stretch. He let my drink go empty twice, but partially my fault--I was thirsty. Didn't really come by and check if we needed anything, we eventually got what we needed ourselves by reaching onto the server's counter (sorry). There were about 5 tables in there around the time we went (6pm-6:30pm), so it wasn't that busy...service could've been better in my opinion. \n\nFood and Pricing: I ordered a medium bowl of pho dac biet, probably the most common pho in any pho restaurant. The portion was SMALLER than most pho restaurants I've been to, and more expensive than the other pho restaurants I've been to. It was about 10$ for a medium, and in my opinion, was NOT worth it. The broth is more on the bland side, so season well with the condiments. Probably about 6 pieces of meat in there max, so if you like a large portion of meat in your pho, don't eat here. I also ordered an order of spring rolls. They were eh, okay. They're small also compared to other restaurants, and of course, cost a little bit more than other restaurants. \n\nOverall: It was a whim coming in here, I probably won't be back because I live in Charlotte and was just in the area. If I was from the area, I'd probably try somewhere else also. The portion of the food just didn't match the price, you can find better pho elsewhere. Even if that means driving a little further. The service wasn't spectacular either to make up for the food. Pretty much to sum it up, mediocre. I'd recommend eating elsewhere!","date":"2016-12-19 08:04:45"}
{"review_id":"th3BzWGmDA1uNzOakD5fHg","user_id":"lN7JeDlr-xoS6kTBDB9vYg","business_id":"Te8ubqIn8aH2uplVhvMntw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"yea i have to say this was not quite gelato, but an ice cream?\n\neither way, it was cute and portion size was cool. \n\ncinnamon was delicioso!","date":"2012-06-26 00:53:41"}
{"review_id":"T0_BU_pxV3r5QRJP-Mei3g","user_id":"lOFBy0gVGOV0VapjoNZdlQ","business_id":"Ie6Dvs2PqepbkMc3DI2Fcw","stars":5.0,"useful":3,"funny":1,"cool":0,"text":"Ohh, Las Vegas. \"Kid-friendly\" doesn't generally come to mind when you think of Sin City, but clearly that moniker was developed before the brand new My Gym Children's Fitness Center  came to town! The new gym is in Henderson near Whole Foods...(The old one, btw, is closed and this new one is under different ownership\/management!)\n\nThe facility itself is so fresh and so clean... My young daughter can run around barefoot and not walk away with black soles on her feet or grime on her hands, and it's the only children's facility I've been where they use only organic, natural products to clean their equipment (and it doesn't smell hippy dippy).\n\n In addition to a safe, clean place to play, the program is FANTASTIC. The teachers, Jeremy and Ben, pack so much into an hour...! It's definitely not a free-play sort of place (you should expect to do everything with your child if they're under 3), but I wouldn't *want* it to be; we love singing and dancing together at circle time, trying out the different tumbling skills, and climbing together on equipment together. I feel like a little kid again, haha.\n\nBest of all, they offer free trial classes. I definitely plan on coming back with a friend or two so we can take class together. :)","date":"2013-04-10 18:16:53"}
{"review_id":"X-aAQ_4suMpRw-q_Z67olg","user_id":"71VVDCPouM5fldCywWxNWg","business_id":"atSfDP-SLY4GrvBlBPB31Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Work in the Phoenix area my co-worker was feeling like chinese food and I found this place by accident. The food is really flavorful and good. The customer service was amazing and the wait time and delivery were way faster than projected.","date":"2016-11-09 19:57:52"}
{"review_id":"MjF0Tymztt6fpLQU20ai5A","user_id":"6ClJwC0SmyPzRXuH7Yru0Q","business_id":"iMGGM-WVNKep9c6bgRYjpA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Delicious food just visiting the area for work and found this great vegan friendly place. That would be nice if they made their way out to Maryland\/D.C.","date":"2017-08-07 20:46:30"}
{"review_id":"NKIuGhJjjh1UmWq9Lw1t9Q","user_id":"LnCbbNOBLomK95lnyWoGlg","business_id":"V2rtUhEzbUGTHBZA6MV3-w","stars":1.0,"useful":6,"funny":0,"cool":0,"text":"It was a truly unfortunate situation, I was visitng with my sister (she resides in beachwood)  and my 2  children- ages 22 mo and 4. We were literally thrown out of the store because the kids were touching the toy cars in the plastic bins.. It was UNBELIEVABLE ! They threatened to call security. We were flabberghasted, AS adults, we were simply standing there, toys in hand waiting to purchase our items. Prior to this, the \"salespeople\" were following others in the store while :\"rearranging afte each customer had moved an item. even slightly. It was CRAZY, totally inappropropriate and RUDE especially in a TOY store. This place will be out of business within a year. NICE CUSTOMER SERVICE. In this economy, I wonder how they will survive, as nobody (the day after thanksgiving) was buying anything). TERRIBLE STORE CUSTOMER SERVICE- DONT SHOP HERE!!!","date":"2011-11-30 01:17:34"}
{"review_id":"erZDHiUx7iw3qRTv4WRLyQ","user_id":"CGr35sdPHepxU4y9TUQuQA","business_id":"Bkf6d4VZdRXkSUjjMViBvQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Great family place.  Decent food at a great price.  Also huge quantities so bring an apetitie or a box.  Seems like mostly a locals place, which is fine since I don't like the \"tourist\" destination.  Several said locals perched on bar stools and looked like they haven't moved for years.\nGame was on the tv, but volume was reasonable.","date":"2012-01-03 16:28:34"}
{"review_id":"eOxjxRV0vUTgTXCCV0tFyw","user_id":"Ke0kAr8rQXLhpR0u5ma4JA","business_id":"3IY-JtcZHBOSzFD53SSXLA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"FINALLY... REAL POUTINE IN AZ!!!!!! I tried poutine in Canada and fell in love with it but haven't had authentic, delicious poutine since coming back to Az. Food is great, service was fast and friendly and the place is REALLY, REALLY cool inside. Big fan... I'll be back!","date":"2015-10-07 22:57:24"}
{"review_id":"77eHaRFqcfpxvs3MQoz6DQ","user_id":"_wNlwPSlwZO6L6Oer4VVsA","business_id":"z4K95Y4P5nMrtJiDtXWDYA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Went here after seeing a positive review in Phoenix magazine. Did not disappoint ! We had the chorizo and black bean queso - seriously, possibly the best appetizer I have ever had. We both ordered rather eccentric sounding main dishes. I actually was presented a different meal than I had asked for, but when I tried it, it didn't matter! Everything about this place is great - the indoor seating area is small but great furniture and chandelier gallery. The outdoor area is nice too. Staff friendly and timely. Definitely coming back again.","date":"2018-01-21 05:11:28"}
{"review_id":"F23bFZ0pqIQW5jUKYk-N-w","user_id":"2pduo--aVrosMHwrO_EAtw","business_id":"Ef_imWvqLiPycv7iRdaolA","stars":5.0,"useful":3,"funny":1,"cool":0,"text":"Some people have difficulty grasping the concept of Planet Fitness. It's just high quality fitness equipment geared at getting you in shape. No glitzy smoothie bars or aerobics classes for ladies to get all dressed up trying not to sweat. The attendants are pleasant and readily answer questions. The Lunk Alarm can be a little irritating but you overlook that after awhile. Keep doing what you do Planet Fitness because I'm a fan!","date":"2012-11-06 03:33:41"}
{"review_id":"zxWHKjsjvOev_fNoLdffwA","user_id":"CU4sdqq1cCNxKvwZLQ-qcg","business_id":"9U4Tqt5SkZKQ6eeH6IPSxQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Really yummy sushi. We've been twice now and only orders off the regular menu.  The sushi is really good and their special roll deal makes it super reasonably priced.  The atmosphere is nice and relaxing and overall enjoyable.  We have liked everything we've ordered and this will probably be our sushi spot from now on.","date":"2016-01-17 05:26:11"}
{"review_id":"GcnKaZ_NH3gfA49gTvyDuw","user_id":"4JoaCp4ENuhY8NfK47gMug","business_id":"iUavFbiZ44RZQj1r8eZ-QA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We were very pleasantly surprised with the care and service that we received at Express Auto Spot. My daughter needed to buy a new car, Jason was more than helpful, mannerly, and truly cared about the entire transaction. He explained everything, and answered my daughters millions of questions. After all was said and done, it was a very fair price for a car and he made sure we were completely happy before we left there. I would recommend going there if you want a no pressure, fair, car sales experience. It was a pleasure and what's more, the car lot is indoors, that means no AZ heat!  Thank you Jason, this was great!!","date":"2016-08-12 21:05:44"}
{"review_id":"6ZHpmsBRiYfJeKquPW-v_Q","user_id":"ejOeU7d0kW6jejLcMtCaQw","business_id":"U3A716YhAWFkyURKcfUo7A","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Ordered lunch using Foodora. I ordered the Chick'n Pot Pie with a market salad on a side, and a Banana Chocolate Chip Sour Cream Cake. Overall, I was pleased with my order. This is a restaurant I'd try again. I gave 4\/5 stars for the great pot pie. I wish the price was cheaper though but it's understandable since most vegan restaurants have this price point. See details on the food below!\n\nChick'n Pot Pie = 4\/5 \nI really enjoyed this one. When it arrived, it was a bit warm, which is expected since it was delivery. I bet if I had this in the restaurant it would have been hot, comforting, and perfect. It had potatoes, sweet potatoes, carrots, red bell pepper, beans, peas, and a nice crust. I wish it had more chick'n though. The salad had spinach, shredded beets, red bell pepper, tomatoes, cucumbers, and balsamic vinaigrette. It was definitely filling and I'd order it again.\n\nBanana Chocolate Chip Sour Cream Cake = 2.5\/5\nThis was a fancier banana bread. The size reminds me of those school safe banana bread snacks you can get from Costco. It basically tastes like that - sweet. I was disappointed with this one since I found it pricey for what reminded me of a school snack. I thought it would be a slice of cake, but it looks just like that snack. I wouldn't repurchase this again. Definitely try a different dessert.","date":"2017-06-06 18:52:11"}
{"review_id":"t8N5Sg01YgQ8R-TfPoocdg","user_id":"LXO2zqRbwzZsl-0E2OZH7w","business_id":"-2ToCaDFpTNmmg3QFzxcWg","stars":1.0,"useful":0,"funny":0,"cool":1,"text":"In Las Vegas and this is by far my worst shuttle experience. We waited almost an hour for our shuttle to come! Then when it comes time to load up and head out, the driver takes his precious time counting and collecting luggages. He had us wait outside, which was absolutely ridiculous when he could've simply opened the door to let us sit in there and wait for him to check us in. Not only was it already HOT, but now we also had major hot air blowing at us from under his bus! He checked us on the bus one by one, again, taking his precious time! I can go on, but I'm already too pissed off so in short, we were the last ones dropped off and the \"dropping off\" of people was not efficient AT ALL!! It was RIDICULOUS!!","date":"2017-06-28 00:11:23"}
{"review_id":"wa3yRtaw8oDE-mU_UFCrzQ","user_id":"y_UnUtYHGE3kgBqZEPOOsw","business_id":"3vpSFjMokFbmOuINzNuZSg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I've been a member for almost 1 year now and feel comfortable leaving a review of the services.  The facility itself is very professional, simple and well decorated.  The rooms are very calming, clean and quiet.  The therapists themselves are very varied in their techniques and skill levels.  I have tried 5 different therapists before finally finding one who is AMAZING.  The first therapist I had was TERRIBLE and I felt like i wasted my money.  The good thing about this facility is that there are many therapists on staff so if you don't like one you then you can try another.  The other therapists were good for first timers or clients looking for a non-aggressive relaxing massage.  I enjoy high pressure deep tissue massages and I finally found an amazing therapist who I exclusively book appointments with.\n\nI had a couple of negative experiences where I got 2 eye stys immediately after my massage.  I noticed on both occasions that there was residue black eye makeup on the face towel where I lay my head.  I don't know if the face towel was reused but I also understand that mascara and eyeliner don't wash out of white towels so I just assumed that the towels were fresh at the time.  I also did not request to have them changed because I didn't want to be rude so that was my mistake and I can't prove that the towels were reused so I won't fault them for that.  \n\nIn summary, if you have signed up for a membership then take the time to really try different therapists and find the one that is right for you. The staff are very polite and professional.  The value is great if you go for regular massages but only if you have a great therapist.","date":"2017-10-11 00:55:34"}
{"review_id":"pIrZ4u7UnsYK0ylUMN1etA","user_id":"eNk1BIDri27Z6LJwORrVbw","business_id":"vcVgncax_tbfhMckX1m36w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Absolutely delicious! This was my first time here (or having a poke bowl in general) and it's similar to like a chipotle or subway where you tell them what you want in your bowl. My friend had the sushi burrito and it looked amazing. Fresh ingredients and quality tasting fish. I devoured my bowl and I'll definitely be back. Also the place is very clean and has modern interior design which is pleasing to the eye. If you're hesitant about coming here or even trying poke, don't be.","date":"2018-07-07 20:38:27"}
{"review_id":"eGkimbUybDGoZ_UWWrKz6w","user_id":"gArhntoIF-9LQaJq7CC6Zw","business_id":"DH-MAADZ6gmPwvDRBMsg4A","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Great service station that knows what they are doing but try to sell you things and then note it on your service record in your account for the next time, whenever you decline.\n\nCase in point, I've been here a handful of times, (and have also done some preventive maintenance myself), and they've changed my oil. All the while the person is changing your oil, they pull other parts out of the car (air filter, etc) and ask that you get them replaced, even if they've been replaced somewhere else. When I told them I got the part fixed before, they asked \"where\" in an almost confronting manner, as if they never believed it was done. Some of the service was done by them only months prior, and they acted as if they couldn't find it within their computers. Shouldn't be that hard, if whenever I decline their service that they offer me besides the oil change, they remind me the next time that I declined them the last time. I argued with the last serviceman the last time I took my jeep in for a good 15 minutes about transmission flushes. \n\nStick to your guns while going here. If all you need is an oil+filter change, tell them that when you go there. Tell them that you are not interested in anything else, or that you do other maintenance measures yourself. Oil changes don't cost much, but when the salesy pitch is pulled out, you may end up spending an upwards of 300$ on something you don't really need!","date":"2015-08-19 05:20:48"}
{"review_id":"GTMM5WVYjrk17tdren9yqw","user_id":"os832o4NXDKxcTYEBN1Mmg","business_id":"a4MVM9E9022sYFrrYWy9DQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Nice Italian food with good prices and generous portions.\nWhats not to like?","date":"2016-01-30 02:37:30"}
{"review_id":"D3E-jYP5aH0D_I43s-xfpQ","user_id":"M5gUQsyH1Ox-ulbAXECKAw","business_id":"ZFyJ83LJkkO1dP82kzXKNg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I love fast food....I really do.  And this is my favorite chicken finger place...hands down.  They do it right.\nThis Raising Canes restaurant is clean and the staff is nice.  They are helpful and efficient.  If you are unsure what to get, they are quick to answer questions too.\nSo....not a ton of variety at this place.....just get what everyone else is getting...chicken fingers with cole slaw and texas toast.  The chicken fingers are amazing! Crunchy on the outside and tender-soft on the inside.  I can eat many of these....many.  The texas toast and the cole slaw are very good as well.  I always order an arnold palmer because they have good sweet tea and lemonade....it's such a good combination.\n\nNext time your in Vegas try it, you won't regret it!","date":"2013-09-04 02:37:39"}
{"review_id":"FtzDS3y7v57tnOzSOpug2A","user_id":"1-Z3KCriOaESSBavE7_isg","business_id":"M0pkmBUi_CI0qrzN7ee80Q","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Love this new location! Has all the charm of the NODA location, just a lot more spacious with lots of seating and a nice long bar. There are three (I think) lines. If you're ordering dessert, make sure you get in the line closest to the pastries. All the servers were super friendly and smiley. Even though it was crowded, our order came out quickly. I've only been to this new location once but I had a great experience. Great addition to Uptown.","date":"2015-12-20 19:41:14"}
{"review_id":"udJUI4ctp3QK2OkiTbddrg","user_id":"_5rcXl1YwQD6rlI9RacUXQ","business_id":"_WvEXsx2eZ53lTWHlIx9kg","stars":4.0,"useful":0,"funny":1,"cool":0,"text":"Been here several times. Brunch was unimpressive, lunch was solid, happy hour is  great and dinner was down right delicious. Also the cocktails are made with care, premium ingredients and creativity. I'd highly recommend the \"lawless\" whiskey and tobacco bitters and served in a glass full of vanilla tobacco smoke. I would also highly recommend the risotto croquettes, short ribs and deviled eggs. A few reviews claim this place is expensive, if your worried about that, trot on over to the tilted quilt next door or chipotle across the street.","date":"2014-10-11 05:27:47"}
{"review_id":"ysUt13dvVaAbabMV8MjxXw","user_id":"JEEYFXLbKy-KpbTT-BHb6A","business_id":"QeGkAHAKUT-TkyPUsl2PIg","stars":4.0,"useful":3,"funny":0,"cool":1,"text":"Today my boyfriend and I stopped by to buy some dog food. I usually just get a big bag of Pedigree at Walmart, but I decided to explore other options. As we were looking at the different bags, Wesley one of the employees, offered to help us. This guys has vast knowledge about all the dog food brands the store carries. I was really impressed, especially when he asked about my dogs in order to give the best recommendations on dogs food. Once we got our bag picked out, he also informed us about how to go through the process of changing out the dog food since Pedigree is all my dogs have ever eaten. When I asked how he learned so much about dog food he said he's been working at Wag N Wash for 5 years. To me this is a plus because you wouldn't go through the effort of learning so much for a job you don't enjoy. Also, this tell me he does like his job and he's willing to learn to help the customers.","date":"2017-12-15 23:45:37"}
{"review_id":"GBTF0zRi9jyR2EuekA5Mcg","user_id":"9lsRdkYWteYRfEBkamCjhQ","business_id":"_iEl9sCLsvXEFHUWPvgsAg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Delicious small bite tacos, amazing salads with so much flavor and the drinks are spot on. We would highly recommend!","date":"2018-03-15 20:52:50"}
{"review_id":"COKi3CYcuMxHOsbXkY2ezg","user_id":"gjZp61JZaqcLrKjEDVSPIQ","business_id":"J9f-9Prw2YVM-fiZqv2fmQ","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Hidey ho!  Hot dogs and wet fries.  By wet, I mean with gravy.  If you're in Pittsburgh, you already knew that.","date":"2005-05-31 22:56:52"}
{"review_id":"Q_FpkQbA916zhJ7jnp8hxA","user_id":"qhsuusMGQ3AjhMsvScpg4w","business_id":"YSdxFINzbpbwX-RtPd1FxQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Just had a wonderful experience at T & M Automotive today.  The staff was courteous and friendly.  I needed brake fluid today and would not hesitate to return to them for any unforeseen automotive problems when in Vegas.  I might also add the bathroom was very clean which I appreciated.  Being an out of Towner anywhere, it's always a scary feeling when something is wrong with your car. The numerous positive reviews encouraged me to go to T & M and I'm glad I did!","date":"2018-04-27 23:04:22"}
{"review_id":"o2dBzUsph8swp1a45JYqmg","user_id":"2r0L3KBF6VQd4aKx3fy--A","business_id":"CC8AIB3g1d88YVpmaUsVgA","stars":3.0,"useful":8,"funny":6,"cool":4,"text":"The best thing about this restaurant is their pizza. Even though it's \"raw\" it's still really tasty and filling. The BLT is pretty good too, but messy to eat--definitely not a good first date food. \n\nI think you have to keep an open mind when you go to places like this, because the rawness makes it harder to fool your average carnivore. I've seen children at nearby tables take one bite, make a face and push the plate away, whereas in places where they cook the vegan food kids will have no idea that they're not eating chicken fingers or whatever the item is. \n\nThe service here is slow. And when I say slow I mean I aged considerably while waiting for my food. I wish I could say this only happened once, but it's happened every time I've been there. I think it's because they make everything from scratch and there are only one or two people working in the restaurant at all times. If you have three or four tables, you do the math. It isn't pretty.\n\nI'm happy to have this place open as an option, but it does not get my highest recommendation.","date":"2015-08-06 20:56:05"}
{"review_id":"-GzPj_xYHLRuJ-A5EvHCUQ","user_id":"uHZxYHgjxhXY7PS6g2rFsA","business_id":"wMc9OCRrfhEMzONtNgpS9Q","stars":1.0,"useful":4,"funny":2,"cool":2,"text":"Come on, Safeway.  You are pretty much the only game in town for downtown right now.  You would think your corporate office would recognize this and remodel and class this place up a bit.  You have people who have money to spend living all over downtown Phoenix now.  The store needs to clean up its act, improve its customer service and cater to a new demographic emerging downtown.  If I had a new better choice downtown, I would never step back in this rundown location.","date":"2012-04-28 20:47:08"}
{"review_id":"8Su7TNWJnfg6iW0FPDKDGQ","user_id":"hJoRRKUWcdgjDmci2oua-g","business_id":"46Ld9Qc9nAx_A0jwclNZiw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Recommended by a local and co-worker. \"Don't let the wait scare you\" she said. Apprehensive by her comment, I rolled in solo at noon on a Wednesday. I was seated immediately. The wait staff speaks in French and English. They were overly  nice and accommodating. I ordered the Soupe de jour -yummy culinary concoction with sausage AND \"the Cubain\". A hot toasted flat bread with sliced seasoned pork, perfectly selected melted cheese and pickled mayonnaise. Delicious beyond delicious. Bon appetit!","date":"2016-03-30 22:50:50"}
