{"review_id":"Z7S9kPEOJUAXw49JDD9Zjg","user_id":"pKXx_Mb22BBKprZAG3Y4hg","business_id":"FBd6q_qzEFixvhV3KdzvJw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Riddle Room is easily my favourite board game cafe in Toronto. They have a wall full of board games and the staff there are really engaging and teach you through them. It's relatively cheap as they only require you to purchase a drink and you can stay however long you like. They also have video console games!\n\nI've tried one of their escape rooms before, and the experience was definitely worth the price I paid.  I believe there are 5 in total and I will have to come back and try them all.","date":"2016-01-04 06:37:53"}
