{"review_id":"dKArj0t6Fz1zV5iNn8UVkQ","user_id":"LaiylSIbrA3aPvOYtl-J4A","business_id":"4OzzW_Zw9g_rjvPlji466Q","stars":4.0,"useful":0,"funny":2,"cool":1,"text":"After a long day of shopping at the waterfront, I discovered Honest John's nearby and decided to check it out. Homestead is really getting some awesome places to draw in a crowd!\n\nI loved the atmosphere here. Clean, rustic, with an awesome bar. The menu is not overwhelming, but there is certainly something for everyone. I tried the lettuces salad with grilled chicken that was incredible and my friend had the grilled chicken sandwich and she raved about that as well.  I felt that the food was slightly overpriced ($15 for a salad..) but I enjoyed the experience greatly.","date":"2018-02-11 12:43:56"}
