{"review_id":"ocqLc9eO9SFQRETGz7mFfQ","user_id":"ZAqKO4wGZUNJ4Ntct0L3UQ","business_id":"cxsN3mkioAXuOLKy04QpyA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Ordered online at 5:45pm to have our food delivered...still had not received it by 9:45pm. Went back another day  to pick up a to go order.. waited an additional hour and a half in restaurant.. food was alright, will try again in a few months when they get their system down.","date":"2017-01-14 22:17:04"}
{"review_id":"Gsnt6Jwrm2C6f7Z4XWMDqQ","user_id":"v04xIfcCOFuXR--IUO5icA","business_id":"2lF1UsGcDpDpaI1lXgRX_g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great lunch specials!! Great margaritas! Bar service was wonderful & friendly....cant wait to come back!  Luv AZ","date":"2018-02-01 20:30:12"}
{"review_id":"Ft1m1ykt3A23cfCzgyQyYQ","user_id":"RX_Pu5NFnPukM0WK7Zfzww","business_id":"t3Rr8xk_9dSdoZm8sfwCXw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"From NYC, so after a long day of walking. My BF and I decided to rest, drink, and eat at this pub. Honestly, there is nothing to complain about the service was on point, the pub was clean and had a rustic European look to it, and the drinks were reasonable size and price (they have HH from 4-7). \n\nThe food was actually fresh and super good for pub food. Vegetable Gyoza had a very unique taste to it, the peanut sauce was a little spicy and thick, which I was dipping my fries into it. Dragon Wings are a must to get, these wings were spicy and a good portion, the meat was super tender and not over, which they'll make your mouth water. For those that do not eat meat, I highly suggest trying the Marinated Olive, Hummus and Taramasalata Plate. It was super good and flavorful. You will not be disappointed stopping into this spot.","date":"2018-10-04 15:44:18"}
{"review_id":"eDg1bsK5UOQpEsCUY1bd7Q","user_id":"0liIMuYz66q_Sz0F4mnLgg","business_id":"LJSEmHKt4GH8UlXvaUnBNw","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"Do not waste time and your money. They done less shot laser each time because they want to charge you extra for more treatments time. First time they used soprano(Alma) it works with heating the second time they used another laser instrument that work by shot,so how can get a good result in this way????","date":"2018-03-08 03:39:01"}
{"review_id":"rVKLU14rnTj6iY2defL1cg","user_id":"eguB3eXzLRK3h40Oi0Iw3g","business_id":"Z0Ni7T-93fPgx4M-loU_1w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Came here because I wasnt feeling well. The admin was sympathetic and waited to charge my co pay until after I had seen the doctor. I was seen within 10 minutes by the nurse. About another 10 minutes or so later I was seen by the Doctor. What a lovely, caring woman. She was honest and stated what she assumed the issue was but said because they didnt have the proper equipment (Cat-Scan) to check me and know for sure that I should go the ER. She waived my co-pay and I took her advise and went straight to Summerlin hospital. Thank you for your honesty, attentiveness and kindness. You are appreciated.","date":"2018-02-23 21:47:24"}
{"review_id":"XXjhaCPvhUjo5sC7SXGc5A","user_id":"7eKtHkxxWvI465WbDJj4dw","business_id":"0-jZq2P4eN7fRdt4Ls1QZQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Fav HK diner for dinner in my books. Usually I brace myself for disappointment at HK diners because they're not known for their service or their quality of food, but this one made me question if I was dreaming. \n\nService was very fast and staff are friendly. They close at 10 and we were staying because the show on their tv ends at 10. We hurried to get our bill but they were like, that's ok the show isn't over, feel free to stay. Like how nice is that! \n\nDishes came promptly too, meaning that the dishes were hot when they arrived. Yay! \n\nDecor is... Well, let's just say this isn't a place you'd want to set a candle lit dinner. But I mean it's a HK diner so what were y'all expecting? \n\nOKAY SO THE FOOD. Cheap, and big portions! I love that they have enough toppings for my udon. Actually, they gave a lot and I'm so glad. Their fish in cream sauce on rice was great and very cheesy. My fav! Also, their pork and chicken chop with garlic sauce on rice qas great too. The sauce wasn't too strong. It was aromatic and delicious. \n\nBut lemme tell you about the satay chicken udon I had. Oh my goodness. So many toppings and they had strips of green and red pepper to help complicate the taste. The noodles weren't oily. You could actually taste the gusto the chef put in when he was cooking this delectable dish in his wok. Oh my gosh. Definite 5\/5.\n\nAnd then! We had free dessert! It was my fav. I have to say, this is a very unique recipe of coconut sago and I love it. This coconut sago has taro chunks and egg. The egg was the truly unique bit because it actually made the dessert feel smoother and it made the whole thing more aromatic. Usually I despise taro with every fibre of my being but not today! My mom even said this may be the only time I did not puke at taro. \n\nMy dinner was $9.50, came with a hot drink (I chose lemon water), a soup (I chose cream of veg but they also have Chinese soup), and if you're lucky, a dessert. What a deal, especially with the amount of food i got! \n\nIf you're a skeptic of HK diners like I am, please come to this place for dinner. It will change your mind. I will definitely come back. I mean this isn't my first time here, lol.","date":"2017-05-26 02:13:09"}
{"review_id":"MGor9MX-tI6frxpWsRSWPA","user_id":"hn-mT1rG9FxXvYsII3JiIA","business_id":"WWyiaVsJusbRRdpTP5gomQ","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"We ordered the spicy fish Sichuan style. We asked for extra spicy but we were disappointed. It wasn't spicy and also bland in taste. We didn't finish it and the dish was about $20. I think there are tons of better options than this to choose from.","date":"2018-06-19 07:06:14"}
{"review_id":"zQ-8dN_W9wl1ednv7wKZhQ","user_id":"vbZZw6tZgH8PNu6NLcK6Sg","business_id":"kTqhrYTKwbWUe-HxfKjB4Q","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Hotels used to have lavish lunch buffets with some sort of meat.  Nowadays $12 will get you an all you can eat soup and salad bar.  Luckily Colors Bistro still offers one other hot item (usually a pasta).\n\nI miss the old days when this bistro would make endless refills of custom pasta dishes PLUS the salad bar, which we all know is really a concession prize for the good stuff.\n\nThe food is good, quality is OK and service is excellent here.  I'd probably try the menu items which might be a better value than the salad bar.","date":"2016-11-09 23:30:17"}
