{"review_id":"pw6fMYxXIS7ClQ8JEjgG5g","user_id":"WfqTqjfsBrpw0kbUePPnjQ","business_id":"3ViGD_AF1AUmxF4zeHB_kQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Terrible. Tried for the first time and was extremely dissapointed. I got the phoking pho bo and it barely had any noodles in it... like a couple strands. Mostly bean sprouts- how cheap can you be with rice noodles??? Paid like $10 for this and was not even full obviously. Went over to the Mexican place next door to make my lunch more fulfilling for a better price. It's like I basically donated $10 to their cause.","date":"2017-07-28 19:21:59"}
{"review_id":"8zDbR_DxgxFPN2EMTGKkdw","user_id":"RdMD77Uwe8Mjy_EptbPa3g","business_id":"Ul0EYexHUOptT9L2GUZJug","stars":5.0,"useful":1,"funny":1,"cool":2,"text":"I love Angie as a person and as a small business aficionado.\nShe's super accommodating for the last minute custom tan. I truly love the tan she provided me. This was my first custom tan & I'm not sure I could ever go back to just standard spray tan.  There were no lines, no drips, nothing negative about the spray at all. Plus Angie's attention to detail is what keeps spots from being darker or lighter than they should be. Just follow her instructions & you will be able to sustain the airbrush for up to 10 days. MOISTURIZE!!! & it will be so awesome. I got the booster to upgrade my base i had been working on. I got tons of compliments. I have another appointment scheduled for my post wedding party in Minnesota. Can't wait.","date":"2013-05-07 06:26:14"}
{"review_id":"F0B_TFZo81J4RvT2BgGD7g","user_id":"4SmD8zwsaAcN7JNzgP574A","business_id":"Px56NzP2NAUH2GktqSkSVg","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"This is the coolest indoor playground I've ever seen.   A lot of things to keep the kids busy (trampolines for kids, zipline for kids, swings, slides galore) and all clean, bright and sturdy.  Plus a toddler area for the littlest ones.  \n\nIt's a great place to have play dates so the kids can play while parents relax.   \n\nSocks are required for both parents and kids but if you forget you can buy some there.","date":"2016-04-11 17:29:58"}
{"review_id":"Y6SXKVyrn2VV9xSCVpmFbA","user_id":"HVJgTH5qu0goywOHNpOjPA","business_id":"SfP326rcU5sjwGx_dQP2RQ","stars":4.0,"useful":13,"funny":7,"cool":12,"text":"I was starving and sick from a bad sinus infection... My cravings were something fried, but also wanted some spicy soup to balance the two out. My thoughts were Tang Soo Yook and Jjampong!!! \n\nWe walked in a few minutes before closing and asked the server if she was still serving... she went back to the kitchen to see if the light was still on. If the light is on, that means the Chef can still cook for us and luckily it was!!!\n\nI enjoyed their Tang Soo Yook, which is a deep fried pork that comes with a tangy jelly-like sauce.. similar to sweet and sour that they give you on the side to pour over. This came out steamy, hot!!! Tasted fresh and love the tempura\/cornstarch batter that makes this deep fried pork so delightful to eat. The oil that was used seem new and made this dish taste light and perfectly crisp. Each bite was pipin' hot and delicious. The sauce that completes this dish consists of sliced cucumber, carrot, napa cabbage, wood ear mushrooms, and onion. I would say, without this sauce.. it would be very plain jane and definitely wouldn't be as good. Love!\n\nMy minus one star was the Jjampong. Although it had chunks of seafood, it lacked flavor tremendously. It was like putting chunks of cayenne pepper in water and heating it up. The spices didn't really do it for me and I felt like there were some missing ingredients that could have done wonders for this soup. That was the only thing that wasn't so great, but I did enjoy the texture of the noodles in this soup very much. \n\nTheir side dishes is very limited to only daikon and kimchi. But their kimchi is very notable... my Father loves the kimchi here and so do I. Small bite size square cut shaped, lightly seasoned, crisp, with a solid homemade taste. If they sold this by the jar, I would definitely buy a few :) Delicious.\n\nThis restaurant is also very known for their Jjajangmyun. A thick black soybean paste sauce with diced meat (pork) and vegetables (mainly diced onion). Normally, if you ask for Jjajangmyun, the sauce is already pre-made, but you can ask the server to cook the sauce fresh, which is called Gan Jjajang myun. If you like your vegetables cooked well, then order Jjajangmyun. If you like your vegetables semi-raw, then you will enjoy Gan Jjajang myun. I enjoy mine cooked well and so does my Mother. My Father, on the other hand orders the semi-raw. I don't think anybody knows that they can order it this way, so just sharing how my Family and I order our food choices here.\n\nThe location is somewhat hidden.. it's tucked in a corner nearby 168 market.. in between the Furniture Store and Nelson Barber Shop. Even the name of this restaurant is written in Chinese Characters, so don't look for Shan Dong!! Good service, great meal, and satisfies my cravings for Korean-Chinese cuisine.","date":"2012-04-28 09:57:50"}
{"review_id":"8szZeXb1W_VuIVJz5yTMfQ","user_id":"BA1cvK6jvpZaXODjUMHhYQ","business_id":"9p-cpmHaga-EXyc6ZzYCcQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great spot off the beaten path. Cool decor-great bathrooms if thats important to you to. The draft beer selection is 12 deep-but decent cause you can mix a few of em together. Bottle selection is average-could really step dat shit up. But overall a solid damn spot. The mixed drink menu-forget what its called but #1 is amazing. I wanna drink it till i black out and wake up in a gutter...its that good. The mint and fruit hide the bourbon and you just consume...and consume...and.....anyway support your local joint and give it a shot!","date":"2015-08-19 06:14:31"}
{"review_id":"pJxy31N963mQx9vydv0UBg","user_id":"qimxTm_J-nNVwOIIpx_u-A","business_id":"wvlF1x7Cm8UGu6iD0LgIJw","stars":3.0,"useful":4,"funny":1,"cool":2,"text":"Salsarita's is a semi healthy fast option in the Charlotte airport food court in between the C and D concourses. The menu is pretty limited but it suited my needs.\n\nI got the regular grilled veggie bowl which includes: rice, choice of beans, grilled veggies (unfortunately that consists of only grilled onions and green peppers), choices of salsas, tomato, onions, cheese if you wish, and jalapeños. \n\nThe bowl was fresh and pretty tasty although I was disappointed by the \"grilled veggies\" which the name led me to believe there would be a variety of veggies grilled, but nope. Just onions and green peppers. The spicy salsa was however tasty and indeed spicy. \n\nOrdering is quick and the service is ok. It's nothing special but it is a semi decent plant based option.","date":"2017-12-02 18:56:45"}
{"review_id":"8LRx-598zhIYrXbBdl_LPw","user_id":"V8ToKD19IuNIhPIxLsOfQQ","business_id":"vTQtnaCpuB1mVNnn0OuTow","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I was there for the first time yesterday.  I received a gift certificate for my birthday from a friend that has gone here for years.  I was EXTREMELY impressed!!  She did not try to fight my calick to go a different way, she cut my hair to lay as it normally does.  It took no more than 25 - 30 minutes for a consult, wash, cut and style. I love the cut and my husband even loves it.  (this from a man that never gets excited about my haircuts)  I will be going back!!","date":"2013-07-12 20:50:54"}
