{"review_id":"c7XBQ84iLeWA2puKDguP8Q","user_id":"zJswYX7-utNvV1dRxAHK2g","business_id":"UDE4VL0k8Zrko7RkJ4agGQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My sister in law ordered food catered from here for my moms 80th birthday.I was visiting from California and I love Thai food and Chinese food and eat lots and have had lots of different places.The Orange Chicken and Egg rolls were very good.Actually great.As was the fried rice and noodles.I have had better Satay, but this was good  and I judge for overall eating experience and this one was so good.There was so much good food and they delivered and really laid out the spread very nice.\nI don't eat Broccoli but the beef and broccoli looked very good.\nWhat made my day and I crave for all the time was the peppered beef and the best Pork that I have ever eaten in my life I really don't know the name but is was a breaded pork that was a little bit spicy and the BOMB!I mean the Bomb.I love Spicy..\n\nI can't wait till I go here in person and I will take some of that pork and put in freezer and take back to California with me.\nI will be coming here and eating this awesome food.\nI would recommend this food to be catered at a party to anyone .\nYour party will be a hit..\nRight on!Bring your awesome place to Cali..\nI love your food and could not get enough..EAT HERE WHEN IN LAS VEGAS.GREAT THAI AND CHINESE FOOD.....","date":"2016-04-11 17:45:34"}
{"review_id":"wlCGiURXoM2ef4QcmSGnyg","user_id":"aPF1nW2ecOTyFjf3ZCTtnw","business_id":"U1g7IHZcnRmOc2m3mvWNig","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Maybe not the absolute best Mediterranean food you will find,  but for fast good food it's  a must.  Super awesome service also make it a plus.","date":"2018-01-09 22:29:02"}
{"review_id":"97sIUHUXb2w_4uNShbMOcg","user_id":"ZWD8UH1T7QXQr0Eq-mcWYg","business_id":"owt49CrXMxyLNB_K8OY4-Q","stars":5.0,"useful":5,"funny":1,"cool":2,"text":"C & Dubbs has been a go to place for many many years starting off in a small barn looking building which was very small with few seats and not much time to move around.  Then moving into a plaza with a larger dining area.  For those of you that are not aware this is the home of the infamous Sumo Burger and Super Sumo Burger.   The names of the burger should speak for them selves but in case they don't let me sum it up for you....INSANE.  The Sumo Burger is 1 lbs of meat and the Super Sumo is 1.5 lbs of meat.  Not only are these burger massive but they taste amazing also.  Its massive and super messy and super hard to eat.  A good burger is a messy burger.  Well that's what I say at least.  I have visited C & Dubbs many times but my last visit i realized I had never reviewed it.  On my last visit of course I had the Sumo Burger but I shared the fries as the burger and a whole plate of fries would have been way to much for me.  Burger was super juicy and tasty.  Dripping with goodness.  Fries were super crispy and tasty.  Seeing as I always order the Sumo Burger when I visit C & Dubbs i think next time i'm going to step out of the box and order something else that is on their great menu.  \n\nALERT !!!!! Mississauga and Etobicoke and all surrounding areas C & Dubbs = Great charbroiled burgers.  Make sure to visit you wont be disappointed.","date":"2017-11-06 20:13:18"}
{"review_id":"iQzaWoIx0zXHvU889dpG0A","user_id":"Cp0JS7kZobOVesZSaJ0aJA","business_id":"O1z_XasQu9EXvRwCthTwlQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"AccuTemp Refrigeration was the third company I called for a repair quote for my A\/C unit which quit working back in October.  I had been told previously that my current unit was undersized so I expressed interest in possibly getting a new unit instead of repairing the old one.  \n\nThe technician who came out was on time and after assessing the situation recommended that given the relatively young age of the my current unit and smaller duct size, that repairing the unit was probably the best way to go.  I really appreciate the honesty and not trying to sell me anything I didn't need.  On top of the professional service they also ended up with the most affordable.  I will definitely be using Accutemp next time I have an A\/C issue.","date":"2016-03-07 03:55:41"}
{"review_id":"cjHfMcMEUoDYkVR8C6DWVw","user_id":"rYhhwBBPmrV9UwN7VIrnTQ","business_id":"58APdML-PG_OD4El2ePTvw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great value for quality food. Reasonably priced beer. Long lines.","date":"2013-08-03 19:02:40"}
{"review_id":"1GOhJq1dtNfzwX0IhJHXUg","user_id":"3iBJZAbL0TEpgEWB66--Yg","business_id":"50XvIvOubxwUsiSgyzaM0w","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"This poor rating is for the guy that runs the headlight restoration. A couple of months ago I stopped by to find out the cost for restoration...he comes over and gives me this full load of crap that I need to have this service done to remain safe while driving at night and he just wanted to help; didn't want me to have to replace the actual lights because it would cost close to $200.00 and he could do the restoration for $150.00....I advised him we can replace the headlights ourselves for much less and that his quote was extremely high. I always wonder if these guys truly believe that woman actually fall for this tactic. I went to the Walmart on Lake Mead off of Rancho after leaving the car wash and they completed the restoration for $29.00....the headlights are like new and the service department was great.","date":"2015-12-20 20:17:29"}
{"review_id":"2cHEJB2Zjq3OElpNu7Oeqw","user_id":"8Ai_ZcNO_Ros2xJ1HuIidg","business_id":"UT6L3b7Zll_nvRidijiDSA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Pizza was delicious. We got Getham, Truffle and Veggie. All were on point! Great bar as well.","date":"2015-09-24 02:06:11"}
{"review_id":"B50WcHF3Gkhk2NnS-Gvr_Q","user_id":"v6Oa_ca7TYnTAl3k96X8BA","business_id":"v9blKqAkFdEMusd6OaeRqw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I had the best experience here. I went here a couple weeks ago on a Sunday. They were the earliest place that opened, so I came in with my two young daughters. I had Cindy and my daughter had Kelly. They did such an amazing job! They were very nice and Cindy gave me a suggestion on a design. My nails are natural and I like the gel manicures for protection. She did a beautiful purple tip with an ombré and glitter. They were amazing. Unfortunately I totally forgot to take pictures. \nFriday, I went back to my old nail place because I had a gift certificate that I wanted to use up. They completely butchered my nails. I literally was in tears, because of the pain from the harder than normal grinding. Also the 20 times of being put under the light after every screw up. I knew there was no amount of fixing that would make it right, it really just kept getting worse. (And yes, I was the dummy that didn't get up and walk out. I was trying so hard to maintain composure and just hope that it turned out ok).\nSo... Sunday I went straight back here. I explained what happened and they were so very nice. Cindy was busy, so I went with Julia (I believe that was her name). She was very attentive and careful. She did a beautiful job. Bottom line, I vowed never to go anywhere else again.","date":"2017-06-28 01:00:37"}
{"review_id":"3Lha0h1V5UV_gg6NpOEhcw","user_id":"gfY5hPf4umUmBSoKg4ulmA","business_id":"uUEKndnFbHD8mVkGiirtpA","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"I have wanted to eat here since moving to Vegas, but it hasn't worked out. After \"checking in\" I found the timing was wrong given my new wardrobe addition of a foot and leg cast, very awkward foot boot, a walker and terrible parking with a long walk to sit down for dinner. After a couple of circles around the place we decided to give up this time around and try again when the cast is gone and there is less of a crowd. Guess this is the long way of \"checking out.\"  Four stars because that many people with four and five stars can't all be wrong.","date":"2012-12-04 07:47:36"}
{"review_id":"HTfNg2ChYKmA7MJzT2q7pA","user_id":"kTgMBl7Xse04Z0Y353bCjA","business_id":"7HbKKqXtZUjf6uVSHZ8wyw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great experience, great service, delicious food. Our server Alec was great and very attentive. I'll be going back when in town.","date":"2018-09-25 14:24:58"}
{"review_id":"62kelu6GkTpyVOguos5O2A","user_id":"Q-kFSXUsidFrFUB3D2g1Qg","business_id":"cTJjTKz2huGZ-ElScC2pSw","stars":4.0,"useful":0,"funny":1,"cool":0,"text":"The fish sandwich is amazing!  Great cocktails and a good beer selection.","date":"2013-06-24 14:08:41"}
{"review_id":"Z-C_JB5MykW3rG5Bsn7PCQ","user_id":"3DaUXXSq_rMMOqz01Upk-w","business_id":"ME6D5nLlfG0xZCtICOYDuw","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"We went during restaurant week and boy did we make the right decision or what! This place has some amazing food you can get in charlotte. Right from the drinks till desert, every item hit home run for us. The mussels in white wine and scottish salmon dish was absolutely delicious. Our server was not that friendly but who cares about the server when you are in food heaven.","date":"2014-07-28 03:53:33"}
{"review_id":"WLqAA5mp6W8lOHpSoH0HlQ","user_id":"pbo1TcPJHg1NeQz1adq2bQ","business_id":"VMPSdoBgJuyS9t_x_caTig","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"It's a small little place, right there on Willy St.  It's fairly cozy inside, with low lighting, but well chosen decor.  It's definitely not the best location for a large group, but if there's just a few of you, it's worth a stop.\n\nAs with other thai restaurants, they've got a spice scale (1 star = mild, 4 stars = Thai spicy), so you can customize the entree to your liking.\n\nNot being overly into Thai\/Laotian, I went with a \"safe\" selection, a stir fry in a sweet and sour based sauce.  I went with moderate spice. It was definitely a unique taste, one I would highly recommend!  I wouldn't consider it traditional fare, there were more than plenty of options, if that's your thing.\n\nI was convinced to go in halvsies on a dessert of mainly coconut milk, rice, and cinnamon, topped with a slice of mango.  Good thing it was in season! It's one of those unique dishes that, I have to admit, doesn't sound like the most appetizing thing until you try it.  However, if you get the chance, go for it - it's a unique dish you won't want to pass up.\n\nI'd recommend Lao Laan Xang for anyone else looking for a unique, tasty, meal.","date":"2009-10-13 22:58:54"}
{"review_id":"IFiAEiWl2ft_C9udF1c-KA","user_id":"HJIyJS4W-D7QemaabqaNCg","business_id":"_ZfjpSEO5ntk-1hbnwCR4g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"After checking in and having a few issues, the staff upgraded me and put in the best suite I've ever been to in Vegas. It has everything you need plus its fly! Keenan the concierge man was so helpful in getting everything situated. I have stayed here on my last few trips to Las Vegas and I dont see that changing anytime soon. Good stuff, Palms Place!","date":"2016-02-23 21:08:23"}
{"review_id":"qH-KcORj1hyHNrFhvelLLA","user_id":"CLbWqhueMo4L9yEFn2FkEg","business_id":"e1RcTvtihmYdf8At7hLgRw","stars":1.0,"useful":6,"funny":0,"cool":1,"text":"Very disappointed with my experience here. My fiancé called the Casino and were told that our $35.00 parking fee would be waved for eating at the buffet. (We were only visiting for dinner). When we get down to the buffet we had to wait in line for about an hour and there were empty seats everywhere. So I decided to go up to the front to ask about how long it might take and the hostess basically ignored me and turned around and started yelling to her coworkers about how annoyed she was that \"people\" kept coming up and asking her about the wait. Long story short, we finally make it into the buffet area and were seated.  We had to wait about 10 minutes before we were even brought water. We finally got to the food only to find that it was not great. The fish was very dry. In all honesty the two things I really only enjoyed were the gumbo soup and cocktail shrimp. For the price of the buffet here and income of a casino I was expecting much higher quality food. We were also barely acknowledged by our waiter, and some of the other waiters were yelling slang to each other in the dining area. Very unprofessional. To top off our \"not so good experience\" we were told that we could not be refunded the $35.00 parking fee. But wait.. That's the only reason we parked there when we could have just payed $10 in the next parking garage. So $75 for a not so great dinner. We definitely won't be returning any time soon. I'd say the casino should step up there game in the dining department.","date":"2015-04-01 14:11:05"}
{"review_id":"1we-CnBDCts_xC1VGuwRCw","user_id":"sOL82Hbfza89tKL6m_wBJA","business_id":"A-ToCCe7d2lWM2uXGVMO7g","stars":1.0,"useful":4,"funny":0,"cool":0,"text":"Many people who reviewed that place say that they have been in California or Texas, that they know what good burritos taste like, etc. Well, I have also lived on the West Coast, been to CA and TX, and I was quite disappointed with this burrito place. I won't say I was surprised, because we live in Montreal and it's so hard to find good Mexican or Tex Mex food around here. But the service was slow, and I was not impressed with the food. For example, the fillings were not evenly placed in the burrito, so there were bites with just rice, nothing else. Don't waste your time and money there.","date":"2013-09-04 02:51:10"}
{"review_id":"JrYvC5lKuqSZDmTq-0PYCA","user_id":"D8PJTlkMlwAyDjow3pup_Q","business_id":"Jt28TYWanzKrJYYr0Tf1MQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great all around. The tortilla soup was fabulous and the service from everyone was awesome! The only reason for 4 stars was nothing really blew me away.","date":"2014-08-24 20:31:29"}
{"review_id":"GOjvvwb1K1Pr6w73FvodwA","user_id":"cWEHD_idBtQKg5uU_XV3JA","business_id":"LHSvyzZ7n7Hy0xAdjHRTlA","stars":5.0,"useful":1,"funny":1,"cool":2,"text":"Totally amazing! Never painted a day in my life! Was fun, laid back and heck, who doesn't like a nice glass of wine while painted your latest master piece!!","date":"2014-11-12 17:07:12"}
{"review_id":"OYJsl8IcRVXG5ViICQTrgA","user_id":"onroTne3We8dVWfw3lz3eA","business_id":"aRqxT28Tdz2aDiZ7Vkyejw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"This is by far one of the most amazing places for fried chicken and waffles. They offer the fried chicken in 2 varieties: original and hot. I chose the original and it was tasty and not oily at all. The waffles were fresh and soft. I also ordered birthday cake super shake and it was nice but nothing extraordinary though it had colour sprinkles. The place is tiny and have an outdoor patio as well. I went on a Friday evening around 7 and waited about 15-18 mins to get a place for 2 since I didn't want to sit on the patio. \nThere were only 2 servers and they were friendly and didn't bother us constantly unlike someplace where they want you to eat and leave. Even though all the tables were taken, they didn't mind us sitting after we were done our meals. This could be due the fact the kitchen had closed and were getting ready to close. \nOverall, I enjoyed my time at this place and will visit again in summer to enjoy the patio.","date":"2018-05-19 01:49:09"}
{"review_id":"uE0SAvF1B7breSmRURFn3A","user_id":"KdRUbbdZ4GxjV4h2BeZH9w","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":9,"funny":1,"cool":1,"text":"We walked in 15 minutes before the doors opened for lunch on a Tuesday and were the only ones there.  By the time we left 90 minutes later, the place was packed and the line wound outside and around the corner.  And with good reason.  \n\nShe started with the sweet potato soup.  It was perfection in a bowl. Sweet, creamy without being heavy.  My goat cheese queso fundido with blue corn tortilla strips was cheesy, slightly spicy, with more than enough chips. Really tasty.\n\nShe had a Mesa burger, which might be the best burger she ever had.  Cooked exactly as ordered (rare),it was thick, juicy and loaded with flavor.  Even the bun stood out.\n\nMy cornmeal crusted chile relleno had a delicious crust loaded with great corn flavor.  The pepper itself could have spicier to my taste, but the cheese and sauce inside blended perfectly-a well presented lunchtime treat.\n\nWe both preferred the burger, but not because the chile was bad in any way.  The burger was just that good.\n\nWe'd return.","date":"2012-03-30 05:48:46"}
{"review_id":"6_Hl0PJllLq_QhsAP3fmBQ","user_id":"ngUZHNmoV2JO0P3vZgdCKg","business_id":"hr_zh7IUGsPdi9UNfVn-2w","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Andrew has done my taxes for the last 3 years based on a friends recommendation.   The first couple of time he helped me navigate through some serious financial issues I had made in my early years.  The outcome was very favorable thanks to his excellent advice.  This year he really came through for me and my family, and it took less time the the previous years and emailing back and forth made things very convenient.   Thank you andrew for the excellent work!","date":"2014-04-19 15:24:39"}
{"review_id":"oo7RO8_DIJAavSfbDIz7bA","user_id":"S1bijCtBDIwew9C1VfXB1g","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We always go to Mesa for special occasion. Absolutely love the dinner. We've been wanting to go for brunch and finally did. Here's my comparison of the two:\n\nBrunch bread basket was better... which says a lot cuz I'm a sucker for the jalapeño cheese bread at dinner. But there's like some coffee cakes and oatmeal things and mini jalapeño muffins that were all delicious. \n\nIf you go for dinner you HAVE to get the cactus pear margarita on the rocks. By far the best margaritas we've tried to this day. Also their side of corn is amazing but seasonal. The tiger shrimp appetizer and rough cut tuna nachos are go tos for us as well. \n\nAs far as breakfast goes, we got both quesadillas (one with egg and one with salmons- i forget what they were called) and they were delicious. The sweet potato clam soup is also great, we've had it twice. It was better the first time but still very good. My waffles... AMAZING. I could have eaten a whole stack! My husbands potato hash Benedict wasn't as spectacular. The flavor was fine but it was all one note texture wise. Very mushy. The mango glazed bacon was good- take it or leave it. \n\nOverall we are fans on Mesa and always come back. Usually we get a couple things we know we love and always try something new as well! Our service has always been excellent.","date":"2018-07-07 23:19:26"}
{"review_id":"2IzPo8rE8iLgfawGMsBaXw","user_id":"0ObIfSgndeeR_kGlo1S7Ww","business_id":"OK0ba4X5seibH8oMWh4bhw","stars":5.0,"useful":10,"funny":7,"cool":9,"text":"Where do you go for some off strip sushi to die for? \"I Love Sushi\" of course. I didnt know what to expect especially from a place called I Love Sushi, let alone it being located in a strip mall. Boy we're we surprised. This place was huge and had about 20 sushi chefs working behind the counter. The place was packed on a Tuesday night. I think the place seats about 200 easily. Wow. The food was awesome. AWESOME. The rolls were about $12-15 each but boy were they worth it. I guess one of the gimmicks of this place is the names of the rolls. Screaming Orgasm, Taste Like My Ex Girlfriend, Fat A$$ Special, and so forth. Regardless about the name, the flavor was top top notch. This is definitely one of my favorite places to eat at. Even though the names and description mention \"special chef sauce\", they are all different sauces that are highly recommended by the sushi chefs. I read somewhere there was a total of 81 chefs that are employed there. Here's a list of rolls we had:\n\n(Check out the pictures I added to the I Love Sushi page. Warning: May cause a craving for some Sushi!)\n\nJackpot Roll - I dont remember the exact description but its a fried tempura roll with spicy mayo sauce.\nSpider Roll - Soft Shell Crab\nScreaming Orgasm - Seared Tuna in chef special sauce\nFat Ass Roll - Tuna, salmon, yellowtail, white tuna, crab meat, avocado, deep fried panko, spicy mayo, hot sauce & eel sauce.\nI Love Sushi Special - Spicy tuna & cucumber topped with tuna & spicy special sauce\nDouble D roll - Raw Salmon and tuna on a roll and then into the yummy sauce\nDragon Roll - Lotsa lotsa Unagi.\nBaked Scallop Mushroom","date":"2008-08-19 05:13:44"}
{"review_id":"AdLWfUhIG4Yw4K5IN9079g","user_id":"GK3mV8cjNG2TfD1NZh6EUA","business_id":"HRLHrJudlNsmtY-je3PDLQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"The prices are as posted. $10 tip the norm at these parlors. It's definitely worth it and I'll keep coming back when I'm in the area.\nThe tables were clean and the masseuse constantly changed the towels and the water. The background had piano music and pretty quiet.","date":"2017-08-07 20:10:07"}
{"review_id":"kWbS8pQrkySvz1K5I-tYZA","user_id":"RNzjSh9EApYf_hvJGtbpxQ","business_id":"RDw-K8fjs5Mporlq2KqTUg","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"Mobile order was perfect.  Then when we got here we added a tall drip of the dark roast and they filled the cup to the rim. Yea!  Many places don't ask and then leave the cup 1\/2 empty.  This is a small Starbucks.  Just wish they had some outdoor seating.","date":"2017-03-03 19:13:35"}
