{"review_id":"CG8dM5cC3Arv0HqdG_RtXg","user_id":"lmyuHkeEuUGM2tqc6LiNGw","business_id":"Yc5_nA9NqqxOp8WCugF-Ng","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"One of the best NY style pizzas in the city.  Location is not much to look at on the outside, but very clean and fresh on the inside.  Plenty of parking.","date":"2017-04-07 21:26:32"}
{"review_id":"MNoabHbmk_kh43EUHlI_jg","user_id":"uaPJcLEu_MiPyYT7ZcaqHg","business_id":"-BmqghX1sv7sgsxOIS2yAg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Was a little skeptical the first time I came in so I am updating my review as I have been back multiple times, the ethiopian food is soo on point its rediculously good! The service is ultra casual and chill. This place is by far my favorite ethiopian restaraunt, and I highly reccomend it. The spice is perfect n the raw beef is delicious! Worth your hard earned $. My wife says she looves the cabage dish!","date":"2015-12-05 03:49:33"}
{"review_id":"5wyY86amixKlfmo3XyPzBA","user_id":"pLBxv4aOFRHp3m_H64lhRQ","business_id":"WCnPXkhqsbjJCEgS0FempA","stars":5.0,"useful":0,"funny":0,"cool":3,"text":"Sean took care of us & recommended the best martinis in town. This place is classy & a good time! Thanks Sean!","date":"2017-02-09 06:07:22"}
{"review_id":"nNfHzbh754NYJXs8xqEjRg","user_id":"tX4d5ktzse4TPxNOds4VCw","business_id":"28adZ4lsuUeVB2aWzohK9g","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"After walking past the sign nearly every weekend this summer, I finally popped in to Prohibition for \"the best brunch in town\" when I realized I was much too lazy to attempt cooking for myself.\n\nAdmittedly, I have a tough time getting up and getting dressed on the weekends, so I'm not much of a brunch connoisseur.  That being said, their \"best brunch in town\" claims may not be that far from the truth.\n\nI ordered the stuffed French toast, which featured two LARGE slices of sourdough bread, stuffed with mascarpone cheese, and topped with enough maple syrup, fresh strawberries, and whipped cream to put me into a sugar coma for the rest of the day.  Coming with a side of bacon, I couldn't ask for anything more.\n\nTheir brunch menu isn't extensive, but what they lack in options they make up for with pure quality, both in the ingredients they use and portion sizes they present.  My stuffed French toast left me entirely stuffed and very, very happy.\n\nIt's definitely on the pricier side ($13 for my meal, $15 for the plate my boyfriend ordered), but when I'm raving about the food to my coworkers on Monday morning, you know it's totally worth it.\n\nI'm not as smitten with the service (we were starving and it was a little on the slow side), but everyone was friendly enough, and I will most definitely be back in the very near future.","date":"2012-09-10 14:25:55"}
{"review_id":"8LBy48Lt-6qQDqpscSd7oA","user_id":"-y6S1XnwFt-ZXasyPXbr6A","business_id":"yzmvsG3Vo-2_F3_0wHzJdA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We were honestly headed to Applebee's and came in here on a whim. It wasn't busy and we were seated right away. Our server, Crystal, was attentive and served our drinks within minutes of us sitting. I ordered the meatloaf plate with a cup of broccoli cheddar soup instead of the vegetables. My fiancé got the Holy Davoli Burger with a side of fries. The soup was so delicious... I could have ate only that. It was creamy and full of nice pieces of broccoli. Then the meatloaf came and WOW! Juicy, tender, full of flavor! Comes served with mashed red potatoes and brown gravy. I'm so glad I decided on that meal. My fiancé was also impressed with his Burger and was glad we decided on Metro Diner over Applebee's. I definitely recommend this place and will be back to try their breakfast!","date":"2017-09-09 01:51:43"}
{"review_id":"DQfx926z2J2zHqLbzkboBQ","user_id":"ug6pnYz7O-JrYJpOJ1EZ_Q","business_id":"O2OD-ojkZXsSbFyzpuvtIA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Absolutely amazing. Vegan. But you certainly I don't need to be a vegan to enjoy and appreciate the quality of the ingredients and the excellent execution. The sweet potato tamales were soft and flavorful, and the tempeh BLT was just about prefect.","date":"2014-07-13 19:32:46"}
{"review_id":"Mhes7Y_4BUJBzXH8SicIfg","user_id":"4BSBPB2hy8CDXZA0yfC7TA","business_id":"4qG3Gh8QyugC1XvoTlmgcQ","stars":4.0,"useful":1,"funny":1,"cool":1,"text":"Great breakfast option in SW Vegas. Breakfast is standard but good. Burgers are above average. Service often leaves something to be desired unfortunately. \n\nThey respond quickly to the sad egg on the table though if you have problems.","date":"2014-04-19 15:19:42"}
{"review_id":"c7srsAhrbuNPB-x1rMCAAA","user_id":"fWbS2oeOL7v2vHM8QhsIiA","business_id":"RLxRHA6HcHrrBOMpSln7MQ","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"Had a groupon for the high roller which included either a picture of the high roller ( eh!) or 1$ off of 6 pictures of our choice totaling 5$! This was fun and easy and the picture came out amazing! I rather do this then pay 30$ for one picture with a fake background from high roller! It took less then ten minutes for the pictures to be printed! I walked to yard house got a beer and walked back - beer in hand! Great experience! Very helpful associates! Amanda helped us and she was sweet and full of smiles for us!","date":"2015-02-16 05:41:44"}
{"review_id":"R2vBlxTqSSGfKMvw1UQILg","user_id":"23ueRrSWWtrEyT2ViGWKMg","business_id":"eI1ZHGOr2Pus842KrZD5ZQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Food is excellent, fresh made to order dim sum, gorgeous location and great service staff. Will be back for sure","date":"2017-11-06 18:59:57"}
{"review_id":"efX1eGbUIj7KhpTykw2NDQ","user_id":"_DuT53_-Cs2t8h9UVe6VtA","business_id":"eqQnIjAAhOUuHqK6gTWRXw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Carryout was very good!! Rigatoni D and Lasagna (meat) were excellent. It's nice the way bread and butter are included without having to ask for it. Best part of the meal? Lemon cookies!","date":"2011-10-27 19:54:32"}
{"review_id":"F1fldN4wcWvJbm-wdl11GA","user_id":"Ka2VMEwLf_uZuRAxGSRZlg","business_id":"eaNenRk_liZBERFFLCXqqQ","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Hobak had a great selection of meats the prices were a little high and the service wasnt always there when you needed it but overall a good spot to eat at. The fried rice and corn were really good and so was the spicy pork belly.","date":"2017-07-28 19:15:49"}
{"review_id":"dWoZNvnLZDVr6tRCYHX2Mw","user_id":"W5ijbelWAZzNtV_bVzcC-Q","business_id":"zgclYxtxOdS4-KIxO7j_UA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Best prices and best haircuts! I have had two haircuts here and am going back for a third very soon. I get compliments on my haircuts from Marina everywhere I go!","date":"2012-12-04 14:45:16"}
{"review_id":"sXA7N2x7tQi4WLYw9d64NQ","user_id":"LUNO0fVb3aO-SPDjMYmzzA","business_id":"UByM7N0mF-ylIGUuIWHCtA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great experience; 2nd time is always the best. Start with the crab cake, it's fantastic. If you're not feeling a cut of meat, go with the seared scallops and as a side, I highly recommend the Mac and cheese. Very awesome, almost like it is made with cream cheese! Great wine selection, get a bottle for sure. Dessert, cookies and cream pie. I went on a date night and we got out of there for $185. Pretty reasonable considering other similar joints in Charlotte can run you $220 easy. Another bonus is valet is friendly and accommodating. Highly suggested my friends!","date":"2015-05-12 19:21:30"}
{"review_id":"pbaJFM1E86IwoS9Aynf4Pw","user_id":"8Fna5VseoP5pw-8cnHer-A","business_id":"8Fgiwhu-RcnyaxdLx-HIhw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Hunting around on Yelp this evening at 5:50pm on a Friday for a place to eat that wasn't booked and found this little gem. Moon is super. And I genuinely mean this. I Love this guy. So genuine.\n\nWe had edamame and tempura to start which was tasty, but the real winner was the hot rock bibimbap and ginger honey tea. Throughly enjoyed both the food, and the dining experience.","date":"2016-05-07 04:45:00"}
{"review_id":"4JXCAbqFL3VvmzBU4AcOyA","user_id":"3Y7KI-jzy8rMgzAxGgfNDQ","business_id":"yNPh5SO-7wr8HPpVCDPbXQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Fabulous service every time, love their menu and drinks...oh my god their drinks are fabulous! Super cute restaurant and bar!","date":"2015-07-03 21:46:17"}
{"review_id":"lrsIVpDYAlDyrUIO1KNKiA","user_id":"8nSAbI-nUi0GavThHTEkJQ","business_id":"2SfSzEd3B7WimeZac23zhg","stars":5.0,"useful":1,"funny":2,"cool":1,"text":"EVERYTIME we come \nEVERYTHING is perfect\nEVERYONE is happy\nAnything is good\nJuices\nOmelets\nLunches\nDinner ....great choices all around  and the ambiance here makes us feel like we're on a street in Europe","date":"2016-09-18 16:40:43"}
{"review_id":"FL0nIFXADj9jNWvc02l5jw","user_id":"1l_O3VEl9TV_JjKAzzyz0Q","business_id":"d_q4avZYM1sOlQP7noJKVg","stars":4.0,"useful":5,"funny":0,"cool":2,"text":"Being from Tucson I was happy to see this location open in Phoenix.  I am a big fan.  The owner even came to our table to see how we were enjoying our meals.  Go with the hot dogs!","date":"2016-01-17 05:30:17"}
{"review_id":"Qtv-TS4MgC8jNS5jKbPHGg","user_id":"MMxRLgkd-MgwowmggmR2Dg","business_id":"Ec9CBmL3285XkeHaNp-bSQ","stars":5.0,"useful":8,"funny":3,"cool":3,"text":"District One is a hidden gem. The chef is great.  He loves to play with his ingredients.  You can tell by his dishes.  I came here a year ago with my mother.  It was great and still is.  I came here a few weeks ago with my husband.  \n \nI was able to try a few different dishes this time around.  Oxtail Fries is a must!  Pork Belly Buns was tasty, the balance in flavors is great.  Pho was good and fresh ingredients. \n\nCan't wait to come by to try their other small dishes!","date":"2017-08-16 11:17:43"}
{"review_id":"ATOq7ZT5himnl6DSg6kMdA","user_id":"uH7Gx_30lEJQKsFeTO0oBQ","business_id":"yIFDNdtHtggwz15aBhB_Jg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Every time I enter the valley I have to stop. This place always has good older books at good prices. The staff is knowledgeable and helpful. I might only go a few times a year, but they always treat me like a regular.","date":"2015-07-03 20:09:56"}
{"review_id":"EXOX42b8ljnofLUC-KpR0w","user_id":"D7gRkh8gokvIlfxz0s72fQ","business_id":"mRWNt7hxoFzo5XZaoSC7aA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Went excited to try trivia with some friends. Got there an hour early, and tables and bar were full. It took 10 minutes for anyone to acknowledge my existence. Finally the bartender did, and when we asked about trivia we were told \"Well everyone here is waiting for trivia so it looks like you're out of luck.\" \n\nWalked out. Will never return after service like that.","date":"2017-01-27 20:28:38"}
{"review_id":"xCSSXsY_enLX0GNiBxCyvw","user_id":"WlSFEwPHTe_cXssK-U1cwQ","business_id":"jgJ49_07V74oZpTxIFtHaA","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Day five of my journey to get my carpets cleaned.  Friday show up at my door because they wrote the wrong number down and were unable to contact me.  Reschedule for Saturday and they send a truck out that is unable to reach my apartment.  Saturday round 2, send a truck with the same equipment that was unable to reach my apartment.  Call office girl who made mistakes refuses to talk to me.  Reschedule for Tuesday and I waste my entire day off waiting.  Quoted 2-5 and I get a call saying that they are going to be 45 minutes because they were on the other side of the city (@4:30 5 minutes before the 30 minutes they quoted when we called to confirm).  But it's ok because when they screwed up on Saturday they assured me it wasn't my fault which I'm sure they will tell me again.  THANK GOD...I have to sleep at night and all.  So here I am 40 minutes after they quoted me 45 more.  All I want is my damn carpets cleaned......if you don't mind wasting 2 of your days off and a lot of patience call them, their prices aren't bad.  But if you value your time rent a machine and do it yourself.  At least you'll know it was worth it and the only person holding you back is in fact you.","date":"2015-04-28 21:11:10"}
{"review_id":"Z9grrTwOafmmrijk8b-OmQ","user_id":"UK5IQUGvMTdbNWn3ImHqqQ","business_id":"ZZ5KRLz9TuNs66Y2KYsxRg","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"Terrible Company!\nThey lie about where you are going to be staying even though they send you out a confirmation.  Don't believe a word that Louis D'Amato says!","date":"2017-12-29 17:07:17"}
{"review_id":"iiCfvg8RsbtDJTS7-SWyqA","user_id":"V-CMshOnHJcJxJiwY-Q8PQ","business_id":"ZCzey5aPhd7jYIoHsUfjmQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I've only come for lunch and I was very intrigued so much so I wanted to have dinner here. Tonight it so happened my boyfriend and I came to have dinner and we were blown away with such stellar customer service. We met Nick who is one of the owners as he walked around and made everyone feel so welcomed. He introduced himself and asked if we needed anything. After that we felt we had made a new friend. While sitting at their Wok Bar the second owner who appeared to be the top chef was so informative with the dishes. Jarred was phenomenal and extremely thorough. He even made us a dish and said it was on the house. Over all our experience here was the best I have ever had in an establishment like this. I will definitely come back.!!!!","date":"2015-12-05 03:37:48"}
{"review_id":"vNjtzYulbVou25e5pDH8HQ","user_id":"AF531-rF67ZVFSWTqPc38A","business_id":"XTtNTWH_Nqv27RC7OtS7dQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Super good service.  Fresh salad.  Broccolini was cooked perfectly.  I ordered iced tea and they had simple syrup.","date":"2018-07-17 01:56:47"}
{"review_id":"9L0BGNjkjngf85LyplSoJg","user_id":"yMiikE7cpVyVLDnJRClLfg","business_id":"pAvqYATjeOZ81xRXh_LC1g","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place was great! The rooms were clean, everything was well organized, the staff was knowledgeable and friendly. I loved the choices in sound. Check-in was fast and simple. My favorite part was the relaxation lounge. There were books, oracle decks, crystals, tea, all kinds of things to relax and enjoy after your float. There was also a book you could leave a journal entry in, it was fun seeing everyone's doodles. Highly recommend this place :)","date":"2018-03-23 17:00:34"}
{"review_id":"yKn0GHRUR3zsGJULA7TXwQ","user_id":"qfXohvCRAeBYFo0-JgseGg","business_id":"hihud--QRriCYZw1zZvW4g","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I went to use the ladies' room and had to wait for a very long time. Finally, the person in the restroom came out and it was a MAN! He was an employee of the restaurant and was not apologetic at all.","date":"2016-04-23 01:38:15"}
{"review_id":"ViJM5hgjDnfatyOAlUKwgw","user_id":"2cZjRgKyhDxC0mzhXdGNDQ","business_id":"eb31LLI9QhMbtjBlkyx7VA","stars":1.0,"useful":1,"funny":3,"cool":0,"text":"This place is packed and the rounds take over 5 1\/2 hours.  They do a good job of marketing, too good.  So that all the hackers and everyone under the sun show up.  I have no problems with hacking since we've all been there.  I do have a problem with no marshal regulating play, the starter not effectively staggering tee offs and people so drunk they can't even stand on their own two feet.  \n\nConsider this place a really pristine muni course, actually you're probably better off at \na muni course\n\nThis was a weekday, I heard weekends are a joke","date":"2013-10-03 15:58:47"}
{"review_id":"aV3E4Wz_Fj5_s8a-55M0_Q","user_id":"7cnJMmi8GJdYzdN0p-F6mA","business_id":"quW_e_rh4PCp2snKAijcgw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I had given this Starbucks a one-star review several months ago, saying I'd never go back after several less-than-stellar visits. I'm pleased to say I've been there since, and wow, what a difference that time has made!  While I still avoid the drive-thru because that's always super-busy, going inside has become a pleasant experience, thanks, in my opinion, to a new staff who are both friendly and efficient. I'm the only one who's noticed the change - the store is now regularly full inside. Yet despite the much busier atmosphere, drink times have gone down. Nice job, Starbucks!","date":"2014-08-24 21:18:28"}
{"review_id":"Q-DN0JCqkzjnNlRfJ9cttQ","user_id":"W8f0nguK5y_F8t_Y78pe_Q","business_id":"O1J2zf-IGDxDig8WifUSrg","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Someone broke into our truck on a Saturday night. We contacted several places to get it replaced on Sunday with no luck. Some told us it would be Wednesday or Thursday before they could get to us. I remembered using Vegas Glass several years ago, so I made the call. Not only did they get us in within the hour, they were $30 less than the lowest quote. They did a great job. In spite of this being a specialty truck, they had the exact window and installed it in a couple of hours. This is now the only glass installer in my contacts.","date":"2017-07-08 18:56:36"}
{"review_id":"R_tUpHD5ojr1At4sQfU-5g","user_id":"rI1KT-JquO6IIKfX3K4GfA","business_id":"5DDumAHRKumv3gZiPKW6iw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Love this place! The ice cream is delicious, and vegan ingredients! My sister and I visit at least once a week or so!","date":"2018-10-04 16:06:55"}
{"review_id":"-VjjcplDQulcRs2UFQ-Ewg","user_id":"27LgQt_13f47mMFGfjGW-g","business_id":"eUuKXhloFVHdQsLdodcLbw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My husband had Steak salad and raved about it. I had steak nachos which was great. We will be returning.","date":"2017-12-02 21:35:21"}
{"review_id":"5usdlJiCfdgQqXbhzjfPDg","user_id":"-daqhtJSAahr-4pVaNt3fA","business_id":"7PRse3yCQbEprAj1DWrEQQ","stars":5.0,"useful":0,"funny":1,"cool":0,"text":"A very nice seafood dinner for my family. My wife loved the Frutti di Mare linguini, my six year old loved my leek soup and tilefish, especially the garlicky spinach and potato salad, and I enjoyed what she left me. Nice wine selection, and excellent bread. Definitely a repeater.","date":"2013-12-29 01:19:25"}
{"review_id":"QpkBmrBN5CSMIWJAwXI8CQ","user_id":"kFXsGfeywYxgE2atC6WBLQ","business_id":"62HlThvB9Rm2QFu_OdXe7w","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Debated on going 3 or 4 stars for the review. I would say that the firecracker shrimp, garlic noodles, selection of fresh spring rolls, and shaken beef deserve a 4 but pho is maybe a 3 and their crispy spring rolls is probably a 2. \n\nSpring rolls: They have a great selection of some traditional and some really Americanized spring rolls, but nevertheless, their spring rolls are great. My grandmothers and Vietnamese restaurant-owning relatives probably wouldn't recognize half of the spring rolls they sell here, but they're tasty. My favorites? The Spicy Asian (Chinese sausage, imitation crab, sriracha, jalapeno, some sort of crunchy stick) and the Enlighten me (this one's vegetarian). \n\nPho: Average. This would not be the reason to come here, although I do get it from time to time. It's not the best, it's not the worst I've ever had. The broth is so-so, unremarkable. Also, I don't get cilantro with my veggie plate, which I think is really weird. \n\nDrinks: They have a great selection of fun cocktails. \n\nStarters: Get the firecracker shrimp with the garlic noodles. They go great together!\n\n Service: Hit and miss. Sometimes, things can be really slow, but lately, things have been pretty good.","date":"2014-01-17 05:08:27"}
{"review_id":"d6uDezsRnLdQgxaxtUe8_w","user_id":"Uf_TVv1Z4s024jdI4UKWtA","business_id":"RCxgxuzyqiUbgomawkEcJQ","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"If you wanted to make an embodiment of all the stereotypes that are wrong with the fitness industry, that embodiment would be LA Fitness.\n\nWe have had a number of issues with LA Fitness. To keep this short we were lied to about personal training contracts which set off a cascade of events.  We had personal training for a year with LA.  When that expired we went to cancel our training and were told, at the time of signing, that we could use any banked sessions after canceling.  The personal training manager at the gym on Riverview (Peter) told us this was not the case and to prevent our 16 banked sessions from expiring 30 days later we could change our contract to one session per month.  We did.  After that we could never get in with our trainer.  We would show up to discover that he was working with someone else, we would schedule times with him and then they would mysteriously fall off the schedule, and we even noticed that we were being charged for sessions with other trainers that we didn't book.  We believe that Peter was filling our trainer's schedule with new clients and pushing us off since we were on our way out. When talking to Peter he was sure to inform us of his salary and that to keep his position he needs to keep his body fat under a certain percentage.\n\nI spoke with James T. (VP of Personal Training) and we worked out a deal.  We were refunded some of the sessions we had banked and could keep the balance without them expiring.  We had to take a few months off of lifting due to an injury so this was a great arrangement.\n\nWhen we went to use the sessions we were told they had expired.  I contacted James to get them back.  After four weeks and five voice messages James never called me back.  I emailed the customer service email and they eventually called me.  They only gave me 3 sessions back.  I told them this was unacceptable as we should have had 4 and that I would not allow them to just steal the session.  I then received a call from the Regional Operations Manager for Phoenix.  He agreed to refund us for the one session that was still in dispute.\n\nWe went to the gym on Stapley\/University to use our three sessions.  We were very specific about what we wanted.  All we needed at this time was help to perfect squat and deadlift form.  We were told that Joseph is the guy for that.  We scheduled a time to work with Joseph.  We showed up as scheduled and the front desk informed us that he doesn't work at that time.  We checked the schedule in the app to find out that somebody moved our appointment with Joseph from a saturday to a thursday without contacting us.  We then rescheduled a time with Joseph.\n\nWhen we met Joseph for our session he very arrogently and aggressively scolded me for asking him to only help us with form. \"That's not how training works, if you're going to work out with me I'm going to make your plan and you're going to do what I say.\"  We spoke with the manager and he told me we could either work out with Joseph or not, but that we would be charged for the session.  We were very specific when we scheduled the session that we did not want him to make a plan and that all we needed was help with our form.  \n\nI chose not to challenge this because I was tired of having to speak with people in upper management to resolve issues caused in the gym and this was the third strike for LA Fitness.  We were charged the session and we will simply allow the last two sessions to go unused rather than giving LA another opportunity to disappoint us.  We have canceled our membership and will work out at a different gym moving forward.\n\nThroughout our time at LA Fitness we have been treated as a bank for which to remove money.  The service has been terrible, we have been continually lied to, being scolded and talked down to by a person whom I paid $100 per hour to work out with was the last straw.  I will not miss LA Fitness.  \n\nMy best recommendation is to avoid LA Fitness.","date":"2018-03-15 19:27:11"}
{"review_id":"WrI9VQuP7VNQdc_Nqr_4_Q","user_id":"DSZjwVTxsmqXTPbmx0fbaA","business_id":"ZbHE1ZncONeH-q93GuVGdA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"Started out comparable to Robertos, but has gotten gradually worse.Super nachos barely have any meat on them!! I'd rather make the drive to find Robertos.","date":"2016-08-03 22:44:23"}
