{"review_id":"lsexUjBytsHlr6johKu87Q","user_id":"1DGt9rWx57JYbARbcPKrUQ","business_id":"VBVqHnViRLSYAqP7v8iNNQ","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Low end chain Mexican food, coupled with bad service and cold \"sizzling\" fajitas earns this place one star.  Salsa is usually the first indication if a Mexican restaurant is going to be any good - the salsa was very bland and it just went downhill from there. We should have known when we went in and the place was mostly empty but we were really craving Mexican.  A real shame because it is in a super location.","date":"2016-03-06 23:46:12"}
{"review_id":"0Lp0TybVEiX4XarMHdfxzg","user_id":"7FdW2SGOF03KXnWgiVUpoA","business_id":"c5TOGBUCCUUNBPM7h_KbmQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Upgraded version of Roberto's. Same menu, taste and price but better service and quality. Roberto's has recently changed their size for shrimp cocktail from 32oz to 22oz (med drink size) which is a lot less than satisfying especially for shrimp cocktail lovers. I'd prefer Frausto's over Roberto's. The service again is a lot more pleasant.","date":"2017-04-30 05:21:27"}
{"review_id":"RypgaUO4jrzYvnRm0sDhEg","user_id":"WOwXnH07iymJmPiLdKfoog","business_id":"zkQPk9lb88VsHj4VPEz5HQ","stars":5.0,"useful":3,"funny":0,"cool":0,"text":"An honest mechanic shop.\n\nMy 99 Jeep Cherokee wouldn't start the mechanic originally diagnosed it as needing a new computer. We were looking at $1,025 parts and labor. After we discussed it with the mechanic we were resolved to our fate. However, the mechanic went the extra mile after we left and looked more into it, on top of the 3 hours he had already spent. He found it was a bad crank sensor replaced and the computer worked.  They could have gone ahead with the expensive repair and replaced the $20 sensor unbeknownst to me but they didn't. They spent at least 4 hours diagnosing my jeep for a $232 repair. This is not my 1st time taking my jeep to this shop and they have had the opportunity time and time again to charge me for an expensive repair when it was something cheap. They are an honest shop.","date":"2013-08-03 16:38:39"}
{"review_id":"_9pd6v-lY-1pq_yIhjsbJg","user_id":"w7eOdRGtzksfy4xtFXCxTg","business_id":"FOqYmI24hSVP4EUibW-9zQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Very clean and comfortable. My good friend lived down the street so we came in to get pampered. Reasonable rates and great job. \n A+","date":"2017-03-27 01:37:26"}
