{"review_id":"4ZDRRGROQhvsWPQivhp8GQ","user_id":"kLxQPVPkPdKDlTx1ODRpwg","business_id":"6kkxRV8H9SQLybj0xnEbMw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We stayed here for Labor Day weekend . The hotel was very nice. The pool was nice and safe for my child  I was a bit disappointed because they didn't offer any coupons or free buffet like other hotels ... But did I mention the buffet was good for breakfast  the room was big and clean . AC WORKED perfect","date":"2016-09-06 01:52:14"}
{"review_id":"OR4aZ7ceJ5sdmgsxbWyAJg","user_id":"g9eud-hds3oUbO99_wweoQ","business_id":"NFm869_w6cvVaWaNpAzjeA","stars":3.0,"useful":2,"funny":1,"cool":2,"text":"Dropped in for a late night dinner and some drinks and the place was packed but we didn't have to wait longer than a beer by the bar before being able to sit and order some grub.  We went with sushi since is was such a warm night and neither of us was could commit to downing anything that warmer than the weather.  Between the two of us we got the vegetable roll, ki roll, spicy tuna roll, and salmon nigiri.  The rolls came out fast and disappeared equally as quickly.  They were delicious!  Fresh and wonderful.  Between the food, frosty beverages, and awesome tunes the DJ was spinning I left feeling full, tipsy, refreshed, and completely satisfied!","date":"2012-05-28 17:39:31"}
{"review_id":"ccnj3JqRdP6SpXRt9iTeyQ","user_id":"FUgdITkYCgeSLf01zxZ6dg","business_id":"sjJOsKnXxsQodXMr1i8fsg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Well, who doesn't like Eaton Centre? I sure do!\n\nWe did Toronto for Thanksgiving 2017 and we had the obligatory visit to Eaton Centre for some shopping --specifically at Roots, and with the convenient exchange rate, this was a must for our visit.\n\nWe had a quick bite for breakfast (food court is not life-changing, I should say) and then went on shopping. Roots was our first stop and they were having this massive sale. Got some things there. Then TNA, some sports store, and a couple of other things here and there.\n\nPlace is clean, modern, well-lit, seasonally decorated, wide open spaces.\n\nWill I come back if I ever make it back to Toronto? Sure.","date":"2017-12-02 20:10:46"}
{"review_id":"iXcYWOTIAshcV9Yt5sSn4A","user_id":"Hg0gMVKYWNApa59L7A8BiQ","business_id":"UT6L3b7Zll_nvRidijiDSA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This probably one of the best pizza I ever eaten. We order a large pepperoni and salami . It was so good. When im in town  again I will be coming here","date":"2018-09-25 05:26:10"}
{"review_id":"0isnP8_R2RazHmJaUZkc-w","user_id":"-KrR1sfoHe6pNiEKuRPwAg","business_id":"2g_auUWw7c3c2CUTgVqI8Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Friendly staff! Friendly owner! Great food! I enjoy the chicken pho with chicken broth!  Annie will always have my business!!!","date":"2017-06-27 23:54:02"}
{"review_id":"AyPXweYft7CP4QIAWlU2jA","user_id":"zlWSz4voG5SjJNQWW3rDnA","business_id":"Ok9vikKusbG_Ue9pJf6s3Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Exactly the place we were looking for. Guacamole is so good and you can add 3 different homemade salsas to get the spicy-ness you want. \n\nThe tacos are delicious. Good portion size. \n\nEnchiladas are also amazing\n\nSimple menu but it is perfect!\n The restaurant itself is small but cozy. \n\nWaiter was very friendly.","date":"2018-02-23 19:46:44"}
{"review_id":"0kyLdjz7KEQDEptMnX2qmg","user_id":"RlpkcJqctkKXl-LO1IAtig","business_id":"iIe6PLxsZDVyrKf4ziKxyw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"After all the reviews and social media posts I have been seeing about this place I decided to stop here during film festival week. This is definitely a neighborhood bar. The bartenders seemed to know everyone who stopped in and what they were drinking. The bartenders\/staff were very friendly and welcomed me as soon as I walked in. \n\nI love how cheap the drinks are here! I paid $2.50 each for my vodka sodas and $7 for my huge chicken salad sandwich. I think this is a spot that everyone needs to check out at least once and I've heard the corned beef is stellar!","date":"2018-04-27 19:53:45"}
{"review_id":"Mxv9QfIr-q7LKorUUful8w","user_id":"x9p0RQsdWD-NZuhH4J1zHw","business_id":"Oi2k3en1Ip-D0n_jfGbvIQ","stars":5.0,"useful":2,"funny":1,"cool":3,"text":"I recently went to this restaurant with a group of friends as I had heard so many positive reviews and must say Artigiani definately lived up to expectations. This resto serves up one  of the best wood oven pizza's in montreal.Their  pizza is thin crust  and  they a have wide variety of pizza's that will please your pallette.  Ambiance is cozy and modern decor. They also serve up a great seafood pasta dish for all you seafood lovers and must not forget to mention their fried calamari entree. Lastly, be sure to leave room for their wonderful tiramisu dessert served in a gelato glass. Would definately recommend!","date":"2017-02-19 13:48:46"}
{"review_id":"hkEIBPFzXJ3WrHdsry9P-w","user_id":"siDEyqT7bvcvYCZmYdnbbg","business_id":"D-RQsQjEVI_w-KC7iDJd5Q","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Very fast to go service. The pad thai is made from bigger noodles than i'm used to but had a very good flavor","date":"2016-01-30 02:40:15"}
{"review_id":"uLfcwTG6H-rMdhDsYicZ_Q","user_id":"Z1XBElsPmwRf10-HzEYLtg","business_id":"S9wM3czqBikZ3ZxHDHO6Ow","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Excellent care. We really like Dr. Peterson and his staff. Good selection of frames. They stand behind all their work and correct anything you ask for. Very friendly and follow up is good.","date":"2016-08-25 13:26:16"}
{"review_id":"HbaS2tpJaZmYhKIoSS6TKQ","user_id":"c5BgNtehrBsJ45AAAJ67Gw","business_id":"Eu-M3y8a5bIxIRXlCj9yHA","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"Probably the best place serving Afghan cuisine and one of my regulars.  The place is usually crowded even on the weekdays.\n\nI ordered Sultani Kebab dinner .Kebabs are succulent, juicy and well cooked and rice garnished with pomegranate seasoning . Naan is baked and fresh.\n\nCost for 2 : Under $25\nOptions to try : Tandoori kebab, Chapli kebab, lamb shank and waziri","date":"2017-10-02 02:13:09"}
{"review_id":"r_SXQix_nyd0L1-I6DsnJw","user_id":"4zfZHqtEX_eGUE_Nnv1Z4A","business_id":"V2Uvh2cUl3vufW9ChM_jkw","stars":4.0,"useful":1,"funny":1,"cool":1,"text":"Stopped in for a late afternoon lunch and was pleasantly surprised. We had wraps and waffle fries (add cheese) and everything tasted fresh and delicious. Beer selection is good and ice cold.","date":"2018-08-04 20:31:21"}
{"review_id":"80d4gEzc1PioQgbr59b9jw","user_id":"osAXja9LtD3IHs5jMwOq0Q","business_id":"ApG6TS7aDiYSZaGjcuzEHA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Wow! What a wonderful car buying experience, thanks to Adora, our stellar saleswoman. Adora doesn't judge you by what you wear or what you drive up in. She is kind, helpful and doesn't rush you as she gets you the best deal. After the purchase, she was an exceptionally patient teacher as she set up our seats, radio settings as well as syncing our phones to our new car. Her patience and her willingness to help us use and enjoy the luxury features of our new car as well as her genuine excitement in helping us buy our dream car made this a great experience. Call her!","date":"2018-02-01 20:50:56"}
{"review_id":"KE_OTFbLD_pRG3tvcLdn_Q","user_id":"dAB-v4B-5_8QgTcoVSnZOw","business_id":"5LPK0LeKiS4HKzYwKXvFLg","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"I came here based on the great reviews on Yelp. I have never had Georgian food before. I was mostly interested in trying the hachapuri (georgian pizza shaped like a boat with an egg on top). It is the coolest thing I have ever seen on yelp. \n\nSo we got here on an afternoon to have some lunch. The restaurant just opened but there was already a party inside! The servers are really nice and really cute :o. Lol. Anyway, we wanted to get a hachapuri and some khinkali (georgian dumplings). There were no pictures on the menu, but even the photos on yelp were hard to distinguish the sizing and portion of food. Let me say upon arrival of our food I was shocked by how generous the portions were! The Khinkali dumplings each of them were like the size of a small person's fist. And the hachapuri was the size of a small pizza. Very filling indeed, even when sharing with a friend. We both loved the food. The khinkali pork and beef had some interesting spices...tasted very beefy and rich. I needed to cleanse the palate with some of their tangy dipping sauces from time to time. Their sauces are really tasty btw. They come as a complimentary appetizer with some hot buns on the side.\n\nThe food was so memorable! I would love to come back to try some other Georgian dishes. I think though, the place could use some natural lighting, it is very dim inside.","date":"2016-01-17 05:31:34"}
{"review_id":"5hLxfV62QCebCTrq9kShuw","user_id":"FQsbJx12jvFYxzKy6RdPSw","business_id":"GqqxsrXIGVJLWxbfYCzaVQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Probably one of the better experiences I've had in regards to purchasing a car.  Macon Wild, the rep. who assisted us at Enterprise, helped us get into a car better than we had ever expected to get.  In a nutshell, she made it as painless as possible, and we walked out extremely happy.\n\n   After my wife's car accident, I was dreading going through the process.  I don't like to feel pressured and obligated to buy from a sales person, especially in regards to something as big as a new car, and would rather bow out than give in.  However, Macon was awesome for us; she had an awesome personality, knew exactly what we wanted and didn't try to deviate from that into something else, and seemed to really help us and understand what we said we could afford when it came down to financing.\n\n   If I were to be completely honest, some of the others that had tried to help seemed to put the pressure on us when we were getting down to the nitty-gritty business of financing, and I almost backed out.  If it hadn't been for Macon and her partner in crime, Alex Woodford, it may not have happened.  Those two were so awesome, patient and understanding about how I needed time to review the information and consider everything before making the final decision.  Between my hesitation and thorough research, I ended up delaying the process for about over a week or more, but because of their patience and just awesomeness all around, we walked out with a better car than I had even expected in the end.\n\n   Again, Macon Wild is the person to see at Enterprise Car Sales in Las Vegas.  We'd go again in a heartbeat, and maybe will go for our second car sooner rather than later with their help!","date":"2015-07-03 21:37:49"}
{"review_id":"L8Lk9HJ0a0-8BGxU1wzwUg","user_id":"SOlw_N92rCZUAMFRIx2hUA","business_id":"VMr8sgoQOW0fo0qVJENajA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"During lunch hour and plenty of empty tables to enjoy a great meal. Had the pandan custard with black sticky rice and the jalapeño fried rice. I've never been disappointed here with the food at malees on main in scottsdale","date":"2017-12-02 20:45:01"}
{"review_id":"aivUPQX-GZXQqPQ9VHt5PA","user_id":"ckzzBbHPecpudAaAbX-_nA","business_id":"YTCCJ3ShO-zg0dlx1nk6dw","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I had higher expectations going there. \nMaybe it was just the hype around it, or the spoiled new yorker in me, but this is a price quality review. I had the 30$ toro, 15$ clam miso and 45$ sushi. \nToro was amazing. Great presentation, great taste, probably a bit overpriced but still good. \nThe calm miso soup was big, like a real soup bowl. The clams where nice but the broth way too salty. Worth $15? More like 7. \nThe sushi. The fish was fresh and good quality but It lacked creativity in fish assortment, it was very boring. The tuna roll that came with it was kinda meh and boring too. The portion was also huge, mind you I got the smallest portion and I could only eat half. I would prefer less of it but better. \n\nSo was it like bad? No, it was good. Was it worth 120$? I spent half the money in new york for better sushi, so I can't say it was.","date":"2017-01-02 04:55:53"}
{"review_id":"U9n4IF2HXDYeDhAFFPbhYw","user_id":"MVweU6TF16a1q6D4Zw-PCw","business_id":"CqsJjzullOVp29m0l__k5Q","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"I've been here a handful of times. I enjoy the decor and the one server that is always present. The flavors are all there and the portions are on par with other Thai restaurants nearby. My last takeout was very disappointing. I got the wonton soup and the soup was  ridiculously hot, temperature wise. The wontons were soggy and mushy. Their spicy scale is way different than what I'm used to. I got a level 2 green bean and I can barely eat it because of the spiciness. Please work on your consistentcy.","date":"2016-03-06 23:49:59"}
{"review_id":"TP_d8sR6_8PxfnJhC4bn_A","user_id":"ryUF1C7Zx7GPZL8ZNihIvg","business_id":"XYZBc8WCuHGgFHkOZ9QW9Q","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Went to this location. Signed up the day before. My name was not on their \"check-in\" list, but I had my email confirmation. I have donated to United Blood for many years. I was excited about donating because after traveling overseas, I was not allowed to do so for a year. Today was my on year anniversary, meaning that I could finally donate blood. I monitored that date for a year, looking forward to the next time I could donate. So, I get there, my name i snot on the list and they say they cannot take me in because I am not on the list! So, all my preparation: eating well, being conscious about not doing certain things, spending time on the prep questions, waking up early, driving all the way to the donor center; nothing mattered. She didn't even seem honestly apologetic. She (Della) just said \"sorry\", without truly caring. She even offered e a voucher for a burger. Ha! I was there ready to give whatever blood kind they needed the most. All the beds where empty! All of them! I sure hope this doesn't happen at other United Blood donation centers. What a shame that would be. United Blood, specifically this center, need to remember how much effort their donors put into each donation and they need to focus, get their act together, and remember what their purpose and commitment is. For me, I am very disappointing. I will continue to help, but seeing this; it will not be with them. Tip for donors: call before you start your drive to the center (even better, before you start your prep questions).","date":"2015-08-30 15:15:06"}
{"review_id":"Yup8VzbEnerbVe7hNiiANQ","user_id":"FSDJLwJCHdDfZ7fV0tZFkw","business_id":"u9zsTjkceESEEbncLBChaQ","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Today was my anniversary. I called this morning for a delivery of flowers, explaining that my girlfriend leaves work at 3 and I wanted her to experience the moment at work for a while before she had to leave. The delivery came exactly at 3, despite the fact that they are literally across the street. \n\nThe cost was just short of $100 and the offered me $10 off for failing to deliver it on time. \n\nI will never use their services again, not for these prices.","date":"2013-12-06 23:05:27"}
{"review_id":"DD717269gjwn2xTW7x6qWQ","user_id":"4McYx8BBWDq_lS7CFWtv8Q","business_id":"065c76tt1dXBNmoGBymUgQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"So I was checking out the container park and seen this on the way out. I said to myself... self you need to try this out tomorrow since I was too full from drinks earlier. \nThe next day returned at lunch and it was busy but fairly fast checked in and received a free soda. Stared at the menu for awhile because I was having a tough time on deciding which dog to get, they all looked so good! \nFinally went with The Godfather and it was very delicious. I would of never thought of some of the toppings going together like the mango with red bell pepper haha but with all the other goodness on there it did very well! Would gladly eat again. \nThe only thing I'd change if I could would be to have a larger dog or even a sausage option \nAlso had some friends loaded fries and chili cheese fries. I'd go with the loaded fries and add a little more sauce or hey mix the chili cheese fries with the loaded mmmmm","date":"2018-02-23 22:00:21"}
{"review_id":"EQT_KyOs59ToiiZSFfYHFw","user_id":"qJNAHjyscMEXpayRJbqpXQ","business_id":"2x04eAw13WDh2lx-UvcVXw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My brand new laptop would not print consistently to my 7-year old laser printer. After much frustration and way too much unproductive time, I knew I needed help from a Pro. I went to Best Buy's help desk and was told that I just needed to buy a new printer because mine was too old. Disappointed, I came home to do my research. I decided to call the company that I purchase my laser toner supplies from instead. I told Lance my problem and asked if he had any refurbished printers. He said they did have some printers, but thought perhaps their  technician could come out and change a few settings to correct the problem. Lance sent Steve out and within two hours he had set up my laptop so it would work with my printer, set up my second monitor, made sure the network was working properly, advised me on moving files from my old computer to the new one, and shared what I might consider purchasing to truly optimize my new laptop. Five-stars to Laser Specialists of AZ! I am a repeat and VERY happy customer!","date":"2016-10-13 20:49:07"}
{"review_id":"MUnlJCvMIphZffb3QL2fPg","user_id":"Ih5YmEY2P3_pGOCp2t87RA","business_id":"cTuLcxYD-qn36g9IQBmBBA","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Stopped in today to see if they could fit me in for a walk-in pedicure. The young man at the desk said yes, and within a couple minutes had me go sit in the pedicure chair with my feet in the warm bath. I sat there and no one came over to start my pedi. As I looked around, all the techs were busy. I sat there for 25-30 minutes, now the water was cold and my feet pruney. None of the techs even appeared close to being done with their current clients, and no one had ever told me they'd be with me soon. I decided to leave and as I gathered my things, a tech asked me if I was leaving. She told me she was going to do a manicure, then me next. I told her I couldn't wait that long, that my water was cold, I'd been sitting there a half hour. I told her it's ok to say they don't have time, or just have me wait up front, but they shouldn't have sat me in a pedi station with my feet in water waiting for that long. I won't be back.","date":"2018-08-04 20:55:43"}
{"review_id":"Km1SW92UXYKftn61Ajc58w","user_id":"sJQBwmg50yEZO2vPuRCTQQ","business_id":"wXilG_OovZwJZzTQMawCrw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Amazing service. every time I go in I know what I want and they try their best to accommodate my needs and wishes. Always friendly. good people. although at times they don't quite seem to grasp the fact of that I know about mods and such. however all in all a great company great people who work there. And a great sense of humor. Also on a side note when I had to get my current mod fixed they helped me rebuild it to new specs with no charge as I brought my own materials (they had the tools I brought the wire and cotton.) It's a minimalist shop with little decoration. however it is clean and well lit and well stocked. Also they're more interested in making sure YOU have what YOU need than seeing you the most expensive items they have. My one minor complaint is that they sell yogurt flavored juice. *shudder* but other than that a great place to go if you're new to vaping and want to try it and or quit smoking.","date":"2016-11-09 20:05:52"}
{"review_id":"i7jArtr2NZ9bYm26EhiSBA","user_id":"k4M43lXJuQMpQW65DTqzIQ","business_id":"3z6IFHo3pPU5jaKtVyAqUQ","stars":5.0,"useful":1,"funny":2,"cool":2,"text":"Sometimes I think orthodontists take pleasure in dishing out pain.  I don't know if they imagine themselves as Dexter and lay out their tools right in front of you while looking at your eyes to see which you're most terrified at.  This is why I haven't trusted a Dental office in so many years, but with Cheyenne Dental Group I found one I can really trust.\n\nSetting up an appointment is easy but finding an open spot to be seen is hard, so get your appointments in.  For example and most recently I called Wednesday night close to closing to be seen for a quick checkup and the next available was on Tuesday at 3pm(!) ugh, with Monday being a holiday.  But with great service comes great demand.\n\nI then met Dr. Tounian whom assessed and had recommendations on work that needed to be done.  No pressure at all on what I needed and wanted.  My insurance isn't the best but they worked with me on getting the necessary work done as well.  \n\nNow lets talk about the treatment.  The assistants and staff were nice but my duel was against Dr. Lisa Hoang (spelling?) and faith was put into her hands.  She did an excellent job and explained what she was going to do and what I might be feeling so I wasn't caught off guard.  \n\nI would recommend this dental office and am glad I found comfort (scary thought being in a dentist office) in this visit and my future visits here.","date":"2013-05-28 20:46:43"}
{"review_id":"xfCZUvkV_L__yPTAVu7ruA","user_id":"XAvInOHFA83p3My_ZCUyEw","business_id":"dEADS75AdeljwVfyWavDdw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I have stayed at many Hampton Inn over the years being I am on the road a lot. I have to say this is one of the best I have stayed in. This Hampton inn is amazing and the staff is great. Highly recommended if you are coming to Goodyear Az.","date":"2015-06-21 02:20:07"}
