{"review_id":"kM60XEAWjAQk6jd5RNXMag","user_id":"gVtAUMKwJuZaRKz7--bLqA","business_id":"AueEbb9kao4lt6CYt06hqw","stars":2.0,"useful":6,"funny":2,"cool":1,"text":"So disappointing. Just beyond.\nNot worth the time of a detailed review but here are the highlights...\nHad a reservation. Host\/Manager seated a walk in table at the better of two crappy tables that were open and then tried to seat us. I asked if that was all he had he said yes. I then asked if they had something outside...they did. Hmmmmmm\nAfter about 7 mins manic (and I mean MANIC) waiter comes over to say he'll be right with us.\nAnother 5 minutes later takes our drink order. During which he argues with me on if I want that drink. It's a classic, I order it often...ok I'll wait while you ask the bartender. Ok order drink.\n35 minutes and 2 small plates later we have drinks.\nWaiter argues with us on food we order.\nFood was good, but definitely not worth the hype. Not even close. \n2.5 hour dinner. We had 1 cocktail.\nSo so disappointed. Will definitely never go back.\n\nAnd I always give a place a second chance. But I won't give this place another dollar.","date":"2017-03-15 04:21:52"}
{"review_id":"oUWW-YA83I0-ytIkMWEQCw","user_id":"UQaDNO3j9E15QN5aYaX8AA","business_id":"ItqPtxnayraXSlBS0EMOgg","stars":5.0,"useful":0,"funny":0,"cool":1,"text":"The food is great! We ordered a wide varitey of food.  The staff is very friendly and there is a great ambiance.  Plus, you can't beat $15 bottomless mimosas!","date":"2014-04-19 19:33:06"}
{"review_id":"bZUaH-qb9jJB2S0bN2Tl5g","user_id":"TnhTyk1qfJ8jL2bHpeTrhQ","business_id":"xrtANyNQxFqf50vB2UC79g","stars":1.0,"useful":1,"funny":1,"cool":1,"text":"Located here:  http:\/\/www.yelp.com\/biz\/team-ford-lincoln-las-vegas#query:enterprise%20rental%20cars\n\n---------------\n\nTo see the beginning of this story, go here:   http:\/\/www.yelp.com\/biz\/enterprise-1-800-rent-a-car-las-vegas-14#query:enterprise%20rental%20cars\n\n\n\nAfter getting transferred from corporate after our 2 1\/2 hour morning nightmare, we told our story to this location and they had our reservation on file.\n\n\"When do you close?\"\n\"12:00\"\n\"That's in 15 minutes...\"\n\"If you come and the doors are locked, but it's right at 12:00, we'll let you in.\"\n\nWait...your company screwed up, so I have to rush over there and drive like a jerk so I can make it there before you need to close up shop? Seriously?\n\nThey didn't even offer to pick us up. We were just expected to go to them after they messed up.\n\n\"I'm on my way.  We'll do our best to get there at or just after 12:00\"\n\nDidn't look like we were going to make it, so I called to beg them to wait for us\n\nNo answer.  Seriously!?\n\nSo we just drove home.  Forget it.  We'll take our business elsewhere.\n\nSimple suggestions to avoid this in the future:  GIVE YOUR CUSTOMERS THE RIGHT LOCATION AND PHONE NUMBER TO START WITH\n\nhow hard is that?","date":"2013-08-03 19:31:59"}
{"review_id":"i4WAhHRO93Ui1qdkMMNOiA","user_id":"TTa7AmDgbLHGdg-KPohlKA","business_id":"2SedpQ674XBqyw3Wq4kyxQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"We just wanted some McDonalds and when we pulled through they were like \"It's gonna be a minute\" and I just wanted my fries","date":"2018-08-04 21:48:02"}
{"review_id":"po_a0VexI-X1G-zDdHCaMA","user_id":"U4qXdgIB7O0JLosJwwm2Ug","business_id":"ajWAVO3L3bFTpk3SVo9JcQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I was debating between doing this one and Battlefield Vegas. I am definitely glad that I decided to go with the Best Bang for Your Buck Groupon experience for two at Gun Garage. Not only do you get to shoot more guns at this venue it seems, but it also seems more suited to novices as well. They provide you with transportation to and from the strip. The driver was nice and very conversational. \n\nOnce we got to the gun garage all we had to do was fill out a form, show our IDs, and listen to our gun range officer and we were ready to go. Our range safety officer's name was James and he was extremely friendly and polite. He knew both of us had never shot a gun before and so he made sure he went over all of the proper steps with us more than once. Not once throughout our entire time there did we feel intimidated. He even gave us support while we were firing because we had never felt recoil before. \n\nIn all we got to shoot A LOT of guns (9 I believe), much more than with the similarly priced deals at Battlefield Vegas. Although the whole experience only lasts about 15-20 minutes per person it felt like a really long time probably because it was our first time shooting and because of all of the adrenaline pumping. I definitely want to go back and shoot my favorite guns with more clips since I now know which ones I like. All in all though this is definitely the perfect venue for people who have never held a gun in their hands before.","date":"2017-06-17 19:08:43"}
{"review_id":"1wlyeocBHTUATx8Ag0zatQ","user_id":"LzYwHinpbHk3YQrIkVI4KQ","business_id":"P4y1YvDp_Y1gCEnedEVxLg","stars":5.0,"useful":1,"funny":1,"cool":0,"text":"I can't say enough about Bill and his staff.  He was constantly checking in on me and making sure I understood the process and his strategy.  From day 1, I felt like Bill cared about me personally and how the results would impact me.  I only witnessed professionalism from Bill and his staff.  Every call was promptly returned and every one I worked with seemed to have my best interest at heart.  I was referred to Bill by a friend and I would absolutely refer him to my friends.  He is a well respected attorney in Charlotte and NC and I just experienced why...... thank you Bill and team for the WIN!!!!!","date":"2016-08-12 22:32:25"}
{"review_id":"Xqle1MfDZzTPZyTj1Of5LQ","user_id":"LkcrdEk9-SOBbLXt0-Mvwg","business_id":"UCpUOtvqR-NBWBNVMzJleA","stars":2.0,"useful":2,"funny":0,"cool":0,"text":"One word for you: Yikes!!! \n\nThis is a MILF bar in a mall to begin with. Double strike for me. So if that's your thing, you'll be in heaven. Overpriced mess of a place overall.\n\nI've been here three times to really make up my mind and each time I ask for \"well\" drinks the bartenders end up pouring me Grey Goose or Van Gogh and then when the check comes they pretend that that's what they heard me say. Last time all I had was two double vodka soda \"well\" drinks and got a bill for 45 bucks cos the bartender poured Chopin. It's a really dumb scam and I've fought it each time. Just be on the lookout for it.","date":"2011-02-14 05:41:02"}
{"review_id":"T-T8CbVLAc-XmPwJW6MgYA","user_id":"kwS_MjOUs1Jd_4X7B5t2yQ","business_id":"0p27EjcNwTI7Ey4K_MNPww","stars":3.0,"useful":1,"funny":0,"cool":1,"text":"Located inside Red ROck Casino, there is ample parking, the hardest part is getting around the casino to find the food court. \nThe ambiance is almost like a trashier version of johnny rockets with the red bar stools, simple American Food with burgers, shakes, fries, chili cheese dribbled onto everything. Although it seems they are making an attempt to be a little healthier with their new crispy chicken wrap (tortilla wrapped fried chicken with all the burger fixings on the inside). I mean the menu is by no means healthy. It is called FATburger- due to the quantity of food and the calories associated with that food. But as I watched them make our burger, I noticed they were not premade patties and they were using what seemed like \"not previously frozen- but who knows\" ground beef. Also it didn't seem like they were using binders (egg or breadcrumbs) \nAs we ate our burger noticed the burger was kinda dry, probably due to the amount of add ons and very little mayo. Def had to ask for extra Mayo.\nLarge 1\/2 pound 7.75$ \nBacon: 1.25, cheese: American, cheddar, Swiss 1.00, chili 1.00, egg 1.00, guacamole 1.25, mushrooms 1.25\nSides: onion rings, fat fries, skinny fries, chili cheese fries \nMilkshakes: vanilla, chocolate, strawberry, cookies and cream\/Oreo, Maui-banana (4.50)\nDesserts include ice cream Sundays (2.10) and root beer floats (2.40)\n\nPretty pricey esp with a meal \nA) fat burger medium 1\/3lb (12.25)\nB) large 1\/2lb 13.50\nC) XXL 1lb 15.80\nD) XXXL 1.5lbs 19.00\n\nIdk, the price for the burger is quite steep. But it is in a casino. I just think there are better options for a better burger.","date":"2017-01-02 05:28:38"}
{"review_id":"baJjGsmLiGt5Ji1Fkl9d0g","user_id":"W1RXN13QRcnnMQImd2rhKw","business_id":"RHHb5MVidyqBUNX_GUTV_A","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"This has to be the worst show I have ever seen. It has no business being on stage at all but if they do have a venue then it should be an afternoon show billed for children. The children in the audience were the only ones gullible enough to fall for this crap. From start to finish every trick was flawed. It was almost a \"behind the curtain\" show because you could see how every trick was done. The \"grand illusions\" were they same tricks you've seen a million times but this time they are so much worse. We should have walked out but it I wanted to stay to give them a fair review. \nThis is only a go if you bring your elementary school age children. This is like the entertainment they used to bring into my school as a kid on assembly days.","date":"2013-08-15 16:16:39"}
{"review_id":"fB459nitx3iQ5nVZwyRzfQ","user_id":"q_j2ZKMwF4-6yHohyNwmug","business_id":"9LE2yGl23qxitNc9mkpbjA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Solid pizza. Maybe slightly on the rich side but sometimes that's what you're looking for! Went for this when Pizzaiolo was closed last night and was very happy with the decision.","date":"2013-07-12 22:27:58"}
{"review_id":"qfbs02pCr7dXv9YZ53XBAA","user_id":"RfDgRzaDcwEZaRZRrLMlnQ","business_id":"4IGaWH9jUYMtP2uHIFEqFQ","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"This airport is freakishly scary! The food selection is minimal and lacks \"traffic\" to provide enough interesting people watching moments. The only redeeming quality about this airport would have to be a cheesy photo op with a mic stand located in Concourse C. \n\nI would not even wish for my worst enemy to have a layover at CLE; or worse...get stranded...in Cleveland!","date":"2008-12-04 05:00:04"}
{"review_id":"ZB8-UksRxp-YBQ8tIFajSg","user_id":"M8hsjur81r3_LhHo7w4sCQ","business_id":"W7hCuNdn2gzehta6eSHzgQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Didn't care for our square fish or the sauce. Both of us ended up feeling and getting sick that night.  I won't be returning.  I don't understand the appeal at all.","date":"2014-12-17 21:27:09"}
{"review_id":"xtIcRjP3iEhiyWZbcQ-AtA","user_id":"R_TJQ6Hy1BtOYK_hCl25bQ","business_id":"_PKXarw3GjlbwbXhjdpUMA","stars":5.0,"useful":1,"funny":1,"cool":0,"text":"So spicy and flavorful! Shrimp Pakoras really good and not too oily. Chicken tangra really tasty too (if you like chicken tikka masala you'll love this!). Appreciated the fact that the manchurian seafood rice actually tasted like seafood (instead of a oil-flavorless-spicy taste) and did not have too much food coloring.","date":"2013-12-28 20:35:09"}
{"review_id":"QbOHMKy9vmw2y7ek2p5MTQ","user_id":"273vUxZ4LRT53kiifAuwbA","business_id":"ZCzey5aPhd7jYIoHsUfjmQ","stars":3.0,"useful":2,"funny":0,"cool":0,"text":"Clever and Deceptive Koi-ness\n\nIt's the middle of summer. Pump up your AC! Especially since your kitchen shares the bar & dining room and the majority of your dishes are HOT, never mind your clientele. ;-)\n\n2 of the 3 stars go to:\n\n1) Jarod: the epitome of a composed and well-conducted host. If you look up \"host\" in the dictionary, Jarod's picture should be displayed. He was bombarded every minute from our arrival to when we were eventually seated. He was calm, collected and extremely pleasant. The best part, when he came to fetch us at Central Wine he said, \"Your table is ready. Don't rush. You waited for us. We will wait for you.\" *Phenomenal* \n\n2) Courteous Wait Staff: at no point did we receive any attitude to our hungry and impatient (did I mention over-heated?) dispositions. Instead, we were comped and sweetened with desert and smiles.\n\nThe 2 hour wait to be served a semblance of food & beverage from check-in to seating is absurd. We arrived at 7:20 and were told a couple tables had bills and should be cleared \"shortly\". A stuffy 30 min later we informed our patient host that we would be at Central Wine (a fantastically COOL waiting area). Once we were seated (around 8:20) we were greeted, a beverage and app order taken - both were served together about 12 min later. Thank goodness we had water refilled. Seriously, it had to be 81 degrees in the dining room. We ordered our entrees right away.\n\nI have to say the \"special\" was quite tasty: salmon sashimi, seaweed, carrots, mandarin oranges and I believe some small grapefruit over brown rice. There was no way I was going to handle a steaming plate\/bowl of anything in that heat. My husband was disappointed at the amount of duck in his Massaman Curry. The noodles far outweighed the 5, possibly 6, thinly sliced pieces of duck. And he was generous to share a piece with me, but once I saw how little he had I felt bad and offered it back. I tasted a bit and it tantalized the tastebuds but left much to desire ... more duck!\n\nPerhaps Friday night is not the time to dine at Clever Koi. I would like to give it another chance, as this kind of pleasant service is hard to find anymore. I think I'll wait until October or November to tantalize my longing for their Spicy Seafood Hot Pot. Right now, I cringe at the thought of nose-planting from the heat into the spicy lava of tentacles.","date":"2014-07-28 01:27:02"}
{"review_id":"1wq5l-o3TMaO2nvdNJ7qxQ","user_id":"OrTuYS6LBKX9_Ge1vJuw7w","business_id":"UPSzbM6D2SkarWAINq1I9A","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"This is some of the best food in Parma. Don't be put off by the run-down decor. This husband and wife duo serve up delicious Vietnamese food and fast. Spring rolls & #85 with tofu are my faves. I do wish they would take the crumbling artwork off the walls and invest in a couple gallons of paint though.","date":"2014-08-10 19:36:59"}
{"review_id":"bn4AzYmsoErrtYWmSK9a5w","user_id":"uJx5Xr_vK5MCGT_k8_yH_w","business_id":"Ec9CBmL3285XkeHaNp-bSQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"My boyfriend and I absolutely love this place! The location is right in the heart of Chinatown but it doesn't make you feel like it...like you're cramped in a small restaurant, touching elbows with the next couple. It's very spacious - you have options of sitting at the bar, nicely spaced out tables, or booths accommodating large groups. \n\nWe're addicted to pho hence our regular check-ins here! This is one of our favorite spots in town. Pho Tai Nam is my go-to dish to order. The secret is in the broth and it is delicious. My boyfriend, on the other hand, loves to mix it up. He likes the Pork Belly Buns, Hot Pepper Wings, and always has room to devour those Crispy Egg Rolls. I think the Vietnamese Coffee is to die for.\n\nI love Happy Hour! Monday thru Friday 3pm-7pm and Sunday 12am-3am. There are specials on drinks and appetizers.","date":"2014-09-25 08:36:39"}
{"review_id":"668ub6Kmuqcur3Bnr9ZIrA","user_id":"63A_tkR2JLH_MPPD2XooEg","business_id":"yp0VCrWxwlQun5syv-7yzQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Carlos was great.  He demonstrated his work after completion to make sure I was satisfied with his services.  I don't see that too much in the service industry.  Most companies grab their money and run.","date":"2018-04-15 13:16:42"}
{"review_id":"5tyk0C843Z4pt7vBpJagqg","user_id":"4O4GqbqnH1stCNfBYlV91Q","business_id":"TQ-FgDYJbJhIXTvSdv-jUw","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"LOVE their chicken club sandwich.  Great barbeque sauce.  We needed a place to hold an impromptu family gathering and they were very accomdating to our large crowd at the last minute.  They have \"The Patriot Room\" that is so cool.  Stop by and take a look and have some onion rings. They're the best!\nI heard they have stand up comedy on Wednesday nights too.  Haven't experienced that. We shall see...... :)","date":"2011-01-08 22:06:37"}
{"review_id":"BpuelvmuEdSak7kc6RuHCQ","user_id":"eSqMc6Nh8pQSQtI1OT_mBQ","business_id":"_gO1inMQhfXlK_S46SgGJA","stars":3.0,"useful":3,"funny":1,"cool":1,"text":"interesting! \n\nSuch an interesting experience. Went on ladies night the guy-girl ration was about 3-1. Men were definitely on the prowl--- which makes it awkward when you are very obliviously not looking. \n\nDidn't try the food, but did try quite a few variety of drinks and they were all fantastic! I'd recommend going before 9 to find a comfortable spot it gets pretty busy afterwards. I like how like most bars this is also a restaurant so there are a lot of seats available not just a small space and dance floor.  The staff upfront, seemed more invested in their own conversations between each other then helping the guests. However, the bartenders and waitress we had were both excellent, checking up on us often and refilling our waters. Overall it was a fun experience, just wish the initial staff you meet at the door were more friendly, after all they are the first impression of the bar-- and it wasn't a good one. So for that had to give 3\/5 stars.","date":"2014-09-25 14:49:54"}
{"review_id":"jXBXHuAjqL8NGqfrWFumbg","user_id":"Jy1YIQbU-OmBVr488nKLxQ","business_id":"0FUtlsQrJI7LhqDPxLumEw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Great food! Everything taste fresh and delicious.  It is a bit pricey but our family loves it. The outdoor area is great and kids love it because they can run around and play! Sweet potatoe fries are amazing!","date":"2015-12-05 05:43:41"}
{"review_id":"PAkOX8JE6QZ_imz9NyTQ1Q","user_id":"cqOIg8EAMEzjO4Mz-knvdQ","business_id":"IuW6aZ8XYtxkdvHJoVHlfw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Ended up going here after a really bad experience with another spa. We were seated immediately, asked if we wanted a drink, and received service right away despite being very busy. The chairs were almost all full. The lady doing our pedicures got right to work right away. Would definitely recommend this place to my friends.","date":"2014-06-27 23:36:18"}
{"review_id":"_WG-774qPaGkTfjms7A8XA","user_id":"Q0DVYlBYH6EDMsJNZWQLqw","business_id":"KWojrEKjUqHCRI5HO7pB4g","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"We came here for the First Thursday @ AGO ($15 a ticket online). We went on time and was glad to see there was no ridiculous line out the door like at Friday Night @ ROM. The crowd seemed more diverse, but also on the trendier side. There was a cash bar and no need for buying vouchers in advance (i.e. nothing ROM bucks). \n\nThe building itself is definitely beautiful, despite the corridors often being crowded. This is especially true near the entrance where the bar is set up and people tend to linger. This is probably because there are no food or drinks allowed for most of the areas, blocked off by a rope and security guards (for good reason, I suppose). There were also food dishes (~$5 a pop) and live music. \n\nI won't pretend to know about art, but the first two floors are great. They have wonderful Group of Seven & Emily Carr exhibits on the second floor. Also live paintings and performances throughout the first two floors. Great place to go for a date!","date":"2015-07-03 21:21:35"}
{"review_id":"QqXsF9S75mAeai5oSjVSZg","user_id":"s6zdXBBNArnZjPmlAlClBg","business_id":"NtfAbj7MSj5IOhAsGM0-5w","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"The service was terrible. The line was 10 deep and employees were moping around like they hated life.","date":"2017-06-17 16:49:47"}
{"review_id":"HwDOaAf23CQQ-88ceKJpWw","user_id":"sW-CNHEKz3Qy1L8c1EkaOA","business_id":"ceuvH6NpDhpT1p4q1w93pA","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Good food quality, quick pick-up turnarounds and very reasonable pricing makes Orient House ideal for when you've got a hankering and don't have a lot of time for lunch.","date":"2017-07-28 17:50:43"}
{"review_id":"_avpgFqTT1dAl90Ab15brg","user_id":"-WCWlsVGhxaLQMfpKuuKhw","business_id":"J4msAaHD4ziCa_3_KzJoVw","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"I do not know much about their services. Strange, I know, but let me explain.\n\nI made an appointment on a Monday for this location (which is a good 30 minutes away) for the following Friday. Even though I was not sure it was going to be open (Friday was the day before a holiday), they told me they were and confirmed my appointment. \n\nThat Friday I drove to the location and waited for the doors to unlock so I could take care of my bothersome cavity. \n\nI waited. And waited. And waited. Yes, you get the point.\n\nBig surprise, they weren't open. Nobody had given me the courtesy to call, apologize for the scheduling mistake and reschedule. So instead of booking another dentist to take care of my increasingly painful cavity, I had to wait almost another week to get into a stellar dentist who confirms their appointments ahead of time and are very friendly.\n\nP.S. 4 days after the missed\/accidental appointment I received a call\/voicemail stating that they got my message and if I was interested in still obtaining their service I could call X phone #. No apology. I didn't expect champagne, catered breakfast and a red carpet as I walked into the office, but a simple apology for THEIR mistake would have saved my business and resulted in more referrals. \n\nSorry Absolute Dental. Fail.","date":"2011-05-27 05:22:25"}
{"review_id":"tyMdS-1UP_ygOAZsilejVg","user_id":"3uq5QyL28UF-UGD9LKfAmw","business_id":"eaNenRk_liZBERFFLCXqqQ","stars":1.0,"useful":0,"funny":1,"cool":0,"text":"Was told 30 40 minutes for a table. Hour and 30 minutes went by and still couldn't get seated. Very frustrating! The young  girls don't know how to do there own job. Don't fall for the 30 to 40 min wait time that they tell everyone!","date":"2016-07-25 04:50:30"}
{"review_id":"CK1IAp07lP7n1LGChxBgoA","user_id":"UJ4uCYEppIIo9IRGMx5E1A","business_id":"A9qmduhmrTZxSg7uTOnzYg","stars":4.0,"useful":1,"funny":0,"cool":1,"text":"I love the texture of the fro-yo here at Menchie's more then any other fro-yo place. Most of all I like that when you eat it the flavors don't taste like powder. It is so smooth and velvety!! They have tons and tons of different topping more then any other place I have ever been to. I knocked off a star because when I walked in the guy behind the counter just left and went to the back and wasn't around for a good 5 mins. We had to wait for him to come back to pay.","date":"2013-05-07 03:18:03"}
{"review_id":"ja65_A4GG_r6h5SFfrz4_Q","user_id":"NN9SThdMsM5xSd58mZ32dQ","business_id":"zpGCFAt_MydbQN4EsXee6w","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I went very close to closing time but the staffs were extremely friendly. They have amazing Banh mi. If you are a meat eater you definitely should try the grill pork Banh mi. The pork is tender and moist. The bread is warm. I had the vegetarian banh mi and it was delicious. I am glad they open near the University. They are generous with the portion. Amazing Thai tea.","date":"2017-09-09 00:57:26"}
{"review_id":"ll_Trgy4TNdlfK-KJnKxwQ","user_id":"0CaxcGaQIkOO1DtUODjbyA","business_id":"QFqtVX-lyZQgVHQrG-dhlg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Me and my husband love this diner, probably one of our favorites in plaza midwood. They changed their Black bean burger recently  (which was my favorite item on the menu) and it just isn't as good. But other than that, it's great service and the food is really good!","date":"2017-08-07 20:34:34"}
{"review_id":"YxV5Ug6ykcguiUBGxqvICA","user_id":"A0Jm5yEaW15VfUx7389bTg","business_id":"zGXyttPnzeeuVex3EaIGdA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This is my go to salon. Great service every time! I always come for the $45 gel mani and pedicure special and never leave dissatisfied. Request Rachel. She's amazing!","date":"2017-05-13 08:24:43"}
{"review_id":"BxkS016RFn_wQm-lpoqv3A","user_id":"lHLnyiVJ4gUm3LQ9L5rfJg","business_id":"1FRf6pdx7AtI6HZXIlAZWA","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Love this place. Wife and some of our friends stopped by Sunday to watch the sunset. Ordered 4 Strawberry daquiris. THEY SAID THEY DON'T DO FROZEN DRINKS ANYMORE...WHAT!!! ARE YOU KIDDING ME..LMAO. You have to have frozen drinks to watch a sunset..ahahahaha Come on guys...get it together..our wives are not the bucket of beer types..ahahaha.Still giing this week. But really miss the old owners sometimes.","date":"2012-07-16 00:29:24"}
{"review_id":"nyxYGG-lr2eVCIdQhfkQ1w","user_id":"BfLPcrmnmBJST8_r48I2Hw","business_id":"_BnBjRMt5Ba-TAv07r3fyw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We were seated on the roof top patio, very nice! Got to see a lot of the downtown happenings. The pasta here was delicious! Andrew was our server and let me tell you he is the best, funny, attentive and gave his recommendations which by the way were great! The atmosphere here was lovely, it's nice for a date night or to take the whole family out! Coming back for sure!","date":"2017-08-07 20:54:41"}
{"review_id":"ASIyW3GmMnvqQ3Ret-u4pA","user_id":"tSyjOfLZytCIO2yx_KW1Vw","business_id":"bjJcDCx5uMUr89nxBdGizw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Been to this location a couple times and have nothing but good things to say!! Awesome friendly staff and the best hollandaise ive ever had!! Best hidden gem I've found in the area. Good job managment!!!!!","date":"2018-04-15 14:50:40"}
{"review_id":"Qzp9byhuBqvazYoA8XmnMg","user_id":"qn5F6kkmhZzW-2ofPpGHeg","business_id":"ol-aOSZbIh46Uy3tKjciaA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"very awesome dive bar. the staff is super friendly. although we were their as tourists one of the things I liked about this place was that it wasn't flooded with tourists like the rest of the bars in downtown. we met a group of friendly locals and had some friendly bouts in billiards all night. good beers on tap. id definitely recommend the \"mad &noisy IPA\".","date":"2016-01-04 03:46:51"}
{"review_id":"jed5jlbs5fUgORcXVPmv4w","user_id":"6C_CoCyLWzMrvY1dd3OdLg","business_id":"vHt0CSynqesXox-9nBj7uA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We got the mini street tacos with black beans and rice. The steak in the tacos was sooooo good and tender. My daughter got the kid nachos and she couldn't stop saying how delicious they were. It was a mommy daughter date for us and we are very happy with our choice of restaurant. We had a great time","date":"2018-02-24 01:19:48"}
{"review_id":"cX57kvMr55RSvN0jEaPDvg","user_id":"yRv8mIPj6mKgI9XbZKeP2A","business_id":"Z_bIlA-etR1cVNlFMLdepA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great experience with Megan!! She is a super friendly and did a fantastic job on my hair. I have let my mom know of my experience and we will both be going to see Megan very soon. I loved that I could book an appointment online, very easy.","date":"2016-07-25 04:58:07"}
{"review_id":"7n0B9XeilUF_JrfxBBysFA","user_id":"qArrBVmRd2iQjN5vy55abw","business_id":"TWt-6EilZoSH99CheLPD2A","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Went a third time. Not brunch, not coffee but dinner. Waaaay better! I was full! The food was delicious as usual but served at the right temperature! They had wine! Better value for your money portion-wise. The \"kid\" portion was enormous! AND on the way out, I noticed a cute little corner where mom and pop could believe they were having dinner on their own with a little table beside it for the kid near the crayons. Brilliant. Service was still uneven (super attentive when not needed, non existent when it was) and chairs kinda uncomfortable but we'll be back. Glad we gave it another shot.","date":"2013-02-21 23:22:08"}
{"review_id":"k3-JMnv9m1Km7xABarVqFg","user_id":"U1vl4SQzO3wTAWlYVnSjnw","business_id":"Q4A3lotSP4AzYwPZPbouKw","stars":4.0,"useful":6,"funny":2,"cool":3,"text":"I've tried Red Mango, Melon, and Chocolate peanut butter so far and I haven't been disappointed!  The flavours are good, service is fast, size is convenient (I always get small.) I just wish they offered all drinks in the small size instead of just the classic ones.\n\nIt's a great alternative to coffee\/hot chocolate in the morning. I start around 10 every morning and since I don't like to eat breakfast, this is a nice way to make sure I do have something in my stomach before work.\n\nIt is expensive (5.34$ small with tax) but I'm told they should be getting MYT Rewards soon so that should help and I know some other chains have a punch card option.","date":"2017-06-06 20:33:17"}
{"review_id":"jXMAmCb7HcFGrkxKbvrwZw","user_id":"zyg4-MFtfPWmwucVazSjfw","business_id":"eufGie8BYKRa8tGYAGhb7A","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"My favourite ice cream here is superkid. I've only gotten this flavour since childhood and haven't tried any others from them other than off of friends and family's ice cream lol.","date":"2017-03-15 03:14:25"}
{"review_id":"CfueO6B4_WauGRQ0cq9Whg","user_id":"fhwZh6_7YxWeVEuskKMTcA","business_id":"poSV39UqEg-gpESXafS9-g","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"Loved this place! \nI came for crab legs and was not disappointed! Loved that the seasoning wasn't full of butter, the level one spice was perfect, steamed veggies were crisp with a flavor season that wasn't too salty. Tried the allegator and frog legs for the first time- good, but not for me. I'm not that into fried, salty foods though. Our service was excellent --thanks, Tim! Fun and laid back atmosphere, friendly service! Oh, and we got to tag the walls which was fun!! I'll be back! \n*wish they stayed open a little later...","date":"2016-05-07 01:19:53"}
{"review_id":"2SRVREKjuikKtHI8HXQhsw","user_id":"bnjwsoyjGC6GuK8RsAsypg","business_id":"wE3p_qPaM7N11fnWzyRtNw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"In from out of town and had a tire with a slow leak. Had to do a roadside spare tire change and limp my way over to this Discount Tire. I saw how good the reviews were here so I drove past several other tire shops on the way. Amazing service from Jonny; quick, professional and courteous. Found that it was only a leaking valve stem so no repair needed. In an out of there within 20 minutes. Definitely highly recommend!","date":"2017-12-02 19:18:21"}
{"review_id":"W6OR4poxqp_1L2giMTSpKQ","user_id":"pVQ0r316y4jpJdt8ufHXEw","business_id":"bDtsc7WTwEJZFuvjXy8wng","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Having nom'ed my way through Toronto, Bestellen is my favourite restaurant in a city if great ones.\n\nFood? Off the charts. The famous cote de boeuf, the burger - phenomenal.\n\nService? Brilliant. Friendly, welcoming, funny, engaging. \n\nThe vibe? It's a hip place without the hipster dip$hits. It's the best of both worlds.\n\nHighly recommend. For the win.","date":"2014-02-23 21:59:53"}
{"review_id":"5_QtzWYK-MIKEGFP0OQviw","user_id":"IUG4FRM2l1bIBdo_BsxSIA","business_id":"tMdgY7Ou4k3bYZZulJCiuQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"They have options for meat eaters and veggie lovers. Delicious. I got David's Special salad with chickpeas, beers, avocado and curry quinoa on top. The kale base had just the right amount of dressing and the portion is huge. I'm so stuffed.","date":"2017-04-07 21:15:55"}
{"review_id":"mMyc5gHgse9VkTQL9X8OWA","user_id":"LHQ82OZdbLOrdwVxEieaoQ","business_id":"z4K95Y4P5nMrtJiDtXWDYA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Mole sauce was amazing! Chicken was a little dry, but searously the mole sauce was good enough to eat with a spoon.\nSkip the fundido.  The waiter could not explain some of the items on the menu, which was funny. The hicima tostado was great!  so was the mango crab salad.","date":"2012-01-03 16:24:49"}
{"review_id":"my8wGnUk7WAjAwDFtV70_Q","user_id":"zMfryQcgMVOJrdPmCGJyeQ","business_id":"4qG3Gh8QyugC1XvoTlmgcQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Great food, great services. Suzzy was wonderful and attentive. We ordered a chile relleno omelette and cinnamon raisin French toast I'd say it was a 3\/5 French toast was completely brown on one side omelette had too much sauce. It was decent food but awesome service by Suzzy.","date":"2016-02-23 18:39:11"}
{"review_id":"w-BcMjNByvMhH0PG6HlrMg","user_id":"Xgc8RAII67FdKk9Iwv62rg","business_id":"46Ld9Qc9nAx_A0jwclNZiw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Went there on a Monday morning and it was packed, waited 15mins for a table. Service was friendly and prompt once seated. Would recommend the Miami special sandwich. Great experience, would come again for lunch or just a casual coffee with friends.","date":"2018-06-19 12:08:05"}
{"review_id":"DeaGMJJ107IJ-QnyuGABKA","user_id":"_OkEXLN_5T9cMc3UFrLT9A","business_id":"46Ld9Qc9nAx_A0jwclNZiw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"One of my favourite lunch\/sandwich spots. Usually packed for good reason but staff is usually friendly. Their vegan sandwiches are delicious. Can't speak much on their coffee as I've only had an Americano there but it was satisfactory.","date":"2016-06-11 22:04:25"}
{"review_id":"0wceCr75fE63DVC-BxJucQ","user_id":"jV2JRJT9oSEVzoSkOSqmiQ","business_id":"szGbmw_vq3kVU4SfK1x6Sw","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Ruth Chris Steakhouse is by far one of the best restaurants I've been to in Pittsburgh. Ironically, my family and I avoid eating red meats whenever possible, which seems awkward when dining at a renowned steakhouse. That being said, no red meat platters were placed in front of us.\n\nThe service here is impeccable. The waiters are amazingly helpful, poised, and polite. \n\nThe food we ordered arrived fairly quickly. I got the lobster mac 'n' cheese, my dad ordered chicken, my sister got medium rare fish, my mom ordered a salad, and as sides we all ordered cream spinach and mashed potatoes with garlic. All the foods were flavorful and seasoned and prepared perfectly. \n\nAs we moved onto dessert, the choices were hard because everything sounded extremely delectable. I got the Chocolate Sin Cake, which the espresso and chocolate mixed together was mouth-watering. My sister ordered the Strawberries and Cream. The strawberries tasted fresh and sweet. My parents split an amazingly tempting apple cobbler served warm with vanilla ice cream and overflowing with delicious apples","date":"2015-01-03 23:44:23"}
{"review_id":"-S7ntC9srmK_Ds1IdxM5ag","user_id":"ibfw2LUjalN25aZYDY6EuQ","business_id":"vTqKk3FgwwLgfCcV7F1jmw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"A great \"box\" Chinese restaurant with cheap prices and your typical selection. The vegetables I've had are always fresh. The staff seems like mostly like a bunch of kids run the place but its all good. I've never had problems and would recommend it to try for take-out.","date":"2011-05-27 12:31:02"}
{"review_id":"AcAgQXcX8DCdg9isZssFOw","user_id":"xuciFPT5qO04YzWwb-CCdg","business_id":"f8IMQgRwo-8GP372MElDGQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Seriously an amazing experience. The staff was polite and took care of my every need. It has the perfect location, just steps from the Freemont experience. Easy walk to all downtown locations.  The rooms are super clean. Beds are huge and comfy. The bathroom is the perfect size for a hotel. Love the modern decor as well, feels like a strip hotel in the room. Nice food options as well. Easy to grab a quick bite at subway and McDonald's. Oscars was a meal to be remembered, looking onto Freemont from the dome. Try the filet and the Martinis. Great old time bartenders and staff.","date":"2015-07-28 06:18:55"}
{"review_id":"OEMMvQciWO35a_Wx3iLAAg","user_id":"f8dRAxgqFnRH5l6AdbOf-A","business_id":"42gnKgy6ryfQ4QBtmyVgqA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"No place like Happy's.  Sit at the counter if you can. Give Leo a fist pump and he is your personal chef.  Great food, consistent, and the name describes it best, a Happy environment.  My daughters love it.  He puts Mickey Mouse ears on the pancakes, by request only according to my 8 yr old.","date":"2016-03-17 16:08:24"}
{"review_id":"pvodxJzszGQH6LoT9hyM4Q","user_id":"pxRFWDsQ7YQ8_dWzqzMQdA","business_id":"91EhRceds781OLo3M4BDrA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"They have the best return policy in town. I highly recommend shopping at nordstroms.  They have very attentive sales associates and carry a nice selection of items.","date":"2015-08-06 21:49:39"}
{"review_id":"ZSfzJNRrNxX5hPck_16Vrw","user_id":"b1rHXLJh7bqy4pEHeV4L2w","business_id":"mzIAa8V_ec4yGpIfFaXSOg","stars":5.0,"useful":5,"funny":0,"cool":0,"text":"I visited Monty's on my way out of the state.. Once I stepped inside I'd wished I wasn't leaving and that I owned an SUV instead of a 2 door sedan... They have so many amazing things that I wish I could have purchased. The ladies there were very friendly and helpful. Was greeted promptly when I entered the store and felt very welcome. If I ever decide to move back to AZ I will definitely stop in and purchase a few things.","date":"2016-03-30 22:08:08"}
{"review_id":"TgXrVccrZpsLfEvKiqoG4w","user_id":"4G0kaesmUCIWttkt6bioHQ","business_id":"ACb637NG7EnswRs8U_BX_w","stars":1.0,"useful":1,"funny":1,"cool":1,"text":"My wife and I tried to eat here, but we couldn't get the staff's attention.  We entered through the main entrance, saw the \"seat yourself\" signs, and sat ourselves outside.  We're both easy going so this is fine.  We looked through the menus, decided what we wanted, chose our drinks, and tried to make eye contact with the staff.  \n\nThe last straw was when, after 15-20 minutes of sitting there without any acknowledgement, the manager came by and looked at us, instructed the busser to do something with the fireplace near our table, turned on his heel, and went back to hanging out with his employees.  We were looking for some sort of hint that he would send someone over, but we did not get it.\n\nThe worst restaurant service experience I had in Paris was better than this.  I wasn't even mangling the language and we felt like personae non gratae.  We ate at Lucille's Barbeque around the corner instead, which was great.","date":"2015-12-05 02:59:38"}
{"review_id":"Q6j_AtqRRS6ZvO6AHRQqVw","user_id":"jhSe6QWZiUq8yoUmvVgTUg","business_id":"bQ-sXUqPSr4-iJfB764Nzw","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"For a place that has \"burger\" in the title, they sure don't serve a good one. I've had better burgers at McDonald's!","date":"2015-06-21 03:32:21"}
{"review_id":"NPtDJyrCOgoGSei0-LHCqQ","user_id":"IV-L3RLN3dgrfX4aeiHLXA","business_id":"Ti7UFcA0g5QpflvxsUpa3g","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"Took my friend here after her grandmother passed away. She wanted to get her feet done, the lady ran her water too hot and never adjusted her temperature when asked. After 20min of waiting another customer walked in and she made my friend get up to do the other girls feet. It was a very uncomfortable feeling for me being that I was already getting my feet done and she wasn't.","date":"2015-10-17 01:12:59"}
{"review_id":"L944kGO4W-K5OOaFgEmBoA","user_id":"AMOQdQtfGisU9aNfk7s2Sg","business_id":"NN6HpdvQlGZUVjBwzhgUWQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Just stopped here for a quick lunch. The entrance was a little confusing, but we quickly realized that we were walking through the brewery which was super cool. Our waitress was super friendly. I got the chipotle bbq chicken sandwich and the bbq pork sandwich. Both were delicious and good sized portions for the price and those fries! The menu said they were homemade beer battered fries and they were amazing! I also got one of their house brewed beers on tap which was also good and the pricing is more than reasonable on a pint! I was extremely pleased with our entire experience and we will be going back often!","date":"2015-03-04 20:18:07"}
{"review_id":"J4SyPzBCZAAHZ7uD5w0nIg","user_id":"gG7PfQQouA2JljeR4DWR9w","business_id":"ufmokEGxGqEWIdvIVsNg_Q","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Best persian food in the valley. Beats out the spots in LA\nTry the homemade ice cream","date":"2018-05-29 01:53:46"}
{"review_id":"xWqPQ9yTuTGRnI1qGHGZKQ","user_id":"RU9Vg1ERB87OETJyv5pvwA","business_id":"8OeHn9KCbICuRBs_XiDDUA","stars":1.0,"useful":6,"funny":0,"cool":0,"text":"I'm 90% sure the owner of this burned it down rather than doing the right thing and selling it or closing it and now he isn't giving his employees money that was raised for them to get them through the holidays. This guy is a total sleeze ball!","date":"2016-01-04 05:14:18"}
{"review_id":"30VIjVCXmNozSjdcjL8AhQ","user_id":"Av7MzGi9W1fJij5CHuY9Qg","business_id":"UDE4VL0k8Zrko7RkJ4agGQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I have been a loyal customer of Little Dumpling for years, and I typically order take out. I love the Chicken Pad Thai and Crab Rangoon! Its well spiced with chili oil and generous with the meat. Delivery is fast, and has friendly drivers. My gf likes the Lemon Chicken with sauce on the side and eggroll for starter. It's our local Chinese go to, give it a try...you won't be disappointed!","date":"2016-11-22 00:29:43"}
{"review_id":"Ifz1p8O2mhgVsxOXPWy2zg","user_id":"mCLrwowWkJz-cKl9BY_Ubw","business_id":"wSAGILK2CFbq5BVZ5D67-A","stars":2.0,"useful":10,"funny":3,"cool":0,"text":"I was excited about this place. It has so much potential but like a lot of places in downtown Cleveland, the administration ruins everything. Sunday wad their first Sunday Funday... there was nobody there and they had nothing from the menu...like they didn't prepare for it at all.\n\nLastly, besides not having anything available to eat and not sure if they had enough ingredients for their drinks during their first Sunday \"party\"... they published the event as \"beach casual look\". However, the hosts were all wearing Sathurday night club type dresses (early afternoon on Sunday!!) which was totally ridiculous. They also looked at us weird because we were wearing shorts... eehh... beach casual? They totally failed on planing in so many different ways.\n\nIf you want to stay upscale you may have to deliver on the simple things first. I hope they get better over time but I see this as another \"Tomo Sushi\" type situation. Great concept and poor execution.","date":"2015-05-12 16:21:00"}
{"review_id":"B71V28ISszrMar3AVqxyng","user_id":"bKd0oZwVNdKJiDHVthYoOQ","business_id":"R-J8197kH_vUWjd1HTmU_g","stars":5.0,"useful":2,"funny":0,"cool":0,"text":"I dropped my car off in the morning because my tire popped I looked for the nearest shop to me and this on came up had good reviews. I did ask for a follow up call and didn't get one I was too happy but when I went to pay for my tire he didn't charge me anything because I wasn't happy. My car drives good now and I was pleased with the service they did. Thanks guys.","date":"2016-08-04 01:07:29"}
{"review_id":"BdGAj-2jMpyMF6LdJZ6BEA","user_id":"vrwEyaJSte3zyFDKP7PaFg","business_id":"lwpQQflP1CGJPV7QLybzOg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"Great service, decent food. I went here with my family for dinner and the staff was extremely friendly and nice. The pizza was ok, we ordered two large pizzas, one was all cheese and the other was half veggie and half buffalo chicken. My husband said he enjoyed the buffalo chicken the most, I preferred the cheese. I didn't get to try the veggie but my mom said it was very good. The bruschetta was very tasty and I would recommend trying it. We also really enjoyed their pizookie, and if you like warm cookies and ice-cream I would highly recommend trying it!","date":"2017-10-24 20:02:13"}
{"review_id":"i-1oN7KMQ1cjD2UmbvNkng","user_id":"CJqgUQeWhdgbDyLAFy7xvQ","business_id":"iMGGM-WVNKep9c6bgRYjpA","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"Been coming since opening week,  been several times.  Tasty fast food, quality ingredients.  Love the couscous, pita bread, falafel, baklava.  Like the bowls with the choices of sauces.  Tasty chips also.","date":"2018-01-21 18:52:15"}
{"review_id":"PRs902-yyXnYc3aMqpiQPg","user_id":"C5f4mfGv1G5WhXe5SLauLA","business_id":"3j_mvJHnT7nJd7su_7zazw","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"We went to Ginseng 3 on 5\/24\/13 during our last quick getaway to Las Vegas. It was late and we were craving sushi. When in Vegas, I normally go to the place in the Cosmopolitan Casino, however we were looking for something closer and less expensive. \n\nGinseng 3 is located on the strip, on the 5th floor of the Quad (the former Imperial Palace). It isn't anything fancy, wasn't busy, we were seated quickly and was less expensive compared to any other sushi restaurant I have been to in Las Vegas. \n\nI had order the spicy tuna roll which was about $12 (super spicy), the eel roll which was about $12-$13 and a glass of orange juice which was $4. Overall the service was mediocre as they didn't check on us much, if at all and the food was tasty but by no means would I say excellent. \n\nIf you want mediocre, less expensive sushi for the Vegas area, I would recommend checking out Ginseng 3 in the Quad casino.","date":"2013-05-28 20:51:19"}
{"review_id":"cSgy6HVMxl0mztysJcjhvw","user_id":"gDWdfiYcA9wv5P9FIM1epg","business_id":"cWkGEqESnCznT-zBMFsCCg","stars":1.0,"useful":5,"funny":0,"cool":0,"text":"Scheduled an appointment for a couples massage for my sister's birthday about a month in advance. We needed a Saturday appointment since I was visiting from out of town, and Donna asked for a $30 deposit, which isn't unheard of for spas. I received an emailed receipt for my deposit and confirmation call the evening before our appointment. The morning of our appointment I was contacted by Donna through text that her daughter had gone into labor and she would have to reschedule. Since I was visiting, we were not able to reschedule and we had to cancel. I asked if the deposit could be returned to my card, and Donna stated that her card processing system was down but she could send a money order.  This was 3 weeks ago, and I have yet to receive the money and have been unable to get in touch with her. Definitely do NOT recommend Donna!","date":"2014-07-28 05:21:43"}
{"review_id":"gCTEyslNDkKGq3ZBJxpTwQ","user_id":"u2xFh32LxAQ5F_35THgWjw","business_id":"4hl8B_aiHPiaqM5zATl01A","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I just are here and everything was fine. I had a two piece Classic Meal, all white, Extra Crispy with mashed potatoes and cole slaw. The drive thru service was quick and polite.","date":"2014-02-05 22:01:27"}
{"review_id":"IhiqGhNjrTE6KCU4-qSjnQ","user_id":"nBMr3AZRi1HOmYb20TUuiA","business_id":"6zH8UMp8VyTveS6_b_CGrw","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"These people were actually quite rude to us when we were customers. Literally treated us like thieves when we came in to transfer a phone to another.","date":"2017-04-08 01:02:02"}
{"review_id":"UnN00hmsmBIgKBsHz51VXA","user_id":"KmHtoogKhK-ID7FWGOPvag","business_id":"Nv2ILPkvHatA1Er5rqnZTg","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Came here with a group of friends for a night out.\n\nHad a good experience from beginning to end.\n\nWe were boring with our choices of food and choose to get lamb, and chicken souvlakis. We were impressed with our choices. We each ordered an alcoholic drink. All of them were made well. \n\nAlthough it was a busy night, the service was still great. Attentive but they did not overdo it. \n\nThe food was delicious, great portions and good quality. \n\nSolid authentic Greek place to add to the list of food restaurants in port credit! \n\nCheck this one out :)","date":"2015-05-12 21:08:49"}
{"review_id":"bKNGwDLj8cQi2JYhxrecFg","user_id":"cp4UIiQXoWyb2ADjgrNtyA","business_id":"f8IMQgRwo-8GP372MElDGQ","stars":4.0,"useful":2,"funny":0,"cool":1,"text":"Anyone who is complaining about the Plaza Hotel has to be a hard-nosed, difficult curmudgeon...cause we got WAY more than we paid for! An excuisite room with a spectacular view of the Strip for just $30! Woulda' been 5 star...except I had booked a room with a Deluxe King Bed, and all they had was 2 Queens. I will come back!","date":"2012-08-15 04:03:30"}
{"review_id":"q36vhN2KESA4IulpCYijpA","user_id":"8ziF9bL2WU9boE6du0yAIA","business_id":"k-drEjxKmfqllwfY90STfA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This review will be short - because my visit was super short as well.\n\nThe boy and I showed up late Sunday afternoon for an early dinner\/late lunch\/super late breakfast and were quickly seated in the bar area.  The lighting was very dim - good if you want a romantic date, bad if you want to read the menu.  \n\nAnyways, we had a Living Social voucher to redeem so we ordered tons of food - starting with the table side guac.  The server brought us chips and salsa and was just about to show up with the guac when the power went out - twice.  Apparently the power went out and then their backup generator failed.  \n\nTurns out the power wasn't expected to be back on for a few hours so we enjoyed our guac by candlelight and were also serenaded by the waiter....\n\nOur real meal never happened - obviously - no power, but I liked the way that they handled the unexpected situation and darn, now I have to go back!","date":"2014-04-01 01:37:36"}
{"review_id":"e29NfXzGsPwoWJoRxWFLyQ","user_id":"akwf2HZW4h29wP5XwMiRBg","business_id":"OK0ba4X5seibH8oMWh4bhw","stars":5.0,"useful":0,"funny":1,"cool":0,"text":"We have been eating here for 5 years and though it is a little bit pricey for some things on the menu, you get what you pay for and what you pay for is the best Sushi and service in Nevada! \nThe staff is amazing and friendly- they know us by name and give my 5 year old hugs and high fives when we come in! I love the entire menu but if I had to eat one only one thing every day for the rest of my life it would be Salmon Lover no Rice! Best thing I have every eaten! (Close runner up is the scallop hand roll and salmon skin hand roll) \nWe look forward to our weekly visits and when we have actually ventured out to try other Sushi places we are always disappointed as nothing ever has come close in quality, service and atmosphere as I Love Sushi!","date":"2016-07-03 18:18:59"}
{"review_id":"R2agv2EUeCooIv0_-3X7YA","user_id":"u3ZPMVVEzneq8x856WksJQ","business_id":"ZspvlO5Dvtd517YhVLJJ_A","stars":3.0,"useful":5,"funny":0,"cool":2,"text":"When it comes to Tomo, my biggest suggestions to have the best experience don't necessarily come from tips about food, but rather, planning your night there.\n\nAt Tomo, when they ask you where you would like to sit, choose the Hibachi grill or the left (left as if you were walking in through the main door). If you sit on the right side, Tomo shares an adjacent wall with a noisy night club, and your table will thump with hip-hop music. This obviously isn't their fault for having noisy neighbors, but it can definitely hinder a first date or good conversation.\n\nThis also goes for choosing when to eat there. I recommend Friday night, before the bar crowds start rolling into the neighborhood. You'll find better parking, and it will be a quieter experience. As for the food, the sushi at Tomo is quality for the prices, but be prepared to spend a little more than usual. The presentation is beautiful, and the service is fast considering their busy Warehouse District location. I absolutely love the Indian Roll and the Sexy Girl roll, and I must mention how nice it is to have a hibachi downtown. The sushi is worthy of a visit, but if you don't have time to sit down, they will never fail you on takeout.","date":"2016-03-06 23:43:57"}
{"review_id":"vtSc-ec5eQbrsh86u8sDPQ","user_id":"ZEVHQJf-F9p5_WeyUtOYow","business_id":"jHB0Rb_xjcUy5po-XQAB-A","stars":5.0,"useful":2,"funny":0,"cool":1,"text":"Great service, alcoholic drinks reasonably priced, food wonderful!!!!  Can't wait to go there again!!!!!  Huge difference from the previous owners!!!!!","date":"2012-05-28 19:56:49"}
{"review_id":"wtHB8AMIxM2eJohuTs542Q","user_id":"haEqV41MSa3d4KFuMia76w","business_id":"WCqcYtJ4rUxA4bIzjOfzqg","stars":3.0,"useful":2,"funny":0,"cool":0,"text":"(2.5\/3) For first timers, this 'restaurant' is organized a lot like a high-tech, italian-only food court. Walk in and an employee will hand you a handy, dandy card which you use to swipe and accumulate expenses at various food stations (pasta, salad, antipasto, pizza, bar, dessert). It's convenient and not too crowded. Apparently the pasta is made fresh daily and they actually cook the dish in front of you--note, this significantly increases your wait time. \n\nI ordered the Pasta Vongole (one of the specials listed in front of the pasta station - $9.95). It was supposed to have white wine, clams, garlic, capers, and anchovies. However, upon closer inspection, my capers and anchovies must have vanished in thin air. The pasta is good, but the dish as a whole lacked flavor. LIke past reviewers, I also found my pasta dry (however, one of my friends had pasta that looked like it was sauced in soup). Serving sizes are huge though (considering how filling pasta can be). My friend who got the carbonara said the sauce was much too heavy but he really enjoyed his side caesar salad. \"The anchovy flavor was great.\" I also got the trio of bruschetta ($4.50) and white chocolate mousse ($2.75) to go. \n\nFinally, I had some issues with the card they provided in that it charged me almost $10 more than it should have when I went to check out. Fortunately, the cashiers were understanding and removed the mysteriously appearing dishes from my check. Overall, I would give this place a second chance since the fresh-made pasta actually has a great texture and the employees are friendly. It's also a great alternative to fast food and traditional sit-down restaurants.","date":"2012-06-26 02:43:12"}
{"review_id":"mQKadThbF9t6Go4cIOFDTA","user_id":"K--OeLy6-GRZIR2RCxdprA","business_id":"VMPSdoBgJuyS9t_x_caTig","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Some of the best Laotian food I've ever had. Whenever I'm in Madison, I go here! Try the curry dishes! \nPrices are fair, service is great and the food is simply tasty.","date":"2013-05-07 15:05:13"}
{"review_id":"IzvDDyteNg3LCHYtIn-YmQ","user_id":"WrlxE5qpTrOPS9wYAHqCKw","business_id":"6sheMoVcv6xrs1E7-bNPZQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"We came here on a Saturday afternoon. I got the veggies with homemade ranch (I love ranch). And the boytoy got a double bacon cheeseburger. He said it was absolutely amazing! And he adores cheeseburgers. So I believe him. My veggies and ranch were exactly what I wanted. Don't worry, I had French fries too. And they were so good! I like to pretend I'm healthy while I drink excessively... haha... so the beer was cold, the food we had was great, and the service and atmosphere were great! We will be back for sure. Ps. They brought our beers in about 15 seconds? It was amazing!","date":"2017-07-08 22:07:59"}
{"review_id":"GiSS3etN75ayUgB8to9Ysw","user_id":"GQzrkCr585I49766K7u8jw","business_id":"XWfpcqwNl2Op8CrDhCE8pQ","stars":1.0,"useful":3,"funny":0,"cool":0,"text":"It's always good to see a new restaurant in town, and this morning we tried the recently opened Kimmie's.  Unfortunately, the food and service were awful.  We will not be back.  \n\nWhen we arrived at around 9:30 on a Saturday morning, the restaurant was not crowded.  Even so, the service was very slow.  There seemed to be one waiter and one busboy on duty.  The waiter seated us and then vanished.  My husband finally went over to the coffee station, brought the pot  to our table and filled our empty cups.  The coffee was fair -- not great.  We eventually saw the waiter, at the back of the room talking on his cell phone.  After a wait of nearly half an hour, we were getting up to leave.  The busboy suddenly appeared and took our order.\n\nOur meal arrived quickly.  The busboy who brought our food dropped the containers of jam onto the floor, picked them up, stacked them back in their little holder and put them onto our table.  Needless to say, we skipped the jam.  We asked repeatedly for butter for our toast & biscuit, and finally my husband headed for the kitchen to find some.  He was intercepted by the busboy, who brought butter.  By this time, our toast & biscuit were stone cold.\n\nMy veggie omelet was so greasy that I couldn't eat it.  My biscuit was obviously a pre-packaged item, which had been split and toasted on the grill in an apparent effort to make it seem fresh.\n\nMy husband's scrambled eggs and sausage were OK -- nothing special.  The bacon strips were curled up in little balls ... apparently no one in the kitchen knows how to cook bacon.  The sliced tomato was good.\n\nThe menu is enormous.  Based on our experience this morning, I would guess that most of the food is precooked, prepackaged and just heated in the microwave or otherwise warmed for service.  Icky!\n\nIf you want a delicious, fresh breakfast in Fountain Hills, our best recommendations are Sofrita on Avenue of the Fountains (great coffee, interesting fresh food, creative decor) or EuroPizza Cafe on Saguaro in Lakeside Plaza (good coffee, good fresh food, lovely view of the lake and fountain).  For bagels, try DJs on Palisades in the Safeway center.  We would suggest steering clear of Kimmie's.","date":"2013-07-13 19:19:14"}
{"review_id":"aWy3WrlfS0jihw8gdkbuwA","user_id":"Ni4n-YjICsjVCwbaaR1qdA","business_id":"YgBQEX8dB27FdYj7PaPhPw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Terrific food, comfortable and unique atmosphere, and excellent staff. I highly recommend the Tom & Jerry in winter and the cheese curds just about any time of year!","date":"2016-01-04 16:52:16"}
{"review_id":"3SM0tM1Pv9VfpYS4lBhgZA","user_id":"xSlZoZ1IDejYVgCGGgBbZQ","business_id":"mezvOoz4VcQXl9F7E2qigg","stars":4.0,"useful":3,"funny":1,"cool":1,"text":"Since I've moved to the Charlotte area I've been \"a happy regular\" at Roosters. I'm not the type to blow massive amounts of money on a haircut, however I'm not going to a $10 quick-cut huge-franchise chain either.\n\nIn my opinion, the haircut is well worth the price. I've gotten cuts by I think everyone in the shop and I've never been disappointed. I've done both appointments and walk-in, either one no problems. You get offered a drink every visit, nice big comfortable chair, and great wash (I personally hate hairs all over my face and ears when I leave the barber chair and they do a great job of not letting that happen!)","date":"2013-04-11 17:18:49"}
{"review_id":"9wl4eFGxtUO4oBI7Q--1aw","user_id":"59xlIIiQvldmw5i-5e8Nkg","business_id":"swX3Vj3dQsz1YlCRmwNQEQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I haven't been to Eddie V's since their relocation from DC Ranch to the Scottsdale Quarter, but I sure wasn't disappointed. I could not try ordering anything else besides the Parmesan-Encrusted Sole and it has not changed it's culinary explosion of flavor one bit. The experience was romantic, the atmosphere was wonderful with a live musician, and we absolutely adored our waiter, Michael. I definitely wish we had more of an appetite leftover from our entrees for the dessert options, but after two side dishes, an appetizer, in addition to the entrees we were filled to the brim. \n\nWe will definitely return.","date":"2016-04-11 20:27:58"}
{"review_id":"fpRWvKpfiR9Qu_O8skCAJQ","user_id":"TQuB_qjHA05Z2ojejtB-8A","business_id":"bdN96PwSC95NJVMgQZ7drQ","stars":1.0,"useful":1,"funny":1,"cool":0,"text":"Awful service!! The floor boards I needed were in reachable, walked around to find help and a group of employees were standing talking, when I asked for assistance with the floor boards they all started at each other as if to say \"I'm not taking it, you take it\" after a good 30 seconds of silence, one finally came to help. The board on the top was VERY damaged so I asked for the one below and and the other 3 I needed. The associate did not say ONE WORD to me the entire time!!!! Rude!!\n\nThen, I went on to find a ceiling fan adapter kit I asked another associate for help and he stated \"I don't work in this department, I don't know what you'll be needing, but I'll look\" then I asked about the kits and he says \"This is all we sell.\" I had to ASK him to try and find someone in this dept. to assist me and answer the questions I had....\n\nAbsolutely nuts!!  I will NEVER go back to this location....in fact... I'll just go to Lowes!!!","date":"2016-07-03 18:18:45"}
{"review_id":"MdY2ETHwgKSrmB_XD7nbrg","user_id":"JUqs6q-cTgr5cgJVfyUAIw","business_id":"sr7jtrZHnF_MedBF8dDigQ","stars":5.0,"useful":3,"funny":1,"cool":1,"text":"Jim showed up with a huge smile and a \"sorry for intruding\" attitude when he came by to move the 1912 Lyon & Healy piano I restored. Shared custody means it bounces back and forth from house to house... long story. Jim has a great spirit and makes you feel like everything is going to work out fine.  I've never worry about the condition of the piano, I know he'll take great care of this antique.  Plus, I rebuilt it, I know how bullet-proof furniture made from that era is.\n\nNow if I could protect my emotions so securely with the loss...\n\nThanks Max Piano moving","date":"2016-03-31 01:41:30"}
{"review_id":"4XNhmR4NbgQVOf6Oe9y0QQ","user_id":"xaYW9NG_EzRMjWRLZTwBFQ","business_id":"nDn2h-_c7Xk4UwM0aiXZlw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Delicious food, good service, pleasant ambiance. Good vegetarian options. Cons: very loud, very busy.","date":"2014-10-27 17:13:19"}
{"review_id":"2uuGYEYl4_p3vWC6P5Dhog","user_id":"1No5nPT1uG_iSN8ywPmrvQ","business_id":"sonOwNb4iOdGjNyZIAs_Jg","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"nice guy, great knife diversity, clothes and miscellaneous items for cooking and baking, comfortable atmosphere. everything a home chef needs, a lot of things a working chef WANTS.","date":"2010-01-10 20:07:13"}
{"review_id":"KBxehNrcc07389Gu9o9CvQ","user_id":"rdrbizbKmClF3M2t11XxFA","business_id":"E3jaP8ftRTQiLdA6M9CGyw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"This restaurant is awesome - it's just down the street from me and I am SO thankful for it. Since moving to Beaconsfield, the restaurant choices nearby have been limited\/very disappointing. Plus, the rest of the West Island kind of sucks. But this place is excellent. I'd also say it's fairly priced. \n\nThe restaurant is located in a converted home, making it very cozy. The staff are so warm and friendly, and it's clear that the restaurant is family-owned and that the owners actually care about their customers. Despite its location, this place could compete with what you find in the city, no problem. It is also consistently excellent. I would definitely recommend that you check out this gem!","date":"2014-01-17 19:11:06"}
{"review_id":"TuxIumqXkw_vtiboC6Ugeg","user_id":"bcnukFkiI8fQjDU35QQSBQ","business_id":"SZEFE5hL7aN5nM-A44iPwQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Service was incredible. Thank you Russell for the great suggestions and service. Everything was very good. We had the peppercorn strip with house sauce, Mac n cheese, and crispy salmon. Highly recommend.","date":"2018-02-02 02:17:48"}
{"review_id":"ISzgBFiVY1zX8MSetcJicg","user_id":"fJezNrc49UX9gONGNJ4YUQ","business_id":"4gwh0q7JsdzHIm_pdYUlZg","stars":5.0,"useful":12,"funny":0,"cool":11,"text":"LOVE this place. The best sushi and one of the best meals I've ever had. Prix fixe menu. You can clearly feel the quality and emphasis on detail as soon as you walk through the door - the owner is meticulous and it shows.\n\nExpect to pay $50+ per person minimum. The menu is perfection and prix fixe changes daily. \n\nOne of the best restaurants I've ever been to, and unbeatable for the price.\n\nBook your reservations today!","date":"2013-02-22 19:19:26"}
{"review_id":"ibD0U9iS04FOrJwvBK-T1Q","user_id":"TZ6q9kDzHnOr2liJIs6DXw","business_id":"ac3laXcJnclYZAO65XAcmA","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"The food was actually not too bad but the customer service of the actual server was pretty appalling when asked why the five top, 4 top and 2 top got fed before us. Literally stop the server and ask what happened? He slowly walked away and said he had to check on our food. Then we asked for the manager. It went well and she was kind and great customer service. Thanks for making our stay a little better and sending us home with brownies. Also she gave me a couple five dollar gift certificates to come again. Overall the food was a seven out of 10. Hopefully we get a different server.","date":"2017-06-27 23:35:31"}
{"review_id":"GR0B51lu8ZJYvrhyseU4LA","user_id":"QxP5-cBblv7zm3a8FC96Fw","business_id":"jlIDquvbSc4LKY-tFyh6-g","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Melissa is the best. She just knows how to relax people. I live in Louisville, Ky and I work out here part of the year. She was recommended by a friend and after going to her once, I just wait till I come out here to get my waxing done. She also offers multiple other services and you can schedule everything online. If you've been thinking about trying Brazilian waxing, jump in and try it with Melissa. You will not be disappointed with her service or her personality. Also, I am plus sized so don't let that stop you from coming in and getting it lined up with Melissa.","date":"2014-08-24 19:37:56"}
{"review_id":"snsp2olQn6ZTLR-SMhjHPA","user_id":"Lbx7hNh-l3xX-cu9tD0TmQ","business_id":"sc9GaupuocNSScOm0J88aA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Came here for the first time today and was incredibaly impressed. Had the falafel laffa..huge portion with so many toppings. Such awesome customer service as well. Falafel was made fresh to order, toppings like sweet potato, eggplant, turnips, pickles, hummus, fries..too many to name. Will definitely come back and recommend to friends and family","date":"2017-08-28 19:46:28"}
{"review_id":"h6uOix4dtoWhWPhu75QbKg","user_id":"W22709z8WX2FSd6Jd84lMA","business_id":"vOcIhGg69R6gq9j1CTGaGA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I have yet to have a wine I didn't like. Molly and her staff are excellent at helping me decide what to get based on what I like.  I promise you will not regret it.","date":"2016-12-04 03:19:53"}
{"review_id":"-XInWEZEZ-75YGiAXPOJmw","user_id":"6X-jOW7lsctid8d_SY8d5A","business_id":"37XExTruLjOLqnTERYy8aw","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"No words to describe how amazing the food here is..my favt has been the number 3.chicken and rice with the extra sauce.\n\nHighly recommend this place to all","date":"2014-11-30 00:05:15"}
{"review_id":"tb0wlY6MmjTlXfE8SCC8ow","user_id":"nYCGV9kideUd-MiidI7eZw","business_id":"ypSAad4wGe3Uh0N6dgVxaw","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"We've been taking our Porsche Cayenne there for service since we purchased it in 2011. Dan Sheridan is our Service Advisor and has been the best Service Advisor we've ever had. He's always so helpful and goes above and beyond. Recently our car was hit from behind and had to have the bumper replaced and the lift gait re painted. The body\/paint department did a good job but after taking it home I realized there was clear coat overspray all over the back window. When I took it back, Dan and I noticed it was all over the car. They had my car for another 3 days. When I picked it up, there was still clear coat overspray on the drivers side mirror. Dan made sure it was taken care of right away and apologized profusely (not that it was his fault at all). I spoke with the Supervisor for body work and he couldn't even believe it got through quality control the way it was, twice. He offered me a free detail which were taking them up on. I probably wouldn't use their body shop again but will always go to Dan for service. He's the best and shows you how much he cares about you as a customer and a person. When it comes time to buy a new car, we will definitely buy from there.","date":"2016-01-30 01:36:09"}
{"review_id":"F_YeV4YGfekBL8sLZozMrg","user_id":"K3v1QF7RP9TLWUIIdyCcfQ","business_id":"4CJ5p16a6KY778DYWqcMTA","stars":1.0,"useful":3,"funny":0,"cool":1,"text":"Portions are incredibly small, It won't fulfill you. I order a mix plate so I can get a decent portion, but it is never enough. Supposed to be Beef shawarma plate, not rice and salad plate with sprinkles of beef on top. Never again","date":"2017-01-27 19:48:24"}
{"review_id":"eY9PxvFepLQ_1G-nNAe_fA","user_id":"62G8kBc2MfDNP-ReecQhZA","business_id":"P8IsTiHq5Hesa6UPL604ww","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"\"This is a little hole in the wall with great food that requires no sauces. Had tried 3 different street tacos all good but the beef was the best smoky flavor. Also had bacon potatoe egg breakfast burrito. So much flavor along with a chorizo egg potatoe burrito. 1s...\"","date":"2013-01-02 17:14:34"}
{"review_id":"jH-vTkYWaggwSXsfXyp03Q","user_id":"Vs4-FOAGiGx82Nsu355GHQ","business_id":"bMIVYOyr0pOYHUDNsmSDwg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"My personal experience was an afternoon coffee. I gave the barista freedom to create and he did not disappoint! Most amazing oat milk spiced latte I have EVER had! Finished with nitro coffee to go and can't wIt for the next visit :)","date":"2017-09-08 22:54:57"}
{"review_id":"0xPbdiQc1HPQqHLrUaO2_Q","user_id":"cXYfwJclcbHAbam3xzY_tA","business_id":"nnDLapJk1z2NJE0-XzwMlQ","stars":5.0,"useful":0,"funny":3,"cool":2,"text":"Dry-Aged New York Steak & Roasted Rack of Lamb (9\/10)\nAfter hearing the rumors and reviews of being one of the top steak houses, i came out to try this aged steak. It was beautifully refrigerated on display outside the stop. Just by looking at it, I started to salivate. I must say the steak lived up to my expectation, the picture cannot do it justice. The tenderness of the meat was perfect with being too overcooked. Getting medium-rare sab f meat had its own unique taste which complimented the seasoning really well. Each bit was like getting a massage on my palate by the juice that sprayed out. It was quite MOOving if I may say. The lamb rack was less spectacular as it was just average with a bit of tenderness in the middle but the outsides were a bit hard, probably because it was ordered as medium (who even does that). \nDefinitely would recommend this place as a stop after making some money from the casino.","date":"2017-03-27 02:11:55"}
{"review_id":"Z__o_-onC4Ey2NqbI62p2A","user_id":"CmzLLzI8ijZrtyVzvGLHGQ","business_id":"YOD9dXrnpu8HTRILpF0onw","stars":4.0,"useful":1,"funny":1,"cool":0,"text":"Great little old school Italian restaurant. Food was good. Nothing special, but what we ordered was good renditions of Italian American restaurant standards.  Service was good. Price was a bit higher than expected for what I was getting, but not outrageously so.  Be a good date night place for sure...","date":"2015-10-07 20:49:47"}
{"review_id":"_06rTa-iUa1epxE6oXV3Rw","user_id":"dMWZ5C3awbLDGCPrLVqptQ","business_id":"LRMwXHODOLJcLJoSvxeHFQ","stars":2.0,"useful":5,"funny":2,"cool":0,"text":"So I'm a food blogger and I have my own website where people can see all the places I've traveled to and criticize the food. Unfortunately, this place didn't make it on my list .. It's a new place & my boyfriend and I came in thinking it would be really great. There was a woman that seated us but was not at all friendly. We felt as if we were being rushed and there no great customer service at all what so ever. The male servers were kind at least. \n\nRamen was okay. We both ordered the miso ramen. They say it's thick noodles but it seems thin? It isn't as good as jinya, monta or Fukiramen. But this place is new so hopefully it gets better! They just need to work on those few things. At least we have this place a chance.","date":"2018-09-03 02:38:30"}
{"review_id":"r1sXpJGEU64pC6Px7CMcAQ","user_id":"XdfIcOBGI979dOWRV3NKKw","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"Dined here with the family during our last visit to Vegas. Food is great! The waitstaff is extremely attentive and knowledgeable. A must restaurant to go to while visiting Las Vegas.\n\nI've always been a Bobby Flay fan and wanted to go here. The waiter was on point with his recommendations. He turned us on to the best margarita I have ever had. It's a Partida blanco margarita. It had fresh lime juice and agave for sweetener. It was amazing. So much in fact that I looked high and low to find that tequila upon my return to Jersey. Luckily I found it.\n\nWe had a few minor temperature issues with the steak but they fixed it and even took it off the bill without me even mentioning it. That in itself will make me return there when I return. \n\nNow I'm hungry...","date":"2013-12-07 02:57:27"}
{"review_id":"CsMbkhrU5IozwJJmDzxrmQ","user_id":"8ZhO7ixP3HRtrry5ygfYFQ","business_id":"U1g7IHZcnRmOc2m3mvWNig","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Zoës is my favorite place to go. The food is always tasty and healthy and there are variety of sides and dishes. Salad dressings on all tables are made in house and are great addition to the dish. Flat breads are good too but it's been a while I had it here and from what I remember they didn't blew my mind but they were good.","date":"2016-07-25 04:11:23"}
{"review_id":"g4AL3ohHZNUNgEP5ks6vLw","user_id":"fzevRmEUuKrZTKBgCsvNzg","business_id":"CE7hNKYS6gIMKv6jK429uQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"really loved their food and the place, but didn't have chance to try their breakfast. plus it's in very quite neighbourhood","date":"2016-05-07 03:06:33"}
{"review_id":"NHDY0NUgqJrZcGBr2UT4fw","user_id":"Yvs8q8tth9J5-7Pdxkaq6w","business_id":"eF2jf-E5ktRQIh_4_-Jxsg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"My rating is purely on the food and not on the service at all.  Every time I come into town for business I make it a point to stop here and eat because the food is outstanding. I had the Ahi tuna. This is the first time that I had Drue as a bartender and maybe he was just having a bad day but someone needs to explain to him that a smile and being friendly is all part of bartending. Everyone has a bad day but when your job involves customer service you have to suck it up and put a smile on your face.","date":"2018-07-17 00:58:56"}
{"review_id":"7Iz2sRzkbZLilg1CGl4wKQ","user_id":"fD2BIDg2yV5EMeqzFXkvTQ","business_id":"G-0VVUUoNUKT3GrnjZnsaA","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Please note that I only came here for dim sum and have never ate from the menu.\n\nThe entrance to this restaurant is met with 2 flights of stairs, and as far as I know there's no access for disability.\n\nI liked the atmosphere, calm, relaxing background music, and clean.\n\nWe ordered hagao, siu mai, and lo mai gai. All of them were tasty and filled my stomach real fast.\n\nA great stop for a quick dim sum eat and it didn't cost a lot. I would highly recommend to come in early especially on weekends.","date":"2018-05-08 15:58:24"}
{"review_id":"uhtTbPBO10f44lWypdMOPw","user_id":"XzITEw7nlcAvrXkW0rZtBA","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"Their standard excuse for everything.....we are undergoing renovation.  When it comes to having no working light switch in your room and the over head towel bar falling on your head in the shower that is NO EXCUSE.  These rooms should not even be rented out.   (Especially at $100 and $190 a night) In addition, there was no available hotel parking for hotel guests (not even valet parking) and the bell hop that was supposed to help us with our luggage (before driving the car  to Ballys to park) never showed up.  Try asking to speak to a hotel manager......after 10 minutes they are still on the phone (probably avoiding speaking to angry hotel guests).","date":"2012-05-28 18:28:27"}
{"review_id":"e1MdD56AB2yFRPm8IszNOw","user_id":"-pXs08gJq9ExIk275YLvPg","business_id":"jBQXyz5yS10X6UvA9kj0Pg","stars":5.0,"useful":1,"funny":1,"cool":1,"text":"sometimes its hard to get past the cash in this store.  you walk in and on your left are tomes filled with photographs and paintings, artists you know, artists youve never heard of, but they are all there welcome you in.  on your right like a cat thats just been in a room where a million other cats have just been hanging out, try as you might, you cannot move quicker help but stop every two seconds, every two inches to get a grip on the newest smell from the newest high quality page in the newest coolest magazine.  the mags are foreign, local, thick and filled with really great articles.\n\nthis spot is top notch for an indie bookstore that has at least two great sections as listed above, and a whole book store filled with both new and obscure titles.","date":"2008-12-04 04:53:02"}
{"review_id":"lGRPXVVq9M2G8O9UIWi9Lw","user_id":"1LM0f41K_mNqBjVl7PB1pQ","business_id":"LGEIsxeJQATo9J1IA-TEdA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"The food was decent, but prices were stupid expensive. The lunch portions were minimal for $8.50, the 1\/2# fajitas were $20. Small sides of guacamole are $2.25. Given the early 90's cheese decor, your money would be well spent elsewhere.","date":"2014-02-05 20:38:13"}
{"review_id":"h09clYYmS-Z0B4g6wAA63w","user_id":"Yuxjl9b5EBo1FhNAyWbr4w","business_id":"mGcNhuOzpgc3colTDjI1bw","stars":2.0,"useful":4,"funny":0,"cool":0,"text":"I called early Saturday morning to make an appointment for a gel manicure and a pedi and just a regular manicure for my niece.  They were able to work with the time I asked for and when I went in there was not much of a wait. My pedicure was great and the people that worked there were very nice! But the quality of the work was not the best. I know I am a walk in and not a priority but I pay just the same and feel that I should have walked out with the best nails my hard earned money can pay for.  My nieces manicure had to completely redone and the polish didnt cover the entire nail on each finger. They were nice and redid them.  My nails some are round some are square and my glitter nail has pink under the silver.  I gave 2 stars because they were very nice but the quality work I had done was not worth the money I paid.  I do have pictures but this is my first review and do not know how to post them","date":"2017-03-15 04:34:56"}
{"review_id":"UUSHvjTqoQ6bPx69XtDF_g","user_id":"PjlYINWKAxdWvL1zz4UlJg","business_id":"k4jX-Xe9dFu2pmdnlrcwgA","stars":2.0,"useful":0,"funny":0,"cool":0,"text":"My husband and I went here after stopping at the farmers market. We were seated almost immediately by someone from the kitchen and then completely forgotten. I'm not sure if the person who seated us shouldn't have, but  we sat for about twenty minutes thinking that someone would be over soon, but we finally had to flag down a waitress and ask if someone could take our order. Her reply was, \"Well, this isn't my table, but I guess I can.\" We ordered and then waited for probably another 20 minutes. Keep in mind we had ordered nothing that would take this long to cook and the place was not excessively busy. Seems that they had forgotten us again. By the time we finally got our food, my husband and I were very hungry and cranky. The waitress completely forgot to bring me the milk I ordered, but at this point I just wanted to eat and get out of there, so I didn't even say anything. When I was finishing up my meal, she finally remembered my milk and apologized. The food was good, but definitely not worth the wait. The wait staff kept apologizing, but it was too little too late. We will not be going back.","date":"2013-12-28 21:50:03"}
{"review_id":"P8MZeOn1u_wYLlG3l9aN2A","user_id":"1l_O3VEl9TV_JjKAzzyz0Q","business_id":"OD09pm-MzynigAvD5KoGPA","stars":3.0,"useful":2,"funny":3,"cool":0,"text":"Today, I had the wet burrito with carne Asada.  They generously load the inside with rice, whole beans and veggies of your choice in addition to cheese.  Warning:  the red sauce poured over the burrito has a kick.  I suggest sampling it first if you don't like spicy!  \n\nI was disappointed with their cheap plastic forks and knives.  It made eating the burrito a challenge.\n\nOverall a good meal.  People line up out the door at lunch, thus the 4.5 star rating.  I however only award it 3 stars!","date":"2014-12-17 18:54:50"}
{"review_id":"5Wy90mJqhpvW9_Dnn1e-xg","user_id":"kPvTjMHDkBI3OIxIBPkjDQ","business_id":"eaNenRk_liZBERFFLCXqqQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"This place is amazing!! Our server Denise was the bomb! She was very attentive to our tables and she able to manager several other while we visited this restaurant! She was very polite and on point with her customer service. We will definitely come back here just for Denise!","date":"2018-02-11 05:52:10"}
{"review_id":"5syk5gEgwG8zLKStbLlhVw","user_id":"nLEqyAEm-nd9dTf1obuqcw","business_id":"u_vPjx925UPEG9DFOAAvFQ","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"Let me start off by saying that I've been coming to Vegas for 20 plus years. I've stayed in many hotels and I've had horrible experiences in most of them... This time I   reluctantly decided to stay at the Flamingo. It's the oldest hotel in the area so it CAN'T be as \"good\" as the others, right? Wrong. By far the best hotel I've stayed at in Vegas. Where Trump had wonderful rooms but no casino, Flamingo came in with a wonderful room AND a Casino. Where Treasure Island had horrible service and crappy rooms, Flamingo came in with wonderful customer service and a wonderful room. My room was clean, comfortable and neat. Every person working there greeted me with a smile. And the biggest plus of all? The Flamingo let me bring my dog and let me walk her anywhere except for the casino and pool area. Plus, plus, and PLUS. From now on every time I visit Vegas I will only stay at The Flamingo. Screw the rest of these modernized barf hotels. Stay where the REAL Las Vegas history remains....  Thank you Flamingo ........and Margaritaville (for the massive hangover)... ;)","date":"2012-07-16 05:43:16"}
{"review_id":"Vo-ds3ysPWV9S_lpIt2KQA","user_id":"OKFutVf6PM1-iSY86MX1LA","business_id":"2qjvYspb3bEmCaw1vmSk0g","stars":1.0,"useful":1,"funny":0,"cool":0,"text":"I'm consistently frustrated by how difficult management makes it to eat here.  \n\nWhen I called ahead to make reservations for our party of four, I was told that they do not accept reservations for parties of less than six people, but that we would be fine if we got there by 6 oclock.\n\nWe arrived at 530...and there was a 30 minute wait. \n\nI'll never go back- I prefer dining at establishments which respect my time.","date":"2015-06-20 22:43:45"}
{"review_id":"WDBmtahN26jo9gq-lr3YPg","user_id":"AzOupRXnY88QOavDcR8Xsg","business_id":"qSAmFujv325-lnLlOetKoQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I first went to Larry about 10 years ago because it was close to my office. He's worked on multiple cars and SUVs of mine. He takes care of my Lexus convertible like it's his wife's. He's done big and small jobs and is always fair with his pricing. His wife runs the office and is a complete pleasure!","date":"2018-06-26 17:00:05"}
{"review_id":"n-Bgh-B2nlw_bfIJy7zMkA","user_id":"xq0bK1rfmXNDex2tVNPQBw","business_id":"HP8mkVdLa9F4Amsp2thKhQ","stars":2.0,"useful":1,"funny":1,"cool":1,"text":"Let me start by saying the food was good. \n\nHowever the place is staffed by young rude people. They got my order wrong and when I said what I really wanted, I was told by the young girl \"No you ordered a large ...\". No sorry. No we will fix that. Just indicating I was wrong. Not one \"welcome\", \"thank you\", \"enjoy\", smile in the place.\n\nLife is too short to give my money to places that can't train the staff that the Customers are important, not an inconvenience in their day.\n\nBye Burrito Boyz...","date":"2015-08-30 15:40:23"}
{"review_id":"vK6kPY7iH23Ip2R41foLAg","user_id":"j-m430aGP_fRLk--yrn7wA","business_id":"3S471NOBFUzQY7YqCImKBQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"When we moved into the area we found this place and I used them once for a shampoo and nail trimming for my old man, Roscoe (Chihuahua mix). They were nice and affordable, I however was still going to try one more groomer in the area, before calling anywhere home. Well Roscoe had other plans, a week later he got into the trash and was covered in bbq sauce right when I was on my way out of the house. I took him back to All Dogs Go To Bev, without calling and they happily took him in and cleaned him up for me while I was out running errands with my kids. Now both of my dogs go here because it's hard to find such good customer service, especially on this side of town! Clean, affordable, good with my pets! All around win in my book.","date":"2016-06-11 23:05:43"}
{"review_id":"E7jBSQuuackyD-HrxtsAgw","user_id":"USn-E16UUM45nmOp0rWEfg","business_id":"BWWzh28StP6hkMm5L4nCAQ","stars":2.0,"useful":1,"funny":0,"cool":0,"text":"I have to say, after coming back from Korea I figured that Toronto would be able to get their pitas right. You can only imagine how excited I was to move just down the street from a pita place!\n\nTurns out it's not so hot. If I'm there I either get unfriendly service or indifferent service. It's not really the most difficult food service job in the world, so skipping on the annoyed attitude or putting on a smile shouldn't be that difficult.\n\nThe food itself is fairly bland. My pita was stale but I can forgive that if the meat isn't stale. But nope, during my multiple visits I've been greeted with super stale meat to old meat. It's really disappointing to have slightly cardboard-like meat. The pickled veg and peppers are delicious though!\n\nI will admit that I have gone on off-lunch hours. So I can understand why food may not be as fresh due to the hours I go in. But that doesn't excuse the service and I'm not too convinced  that mid-afternoon or evening food should be of that quality.\n\nI hate handing out poor reviews. I would love it if this store to try to improve themselves a bit and train their workers a bit better, as I don't think it deserves to go under.","date":"2013-08-15 16:28:10"}
{"review_id":"m4LZiLK-05TNUCtP-8Rsvw","user_id":"XmEiKBBXT9VlLHT7z6oC_g","business_id":"woXlprCuowrLJswWere3TQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Food and drinks were absolutely delicious! Service was good and prompt. The decorations were cool but the tables were so close together it was almost impossible to have a conversation. We decided not to stay for an additional drink because we couldn't talk.","date":"2017-03-15 02:50:48"}
{"review_id":"UGPLubG5lvsTEeDEs9neVg","user_id":"lvGyDFhe8Yh9yg4knY-i-w","business_id":"inLDlmy0p2ZthCYQzGZVnw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Loved the food here, portions were a little on the smaller side, but the food overall was one of the best for BBQ that we have tried. The brisket was excellent very tender and juicy and smoked just right we also got the chicken which was pretty good as well, we were a little disappointed that they didn't have beef ribs only pork because we go to BBQ places a lot and love beef ribs, maybe someday they can add them to their menu. The sides were ok but very small like I had mentioned and the Mac n cheese was a little original not much flavor. I would definitely go back maybe for takeout but the overall service was horrible the woman at the window was extremely rude to every customer and very irritated with everyone, we felt like every time we asked something we were a bother and she said you cannot even sample the sides or sauces and just the whole way she proceeded to take our order and others was with an attitude when we came up to order wings as well it was like wecouldnt even ask any questions, because she didnt want to be bothered,  poor customer service and business ownership. To add to this...the wings we tried  at the spare of the moment, garlic parmesan and they were excellent, some of the best I have had, or maybe it was the sauce?","date":"2014-06-11 17:00:43"}
{"review_id":"YfYS9n1tKwZBHcOBhX6wMQ","user_id":"n0r_0HkCFaC175vXtIVcaQ","business_id":"iTwYEwBqer2O4OkI_7Ef9A","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"I'm a local and my mom is in town. We were coming back from Hoover dam and saw this place. The place wasn't crowed and it was clean, fast and friendly place. Food was absolutely delicious and fresh. We had burgers and my mom had fried shrimp. I will be coming back! And oh prices were very good!!!","date":"2016-10-26 17:00:38"}
{"review_id":"nZSB2JTP0Ep3biP8ufi2IA","user_id":"WfbJKGJWj2yQ50XRku-OzQ","business_id":"Vg1C_1eqwIwkZLIXGMTW3g","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"This review is based more on the service rather than the food or atmosphere , we had a large group of people meeting for a going away party , and basically were just left hanging around , we had to move tables for ourselves , and when server did come by it was rushed !! I realize it's a busy place but if they know it's going to be busy shouldn't they staff more ? For those that ordered food the wait to get it was over an hour , seriously about an hour and 15 minutes !! Our server was argumentative , when we asked what the hold up was , and basically said \" do you want it or not ? Half the group cancelled their orders , the others starved , decided to wait even longer for food that was mediocre at best , The beer selection was nice and I'm sure we would have spent more ( there were some drinkers in the group that just went to bar for their cocktails ) but with no one coming by often to check for empty cocktails I only had about 2 drinks in about 2 and half hours ( usually could have doubled that , lol ) after leaving there I went to a real bar and was served promptly , all in all though there was nothing here that would make me want to come back !!","date":"2014-10-11 11:04:51"}
{"review_id":"9xwe2e2mj855Dr5VBsbJ_g","user_id":"zSl68XFwisQyr_TDXQj3ow","business_id":"tvYID0arhN-shKGUrC1Wsg","stars":3.0,"useful":0,"funny":1,"cool":0,"text":"Stacks on stacks of meat, and some super yummy pineapple! \n\nI think at one point, I was playing catch up with all the cuts of meat I had waiting for me on my plate. All of us couldn't help being a little extra gluttonous. \n\nAnd who can say no to their pineapple? \nThe second time they came around with the pineapple, to my group of 6, and we were told there were only 3 pieces left at the moment... Every man for himself! Needless to say, I wanted them all..\n\nService was meh. We initially had reservations made for 9, and didn't actually get seated until almost 9:30. \nIt wasn't even a case where they were full and couldn't accommodate - there were multiple empty tables (that seated 6). Yet, we were told to wait, as the server continued to seat others who came after us with later reservations of 9:30. \nIt wasn't until we had to press them for our reservation a 3rd time, where we finally got seated - in the corner of the restaurant beside the bar. Not impressed. Not to mention there were still empty tables in the main dining. \n\nQuality-wise for the food was much better, in comparison to their Adelaide location. Salad bar\/antipasto at this location was much smaller and bleak, but the mussels are worth mentioning. \n\nThere is also free parking available! Located behind the building, for 150 Eglinton. Just need to validate with the hostess.","date":"2015-02-02 07:57:25"}
{"review_id":"McLCs2nnktNY9WRwCA_HaQ","user_id":"haVz3V2Nux3V4c7jHOZ3jQ","business_id":"ES_4CV52Zm1Rw-fIBdIgFg","stars":3.0,"useful":0,"funny":0,"cool":0,"text":"ORIGINAL POST\nMy iphone 4s home button broke for the 2nd time in 15 months.  It is now broke again and 3 months out of warranty.  The Apple Store at the Forum Shops Senior Manager-Andrea Lettus- refused any assistance with this whatsoever.  After living the in the \"Apple World\" with ipads, iphones, and macs, I am seriously considering leaving and going in another direction.  Seriously disappointed with their service.\n\nUPDATE\nWanted to update this review from 1 star to 3.  After calling the Apple Corporate Office with my issues, another Manager with the local Apple store called me back.  He inquired about the issue and took care of it \"no questions asked\".  It was a shame I had to go to these lengths to get something done, but Apple finally did the right thing.","date":"2013-10-03 18:24:20"}
{"review_id":"cIei1tLnaw0WbHtOlP5Ong","user_id":"e5jL6i7aeAKktpZcSLyLDg","business_id":"tcnu9ivUsuQUNiz944bpOA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"I loved the original restaurant and love this new incarnation. This is much different: much more casual and much friendlier to the wallet. The food is still delicious. As a sidebar, I had a Weight Watchers friendly meal here: chicken kabob with eggplant and zucchini over beans with harissa sauce. Fantastic!! The woman told us the harissa was very spicy but I thought it was just right. We plan to eat here regularly.","date":"2018-03-03 23:36:52"}
{"review_id":"XiiEf-C7etOTGZpuDYtpNw","user_id":"1WgyoFa-Sxnu-xpmVIrHJw","business_id":"3STgMi8D-cx8LJv3Wr6_OQ","stars":1.0,"useful":5,"funny":1,"cool":1,"text":"Disgusting!\n\nwow!!\nIf rude and conceited behavior were highly valued, this place would rock the town.\nThe very strange, cold reception that I received from the 50-plus-year-old Nazi woman, who seemed to run the front counter, would offend nearly anyone who has considerable customer service skills. Five stars if nasty treatment is what you're looking for. \n\nI was immediately turned off, and would hate to give them any of my money. \nOr my plumber's money.","date":"2016-03-30 22:52:07"}
{"review_id":"SxTHMXM4p_lhbGky3ohuSA","user_id":"BcDY4RICnvFwV6wS0DBj_g","business_id":"-2ToCaDFpTNmmg3QFzxcWg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"This is an atrocity of shuttle service.  Bought roundtrip tickets from airport to hotel.  Waited about 15 minutes on the airport, which is ok considering this is a pooled shuttle.  However, the returning trip was horrible.  I waited 15 minutes, didn't see the bus, so I called and they made some excuse about the \"strip being closed\".  Seriously?  Why do I see other shuttles coming to the hotel?  The guy said the bus will be here in an hour.  I decided to take one of the other shuttles that were coming and got in their line.  About 20 minutes later, the original bus showed up.\n\nSo the shuttle was about 40 minutes late, and they some excuse that it will be 1.25 hours late.","date":"2012-12-04 17:50:29"}
{"review_id":"4e1n94RbZxVnk4ieLO3_ww","user_id":"soc2J5OHH7V6JQ7t211Icg","business_id":"k1c_bC3DK6mKg797vH1T8w","stars":3.0,"useful":1,"funny":0,"cool":0,"text":"Birthday dinner #2, first-timer for Beckett's Table, I guess I just wasn't impressed.\n\nSunday night around 7, the restaurant is about 40% full with a couple of patio tables. We were greeted warmly and taken to the table. Interesting enough, the first thing i noticed here is the deco, very contemporary american diner setting, yeah, that's how I could describe. The dinner tables and chairs are clearly divided into two colors, beige-ish or dark chocolate-ish, somehow there were no specific color match arrangement or setting, it was a bit random to me.\n\nWhile the hostess was very nice, our waitress had a I-do-not-want-to-work-on-sundays face, I think that just described enough. My entree was the butternut squash risotto. The presentation of this dish was good at a first sight, but when you look at it closely, I don't understand why the fried almost turned black brussels leaves are floating around, it was oily and tasteless. If you want to add a touch of green to the dish, maybe don't fry it as much so it would stay at green. Overall the dish was too salty for me, and a bit too rich as well....Though my friend enjoyed his shrimp and sausage dish very much.\n\nMaybe next time...","date":"2013-11-14 05:36:39"}
{"review_id":"qEzgsOsc9nsBn98eLXjrrQ","user_id":"KRDDr22pTXFcSd7VLdJWfg","business_id":"Os1n1_idfw9vv9kwULGJnQ","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Definitely the bang for your buck! Awesome Hawaiian food traditionally made and not so pricey either!","date":"2018-02-23 23:40:55"}
