{"review_id":"oMQOUxCDTHw1jk_guORnGA","user_id":"QS8hvLT-Ks3gHDZBrz8D7w","business_id":"UT6L3b7Zll_nvRidijiDSA","stars":1.0,"useful":1,"funny":2,"cool":0,"text":"My review is based on my experience with the management, not the food. The food is just ok, nothing to write home about. Secret pizza at Cosmo is better.\n\nThe manager on duty failed to do his duties when I requested him to call security to come assist me when I was being harassed by a drunk belligerent man while in line. I felt unsafe and wanted security to come but the manager NEVER CALLED them. He in fact lied to me saying that they were too busy to assist me. I spoke to security later on that night and they told me they never received a call. \n\nSHAME ON YOU manager on duty Sunday 1:30AM for lying about calling security.","date":"2015-05-26 17:38:23"}
{"review_id":"TB_mQgD7BMdZPUqeX_ovzg","user_id":"7_etBT-vLhCBJz0v6Dbsbw","business_id":"0CElIQnJdQYF2bmsAiWczg","stars":5.0,"useful":1,"funny":0,"cool":1,"text":"WONDERFUL! My family stopped by today after church. What a delightful place. Luci's had some delicious food and afterwards we went to Splurge for some delicious Gelato. It was a bit warm, Arizona Summer, the trees have misting systems as well as plenty of shade. Grass and a small splashpad. What a delightful getaway from the big city we live in.","date":"2016-07-03 20:29:42"}
