{"review_id":"BfyfaBB50XV5w5nOlosruA","user_id":"FTsRfaVbDUB6Sc6pL-J80w","business_id":"7sb2FYLS2sejZKxRYF9mtg","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Great Sushi, young crowd. This place has a California, urban vibe. They pre slice their fish so you get your food in no time and the wait isn't bad because of that. \nAYCE includes some great stuff!","date":"2017-10-11 00:45:27"}
{"review_id":"ojAGpZfi-sCHeULkExYQfg","user_id":"iH6HPgXttTI0AdJjWJkcPw","business_id":"cxsN3mkioAXuOLKy04QpyA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"Really enjoyed my experience here today. The service was fantastic. The manager made sure we had everything we needed and he had a great sense of humor.","date":"2018-09-14 04:09:23"}
{"review_id":"iCX-iiWvN22f5HVMF6ybzw","user_id":"zSFTIpXO0IRbQUcXujysnQ","business_id":"-rN57iU8KVm4uhyvtngzgg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"I keep receiving calls from 602-258-2371, even though I have asked to be taken off the call list and have never done business with Western Dental.  The most recent request to be removed was given yesterday, and I received a phone call again today ... which I again asked to be taken off their call list.  I now have the phone number blocked.  This example of administrative ineptness will prevent me from seeking out Western Dental for actual business.\n\nUpdate:  Thank you to Cynthia for the reply below.  However, I do not wish to share personal information with a company I do not and have never done business with, and the phone calls I am receiving from Western Dental ask for a different person than me.  Having spent nearly 5 years with metal train-track braces until the age of 17, I have an aversion for dentists and have not seen one in 20+ years.  I also have only owned this phone number for 4 years.  Therefore, I am confident you will not find my name or birth date within your records.   Yes, I still have all my teeth and the money my parents spent every month over those long 5 years has not gone to waste.  With my repeated requests (including twice in the last two days) to remove my phone number from Western Dental records and now that I have blocked 602-258-2371 from my phone, I do not expect to receive calls from Western Dental.  If Western Dental chooses to call from a different phone number, rather than following through with removing my phone number as promised, then I will be glad to update this post again with those calls.","date":"2017-09-20 18:39:03"}
{"review_id":"Jhk6CCEfAdMtgW-dIs35UQ","user_id":"5cNiDAQsoL5uo0ArBUajwg","business_id":"uuGlYAIvYAX1q1KhpY6dtA","stars":5.0,"useful":0,"funny":0,"cool":0,"text":"A very good experience.  They did everything well.\n\nJessica provided great service.  The wine list is large enough, good variety and fair prices.  Food was very good also; good presentation; delivered hot, big portions, and at reasonable prices.\n\nIf you stay at the Monte Carlo, there is no reason to leave the property for a steak dinner.","date":"2016-12-04 03:36:45"}
{"review_id":"lEtyFOWAzX594XaeyD-ldw","user_id":"8BjtYLi4rfZH-v23S170OA","business_id":"GfGG0Xhk7yTJTikmk3jJFg","stars":4.0,"useful":3,"funny":0,"cool":1,"text":"J'y suis aller pour notre dîner de fin d'année avec mes collègues\n\nUn superbe restaurant avec un ambiance très décontracté. La cuisine était excellente ! Les choix était intéressant également et les cuissons étaient parfaites. \n\nC'est un ''apporté votre vin'' alors un point de plus ici !\n\nUn peu cher par contre pour un midi, mais la qualité était au rendez-vous !","date":"2013-01-02 16:25:50"}
{"review_id":"5uef9byG9AgKAgYrNHI6vQ","user_id":"a3RM-zFyB0YnGydpP82zmg","business_id":"ivgKHakMYMpsV1RIjQruOQ","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"The rolls are delicious, good mango lemonades, and their country fried chicken was awesome. \nAlso got a minibucket nutter butter which was great. And we got to keep the little bucket! So cute!","date":"2014-08-11 04:26:58"}
{"review_id":"DS9Tcscok4_b3sWmhi7dmw","user_id":"eRDWzHCldd6YXypRECvHYg","business_id":"PjtX-5vSTBVyWfMREX8bRA","stars":3.0,"useful":2,"funny":1,"cool":3,"text":"They have been bought out by a group of people that want to integrate Latin food into the menu. I stopped by for gelato, and was happy with the flavors and portion size. I am curious to see what they do with the place. The name will change, but they will keep the burgers and gelato.","date":"2015-03-18 20:58:53"}
{"review_id":"VtIyTaV519by0w8_zqD3jQ","user_id":"Oqaa7omR5ttJHy3mkn1YUQ","business_id":"KWojrEKjUqHCRI5HO7pB4g","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"Loved the expansive collection of this museum. The Canadian artists, particularly the group of seven and James Wilson Morrice, were my favorite. \n\n\nThe price was a bit over the top. For the generally collection (the two two floors were shut), and the two special collections about Ai Wei Wei and David Bowie, it was 40 per person.","date":"2013-10-03 23:26:02"}
{"review_id":"CYKBzgIqmqUEKS6TOouAVA","user_id":"wN4gFGx3srNtWU-DXvZG7Q","business_id":"XZbuPXdyA0ZtTu3AzqtQhg","stars":4.0,"useful":0,"funny":0,"cool":1,"text":"We came here on a recommendation from some other foodie friends knowing we were Top Chef fans & loves Booby Flays style of cooking. It did not disappoint! I had the blue corn lobster tacos as a starter followed by the pork tenderloin, both were fantastic but I was stuffed! The serving size was HUGE for me, especially knowing I was going out later...big meals kinda make me wanna zzzzzzzz... anyways. Yum. The place is really good. The only negative, and this just my personal preference, was that it was very noisy. So if you are looking for a quiet, romantic spot for dinner? This isn't it. But go with an appetite when you do!","date":"2013-03-19 00:14:30"}
{"review_id":"aUYAOOtPwTr_gf-2wOBYgg","user_id":"ZzJrlRX0k5X2mMaMqPs-Ig","business_id":"LpJvitnw7vU5UW-3KE9kjA","stars":5.0,"useful":1,"funny":0,"cool":0,"text":"I first tried a Vosges bar after finding one at a local coffee shop in LA. I was wary at the $7 price, but the mix of dark chocolate, cinnamon and red chili was too intriguing to pass up. It pretty much rocked my world. So I did some research and discovered that there was a shop in Vegas, and wouldn't you know.. I had a trip planned already for Spring Break! \n\nVisiting the shop was the only thing on my itinerary for that weekend, and when I finally was able to drag my bro and sis there, we were in heaven. I walked off with a bagful of bars and some toffee, plus a few gifts for friends. At least 2 flavors are available for samples on the counter, but more importantly you can sample almost everything with the assistance of the staff. After my lengthy visit, I had sampled more than half of the options I think! What a great chocolate coma I had the rest of the day.  \n\nBesides the great product, what I was really impressed with was the friendly staff. I got a lot of great information and tips from the woman who helped me, and she was more than happy to give me and my family plenty of samples and suggestions. Those of you that read my reviews know how much I appreciate great service like this. And as a little epilogue, the other day I received a letter in the mail from the shop, which contained a hand-written note thanking me for my patronage and included a coupon for store and online use.  I can't wait to use it soon!","date":"2009-05-22 02:14:26"}
{"review_id":"fIaSwJBc2sqJCl4DWpSBFw","user_id":"rV6McdBorQ5xkE1yljneMQ","business_id":"tInrGCzll4k9hF34Ye1rvQ","stars":4.0,"useful":2,"funny":0,"cool":0,"text":"We partook of Chima this past Sunday at the end of restaurant week. Our first reservation choice wasn't Sunday but it was the only time we could get in. This was my first visit to Chima and my boyfriend's second visit. We arrived right at 7:30 and waited about 10 minutes before our table was ready. The restaurant was pretty easy to find and valet parking was complimentary.  We ate upstairs which I understand is less crowded than the downstairs dining area.\n\nThe restaurant was right downtown Charlotte and the decor was modern, sleek and warm. First portion of the three-course meal was the salad bar, which in my opinion is enough for a meal. I don't know if they offer that alone but it might be a good idea if they ever decide to open for lunch. It also might be appealing to those of us who can't justify spending fifty bucks there outside of restaurant week since the meal is just way too much for the average person to eat in my opinion.\n\nThe salad bar was very decadent and consisted of beef carpaccio, caprese salad, shrimp salad, a nice variety of greens, melon, soy beans, chicken salad, waldorf salad and few others items. There was also a wide variety of dressings, sauces for your meats, a couple different types of rice, three or four different soups, and bread with butter. \n\nAfter visiting the salad bar you sit down and the men come by with a variety of meats. My favorite was by far the top sirloin; second favorite was the parmesan pork tenderloin. It was pretty salty but still good. I also had the filet mignon wrapped with bacon but it was pretty fatty for a filet. I also enjoyed the flank steak and chicken. My boyfriend really enjoyed the ribs. I also had the swordfish, which I found to be a bit dry, and the lamb, which was too gamy for my liking. While we were being served the meats we had other side items being served to us. I forgot to mention the appetizer, which were doughy Parmesan rolls with a turkey dip, very good. The side items were fried bananas and some fried potato sticks, which tasted like hash browns. I personally didn't care for the fried bananas but I don't like bananas much anyway.\n\nBelieve it or not we ordered dessert. It didn't come with the meal but I wanted a little something sweet. So we ordered the crème brulee. It stole the show. We finished that off in about five minutes. Maybe the best crème brulee I have ever had. \n\nService was very good and I was pleased. I enjoyed the experience but I wouldn't go back for myself. It's just way too much food and I would rather savor one entree instead of be constantly paraded with more food while I am trying to eat what I have. I would love to go back just for the salad bar and dessert though. They had a lot of other choices for dessert as well. They don't give boxes for your leftovers either so eat up!","date":"2012-02-01 04:09:56"}
{"review_id":"aQpgz3z_U6ffHgxHt45hgg","user_id":"cv0d46AaUiU1hF_ixe-2WQ","business_id":"AtD6B83S4Mbmq0t7iDnUVA","stars":4.0,"useful":0,"funny":0,"cool":2,"text":"Oh boy! I love veggie restaurants! Especially Asian influenced.  I usually try the General Tzo Chick'N when I try out a place for the first time. Even not so good that is stomach-able ^_^. Soo delicious, lunches are priced right!  My only ding would be the soup was pretty salty. I'm a fan and will come back. They have a veggie meat ball that I'm curious about. I have a sunflower at home that has a delicious ball that tastes of cinnamon and cumin. Hard to find how to make so if soy and shiitake mushrooms are the real ingredients to what I have back home, then oh boy!!!\n\nOk the bathrooms are single and clean for the populated traffic. Staff was pleasant and checked up on us.  Can't wait to see them again :)","date":"2017-07-18 21:17:18"}
{"review_id":"T-7Tyadnevf1WbkankMJnA","user_id":"RI66qTEDRrS4-yiULLbtmA","business_id":"IMb5BpDLlSbr7yn19HhltA","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I am very surprised at the bad reviews for this place. Me & my husband have been here 3 times & have been very much satisfied with the food. We always get take out so I can't review on the service, but the hostess up front is always nice & cheerful.","date":"2011-04-21 23:58:42"}
{"review_id":"W6ckRDQh70Qy5PKX_yvN3g","user_id":"eaCznBMQy9fgl4Fe0jBtUw","business_id":"NEVA0IYbawceL6kz5v5DAw","stars":4.0,"useful":0,"funny":0,"cool":0,"text":"I was in Urbana, IL for a few days on business. I dined at two restaurants and this was one of them.\n\nThe place was rather empty, but that's because it was Halloween evening.\n\nWith that being said, the interior design is pretty cool but feels a bit cold. I had a couple of things on the menu. I had the halibut as my main dish and the california roll just for fun. I was very stuffed by the end of the evening. I liked both dishes.\n\nI think Ko Fusion needs to focus on one cuisine. It's trying to be everything to everyone. But what I had was tasty. The outside signage says 'Steak Pizza Sushi Seafood.' What the hell kinda combination is that? I'd go back if I was in town. :)","date":"2007-12-10 03:16:51"}
{"review_id":"cqFO4XKDyey3EbRxkLoDRA","user_id":"aaPzncoFcHkj-AJPQTgCxw","business_id":"PJ-VbAtIOso1dqd2frQqqg","stars":1.0,"useful":0,"funny":0,"cool":0,"text":"No matter where I am in the valley, when I'm craving donuts this is where I go because the donuts here is the best. Apple Fritters, crisp outside, soft gooey inside, donut holes that are completely covered in glaze, and their burritos are pretty delicious.\n*update* Today 09\/02\/18 I experienced the worst service ever. Male working at 530PM when I arrived, worst attitude, refused to listen to what my party and I said, placed donuts into box that we DID NOT ORDER and looked at us like NEXT? No matter the fact that I told him we dont want THOSE, he stood there and asked AND? If it were legal, I would have jumped the counter to beat his stupid ass. Told him to shove his donuts up his ass and his response HAVE A GOOD DAY.","date":"2018-09-03 02:19:42"}
{"review_id":"W3oZqg1UD3-OOVLBK4Jxdw","user_id":"dLxT3-EwXkrI9AXoW6HCGg","business_id":"LkMtMHVetws5_7QfRjPtlg","stars":4.0,"useful":1,"funny":0,"cool":0,"text":"I have to say that my experience there was really great!!! To check in was a breeze everyone there was great I do recommend that you pay the extra 20 dollars for the renovated room. The only reason I gave it 4 stars and not 5 was because every way you turned the staffed tried to sell my boyfriend and I a time share. Dinner at the sushi restaurant was great well priced and the staff was attentive. We will definitely be back especially after all the renovations are done.","date":"2014-08-10 21:23:17"}
